INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(172906, 'esMX', 'Mejor que salga de su billetera que de la mía, ¡JA!', '', 30706),
(172905, 'esMX', 'Gazlowe dijo que se encargaría de tu pago. ¡Supongo que odiaba a ese tipo más que yo!', '', 30706),
(172903, 'esMX', 'Terminemos este trabajo.', '', 30706),
(172728, 'esMX', '¡Plumas hará cortocircuito! ¡Sujétate!', '¡Plumas hará cortocircuito! ¡Sujétate!', 30706),
(172721, 'esMX', '¿Me prestas tu hilo síncrono, Delormi?', '¿Me prestas tu hilo síncrono, Delormi?', 30706),
(172671, 'esMX', '¡Por supuesto, $Ucampeón:campeona;! Aún no hemos visto todo lo que puede hacer el Corazón de Azeroth, ¡te lo aseguro!', '', 30706),
(172670, 'esMX', 'Magni, ¿crees que el Corazón de Azeroth puede volverse más fuerte?', 'Magni, ¿crees que el Corazón de Azeroth puede volverse más fuerte?', 30706),
(172622, 'esMX', '', 'Permítenos bañarnos en tu gloria, para que podamos proteger a tus hijos.', 30706),
(172621, 'esMX', '', 'Por favor, otorga tu bendición a estos instrumentos...', 30706),
(172620, 'esMX', '', 'Elune, oye mi plegaria...', 30706),
(172619, 'esMX', 'Concédenos tus dones, para que podamos proteger a tus hijos.', '', 30706),
(172618, 'esMX', 'Bendícenos con tu benevolencia.', '', 30706),
(172617, 'esMX', 'Madre Tierra, concédenos tu ayuda.', '', 30706),
(172614, 'esMX', '¿Cuál de eh\'tas lujosas construccione\' quieres visitar?', '¿Cuál de eh\'tas lujosas construccione\' quieres visitar?', 30706),
(172613, 'esMX', 'Solo baja las eh\'caleras hasta el bancal donde eh\'tán todos los santuarios y lo encontrarás.', 'Solo baja las eh\'caleras hasta el bancal donde eh\'tán todos los santuarios y lo encontrarás.', 30706),
(172612, 'esMX', '¿Una rana? Qué ridículo. Como sea, está cerca de los artesano\' en la eh\'quina noroeste.', '¿Una rana? Qué ridículo. Como sea, está cerca de los artesano\' en la eh\'quina noroeste.', 30706),
(172611, 'esMX', 'Solo baja las eh\'caleras hasta el bancal donde eh\'tán todos los santuarios y lo encontrarás.', 'Solo baja las eh\'caleras hasta el bancal donde eh\'tán todos los santuarios y lo encontrarás.', 30706),
(172610, 'esMX', 'El altar del eh\'queleto parlanchín eh\'tá al oeste de esta roca.', 'El altar del eh\'queleto parlanchín eh\'tá al oeste de esta roca.', 30706),
(172609, 'esMX', 'Mmm... Creo que eso eh\'tá cerca del Gran Sello.', 'Mmm... Creo que eso eh\'tá cerca del Gran Sello.', 30706),
(172608, 'esMX', 'Encontrarás el altar del dios felino al eh\'te de la pirámide.', 'Encontrarás el altar del dios felino al eh\'te de la pirámide.', 30706),
(172581, 'esMX', '', 'Yo te observaré lidiar con el hilo de tiempo, y así decidiré si tienes lo necesario para ser $Uun:una; sastre $Usincrónico:sincrónica;.', 30706),
(172576, 'esMX', '', 'Aguarda, ante\' de que te vayas... Creo que he deh\'cubierto cómo obtener el lente que ese terráneo usaba en los santuario\'.', 30706),
(172575, 'esMX', '', 'Eh\'tán en Kul Tiras. Tal vez puedas acompañar a los Honorable\' en su próxima incursión.', 30706),
(172574, 'esMX', '', 'Creo que sé dónde puede haber alguno\' más. Pero es un territorio muy hostil.', 30706),
(172573, 'esMX', '', 'Mientras no eh\'tabas, estuve examinando el diario para tratar de deh\'cubrir más ubicaciones de santuarios.', 30706),
(172522, 'esMX', 'El santuario de Pa\'ku está en la base de las escalera\' en el camino al Bancal de los Buh\'cadores.', 'El santuario de Pa\'ku está en la base de las escalera\' en el camino al Bancal de los Buh\'cadores.', 30706),
(172521, 'esMX', 'El santuario de Krag\'wa está en la eh\'quina noroeste de la pirámide, cerca del Bancal de los Artesano\'.', 'El santuario de Krag\'wa está en la eh\'quina noroeste de la pirámide, cerca del Bancal de los Artesano\'.', 30706),
(172520, 'esMX', 'El santuario de Kimbul eh\'tá al este de la pirámide, con vista a la selva.', 'El santuario de Kimbul eh\'tá al este de la pirámide, con vista a la selva.', 30706),
(172519, 'esMX', 'El santuario de Gonk eh\'tá en la base de las escaleras en el camino al Bancal de los Buh\'cadores.', 'El santuario de Gonk eh\'tá en la base de las escaleras en el camino al Bancal de los Buh\'cadores.', 30706),
(172518, 'esMX', 'El santuario de Bwonsamdi eh\'tá en las escalera\' en el borde occidental de la pirámide.', 'El santuario de Bwonsamdi eh\'tá en las escalera\' en el borde occidental de la pirámide.', 30706),
(172517, 'esMX', 'Hay un santuario dedicado a Akunda en las eh\'caleras al este del Gran Sello.', 'Hay un santuario dedicado a Akunda en las eh\'caleras al este del Gran Sello.', 30706),
(172516, 'esMX', '', 'Por último, debes realizar el ritual de vinculación.', 30706),
(172496, 'esMX', '¿Qué santuario te interesa?', '¿Qué santuario te interesa?', 30706),
(172489, 'esMX', 'Santuario de Pa\'ku', 'Santuario de Pa\'ku', 30706),
(172488, 'esMX', 'Santuario de Krag\'wa', 'Santuario de Krag\'wa', 30706),
(172487, 'esMX', 'Santuario de Kimbul', 'Santuario de Kimbul', 30706),
(172486, 'esMX', 'Santuario de Gonk', 'Santuario de Gonk', 30706),
(172485, 'esMX', 'Santuario de Bwonsamdi', 'Santuario de Bwonsamdi', 30706),
(172484, 'esMX', 'Santuario de Akunda', 'Santuario de Akunda', 30706),
(172483, 'esMX', 'Santuarios de los loa', 'Santuarios de los loa', 30706),
(172475, 'esMX', 'Tus pruebas aguardan. Estudia los tomos y obtén el conocimiento que buscas.', '', 30706),
(172437, 'esMX', '¡%s y $n chocaron, lo que provocó una gran erupción!', '¡%s y $n chocaron, lo que provocó una gran erupción!', 30706),
(172436, 'esMX', 'La Resonancia inestable de %s finalizó, ¡lo que provocó una gran erupción!', 'La Resonancia inestable de %s finalizó, ¡lo que provocó una gran erupción!', 30706),
(172435, 'esMX', '|TInterface\\Icons\\SPELL_SHADOW_DEATHSEMBRACE:20|t¡|cFFFF0000%s|r comienza a lanzar |cFFFF0000|Hspell:293653|h[Resonancia inestable]|h|r!', '', 30706),
(172433, 'esMX', 'Tal vez encuentres algunos que aún puedan salvarse.', '', 30706),
(172432, 'esMX', 'Te recomiendo que busques en el este. Hay unos yetis bastante feroces en torno a Cuesta Alpina a los que les gusta alimentarse con los venados del lugar.', '', 30706),
(172431, 'esMX', 'Para esa prueba, necesitas hallar una criatura herida y sanarla. Claro que eso te costará parte de tu propia fuerza vital.', '', 30706),
(172429, 'esMX', '¿Qué debo hacer con el escrito de sacrificio?', '¿Qué debo hacer con el escrito de sacrificio?', 30706),
(172428, 'esMX', 'Tus pruebas te esperan en los libros que están a mis dos lados. Elige el que prefieras.', '', 30706),
(172413, 'esMX', '¡Pagarás por tus acusaciones frívolas!', '', 30706),
(172412, 'esMX', '¿Juego sucio? ¡Qué $ugrosero:grosera;!', '', 30706),
(172411, 'esMX', '¡Esos eran mis dados buenos, salvaje!', '', 30706),
(172410, 'esMX', '¿Cómo que no lo aceptas?', '', 30706),
(172409, 'esMX', '$UBienvenido:Bienvenida; a mi tienda, $r. ¿Te guh\'taría ver algunas de las telas más finas?$b$b¿O quieres aprender a convertir eh\'tas telas en equipamiento poderoso?', '', 30706),
(172408, 'esMX', '¿Qué cuentas, $Uhermano:hermana;? ¿Quiere\' fabricar algunos artículos elegante\' de cuero?$b$bLlegah\'te al lugar ideal. Soy el mejor instructor de por aquí.', '', 30706),
(172407, 'esMX', '¿Qué cuentas, $c? ¿Buscas la forma de crear una explosión más grande que la de Silithus?$b$bHas llegado al lugar indicado. ¡Soy el goblin que puede hacer realidad todos tus sueños explosivos!$b$b¿Por qué no echas un vistazo?', '', 30706),
(172403, 'esMX', '¿Qué tal si jugamos con mis dados?', '', 30706),
(172402, 'esMX', '¡Vamos, daditos, no me fallen ahora!', '', 30706),
(172401, 'esMX', '¡Vamos, dados de la suerte! ¡Papi necesita una victoria!', '', 30706),
(172399, 'esMX', 'Has completado tu entrenamiento, ahora avanza hacia los grifos que están detrás de la nave de guerra.', 'Has completado tu entrenamiento, ahora avanza hacia los grifos que están detrás de la nave de guerra.', 30706),
(172397, 'esMX', '¡Tendremos el yunque listo para ti en un abrir y cerrar de ojos!$b$bPero... será mejor que mantengas esa información en secreto mientras lo hacemos.', '', 30706),
(172391, 'esMX', 'Has completado tu entrenamiento, ahora avanza hacia los dracoleones que están detrás de la nave de guerra.', 'Has completado tu entrenamiento, ahora avanza hacia los dracoleones que están detrás de la nave de guerra.', 30706),
(172380, 'esMX', 'Puedo sentir mucha ira y frustración entre los que están reunidos aquí hoy. En mi tierra natal, esos sentimientos se tradujeron en amenazas muy concretas después de que intentamos reprimirlos durante demasiado tiempo.\n\nBaine tuvo que actuar para evitar que su ira se convirtiera en una amenaza mayor para la Horda. \n\nDeberíamos aprender la lección.', '', 30706),
(172365, 'esMX', '', 'También me pregunto si Zukashi eh\'taba esperando que usara esas burbujas solo para verme así. Siempre tuvo su lado infantil.', 30706),
(172364, 'esMX', '', 'Puaj, creo que necesito una ducha.', 30706),
(172363, 'esMX', '', 'Bueno. Supongo que esos no eran los ingrediente\' indicados. Al menos ahora podemo\' descartar algunos, ¿verdad, $n?', 30706),
(172362, 'esMX', 'Siempre fue muy infantil, y ahora me pregunto si estaba esperando que yo usara esas burbujas solo para ver el resultado.', '', 30706),
(172361, 'esMX', 'Usar un ingrediente que dé semejante resultado es algo típico de Quintin.', '', 30706),
(172360, 'esMX', 'Bueno, si no lo logras la primera vez hay que volver a intentarlo, ¿verdad? Al menos podemos eliminar los ingredientes incorrectos de la lista.', '', 30706),
(172354, 'esMX', 'Oye, ¿qué es eso que tienes en el bolsillo?$b$b¡¿Acaso es una de mis piedras de transmutación?! Guau, ¿cuál conseguiste?$b$b<Le muestras la piedra a Silas.>$b$bJaja, sí, esa es muy divertida. Creo que hasta intenté vender la receta una vez...$b$bMuy bien, ¡espero que la disfrutes! Y no olvides recorrer mi feria. ¡Encontrarás maravillas que parecen salidas de tus sueños!', '', 30706),
(172353, 'esMX', 'Supongo... que simplemente extraño a Hati, para ser honesto. Ese muchacho tiene el corazón más noble que he conocido.', '', 30706),
(172352, 'esMX', '¡Ja, le agradamos!', '', 30706),
(172350, 'esMX', 'Tendremos que acabar con esto después, Barbabronce. ¡$p ha llegado!', '', 30706),
(172342, 'esMX', '', 'Volver a hablar con Derek después de tanto tiempo...\n\n<Jaina sacude la cabeza>\n\nTengo mucho que pensar.', 30706),
(172341, 'esMX', 'Tenemos mucho que enseñarles a los orcos de este mundo.', 'Tenemos mucho que enseñarles a los orcos de este mundo.', 30706),
(172340, 'esMX', 'Aún sueño con Draenor. ¿Mi hogar seguirá existiendo?\n\nAhhh... No sirve de nada pensar en eso.', 'Aún sueño con Draenor. ¿Mi hogar seguirá existiendo?\n\nAhhh... No sirve de nada pensar en eso.', 30706),
(172339, 'esMX', '¡Lok-tar ogar!', '¡Lok-tar ogar!', 30706),
(172338, 'esMX', 'El jefe de guerra Grito Infernal seguramente está muerto. Si es así, murió como un héroe.', 'El jefe de guerra Grito Infernal seguramente está muerto. Si es así, murió como un héroe.', 30706),
(172337, 'esMX', 'Este mundo apesta a corrupción.', 'Este mundo apesta a corrupción.', 30706),
(172336, 'esMX', '¡Estaré listo si algún traidor lazoluz se atreve a venir a este mundo!', '¡Estaré lista si algún traidor lazoluz se atreve a venir a este mundo!', 30706),
(172335, 'esMX', '¿Cuál fue el destino que enfrentaron nuestros hermanos y hermanas?', '¿Cuál fue el destino que enfrentaron nuestros hermanos y hermanas?', 30706),
(172334, 'esMX', 'La señora suprema Geya\'rah era la mano derecha del jefe de guerra. No existe orco más valiente en este mundo.', 'La señora suprema Geya\'rah era la mano derecha del jefe de guerra. No existe orco más valiente en este mundo.', 30706),
(172333, 'esMX', '', 'Es bueno volver a casa.', 30706),
(172275, 'esMX', '¿Hace mucho que estás ahí?', '', 30706),
(172274, 'esMX', '', '¿Sabes en qué momento estamos?', 30706),
(172242, 'esMX', 'Llevo tiempo observándote, $p.', '', 30706),
(172239, 'esMX', 'También entra a la arena: ¡Sir Phillip Carter Tracey!', '', 30706),
(172216, 'esMX', '', 'Por desgracia, ese es todo el tiempo del que dispongo. Debo marcharme. ¡Fue un placer conocerte!', 30706),
(172215, 'esMX', '', 'Ah, esta es una época interesante. Veamos, a juzgar por tu vestimenta debería estar en...\n\nSí, en ese período. ¡Excelente! Muy bien, mi sastre colega, si te interesa algo más que mi humilde compañía, quizás quieras ver algunas de las recetas que tengo a la venta.\n\nNo te preocupes, no te quitaré todo el oro. Me dedico principalmente al comercio de telas.', 30706),
(172198, 'esMX', '¡%s es $Uel Señor:la Señora; de Roca Negra!', '', 30706),
(172189, 'esMX', 'Yo... Guau... Eso me sacó mucha más energía de la que había imaginado. Debo descansar por un momento.', '', 30706),
(172176, 'esMX', 'Comienza el ritual.', 'Comienza el ritual.', 30706),
(172168, 'esMX', 'Y con \"los atraen\", ¡quiere decir que te devorarán si no apagas la luz!', '', 30706),
(172167, 'esMX', 'Cuidado con los tiburones ballena. Parece que las luces brillantes los atraen.', '', 30706),
(172166, 'esMX', 'Quiere decir que si hablas conmigo te daré unos artilugios fenomenales cuando tengas suficientes notas de investigación.', '', 30706),
(172165, 'esMX', 'Tu participación voluntaria en este experimento se compensará con incentivos.', '', 30706),
(172164, 'esMX', 'Es estupendo, ¿no? Por cierto, Edgar es nuestro submarino.', '', 30706),
(172163, 'esMX', 'Recibirás notas desde el casco directamente hasta tu mochila.', '', 30706),
(172162, 'esMX', 'Trae esas criaturas aquí y Edgar las investigará.', '', 30706),
(172161, 'esMX', '¿Por qué no puedes decir \"que brillan\" como una persona normal?', '', 30706),
(172160, 'esMX', 'Hemos identificado tres especies distintas de criaturas luminescentes en las cercanías.', '', 30706),
(172158, 'esMX', 'Está muerto. ¿Dónde está mi dinero?', 'Está muerto. ¿Dónde está mi dinero?', 30706),
(172157, 'esMX', 'No es más que una mancha en el desierto. Una mancha diminuta. Un conjunto de pedacitos microscópicos desperdigados por la arena. Está 100% muerto. Me quemé mucho la piel buscando todas las partes. Y cuando las encontré, las volví a hacer estallar. Sí. Está muerto. Muertísimo.', 'No es más que una mancha en el desierto. Una mancha diminuta. Un conjunto de pedacitos microscópicos desperdigados por la arena. Está 100% muerto. Me quemé mucho la piel buscando todas las partes. Y cuando las encontré, las volví a hacer estallar. Sí. Está muerto. Muertísimo.', 30706),
(172156, 'esMX', '¡Eso quería oír! Un placer hacer negocios contigo, $p.', '', 30706),
(172155, 'esMX', '¡Ey! ¡$N!\n¿Te ocupaste de esa pésima inversión, Grizzek Llavesilbo?\n\n¡Cuéntame hasta el último detalle! ¡Vamos, habla!', '', 30706),
(172154, 'esMX', '¡Dile que corra si se acerca mucho!', '', 30706),
(172153, 'esMX', '¡Nunca te metas en ingeniería política! ¡Jamás!', '', 30706),
(172152, 'esMX', 'Y, eh, ¿dale las gracias a Gazlowe de mi parte? Le debo una, así que se la pagaré con un consejo. Dáselo de mi parte.', '', 30706),
(172151, 'esMX', '', 'Recuerda, ¡nunca nos viste!', 30706),
(172150, 'esMX', '¡Hola, Saffy!', '', 30706),
(172149, 'esMX', 'Tiempo para alcanzar el objetivo: aproximadamente veinte segundos.', '', 30706),
(172148, 'esMX', 'Señal reestablecida.', '', 30706),
(172147, 'esMX', 'Señal interrumpida. Error 37. Compensando.', '', 30706),
(172146, 'esMX', 'Intentando compensar.', '', 30706),
(172145, 'esMX', 'Degradación de señal. Disturbios atmosféricos detectados.', '', 30706),
(172144, 'esMX', '¡Ey! ¡$p! ¡Por aquí!', '', 30706),
(172143, 'esMX', '¡Recuerda, pagaré el doble!', '', 30706),
(172139, 'esMX', '¡Ja ja ja ja JA JA JA JA!', '', 30706),
(172134, 'esMX', '¡Muy bien, chicos! ¡Nuestra inversión rindió frutos! Busquemos nuestro próximo éxito.', '', 30706),
(172130, 'esMX', 'Bien, chicos, ¡nos pagaron! Yo invito la primera ronda.', '', 30706),
(172100, 'esMX', 'Jo\'nok responde al llamado de la reina de los zandalari.\n\n¿Qué quieres, criatura?', '', 30706),
(172099, 'esMX', '¡Mira cuántos tomos hay! ¡Y pergaminos! ¡Y libros!\n\nSabía que los zandalari eran sofisticados, ¡pero me llevaría décadas leer todo esto!\n\nEl viejo Torga tenía razón, como siempre. De las aventuras extrañas nacen las mejores historias.\n\n¡Muero de ganas de saber cómo sigue esto!', '', 30706),
(172098, 'esMX', '', '<La guardia de espadas Kaja conversa muy concentrada con la general Rakera.>', 30706),
(172097, 'esMX', '', '<La general Rakera conversa muy concentrada con la guardia de espadas Kaja.>', 30706),
(172096, 'esMX', 'Soplan vientos de cambio\'. ¿No lo sientes en el aire?', '', 30706),
(172095, 'esMX', '', '¡Ah, $n!\n\nMientras la reina Talanji se rompe los cuerno\' restaurando nuestro imperio, el Concilio zanchuli tiene la tarea de garantizar que los fiele\' a Zandalar le den el tiempo que necesite.\n\nAún hay quienes dudan de ella en el sacerdocio, pero pronto se darán cuenta de que Talanji es una líder digna. Yo ya lo sé.', 30706),
(172094, 'esMX', '', 'Que la luz de los loa te ilumine, $n.', 30706),
(172093, 'esMX', '', 'Como diría me padre, e\' bueno ser la reina.\n\nNo hay día que no lo eche de menos. Siempre me pregunté cómo iba a hacer para estar a la altura del ejemplo que me dio. Ahora, empiezo a comprender que incluso los más ancianos y sabios entre nosotros no pueden prever todo lo que ocurrirá. Ni siquiera un profeta como Zul.\n\nNos espera un camino desconocido, pero los zandalari se alzarán y afrontarán los cambios que vendrán.\n\nEso lo sé con seguridad.', 30706),
(172088, 'esMX', 'Sé que mi hermana no me asignó esta tarea me quede aquí tomándome toda la cerveza de Ventormenta.\n\nPronto, muy pronto, atacaremos a la Horda. El mar nos convoca, como siempre.', '', 30706),
(172087, 'esMX', 'Sí, $n.\n\nEsta ciudad tiene una artillería hermosa. Con razón aguantó tanto. \n\nMe recuerda a mi hogar, sí.', '', 30706),
(172086, 'esMX', '', 'Solo espero que no nos dejen aquí de adorno, $n.\n\nTengo unos arpones con el nombre de nuestros amigos de la Horda.', 30706),
(172084, 'esMX', '¡Hola de vuelta, $n!\n\nEsperaba que pasaras por aquí. Todo está muy tranquilo por aquí sin Doriana.\n\nAh, no me malinterpretes, me gusta disfrutar de un poco de paz. Y si me apetece hablar, siempre puedo visitar Presabrenna. De todos modos, mi mujer nunca fue de charlar mucho.\n\nDijo que me visitaría pronto. Eso será lindo.\n\n<Sal tararea contento y regresa a su jardinería.>', '', 30706),
(172082, 'esMX', 'En otros tiempos, los maresabios debían navegar por el mundo. Estoy ansioso por ver a dónde nos llevarán estas nuevas corrientes extrañas.', '', 30706),
(172081, 'esMX', '', 'Thomas Zelling tiene… tenía… una familia en vida. Me obligó a prometerle que los mantendría a salvo, incluso después de que lo llamaron monstruo y lo abandonaron por ser un no-muerto. Es una promesa que nunca dejaré de cumplir.\n\nSi alguna vez preguntan cómo murió, diré que murió como un héroe.\nNosotros, los Renegados, poseemos libre albedrío. Eso es lo que nos distingue de la Plaga. Sylvanas Brisaveloz se enorgullecía de esta diferencia. \n\nPero después de todo lo que he visto en esta guerra, me pregunto si realmente sigue siendo así.', 30706),
(172080, 'esMX', 'Hace muchos años, Tirion Vadín sacrificó todo para salvarme la vida en un acto de honor. Baine ha actuado de la misma forma. ¿Ahora vamos a castigarlo por eso?\n\nTemo que la Horda se esté convirtiendo en aquello que solíamos odiar, $c. Y no me gusta nada.', '', 30706),
(172079, 'esMX', '', '¿Vieron lo que le sucedió a Baine? ¿A Zelling? Es por eso que necesitamos mantener un perfil bajo, no llamar la atención y seguir las órdenes de la jefa de guerra. Al menos por ahora.\n\nEl error de Baine no fue desobedecer a Sylvanas, fue actuar demasiado pronto.', 30706),
(172078, 'esMX', 'Hay otras personas que deben escuchar esto, $n. \n\nY así será.', '', 30706),
(172077, 'esMX', '', '¿Esos son los ideales que defiende la Horda? ¿Encarcelar a quienes actúan con honor y compasión?\n\nTal vez nunca debería haber abandonado Altamontaña con mi pueblo…', 30706),
(172076, 'esMX', '', 'Nuestra rebelión contra Elisande fue justa, y mi espalda pagó el precio con una herida. Espero que Baine no corra la misma suerte.\n\nLos natonocturno son muy nuevos en la Horda. Quizás debería acudir a Lor\'themar. Él comprende lo que sufrió mi pueblo, y nuestras conversaciones me han enseñado mucho.', 30706),
(172075, 'esMX', '', 'No será una orco, pero la jefa de guerra demuestra su fuerza castigando a los tauren que la engañaron y traicionaron. \n\nAquellos que carecen de lealtad también carecen de honor.', 30706),
(172074, 'esMX', '', 'Sin la Horda de nuestro lado, mi pueblo estaría a merced de la Alianza. Le debemo\' mucho a la jefa de guerra… pero no la seguiremo\' ciegamente. \n\nBaine Pezuña de Sangre ha demostrado honor y respeto por los zandalari. Debemo\' darle la oportunidad de enfrentar a sus acusadores y responder por su supuesto crimen.', 30706),
(172073, 'esMX', 'Eh\'to es un juju muy malo, colega. La Horda no puede separarse si pretende ganar eh\'ta guerra… pero Sylvanas… no nos la deja fácil. \n\nY eh\'to será como echar leña al fuego.', '', 30706),
(172072, 'esMX', 'No puedo culpar a Baine por lo que sentía, incluso aunque sus acciones hayan sido drásticas. A través de su acto de resistencia expuso una grieta que crece en la Horda desde el ataque a Teldrassil.\n\nTemo que al oponerse a Sylvanas abiertamente haya puesto en peligro a su propio pueblo. El mismo peligro en el que estaría mi pueblo si decidiera aliarme con él.\n\nEstos tiempos que corren son difíciles. Debemos ser precavidos… y prudentes.', '', 30706),
(172071, 'esMX', 'Bueno, ¡eso no me lo esperaba! \n\nOjalá hubiese sabido cómo terminaría la situación. ¡Podría haber cobrado la entrada el DOBLE!', '', 30706),
(172051, 'esMX', '', '¡Cuida de Plumas, $p!', 30706),
(172050, 'esMX', 'Cierto, tienes razón. Todo listo, amiguita. Partiremos cuando tú digas.', '', 30706),
(172049, 'esMX', '', 'Deberíamos irnos, en serio. ¡Los matones de Gallywix podrían encontrarnos en cualquier momento!', 30706),
(172048, 'esMX', 'Ey, gracias por no delatarme con Gallywix.', '', 30706),
(172047, 'esMX', '', 'Estaremos en contacto. A lo mejor. Quizás.', 30706),
(172046, 'esMX', 'Hola, $Uricachón:ricachona;.\n\nJani no le quitará el ojo de encima a esta nueva reina. Sus seguidores jamás me adorarían, pero donde el oro brilla, siempre hay basura oculta cerca.\n\nAquellos que Talanji abandone me encontrarán, tarde o temprano.\n\nHasta entonces, $Uricachón:ricachona;', '', 30706),
(172043, 'esMX', '¡Error 37! ¡Error 37! ¡Reiniciar sistema!', '¡Error 37! ¡Error 37! ¡Reiniciar sistema!', 30706),
(172042, 'esMX', '¡Sobrecarga de sistema! ¡Borrar datos!', '¡Sobrecarga de sistema! ¡Borrar datos!', 30706),
(172041, 'esMX', '¡Se requiere una acción! ¡Pulsa cualquier tecla!', '¡Se requiere una acción! ¡Pulsa cualquier tecla!', 30706),
(172020, 'esMX', 'Llévame a casa.', 'Llévame a casa.', 30706),
(172019, 'esMX', '', 'Ah, perdóname… Necesito recuperar fuerzas.', 30706),
(172018, 'esMX', 'Déjame intentarlo de nuevo.', 'Déjame intentarlo de nuevo.', 30706),
