(171869, 'esMX', 'Estas son todas las ubicaciones a las que puedes teletransportarte de forma segura.', '', 30706),
(171868, 'esMX', 'Quisiera saber a dónde puedes llevarme.', 'Quisiera saber a dónde puedes llevarme.', 30706),
(171867, 'esMX', '¿Cuál es tu voluntad?', '', 30706),
(171863, 'esMX', 'Volveré más tarde.', 'Volveré más tarde.', 30706),
(171849, 'esMX', 'Escucharon a la rata. A $Uél:ella;, muchachos.', '', 30706),
(171848, 'esMX', '¡Lih\'to! Aquí tienes.', '', 30706),
(171847, 'esMX', '¡Lo haré en un abrir y cerrar de ojo\', $n!', '', 30706),
(171846, 'esMX', '¿Has encontrado otro capítulo? Tienes suerte, aún no devolví esos libro\'.', '', 30706),
(171843, 'esMX', 'Comprar los pellejos raros de Sheza a cambio de:', 'Comprar los pellejos raros de Sheza a cambio de:', 30706),
(171842, 'esMX', 'Sheza dijo que querías 1,000.', 'Sheza dijo que querías 1,000.', 30706),
(171841, 'esMX', '', '… y ahora, a grabar las runas de poder en los huesos.', 30706),
(171840, 'esMX', '', 'Mmm… Estas escamas aún tienen un poco de carne. Con un baño de lima quedarán impecables.', 30706),
(171839, 'esMX', 'Lo pedí con educación.', 'Lo pedí con educación.', 30706),
(171838, 'esMX', 'Quizás las manos de la Horda estén manchadas de sangre, pero no tiene sentido lavarlas hasta destruir a la Alianza.', '', 30706),
(171810, 'esMX', '', 'Empezaré a remojarlos para que estén listos cuando los necesitemos.', 30706),
(171807, 'esMX', '', 'Jamás olvides Teldrassil, $Uamigo:amiga;.$b$bHaremos que la Horda pague los estragos que ha causado.$b$bY no toques la bebida de Gubia. Podría llegar a romperte una mano... si tienes suerte.', 30706),
(171802, 'esMX', '', '$UBienvenido:Bienvenida; a mi tienda, $c.$b$b¿Te interesan mis productos o quisieras aprender a cortar las gemas tú $Umismo:misma;?', 30706),
(171801, 'esMX', 'Aquí tiene\', $n. La traducción de tu diario... Realmente apasionante, para serte sincero.', '', 30706),
(171800, 'esMX', '¿Sí? ¡Sí! ¡Eso es! Bien, ¿dónde eh\'tán mis libros...? Ah, aquí hay uno.', '', 30706),
(171799, 'esMX', '¡AH! Así que eh\'ta runa significa ESO. Muy interesante...', '', 30706),
(171798, 'esMX', '¿Los has encontrado? ¡Excelente trabajo, $n! Ahora, hay que traducir eh\'te diario.', '', 30706),
(171797, 'esMX', 'Hola, te doy la bienvenida. ¡Me dedico al comercio de productos exóticos del lejano norte!$b$bVen, ¡echa un vistazo!', '', 30706),
(171796, 'esMX', '', 'Aquí tienes. Ten cuidado con él, es bastante antiguo.', 30706),
(171795, 'esMX', '', '¡Aquí está!', 30706),
(171794, 'esMX', '', 'Ah, sí, creo que está por aquí, en algún lado...', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(171758, 'esMX', 'La cría de Torcali te acaricia con el hocico cariñosamente.', '', 30706),
(171757, 'esMX', 'La cría de Torcali apoya con fuerza sus fauces en tu mano y gruñe alegremente.', '', 30706),
(171756, 'esMX', '¡La cría de Torcali mastica la fruta con entusiasmo!', '', 30706),
(171755, 'esMX', '<Acaricia a la cuernoatroz.>', '<Acaricia a la cuernoatroz.>', 30706),
(171754, 'esMX', '<Ofrecer |TINTERFACE\\ICONS\\INV_MISC_FOOD_106_FJORDPEACH.BLP:16|t |Hitem:167553:0:0:0:0:0:0:0:0:0|h|cFFFFFFFF[Mango jugoso]|h|r>', '<Ofrecer |TINTERFACE\\ICONS\\INV_MISC_FOOD_106_FJORDPEACH.BLP:16|t |Hitem:167553:0:0:0:0:0:0:0:0:0|h|cFFFFFFFF[Mango jugoso]|h|r>', 30706),
(171753, 'esMX', '<Toma la fruta.>', '<Toma la fruta.>', 30706),
(171752, 'esMX', '', 'A mi loa no le importan los templo\' relucientes y las efigies brillantes. Nos han dicho que todo Zandalar es su templo y que todos lo\' que caminan en el mundo están bajo su cuidado. \n\nLa Gran Madre, la errante, la montaña andante, el baluarte, son todos nombre\' por los que se la conoce. Soy una humilde servidora de la loa del botín y es mi deseo ver crecer a eh\'ta pequeña cría.\n\nEspero que tú y yo podamos trabajar $Ujuntos:juntas; para lograrlo, ¿qué dices?', 30706),
(171751, 'esMX', '', 'Las criaturas pequeña\' como la que tienes normalmente se crían con sus hermano\' y primos rodeados de parientes en un un campo amplio.\n\nComprendo por qué está sola, pero quizás podamo\' hacer algo más para ayudarla a sentirse mejor.\n\nRecogí unas frutas jugosas mientras venía de la ciudad eh\'ta mañana. \n\nQuizás eso la alegre.', 30706),
(171748, 'esMX', '¿Quieren matarme? ¡Ustedes primero!', '', 30706),
(171747, 'esMX', '¡Anar\'alah belore!', '', 30706),
(171746, 'esMX', 'No están hechos para esto.', '', 30706),
(171745, 'esMX', 'Les ha sonreído... la fortuna.', '', 30706),
(171744, 'esMX', '¡Una muerte gloriosa!', '', 30706),
(171743, 'esMX', 'Un esfuerzo admirable.', '', 30706),
(171742, 'esMX', '¿Quieren ponerme a prueba?', '', 30706),
(171741, 'esMX', 'Mientras escudriñas los restos, encuentras lo que parece ser una especie de núcleo partido en dos, con varias piezas pequeñas que parecen partes de la joya que buscas.$b$bParece que la persona que hizo estos ensamblajes usaba la misma joya de la que estaba hecho el santuario.', '', 30706),
(171740, 'esMX', '<Ofrecer |TINTERFACE\\ICONS\\INV_RaptorBaby_red.blp:16|t |Hitem:167553:0:0:0:0:0:0:0:0:0|h|cFFFFFFFF[Raptor chillón]|h|r>', '<La cría de Torcali brinca alegremente al ver al raptor chillón.>', 30706),
(171739, 'esMX', '<La cría de Torcali brinca alegremente al ver al raptor chillón.>', '', 30706),
(171735, 'esMX', '1,250 de oro.$b$bÚltima oportunidad, $r. ¿Qué será?$b$b¿Quieres hacer negocios o te irás de aquí en un ataúd?', '', 30706),
(171734, 'esMX', 'Recogiendo', 'Recogiendo', 30706),
(171733, 'esMX', '', 'Oh, no, no, no. ¡Ese no es un buen ejemplo para los jovencitos!', 30706),
(171732, 'esMX', '', 'Mmm. He visto peores... pero estoy segura de que puedes hacerlo mejor.', 30706),
(171729, 'esMX', '', 'Tu trabajo ha cautivado a los niños. ¡Mira cómo les brillan los ojitos!', 30706),
(171724, 'esMX', '', '¡Un trabajo espléndido! Sabes, si esto de las aventuras no funciona, podrías ser $Uun excelente maestro:una excelente maestra;.', 30706),
(171722, 'esMX', '', 'Antes de que un joven tortollano inscriba su primer pergamino, debe practicar las formas básicas. ¿Puedes mostrarles a estos pequeños cómo se hace?', 30706),
(171721, 'esMX', '', '¡Otra tortuga llegó al agua!', 30706),
(171720, 'esMX', '', 'Todas las criaturas de la naturaleza deben convivir en armonía. ¡Pero no puedo evitarlo, tengo que alentar por las tortuguitas!', 30706),
(171719, 'esMX', '', '¡Estos cangrejitos necesitan ayuda! Detesto ver sufrir a un ser vivo. ¿Nos darías una mano?', 30706),
(171718, 'esMX', 'Comprar los pellejos raros de Telonis a cambio de:', 'Comprar los pellejos raros de Telonis a cambio de:', 30706),
(171717, 'esMX', '', 'Estará ansiosa por verte de nuevo en la mañana. Intenta no decepcionarla, ¿de acuerdo?', 30706),
(171716, 'esMX', '', 'No te preocupe\', este no es otro sueño encantado.', 30706),
(171715, 'esMX', '', 'Estaré aquí si tienes preguntas, aunque deberás encargarte tú $Usolo:sola; de criar a esta pequeñita.', 30706),
(171714, 'esMX', '', 'He venido a asegurarme de que estés cuidando bien a la cría de mi loa.', 30706),
(171713, 'esMX', '', 'Saludos, $n. Soy Li\'zal, la sacerdotisa de Torcali.', 30706),
(171712, 'esMX', '', 'Me preguntaba si la gran errante intervendría.', 30706),
(171711, 'esMX', '¡Es una estafa!', '¡Es una estafa!', 30706),
(171710, 'esMX', 'Perfecto, los compraré.', 'Perfecto, los compraré.', 30706),
(171709, 'esMX', 'Lamento que lo veas de esa forma.$b$bMuchachos, traten de no hacer un desastre. No quiero tener que volver a mudarme.', '', 30706),
(171708, 'esMX', '¡Bien, muchachos! Hemos terminado aquí.$b$b¡Vayamos con el mejor vendedor de porquerías para celebrar nuestra buena fortuna!', '', 30706),
(171707, 'esMX', '\"Por las malas\".', '\"Por las malas\".', 30706),
(171706, 'esMX', 'Bien, ¿cuánto por ellos?', 'Bien, ¿cuánto por ellos?', 30706),
(171705, 'esMX', 'Hmm. Cuánta ferocidad.$b$bPareces $Uun:una; $r agradable, así que te daré otra oportunidad. Piensa bien tu respuesta.$b$bMis muchachos ansían una buena pelea, y no vale la pena morir por esto.$b$b¿Cómo quieres que lo hagamos?', '', 30706),
(171704, 'esMX', 'Entrégame las pieles o habrá menos ladrones en el mundo.', 'Entrégame las pieles o habrá menos ladrones en el mundo.', 30706),
(171703, 'esMX', '¡Fantástico! Le dije a esta bola de ineptos que aún quedaban personas buenas y decentes en el mundo.$b$b<Toma tu dinero y te entrega una pequeña llave de plata.>$b$bUn verdadero placer hacer negocios con usted, $ubuen hombre:señorita;.$b$bEspero que todos sus emprendimientos resulten tan sencillos y fructíferos como este.', '', 30706),
(171702, 'esMX', '¡Ahhh! ¡Esto SÍ me gusta! Alguien que comprende las prácticas comerciales y está $Udispuesto:dispuesta; a actuar como $utodo un caballero:toda una dama;.$b$bConsideré aumentar los precios por todo el alboroto, pero dado que estás siendo tan... $Udiplomático:diplomática;, tendré la amabilidad de reducir un poco el costo.$b$b1,250 de oro. Si te alcanza el dinero, te llevarás unas pieles invaluables y nosotros nos marcharemos alegremente.$b$b¿Qué dices?', '', 30706),
(171701, 'esMX', 'No hay necesidad de ponernos violentos. Solo quiero comprar las pieles.', 'No hay necesidad de ponernos violentos. Solo quiero comprar las pieles.', 30706),
(171692, 'esMX', 'Buen día $Uquerido amigo:querida amiga;.$b$b¿Te interesa una colección de cueros finos?$b$bMuy accesibles. Es casi un robo.', '', 30706),
(171686, 'esMX', 'Me encantaría seguir escuchando la historia, pero realmente necesito el códice, tengo un poco de prisa.', 'Me encantaría seguir escuchando la historia, pero realmente necesito el códice, estoy con un poco de prisa.', 30706),
(171685, 'esMX', '¡Así es! La naga luego se le acercó y le preguntó cómo se sentía. ¿Y sabes lo que le respondió él? \n\n<Toopa saca el libro y hojea las páginas. Se aclara la garganta y empieza a recitar un pasaje.>\n\n\"Por un momento, pensé que me habían rescatado, pero al observar esos ojos tuyos, siento que aún sigo perdido en el mar\". ¡Y ella también empezó a coquetearle!\n\nUna naga y un humano, conversando e intercambiando zalamerías. Es por cosas como esta que la ficción es tan divertida, ¿no crees?', '', 30706),
(171684, 'esMX', '¡Es una locura! ¡¿Una naga?!', '¡Es una locura! ¡¿Una naga?!', 30706),
(171679, 'esMX', 'Más tarde, se despierta en la costa de una isla bastante grande. Sus heridas están cubiertas con algas marinas y a unos pocos metros se oye el canto de una voz maravillosa. \n\nCuando levantó la mirada para ver quién era, contempló algo que pensó que jamás sucedería en la vida real: ¡era una naga!', '', 30706),
(171678, 'esMX', 'Ah, ¿y qué sucede después?', 'Ah, ¿y qué sucede después?', 30706),
(171677, 'esMX', 'Muy interesante, ¿pero qué hay del códice...?', 'Muy interesante, ¿pero qué hay del códice...?', 30706),
(171676, 'esMX', 'La historia comienza cuando a Marcus lo capturan unos piratas. Después de un tiempo, logra persuadirlos de que lo dejen marcharse. \n\nEn el camino, ¡un kraken ataca el bote! \n\nDespués de una larga pelea y algunos vocablos que harían sonrojar hasta al más grosero de los piratas, ¡el barco se hunde y Marcus termina en el fondo del mar!', '', 30706),
(171674, 'esMX', '¡Pobres necios!', '', 30706),
(171673, 'esMX', 'Mis mascotas fracasaron. Quizás haga falta otra demostración.', '', 30706),
(171672, 'esMX', '¡Una muestra... sólo una pequeña muestra... del poder del Tejehechizos!', '', 30706),
(171671, 'esMX', 'Demasiada energía inestable... ¡pero destruirte vale el riesgo!', '', 30706),
(171670, 'esMX', '¡Si tan solo comprendieras!', '', 30706),
(171669, 'esMX', '¿Ahora lo ves? ¿No?', '', 30706),
(171668, 'esMX', 'Desafortunado, pero necesario.', '', 30706),
(171667, 'esMX', 'Todo lo que hice... fue por Azeroth…', '', 30706),
(171666, 'esMX', '¡Ajá! Esperaba que llegaran hasta aquí. Prepárense para un combate de verdad.', '', 30706),
(171665, 'esMX', 'Bien... hecho, je. Pero me pregunto si serían tan buenos como para... vencerlo.', '', 30706),
(171664, 'esMX', 'Métanse con el toro...', '', 30706),
(171663, 'esMX', '¡Abajo!', '', 30706),
(171662, 'esMX', '¡Levántate! ¡Blandengue!', '', 30706),
(171661, 'esMX', '¿Qué tal ESTO?', '', 30706),
(171660, 'esMX', '¡VAMOS!', '', 30706),
(171659, 'esMX', 'Parece que voy a tener que hacerlo yo. ¡Bien!', '', 30706),
(171657, 'esMX', '', '¡Levántate, mi campeón!', 30706),
(171656, 'esMX', '¡Solo estoy calentando!', '', 30706),
(171655, 'esMX', '¡Resistan y luchen!', '', 30706),
(171654, 'esMX', '¡Muéstrenme lo qué tienen!', '', 30706),
(171653, 'esMX', '¡No tengan piedad!', '', 30706),
(171652, 'esMX', 'Una muerte... con honor.', '', 30706),
(171651, 'esMX', 'Un barrido con pierna... ¿Tienen algún problema con eso?', '', 30706),
(171650, 'esMX', 'Deberías haberte quedado en casa.', '', 30706),
(171646, 'esMX', 'Todos tenemos nuestros demonios...', '', 30706),
(171645, 'esMX', '¡No tengo igual!', '', 30706),
(171644, 'esMX', '¡Muere, mortal!', '', 30706),
(171643, 'esMX', '¡Sí... sí!', '', 30706),
(171642, 'esMX', '¡Matar, matar!', '', 30706),
(171641, 'esMX', '¡Eso, sí!', '', 30706),
(171640, 'esMX', '¿Quién es el amo ahora?', '', 30706),
(171639, 'esMX', '¡No pueden matarme, tontos! ¡Volveré! Vol...', '', 30706),
(171638, 'esMX', '¡No necesito huesos para ganarte!', '', 30706),
(171637, 'esMX', '¡Mi piel putrefacta me estorbaba!', '', 30706),
(171636, 'esMX', '¡No! No debo fallar... de nuevo…', '', 30706),
(171635, 'esMX', 'Qué desperdicio de carne.', '', 30706),
(171634, 'esMX', '¡Esta farsa se termina ahora!', '', 30706),
(171633, 'esMX', 'Patético.', '', 30706),
(171632, 'esMX', 'Arruinaste mi entrada triunfal, rata.', '', 30706),
(171631, 'esMX', '¿Realmente pensaron que un agente del Rey Exánime podía llegar a perder en este torneíto patético?', '', 30706),
(171630, 'esMX', 'He venido a terminar mi tarea.', '', 30706),
(171629, 'esMX', '¡Defiéndete, de mucho que te valdrá!', '', 30706),
(171628, 'esMX', '¡La carne... es... débil!', '', 30706),
(171627, 'esMX', '¡Demuestra tu poderío!', '', 30706),
(171626, 'esMX', '¡GRAAAAAH! ¡Observa la furia de hierro y acero!', '', 30706),
(171625, 'esMX', 'Así concluye tu maldición.', '', 30706),
(171624, 'esMX', 'Bolvin umyol marnjar.', '', 30706),
(171623, 'esMX', '¡Soy el mayor de los hijos de mi padre! ¡Te ha llegado el fin!', '', 30706),
(171622, 'esMX', '¿Cómo es... posible? ¡La carne no es más... fuerte!', '', 30706),
(171621, 'esMX', '¡Asaré tu carne!', '', 30706),
(171620, 'esMX', '¡Sangra para mí!', '', 30706),
(171619, 'esMX', 'Los otros... me... vengarán...', '', 30706),
(171618, 'esMX', 'Débil.', '', 30706),
(171617, 'esMX', 'Ese no habrá de morir solo.', '', 30706),
(171616, 'esMX', '¡Animalidad!', '', 30706),
(171614, 'esMX', '¡Siente mi furia!', '', 30706),
(171613, 'esMX', '¡Ven! ¡Tu carne y huesos alimentarán a mis animales!', '', 30706),
(171612, 'esMX', '¡Falla! ¡Te vengaré! ¡Va a correr SANGRE!', '', 30706),
(171611, 'esMX', 'Ira interminable... Enfrenten la furia del lobo.', '', 30706),
(171610, 'esMX', '', 'Hay que tener agallas para desafiar a la señora de las ilusiones. ¿Y bien? ¡Deslúmbrenme!', 30706),
(171609, 'esMX', '', '¿Se sienten un poco... mareados?', 30706),
(171608, 'esMX', '', 'Ay. Intenta no sangrar en la alfombra, cariño.', 30706),
(171607, 'esMX', '', '¡Polvo eres y en polvo te convertirás!', 30706),
(171606, 'esMX', '', '¡Que les vaya mejor la próxima vez!', 30706),
(171605, 'esMX', '', '¡Vengan a probar suerte! Ja, ja, jaaa…', 30706),
(171604, 'esMX', '', 'Aah... ¿la muerte... duele? Increíble...', 30706),
(171603, 'esMX', '', '¡Esbirros, hijos del Rompemundos, vengan a mí! ¡Las salas santificadas de nuestro padre han sido contaminadas! ¡Maten a los intrusos!', 30706),
(171602, 'esMX', '', 'Tras mi muerte, habrá infinitas más. El peso está en tus hombros ahora.', 30706),
(171601, 'esMX', '', 'Un sacrificio para usted, amo.', 30706),
(171600, 'esMX', '', '¡Siente el poder de Alamuerte en mí! ¡La furia de la tierra!', 30706),
(171599, 'esMX', '', '¡El mundo renacerá en llamas!', 30706),
(171597, 'esMX', '¡Formen filas! ¡A la carga!', '', 30706),
(171596, 'esMX', '¡Mi presa jamás escapa!', '', 30706),
(171595, 'esMX', 'Ahora… el cazado… soy yo.', '', 30706),
(171593, 'esMX', '¡Bien, bien! ¡Otro grupo de ladrones que intenta robarse mi caballo!', '', 30706),
(171591, 'esMX', '¡Cabalgamos, Medianoche! ¡A la victoria!', '', 30706),
(171590, 'esMX', 'Ah, fiel Medianoche. Por muchos años nuestras incontables cacerías han provisto una mesa abundante para el amo.', '', 30706),
(171589, 'esMX', 'Hoy en día cazamos por deporte... ¡y por la gloria de la matanza!', '', 30706),
(171588, 'esMX', '¡Mi colección de trofeos crece!', '', 30706),
(171587, 'esMX', '¡Presa fácil!', '', 30706),
(171585, 'esMX', '¡No tenían ninguna oportunidad! ¡Vivo para matar!', '', 30706),
(171584, 'esMX', '¡Quédate quieto y mira fijamente la luz!', '', 30706),
(171583, 'esMX', '¡Que las nubes tormentosas se eleven y que llueva muerte desde los cielos!', '', 30706),
(171582, 'esMX', '¡JA!', '', 30706),
(171581, 'esMX', '¡Una muerte piadosa!', '', 30706),
(171580, 'esMX', '¡Te arrojas de cabeza en las fauces de la locura!', '', 30706),
(171579, 'esMX', 'El poder de la tormenta vivirá por siempre.', '', 30706),
(171578, 'esMX', '¡Esta sesión de la Asamblea de Hierro se levanta!', '', 30706),
(171577, 'esMX', 'Ya sean los mayores mequetrefes o los mayores héroes del mundo, siguen siendo mortales.', '', 30706),
(171576, 'esMX', '¡No he acabado aún! Aún tengo un par de ases bajo la manga...', '', 30706),
(171575, 'esMX', '¡No me atormenten más!', '', 30706),
(171574, 'esMX', '¡Quiero que se acabe esta pesadilla!', '', 30706),
(171573, 'esMX', '¡De vuelta a la fría oscuridad con ustedes!', '', 30706),
(171572, 'esMX', '¡Ardan, monstruos infernales!', '', 30706),
(171571, 'esMX', '¡Les mostraré que este perro maltrecho aún tiene dientes!', '', 30706),
(171570, 'esMX', 'Al fin acaba la pesadilla...', '', 30706),
(171569, 'esMX', '¡No soy un simple bufón! ¡Soy Nielas Aran!', '', 30706),
(171568, 'esMX', '¿Quiénes son? ¿Qué quieren? ¡Aléjense de mí!', '', 30706),
(171567, 'esMX', '¡Por favor, basta! ¡Mi hijo... se ha vuelto loco!', '', 30706),
(171565, 'esMX', '', '¡Fuego para ayudar a las sombras!', 30706),
(171564, 'esMX', '', '¡Sacrolash!', 30706),
(171563, 'esMX', '', '¡Edir harach!', 30706),
(171562, 'esMX', '', 'Der\'ek... manul.', 30706),
(171561, 'esMX', '', '¡El fuego consume!', 30706),
(171560, 'esMX', '', '¡Su racha de suerte ha acabado!', 30706),
(171559, 'esMX', 'Ah, los jovencitos siempre tienen tanta prisa. Muy bien, aquí tienes el códice.$b$bSi en algún momento quieres escuchar el resto de la historia de Marcus, ya sabes dónde encontrarme.', '', 30706),
(171558, 'esMX', 'Su muerte será rápida, extranjeros. No deberían haber venido a eh\'te lugar.', '', 30706),
(171557, 'esMX', 'Mis águilas me traerán sus espíritu\'. Sus sacrificio\' no serán en vano...', '', 30706),
(171556, 'esMX', '¡No tiene\' nada!', '', 30706),
(171555, 'esMX', '¡Ya bah\'ta de lloriquear!', '', 30706),
(171554, 'esMX', '¡Aliméntense, hermanos mío\'!', '', 30706),
(171553, 'esMX', '¡No pueden... matar... mi eh\'píritu!', '', 30706),
(171552, 'esMX', '¡Solo eh\'tán malgastando mi tiempo!', '', 30706),
(171551, 'esMX', '¡Yo soy el depredador! Ustede\' la presa...', '', 30706),
(171550, 'esMX', '¡Qué emocionante! Cuéntame más.', '¡Qué emocionante! Cuéntame más.', 30706),
(171549, 'esMX', 'Parece muy interesante. Sin embargo, solo quisiera pedirte prestado el códice.', 'Parece muy interesante. Sin embargo, solo quisiera pedirte prestado el códice.', 30706),
(171548, 'esMX', '¡Skarvald, holgazán incompetente! ¡Vuelve y haz algo útil!', '', 30706),
(171547, 'esMX', 'Puede que aún me sirvas.', '', 30706),
(171546, 'esMX', 'No hay... mayor... gloria.', '', 30706),
(171545, 'esMX', 'Nos... vemos... pronto.', '', 30706),
(171544, 'esMX', '¿Necesitas evaluar un poco más la situación? ¡Idiota! ¡Sólo muévete y pelea!', '', 30706),
(171543, 'esMX', 'Así es. Y es bastante interesante.$b$bSin embargo, también me encontré con otros libros. Hay uno que quizás te interese un poco más que trata sobre una historia de desamor y aventuras.$b$bEl protagonista es un hombre llamado \"Marcus\", que va conquistando mujeres mientras recorre el mundo.$b$bEs un libro bastante subido de tono.', '', 30706),
(171542, 'esMX', 'Me han contado que encontraste un antiguo códice terráneo durante tus viajes recientes. ¿Me lo prestarías?', 'Me han contado que encontraste un antiguo códice terráneo durante tus viajes recientes. ¿Me lo prestarías?', 30706),
(171541, 'esMX', 'La aventura espera, $ujovencito:jovencita;.', '', 30706),
(171540, 'esMX', '¡Claro que sí! Sin embargo, y sin ánimos de faltarte el respeto, todo en esta vida tiene un precio.$b$bSi tienes dinero suficiente, son todos tuyos.', '', 30706),
(171539, 'esMX', 'Estoy buscando unos pergaminos que es posible que tengas.', 'Estoy buscando unos pergaminos que es posible que tengas.', 30706),
(171538, 'esMX', 'Hola, te doy la bienvenida. ¡Me dedico al comercio de productos exóticos del lejano norte!$b$bVen, ¡echa un vistazo!', '', 30706),
(171537, 'esMX', '¡Dejarás a la Horda en ruinas!', '', 30706),
(171536, 'esMX', '¡Traicionas a la Horda!', '', 30706),
(171535, 'esMX', '¿No somos más que peones en tu juego?', '', 30706),
(171534, 'esMX', 'Yo llevé a Derek Valiente de vuelta con su familia.', '', 30706),
(171533, 'esMX', '', 'Tuvo ayuda. ¿No es verdad...?', 30706),
(171532, 'esMX', '', 'Parece que hay un traidor entre nosotros.', 30706),
(171531, 'esMX', '', 'Aquí tienes. Ten cuidado con él, es bastante antiguo.', 30706),
(171530, 'esMX', '', '¡Aquí está!', 30706),
(171529, 'esMX', '', 'Ah, sí, creo que está por aquí, en algún lado...', 30706),
(171528, 'esMX', 'Estoy buscando un libro que tienes sobre runas y tallados. ¿Me lo podrías prestar?', 'Estoy buscando un libro que tienes sobre runas y tallados. ¿Me lo podrías prestar?', 30706),
(171527, 'esMX', 'La cría de Torcali hace desaparecer el bocadito de tu mano y luego te observa expectante.', '', 30706),
(171526, 'esMX', 'La cría de Torcali devora la comida de tus manos y cuando termina, olisquea en busca de más.', '', 30706),
(171525, 'esMX', 'La cría de Torcali come tan rápido que esparce trocitos por todos lados. Te observa y brama para pedir más.', '', 30706),
(171524, 'esMX', 'La cría de Torcali mastica el bocadito e inmediatamente busca más en tus manos.', '', 30706),
(171523, 'esMX', 'La cría de Torcali inhala el bocadito y te observa expectante.', '', 30706),
(171521, 'esMX', 'La cría de Torcali bosteza y se acuesta para tomar otra siesta.', '', 30706),
(171520, 'esMX', '<La cría de Torcali busca algo para comer en tus manos.>', '', 30706),
(171519, 'esMX', '<La cría de Torcali se pasea alegremente cuando te ve.>', '', 30706),
(171518, 'esMX', '<La cría de Torcali te olfatea la mano.>', '', 30706),
(171517, 'esMX', '<La cría de Torcali te observa con un gesto de confianza.>', '', 30706),
(171516, 'esMX', '<La cría de Torcali arranca una hoja del suelo y te la ofrece.>', '', 30706),
(171515, 'esMX', '<La cría de Torcali gira rápidamente en el lugar apenas te ve.>', '', 30706),
(171514, 'esMX', '<La cría de Torcali choca tu mano con su cuerno suavemente.>', '', 30706),
(171513, 'esMX', '<La cría de Torcali pisa el suelo cuando te acercas.>', '', 30706),
(171512, 'esMX', '<La cría de Torcali te recibe con un bramido suave.>', '', 30706),
(171511, 'esMX', 'Le doy gracias a Elune porque estamos con vida y tenemos aliados lo suficientemente fuertes como para disponer del tiempo y los recursos necesarios para recuperarnos.', '', 30706),
(171510, 'esMX', 'La cría de Torcali devora ansiosamente las hierbas que están dentro de la ofrenda.', '', 30706),
(171501, 'esMX', '', 'Ha sido un placer, $n. Quizás nos volvamos a ver en otro momento.', 30706),
(171484, 'esMX', '', 'Apresurémonos, $n. Temo que no nos quede mucho tiempo más, y quién sabe a dónde nos lleve esta cacería.', 30706),
(171480, 'esMX', 'Sheza me envió. He venido a negociar por los artículos.', 'Sheza me envió. He venido a negociar por los artículos.', 30706),
(171460, 'esMX', '', 'Debería haber una falla aquí por algún lado. Apresurémonos a repararla.', 30706),
(171459, 'esMX', 'Mira, pareces $Uun tipo:una muchacha; agradable.\n\nPuedes pagar y marcharte, o el equipo de \"Recuperadores de materiales\" de Ventura y Cía. deberá revisar tus bolsas. Ya sabes, para asegurarnos de que \"accidentalmente\" no hayas adquirido nada que le pertenezca por derecho a Ventura y Cía.\n\nDéjame advertirte que te sorprenderá la cantidad de cosas nuestras que encontraremos en tu bolsa.\n\n¿Capisce?', '', 30706),
(171458, 'esMX', '¡Correcto! ERAN 1,000 de oro.\n\nPero debe haberse olvidado de incluir mis, ejem, \"honorarios\".\n\nLa oferta es 1,250. Tómalo o déjalo.\n\nAunque con nuestro suministro limitado y la repentina demanda del mercado, lo que corresponde fiscalmente sería, ehh, aumentar aún más el precio.\n\n<Sonríe y muestra sus dientes amarillos.>', '', 30706),
(171457, 'esMX', 'Conque la vaca te explicó todo, ¿eh? Está bien. Una marca es una marca. No me importa quién consiga los bienes.\n\nSi quieres lo que está en el cofre, ¡dame un pago único de 1,250 de oro y será todo tuyo!', '', 30706),
(171456, 'esMX', 'Oye, tú pareces joven e inteligente.\n\n¿Te interesaría conseguir algunos pellejos finos?', '', 30706),
(171451, 'esMX', '', 'Ha sido fabuloso, $n. Pero te necesitan en otro lado.\n\n¿Estás $ulisto:lista; para partir?', 30706),
(171450, 'esMX', 'Estoy listo para partir.', 'Estoy lista para partir.', 30706),
(171442, 'esMX', '', 'No importa. ¡Acabaré contigo y con tu $Ucompañero entrometido:compañera entrometida; ahora!', 30706),
(171441, 'esMX', '', 'Veo que escapaste de mi trampa. Somos muy resistentes cuando surge la necesidad.', 30706),
(171428, 'esMX', '', 'Me están... despedazando. Toma mi hilo. ¡Cierra... las fallas! ¡Gaaaaahh!', 30706),
(171427, 'esMX', '', '¡$n! ¡Ayúdame! Era... una trampa...', 30706),
(171426, 'esMX', '', 'Buscaré el área por mi cuenta para averiguar si Prelus intentó decirme algo útil.', 30706),
(171425, 'esMX', '', 'Los miembros de mi orden están entrenados para dejar pistas tan sutiles que solo otro forestal oscuro puede advertirlas.', 30706),
(171423, 'esMX', '', 'Mientras buscas evidencia, yo realizaré mi propia investigación.', 30706),
(171416, 'esMX', '', '¡Espera, $n! ¡No toques ese portal!', 30706),
(171415, 'esMX', '<Activar la subrutina de regreso.>', '<Activar la subrutina de regreso.>', 30706),
(171404, 'esMX', '¿Quieren saber más? Tomen un panfleto. Tenemos muchos para elegir.', '¿Quieren saber más? Tomen un panfleto. Tenemos muchos para elegir.', 30706),
(171403, 'esMX', 'No confíen en la Alianza. ¡Nosotros no les importamos!', 'No confíen en la Alianza. ¡Nosotros no les importamos!', 30706),
(171401, 'esMX', '¡Donen a la Hermandad Escarlata! ¡Ayúdennos a ayudarlos!', '¡Donen a la Hermandad Escarlata! ¡Ayúdennos a ayudarlos!', 30706),
(171400, 'esMX', '¡El único no-muerto bueno es uno bien muerto!', '¡El único no-muerto bueno es uno bien muerto!', 30706),
(171399, 'esMX', '¡Lordaeron es para los vivos! ¡Síganme!', '¡Lordaeron es para los vivos! ¡Síganme!', 30706),
(171398, 'esMX', 'Quieren recuperar su hogar de esos monstruos no-muertos, ¿verdad?', 'Quieren recuperar su hogar de esos monstruos no-muertos, ¿verdad?', 30706),
(171397, 'esMX', '¡Ja ja! ¡Por aquí!', '', 30706),
(171396, 'esMX', 'Estoy cansado de todo este odio.', 'Estoy cansada de todo este odio.', 30706),
(171395, 'esMX', '¿En serio es esto lo que Lordaeron defiende?', '¿En serio es esto lo que Lordaeron defiende?', 30706),
(171391, 'esMX', 'Orden reconocida. Transmisión cancelada.', '', 30706),
(171390, 'esMX', '', '¡Plumas! ¿Cómo estás...? ¡Plumas! ¡Cancelar transmisión! Cancelar...', 30706),
(171389, 'esMX', '¡Hola, Saffy!', '', 30706),
(171388, 'esMX', 'Dentro del radio de transmisión. Comenzando transmisión.', '', 30706),
(171386, 'esMX', 'Operación reanudada.', '', 30706),
(171383, 'esMX', 'Señal débil. Recalibrando.', '', 30706),
(171382, 'esMX', 'Levando anclas', 'Levando anclas', 30706),
(171381, 'esMX', '<Comenzar depuración.>', '<Comenzar depuración.>', 30706),
(171380, 'esMX', '¡Ho- <estática> o- o- o- la!', '', 30706),
(171377, 'esMX', 'NO MOSTRAR en el subtítulo y en el chat - (Suspiro de sorpresa)', '', 30706),
(171376, 'esMX', 'Señal encontrada. Activando protocolo \"Buscar a Saffy\".', '', 30706),
(171375, 'esMX', 'Faro de regreso activado. Buscando señal.', '', 30706),
(171374, 'esMX', 'Es cierto. Los no-muertos son una plaga.', 'Es cierto. Los no-muertos son una plaga.', 30706),
(171373, 'esMX', 'Estas ideas no me convencen...', 'Estas ideas no me convencen...', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(171372, 'esMX', 'La Hermandad tiene razón.', 'La Hermandad tiene razón.', 30706),
(171371, 'esMX', 'Creo que es hora de poner el mundo en equilibrio, ¿no te parece?', '', 30706),
(171335, 'esMX', 'Son monstruos... todos ustedes...', 'Son monstruos... todos ustedes...', 30706),
(171334, 'esMX', 'Por... Lordaeron...', 'Por... Lordaeron...', 30706),
(171333, 'esMX', 'Escoria... impura...', 'Escoria... impura...', 30706),
(171332, 'esMX', 'Nuestro reino... será... grande una vez más...', 'Nuestro reino... será... grande una vez más...', 30706),
(171331, 'esMX', 'Profanas... esta tierra...', 'Profanas... esta tierra...', 30706),
(171330, 'esMX', '¡Escoria impura!', '¡Escoria impura!', 30706),
(171329, 'esMX', '¡Lordaeron recuperará su antigua gloria!', '¡Lordaeron recuperará su antigua gloria!', 30706),
(171328, 'esMX', '¡Por la Hermandad Escarlata!', '¡Por la Hermandad Escarlata!', 30706),
(171327, 'esMX', '¡Pagarás por tu intromisión!', '¡Pagarás por tu intromisión!', 30706),
(171326, 'esMX', '¡Lordaeron es NUESTRA!', '¡Lordaeron es NUESTRA!', 30706),
(171325, 'esMX', '', '¡Apresurémonos!', 30706),
(171324, 'esMX', 'Estoy listo, Delormi.', 'Estoy lista, Delormi.', 30706),
(171323, 'esMX', '', 'Creo que sé cuándo y dónde debemos investigar primero. Avísame cuando estés $ulisto:lista; para partir.', 30706),
(171321, 'esMX', 'Adiós, $uprotector:protectora; de lo salvaje. Espero que nuestros caminos vuelvan a cruzarse.', '', 30706),
(171320, 'esMX', 'Puedes controlar cualquier aspecto del espíritu de Hati cuando lo desees, siempre y cuando pelees contra los que quieren destruir nuestro mundo.', '', 30706),
(171319, 'esMX', '¡Solo debes colocar la mano encima y recordar los desafíos que has superado junto a Hati!', '', 30706),
(171318, 'esMX', 'Cuando el Chispatrueno esté en posición, verás su verdadero potencial.', '', 30706),
(171317, 'esMX', '¡Ah, $p! Ya estaba preguntándome a dónde habías ido.', '', 30706),
(171316, 'esMX', '', '¿Te gusta lo que ves? ¡Puedes conseguirla gratis!', 30706),
(171315, 'esMX', '', 'Ahora que ya viste cómo se hace, ¿por qué no lo intentas? Toma, te presto mi hilo.', 30706),
(171314, 'esMX', '', '¡Encontraste uno! Yo lo arreglaré, pero presta atención.', 30706),
(171312, 'esMX', 'Oh, mira, eh\'tás... Mueh\'to.', '', 30706),
(171311, 'esMX', 'Muchos más caerán como tú.', '', 30706),
(171310, 'esMX', '¡Da Amani di chuka!', '', 30706),
(171309, 'esMX', '¡Les presento a mis nuevos hermanos: colmillo y garra!', '', 30706),
(171308, 'esMX', '¡No hay forma de esconderse del águila!', '', 30706),
(171307, 'esMX', '¡No hace falta mirar al cielo para ver al dracohalcón!', '', 30706),
(171306, 'esMX', 'Quizá yo caiga... pero el imperio Amani... nunca morirá.', '', 30706),
(171305, 'esMX', '¡Por esto dicen que soy INVENCIBLE!', '', 30706),
(171304, 'esMX', 'Mira. Tengo algunos trucos nuevos... como mi hermano oso...', '', 30706),
(171303, 'esMX', 'Los Zandalari nos dan fuerza. ¡Nadie volverá a despreciar a los Amani!', '', 30706),
(171302, 'esMX', '', '¡Sólo existe un camino a la iluminación! ¡LA MUERTE!', 30706),
(171301, 'esMX', '', '¡Llénense de su poder! ¡Vuélvanse agentes de la ira del amo!', 30706),
(171300, 'esMX', '', 'Por el amo, moriría mil veces... Mil v…', 30706),
(171299, 'esMX', '', '¡HEREJES! ¡Sufrirán por esta interrupción!', 30706),
(171298, 'esMX', '¡El vórtice de la destrucción te llama!', '', 30706),
(171297, 'esMX', '¡Otra alma para fortalecer al anfitrión!', '', 30706),
(171296, 'esMX', 'Combustible para el motor.', '', 30706),
(171295, 'esMX', 'Guh…', '', 30706),
(171294, 'esMX', '¡Separaré tu alma de tu cuerpo!', '', 30706),
(171293, 'esMX', 'Sigue la corriente, $n.', '', 30706),
(171292, 'esMX', '¡Por fin, un público atento!', '', 30706),
(171291, 'esMX', 'No podemos arriesgarnos a que te vean con este barco. El talismán que llevas está vinculado al Puerto de Zandalar. Con eso regresarás sin riesgos.', '', 30706),
(171290, 'esMX', 'Correrá sangre.', '', 30706),
(171289, 'esMX', 'La verdad se halla en la muerte.', '', 30706),
(171288, 'esMX', '¿Alguna vez fuiste una amenaza?', '', 30706),
(171287, 'esMX', '¡Qué poder tan maravilloso! La Esfera del Caído Oscuro me ha vuelto INVENCIBLE.', '', 30706),
(171286, 'esMX', 'Mi reina, se… acercan.', '', 30706),
(171285, 'esMX', 'Estoy en ninguna parte... Estoy en todas partes. Soy el vigilante oculto.', '', 30706),
(171284, 'esMX', 'Tus latidos son... música para mis oídos.', '', 30706),
(171283, 'esMX', 'Un último... abrazo.', '', 30706),
(171282, 'esMX', 'No beberé sangre antes de tiempo.', '', 30706),
(171281, 'esMX', '¡Bin dorei am\'ovel!', '', 30706),
(171280, 'esMX', 'Sangre fresca y tibia... hacía tanto tiempo.', '', 30706),
(171279, 'esMX', 'Tan... apetitoso.', '', 30706),
(171278, 'esMX', 'Aún tengo hambre. Aún... tengo... sed.', '', 30706),
(171277, 'esMX', '¡Devoraré tus restos!', '', 30706),
(171276, 'esMX', 'Trato hecho.', 'Trato hecho.', 30706),
(171275, 'esMX', '¿Sí? ¿Qué clase de trato?', '¿Sí? ¿Qué clase de trato?', 30706),
(171274, 'esMX', 'Agh...', '', 30706),
(171273, 'esMX', 'Mi copa rebalsa.', '', 30706),
(171272, 'esMX', '¿Ahora ves el poder de los Caído Oscuro?', '', 30706),
(171271, 'esMX', 'La cena... está servida.', '', 30706),
(171270, 'esMX', '¡Naxxanar fue un pequeño revés! ¡Con el poder de la esfera, Valanar conseguirá su venganza!', '', 30706),
(171269, 'esMX', '¡ARRODÍLLENSE ANTE LOS SAN\'LAYN!', '', 30706),
(171268, 'esMX', 'No se acercarán al Maestro. ¡Jinetes de dragones, ataquen!', '', 30706),
(171264, 'esMX', 'Ya he esperado suficiente. Ahora se enfrentaran al Recolector de almas.', '', 30706),
(171260, 'esMX', 'Su estupidez los ha llevado a la muerte. Le han faltado el respeto descaradamente a poderes que ni siquiera pueden empezar a comprender. Han intentado invadir el reino del cosechador con todas sus fuerzas. Ahora solo les queda una salida… recorrer en solitario… el camino de los malditos.', '', 30706),
(171259, 'esMX', '¡La muerte es la única salida!', '', 30706),
(171258, 'esMX', 'Es... mi... fin.', '', 30706),
(171257, 'esMX', '¡Nadie osa desafiar al Shadopan!', '', 30706),
(171256, 'esMX', '¡Su energía es fuerte!', '', 30706),
(171255, 'esMX', 'Dejen que les muestre mi poder.', '', 30706),
(171254, 'esMX', '¡Ven a mí, dragón! Juntos destruiremos a los intrusos.', '', 30706),
(171253, 'esMX', 'Acérquense... Su muerte los espera.', '', 30706),
(171252, 'esMX', '¡Gusanos!', '', 30706),
(171250, 'esMX', '¡Dragón, otórgame tu poder!', '', 30706),
(171249, 'esMX', 'Aun juntos... hemos fracasado...', '', 30706),
(171248, 'esMX', '¡Los rayos no conocen la piedad!', '', 30706),
(171247, 'esMX', '¿Gallywix te habló de Llavesilbo? Sí, Eso creí.\n\nMira, Grizzek no tenía ningún escrúpulo cuando se trataba de política, pero era un buen tipo. Aquí entre nosotros... necesitamos goblins como él, que desafíen los límites de la ingeniería.\n\nAsí que esta es mi contraoferta. Si encuentras a Grizzek, dile que mantenga un perfil bajo y luego ve y dile a Gallywix que te has encargado de él.\n\nSi lo haces, te pagaré el doble. ¿Qué dices?', '', 30706),
(171246, 'esMX', '', 'Hay belleza en la simpleza de las camisas, ¿no lo crees?', 30706),
(171245, 'esMX', '¡Oye, $n!\n\n<Gazlowe mira a ambos lados antes de indicarte que te acerques.>\n\nCreo que podemos hacer un trato aquí.', '', 30706),
(171239, 'esMX', '', 'Ah, sí, creo que sé en qué momento debería estar ahora. Deja que me oriente...', 30706),
(171237, 'esMX', 'Invocar la esencia de Sacrificio de Hati.', 'Invocar la esencia de Sacrificio de Hati.', 30706),
(171236, 'esMX', 'Invocar la esencia de Mordedura de serpiente.', 'Invocar la esencia de Mordedura de serpiente.', 30706),
(171235, 'esMX', 'Invocar la esencia de Cañón antijabalí.', 'Invocar la esencia de Cañón antijabalí.', 30706),
(171234, 'esMX', 'Invocar la esencia de Trueno de Elekk.', 'Invocar la esencia de Trueno de Elekk.', 30706),
(171233, 'esMX', 'Invocar la esencia de Águila vigía.', 'Invocar la esencia de Águila vigía.', 30706),
(171232, 'esMX', 'Invocar la esencia de Titánica.', 'Invocar la esencia de Titánica.', 30706),
(171231, 'esMX', '<El cristal resuena con energía.>', '', 30706),
(171230, 'esMX', 'Hay que conservar los especímenes', '', 30706),
(171229, 'esMX', 'La naturaleza se somete a mi voluntad...', '', 30706),
(171228, 'esMX', '¡Endorel anuminor!', '', 30706),
(171227, 'esMX', 'Serás comida para gusanos.', '', 30706),
(171226, 'esMX', 'Ha concluido tu ciclo vital.', '', 30706),
(171225, 'esMX', '¿Qué hacen? ¡Estos especímenes son muy delicados!', '', 30706),
(171224, 'esMX', '¡Basta de juegos!', '', 30706),
(171223, 'esMX', '¡Son míos!', '', 30706),
(171222, 'esMX', 'Disfruten sus últimos momentos.', '', 30706),
(171221, 'esMX', 'Lord Illidan, yo...', '', 30706),
(171220, 'esMX', '¡Bien hecho!', '', 30706),
(171219, 'esMX', '¡Selama am\'oronor!', '', 30706),
(171218, 'esMX', 'Tengo mejores cosas que hacer...', '', 30706),
(171214, 'esMX', '¿Quieres ver poder? ¡TE MOH\'TRARÉ EL PODER!', '', 30706),
(171213, 'esMX', '¡Después de eh\'to no quedar nada!', '', 30706),
(171212, 'esMX', '¡Saluda a mi GRAN amigo!', '', 30706),
(171211, 'esMX', '¡MÁTALOS A TODO\'!', '', 30706),
(171210, 'esMX', '¡Destrípalos! ¡Ensártalo\'!', '', 30706),
(171209, 'esMX', '¡Te lo dije!', '', 30706),
(171208, 'esMX', '¿Quién necesita dioses si NOSOTRO\' lo somos?', '', 30706),
(171207, 'esMX', '¡Cuánta adrenalina!', '', 30706),
(171206, 'esMX', 'Hasta los poderoso\'... sucumben.', '', 30706),
(171205, 'esMX', '¡Te sacaré las tripa\', colega!', '', 30706),
(171204, 'esMX', '¡Reúnan a las fuerzas!', '', 30706),
(171203, 'esMX', 'Por la Horda…', '', 30706),
(171202, 'esMX', 'Soy Nazgrim, el puño del Jefe de Guerra y el general de la Armada de la Horda. Si tengo que morir hoy, moriré con honor en batalla. ¡Por la Horda!', '', 30706),
(171201, 'esMX', '¡Guerreros, doble marcha!', '', 30706),
(171200, 'esMX', '¡Kor\'kron, a mi lado!', '', 30706),
(171199, 'esMX', 'Muero... con honor... Lok\'tar ogar...', '', 30706),
(171198, 'esMX', 'Ah... has aprendido mucho... y bien... Una batalla honorable.', '', 30706),
(171197, 'esMX', 'Debieron haber entrenado más.', '', 30706),
(171194, 'esMX', 'Miedo... qué estimulante…', '', 30706),
(171193, 'esMX', 'Desesperación... qué delicia…', '', 30706),
(171192, 'esMX', '¡Los niños de Stratholme lucharon con más ferocidad que esto!', '', 30706),
(171191, 'esMX', '¡Gusano llorón!', '', 30706),
(171190, 'esMX', '¡Soldados de Lordaeron, levántense y respondan al llamado de su amo!', '', 30706),
(171189, 'esMX', 'Marwyn, acaba con ellos...', '', 30706),
(171188, 'esMX', 'Hombres, mujeres, niños... Nadie se libró de la cólera de nuestro amo. Tu muerte no será distinta.', '', 30706),
(171187, 'esMX', '', 'Su vida hasta ahora, sus deseos mortales no significan nada... ¡ahora son acólitos del amo y le servirán sin cuestionarlo! ¡No hay mayor gloria que morir al servicio del amo!', 30706),
(171186, 'esMX', '', '¡Mátalos en el nombre del amo!', 30706),
(171185, 'esMX', '', '¡Corre mientras puedas!', 30706),
(171184, 'esMX', '', '¡Arrodíllate ante mí, sabandija!', 30706),
(171183, 'esMX', '', '¡Patético infeliz!', 30706),
(171182, 'esMX', '', '¡No puedes esconderte de mí!', 30706),
(171181, 'esMX', '', '¡Has fracasado!', 30706),
(171180, 'esMX', '', '¡¡El maestro me vengará!!', 30706),
(171179, 'esMX', '¡No! ¡No! ¡Y lo repito: no! No alcanzó.', '', 30706),
(171178, 'esMX', '¡Me rindo! Abandono. Excelente trabajo. ¿Ya me puedo ir corriendo?', '', 30706),
(171177, 'esMX', '¿Están a la altura del desafío? No me contendré.', '', 30706),
(171176, 'esMX', '¡Ustedes! Necesitan más práctica.', '', 30706),
(171175, 'esMX', '¡Prepárense!', '', 30706),
(171174, 'esMX', '¡El Martillo de la Justicia!', '', 30706),
(171171, 'esMX', '', 'Sorpresa.', 30706),
(171170, 'esMX', '', 'Adiós.', 30706),
(171168, 'esMX', '', 'Eres... mucho mejor... de lo que creía...', 30706),
(171167, 'esMX', '', 'A trabajar, ¿de acuerdo?', 30706),
(171166, 'esMX', '', 'Buenas noches...', 30706),
(171165, 'esMX', '', '¡Mmm, qué divertido!', 30706),
(171164, 'esMX', '', 'Espero que tus amigos sepan hacerlo mejor.', 30706),
(171163, 'esMX', '', '¡Pff! ¿Tan pronto?', 30706),
(171162, 'esMX', '¡Atrás, percebes descerebrados!', '', 30706),
(171160, 'esMX', '¡Ceburón, leva el ancla y mueve tus malditas plumas! Tenemos que lidiar con unos mequetrefes.', '', 30706),
(171159, 'esMX', '¡Su perdición se acerca!', '', 30706),
(171158, 'esMX', '¡Carrrrrrrrrga!', '', 30706),
(171157, 'esMX', '¡Sin piedad!', '', 30706),
(171156, 'esMX', '¡Los voy a despellejar!', '', 30706),
(171154, 'esMX', '¡Parece que a alguien le cuesta mantener el equilibrio!', '', 30706),
(171153, 'esMX', '¡Los muertos no cuentan cuentos!', '', 30706),
(171152, 'esMX', '¡No eras más que carnada!', '', 30706),
(171151, 'esMX', 'Creo.. que me iré... al armario…', '', 30706),
(171150, 'esMX', '¡No debiste meterte con los Zandalari!', '', 30706),
(171149, 'esMX', '¡De rodillas!', '', 30706),
(171148, 'esMX', '¡Quítense!', '', 30706),
(171147, 'esMX', '¡Aquí viene!', '', 30706),
(171146, 'esMX', '¡Lei Shen, danos fuerza!', '', 30706),
(171145, 'esMX', '¡El Rey del Trueno nos muestra el camino!', '', 30706),
(171144, 'esMX', '¡Electrizante!', '', 30706),
(171143, 'esMX', '¡Esto les va a doler!', '', 30706),
(171142, 'esMX', '¡No pueden detener al imperio Amani!', '', 30706),
(171141, 'esMX', 'El... Rey del... Trueno... lo prometió...', '', 30706),
(171140, 'esMX', 'Ikiss no -rak, rak-morirá...', '', 30706),
(171139, 'esMX', '¡Muere-ka! ¡No toques los abalorios!', '', 30706),
(171138, 'esMX', 'Mmmmmm...', '', 30706),
(171137, 'esMX', 'Mmmm, ¿declaran la guerra a Ikiss? ¡Aa-ak!', '', 30706),
(171136, 'esMX', 'Ikiss los corta, preciosos-ak-a-ak-, los rebana, ¡sí!', '', 30706),
(171135, 'esMX', '¡No hay escapatoria para aogh-para ustedes!', '', 30706),
(171134, 'esMX', '¡Ra-ak! Abalorios, sí. ¡Abalorios preciosos! ¡Ak! Poder, gran poder. ¡Ra-kaw! ¡Poder de los abalorios! ¡Ak-co!', '', 30706),
(171133, 'esMX', '¡Var-jorgg gramalch!', '', 30706),
(171132, 'esMX', '¡Mátenlos a todos! ¡Sin excusas! ¡Sin piedad! ¡Sin descanso! ', '', 30706),
(171131, 'esMX', '¡Arrasen con todo! ¡Acallen todo grito!', '', 30706),
(171130, 'esMX', '¡Pintaré mi rostro con tu sangre!', '', 30706),
(171129, 'esMX', '¡Soy un guerrero innato!', '', 30706),
(171128, 'esMX', 'Mi vida por el... ¡dios de la Muerte!', '', 30706),
(171127, 'esMX', '¡Regreso! ¡Una segunda oportunidad de perforar tu alma!', '', 30706),
(171126, 'esMX', '¡Mjul orm agn gjor!', '', 30706),
(171125, 'esMX', '¡No! Puedo hacerlo... ¡mejor! Puedo...', '', 30706),
(171122, 'esMX', 'Puedes usar la unidad de biorreorganización YZ-85 junto al convertidor de iones si necesitas lugar en tu establo, claro.', '', 30706),
(171121, 'esMX', 'Me alegra tenerte de nuevo entre nosotros, Hati, viejo amigo. ¡No seas tímido!', '', 30706),
(171120, 'esMX', 'Dejaré que se vuelvan a familiarizar. ¡A este enano le vendrían bien un par de días en la naturaleza!', '', 30706),
(171119, 'esMX', 'Vaya que le gusta brincar por todos lados, ¿no?', '', 30706),
(171118, 'esMX', 'Reunámonos en el Templo de las Tormentas. ¡Hay algo que debo enseñarte!', '', 30706),
(171117, 'esMX', '¡Lo lograste! ¡No dudé de ti ni por un instante!', '', 30706),
(171114, 'esMX', 'Es decir... ¡Claro que funcionó! Observen... ¡Hati está entero otra vez!', '', 30706),
(171112, 'esMX', '¿Funcionó?', '', 30706),
(171111, 'esMX', 'Mantén el campo justo ahí... ¡sí, sí, sí! No, no, no, no, no. Espera... No... ¡Sí!', '', 30706),
(171110, 'esMX', '¡Mira! El campo de estabilización está atrayendo la magia de relámpagos del Chispatrueno. ¡Espectacular!', '', 30706),
(171109, 'esMX', 'La prensa de fusión está recibiendo la energía. ¡Maravilloso! ¡Increíblemente maravilloso!', '', 30706),
(171107, 'esMX', 'Matriz de estabilización al máximo. Redireccionando iones a la prensa de fusión...', '', 30706),
(171106, 'esMX', 'Convertidores de iones llegando a su energía máxima... ¡ahora!', '', 30706),
(171105, 'esMX', '¡Solo debes colocar el Chispatrueno en esta consola y Hati regresará de inmediato!', '', 30706),
(171104, 'esMX', 'Es más que bueno, Barbabronce. ¡Es ciencia!', '', 30706),
(171103, 'esMX', 'Y eso es... ¿bueno?', '', 30706),
(171102, 'esMX', '¡Allí estás! Acabo de completar el redireccionamiento de las unidades de baja energía iónica del convertidor a la matriz de estabilización. ¡Eso debería hacer que la prensa de fusión reforme el cuerpo de Hati a partir de su esencia!', '', 30706),
(171099, 'esMX', 'Supongo... que solo extraño a Hati, para ser honesto. Sé que está vinculado a tu espíritu y todo eso, pero tiene el corazón más noble que he visto.', '', 30706),
(171098, 'esMX', 'Antes solo recorría la naturaleza con Theodore y el viejo Huey. Tal vez nos encontrábamos con algún otro cazador ocasionalmente.', '', 30706),
(171097, 'esMX', '¿Sabes, $Umuchacho:muchacha;? A veces me pregunto cómo nos metemos en estas situaciones.', '', 30706),
(171096, 'esMX', 'Sí, Mimiron... lo que digas.', '', 30706),
(171095, 'esMX', '¡Barbabronce, lo lograste! Lamento la ligera descombobulación en tu viaje por el teletransportador.', '', 30706),
(171094, 'esMX', '¡Por aquí llegarás a la maravillosa Chispa de la Imaginación! ¡Vamos, $p! ¡Llegó la hora de reconstruir a tu compañero con la magia de la ciencia!', '', 30706),
(171092, 'esMX', '¿Otro intruso? No importa. ¡Los dos morirán!', '', 30706),
(171091, 'esMX', '¡$p! ¿Quieres unirte a la diversión?', '', 30706),
(171090, 'esMX', '', 'La Horda planea algo y vamos a descubrirlo, sea como sea.', 30706),
(171087, 'esMX', '', '¡Y... éxito! ¡Un dispositivo auditivo ya está en marcha!', 30706),
(171086, 'esMX', '', 'Solo un momento, ya casi lo tengo.', 30706),
(171085, 'esMX', '', 'Ahora reinicio la matriz. Y luego... Un momento... ¿Qué hace esa pieza ahí?', 30706),
(171084, 'esMX', '', 'Ahora tengo que reiniciar la matriz de poder... ¡No! ¡Espera! ¡Faltan las descargas a tierra!', 30706),
(171083, 'esMX', '', 'Veamos... tengo que calibrar el churumbele.', 30706),
(171074, 'esMX', 'Yo te cubro.', 'Yo te cubro.', 30706),
(171067, 'esMX', '', '¡La ira de Shadra los destruirá!', 30706),
(171066, 'esMX', '', '¡Muerte a los que se opongan al imperio!', 30706),
(171065, 'esMX', '', 'Shadra... Sálvame...', 30706),
(171064, 'esMX', '', '¡Otra ofrenda para los loa!', 30706),
(171063, 'esMX', '', '¡Se dará un festín con tu alma!', 30706),
(171062, 'esMX', '', '¡Sucumban al veneno!', 30706),
(171061, 'esMX', '', '¡Sus almas me pertenecen!', 30706),
(171060, 'esMX', '', '¡El Vinculador de Espíritus me revela tu alma!', 30706),
(171059, 'esMX', '', '¡Acepten su fin!', 30706),
(171058, 'esMX', '', 'Alardeen cuanto quieran; no tienen ninguna opción. Huyan mientras puedan.', 30706),
(171057, 'esMX', '', '¡Se enfrentan a la Vinculatormentas! Los mataré a todos.', 30706),
(171056, 'esMX', '', 'Debiste huir, perrito.', 30706),
(171055, 'esMX', '', '¡Ja!', 30706),
(171054, 'esMX', '', 'Abajo, cachorro.', 30706),
(171052, 'esMX', '', 'No podrán huir de la tormenta.', 30706),
(171051, 'esMX', '', 'Mueran bajo el hielo.', 30706),
(171050, 'esMX', '', '¡Sufran la ira de la tormenta!', 30706),
(171048, 'esMX', '', '¡Miren lo que les pasa a los que se oponen a mí!', 30706),
(171044, 'esMX', '', '¡Cobardes! Vaya bola de inútiles... perros…', 30706),
(171043, 'esMX', '¡Tormenta!', '', 30706),
(171042, 'esMX', '¡Y fuego!', '', 30706),
(171041, 'esMX', '¡La verdadera Horda se apodera de lo que quiere!', '', 30706),
(171040, 'esMX', '¡Agua angustiada, estancada y venenosa!', '', 30706),
(171039, 'esMX', '¡La tierra se desmorona plagada de óxido!', '', 30706),
(171038, 'esMX', '¡La sangre de la verdadera Horda ansía poder!', '', 30706),
(171037, 'esMX', 'Los elementos... ¿Qué hemos hecho?...', '', 30706),
(171036, 'esMX', 'Tu cráneo adornará mi collar.', '', 30706),
(171035, 'esMX', 'Ahora me perteneces.', '', 30706),
(171034, 'esMX', 'Te veo...', '', 30706),
(171033, 'esMX', 'Eres... mi próxima víctima.', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(171032, 'esMX', 'Cierra los ojos. Duerme.', '', 30706),
(171031, 'esMX', 'Las razas del mundo perecerán. Es solo cuestión de tiempo.', '', 30706),
(171030, 'esMX', 'Veo sufrimiento sin fin. Veo tormento. Veo furia. Lo veo todo...', '', 30706),
(171029, 'esMX', 'Pronto el mundo temblará.', '', 30706),
(171028, 'esMX', 'Ha llegado tu fin.', '', 30706),
(171027, 'esMX', 'Gusanos hambrientos se darán un festín con tu carne podrida.', '', 30706),
(171026, 'esMX', '¡La venganza es mía!', '', 30706),
(171025, 'esMX', 'Yo fui el primero. Para mí, la ruleta de la muerte ha girado muchas veces. Ha pasado tanto tiempo... Tengo que ponerme al día. ', '', 30706),
(171024, 'esMX', 'Sé qué hacer contigo...', '', 30706),
(171023, 'esMX', 'Esto empeora.', '', 30706),
(171022, 'esMX', 'La muerte no es tan terrible.', '', 30706),
(171021, 'esMX', '¿De qué tienen miedo?', '', 30706),
(171020, 'esMX', 'Ríndanse.', '', 30706),
(171019, 'esMX', 'Tengo algo para ustedes.', '', 30706),
(171018, 'esMX', '¡Mostrarán el debido respeto!', '', 30706),
(171017, 'esMX', 'La ruleta... gira... de nuevo.', '', 30706),
(171016, 'esMX', 'Los haré pedazos.', '', 30706),
(171015, 'esMX', 'Nadie puede derrotarme. Acabo con todos.', '', 30706),
(171014, 'esMX', 'Mis puños se tiñen de escarlata... ¡con tu sangre!', '', 30706),
(171013, 'esMX', 'Si mueres, mueres.', '', 30706),
(171012, 'esMX', 'Son como... una barra de hierro…', '', 30706),
(170997, 'esMX', '¡Ajá! Una buena ocasión para medir mis fuerzas.', '', 30706),
(170996, 'esMX', '¡En guardia!', '', 30706),
(170995, 'esMX', 'Vencido... por alguien como...', '', 30706),
(170994, 'esMX', '¡Ja, ja, ja!', '', 30706),
(170993, 'esMX', '¡Bah! Te falta entrenamiento.', '', 30706),
(170992, 'esMX', '', '¡¡MOLINO!! ¡Eres el próximo!', 30706),
(170991, 'esMX', '', '¿Qué dijiste?... ¡Nadie se burla de mi cabello! ¡NADIE!', 30706),
(170990, 'esMX', '', '¿Estás $Ulisto:lista; para EXPLOTAR?', 30706),
(170989, 'esMX', '', '¡Aquí viene el calor!', 30706),
(170988, 'esMX', '', '¡No puedes esconderte de mí, Molino! ¡No puedes!', 30706),
(170986, 'esMX', 'Combatimo\' la Plaga. ¿Crees que TÚ tiene\' alguna chance?', '', 30706),
(170985, 'esMX', 'Prepárate para algo... mucho... ¡MÁS GRANDE!', '', 30706),
(170984, 'esMX', '¡Te tragará la tierra!', '', 30706),
(170983, 'esMX', '¡Los aplasto como cucaracha\'!', '', 30706),
(170982, 'esMX', '¿Quién me detendrá? ¿Tú?', '', 30706),
(170981, 'esMX', 'Ahora no ere\' tan $urudo:ruda;, ¿no?', '', 30706),
(170980, 'esMX', 'Si nuestros diose\' pueden morir... nosotros también...', '', 30706),
(170979, 'esMX', 'Las sombras caerán sobre ustedes...', '', 30706),
(170978, 'esMX', 'Si no me has matao ya... ¡no tendrás otra oportunidá!', '', 30706),
(170977, 'esMX', '¡Esta es una pesadilla de la que no despertarás!', '', 30706),
(170976, 'esMX', '¡Azzaga choogo zinn!', '', 30706),
(170975, 'esMX', '¡Ahora me pertenecen sus voluntades!', '', 30706),
(170974, 'esMX', 'La oscuridad viene por ustedes...', '', 30706),
(170973, 'esMX', '¡Sus almas sangrarán!', '', 30706),
(170972, 'esMX', '¡Este no es... mi final!', '', 30706),
(170971, 'esMX', 'Que se nuble tu mente.', '', 30706),
(170970, 'esMX', '¡Mira fijamente la oscuridad de tu alma!', '', 30706),
