(170959, 'esMX', 'Diel fin\'al.', '', 30706),
(170958, 'esMX', '¿Sha\'amoor ara mashal?', '', 30706),
(170957, 'esMX', '¡Shal\'mor sinabanal!', '', 30706),
(170956, 'esMX', '', '¡Huyan o mueran!', 30706),
(170955, 'esMX', '', 'He cumplido con mi deber.', 30706),
(170954, 'esMX', '', 'Como debe ser.', 30706),
(170953, 'esMX', '', 'El destino... espera.', 30706),
(170952, 'esMX', '', '¡Nada de segundas oportunidades!', 30706),
(170951, 'esMX', '', '¡Por Quel\'Thalas! ¡Por la Fuente del Sol!', 30706),
(170950, 'esMX', '', '¡Estoy llena de sorpresas!', 30706),
(170943, 'esMX', '¡Me niego a asumir la derrota! ¡Soy el príncipe de los Eredar! Soy…', '', 30706),
(170942, 'esMX', 'No habrás pensado que podías vencer', '', 30706),
(170941, 'esMX', 'Tu codicia y estupidez te han llevado a este final.', '', 30706),
(170940, 'esMX', 'No eres más que un juguete y ni siquiera sirves para entretenerme.', '', 30706),
(170939, 'esMX', '¡Tontos! El tiempo es el fuego en el que arderán!', '', 30706),
(170938, 'esMX', '¡No solo se enfrentan a Malchezaar, sino a todas las legiones bajo mi mando!', '', 30706),
(170937, 'esMX', '¿Cómo pueden esperar enfrentarse a semejante poder?', '', 30706),
(170936, 'esMX', '¡Todas las realidades, todas las dimensiones están abiertas a mí!', '', 30706),
(170935, 'esMX', 'Vi la misma mirada en sus ojos cuando murió. Terenas no lo podía creer.', '', 30706),
(170934, 'esMX', '¡Atragántate con tu sufrimiento!', '', 30706),
(170933, 'esMX', 'Sí... Corre... Corre hacia tu destino... Su amargo y frío abrazo te espera.', '', 30706),
(170932, 'esMX', 'El amo observó su reino y le pareció... insuficiente. Su juicio fue rápido e inclemente: ¡MUERTE A TODOS!', '', 30706),
