(170930, 'esMX', '¡Consúmete en la nada!', '', 30706),
(170929, 'esMX', '¡La muerte es todo lo que encontrarán aquí!', '', 30706),
(170928, 'esMX', 'Acérquense para que podamos presentarnos como es debido.', '', 30706),
(170927, 'esMX', 'Cuando era un cachorro apenas podía dar puñetazos. Tras años de entrenamiento, puedo hacer muchísimo más.', '', 30706),
(170926, 'esMX', 'La habilidad con las armas no es más que una manifestación física de las artes marciales. ¡Les mostraré lo que es el poder espiritual!', '', 30706),
(170925, 'esMX', 'Como decía mi maestro: \"No conoces de verdad a alguien hasta que has luchado contra él\".', '', 30706),
(170924, 'esMX', 'Cuando uno cae, otro acude a ocupar su puesto.', '', 30706),
(170923, 'esMX', 'Necesitas trabajar tu técnica.', '', 30706),
(170922, 'esMX', '¡Tienes que entrenar más!', '', 30706),
(170921, 'esMX', 'No se contengan; ¡yo no lo haré!', '', 30706),
(170920, 'esMX', '¡Al fin acaba mi destierro!', '', 30706),
(170919, 'esMX', 'Rook... no está a salvo…', '', 30706),
(170918, 'esMX', '¡Rook... necesita ayuda!', '', 30706),
(170917, 'esMX', 'Lucha... con Rook.', '', 30706),
(170916, 'esMX', '¡Rook lucha!', '', 30706),
