(170914, 'esMX', 'Tú no eres... mi amigo...', '', 30706),
(170913, 'esMX', 'Por favor... Ayuda...', '', 30706),
(170912, 'esMX', '¡La venganza arde!', '', 30706),
(170911, 'esMX', '¡Felomin Ashal! ', '', 30706),
(170910, 'esMX', 'Pondré su mundo... cabeza... abajo.', '', 30706),
(170909, 'esMX', 'Maestro, otórgame fuerza.', '', 30706),
(170908, 'esMX', '¡No sean tan engreídos! Sé lo que están pensando, pero El Castillo de la Tempestad no era más que una distracción. ¿Realmente creyeron que confiaría el futuro a un perro ciego medio elfo de la noche? ¡Oh no, él solo era un instrumento, el primer paso de un plan mucho mayor! Todo nos ha llevado hasta aquí… ¡y esta vez no se interpondrán!', '', 30706),
(170907, 'esMX', 'No se pongan... demasiado cómodos.', '', 30706),
(170906, 'esMX', '¡Mi muerte no supone nada! ¡El maestro acabará con ustedes! ¡Se ahogarán en su propia sangre! ¡Este mundo arderá! ¡Aaaghh!', '', 30706),
(170905, 'esMX', '¡Auuuuu!', '', 30706),
(170904, 'esMX', '¿Sienten ese escalofrío en la nuca? La niebla se acerca…', '', 30706),
(170902, 'esMX', 'Huelo su miedo...', '', 30706),
(170901, 'esMX', '¡Les arrancaré el corazón del pecho!', '', 30706),
(170900, 'esMX', '¡Ja, ja, ja, ja! ¡Ja, ja, ja, ja, ja, ja!', '', 30706),
(170899, 'esMX', '¡Su sangre sólo incrementa mi hambre!', '', 30706),
(170898, 'esMX', '¡Ah, carne fresca!', '', 30706),
(170896, 'esMX', 'deep', 'deep', 30706),
(170890, 'esMX', '¡¿Por qué en el nombre de la ciencia presionarías el gran botón rojo que dice \"NO PRESIONAR ESTE BOTÓN\"?! ¡Tenemos trabajo por hacer!', '', 30706),
(170889, 'esMX', '', 'Te veré allí, $p.', 30706),
