INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(170234, 'esMX', '¡Intrusos! ¡No saldrán de aquí con vida!', '', 30706),
(170233, 'esMX', 'Morirás... como cualquier traidor...', '', 30706),
(170232, 'esMX', '¡Te infiltraste en el barco equivocado, rata!', '', 30706),
(170231, 'esMX', '¡Ningún prisionero justifica esto! ¡Llévenselo!', '¡Ningún prisionero justifica esto! ¡Llévenselo!', 30706),
(170230, 'esMX', '¡Por favor, basta!', '¡Por favor, basta!', 30706),
(170229, 'esMX', '¡Piedad! ¡Yo solo seguía órdenes!', '¡Piedad! ¡Yo solo seguía órdenes!', 30706),
(170228, 'esMX', '¡Muere, $uintruso:intrusa;!', '¡Muere, $uintruso:intrusa;!', 30706),
(170227, 'esMX', '¡Debemos defender al prisionero!', '¡Debemos defender al prisionero!', 30706),
(170226, 'esMX', '¡Nos han abordado!', '¡Nos han abordado!', 30706),
(170225, 'esMX', '', '$uBienvenido:Bienvenida; de nuevo, adalid. Niveles de contaminación de complejo mínimos desde purga exitosa del espécimen G\'huun.', 30706),
(170224, 'esMX', '¡Intrusos! ¡El alma en pena se quedará con sus cabezas!', '¡Intrusos! ¡El alma en pena se quedará con sus cabezas!', 30706),
(170222, 'esMX', 'Cuando des la orden, derribaré la puerta. Prepárate para enfrentar una resistencia feroz.', '', 30706),
(170219, 'esMX', '$UBienvenido:Bienvenida; a mi tienda, $n. ¿Quieres aprender las técnica\' de los escribas?$b$b¿O buh\'cas ahondar en los conocimiento\' de estas artes?', '', 30706),
(170218, 'esMX', 'Descubres los eventos de tu prueba escritos en el libro.', 'Descubres los eventos de tu prueba escritos en el libro.', 30706),
(170215, 'esMX', '¡Han destruido la torre occidental!', '', 30706),
(170212, 'esMX', '...Aunque no debería hablar de eso.', '', 30706),
(170209, 'esMX', '', 'Saludos de nuevo, $uportador:portadora; del Corazón de Azeroth.\n\nTu descontaminación de Uldir ha quedado registrada y es apreciada. Recomendación: continuar esfuerzos para impedir aniquilación planetaria absoluta.', 30706),
(170205, 'esMX', 'Como cuando ella y Ulfar se conocieron. Ja, esa es buena. Sí.', '', 30706),
(170204, 'esMX', 'Siempre quise conocerla. ¡Las historias de los Oradores de Espinas son muy interesantes!', '', 30706),
(170202, 'esMX', 'Viniste por pedido de Doriana, ¿verdad?', '', 30706),
(170201, 'esMX', 'Ulfar sabrá qué hacer con eso. Creo.', '', 30706),
(170200, 'esMX', 'Me da escalofríos.', '', 30706),
(170199, 'esMX', 'Esa magia que tienes ahí sí que parece aterradora.', '', 30706),
(170198, 'esMX', 'Ocultar esta información seguro despertará la ira de Sylvanas. ¿Estás seguro de que quieres ocultarle esto a Nathanos?', 'Ocultar esta información seguro despertará la ira de Sylvanas. ¿Estás segura de que quieres ocultarle esto a Nathanos?', 30706),
(170187, 'esMX', '<Placeholder: Magni meets MOTHER.>', '<Placeholder: Magni meets MOTHER.>', 30706),
(170185, 'esMX', 'Ten cuidado, Zelling. La Reina alma en pena planea algo...', '', 30706),
(170184, 'esMX', 'Supongo que quiere hacer una demostración de poder. Pero no sé a quién.', '', 30706),
(170183, 'esMX', 'Estamos en medio del territorio enemigo, Baine. ¿Por qué Sylvanas reuniría a los líderes de la Horda aquí?', '', 30706),
(170174, 'esMX', '', 'Recuerda a quién le debes lealtad.', 30706),
(170173, 'esMX', 'No podía quedarme de brazos cruzados ante semejante depravación.', '', 30706),
(170172, 'esMX', '¡Alto!', '', 30706),
(170170, 'esMX', 'Más allá de tus sentimientos por los forestales oscuros y su posición en la Horda, espero que comprendas mi preocupación por el bienestar de Velonara.', '', 30706),
(170169, 'esMX', 'Como miembro de la Alianza, puede que no te preocupe el bienestar de la forestal oscura Velonara. Pero debes saber que ella no es lo que parece.', '', 30706),
(170168, 'esMX', 'Por favor, ¡haz todo lo que puedas para garantizar su seguridad!', '', 30706),
(170167, 'esMX', 'Es un alma noble que se preocupa mucho por el bienestar de su aprendiz. Temo que su preocupación la ha puesto en peligro.', '', 30706),
(170166, 'esMX', 'Puede que mis sentimientos por la forestal oscura Velonara hayan sido románticos al principio, pero ahora la considero una querida amiga.', '', 30706),
(170155, 'esMX', '', 'Bien hecho, $n.', 30706),
(170154, 'esMX', '', 'Qué bueno verte, $n. Mantén la cabeza baja, toda esta área está repleta de partidarios de Aspafresno.\n\n<Kelsey sonríe> \n\nBueno, al menos por ahora.', 30706),
(170148, 'esMX', 'Ahora que tenemos a MADRE en la Cámara del Corazón, ¡podemos empezar a idear un plan!\n\nSolo espero que no le tome mucho tiempo terminar esos cálculos...', '', 30706),
(170146, 'esMX', '', 'Entiendo que Baine debe tener poco tiempo, pero antes de partir necesitamos hacer algunos preparativos.', 30706),
(170145, 'esMX', '', 'Confío en el maestro Shaw y confío en Anduin. Eso me basta. Dile a Baine que asistiré a la reunión... pero no iré sola y estaré preparada.', 30706),
(170141, 'esMX', '¡Nunca hay un momento de aburrimiento cuando se trata de los dioses antiguos! Me alegra que hayamos salido enteros.', '', 30706),
(170140, 'esMX', '¡Ven a pelear, cobarde!', '', 30706),
(170134, 'esMX', '', 'Se recomienda exterminación de todos los especímenes contaminados.', 30706),
(170133, 'esMX', '', 'Protocolo de descontaminación mejorado iniciado.', 30706),
(170132, 'esMX', '¡Ajj! ¡Parece que todavía queda algo de corrupción en el sistema!', '', 30706),
(170131, 'esMX', 'Pero eso fue solo el principio. Ahora oye todo lo que Azeroth dice, y siente el dolor que la aqueja.', '', 30706),
(170130, 'esMX', 'Cuando éramos niños, bromeaba con que Magni cargaba con el peso del mundo. No sabía que se lo tomaría tan a pecho.', '', 30706),
(170118, 'esMX', '¡Ay, fuego! ¡Yo me largo!', '', 30706),
(170092, 'esMX', '', 'Por supuesto, Derek. Aunque la tormenta sea intensa, la enfrentaremos... como familia.', 30706),
(170091, 'esMX', '¿Me acompañarás, Jaina? No... no sé si puedo hacer esto solo.', '', 30706),
(170090, 'esMX', '', 'No. Aún no. Pero conozco a otros que han pasado por esto. Creo que pueden ayudarte.', 30706),
(170089, 'esMX', 'No puedo ir a casa... ¿verdad?', '', 30706),
(170087, 'esMX', '', 'No lo sé. Pero encontraremos la respuesta juntos.', 30706),
(170086, 'esMX', 'Tú, mamá y Tandred sufrieron mucho. Me alegra que se hayan reecontrado, pero... ¿cuál es mi camino ahora?', '', 30706),
(170085, 'esMX', 'Sé lo de papá. La Horda espetó mentiras venenosas para enfrentarme a ti. Pero Baine explicó la verdad de lo sucedido.', '', 30706),
(170084, 'esMX', '', 'Mucho ha cambiado, Derek. Yo... Hay algo que debo decirte…', 30706),
(170083, 'esMX', 'Jaina... no puedo creer que eres tú. Eras una niña cuando zarpé. Y ahora... Lady Almirante.', '', 30706),
(170082, 'esMX', 'Gracias por confiar en Baine. Él me trató bien.', '', 30706),
(170081, 'esMX', '', 'No vino como enemigo. Esta vez.', 30706),
(170075, 'esMX', '', 'Si queremos terminar con esta guerra, debemos terminar con ella.', 30706),
(170074, 'esMX', '', 'Durante años sentí pena por Sylvanas y lo que sufrió a manos de Arthas. Pero su heroísmo ha desaparecido. Quizás ahora la Horda también lo descubra.', 30706),
(170073, 'esMX', '', 'Baine demostró compasión y honor al devolvernos a Derek. Me temo que esta decisión podría costarle la vida.', 30706),
(170072, 'esMX', 'Informa a la Lady Almirante de nuestros hallazgos. Yo volveré por mi cuenta.', '', 30706),
(170071, 'esMX', 'Lo hizo para enviar un mensaje al resto de la Horda: no tolerará el disenso.', '', 30706),
(170070, 'esMX', 'Eso fue despiadado, incluso para el alma en pena.', '', 30706),
(170069, 'esMX', 'Y en esta esquina... Un momento, ¿quién le dio cohetes? ¿Y cañones? ¡¿Por qué alguien haría esto?! ¡Es una hiper-meca-megagaviota!', '', 30706),
(170068, 'esMX', '', 'Y en esta esquina... Un momento, ¿quién le dio cohetes? ¿Y cañones? ¡¿Por qué alguien haría esto?! ¡Es una hiper-meca-megagaviota!', 30706),
(170066, 'esMX', '<Espiar la reunión de la Horda.>', '<Espiar la reunión de la Horda.>', 30706),
(170065, 'esMX', '¡Por aquí, $p!', '', 30706),
(170063, 'esMX', '', 'Te deseo suerte y espero que encuentres al maestro Shaw y a los demás con vida e ilesos.', 30706),
(170062, 'esMX', '', 'Pero aún debo ganarme su confianza.', 30706),
(170061, 'esMX', '', 'Me dirijo a uh\'tedes habiendo probado mi valor frente a los loa.', 30706),
(170060, 'esMX', '', 'Y junto a la Horda, ocupamos el lugar que nos pertenece entre los grande\' reinos de Azeroth. ¡Zandalar por siempre!', 30706),
(170059, 'esMX', '', 'Debimos enfrentar enemigos externos e internos... que pusieron a prueba nueh\'tra fe.', 30706),
(170058, 'esMX', '', 'Con la bendición de lo\' loa, nueh\'tras cuchillas sagradas y barcos poderosos controlaban los mares.', 30706),
(170055, 'esMX', 'Vi a Kelsey Chispacero pasar rápidamente hace poco, pero la gravedad de mi herida no me permitió llamar su atención. Puede que también necesite ayuda.', 'Vi a Kelsey Chispacero pasar rápidamente hace poco, pero la gravedad de mi herida no me permitió llamar su atención. Puede que también necesite ayuda.', 30706),
(170054, 'esMX', 'Oí a unos peones hablando. Dicen que la jefa de guerra ordenó mantener el área despejada. Mantente en guardia.', 'Oí a unos peones hablando. Dicen que la jefa de guerra ordenó mantener el área despejada. Mantente en guardia.', 30706),
(170053, 'esMX', '¡Eliminaron nuestros puestos de espionaje! Yo también estaría muerto si no hubieras venido. No sé qué está pasando, pero es importante.', '¡Eliminaron nuestros puestos de espionaje! Yo también estaría muerta si no hubieras venido. No sé qué está pasando, pero es importante.', 30706),
(170052, 'esMX', 'No sé qué planean, pero es grande. No quieren testigos.', 'No sé qué planean, pero es grande. No quieren testigos.', 30706),
(170051, 'esMX', 'La Horda vigila el área sistemáticamente. Ten cuidado.', 'La Horda vigila el área sistemáticamente. Ten cuidado.', 30706),
(170049, 'esMX', '', 'Doriana Lagos acaricia el cuello de Huracán afectuosamente.', 30706),
(170045, 'esMX', '<Observar la reunión.>', '<Observar la reunión.>', 30706),
(170044, 'esMX', 'Buen trabajo asegurando el área, $c. \n\nEs hora de que empiecen los festejos.', '', 30706),
(170043, 'esMX', '', 'Hola, $r. ¿Qué necesitas?', 30706),
(170040, 'esMX', '', '', 30706),
(170039, 'esMX', 'Lady Jaina, se acerca una nave de la Horda.', 'Lady Jaina, se acerca una nave de la Horda.', 30706),
(170038, 'esMX', '', '<La mirada de Jaina reposa en las ruinas de Theramore mientras te acercas.>\n\nPerdimos tanto aquí.\n\nMe pregunto si eso también me incluye.\n\nNo es la primera vez que me pregunto si me estoy convirtiendo en mi padre.', 30706),
(170037, 'esMX', '$UBienvenido:Bienvenida; a Arathi, $r. \n\nAh, ¿quieres saber qué hago?\n\nMientras ustedes están matándose, ¡yo planeo una gran renovación de este terreno abominable que será digna de la jefa de guerra!\n\n¿Qué les pasa a estos humanos? ¿Quién pone un techo tan rojo y brillante en pilares de piedra?\n\nSalvajes...', '', 30706),
(170036, 'esMX', 'El héroe se sentó para recuperar fuerzas. Hasta ahora esta prueba había sido más difícil de lo que esperaba.', 'La heroína se sentó para recuperar fuerzas. Hasta ahora esta prueba había sido más difícil de lo que esperaba.', 30706),
(170035, 'esMX', '', 'No... supongo que no.', 30706),
(170034, 'esMX', 'Tiene sentido. ¿Se te ocurre algún lugar menos vigilado por la Horda?', '', 30706),
(170033, 'esMX', '', 'Puede que no confíe en mí, Lady Almirante, pero el rey Anduin respaldará mis palabras y las de Baine.', 30706),
(170032, 'esMX', 'Lady Jaina, Valeera fue una de las amigas más cercanas del rey Varian. Si dice que Baine quiere reunirse para desafiar a Sylvanas, le creo.', '', 30706),
(170031, 'esMX', 'Si no tienes boleto, tienes que marcharte.', 'Si no tienes boleto, tienes que marcharte.', 30706),
(170030, 'esMX', 'Muéstrame tu boleto.', 'Muéstrame tu boleto.', 30706),
(170029, 'esMX', '¡Me rindo! ¡Me rindo!', '¡Me rindo! ¡Me rindo!', 30706),
(170028, 'esMX', '¡Me largo de aquí!', '¡Me largo de aquí!', 30706),
(170027, 'esMX', 'Sí, creo que eres lo bastante $urudo:ruda;...', 'Sí, creo que eres lo bastante $urudo:ruda;...', 30706),
(170026, 'esMX', '¡Basta! Bueno, me voy...', '¡Basta! Bueno, me voy...', 30706),
(170025, 'esMX', '¡Yo te mostraré dónde puedes meterte tu \"boleto\"!', '¡Yo te mostraré dónde puedes meterte tu \"boleto\"!', 30706),
(170024, 'esMX', '¡Acabas de sacar un boleto para una buena paliza!', '¡Acabas de sacar un boleto para una buena paliza!', 30706),
(170023, 'esMX', '¡No se te ocurra darme órdenes!', '¡No se te ocurra darme órdenes!', 30706),
(170022, 'esMX', '¡No puedes obligarme a irme!', '¡No puedes obligarme a irme!', 30706),
(170021, 'esMX', '¿Estos goblins te tienen como parte de la seguridad? Bien, aquí está.', '¿Estos goblins te tienen como parte de la seguridad? Bien, aquí está.', 30706),
(170020, 'esMX', 'Demasiado vestuario para $uun inspector:una inspectora; de boletos, ¿no crees? Aquí tienes.', 'Demasiado vestuario para $uun inspector:una inspectora; de boletos, ¿no crees? Aquí tienes.', 30706),
(170019, 'esMX', 'Aquí está. Aún no puedo creer que tuve que pagar para estar aquí.', 'Aún no puedo creer que tuve que pagar para estar aquí.', 30706),
(170018, 'esMX', '|cFF0000FF(Misión)|r Zarpar hacia la costa de Theramore.', '|cFF0000FF(Misión)|r Zarpar hacia la costa de Theramore.', 30706),
(170017, 'esMX', 'Aquí está. Pagué una buena suma por esto.', 'Aquí está. Pagué una buena suma por esto.', 30706),
(170016, 'esMX', '¿Es broma? ¿Con el precio que cobran estos goblins? \n\n¡Pero qué banda de ladrones!', '¿Es broma? ¿Con el precio que cobran estos goblins? \n\n¡Pero qué banda de ladrones!', 30706),
(170015, 'esMX', 'Estoy en la lista de invitados especiales. \n\nPregúntale a Gallywix, él te dirá.', 'Estoy en la lista de invitados especiales. \n\nPregúntale a Gallywix, él te dirá.', 30706),
(170014, 'esMX', 'No, no tengo un estúpido boleto. ¿Qué vas a hacer al respecto?', 'No, no tengo un estúpido boleto. \n\n¿Qué vas a hacer al respecto?', 30706),
(170013, 'esMX', '¿Boleto? \n\nOh, debo haberlo dejado en mis otras grebas...', '¿Boleto? \n\nOh, debo haberlo dejado en mis otras grebas...', 30706),
(170012, 'esMX', 'La Dama Oscura tiene mucho coraje para convocar una reunión justo delante de las narices de la Alianza. \n\n¡Eso es una demostración de poder!', 'La Dama Oscura tiene mucho coraje para convocar una reunión justo delante de las narices de la Alianza. \n\n¡Eso es una demostración de poder!', 30706),
(170011, 'esMX', 'Es un gran riesgo reunir a tantos de nuestros líderes en medio del territorio de la Alianza. \n\n¿Qué quiere demostrar Sylvanas?', 'Es un gran riesgo reunir a tantos de nuestros líderes en medio del territorio de la Alianza. \n\n¿Qué quiere demostrar Sylvanas?', 30706),
(170010, 'esMX', '¿Cuál es tu mensaje?', '¿Cuál es tu mensaje?', 30706),
(170009, 'esMX', 'Yo también confiaré en tu palabra. ¿Qué tienes para decir?', 'Yo también confiaré en tu palabra. ¿Qué tienes para decir?', 30706),
(170008, 'esMX', 'Este es un lugar extraño para convocar un consejo. \n\nMe pregunto qué está pasando.', 'Este es un lugar extraño para convocar un consejo. \n\nMe pregunto qué está pasando.', 30706),
(170007, 'esMX', '¿Por qué convocaría a todos los líderes aquí? \n\nDebe estar pasando algo grande.', '¿Por qué convocaría a todos los líderes aquí? \n\nDebe estar pasando algo grande.', 30706),
(170005, 'esMX', '', '¿Quién es el caballito más dulce de todo el valle? ¡Claro que sí!', 30706),
(170004, 'esMX', 'Huracán se aleja de ti dando coces y relinchando.', '', 30706),
(170003, 'esMX', 'Huracán relincha irritado.', '', 30706),
(170002, 'esMX', '', 'Encontrarás al viejo Huracán en el patio. No te preocupes, no es tan violento como su nombre indica. Solo un poco.', 30706),
(169997, 'esMX', '', '<Valeera te examina>\n\nHago lo que puedo, $ucampeón:campeona;, como todos.', 30706),
(169996, 'esMX', '', 'Es curioso que sigamos encontrándonos en circunstancias funestas, $n. \n\n<Valeera sonríe>\n\n¿Crees poder convencer a Lady Valiente de que no quiero matarla? Lo que tengo para decirle le interesa.', 30706),
(169995, 'esMX', '', 'Confío en el maestro Shaw y confío en Anduin. Eso me basta. Dile a Baine que asistiré a la reunión... pero no iré sola.', 30706),
(169994, 'esMX', '', 'Si no confías en mi palabra, ve a Ventormenta y pregunta si Anduin confía en mí. Pero no tenemos mucho tiempo, Lady Jaina.', 30706),
(169993, 'esMX', '', 'Baine actúa a espaldas del alma en pena. Por eso sugiere Theramore. No pretende ofenderte, solo mantener el secreto.', 30706),
(169992, 'esMX', '', 'Entonces él también debe escuchar este mensaje. Dile a Baine que iré a la reunión... después de hablar con Anduin.', 30706),
(169991, 'esMX', '', 'Confiaba en Varian... como confío en el maestro Shaw. Eso me basta. Dile a Baine que iré a la reunión... pero no iré sola.', 30706),
(169990, 'esMX', '', 'La Reina alma en pena tiene espías en todas partes. Theramore es uno de los pocos lugares que no vigila.', 30706),
(169989, 'esMX', '', 'Después de todo lo que ha hecho la Horda, ¿te atreves a...?', 30706),
(169988, 'esMX', '', 'Baine Pezuña de Sangre quiere enmendar una ofensa a tu familia. Quiere reunirse contigo en secreto... en la costa de Theramore.', 30706),
(169987, 'esMX', '', 'Escuchemos tu mensaje.', 30706),
(169986, 'esMX', '', '¡Las corrientes del tiempo están bajo mi poder! ¡No puedes ganar!', 30706),
(169985, 'esMX', '', '¡Que las olas del tiempo te aplasten!', 30706),
(169984, 'esMX', '', '¡Yo controlo el campo de batalla, no tú!', 30706),
(169983, 'esMX', '', 'El tiempo cambia de nuevo, ¡y tu fin se acerca!', 30706),
(169982, 'esMX', '', '¿Atravesarán rápidamente el tiempo? ¿O se quedarán atrapados en una eternidad sin fin?', 30706),
(169981, 'esMX', '', '¡Aquí terminan sus líneas temporales!', 30706),
(169980, 'esMX', '', 'No... es posible... Estaba destinada a ganar...', 30706),
(169979, 'esMX', '', 'Tu destino era morir.', 30706),
(169978, 'esMX', '', 'Un resultado inevitable.', 30706),
(169977, 'esMX', '', 'Justo como lo predije.', 30706),
(169976, 'esMX', '¡Yo terminaré con esto!', '', 30706),
(169975, 'esMX', 'Arderán... ¡Todos ustedes ARDERÁN!', '', 30706),
(169974, 'esMX', '¿Es todo lo que pueden exhibir?', '', 30706),
(169973, 'esMX', 'No tienen disciplina.', '', 30706),
(169972, 'esMX', 'Débil.', '', 30706),
(169971, 'esMX', 'Somos... el arma del jefe de guerra... Sin nosotros, estaría...', '', 30706),
(169970, 'esMX', 'Su tiempo se agota.', '', 30706),
(169969, 'esMX', 'Sus cuerpos alimentarán las llamas.', '', 30706),
(169968, 'esMX', 'No hay dónde esconderse ahora.', '', 30706),
(169967, 'esMX', '¡Colgaré sus cuerpos despedazados en las puertas de esta fundición!', '', 30706),
(169966, 'esMX', 'Olvídalo.', 'Olvídalo.', 30706),
(169965, 'esMX', '', 'Los llamé y vinieron. Son mucho más útiles que cualquiera de los ayudantes de dos piernas que he tenido.', 30706),
(169964, 'esMX', '¿Entonces eres una chamán?', '¿Entonces eres una chamán?', 30706),
(169963, 'esMX', '¿Tú invocaste a estos elementales?', '¿Tú invocaste a estos elementales?', 30706),
(169962, 'esMX', '', '¿Qué es una chamán?', 30706),
(169961, 'esMX', '', 'No es mi hogar, pero al menos se siente la brisa del océano.\n\nExtraño a Sam.', 30706),
(169960, 'esMX', '', 'Creí que jamás volvería a navegar. Pero aquí estoy. Soy la subalterna. Y he zarpado para unirme a la Alianza.\n\n<Doriana suspira.>\n\nEspero que Sam pueda arreglarse sin mí.', 30706),
(169959, 'esMX', '', '<Doriana luce visiblemente incómoda.>\n\nNo me gusta que me observen.', 30706),
(169958, 'esMX', '', 'Sí, accedí a ayudarte. No hagas que me arrepienta.', 30706),
(169957, 'esMX', 'Comiendo', 'Comiendo', 30706),
(169955, 'esMX', '¡Y USTEDES! ¡Nos devoraremos sus cenizas! ¡Mueran!', '', 30706),
(169954, 'esMX', 'Que la fe te guíe.', '', 30706),
(169953, 'esMX', 'Que la Luz esté contigo.', '', 30706),
(169952, 'esMX', '¡Contempla mi PODER!', '', 30706),
(169951, 'esMX', '¡Ahóguense en la sombra!', '', 30706),
(169950, 'esMX', '¡La Luz los consumirá!', '', 30706),
(169949, 'esMX', 'Miré a los ojos del dragón, y perdí la esperanza...', '', 30706),
(169948, 'esMX', '', '¡Avancen! ¡Por la Alianza!', 30706),
(169947, 'esMX', '', 'Capturemos los estandartes andrajosos de la Horda y los colgaremos de nuestras murallas para enviarles un mensaje. ¡Muéstrenles la fuerza de los centinelas!', 30706),
(169946, 'esMX', '', 'Bienvenidos, campeones. Los centinelas están preparándose para la batalla. Sugiero que hagan lo mismo.', 30706),
(169945, 'esMX', '', 'Esos brutos de la Horda buscan profanar nuestra tierra. ¡Asesínenlos sin remordimientos!', 30706),
(169944, 'esMX', '', 'Hermanos y hermanas, debemos prepararnos para la batalla. Nos esperan lo guerreros más despiadados de la Horda.', 30706),
(169942, 'esMX', '¡Vamos, luchen! ¡Por la Horda!', '', 30706),
(169941, 'esMX', 'No les den cuartel a esos perros de la Alianza. Derríbenlos y traigan sus estandartes como trofeos. ¡Lok-tar O\'gar!', '', 30706),
(169940, 'esMX', 'Cuando el héroe entró en la recámara, se encontró ante las criaturas contra las que había luchado, pero en una versión más grande. Tal vez esa era la prueba que había venido a realizar.', 'Cuando la heroína entró en la recámara, se encontró ante las criaturas contra las que había luchado, pero en una versión más grande. Tal vez esa era la prueba que había venido a realizar.', 30706),
(169939, 'esMX', 'Es un honor representar a la Horda en Garganta Grito de Guerra. ¡Peleen con la frente en alto y con ferocidad!', '', 30706),
(169938, 'esMX', 'Concéntrense, guerreros de la Horda. Nuestra jefa de guerra no aceptará más que la victoria.', '', 30706),
(169937, 'esMX', 'Es un lindo día para una batalla. ¡Hoy nos quedaremos con la gloria!', '', 30706),
(169932, 'esMX', 'El héroe trató de abrir una de las puertas, pero no se movía. Tendría que avanzar contra las criaturas que estaban ante él.', 'La heroína trató de abrir una de las puertas, pero no se movía. Tendría que avanzar contra las criaturas que estaban ante ella.', 30706),
(169926, 'esMX', '', '¡Por los Rapiñadores! ¡Por la Horda!', 30706),
(169925, 'esMX', '', 'Campeones, los recursos de este lugar son vitales para alimentar nuestra máquina de guerra. Las órdenes de la jefa de guerra son asaltar y dominar la tierra sea como sea. Que no quede nadie en pie.', 30706),
(169924, 'esMX', 'Son todos mentirosos y charlatanes.\n\nApuesto a que tengo algunas historias que aún no has escuchado.', 'Son todos mentirosos y charlatanes.\n\nApuesto a que tengo algunas historias que aún no has escuchado.', 30706),
(169923, 'esMX', '¿Tienes algún rumor para compartir, $n?', '¿Tienes algún rumor para compartir, $n?', 30706),
(169922, 'esMX', '...Claro que tuve que soltarlo. ¿Cómo esperabas que subiera un tiburón ballena a bordo?\n\n<Te codea suavemente en las costillas.>\n\n¿No es cierto? \n\nDime, ¿qué necesitas?', '...Claro que tuve que soltarlo. ¿Cómo esperabas que subiera un tiburón ballena a bordo?\n\n<Te codea suavemente en las costillas.>\n\n¿No es cierto? \n\nDime, ¿qué necesitas?', 30706),
(169921, 'esMX', '... ¿De verdad me estás diciendo que un tentáculo gigante te arrastró hacia el fondo del mar y que ahora estás aquí contando la historia?\n\n<Señala a la persona con la que estaba conversando.>\n\n¿Puedes creer tantas patrañas?\n\nEn fin. ¿Qué puedo hacer por ti?', '... ¿De verdad me estás diciendo que un tentáculo gigante te arrastró hacia el fondo del mar y que ahora estás aquí contando la historia?\n\n<Señala a la persona con la que estaba conversando.>\n\n¿Puedes creer tantas patrañas?\n\nEn fin. ¿Qué puedo hacer por ti?', 30706),
(169920, 'esMX', '...Es en serio, ¡en esa isla había monos voladores! ¿Por qué inventaría algo así?\n\n<Suspira nerviosamente y se voltea hacia ti.>\n\n... Hola, $Uforastero:forastera;. ¿Vienes a compartir tus historias?', '...Es en serio, ¡en esa isla había monos voladores! ¿Por qué inventaría algo así?\n\n<Suspira nerviosamente y se voltea hacia ti.>\n\n... Hola, $Uforastero:forastera;. ¿Vienes a compartir tus historias?', 30706),
(169919, 'esMX', '... Entonces le dije que podía soltar su ancla...\n\n<Se aclara la garganta y te observa.>\n\n¿Vas a seguir husmeando o necesitas algo?', '... Entonces le dije que podía soltar su ancla...\n\n<Se aclara la garganta y te observa.>\n\n¿Vas a seguir husmeando o necesitas algo?', 30706),
(169918, 'esMX', '... ¡La ola era más alta que yo! Cayó con fuerza sobre la cubierta...\n\n<Se percata de tu presencia y se voltea para verte.>\n\nEh, ¿necesitas algo?', '... ¡La ola era más alta que yo! Cayó con fuerza sobre la cubierta...\n\n<Se percata de tu presencia y se voltea para verte.>\n\nEh, ¿necesitas algo?', 30706),
(169917, 'esMX', '¿Sabes dónde puedo encontrar a D. Lagos?', '¿Sabes dónde puedo encontrar a D. Lagos?', 30706),
(169916, 'esMX', '<Se detiene en la mitad de la oración y te observa.>\n\n¿Sí?', '<Se detiene en la mitad de la oración y te observa.>\n\n¿Sí?', 30706),
(169915, 'esMX', '', 'Bien. Entonces tiene mi atención.', 30706),
(169914, 'esMX', 'El rey Varian lo hizo.', '', 30706),
(169913, 'esMX', '', '¿Podemos confiar en ella?', 30706),
(169912, 'esMX', '', 'Tengo un mensaje para la Lady Almirante.', 30706),
(169911, 'esMX', '¡Todos atrás! Explica por qué estás aquí, Valeera. Ahora.', '', 30706),
(169910, 'esMX', '', 'Nada mal, Shaw.', 30706),
(169909, 'esMX', '¡Muéstrate!', '', 30706),
(169908, 'esMX', 'La ambición puede corromper... Un momento. No estamos solos.', '', 30706),
(169907, 'esMX', '', 'Sabía que Aspafresno era traicionera, pero aliarse con la Horda fue una bajeza inesperada.', 30706),
(169906, 'esMX', '', 'Afilen sus espadas y envenenen sus dagas. ¡Hoy la Cuenca de Arathi será de la Horda!', 30706),
(169904, 'esMX', '', 'Prepárense para la batalla, campeones. La Alianza seguramente tiene preparada una fuerza formidable.', 30706),
(169903, 'esMX', '', 'Bienvenidos al segundo hogar de los Rapiñadores. También será su casa mientras sobrevivan. ¡Prepárense!', 30706),
(169902, 'esMX', '\"La tinta de la pluma y la sangre de las venas$b$bse entremezclan y encadenan.$b$bDel púrpura y el negro combinados$b$bsurge un destripador con sangre vinculado\".', '\"La tinta de la pluma y la sangre de las venas$b$bse entremezclan y encadenan.$b$bDel púrpura y el negro combinados$b$bsurge un destripador con sangre vinculado\".', 30706),
(169901, 'esMX', 'De pronto una voz invadió la cabeza del héroe. Con un tono lírico, recitaba un poema.', 'De pronto una voz invadió la cabeza $Udel héroe:de la heroína;. Con un tono lírico, recitaba un poema.', 30706),
(169900, 'esMX', '...y cuando la recuperó estaba en una cámara extraña.', '...y cuando la recuperó estaba en una cámara extraña.', 30706),
(169899, 'esMX', 'Lo tenemos. Ahora preparemos este barco para zarpar.', '', 30706),
(169896, 'esMX', '¡Victoria para la Alianza!', '', 30706),
(169895, 'esMX', '<Toma la llave.>', '<Toma la llave.>', 30706),
(169894, 'esMX', '<El diario está ahuecado y tiene una llave escondida dentro.>', '', 30706),
(169890, 'esMX', '¡Héroes! La Horda nos pisa los talones y es hora de oponer resistencia. Su rey ha declarado que esta tierra y sus recursos son vitales para conseguir la victoria. ¡Defiendan la cuenca, por el rey!', '', 30706),
(169889, 'esMX', 'Casi puedo oler su hedor desde aquí. Prepárense, campeones. Los aplastaremos como los perros que son.', '', 30706),
(169888, 'esMX', 'Déjenme observarlos un segundo. Permítanme decirlo, ¡son una fuerza excelente! La batalla debería ser rápida y decisiva.', '', 30706),
(169887, 'esMX', 'Bienvenidos a la cuenca de Arathi, campeones. Es un honor para la Liga de Arathor que vengan a luchar aquí con nosotros.', '', 30706),
(169885, 'esMX', 'Sí. Los Lagos viven en las afueras del pueblo, creo que en algún lugar de La Rivera Muerta. No voy muy seguido para ese lado.', 'Sí. Los Lagos viven en las afueras del pueblo, creo que en algún lugar de La Rivera Muerta. No voy muy seguido para ese lado.', 30706),
(169884, 'esMX', '¿La persona que construye barcos? He oído que falleció.', '¿La persona que construye barcos? He oído que falleció.', 30706),
(169883, 'esMX', '¿Lagos? Ah, sí. Recorro el camino desde Fuerte Daelin todo el tiempo y nos hemos cruzado en algunas ocasiones. Espero que eso te sea de ayuda.', '¿Lagos? Ah, sí. Recorro el camino desde Fuerte Daelin todo el tiempo y nos hemos cruzado en algunas ocasiones. Espero que eso te sea de ayuda.', 30706),
(169882, 'esMX', '¿LAGOS? ¿El apellido más famoso entre los carpinteros de barcos? ¿La persona que diseñó la nave insignia kultirana? ¿Fuerte, de gran estatura y que podría construir un bote sin derramar una gota de sudor? Nop, no tengo idea de quién es.', '¿LAGOS? ¿El apellido más famoso entre los carpinteros de barcos? ¿La persona que diseñó la nave insignia kultirana? ¿Fuerte, de gran estatura y que podría construir un bote sin derramar una gota de sudor? Nop, no tengo idea de quién es.', 30706),
(169881, 'esMX', 'Sí, claro. Lagos trae un carro desde el norte ocasionalmente.', 'Sí, claro. Lagos trae un carro desde el norte ocasionalmente.', 30706),
(169880, 'esMX', '¿No es ese el nombre de una persona famosa que construye barcos? Juraría que lo he oído antes...', '¿No es ese el nombre de una persona famosa que construye barcos? Juraría que lo he oído antes...', 30706),
(169879, 'esMX', 'Aunque no lo vi con mis propios ojos, he oído que Lagos una vez construyó una nave en tan solo un día. Envíale saludos de mi parte, ¿sí?', 'Aunque no lo vi con mis propios ojos, he oído que Lagos una vez construyó una nave en tan solo un día. Envíale saludos de mi parte, ¿sí?', 30706),
(169878, 'esMX', '¿Quién?', '¿Quién?', 30706),
(169875, 'esMX', '<Toma la carta.>', '<Toma la carta.>', 30706),
(169874, 'esMX', '', ' <Lady Jaina Valiente te extiende una carta doblada.>\n\nPuedes leerla si quieres. Es un poco sentimental, pero no es nada demasiado privado.', 30706),
(169871, 'esMX', '¿Sacudematas? ¡No!\n\nQué pena. Era un buen muchacho. Daba buenos abrazos. Sus plumas eran muy suaves. Seguramente lo mataron los mismos que me dejaron aquí varado.', '', 30706),
(169870, 'esMX', '¡El Bizmo de la arena es un impostor! ¡Desenmascarémoslo y averigüemos qué está pasando!', '', 30706),
(169869, 'esMX', '<Cuéntale a Bizmo acerca del asesinato de Sacudematas.>', '<Cuéntale a Bizmo acerca del asesinato de Sacudematas.>', 30706),
(169868, 'esMX', '¡Gracias! ¡No tenías ninguna obligación, cariño!\n\n¿Y? ¿Qué me perdí mientras no estuve?', '', 30706),
(169867, 'esMX', '<Ofrécele 2 de oro a Bizmo para que pueda regresar a casa.>', '<Ofrécele 2 de oro a Bizmo para que pueda regresar a casa.>', 30706),
(169866, 'esMX', '<Ofrécele tu piedra de hogar a Bizmo para que pueda regresar a casa.>', '<Ofrécele tu piedra de hogar a Bizmo para que pueda regresar a casa.>', 30706),
(169865, 'esMX', 'No sé quién es ese Bizmo con el que estuviste trabajando, ¡pero es un traidor! No sé quién... o qué... será, pero sí sé que no es yo. ¡Yo soy yo!\n\nTe diré todo lo que sé.\n\nNo sé qué sucedió. Me atraparon por la espalda. Hubo un forcejeo y después... oscuridad. Y después estaba aquí, al otro lado del mundo, sin una piedra de hogar ni una moneda a mi nombre.', '', 30706),
(169864, 'esMX', '¿Qué? ¿Bizmo? Creí que estabas a cargo del Club de Lucha de Bizmo. ¿Qué está sucediendo?', '¿Qué? ¿Bizmo? Creí que estabas a cargo del Club de Lucha de Bizmo. ¿Qué está sucediendo?', 30706),
(169863, 'esMX', '¿Tú... eres de mi Club de Lucha? ¡Soy yo! ¡Bizmo!\n\n¡El AUTÉNTICO Bizmo!', '', 30706),
(169862, 'esMX', 'Te veré de regreso en el Club de Lucha, $p. ¡Desenmascaremos a mi falso yo y lleguemos al fondo de este misterioso asesinato!', '', 30706),
(169858, 'esMX', 'Zarpa hacia Theramore.', 'Zarpa hacia Theramore.', 30706),
(169857, 'esMX', 'Como maresabio, puedo invocar los poderes del mar para guiar esta nave hasta su destino.\n\nCuando digas, levaremos anclas.', '', 30706),
(169856, 'esMX', 'Tengo noticias, Alto comandante. Encontré esta carta de Lady Aspafresno.', 'Tengo noticias, Alto comandante. Encontré esta carta de Lady Aspafresno.', 30706),
(169855, 'esMX', '', 'Volveremos a vernos... no tengo dudas.', 30706),
(169853, 'esMX', 'Por favor regrese al estrado, $useñor:señorita; $n.', '', 30706),
(169852, 'esMX', 'En efecto. Si miente en mi tribunal una vez más, $n, ¡$ulo:la; acusaré de desacato!', '', 30706),
(169851, 'esMX', '', '¡Mentira! Su señoría, sabe perfectamente que $uel:la; testigo está mintiendo.', 30706),
(169850, 'esMX', '', '$UEl:La; testigo miente, su señoría. Todos estuvimos allí. Todos vimos esa paliza épica.', 30706),
(169849, 'esMX', '', '¿En serio? ¿No recuerda nada? Bien, continuemos.', 30706),
(169848, 'esMX', '', 'Recuerde que ESTÁ bajo juramento, $n.', 30706),
(169847, 'esMX', '', '$n, investigamos el caso $Ujuntos:juntas;. ¿No estaba prestando atención? Ay...', 30706),
(169846, 'esMX', '', 'Qué extraño, creí estar en lo correcto... Prosigamos, entonces. ¿Es cierto que en sus discusiones con Lord Browne descubrió un posible motivo?', 30706),
(169845, 'esMX', 'Por último, quiero preguntarle, $n: ¿quién cree USTED que mató al intendente?', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(169844, 'esMX', '', '¡Los tres acusados enfrentan el cargo de asesinar al intendente Sacudematas!', 30706),
(169843, 'esMX', 'Todos de pie. El juez Bizmo abandona la sala. Albóndiga tiene hambre. Se levanta la sesión.', '', 30706),
(169842, 'esMX', 'Me gustaría que la corte entre en receso para que su equipo investigue esta evidencia en detalle.', '', 30706),
(169841, 'esMX', 'Comandante Daalo, su asociado jinyu ha encontrado información relevante para el planteo de la fiscalía.', '', 30706),
(169840, 'esMX', 'Ya veo. Es muy inusual... pero lo permitiré.', '', 30706),
(169839, 'esMX', 'Acérquese.', '', 30706),
(169838, 'esMX', 'Necesito un minuto de su tiempo, su señoría.', '', 30706),
(169837, 'esMX', '¡Alto! ¡Detengan todo!', '', 30706),
(169836, 'esMX', 'En el caso de la Alianza contra Browne, O\'Flannerty, Lazarby y $n, encontramos a...', '', 30706),
(169835, 'esMX', '¡Qué intrigante! Prosiga, señor presidente.', '', 30706),
(169834, 'esMX', 'Así es, su señoría.', '', 30706),
(169833, 'esMX', 'Ya veo. ¿Y han encontrado a algún culpable entre los presentes?', '', 30706),
(169832, 'esMX', 'El jurado ha llegado a un veredicto, su señoría.', '', 30706),
(169831, 'esMX', 'Muy bien. Ahora me gustaría darle al jurado la oportunidad de deliberar...', '', 30706),
(169830, 'esMX', '', 'La defensa descansa, su señoría.', 30706),
(169829, 'esMX', '', 'No hay otra explicación para lo obvio: $n mató a Sacudematas.', 30706),
(169828, 'esMX', '', '$n nos ha mentido todo este tiempo. Se comporta como $uun asesino:una asesina; con algo que esconder.', 30706),
(169827, 'esMX', '', 'Me gustaría presentarle al jurado esta foto S.E.L.F.I.E. que muestra claramente cómo $N infringe la ley distribuyendo invitaciones ilegales al Club de Lucha. ¡No tiene ningún respeto por la ley!', 30706),
(169826, 'esMX', '', '¿Su sed de sangre no tiene fin? Y por último: $useñor:señorita; $n. Usted acusó a mi cliente huargen de asesinato.', 30706),
(169825, 'esMX', '', 'Sin embargo, asesinaste a dos ingenieros inocentes mientras investigabas a mi cliente, ¿es correcto?', 30706),
(169824, 'esMX', '', '¿Ven? $uÉl:Ella; tiene motivos económicos. Y, $useñor:señorita; $n, usted ha acusado a mi intachable cliente enano de haber asesinado al intendente.', 30706),
(169823, 'esMX', '', '¡Pero los registros indican que USTED asesinó a Lord Sylysthrel para robar su bien habido oro del luchador! ¿Es eso correcto?', 30706),
(169822, 'esMX', '', '$uSeñor:Señorita; $n. Ha acusado a mi cliente humano de tener motivos para matar a nuestro intendente.', 30706),
(169821, 'esMX', '', '¡$n asesinó a Sacudematas!', 30706),
(169820, 'esMX', '', 'Nos gustaría presentar una teoría alternativa al jurado:', 30706),
(169819, 'esMX', '', 'Gracias, su señoría.', 30706),
(169818, 'esMX', 'Gracias, abogado. ¿La defensa?', '', 30706),
(169817, 'esMX', '', 'La fiscalía descansa, su señoría.', 30706),
(169816, 'esMX', '', '¡Estaba poseído por un demonio!', 30706),
(169815, 'esMX', '', '¡Era un espía de la Horda!', 30706),
(169814, 'esMX', '', '¡Estaba tan aburrido con el Club de Lucha que robó tiendas!', 30706),
(169813, 'esMX', '', '¡Estaba tan aburrido con el Club de Lucha que lanzó un escupitajo desde el salón VIP!', 30706),
(169812, 'esMX', '', 'La falsificación de invitaciones a causa del aburrimiento requiere una gran cantidad de ingresos disponibles, y esto concuerda con la espada enjoyada que $n encontró en la escena.', 30706),
(169811, 'esMX', '', 'Estaba tan aburrido con el Club de Lucha que empezó a distribuir invitaciones falsas.', 30706),
(169810, 'esMX', '', 'Grant Lazarby tenía un excelente motivo para asesinar a Sacudematas:', 30706),
(169809, 'esMX', 'No, está equivocada...', '', 30706),
(169808, 'esMX', '', '¡Quería entregar el sombrero de nuestro intendente al Rey Exánime!', 30706),
(169807, 'esMX', '', '¡Quería vender el sombrero de nuestro intendente al mejor postor!', 30706),
(169806, 'esMX', '', '¡Quería entregar el sombrero de nuestro intendente como alimento para un monstruo de las sombras invisible!', 30706),
(169805, 'esMX', '', '¡Quería entregar el corazón de nuestro intendente al Rey Exánime!', 30706),
(169804, 'esMX', '', '¡Quería vender el corazón de nuestro intendente al mejor postor!', 30706),
(169803, 'esMX', '', '¡Quería entregar el corazón de nuestro intendente como alimento para un monstruo de las sombras invisible!', 30706),
(169802, 'esMX', '', '¡Quería entregar el alma de nuestro intendente al Rey Exánime!', 30706),
(169801, 'esMX', '', '¡Quería vender el alma de nuestro intendente al mejor postor!', 30706),
(169800, 'esMX', '', 'Esto encaja con la evidencia que encontró $n en la escena del crimen: un pergamino sombrío.', 30706),
(169799, 'esMX', '', '¡Quería entregar el alma de nuestro intendente como alimento para un monstruo de las sombras invisible!', 30706),
(169798, 'esMX', '', 'El maestro de las sombras O\'Flannerty también tenía un buen motivo:', 30706),
(169797, 'esMX', '¡Cómo... te... atreves...!', '', 30706),
(169796, 'esMX', '', '¡Él mató a Sacudematas para encubrir otro asesinato!', 30706),
(169795, 'esMX', '', '¡Él y Sacudematas eran parte de un triángulo amoroso!', 30706),
(169794, 'esMX', '', 'Tenía grandes deudas con Jaina Valiente.', 30706),
(169793, 'esMX', '', 'Tenía grandes deudas con Thrall.', 30706),
(169792, 'esMX', '', 'Esto encaja con la evidencia que $ encontró en la escena: un cajón de suministros valiosos había sido robado.', 30706),
(169791, 'esMX', '', 'Tenía grandes deudas con Lord Sylysthrel.', 30706),
(169790, 'esMX', '', 'Lord Winifred Browne tenía un buen motivo para matar a Sacudematas:', 30706),
(169789, 'esMX', '', 'Damas y caballeros del jurado, han escuchado la evidencia.', 30706),
(169788, 'esMX', 'Pfshh. Si divertirse un poco es un crimen, entonces soy culpable. Pagaré cualquier multa que decidan. Terminemos con esto.', '', 30706),
(169787, 'esMX', '', 'Ya veo. ¿Y qué CRIMEN cometió por aburrimiento?', 30706),
(169786, 'esMX', '', '¿Y cuál era ese motivo?', 30706),
(169785, 'esMX', '', 'Gracias. Y, $n, ¿es cierto que en sus discusiones con el señor Lazarby descubrió un posible motivo?', 30706),
(169784, 'esMX', '', '¿Qué evidencia encontró en la escena del crimen que implicara al señor Lazarby?', 30706),
(169783, 'esMX', '', 'Por último, $n, me gustaría preguntarle sobre Grant Lazarby.', 30706),
(169782, 'esMX', 'Lo siento.', '', 30706),
(169781, 'esMX', '¡No permitiré el desorden en mi tribunal de la gresca!', '', 30706),
(169780, 'esMX', '¡N-n-no comprende! Y-yo...', '', 30706),
(169779, 'esMX', '', '¿Y a quién iba a darle ese sombrero?', 30706),
(169778, 'esMX', '', '¿Y a quién iba a darle ese corazón?', 30706),
(169777, 'esMX', '', '¿Y a quién iba a darle esa alma?', 30706),
(169776, 'esMX', '', '¿Y cuál era ese motivo?', 30706),
(169775, 'esMX', '', 'Gracias. Y, $n, ¿es cierto que en sus discusiones con el señor O\'Flannerty descubrió un posible motivo?', 30706),
(169774, 'esMX', '', '$n, usted también encontró evidencia que podría implicar al maestro de las sombras O\'Flannerty. ¿Qué encontró?', 30706),
(169773, 'esMX', '¿Qui-quién, yo?', '', 30706),
(169772, 'esMX', '', 'Gracias, su señoría. Me gustaría continuar con algunas preguntas sobre un tal maestro de las sombras O\'Flannerty.', 30706),
(169771, 'esMX', 'Abogada, puede continuar.', '', 30706),
(169770, 'esMX', 'Es poco ortodoxo, pero lo permitiré.', '', 30706),
(169769, 'esMX', '¡Tu gran bocota será tu fin, $pr! ¡A las armas!', '', 30706),
(169768, 'esMX', '', '¿Y a quién le debía el dinero?', 30706),
(169767, 'esMX', '¡OBJECIÓN!', '', 30706),
(169766, 'esMX', '', '¿Y cuál era ese motivo?', 30706),
(169765, 'esMX', '', 'Gracias. Y, $n, ¿es cierto que en sus discusiones con Lord Browne descubrió un posible motivo?', 30706),
(169764, 'esMX', '', '¿Y cuál era esa evidencia?', 30706),
(169763, 'esMX', '', '$n, ¿es cierto que encontró evidencia en la escena del crimen que implica a Lord Browne?', 30706),
(169762, 'esMX', '¡Ejem!', '', 30706),
(169761, 'esMX', '', '$n, me gustaría hacerle algunas preguntas sobre Lord Winifred Browne.', 30706),
(169760, 'esMX', '', 'La fiscalía llama a $n al estrado.', 30706),
(169759, 'esMX', 'Gracias, Ulaani. Fiscal, su testigo.', '', 30706),
(169758, 'esMX', '', '¡Mis clientes son inocentes!', 30706),
(169757, 'esMX', 'Gracias, abogada. ¿Los comentarios de apertura de la defensa?', '', 30706),
(169756, 'esMX', '', 'Los tres acusados enfrentan cargos de asesinato. ¡Queremos demostrar que al menos uno es culpable!', 30706),
(169755, 'esMX', '', 'Gracias, su señoría.', 30706),
(169754, 'esMX', 'La fiscalía puede proceder.', '', 30706),
(169753, 'esMX', 'Bien. El jurado puede sentarse.', '', 30706),
(169751, 'esMX', 'Oficial Albóndiga, tómele juramento al jurado.', '', 30706),
(169750, 'esMX', 'Escuchen, jurado. ¿Juran decir toda la verdad, ante los ojos de la Luz?', '', 30706),
(169749, 'esMX', 'Hoy presenciamos el caso del pueblo de la Alianza contra Browne, O\'Flannerty y Lazarby.', '', 30706),
(169748, 'esMX', 'El tribunal del Club de Lucha entra en sesión. El juez Bizmo preside. Albóndiga tiene hambre.', '', 30706),
(169747, 'esMX', 'Escuchen todos.', '', 30706),
(169746, 'esMX', 'Aunque muchos de los acontecimientos en torno a tu prueba ahora están en el libro, tu historia aún no ha llegado al desenlace.', '', 30706),
(169745, 'esMX', 'Sigue escribiendo tu historia.', 'Sigue escribiendo tu historia.', 30706),
(169744, 'esMX', 'La visión del héroe se nubló...', 'La visión de la heroína se nubló...', 30706),
(169738, 'esMX', 'No me hagas perder el tiempo, $c. \n\nVuelve cuando sepas algo que valga la pena escuchar.', '', 30706),
(169737, 'esMX', 'Nada importante. <No informes el pedido de Pezuña de Sangre.>', 'Nada importante. <No informes el pedido de Pezuña de Sangre.>', 30706),
(169736, 'esMX', 'Baine Pezuña de Sangre me ha pedido que lo ayude con una tarea secreta.', 'Baine Pezuña de Sangre me ha pedido que lo ayude con una tarea secreta.', 30706),
(169735, 'esMX', '¿Así que Pezuña de Sangre quiere actuar desde las sombras? Tenemos que averiguar qué planea.\n\nSíguele la corriente, $n. Tienes mi protección, así que no te preocupes si tienes que ensuciarte las manos para mantener las apariencias.\n\nHaz lo que te pida y cuéntame que descubriste.', '', 30706),
(169734, 'esMX', '¿Tienes algo que informar, $n?', '', 30706),
(169733, 'esMX', '', '¡$C! ¡Traigo un mensaje urgente del gran jefe!', 30706),
(169732, 'esMX', 'No olvidaré lo que has hecho hoy. Cuídate, $n.', '', 30706),
(169731, 'esMX', 'Sintió que el libro absorbía su esencia.', 'Sintió que el libro absorbía su esencia.', 30706),
(169729, 'esMX', '\"Cuando la pluma del héroe tocó el papiro en blanco, algo comenzó a moverse en las páginas.', '\"Cuando la pluma de la heroína tocó el papiro en blanco, algo comenzó a moverse en las páginas.', 30706),
(169727, 'esMX', 'Cuando acerqué la mano, el libro comenzó a escribirse solo...', 'Cuando acerqué la mano, el libro comenzó a escribirse solo...', 30706),
(169721, 'esMX', '¡Nos encontraremos contigo allí enseguida!', '', 30706),
(169720, 'esMX', 'No hay tiempo para charlas, Barbabronce. ¡Ustedes dos ya tendrían que haber salido para mi laboratorio hace rato!', '', 30706),
(169719, 'esMX', 'Es que yo...', '', 30706),
(169718, 'esMX', '¡Sí, claro! ¡El Chispatrueno está completamente cargado con la esencia de Hati! ¡¿Por qué no lo dijiste antes?!', '', 30706),
(169717, 'esMX', 'Lo siento, Mimiron. Solo absorbimos...', '', 30706),
(169716, 'esMX', 'Por fin los encuentro a ustedes dos. ¡Su batalla con la esencia de Hati frió mis relés de truenolocalización!', '', 30706),
(169715, 'esMX', 'Mira, ¡se acerca uno de los robotitos de Mimiron!', '', 30706),
(169714, 'esMX', 'Ya es hora, $p. ¡Absorbe la esencia de Hati en el Chispatrueno!', '', 30706),
(169713, 'esMX', 'Sé que duele, amiguito. ¡Solo resiste un poco más!', '', 30706),
(169712, 'esMX', 'La esencia de Hati gime adolorida.', '', 30706),
(169711, 'esMX', 'Sí, se sacrificó por todos nosotros. ¡No podemos abandonarlo ahora!', '', 30706),
(169709, 'esMX', 'Siento que el alma de Hati está expuesta. Ha soportado tantas luchas... ¡tanto dolor!', '', 30706),
(169708, 'esMX', 'Lo intentaré, pero por ahora necesitamos concentrarnos en aplacar la angustia de Hati.', '', 30706),
(169707, 'esMX', '¡Por el trueno de Muradin! ¡La próxima vez ten cuidado con la barba!', '', 30706),
(169706, 'esMX', 'No, solo estaba buscando pistas.', 'No, solo estaba buscando pistas.', 30706),
(169705, 'esMX', '', 'Y entonces... ¿$ulisto:lista; para una pelea?', 30706),
(169704, 'esMX', 'Este cajón está completamente vacío. Lo forzaron y se llevaron todo su contenido.\n\nSacudematas era el intendente de la arena, y comerciaba artículos valiosos. Quien haya robado esta mercadería puede haber tenido |cFF0000FFmotivos económicos|r.', 'Este cajón está completamente vacío. Lo forzaron y se llevaron todo su contenido.\n\nSacudematas era el intendente de la arena, y comerciaba artículos valiosos. Quien haya robado esta mercadería puede haber tenido |cFF0000FFmotivos económicos|r.', 30706),
(169702, 'esMX', 'Sacudematas yace sobre la mesa, sin respirar, con una espada clavada en el centro de su enorme pecho emplumado.\n\nSospechas que esto fue lo que lo mató.\n\nLa espada tiene incrustaciones de oro y piedras preciosas. Quien haya comprado esta arma debió tener acceso a una |cFF0000FFgran fortuna|r. ', 'Sacudematas yace sobre la mesa, sin respirar, con una espada clavada en el centro de su enorme pecho emplumado.\n\nSospechas que esto fue lo que lo mató.\n\nLa espada tiene incrustaciones de oro y piedras preciosas. Quien haya comprado esta arma debió tener acceso a una |cFF0000FFgran fortuna|r. ', 30706),
(169700, 'esMX', 'No estás solo, Barbabronce. ¡Por las tierras salvajes!', '', 30706),
(169699, 'esMX', '¡La esencia de Hati aúlla furibunda!', '', 30706),
(169698, 'esMX', '¡¡¡KROLMIR!!!', '', 30706),
(169697, 'esMX', 'AAH, ¡mala idea, mala idea!', '', 30706),
(169696, 'esMX', 'Todo el dolor que hay aquí te está jugando una mala pasada, ¿verdad, amiguito? ¡Solo estás asustado!', '', 30706),
(169695, 'esMX', 'Veré si logro que venga sin luchar. Mantén la distancia, $p.', '', 30706),
(169694, 'esMX', 'Tranquilo, muchacho. Tranquilo...', '', 30706),
(169693, 'esMX', 'Estoy listo.', 'Estoy lista.', 30706),
(169692, 'esMX', 'He oído las historias sobre lo que pasó aquí. Esperaba nunca tener que verlo con mis propios ojos.', '', 30706),
(169663, 'esMX', 'Lamento que viajemos tan apretados. Estos botes no han sido diseñados para tauren.', '', 30706),
(169657, 'esMX', 'Hora de jugar un juego. Párate junto a las pistas que espío... ¡o arde!', '', 30706),
(169655, 'esMX', '¡Veamos cómo lo haces sin los ojos!', '', 30706),
(169629, 'esMX', '¡Vientos marinos, inflen nuestras velas! ¡Guíen nuestra nave a través de los océanos!', '', 30706),
(169628, 'esMX', 'Entonces no perdamos más tiempo. ¿$C?', '', 30706),
(169627, 'esMX', 'Es que hubo... complicaciones... pero ya estamos listos para partir.', '', 30706),
(169626, 'esMX', 'Tardaron más de lo que esperaba. Temí que los hubieran atrapado.', '', 30706),
(169625, 'esMX', 'Mmm. Esa cerradura es muy compleja. Creo que tenemos un problema.', '', 30706),
(169624, 'esMX', 'Al menos... tan cerca como permite la no-muerte.', '', 30706),
(169623, 'esMX', '¡Por aquí! Está inconsciente, pero sigue con vida...', '', 30706),
(169622, 'esMX', 'Valiente debe estar bajo cubierta. Apresúrate.', '', 30706),
(169621, 'esMX', 'Bueno, esa es otra forma de hacerlo...', '', 30706),
(169620, 'esMX', 'En guardia. Esto seguramente alertará a todos dentro.', '', 30706),
(169619, 'esMX', 'Es una pena, pero tal vez tengamos que derramar sangre hoy.', '', 30706),
(169618, 'esMX', 'La tripulación del barco solo es leal a Sylvanas. Nuestra traición no pasará inadvertida.', '', 30706),
(169617, 'esMX', '$n, usa el gancho de agarre para abordar el barco. Yo te seguiré.', '', 30706),
(169616, 'esMX', 'Llegamos. Zelling, espera aquí mientras despejamos la cubierta.', '', 30706),
(169615, 'esMX', 'Veneradas mareas, llévennos raudamente y en silencio hasta nuestra presa.', '', 30706),
(169614, 'esMX', 'El Venganza Veloz ha anclado en la salida del muelle. Zelling nos llevará hasta allí.', '', 30706),
(169613, 'esMX', 'Debe reunirse con nosotros en Theramore. Si no, nuestros esfuerzos habrán sido en vano.', '', 30706),
(169611, 'esMX', '', 'Gracias, Erata. Y a ti, $n. Ha llegado la hora de dirigirme a mi pueblo.', 30706),
(169610, 'esMX', 'Veo que eres $uun:una; colega escriba. ¿Te interesa expandir tu conocimiento?$b$bTambién tengo suministros en caso de que los necesites.', '', 30706),
(169609, 'esMX', 'Hola, $uviajero:viajera; ¿Has venido en busca de conocimientos de escriba?$b$b¿O acaso necesitas más suministros para tu viaje?', '', 30706),
(169608, 'esMX', 'La jardinería requiere una mano delicada.', '', 30706),
(169607, 'esMX', '¡Pisa con cuidado en mi jardín!', '', 30706),
(169606, 'esMX', 'Te haré morder la hierba, $c.', '', 30706),
(169605, 'esMX', '¡Un poquito de agua para ti!', '', 30706),
(169598, 'esMX', 'Dejó de devorarse a sí mismo por un rato para probar un bocado de $Unuestro retador:nuestra retadora;: recibamos a... ¡Uróboros!', '', 30706),
(169597, 'esMX', '', 'En un receso de devorarse a sí mismo para probar un bocado de $Unuestro retador:nuestra retadora;, recibamos a... ¡Uróboros!', 30706),
(169588, 'esMX', '', 'La luz de los loa te ilumina, mi reina.', 30706),
(169584, 'esMX', 'Espío... ¡un conocedor anfibio de insectos!', '', 30706),
(169583, 'esMX', 'Espío... ¡una criatura de las profundidades!', '', 30706),
(169582, 'esMX', 'Espío... ¡un aparato de hierro fundido!', '', 30706),
(169581, 'esMX', 'Espío... ¡una mascota blindada!', '', 30706),
(169580, 'esMX', 'Espío... ¡algo con alas que pica!', '', 30706),
(169579, 'esMX', 'Espío... ¡una criatura con plumas!', '', 30706),
(169578, 'esMX', 'Espío... ¡una recompensa deliciosa!', '', 30706),
(169577, 'esMX', 'Espío... ¡un amiguito peludo para acariciar!', '', 30706),
(169576, 'esMX', 'Espío... ¡un tesoro de cera que los kóbolds desean!', '', 30706),
(169571, 'esMX', 'Equipando...', 'Equipando...', 30706),
(169570, 'esMX', 'Como desees.', 'Como desees.', 30706),
(169565, 'esMX', 'Todo lo que dormía... despertará.', '', 30706),
(169564, 'esMX', 'Lo que estaba hundido resurgirá.', '', 30706),
(169563, 'esMX', 'Recibe mi don y todas las verdades se revelarán ante ti.', '', 30706),
(169562, 'esMX', 'He guiado tu mano.', '', 30706),
(169561, 'esMX', '', '¡La jefa Zumbarriel de la arena es una impostora! ¡Desenmascarémosla y averigüemos qué está pasando!', 30706),
(169560, 'esMX', '¡Esquiva las ranas mientras la princesa Talanji te rescata!', '¡Esquiva las ranas mientras la princesa Talanji te rescata!', 30706),
(169553, 'esMX', 'Ya decidí mi veredicto.', '', 30706),
(169552, 'esMX', 'Tiene ssssentido...', '', 30706),
(169551, 'esMX', 'Uk.', '', 30706),
(169550, 'esMX', 'Buen punto.', '', 30706),
(169549, 'esMX', 'Oh sí, yo recordar.', '', 30706),
(169548, 'esMX', 'Ellos mataron a esos tipos.', '', 30706),
(169547, 'esMX', 'Nunca lo había pensado de esa forma.', '', 30706),
(169546, 'esMX', 'Interesante.', '', 30706),
(169545, 'esMX', '<gruñe>', '', 30706),
(169544, 'esMX', '¿$n? ¡Imposible!', '', 30706),
(169543, 'esMX', '¡No es cierto!', '', 30706),
(169542, 'esMX', '<jadea>', '', 30706),
(169539, 'esMX', '', 'Su ojito ve algo curioso... ¡Tu MUERTE! ¡Reciban con un aplauso al maestro espía!', 30706),
(169538, 'esMX', 'Su ojito ve algo curioso... ¡Tu MUERTE! ¡Reciban con un aplauso al maestro espía!', '', 30706),
(169517, 'esMX', 'Bueno, es un comienzo. Gracias, adalid. Cuando MADRE tenga una respuesta, lo sabrás de inmediato.', '', 30706),
(169516, 'esMX', '', 'Calculando.', 30706),
(169515, 'esMX', '¿Solo para el análisis? ¿Y cuánto tardaremos en idear un plan?', '', 30706),
(169514, 'esMX', '', 'Accediendo a archivos de datos de Cámara del Corazón. Un análisis exhaustivo llevará aproximadamente 77 ciclos.', 30706),
(169513, 'esMX', 'Ahora que te hemos traído aquí, ¿sabes cómo sanar a Azeroth?', '', 30706),
(169512, 'esMX', '¡Extermínala o moriremos aquí!', '', 30706),
(169511, 'esMX', '¡Miren el tamaño de ese!', '', 30706),
(169510, 'esMX', '', 'Sistema c-c-c-corrupto.', 30706),
(169509, 'esMX', '¡Algo no está bien! ¡La perdemos!', '', 30706),
(169508, 'esMX', '$UNuestro:Nuestra; adalid se encargará, pase lo que pase. ¡Prepárate!', '', 30706),
(169507, 'esMX', '', 'Advertencia: Rutina de diagnóstico de portal incompleta. Alta probabilidad de corrupción en conducto de viaje.', 30706),
(169506, 'esMX', '¡Una puerta titánica que funciona! ¡Ya quiero verla en acción!', '', 30706),
(169505, 'esMX', '', 'Sobrecarga en sistema de etiqueta. Reiniciando.', 30706),
(169504, 'esMX', '', 'Advertencia: Secuencia de reoriginación inminente.', 30706),
(169503, 'esMX', '', 'Error. Rutina de salida no encontrada.', 30706),
(169502, 'esMX', '', 'Partida reconocida.', 30706),
(169501, 'esMX', '', 'Protocolo de despedida activado.', 30706),
(169500, 'esMX', '', '¿Necesitas experimentar?', 30706),
(169499, 'esMX', '', 'Accediendo a base de datos de saludos. Hola.', 30706),
(169498, 'esMX', '', 'Niveles de contaminación insignificantes.', 30706),
(169497, 'esMX', 'Sabía que no me abandonarías a mi suerte, $n. Gracias por salvarme la vida.', '', 30706),
(169495, 'esMX', '¡Tras su retiro, el granjero Xiang-Su vuelve para regar algunas plantas!', '', 30706),
(169494, 'esMX', '', 'En cuanto a ti, $r. Has demostrado que valoras la vida por encima de las posesiones y te recompensaré por eso. Puedes llevarte el yunque.', 30706),
(169493, 'esMX', '', 'Puedes irte, Ormhun. Pero no creas que te irás sin castigo. Discutiremos los detalles más tarde.', 30706),
(169492, 'esMX', '', 'Tenía la sensación de que quizás había una pizca de virtud en ti, habitante de la superficie.', 30706),
(169491, 'esMX', '', 'Muy bien, puedes quedarte con el yunque. Ormhun enfrentará su castigo en otro lugar.', 30706),
(169490, 'esMX', '', 'Típico de habitante de la superficie. Solo piensas en ti y en aumentar tu propio poder.', 30706),
(169489, 'esMX', 'Muy bien.', '', 30706),
(169488, 'esMX', '<gruñe>', '', 30706),
(169487, 'esMX', '¿Eh?', '', 30706),
(169486, 'esMX', 'Sssssí...', '', 30706),
(169485, 'esMX', '¡Skraawwwk!', '', 30706),
(169484, 'esMX', 'Desde luego.', '', 30706),
(169483, 'esMX', 'Hrnngg.', '', 30706),
(169482, 'esMX', '¡Yo siempre decir la verdad!', '', 30706),
(169481, 'esMX', '¡Kraku que sí!', '', 30706),
(169480, 'esMX', 'Seh, como sea.', '', 30706),
(169479, 'esMX', 'Sí, claro.', '', 30706),
(169478, 'esMX', 'Therazane, por favor. No pensé que sería un problema tan grave.', '', 30706),
(169477, 'esMX', '', '¿Y bien? ¡¿Qué tienes para decir en tu defensa?!', 30706),
(169476, 'esMX', '', 'Y tú, $r. ¡Habitante de la superficie $Udescarado:descarada;! ¡¿Creíste que podías venir aquí y robar nuestros secretos?!', 30706),
(169475, 'esMX', '', 'Correcto. No pensaste. Y ahora deberás responder por tus crímenes.', 30706),
(169471, 'esMX', 'Ahora podrás forjar un equipamiento más resistente. Pero será mejor que...', '', 30706),
(169470, 'esMX', 'Y qué yunque tan hermoso. Veo que has dominado la técnica, $n.', '', 30706),
(169469, 'esMX', '¡Lo logramos!', '', 30706),
(169468, 'esMX', 'Estoy listo para conocer a MADRE.', 'Estoy lista para conocer a MADRE.', 30706),
(169467, 'esMX', '¡Necesitamos ayuda si queremos salvar Azeroth! ¡Espero que MADRE sepa lo que hay que hacer!', '', 30706),
(169466, 'esMX', 'Aspiro a una grandeza que no puedes siquiera imaginar. Debo hacer cálculos muy importantes.\n\n¡Déjame en paz!', '', 30706),
(169465, 'esMX', 'Soy digno, no puedes negarme el acceso.', '', 30706),
(169464, 'esMX', '¡El secreto está aquí, todas mis pruebas estaban en lo cierto!', '', 30706),
(169462, 'esMX', '¡Gólem-meca! Cuida a $n por mí, ¿quieres? Puede que $ulo:la; hayan seguido...', '', 30706),
(169460, 'esMX', '¡Lo has logrado! Sujétate, ¡nos vamos de aquí!', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(169457, 'esMX', 'Estoy listo para comenzar el proceso de extracción.', 'Estoy lista para comenzar el proceso de extracción.', 30706),
(169456, 'esMX', '', 'Saludos. \n\nCorazón de Azeroth detectado. Aniquilación planetaria inminente.', 30706),
(169452, 'esMX', 'Zug zug, $n.', '', 30706),
(169451, 'esMX', 'Si quieres regresar a Terrallende, nuestros aliados etéreos han abierto un portal a Ciudad de Shattrath, Bosque de Terokkar.\n\nNo importa donde vayas, desde allí podrás llegar a tu destino con facilidad.', '', 30706),
(169450, 'esMX', 'Si quieres regresar a Terrallende, arriba hay un portal a Ciudad de Shattrath, en Bosque de Terokkar.\n\nAtraviesa el portal grande de la cima de la torre para acceder al salón de portales. Sigue el pasillo hasta el fondo, y a la derecha verás el portal a Ciudad de Shattrath.', '', 30706),
(169448, 'esMX', 'Debo presentarme en el Portal Oscuro.', 'Debo presentarme en el Portal Oscuro.', 30706),
(169445, 'esMX', 'Saludos, $n.', '', 30706),
(169437, 'esMX', '', '<La sacerdotisa reposa con una nota ensangrentada en sus prendas.>\n\n¡MARIONETA DE BWONSAMDI! LOS FIELES NO SE ARRODILLARÁN.', 30706),
(169436, 'esMX', '', '<La princesa Talanji se arrodilla frente al cadáver de una sacerdotisa. Sujeta un talismán cubierto de sangre contra su pecho.>\n\nArrojaron su cadáver a mis pies, $n.\n\nLo único que hizo fue alabar a Bwonsamdi.\n\nYo soy culpable de su destino.', 30706),
(169420, 'esMX', 'No hay bien. No hay mal. No hay Luz. ¡Solo... PODER!', '', 30706),
(169415, 'esMX', '¡%s se armará en 3 segundos!', '', 30706),
(169412, 'esMX', 'Estoy listo para forjar el yunque.', 'Estoy lista para forjar el yunque.', 30706),
(169400, 'esMX', 'Bien, ya la oíste, adalid. ¡Manos a la obra!', '', 30706),
(169399, 'esMX', '', 'Comprendido. Se recomienda activación de puerta. Coordenadas de destino codificadas en Corazón de Azeroth.', 30706),
(169398, 'esMX', 'Uh, sin ánimo de ofender... si mi máquina voladora no pudo con Magni, ¡dudo que pueda viajar con una vigía de los titanes hasta Silithus!', '', 30706),
(169397, 'esMX', '', 'Recomendación: Reubicar a unidad MADRE en complejo de Cámara del Corazón.', 30706),
(169396, 'esMX', '', 'Error: Complejo de Uldir diseñado para experimentación y contención de dios antiguo. Rehabilitación planetaria fuera de parámetros operativos.', 30706),
(169395, 'esMX', '¡Exacto! Necesitamos tu ayuda, MADRE. Azeroth agoniza, y parece que no podemos curarla.', '', 30706),
(169394, 'esMX', '', 'Visitante identificado. Designación: Portavoz. Presencia de Portavoz indica amenaza inminente para Azeroth.', 30706),
(169393, 'esMX', 'Es un placer conocerte. Soy Magni...', '', 30706),
(169392, 'esMX', '', 'Saludos. Soy la Matrona del Afán, Directora Radical de Estudios. Designación: MADRE.', 30706),
(169391, 'esMX', 'Hace mucho tiempo que no formo equipo con alguien de la Horda. Pero si queremos salvar Azeroth, tenemos que trabajar juntos.', '', 30706),
(169390, 'esMX', '¡Ahora sujétate! ¡Allá vamos!', '', 30706),
(169389, 'esMX', 'Hará lo que sea para curar a nuestro mundo. Pero esta vez no permitiré que cargue con todo el peso solo.', '', 30706),
(169388, 'esMX', 'No importa qué tan pesada sea la carga, Magni siempre la asume sin ayuda. Es tan testarudo como valiente, y eso le ha costado caro.', '', 30706),
(169387, 'esMX', 'Pero siempre ha sido así. Como hermano, como rey de Forjaz, y ahora como Portavoz de Azeroth.', '', 30706),
(169386, 'esMX', 'Cuando se convirtió en diamante, todos creímos que lo habíamos perdido para siempre. Que se había sacrificado para salvarnos.', '', 30706),
(169385, 'esMX', 'De niños, bromeaba que Magni cargaba con el peso del mundo. Nunca creí que se lo tomaría tan a pecho.', '', 30706),
(169384, 'esMX', '', 'La Horda no es el enemigo. Lo siento.', 30706),
(169383, 'esMX', '', 'El único motivo por el que no masacro a los hereje\' que amenazan a mi futura reina es por respeto a la misericordia de Talanji.', 30706),
(169382, 'esMX', '', 'Esa insolencia se puede aplah\'tar de muchas formas. Acudiré a la sabiduría de Talanji.', 30706),
(169381, 'esMX', '', 'La debilidad no tiene lugar en nuestras filas.', 30706),
(169380, 'esMX', 'Todos verán lo que realmente eres, Sylvanas.', '', 30706),
(169379, 'esMX', '', 'Llévenselo.', 30706),
(169378, 'esMX', '', 'No. Él la traiciona. Igual que tú.', 30706),
(169377, 'esMX', '¡Alma en pena!', '', 30706),
(169376, 'esMX', '', 'Aprecio tu honestidad.', 30706),
(169375, 'esMX', 'Lo reviviste como Renegado. Pero querías negarle el libre albedrío. Profanar su mente.', '', 30706),
(169373, 'esMX', '', '¿... Zelling?', 30706),
(169372, 'esMX', '', 'Pero Derek Valiente no huyó a Kul Tiras solo.', 30706),
(169371, 'esMX', '', 'La mayoría de ustedes no tiene nada que temer.', 30706),
(169370, 'esMX', '', 'Tengo malas noticias.', 30706),
(169369, 'esMX', 'El tormento...', '', 30706),
(169368, 'esMX', 'Por favor... acaba con esta maldición...', '', 30706),
(169367, 'esMX', 'No hay escapatoria...', '', 30706),
(169366, 'esMX', 'Mucho frío...', '', 30706),
(169365, 'esMX', 'Al fin...', '', 30706),
(169364, 'esMX', '$uProfanador:Profanadora;...', '', 30706),
(169363, 'esMX', 'Venganza...', '', 30706),
(169362, 'esMX', 'Tengo... hambre...', '', 30706),
(169361, 'esMX', '|TInterface\\Icons\\ABILITY_CREATURE_DISEASE_02.BLP:20|t¡%s comienza a lanzar |cFFFF0000|Hspell:291061|h[Corrosión de la muerte]|h|r!', '', 30706),
(169360, 'esMX', '', 'Úsalo con orgullo, es un reconocimiento por tus servicios a la Alianza y a Kul Tiras.', 30706),
(169359, 'esMX', '', 'Adalid, es con enorme respeto y admiración que te presento el atavío de los oficiales más condecorados del almirantazgo.', 30706),
(169358, 'esMX', '', 'Dale mis saludos al rey. Y te lleven donde te lleven los vientos, no apartes la vista del mar.', 30706),
(169357, 'esMX', '', 'Los kultiranos siempre hemos sido un pueblo aventurero. No tengo duda de que tus hazañas traerán gloria a la Alianza y orgullo a Kul Tiras.', 30706),
(169356, 'esMX', '', 'Es un honor concederte la armadura dorada de nueh\'tros campeone\' más sagrados. Camina con la bendición de los loa y el orgullo de nueh\'tro pueblo.', 30706),
(169355, 'esMX', '', 'Mientras nos reincorporamo\' con el mundo más allá de nueh\'tras costas, tú sigues representando la grandeza de Zandalar.', 30706),
(169353, 'esMX', '', 'El vínculo forjado en una batalla es tan fuerte como el pacto con un loa. Acompaña a nueh\'tros nuevos hermanos y hermanas, y honra a Zandalar y a la Horda.', 30706),
(169351, 'esMX', '', 'Cuando la Alianza invadió nueh\'tro hogar, los héroe\' de la Horda tomaron sus armas y lucharon junto a nosotro\'.', 30706),
(169348, 'esMX', '', '¡AHH! ¡Por favor! ¡Desencanta el resguardo que me inmoviliza!', 30706),
(169347, 'esMX', '', '¡GAH! ¡No puedo moverme! ¡Hay un resguardo cerca! ¡Tienes que desencantarlo!', 30706),
(169339, 'esMX', '', '¡Zandalar por siempre!', 30706),
(169338, 'esMX', '', 'Nueh\'tro imperio tiene un destino glorioso, y debemo\' recibirlo juntos. ¿Eh\'tan conmigo?', 30706),
(169337, 'esMX', '', 'Pero sin su ayuda, nueh\'tro orgullo nos habría llevado a la perdición. Eh\'tos poderosos aliados le han dado nueva fuerza a Zandalar.', 30706),
(169336, 'esMX', '', 'Muchos cueh\'tionaron mi decisión de acudir a la Horda.', 30706),
(169335, 'esMX', '', 'Pueblo de Zandalar.', 30706),
(169334, 'esMX', 'Toma esto como una muerte misericordiosa.', '', 30706),
(169333, 'esMX', 'Tan valiente, pero tan... poca visión.', '', 30706),
(169332, 'esMX', 'La Gran Magistrix... les arrancará la cabeza por esto.', '', 30706),
(169331, 'esMX', 'No sobreviví durante diez mil años solo para caer a un enjambre de ratas.', '', 30706),
(169330, 'esMX', 'Lamentablemente, el coraje ciego solamente triunfa en los cuentos de hadas.', '', 30706),
(169329, 'esMX', '¡Soy un canal del poder glorioso de la Fuente de la Noche! ¡Soy un NATONOCTURNO!', '', 30706),
(169328, 'esMX', '¿Alguna vez han presenciado tal poder natural, alimañas? No lo creo.', '', 30706),
(169327, 'esMX', '¡Suficiente! ¡Pequeñas bestias incontrolables!', '', 30706),
(169326, 'esMX', 'Otra víctima de mi arte.', '', 30706),
(169325, 'esMX', '¡Nunca escuchó mi espada acercarse!', '', 30706),
(169324, 'esMX', 'Sus nombres serán olvidados.', '', 30706),
(169323, 'esMX', '¡El viento corta hasta los huesos!', '', 30706),
(169322, 'esMX', '¡Muerte por mil cortes!', '', 30706),
(169321, 'esMX', '¡Si pestañean... sangran!', '', 30706),
(169320, 'esMX', '¡Cómo se atreven a interrumpir a sus superiores!', '', 30706),
(169319, 'esMX', 'Por fin. Seré breve.', '', 30706),
(169318, 'esMX', '¡Sangren para la Gran Magistrix!', '', 30706),
(169317, 'esMX', 'Elisande... ¡perdóname!', '', 30706),
(169316, 'esMX', 'Mar al mar, tormenta a la tormenta, mareas a las mareas.', '', 30706),
(169315, 'esMX', 'Que este navío sea uno con el océano y nosotros uno con él.', '', 30706),
(169313, 'esMX', '|cFF0000FF(Misión)|r Entrar a Uldir.', '|cFF0000FF(Misión)|r Entrar a Uldir.', 30706),
(169311, 'esMX', '¡Brinden fuerza a nuestras velas, y protéjannos de las profundidades abrumadoras!', '', 30706),
(169310, 'esMX', '¡Escuchen nuestro llamado, tormentas y mareas!', '', 30706),
(169305, 'esMX', '', 'La ingeniería es muy sencilla una vez que entiendes los conceptos básicos.', 30706),
(169304, 'esMX', 'Han moldeado tu carne recientemente.\n\nVolver a moldearla ahora sería... insensato.', '', 30706),
(169303, 'esMX', 'Voy a prepararme para mi parte, y cuando tú estés $ulisto:lista;, ¡comienza a golpear lo más fuerte que puedas!', '', 30706),
(169302, 'esMX', 'Sin duda te considerarán digna, princesa.', '', 30706),
(169298, 'esMX', 'Parece que la esencia de Hati se ha juntado en los lugares dónde realizó grandes sacrificios mientras vivía. ¡Vayan al Templo de las Tormentas de inmediato!', '', 30706),
(169297, 'esMX', 'Llevemos este mineral fundido al yunque y podremos comenzar a trabajar.', '', 30706),
(169296, 'esMX', 'Los Lanza Negra han organizado el transporte a Zandalar en bote desde las Islas del Eco al sur de Orgrimmar.\n\nComo alternativa, nuestros aliados zandalari han establecido un portal directo a su capital en el salón de portales.', 'Los Lanza Negra han organizado el transporte a Zandalar en bote desde las Islas del Eco al sur de Orgrimmar.\n\nComo alternativa, nuestros aliados zandalari han establecido un portal directo a su capital en el salón de portales.', 30706),
(169295, 'esMX', 'Zuldazar, Zandalar', 'Zuldazar, Zandalar', 30706),
(169294, 'esMX', 'Nuestros aliados shal\'dorei han establecido un portal directo a Azsuna, en Islas Quebradas. Búscalo en el salón de portales, que se encuentra en las puertas principales de Orgrimmar.', 'Nuestros aliados shal\'dorei han establecido un portal directo a Azsuna, en Islas Quebradas. Búscalo en el salón de portales, que se encuentra en las puertas principales de Orgrimmar.', 30706),
(169293, 'esMX', 'Azsuna, Islas Quebradas', 'Azsuna, Islas Quebradas', 30706),
(169292, 'esMX', 'Nuestros magos han abierto un portal directo a Ashran, Draenor, en el salón de portales. \n\nSi es la primera vez que visitas Draenor, el mago de batalla de la vanguardia cerca del portal puede ayudarte.', 'Nuestros magos han abierto un portal directo a Ashran, Draenor, en el salón de portales. \n\nSi es la primera vez que visitas Draenor, el mago de batalla de la vanguardia cerca del portal puede ayudarte.', 30706),
(169291, 'esMX', 'Nuestros aliados de Pandaria han abierto un portal a Aldea Zarpa\'don, en el Bosque de Jade. Búscalo en el salón de portales, que se encuentra en las puertas principales de Orgrimmar.', 'Nuestros aliados de Pandaria han abierto un portal a Aldea Zarpa\'don, en el Bosque de Jade. Búscalo en el salón de portales, que se encuentra en las puertas principales de Orgrimmar.', 30706),
(169290, 'esMX', 'Para viajar rápidamente a Rasganorte, dirígete al salón de portales ubicado en las puertas principales de Orgrimmar. Unos magos Argenta te han facilitado un portal.', 'Para viajar rápidamente a Rasganorte, dirígete al salón de portales ubicado en las puertas principales de Orgrimmar. Unos magos Argenta te han facilitado un portal.', 30706),
(169289, 'esMX', 'Ciudad de Dalaran, Rasganorte', 'Ciudad de Dalaran, Rasganorte', 30706),
(169288, 'esMX', '¡$n, has llegado! Tengo todo listo para empezar. Avísame y pondremos manos a la obra.', '', 30706),
(169287, 'esMX', 'Unos magos representantes de Thrallmar han establecido un portal a Península del Fuego Infernal, Terrallende, en nuestro salón de portales. Si nunca has visitado el salón de portales, está ubicado dentro de las puertas principales de la ciudad.', 'Unos magos representantes de Thrallmar han establecido un portal a Península del Fuego Infernal, Terrallende, en nuestro salón de portales. Si nunca has visitado el salón de portales, está ubicado dentro de las puertas principales de la ciudad.', 30706),
(169286, 'esMX', 'Unos magísteres elfos de sangre han establecido un portal a Ciudad de Lunargenta en el salón de portales de Orgrimmar. El salón está ubicado dentro de las puertas principales de la ciudad.', 'Unos magísteres elfos de sangre han establecido un portal a Ciudad de Lunargenta en el salón de portales de Orgrimmar. El salón está ubicado dentro de las puertas principales de la ciudad.', 30706),
(169285, 'esMX', 'Ciudad de Lunargenta, Reinos del Este', 'Ciudad de Lunargenta, Reinos del Este', 30706),
(169284, 'esMX', 'Para llegar a Entrañas, busca a Frezza en la torre de zepelín este en la meseta central de Orgrimmar. Él tiene más información sobre cómo llegar a tu destino. ', 'Para llegar a Entrañas, busca a Frezza en la torre de zepelín este en la meseta central de Orgrimmar. Él tiene más información sobre cómo llegar a tu destino.', 30706),
(169283, 'esMX', 'Entrañas, Reinos del Este', 'Entrañas, Reinos del Este', 30706),
(169282, 'esMX', 'Supongo que pensaremos el plan después. ¡Andando!', '', 30706),
(169281, 'esMX', '¿Recuperar a Hati? ¡¿Por qué no lo dijiste antes?! ¡Los veré en Silithus cuanto antes!', '', 30706),
(169280, 'esMX', 'El resto de la esencia de Hati está en Silithus. Si podemos capturarla, ¡Mimiron cree que puede reformarlo!', '', 30706),
(169279, 'esMX', 'Por el amor de… sí, yo también me alegro de volver a verte, Thorim.', '', 30706),
(169278, 'esMX', '¡Ah, Barbabronce y $p! ¡Cómo me alegra volver a verlos!', '', 30706),
(169277, 'esMX', '¡SOY LIBRE!', '', 30706),
(169276, 'esMX', '¡Eso es! ¡Usa el Chispatrueno para absorber la esencia de Hati!', '', 30706),
(169275, 'esMX', '¡Creo que estamos avanzando! ¡Sigue así, $p!', '', 30706),
(169274, 'esMX', 'Sé que estás ahí, Hati. ¡Vinimos a ayudarte!', '', 30706),
(169273, 'esMX', '¡Excelsior!', '', 30706),
(169272, 'esMX', '¡Vamos! ¡Surgios exige poder!', '', 30706),
(169271, 'esMX', '¡Trabajen más rápido!', '', 30706),
(169270, 'esMX', '¡Si no ponen estas cosas en funcionamiento, los convertiré en un hermoso collar!', '', 30706),
(169266, 'esMX', 'Misión terminada. Órdenes nuevas: regresar a base.', '', 30706),
(169265, 'esMX', '¿Y dónde estaría la diversión? ¡Sube, adalid!', '', 30706),
(169264, 'esMX', 'Te veré dentro de Uldir. ¡Brann, vuela con cuidado!', '', 30706),
(169262, 'esMX', '¡La esencia de Hati te reconoce y se confunde!', '', 30706),
(169261, 'esMX', '', 'Di lo que tengas para decir.', 30706),
(169260, 'esMX', '', 'Terminemos con esto.', 30706),
(169259, 'esMX', '', 'Sí, sí, te escucho.', 30706),
(169258, 'esMX', '', 'Vamos, sigue tu camino.', 30706),
(169257, 'esMX', '', 'Que las mareas me lleven.', 30706),
(169256, 'esMX', '', 'Pff. Bueno.', 30706),
(169255, 'esMX', '', 'Mi vida por Zandalar.', 30706),
(169254, 'esMX', '', 'Rezo, y la luz de los loa me reh\'ponde.', 30706),
(169253, 'esMX', '', 'Habla.', 30706),
(169252, 'esMX', 'Para llegar a Boralus, busca al capitán Hicks de El Implacable en el último muelle al sur de Puerto de Ventormenta. Su barco parte periódicamente rumbo a Kul Tiras.\n\nComo alternativa, nuestros aliados maresabios han abierto un portal hacia su capital en la Torre de los Magos.', 'Para llegar a Boralus, busca al capitán Hicks de El Implacable en el último muelle al sur de Puerto de Ventormenta. Su barco parte periódicamente rumbo a Kul Tiras.\n\nComo alternativa, nuestros aliados maresabios han abierto un portal hacia su capital en la Torre de los Magos.', 30706),
(169251, 'esMX', '', 'Tiene\' mi atención.', 30706),
(169250, 'esMX', 'Estaré por aquí si me necesitas.', '', 30706),
(169249, 'esMX', 'Vuelve cuando quieras.', '', 30706),
(169248, 'esMX', 'Es un día fantástico, ¿no?', '', 30706),
(169247, 'esMX', 'Hola, hola.', '', 30706),
(169246, 'esMX', '', 'Como Talanji desee.', 30706),
(169245, 'esMX', '', 'Por la voluntad de Rastakhan.', 30706),
(169244, 'esMX', '', 'Que los loa te tengan en su gracia.', 30706),
(169243, 'esMX', '', '¡Di chuka Zandalar!', 30706),
(169242, 'esMX', 'Canal de Tiragarde, Kul Tiras', 'Canal de Tiragarde, Kul Tiras', 30706),
(169241, 'esMX', '', 'Mi vida por el trono.', 30706),
(169240, 'esMX', '', 'Sirvo a la reina.', 30706),
(169239, 'esMX', '', 'Sirvo al rey.', 30706),
(169238, 'esMX', 'Para llegar a las Islas Quebradas, nuestros aliados han abierto un portal a Azsuna en el salón de portales. Lo encontrarás en la cima de la Torre de los Magos.', 'Para llegar a las Islas Quebradas, nuestros aliados han abierto un portal a Azsuna en el salón de portales. Lo encontrarás en la cima de la Torre de los Magos.', 30706),
(169237, 'esMX', '', '¿Qué necesita\' de la corona?', 30706),
(169236, 'esMX', '', 'Te eh\'cucho.', 30706),
(169235, 'esMX', '', 'Di a qué vienes.', 30706),
(169233, 'esMX', '', 'Saludos.', 30706),
(169232, 'esMX', '', '¡Zandalar por siempre!', 30706),
(169231, 'esMX', '', 'Que la luz de los loa te guíe.', 30706),
(169230, 'esMX', '', 'Eh\'tás frente a la Alta prelada.', 30706),
(169229, 'esMX', '¿En qué puedo ayudarte, $Uamigo:amiga;?', '', 30706),
(169228, 'esMX', 'Me han dicho que el continente es muy bonito en esta época del año.', '', 30706),
(169227, 'esMX', '', '¿Eso es todo?', 30706),
(169226, 'esMX', '', 'Date prisa.', 30706),
(169225, 'esMX', 'Azsuna, Islas Quebradas', 'Azsuna, Islas Quebradas', 30706),
(169224, 'esMX', 'Nuestros aliados del Kirin Tor han abierto un portal dentro de la Torre de los Magos para ayudar a los héroes en sus viajes a Draenor. Si lo atraviesas, llegarás a Ashran en un instante.', 'Nuestros aliados del Kirin Tor han abierto un portal dentro de la Torre de los Magos para ayudar a los héroes en sus viajes a Draenor. Si lo atraviesas, llegarás a Ashran en un instante.', 30706),
(169223, 'esMX', 'Ashran, Draenor', 'Ashran, Draenor', 30706),
(169222, 'esMX', 'Nuestros aliados de Pandaria nos han permitido crear un portal a Aldea Zarpa\'don, en el Bosque de Jade. Se encuentra en la cima de la torre central del Barrio de los Magos.', 'Nuestros aliados de Pandaria nos han permitido crear un portal a Aldea Zarpa\'don, en el Bosque de Jade. Se encuentra en la cima de la torre central del Barrio de los Magos.', 30706),
(169220, 'esMX', 'Para llegar en un instante a Rasganorte, dirígete al salón de portales de la cima de la Torre de los Magos. Unos magos del Pacto de Plata han establecido un portal para que uses cuando quieras.', 'Para llegar en un instante a Rasganorte, dirígete al salón de portales de la cima de la Torre de los Magos. Unos magos del Pacto de Plata han establecido un portal para que uses cuando quieras.', 30706),
(169219, 'esMX', 'Ciudad de Dalaran, Rasganorte', 'Ciudad de Dalaran, Rasganorte', 30706),
(169218, 'esMX', 'Exodar, Kalimdor', 'Exodar, Kalimdor', 30706),
(169217, 'esMX', 'Unos magos han abierto un portal a Península del Fuego Infernal en la Torre de los Magos. Encontrarás el salón de portales en la cima de la torre del Barrio de los Magos.', 'Unos magos han abierto un portal a Península del Fuego Infernal en la Torre de los Magos. Encontrarás el salón de portales en la cima de la torre del Barrio de los Magos.', 30706),
(169216, 'esMX', 'Teldrassil, Kalimdor', 'Teldrassil, Kalimdor', 30706),
(169215, 'esMX', '¿Quieres ir a Teldrassil? Habla con Perrin Lágrima Lunar en el último muelle al sur de Puerto de Ventormenta. Podrá asistirte con tus viajes.', '¿Quieres ir a Teldrassil? Habla con Perrin Lágrima Lunar en el último muelle al sur de Puerto de Ventormenta. Podrá asistirte con tus viajes.', 30706),
(169214, 'esMX', 'Allí está el otro, ¡atrápalo!', '', 30706),
(169213, 'esMX', '', 'Todos tienen su mérito. La decisión es tuya, $n.', 30706),
(169212, 'esMX', '', 'Madre, eso es hermoso.', 30706),
(169211, 'esMX', '', 'Melodía de Tiffin.', 30706),
(169210, 'esMX', 'A la Alianza le gustan los leones. ¿Qué tal Corazón de León?', '', 30706),
(169209, 'esMX', 'Yo diría que parece más un Navegante del Alba.', '', 30706),
(169208, 'esMX', '', 'Furia de Anduin. ¡La Horda aprenderá a temerle!', 30706),
(169207, 'esMX', '', 'Necesita un nombre, como todos los grandes barcos. ¿Sugerencias?', 30706),
(169206, 'esMX', 'Yo puedo ocuparme de la casa, querida. Ve. Disfruta de la aventura.', '', 30706),
(169205, 'esMX', '', 'Ah... sí. Gracias.', 30706),
(169204, 'esMX', 'Es un poco tímida, señora. No le preste atención. ¿Gustaría un poco de leche tibia mientras espera?', '', 30706),
(169203, 'esMX', 'Necesito regresar a mi puesto ahora. Buena suerte, y no olvides la carta.', '', 30706),
(169202, 'esMX', 'Buscas una residencia en algún lugar de La Rivera Muerta.', '', 30706),
(169201, 'esMX', 'En esta ciudad abundan los rumores. Pero al menos hemos acotado nuestra búsqueda.', '', 30706),
(169200, 'esMX', 'Pregúntales a los locales. Yo hablaré con el tabernero. El viejo Buck nunca olvida un rostro.', '', 30706),
(169199, 'esMX', 'Presabrenna es un cruce muy transitado. Es posible que Lagos haya pasado por aquí una o dos veces.', '', 30706),
(169198, 'esMX', 'A la orden, Lady Almirante. Ven, $n. Comenzaremos en Valle Canto Tormenta, donde construimos todos los barcos de la flota.', '', 30706),
(169197, 'esMX', 'Puedo ayudarte con la búsqueda, ¿pero qué sucede si este misterioso carpintero de barcos rechaza tu pedido?', '', 30706),
(169196, 'esMX', 'Directiva actualizada: vengar a Gryzix. Seguir a $r hasta hostiles.', '', 30706),
(169195, 'esMX', 'No… Algo anda mal. ¿Qué sucede, pequeño?', '', 30706),
(169194, 'esMX', '¡Ja, nos recuerda!', '', 30706),
(169193, 'esMX', '¡Hati! ¡Ven aquí, pequeño!', '', 30706),
(169192, 'esMX', 'Descuida, Thorim, ¡yo te cubro la espalda!', '', 30706),
(169191, 'esMX', 'Esa cosa apenas podía llevarnos antes de convertirme en diamantes. Prefiero arriesgarme por tierra.', '', 30706),
(169190, 'esMX', 'Hati… ¿eres tú?', '', 30706),
(169189, 'esMX', '', 'Nuestro próximo combatiente tiene más martillos que una convención de carpinteros. ¡Me gustaría saber de dónde clavos los saca!', 30706),
(169188, 'esMX', '¡Ah, vamos, Magni! ¡Este viejo pájaro soporta perfectamente el peso extra!', '', 30706),
(169187, 'esMX', 'Y directamente de los páramos congelados de Draenor... ¡Ya deja eso, es la hora del martillo!', '', 30706),
(169186, 'esMX', 'Sus ojos no los engañan, amigos: ¡tenemos una maestra cervecera de las hermosas tierras de Pandaria!', '', 30706),
(169184, 'esMX', '', 'Para enfrentarse a nuestro campeón novato, ¿tenemos a alguien que va a preparar cerveza en la arena? Momento, esto no puede estar bien...', 30706),
(169176, 'esMX', 'Estoy listo.', 'Estoy lista.', 30706),
(169175, 'esMX', '¡Cuidado, $Umuchacho:muchacha;! Algo anda mal.', '', 30706),
(169174, 'esMX', 'Modo de combate: activado. Encendiendo propulsores.', '', 30706),
(169170, 'esMX', 'Órdenes nuevas: seguir a $r. Proteger a toda costa.', '', 30706),
(169169, 'esMX', 'Abandonar Uldir.', 'Abandonar Uldir.', 30706),
(169168, 'esMX', '¿Esto es... la muerte? Fascinante...', '', 30706),
(169167, 'esMX', 'Sigue intentando...', '', 30706),
(169166, 'esMX', 'Y ahora, el último fragmento de información... ¡tu muerte!', '', 30706),
(169165, 'esMX', 'Ah, ese es el precio de la información. Mi ama estará complacida con mis observaciones.', '', 30706),
(169164, 'esMX', 'Es una lástima que tuviera que matar a ese encargado inocente para poner en marcha mis planes.', '', 30706),
(169163, 'esMX', 'Verte pelear fue muy informativo... pero verte resolver este misterio ha sido mucho más esclarecedor.', '', 30706),
(169162, 'esMX', '', 'Llevo tiempo observándote, $p.', 30706),
(169159, 'esMX', 'Modo de emergencia: activado. Regresando a base principal.', '', 30706),
(169154, 'esMX', '', 'Te veré de regreso en Liza\'gar, $p. ¡Desenmascaremos a mi falso yo y lleguemos al fondo de este misterioso asesinato!', 30706),
(169153, 'esMX', 'Sethrak detectado. Encendiendo aplanadoras...', '', 30706),
(169152, 'esMX', 'Gurú de datos Gryzix: No encontrado. Guardián nuevo: $r.', '', 30706),
(169151, 'esMX', 'Anular pasajero: Activo', '', 30706),
(169150, 'esMX', 'El resto de la esencia de Hati está atrapada en Silithus… a una distancia peligrosa de la herida.', '', 30706),
(169149, 'esMX', 'Es peor de lo que imaginaba. Pondré la señal en cuarentena. ¡Esperen!', '', 30706),
(169148, 'esMX', '¡¿Qué pasa?! ¿Hati está bien?', '', 30706),
(169147, 'esMX', '¿Silítido? Qué sospechoso. Quizás si lo comparo con otro conjunto de datos… Ay, cielos.', '', 30706),
(169146, 'esMX', '¡Un momento! Recibo más datos del protocolo de triangulación. Analizando…', '', 30706),
(169145, 'esMX', '', '<Suspira> Es una pena. Era un buen chico. Seguramente lo mataron los mismos que me dejaron aquí varada.', 30706),
(169144, 'esMX', 'La señal proviene del Templo de las Tormentas, no muy lejos de aquí. ¡Parece que ha llegado la hora de visitar a nuestro amigo Thorim!', '', 30706),
(169143, 'esMX', '<Cuéntale a la jefa Zumbarriel sobre el asesinato de Paul North.>', '<Cuéntale a la jefa Zumbarriel sobre el asesinato de Paul North.>', 30706),
(169142, 'esMX', 'Según mis cálculos, solo está vinculado a una parte de la esencia de Hati. Pero sí, ¡lo averigüé!', '', 30706),
(169141, 'esMX', '¿Y? ¡¿Averiguaste a dónde se fue Hati?!', '', 30706),
(169140, 'esMX', '', '¡Gracias! ¡No tenías ninguna obligación, cariño!\n\n¿Y? ¿Qué me perdí mientras no estuve?', 30706),
(169139, 'esMX', '<Ofrécele 2 de oro a la jefa Zumbarriel para que pueda volver a casa.>', '<Ofrécele 2 de oro a la jefa Zumbarriel para que pueda volver a casa.>', 30706),
(169138, 'esMX', '<Ofrécele tu piedra de hogar a la jefa Zumbarriel para que pueda volver a casa.>', '<Ofrécele tu piedra de hogar a la jefa Zumbarriel para que pueda volver a casa.>', 30706),
(169137, 'esMX', 'Presiento que aún no saldremos de este bosque, $Umuchacho:muchacha;.', '', 30706),
(169136, 'esMX', '', 'No sé quién es esa Zumbarriel con la que estuviste trabajando, ¡pero es una traidora! No sé quién... o qué... será, pero sí sé que no es yo. ¡Yo soy yo!\n\nTe diré todo lo que sé.\n\nNo sé qué sucedió. Me atraparon por la espalda. Hubo un forcejeo y después... oscuridad. Y después estaba aquí, al otro lado del mundo, sin una piedra de hogar ni una moneda a mi nombre.', 30706),
(169135, 'esMX', '¿Qué? ¿Jefa Zumbarriel? Pensé que estaba en la Arena Liza\'gar. ¿Qué está pasando?', '¿Qué? ¿Jefa Zumbarriel? ¿Qué está pasando?', 30706),
(169134, 'esMX', 'Estoy comparando los datos con mis archivos. ¡Veamos de dónde viene esta señal!', '', 30706),
(169133, 'esMX', '', '¿Eres... eres de Liza\'gar? ¡Soy yo! ¡La jefa Zumbarriel!\n\n¡La VERDADERA jefa Zumbarriel!', 30706),
(169132, 'esMX', 'Protodracos... Fascinante. ¡Fascinante!', '', 30706),
(169131, 'esMX', '', '$n, creo que tú eh\'tás mejor $Uequipado:equipada; para encargarte de eh\'to.', 30706),
(169130, 'esMX', '', 'No. Tienen derecho a eh\'tar enfadados. Solo usaré la fuerza como último recurso.', 30706),
(169129, 'esMX', 'Parece que es nuestro turno, $p. ¡Por las tierras salvajes!', '', 30706),
(169128, 'esMX', 'Cielos. Creo que mi afirmación fue un poco prematura. ¡Algo se acerca!', '', 30706),
(169127, 'esMX', 'Por supuesto que no, Barbabronce.', '', 30706),
(169126, 'esMX', 'No habrá más \"incompatibilidades\" esta vez... ¿No?', '', 30706),
(169125, 'esMX', 'Estoy activando el protocolo de triangulación. En breve, ¡sabremos el lugar exacto al que huyó la esencia de Hati!', '', 30706),
(169124, 'esMX', '', 'Soy Sylvanas Brisaveloz, y apruebo este mensaje.', 30706),
(169123, 'esMX', 'Soy Anduin Wrynn, y apruebo este mensaje.', '', 30706),
(169121, 'esMX', '¡Apresúrate! ¡Tenemos mucha ciencia gloriosa por delante!', '', 30706),
(169119, 'esMX', 'Ella no es la última, sino la primera. Ahógala y verás.', '', 30706),
(169118, 'esMX', 'Él se entregó a las profundidades. Y me entregó su vida.', '', 30706),
(169117, 'esMX', 'Cada vez tiene más hambre... y audacia. Pero ustedes tienen los ojos cerrados.', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(169116, 'esMX', 'Solo yo puedo salvarlos de lo que vendrá.', '', 30706),
(169114, 'esMX', '', 'Regresa a Zuldazar, mi adalid, para que podamo\' recompensarte y celebrar tus proezas.', 30706),
(169113, 'esMX', '', 'Hay muchos héroes en la historia del imperio zandalari, pero poco\' pueden igualar todo lo que has logrado tú.', 30706),
(169112, 'esMX', '', 'Ahora que has visto el mundo fuera de Kul Tiras, es hora de que regreses a las costas de tu hogar. Sería un honor para mí felicitarte personalmente por tu servicio.', 30706),
(169111, 'esMX', '', 'Parece que te has vuelto $Ufamoso:famosa;, $n. No hay día en que en las tabernas de Boralus no se levante una copa en honor a tus proezas.', 30706),
(169110, 'esMX', 'La prisión de las profundidades se debilita. ¡Nadie se salvará!', '', 30706),
(169109, 'esMX', 'Él los ahogará a todos...', '', 30706),
(169107, 'esMX', '', 'Ahora yo soy reina.', 30706),
(169106, 'esMX', '', 'Pero con el tiempo, nueh\'tro imperio se eh\'tancó. Quedamos solos.', 30706),
(169105, 'esMX', '', 'Los zandalari hemo\' gobernado eh\'ta tierra por miles de años.', 30706),
(169104, 'esMX', '', 'ELIMÍNAME.', 30706),
(169103, 'esMX', '', 'Hoy, la bandera de la Alianza flamea nuevamente con orgullo en Kul Tiras. Sea lo que sea que nos aguarde, lo enfrentaremos... juntos.', 30706),
(169102, 'esMX', '', 'Durante un tiempo, dejamos que el miedo y la desconfianza nos dividieran.', 30706),
(169101, 'esMX', '', 'Los kultiranos tenemos un vínculo fuerte con el mar.', 30706),
(169099, 'esMX', '¡$p! ¡Allí estás! ¡Debemos hablar de inmediato!', '', 30706),
(169098, 'esMX', 'Tendremos que acabar con esto después, Barbabronce. ¡$UNuestro fiel amigo:Nuestra fiel amiga; $p ha llegado!', '', 30706),
(169097, 'esMX', 'Por todos los cielos, ¡¿cuántas veces tengo que repetirte que no soy Brann?!', '', 30706),
(169094, 'esMX', 'Entidad desconocida en las proximidades. Servos de pánico activados.', '', 30706),
(169093, 'esMX', 'Cuando la flecha llegue a su objetivo, la última cadena se romperá.', '', 30706),
(169083, 'esMX', '¡Levántense, caídos!', '', 30706),
(169082, 'esMX', 'Ella revela su verdadero rostro con el caer de la noche. No traerá más que ruina.', '', 30706),
(169081, 'esMX', 'El velo se desvanece. Su corona abrirá el camino.', '', 30706),
(169080, 'esMX', 'Seis asientos en la gran mesa. Seis bocas hambrientas. Una consumirá a las demás.', '', 30706),
(169079, 'esMX', 'La Luz ha hecho un trato con el enemigo de todo.', '', 30706),
(169077, 'esMX', '|TInterface\\Icons\\SPELL_SHAMAN_STATICSHOCK.BLP:20|t ¡Te estás quedando sin tiempo! ¡El |cFFFF0000|Hspell:286480|h[Choque antimanipulación]|h|r es inminente!', '|TInterface\\Icons\\SPELL_SHAMAN_STATICSHOCK.BLP:20|t ¡Te estás quedando sin tiempo! ¡El |cFFFF0000|Hspell:286480|h[Choque antimanipulación]|h|r es inminente!', 30706),
(169069, 'esMX', '', 'El bosque es nuestro aliado... Morirán aquí...', 30706),
(169068, 'esMX', '', '¡Los kaldorei recuperarán esta tierra!', 30706),
(169067, 'esMX', 'No debí... cambiar de trabajo...', '', 30706),
(169066, 'esMX', 'Ah, ¡quedarás súper crujiente, $Ucompañero:compañera;!', '', 30706),
(169065, 'esMX', 'Nuestros ancestros... los expulsarán...', '', 30706),
(169064, 'esMX', '¡Tu mera presencia profana esta tierra!', '', 30706),
(169063, 'esMX', 'Jamás nos... rendiremos...', '', 30706),
(169062, 'esMX', '¡Lok-tar ogar!', '', 30706),
(169061, 'esMX', '', 'Su especie... no... sobrevivirá...', 30706),
(169060, 'esMX', '', '¡Gilneas resiste con los kaldorei!', 30706),
(169059, 'esMX', 'No conquistarán... esta tierra...', '', 30706),
(169058, 'esMX', '¡Coh\'ta Oscura le pertenece a lo\' Rompelanzas ahora!', '', 30706),
(169057, 'esMX', 'No... sobrevivirán...', '', 30706),
(169056, 'esMX', '¡Conquistaremos esta tierra en nombre de Azshara!', '', 30706),
(169055, 'esMX', '', 'Somos apenas... el comienzo...', 30706),
(169054, 'esMX', '', '¡La marea naga destruirá sus patéticas fuerzas!', 30706),
(169053, 'esMX', '¡No! Mi trabajo aún no está... terminado...', '', 30706),
(169052, 'esMX', '¡Llegan demasiado tarde! ¡Soggoth ya ha despertado!', '', 30706),
(169051, 'esMX', 'Fallas en la matriz de defensa... Hemos perdido el lugar...', '', 30706),
(169050, 'esMX', 'Este lugar está en peligro. Se purgarán todas las formas de vida.', '', 30706),
(169049, 'esMX', 'Él los ahogará a todos...', '', 30706),
(169048, 'esMX', 'La prisión de las profundidades se debilita. ¡Nadie se salvará!', '', 30706),
(169047, 'esMX', '¡No! ¡No puedo... perder!', '', 30706),
(169046, 'esMX', '¡Tu alma me pertenece!', '', 30706),
(169045, 'esMX', '', 'Las llamas... se apagan...', 30706),
(169044, 'esMX', '', '¡Eh\'te bosque arderá!', 30706),
(169043, 'esMX', 'El ciclo continúa...', '¡Victoria o muerte!', 30706),
(169042, 'esMX', '¡Enfréntense a la ira del bosque!', '¡Victoria o muerte!', 30706),
(169040, 'esMX', '¿Qué ha ocurrido aquí?', '¿Qué ha ocurrido aquí?', 30706),
(169039, 'esMX', '¡Cállate! ¡Pega más fuerte!', '', 30706),
(169038, 'esMX', '¿Qué? Brugg, eso no tiene sentido...', '', 30706),
(169037, 'esMX', '¡Hermano, no!', '', 30706),
(169036, 'esMX', 'Me rindo...', '', 30706),
(169035, 'esMX', '¡Estás muerto!', '', 30706),
(169034, 'esMX', '¡No! ¡Hermano, no mueras!', '', 30706),
(169033, 'esMX', 'Brugg, me duele...', '', 30706),
(169032, 'esMX', '...¡Morirás como los cuervos!', '', 30706),
(169031, 'esMX', 'Ven a divertirte con los hermanitos...', '', 30706),
(169030, 'esMX', '¡No puedes huir!', '', 30706),
(169029, 'esMX', 'Pensándolo mejor... no importa. ¡Me gusta esta maldición!', 'Pensándolo mejor... no importa. ¡Me gusta esta maldición!', 30706),
(169028, 'esMX', '¿Puedes llevarme de regreso al presente?', '¿Puedes llevarme de regreso al presente?', 30706),
(169027, 'esMX', 'No. Debemos descubrir lo que busca... y detener cualquier locura que pretenda desatar contra nosotros.', '', 30706),
(169026, 'esMX', 'Estamos muy cerca de terminar con este conflicto y forjar una paz duradera. Pero si Sylvanas descubre un arma nueva que le permita seguir peleando...', '', 30706),
(169025, 'esMX', 'Claramente no pelea por Azeroth. Tampoco por la Horda. Le declara la guerra a la vida misma.', '', 30706),
(169024, 'esMX', 'Cuando Sylvanas Brisaveloz se convirtió en jefa de guerra, supe que no seríamos amigos... pero tampoco quería que fuéramos enemigos. Luego sobrevino la masacre de Arathi... y el incendio de Teldrassil.', '', 30706),
(169023, 'esMX', '¿Puedes mostrarme cómo era Costa Oscura antes de la batalla?', '¿Puedes mostrarme cómo era Costa Oscura antes de la batalla?', 30706),
(169022, 'esMX', 'TRABAJO EN CURSO', '', 30706),
(169021, 'esMX', '', '¡ERR! ¡Encuentra el resguardo! ¡Desencántalo!', 30706),
(169020, 'esMX', 'La batalla por Costa Oscura desbloqueada', 'La batalla por Costa Oscura desbloqueada', 30706),
(169017, 'esMX', 'Transfórmame.', 'Transfórmame.', 30706),
(169016, 'esMX', 'Puedo transformar tu carne si lo deseas. \n\nTen en cuenta que no podrás someterte a otro cambio de este tipo por un tiempo, y tal vez tu mente cambie para siempre.\n\n¿Cómo puedo servirte?', '', 30706),
(169015, 'esMX', '', 'Esta guerra está por cambiar de nuevo. Y esta cuchilla será la que nos guíe a la victoria.', 30706),
(169014, 'esMX', '', 'La guerra tiene vida propia. Se retuerce, crece, chilla y da vueltas hasta revelar su verdadera forma.', 30706),
(169013, 'esMX', '', 'Tontos. El niño rey se miente a sí mismo y le miente a su pueblo. No tiene la más mínima noción de lo que enfrenta realmente.', 30706),
(169012, 'esMX', '', 'La Alianza cree que, con la muerte de Rastakhan y la exterminación de la flota zandalari, nos han derrotado. Que la Horda pronto se desmoronará.', 30706),
(169011, 'esMX', 'El dios antiguo quiere fracturarnos. Dividirnos. Me temo que esta guerra es justo lo que N\'Zoth quiere.', '', 30706),
(169010, 'esMX', 'Me convertí en maresabio para blandir el poder de las profundidades por el bien de Kul Tiras. Y ahora descubro la gran oscuridad que siempre nos acechó desde abajo...', '', 30706),
(169009, 'esMX', 'Toda la vida he contemplado la dualidad del mar. Es una fuente de vida... y una fuerza de destrucción.', '', 30706),
(169008, 'esMX', '', 'Derrotamos a G\'huun, pero N\'Zoth es una amenaza mayor. En un mundo deh\'garrado por la guerra, rezo para que los loa nos mueh\'tren el camino para detenerlo.', 30706),
(169007, 'esMX', '', 'Pero ahora veo que son reale\'. Una infección en el corazón de Azeroth.', 30706),
(169006, 'esMX', '', 'De niña, escuchaba las historias de los diose\' antiguos que contaban los ancianos. Creí que solo eran historias de fantah\'mas para asustarnos.', 30706),
(169005, 'esMX', 'Regresar y seguir combatiendo a la Alianza.', 'Regresar y seguir combatiendo a la Alianza.', 30706),
(169004, 'esMX', '<Usar uno de los cañones de mano improvisados de Okri.>', '<Usar uno de los cañones de mano improvisados de Okri.>', 30706),
(169003, 'esMX', 'Estoy listo.', 'Estoy lista.', 30706),
(169002, 'esMX', '', 'Ponte en posición. Está por comenzar.', 30706),
(169001, 'esMX', '¡No hay presa que pueda escapar a los Firmemares!', 'Nunca antes había visto una invasión como esta, pero una vez que acabemos con la Horda, ¡no volverán nunca más!', 30706),
(168996, 'esMX', '', 'Si deseas continuar la lucha en Draenor, usa el portal que está a mis espaldas.', 30706),
(168995, 'esMX', '', 'Si deseas continuar la lucha en Draenor, usa el portal a Ashran del piso de arriba.', 30706),
(168994, 'esMX', 'Debo ayudar a Khadgar. ¡Envíame a las Tierras Devastadas!', 'Debo ayudar a Khadgar. ¡Envíame a las Tierras Devastadas!', 30706),
(168993, 'esMX', '', 'Si deseas regresar a las Islas Quebradas, usa el portal que está a mis espaldas.', 30706),
(168992, 'esMX', '', '¿Qué ocurre, $n?', 30706),
(168979, 'esMX', '', 'Si quieres regresar a las Islas Quebradas, usa el portal que está a mis espaldas.', 30706),
(168978, 'esMX', 'El Kirin Tor precisa mi ayuda. ¡Envíame a Dalaran!', 'El Kirin Tor precisa mi ayuda. ¡Envíame a Dalaran!', 30706),
(168977, 'esMX', '', '¿Puedo ayudarte, $c?', 30706),
(168970, 'esMX', '', 'Ten cuidado, $c. La Horda ataca esta región.\n\nLa Alianza ha enviado un contingente de soldados fortalecidos por la Luz para que protejan a la población local.\n\nMantendremos protegida está área, pero no podemos garantizar tu seguridad fuera de Alto de Arom.\n\nSi ves actividad de la Horda, informa al oficial de la Alianza más cercano y nos encargaremos de la amenaza.\n\n¡Dioniss aca!', 30706),
(168967, 'esMX', '¡Suelta eso!', '', 30706),
(168966, 'esMX', '¡Deja eso!', '', 30706),
(168965, 'esMX', '¡Atrás!', '', 30706),
(168962, 'esMX', '¡$ULadrón:Ladrona; de madera!', '', 30706),
(168961, 'esMX', '¡Eso es robar!', '', 30706),
(168960, 'esMX', '¡Vas a conocer mi hacha!', '', 30706),
(168959, 'esMX', '¡Ey! ¡Quita las manos de eso!', '', 30706),
(168956, 'esMX', 'No importa cuánto nos adentremos en Costa Oscura si los elfos de la noche nos rodean y nos atacan por la retaguardia.', '', 30706),
(168955, 'esMX', '|TInterface\\Icons\\ABILITY_MAGE_LIVINGBOMB.BLP:20|tTus aliados están afectados con |cFFFF0000|Hspell:286987|h[Ascuas abrasadoras]|h|r. ¡Disípalas antes de que exploten!', '|TInterface\\Icons\\ABILITY_MAGE_LIVINGBOMB.BLP:20|tTus aliados están afectados con |cFFFF0000|Hspell:286987|h[Ascuas abrasadoras]|h|r. ¡Disípalas antes de que exploten!', 30706),
(168937, 'esMX', '', '¡Una montaña rusa de emociones!', 30706),
(168936, 'esMX', '', 'Para montar en la montaña rusa les harán falta vales. ¡Vengan y compren vales!', 30706),
(168935, 'esMX', '', '¡Vales! ¡Compren vales para la montaña rusa!', 30706),
(168934, 'esMX', '', '¿Sientes la necesidad? ¿La necesidad... de velocidad?', 30706),
(168933, 'esMX', '', '¡Siente la adrenalina!', 30706),
(168932, 'esMX', '', '¡Suban a la montaña rusa de Gryvern!', 30706),
(168931, 'esMX', 'Te hace falta un vale de la Luna Negra para subir a la montaña rusa.', 'Te hace falta un vale de la Luna Negra para subir a la montaña rusa.', 30706),
(168930, 'esMX', '', 'La única opción que tenemos es deh\'truir este artefacto para eliminar la niebla... ¡Maldita sea la Alianza por eh\'ta trampa!', 30706),
(168929, 'esMX', '', 'Algo no anda bien... ¡La magia de eh\'te artefacto no se disipa!', 30706),
(168919, 'esMX', '¡Este sujeto ha derribado más pilotos goblin que todos los escuadrones de la Alianza juntos!', '', 30706),
(168917, 'esMX', '¡Ah, maldita sea, es el barón! ¡Muévete, muévete, muévete!', '', 30706),
(168905, 'esMX', '', '¡Es aquí!', 30706),
(168904, 'esMX', '', '¡Oh! ¡Ese parece conocido!', 30706),
(168903, 'esMX', '', 'Tampoco es ese.', 30706),
(168902, 'esMX', '', 'No es ese árbol. Continuemos.', 30706),
(168901, 'esMX', '', 'Me enterraron cerca de uno de estos árboles, los de hojas rojas y corteza blanca. Sígueme.', 30706),
(168900, 'esMX', '', 'Esas pobres almas, atrapadas por ese resguardo. Deberías desencantarlo para liberarlas.', 30706),
(168899, 'esMX', '', '*Suspiro* Estos bosques solían estar llenos de espíritus alegres. Pero ahora... Te mostraré lo que veo...', 30706),
(168898, 'esMX', 'Gracias. Sean todos bienvenidos a la Alianza.', '', 30706),
(168897, 'esMX', '', 'Está a tu disposición, al igual que su tripulación. Te servirán en nombre de todo Kul Tiras.', 30706),
(168896, 'esMX', 'Espero que tenga la determinación de mi padre.', '', 30706),
(168895, 'esMX', 'Ah... Jaina.', '', 30706),
(168894, 'esMX', 'Y navegará cientos de albas.', '', 30706),
(168893, 'esMX', 'Sin duda es un mensaje poderoso. Sus enemigos temerán al verlo llegar.', '', 30706),
(168892, 'esMX', '', 'Corazón de León.', 30706),
(168891, 'esMX', '', 'Melodía de Tiffin.', 30706),
(168890, 'esMX', '', 'Navegante del Alba.', 30706),
(168889, 'esMX', '', 'Aún no podemos detenernos, $Uamigo:amiga;.', 30706),
(168888, 'esMX', '', 'Furia de Anduin.', 30706),
(168887, 'esMX', '', '¡Adelante!', 30706),
(168886, 'esMX', '¿Cómo se llama?', '', 30706),
(168885, 'esMX', 'No se me ocurre un gesto más noble, Lady Almirante.', '', 30706),
(168884, 'esMX', '', '¡Sígueme, $Uamigo:amiga;!', 30706),
(168883, 'esMX', '', 'Kul Tiras y la Alianza compartían un vínculo de amistad. Ahora los dos pueblos presenciarán el renacer de esa unión.', 30706),
(168882, 'esMX', '', 'Continuemos.', 30706),
(168881, 'esMX', '', '¿$UListo:Lista;?', 30706),
(168880, 'esMX', '', 'Estoy segura de que es por aquí.', 30706),
(168879, 'esMX', 'Cuando pediste verme en el puerto, no imaginaba qué tenías en mente. ¡Esto es increíble!', '', 30706),
(168878, 'esMX', '', '¡Vamos, vamos!', 30706),
(168877, 'esMX', 'Espera a ver la próxima versión de mi bombardero, $p... ¡Te dejará por los aires!', '', 30706),
(168875, 'esMX', 'Oye, colega.\n\nLos mago\' de la Horda al fin se reunirán para que viajar sea más simple.\n\nSi quieres ir a alguna de las regiones aún herida\' por el Cataclismo, puedes hacerlo desde el Santuario de la Tierra Occidental al norte de los zepelines.', '', 30706),
(168873, 'esMX', 'Estos tonto\' no aprecian el verdadero poder de mis transmutacione\'. Pero les enseñaré. Pronto aprenderán que soy una persona a la que deben reh\'petar...$b$bDime, ¿qué te ha traído hasta aquí, $c? ¿Quiere\' conocer los secreto\' de la alquimia?$b$bSi es así, esos secreto\' tienen un costo.', '', 30706),
(168872, 'esMX', 'Hagámoslo.', 'Hagámoslo.', 30706),
(168871, 'esMX', '', 'Tandred la guiará a Puerto de Ventormenta, pero creo que será mejor si tú haces los honores y nos pones en marcha. Pon las manos en el timón cuando estés $ulisto:lista;.', 30706),
(168870, 'esMX', 'Estás abandonando el área de combate. ¡Regresa!', 'Estás abandonando el área de combate. ¡Regresa!', 30706),
(168869, 'esMX', 'Ooh, ¡lo tenía justo donde quería! Pero tenía que... recobrar fuerzas. Continuemos.', '', 30706),
(168868, 'esMX', 'Te juro que no soy una buena cena, gatito. Soy puro huesos.', '', 30706),
(168867, 'esMX', '¡Gato malo!', '', 30706),
(168866, 'esMX', '<Placeholder RTC: Tidesage\'s Blessing.>', '<Placeholder RTC: Tidesage\'s Blessing.>', 30706),
(168865, 'esMX', 'Sí, hermano Pike.', 'Sí, hermano Pike.', 30706),
(168864, 'esMX', 'Es un placer para mí ofrecer mis servicios para bendecir esta nave.\n\nVen conmigo, cruzaremos la bahía para dar un sermón como corresponde.', '', 30706),
(168863, 'esMX', 'Es un honor que me hayan elegido para formar parte de esta tripulación, $n.', '', 30706),
(168862, 'esMX', '', 'Corazón de León. Buena elección.', 30706),
(168861, 'esMX', '', 'Melodía de Tiffin. Buena elección.', 30706),
(168860, 'esMX', '', 'Navegante del Alba. Buena elección.', 30706),
(168859, 'esMX', '', 'Furia de Anduin. Buena elección.', 30706),
(168858, 'esMX', 'Esta acción es permanente y no puede modificarse.\n\n¿Deseas continuar?', 'Esta acción es permanente y no puede modificarse.\n\n¿Deseas continuar?', 30706),
(168857, 'esMX', 'Corazón de León', 'Corazón de León', 30706),
(168856, 'esMX', 'Melodía de Tiffin', 'Melodía de Tiffin', 30706),
(168855, 'esMX', 'Navegante del Alba', 'Navegante del Alba', 30706),
(168854, 'esMX', 'Furia de Anduin', 'Furia de Anduin', 30706),
(168853, 'esMX', '', '¿Cómo deberíamos llamar a este navío nuevo, $n?', 30706),
(168852, 'esMX', '', 'Nunca comparto mis métodos, Lady almirante.', 30706),
(168851, 'esMX', '', '¿Tan rápido? ¿Cómo es posible?', 30706),
(168850, 'esMX', '', 'Debería estar listo al final del día. O antes, si dejas de interrumpirme.', 30706),
(168849, 'esMX', '|TInterface\\Icons\\SPELL_SHAMAN_STATICSHOCK.BLP:20|t ¡Has sufrido un |cFFFF0000|Hspell:286480|h[Choque antimanipulación]|h|r! ¡Ingresa el código de apagado correspondiente a tu chispabot!', '|TInterface\\Icons\\SPELL_SHAMAN_STATICSHOCK.BLP:20|t ¡Has sufrido un |cFFFF0000|Hspell:286480|h[Choque antimanipulación]|h|r! ¡Ingresa el código de apagado correspondiente a tu chispabot!', 30706),
(168848, 'esMX', '', 'Bien. Pero si dañas mi nave, te las verás conmigo.', 30706),
(168847, 'esMX', 'Jamás.', '', 30706),
(168846, 'esMX', '', 'No te vas a dar por vencido, ¿verdad?', 30706),
(168845, 'esMX', '¿Cómo puedes construir una nave tan magnífica y no querer llevarla hacia el atardecer? ¡Es hermosa!', '', 30706),
(168844, 'esMX', '', 'Me he jubilado.', 30706),
(168843, 'esMX', 'Dime si hay un mejor subalterno y lo llevaré en tu lugar. Tú pediste al mejor. Tú eres la mejor.', '', 30706),
(168842, 'esMX', 'Pues ya oyó lo que dijo.', 'Pues ya oyó lo que dijo.', 30706),
(168841, 'esMX', '', 'No me gusta la forma en que me mira este jovencito.', 30706),
(168840, 'esMX', '', 'Tuve mi época de notoriedad pública. Me alegra poder terminar mis días lejos de eso.\n\nAdemás, a Sam no le gustan las multitudes.', 30706),
(168839, 'esMX', '$n, quiero reclutar a alguien más. Reunámonos en Puerto Brumarea después de que hables con todos.', '', 30706),
(168838, 'esMX', '¡Ja! Excelente. No podría pedir una tripulación mejor. Prepárate y sígueme.', '', 30706),
(168837, 'esMX', '', 'La próxima vez empieza con eso, capitán.', 30706),
(168836, 'esMX', 'Bueno... Entiendo que sí, claro.', '', 30706),
(168835, 'esMX', '', '¿La Alianza? ¿Quieres decir que nos vengaremos de la Horda?', 30706),
(168834, 'esMX', '¡Y seguirán siendo tu tripulación! Quiero a todos ustedes en mi barco cuando zarpemos con la bandera de la Alianza.', '', 30706),
(168833, 'esMX', '', '¿Esperas que me sienta halagada? Soy capitana. Los Firmemares son mi tripulación.', 30706),
(168832, 'esMX', 'Sé que parece extraño, pero necesito un contramaestre en quien pueda confiar. ¡Y no hay nadie mejor que tú!', '', 30706),
(168831, 'esMX', '', '¿Que quieres que sea tu QUÉ?', 30706),
(168830, 'esMX', '', '¡¿Es en serio?!', 30706),
(168829, 'esMX', '¡Te arrepentirás de esto!', '', 30706),
(168828, 'esMX', '', 'Al parecer, eh\'tas burbujas contienen algún tipo de poder. Tal vez si les quito la parte de afuera...', 30706),
(168827, 'esMX', '', '¡Gah!', 30706),
(168826, 'esMX', '', 'Eh\'tos ojos se ven bien jugoso\'. Los exprimiré hasta sacar un par de gotas y...', 30706),
(168824, 'esMX', '', 'Buen día, continental.\n\n¿Qué necesitas de los Firmemares? ¿Quieres cazar algunas bestias de mar?', 30706),
(168823, 'esMX', 'Bien, muchachos y muchachas. Parece que debo zarpar.', '', 30706),
(168822, 'esMX', 'Hmm. Buen punto.', '', 30706),
(168821, 'esMX', 'Somos muy capaces de defender la colina.', 'Somos muy capaces de defender la colina.', 30706),
(168820, 'esMX', 'Ha estado practicando puntería con las aves por un largo rato, señor.', 'Ha estado practicando puntería con las aves por un largo rato, señor.', 30706),
(168819, 'esMX', '¿Y abandonar la defensa de esta puerta?', '', 30706),
(168818, 'esMX', 'Tandred Valiente está armando una tripulación y necesita un maestro artillero. ¿Te interesa?', 'Tandred Valiente está armando una tripulación y necesita un maestro artillero. ¿Te interesa?', 30706),
(168817, 'esMX', '¿De dónde sacan todas estas aves?\n\nBah. ¿Qué necesitas, $n?', '', 30706),
(168816, 'esMX', '¡Piratas malditos!', '', 30706),
(168815, 'esMX', 'Además, ¿cómo podría negarme a ayudar al hermano de la Lady almirante?', '', 30706),
(168814, 'esMX', 'El legado de los maresabios ha quedado manchado, pero quizá pueda recuperarlo.', '', 30706),
(168813, 'esMX', 'Ha pasado demasiado tiempo desde que navegué los mares.', '', 30706),
