(168315, 'esMX', '¡La Horda se convertirá en polvo!', '¡La Horda se convertirá en polvo!', 30706),
(168314, 'esMX', '¡Siente el fuego de mi furia!', '¡Siente el fuego de mi furia!', 30706),
(168313, 'esMX', '¡Tú! ¡Sabía que la Horda estaba detrás de esto!', '¡Tú! ¡Sabía que la Horda estaba detrás de esto!', 30706),
(168312, 'esMX', '¡Entreguen los suministros y liberaremos a los vulperas!', '¡Entreguen los suministros y liberaremos a los vulperas!', 30706),
(168311, 'esMX', '', 'No todos los miembros de mi patrulla sobrevivieron, pero muchos sí. Eso es algo, ¿no?\n\nGracias por salvar todas las vidas que pudiste.', 30706),
(168310, 'esMX', '¡Los vulperas no debieron entrometerse!', '¡Los vulperas no debieron entrometerse!', 30706),
(168309, 'esMX', '¡La Horda no puede conseguir estos suministros!', '¡La Horda no puede conseguir estos suministros!', 30706),
(168308, 'esMX', '', 'El ataque de la Horda fue repentino. ¡Puntanzuelo necesita ayuda ahora!', 30706),
(168307, 'esMX', 'Al fin paz.', 'Al fin paz.', 30706),
(168306, 'esMX', 'Aysa... te he fallado.', 'Aysa... te he fallado.', 30706),
(168305, 'esMX', '¡Mis años de meditación me han preparado para matar a basuras de la Horda como tú!', '¡Mis años de meditación me han preparado para matar a basuras de la Horda como tú!', 30706),
(168304, 'esMX', '¡La furia de mil golpes te aplastará!', '¡La furia de mil golpes te aplastará!', 30706),
(168303, 'esMX', '¡No tienes honor! ¡Mi bastón será tu fin!', '¡Los Honorables no tienen honor! ¡Mi bastón será tu fin!', 30706),
(168302, 'esMX', 'Sí, sí. Estoy en eso.', 'Sí, sí. Estoy en eso.', 30706),
(168301, 'esMX', 'Tal vez renegociemos un poco cuando termine aquí.', 'Tal vez renegociemos un poco cuando termine aquí.', 30706),
(168300, 'esMX', 'Enseguida, colega.', 'Enseguida, colega.', 30706),
(168299, 'esMX', 'Estoy en eso.', 'Estoy en eso.', 30706),
(168298, 'esMX', '|cFF0000FF(Misión)|r Dime cómo puedo ser de ayuda.', '|cFF0000FF(Misión)|r Dime cómo puedo ser de ayuda.', 30706),
(168297, 'esMX', 'Reconozco el poder que has traído ante mí. Lo sentí en mi corteza y en mis huesos antes de que llegaras a la cima.\n\nSe trata de magia antigua que ha sido corrompida.\n\nDebemos actuar rápido si queremos estar a salvo de su corrupción.', '', 30706),
(168296, 'esMX', '¡Corran!', '¡Corran!', 30706),
(168295, 'esMX', '¡La puerta no resistirá!', '¡La puerta no resistirá!', 30706),
(168294, 'esMX', '¡Hay que conseguir ayuda!', '¡Hay que conseguir ayuda!', 30706),
(168293, 'esMX', '¡Alguien debe detenerlo!', '¡Alguien debe detenerlo!', 30706),
(168292, 'esMX', '¡Logrará entrar!', '¡Logrará entrar!', 30706),
(168291, 'esMX', '¡La Alianza ya comienza a desmoronarse ante nuestro poder! Sube, $r. ¡Hay que terminar esta pelea!', '', 30706),
(168290, 'esMX', 'No puedes... ganar.', 'No puedes... ganar.', 30706),
(168289, 'esMX', 'La Horda... no vencerá...', 'La Horda... no vencerá...', 30706),
(168288, 'esMX', 'No puedes... matarnos a todos...', 'No puedes... matarnos a todos...', 30706),
(168287, 'esMX', 'Ya es tarde para detenernos.', 'Ya es tarde para detenernos.', 30706),
(168286, 'esMX', '¡Tus fronteras son débiles!', '¡Tus fronteras son débiles!', 30706),
(168285, 'esMX', '¡Esto es por Teldrassil!', '¡Esto es por Teldrassil!', 30706),
(168284, 'esMX', '¡Tú, $r! ¡Sube y ve a la batalla!', '', 30706),
(168283, 'esMX', 'Escoria de la Horda.', 'Escoria de la Horda.', 30706),
(168282, 'esMX', '¡Por la Alianza!', '¡Por la Alianza!', 30706),
(168281, 'esMX', '¡Por la Horda!', '¡Por la Horda!', 30706),
(168280, 'esMX', 'No tienen los números para triunfar. ¡Es solo cuestión de tiempo!', 'No tienen los números para triunfar. ¡Es solo cuestión de tiempo!', 30706),
(168279, 'esMX', '¿A eso llamas línea de suministros?', '¿A eso llamas línea de suministros?', 30706),
(168278, 'esMX', 'Los suministros que trajo tu gente serán de gran ayuda para la Horda.', 'Los suministros que trajo tu gente serán de gran ayuda para la Horda.', 30706),
(168277, 'esMX', 'La Alianza... aún... caerá...', 'La Alianza... aún... caerá...', 30706),
(168276, 'esMX', 'Nuestros amigos de la Liga de Expedicionarios han descubierto estos huesos. El esqueleto parece estar intacto, será un buen conducto.$b$bEl Vacío necesita consumir. Devorar. Crecer. Responderá tu llamado y permitirá que lo guíes por un tiempo.$b$bEntiendo que los zandalari veneran especialmente a sus muertos, una costumbre bastante primitiva para una civilización tan magnífica. Podría decirse que es... poético que uno de los suyos cause su ruina, ¿no crees?', '', 30706),
(168275, 'esMX', 'Esperaba... una victoria...No la muerte...', 'Esperaba... una victoria...No la muerte...', 30706),
(168274, 'esMX', 'Vendrán más...', 'Vendrán más...', 30706),
(168273, 'esMX', 'Una... muerte... gloriosa...', 'Una... muerte... gloriosa...', 30706),
(168272, 'esMX', '¡$R! ¡Apresúrate y ven aquí! Hemos comenzado nuestro asalto sobre esta tierra maldita.', '', 30706),
(168271, 'esMX', '¡Muere!', '¡Muere!', 30706),
(168270, 'esMX', '¿Creíste que podías infiltrarte en NUESTRO territorio?', '¿Creíste que podías infiltrarte en NUESTRO territorio?', 30706),
(168269, 'esMX', '', 'Este tótem servirá para espantar a los vulperas sin hacerles daño. Luego podrás concentrarte en el objetivo principal: destruir los suministros de la Horda.', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(168268, 'esMX', '', 'Los vulperas no son nuestros enemigos. Pero no podemos permitirles que transporten suministros para la Horda.', 30706),
(168267, 'esMX', 'He estado esperando una buena pelea. Intenta no morir demasiado rápido.', 'He estado esperando una buena pelea. Intenta no morir demasiado rápido.', 30706),
(168266, 'esMX', 'Mi lobo se dará un festín contigo.', 'Mi lobo se dará un festín contigo.', 30706),
(168265, 'esMX', '¡Escoria de la Alianza!', '¡Escoria de la Alianza!', 30706),
(168264, 'esMX', '¡Pintaremos todo este continente de rojo con tu sangre!', '¡Pintaremos todo este continente de rojo con tu sangre!', 30706),
(168263, 'esMX', '¿Qué ritual es este, magíster?', '¿Qué ritual es este, magíster?', 30706),
(168262, 'esMX', 'Telaamon, señor, ¡nos ataca un Lanza Negra solitario llamado Rokhan!', 'Telaamon, señor, ¡nos ataca un Lanza Negra solitario llamado Rokhan!', 30706),
(168261, 'esMX', '¿Rokhan? He oído sobre ese cazador de las sombras. Veamos qué tan poderoso es en verdad.', '', 30706),
(168260, 'esMX', 'Gallywix, sé que voy a arrepentirme de preguntarte esto, ¿pero qué piensas de la resurrección de Derek Valiente?', 'Gallywix, sé que voy a arrepentirme de preguntarte esto, ¿pero qué piensas de la resurrección de Derek Valiente?', 30706),
(168259, 'esMX', '', 'Lilian me ha estado ayudando a amigarme con quien soy... y con las razones que ella tuvo para participar en todo esto.', 30706),
(168258, 'esMX', '', 'Pelearemos por Lady Shandris siempre que ella lo pida.', 30706),
(168257, 'esMX', 'Lilian, ¿qué piensas sobre la decisión de Sylvanas de resucitar a Derek Valiente?', 'Lilian, ¿qué piensas sobre la decisión de Sylvanas de resucitar a Derek Valiente?', 30706),
(168256, 'esMX', 'Lilian, oí que ayudaste a la familia de Zelling a conseguir una casa en Drustvar.', 'Lilian, oí que ayudaste a la familia de Zelling a conseguir una casa en Drustvar.', 30706),
(168255, 'esMX', 'Baine, pareces angustiado con la decisión de Sylvanas de revivir a Derek Valiente.', 'Baine, pareces angustiado con la decisión de Sylvanas de revivir a Derek Valiente.', 30706),
(168254, 'esMX', '¿Qué piensas sobre la decisión de Sylvanas de resucitar a Derek Valiente?', '¿Qué piensas sobre la decisión de Sylvanas de resucitar a Derek Valiente?', 30706),
(168253, 'esMX', 'Qué necedad por parte de la Alianza pensar que podrían impedir que hagamos experimentos aquí. ¡Si el añublo es una creación derivada de las mayores potencias de la naturaleza!\n\nEste enorme árbol no nos demorará mucho, no te preocupes.', '', 30706),
(168252, 'esMX', 'La Horda piensa que puede obtener poder de la tierra para mejorar sus armas de guerra. Nuestro Anciano del conocimiento nos ayudará a revertir el daño que han provocado.', '', 30706),
(168251, 'esMX', '', 'Nunca antes había visto una invasión como esta, pero una vez que acabemos con la Horda, ¡no volverán nunca más!', 30706),
(168250, 'esMX', '¿Y ahora qué? ¿Elementales enormes y furiosos? ¡Hasta aquí llegué!', '¿Y ahora qué? ¿Elementales enormes y furiosos? ¡Hasta aquí llegué!', 30706),
(168249, 'esMX', '¡Niiishaaa!', '¡Niiishaaa!', 30706),
(168248, 'esMX', '¡¿Qué es eso?!', '¡¿Qué es eso?!', 30706),
(168247, 'esMX', '¡Se suponía que era un trabajo sencillo!', '¡Se suponía que era un trabajo sencillo!', 30706),
(168246, 'esMX', '¡Me largo de aquí!', '¡Me largo de aquí!', 30706),
(168245, 'esMX', '¡Nadie mencionó que habría elementales furiosos!', '¡Nadie mencionó que habría elementales furiosos!', 30706),
(168244, 'esMX', '¡No me contrataron para esto!', '¡No me contrataron para esto!', 30706),
(168243, 'esMX', '¡Aaah!', '¡Aaah!', 30706),
(168242, 'esMX', '¡Saluda a Ulfar de mi parte!', '', 30706),
(168241, 'esMX', '¡Ya casi llegamos!', '', 30706),
(168240, 'esMX', '', 'No tenemos problemas con los vulperas, pero la Horda les alquila sus caravanas para transportar suministros bélicos.\n\nEsto no puede continuar.\n\nTengo la esperanza de que podamos espantar a los conductores de las caravanas y desalentarlos para que no sigan trabajando con la Horda en el futuro... sin convertirlos en nuestros enemigos.\n\n<Vakaara suspira.> \n\nLa diplomacia en tiempos de guerra no es una tarea fácil.', 30706),
(168239, 'esMX', 'Solo... no mires hacia abajo.', '', 30706),
(168238, 'esMX', 'Por suerte para ti, conozco el terreno a la perfección.', '', 30706),
(168237, 'esMX', 'Entrégame el tótem. ¡Espantaré a los vulperas!', 'Entrégame el tótem. ¡Espantaré a los vulperas!', 30706),
(168236, 'esMX', '', 'Nos hemos enterado que la Horda está alquilando caravanas vulperas para transportar suministros bélicos.\n\nAunque no tenemos problemas con las pequeñas personas zorro, no podemos permitir que ayuden a nuestros enemigos.\n\nUsa este Tótem aterrarenas para atemorizar a los vulperas y alejarlos de los suministros. Luego, destrúyelos.\n\nEspero haber sido clara: debes destruir los suministros, ¡no a los vulperas! Solo queremos disuadirlos de seguir trabajando para la Horda.', 30706),
(168235, 'esMX', 'Pero cuando empieza a sermonear sobre la \"dignidad\", dejo de escucharlo.', '', 30706),
(168234, 'esMX', 'En fin, hace tiempo intento convencer a Ulfar de que una forma de cabra sería increíble.', '', 30706),
(168233, 'esMX', 'Sujétate fuerte, este paseo será un poco agitado.', '', 30706),
(168232, 'esMX', '¡No estamos a la altura de ellos!', '¡No estamos a la altura de ellos!', 30706),
(168231, 'esMX', '¡Por la Horda!', '¡Por la Horda!', 30706),
(168230, 'esMX', '¡Necesitamos refuerzos!', '¡Necesitamos refuerzos!', 30706),
(168229, 'esMX', '¡Nos atacan!', '¡Nos atacan!', 30706),
(168228, 'esMX', '¡La Alianza está atacando!', '¡La Alianza está atacando!', 30706),
(168227, 'esMX', '¡Su adalid está aquí!', '¡Su adalid está aquí!', 30706),
(168226, 'esMX', '', '¡Ya tengo un objetivo!', 30706),
(168225, 'esMX', '', 'Esto será rápido.', 30706),
(168224, 'esMX', '', '¡Por la Alianza!', 30706),
(168223, 'esMX', '', 'Considéralo hecho.', 30706),
(168222, 'esMX', '', 'Así que lo tomé prestado.', 30706),
(168221, 'esMX', '', 'Gesbish Apagabots dejó las llaves puestas.', 30706),
(168220, 'esMX', '', '¡Es casi como ser una máquina!', 30706),
(168219, 'esMX', '', 'Baja la voz. Por supuesto que me ocupé de que su familia estuviera bien. ¿Crees que soy un monstruo?\n\nMejor no me respondas.\n\nLe di a Zelling mi palabra de que su familia estaría a salvo. Y pienso cumplir con mi promesa, aunque sea desde las sombras.', 30706),
(168218, 'esMX', 'No puedo permitir esto, $n. Cada vez que pienso que Sylvanas ha ido demasiado lejos, encuentra una nueva línea que cruzar. La he visto cometer un acto deshonroso tras otro.\n\nProfana más que la memoria de un enemigo caído. Profana a la misma Horda.\n\nEsto no puede seguir así. Hay que hacer algo. Y pronto.', '', 30706),
(168217, 'esMX', '', 'Lo último que hizo mi padre fue invocar el poder de Bwonsamdi. Es común que los zandalari invoquemos a los muerto\' para que nos sirvan.\n\nPero resucitar a Derek Valiente... me da una mala sensación. Me recuerda a lo que Zul le hizo a mi amado Rezan... un acto vil que me rompió el corazón..\n\nLa Alianza debe pagar por la muerte de mi padre. Pero no podemo\' dejar la furia nos ciegue... ni nos haga olvidar el honor que hace grandes a los zandalari.', 30706),
(168216, 'esMX', 'Ohhhhh, ¡la Alianza estallará de rabia con esta! Nos van a atacar con todo lo que tienen. Sabes lo que eso significa, ¿no?\n\n¡Significa que mi margen de ganancia en blindaje de armadura de azerita se irá a las nubes! Tengo que duplicar —no triplicar— mis operaciones de minería. Menos mal que no les pago horas extra a mis matones. En realidad, ni siquiera les pago.\n\nAhora, si me disculpas, tengo que ir a hablar con una jefa de guerra sobre oferta y demanda. ¡Muévete!', '', 30706),
(168215, 'esMX', '', 'Cuando todavía era cadete, mis instructores me contaban historias sobre la valentía de Derek Valiente. Todos los capitanes que conocía soñaban con estar a su altura. \n\nMe duele verlo así, saber que nunca más será aceptado por su pueblo y su familia.\n\nY saber que en parte fue mi culpa.', 30706),
(168214, 'esMX', '', 'No me sorprende. Siempre supe que la Reina alma en pena era capaz de usar tácticas como estas. Como le gusta decir, son las flechas en su carcaj.\n\nEsto no cambia nada para mí... ni para lo que tengo que hacer.', 30706),
(168213, 'esMX', '', 'La guerra no es bonita. Yo lo sé muy bien, y también lo sabe Brisaveloz. Tienes que decidir lo que estás dispuesto a hacer para alcanzar la victoria... y lo que no.', 30706),
(168212, 'esMX', '¡Por supuesto! ¡Sube!', '', 30706),
(168211, 'esMX', '¿Puedes llevarme con el alto orador de espinas?', '¿Puedes llevarme con el alto orador de espinas?', 30706),
(168210, 'esMX', 'Arboledul dijo que podías necesitar ayuda para llegar a Ulfar. Su guarida no está bien señalizada, por así decirlo.', '', 30706),
(168206, 'esMX', '¡Ey, tú, $c! ¡Estamos tomando la tierra de los zandalari! ¡Sube!', '', 30706),
(168202, 'esMX', '¡Ey, tú, $c! Es hora de demostrarle a la Horda que no están seguros aquí. ¡Sube y ve a la batalla, soldado!', '', 30706),
(168201, 'esMX', '|TInterface\\Icons\\INV_MISC_ENGGIZMOS_35.BLP:20|t ¡%s comienza a lanzar |cFFFF0000|Hspell:287952|h[Generador de agujeros de gusano]|h|r!', '|TInterface\\Icons\\INV_MISC_ENGGIZMOS_35.BLP:20|t ¡%s comienza a lanzar |cFFFF0000|Hspell:287952|h[Generador de agujeros de gusano]|h|r!', 30706),
(168200, 'esMX', '|TInterface\\Icons\\ACHIEVEMENT_CHARACTER_GNOME_MALE.BLP:20|t ¡Te han |cFFFF0000|Hspell:284168|h[Encogido]|h|r, cuidado!', '|TInterface\\Icons\\ACHIEVEMENT_CHARACTER_GNOME_MALE.BLP:20|t ¡Te han |cFFFF0000|Hspell:284168|h[Encogido]|h|r, cuidado!', 30706),
(168199, 'esMX', '¡Demasiado fácil!', '¡Demasiado fácil!', 30706),
(168198, 'esMX', 'Fuerza... y honor...', 'Fuerza... y honor...', 30706),
(168197, 'esMX', 'La Horda... prevalecerá...', 'La Horda... prevalecerá...', 30706),
(168196, 'esMX', 'Muero... como un guerrero...', 'Muero... como una guerrera...', 30706),
(168195, 'esMX', '¡Sangre y truenos!', '¡Sangre y truenos!', 30706),
(168194, 'esMX', '¡Por la Horda!', '¡Por la Horda!', 30706),
(168193, 'esMX', '¡Victoria o muerte!', '¡Victoria o muerte!', 30706),
(168192, 'esMX', '|TInterface\\Icons\\SPELL_SHAMAN_STATICSHOCK.BLP:20|t ¡Te estás quedando sin tiempo! ¡El |cFFFF0000|Hspell:286480|h[Choque antimanipulación]|h|r es inminente!', '|TInterface\\Icons\\SPELL_SHAMAN_STATICSHOCK.BLP:20|t ¡Te estás quedando sin tiempo! ¡El |cFFFF0000|Hspell:286480|h[Choque antimanipulación]|h|r es inminente!', 30706),
(168191, 'esMX', '¡Ey, tú, $c! ¡Estamos atacando a la Horda en Nazmir! ¡Súbete y marcha al ataque, soldado!', '', 30706),
(168190, 'esMX', '|TInterface\\Icons\\ACHIEVEMENT_CHARACTER_GNOME_MALE.BLP:20|t ¡Te han|cFFFF0000|Hspell:284168|h[Encogido]|h|r! ¡Toma el control del chispabot!', '|TInterface\\Icons\\ACHIEVEMENT_CHARACTER_GNOME_MALE.BLP:20|t ¡Te han|cFFFF0000|Hspell:284168|h[Encogido]|h|r! ¡Toma el control del chispabot!', 30706),
(168189, 'esMX', '¡No eres rival para mí!', '¡No eres rival para mí!', 30706),
(168188, 'esMX', '¡Tengo a su adalid en la mira!', '¡Tengo a su adalid en la mira!', 30706),
(168187, 'esMX', '¡Liquídalo!', '¡Liquídalo!', 30706),
(168186, 'esMX', '¡Lo tengo en la mira!', '¡Lo tengo en la mira!', 30706),
(168184, 'esMX', 'Voy... al otro lado...', 'Voy al... otro lado...', 30706),
(168183, 'esMX', 'La Horda nos vengará...', 'La Horda nos vengará...', 30706),
(168182, 'esMX', 'Tendría que haberme alejado... del vudú...', 'Tendría que haberme alejado... del vudú...', 30706),
(168181, 'esMX', '¡Eh\'ta tierra es nuestra!', '¡Eh\'ta tierra es nuestra!', 30706),
(168180, 'esMX', '¡Muerte a los enemigos de la Horda!', '¡Muerte a los enemigos de la Horda!', 30706),
(168179, 'esMX', '¡Te eh\'tás metiendo con el trol equivocado, colega!', '¡Te eh\'tás metiendo con la trol equivocada, colega!', 30706),
(168178, 'esMX', '', '¿Sabes lo difícil que es dejar portales abiertos todo el día?\n\nRealmente no es lo mío. Me dedicaré solo a supervisar. En serio, ¡hay que cuidar a esos lunáticos!', 30706),
(168177, 'esMX', 'Llenando la vasija', 'Llenando la vasija', 30706),
(168176, 'esMX', 'Los orcos adoran la luz tenue.\n\nLamentablemente, no es ideal para estudiar.', 'Los orcos adoran la luz tenue.\n\nLamentablemente, no es ideal para estudiar.', 30706),
(168175, 'esMX', '', 'Tenía mis reservas con los Renegados cuando me uní a la Horda, pero me aseguraron que elegían la no-muerte voluntariamente. Ahora esto...\n\nLos Natonorcturno sufrieron mucho bajo el yugo de la Legión. Las atrocidades que he visto... es escalofriante cuánto esto me recuerda a esas épocas. Eso es todo lo que diré.', 30706),
(168174, 'esMX', '¿Me llaman mis compañeros? ¿Ya es hora?', '', 30706),
(168173, 'esMX', '¿Qué piensas sobre la resurrección de Derek Valiente, Valtrois?', '¿Qué piensas sobre la resurrección de Derek Valiente, Valtrois?', 30706),
(168172, 'esMX', '', 'Debo admitir que la arquitectura de los zandalari es impresionante. No tanto el olor...', 30706),
(168171, 'esMX', '', '¡Te inclinarás ante nuestra reina!', 30706),
(168170, 'esMX', '', '¡Azshara reclamará estas tierras!', 30706),
(168169, 'esMX', '', '¡Nuestras mareas los devorarán!', 30706),
(168168, 'esMX', '', 'Véngame... mi reina...', 30706),
(168167, 'esMX', '', 'Los mares te enterrarán...', 30706),
(168166, 'esMX', '', 'No puedes... detenernos...', 30706),
(168165, 'esMX', 'No puedes... detenernos...', '', 30706),
(168164, 'esMX', 'Los mares te enterrarán...', '', 30706),
(168163, 'esMX', 'Véngame... mi reina...', '', 30706),
(168162, 'esMX', '¡Nuestras mareas los devorarán!', '', 30706),
(168161, 'esMX', '¡Azshara reclamará estas tierras!', '', 30706),
(168160, 'esMX', '¡Te inclinarás ante nuestra reina!', '', 30706),
(168159, 'esMX', 'El botín... valió la pena...', 'El botín... valió la pena...', 30706),
(168158, 'esMX', 'Perdón, capitán...', 'Perdón, capitán...', 30706),
(168157, 'esMX', 'Prefiero morir... a ser de la Alianza...', 'Prefiero morir... a ser de la Alianza...', 30706),
(168156, 'esMX', 'Arrr.... ggg...', 'Arrr.... ggg...', 30706),
(168155, 'esMX', 'Al menos... nunca fui de la Alianza...', 'Al menos... nunca fui de la Alianza...', 30706),
(168154, 'esMX', 'A la deriva...', 'A la deriva...', 30706),
(168153, 'esMX', 'Zelling, pareces angustiado. ¿Es por la resurrección de Derek Valiente?', 'Zelling, pareces angustiado. ¿Es por la resurrección de Derek Valiente?', 30706),
(168152, 'esMX', 'Muero libre... y más pirata... que nunca...', 'Muero libre... y más pirata... que nunca...', 30706),
(168151, 'esMX', 'Bien... quédate... con tu tesoro...', 'Bien... quédate... con tu tesoro...', 30706),
(168150, 'esMX', '¡Por la capitana!', '¡Por la capitana!', 30706),
(168149, 'esMX', '¡Corre, sabandija! ¡Será más divertido!', '¡Corre, sabandija! ¡Será más divertido!', 30706),
(168148, 'esMX', '¡Saqueo y destrucción!', '¡Saqueo y destrucción!', 30706),
