(167548, 'esMX', 'Debe ser desconcertante volver a estar vivo de repente, sobre todo resucitar en medio del campo de batalla.\n\nEstamos aquí para ayudar a nuestros reclutas nuevos a adaptarse en esta transición.', '', 30706),
