(167527, 'esMX', 'ADVERTENCIA: Esta elección te impedirá completar las misiones principales de El destino de Colmillosauro y te otorgará en cambio una misión alternativa.\n\nNo podrás obtener el juguete Capa gastada como recompensa, pero podrás llevarte otras.\n\nZekhan recordará esto. ¿Quieres continuar?', 'ADVERTENCIA: Esta elección te impedirá completar las misiones principales de El destino de Colmillosauro y te otorgará en cambio una misión alternativa.\n\nNo podrás obtener el juguete Capa gastada como recompensa, pero podrás llevarte otras.\n\nZekhan recordará esto. ¿Quieres continuar?', 30706),
