(167502, 'esMX', 'Vi... ¡Vi todo!', '', 30706),
(167501, 'esMX', '<Jux mira avergonzado hacia adelante y hacia atrás.>\n\nEehh, no nos gusta hablar sobre lo que ocurrió con el MEKarita Mk. I. Basta con decir que no superó las pruebas en el mar. ¿Entiendes?', '', 30706),
