(167484, 'esMX', 'Tienes la mirada perdida. ¿Vienes por un trago?', '', 30706),
(167483, 'esMX', 'Fue hace mucho tiempo, Lady almirante. Pero el nombre me suena familiar...', '', 30706),
(167482, 'esMX', '', 'Creo que los barcos de Lagos eran un ejemplo de excelencia cuando servías en la guardia de mi padre.', 30706),
(167481, 'esMX', 'Mmm... Sí, Lagos…', '', 30706),
(167480, 'esMX', 'Los eh\'piritus están en desacuerdo...', '', 30706),
(167479, 'esMX', 'Se piensan que sus muros brillante\' y el destello de sus luce\' nos alejarán de esta ciudad.', '', 30706),
(167478, 'esMX', 'La Alianza enviará refuerzos templeluz para luchar contra nosotro\'.', '', 30706),
(167477, 'esMX', '', '¡Todo el poder a los escudos de retaguardia! ¡Que nada ni nadie entre en la ciudad!', 30706),
(167476, 'esMX', '', '¿Qué es lo que está derribando las defensas? ¡Quiero respuestas!', 30706),
(167475, 'esMX', '', '¡Necesitamos más tropas en el flanco oriental! ¡Defiendan el frente!', 30706),
(167474, 'esMX', '', '¿Qué es ese sonido impío? ¡Quiero un informe de la situación de inmediato!', 30706),
(167473, 'esMX', '', '¡Argh! Solo veo... oscuridad... ¿Por qué?', 30706),
(167472, 'esMX', '¡MUERTE!', '', 30706),
(167471, 'esMX', 'Nuestros enemigo\' aquí escucharán nuestro grito: ¡MUERTE!', '', 30706),
(167470, 'esMX', '¡Llenen eh\'tos recipientes con todo su dolor, su furia y poder!', '', 30706),
(167469, 'esMX', 'Eh\'piritus antiguos, abandonados y olvidados, estoy aquí. Los recuerdo.', '', 30706),
(167464, 'esMX', '¡La Horda ha capturado Lor\'danel!', '¡La Horda ha capturado Lor\'danel!', 30706),
(167463, 'esMX', 'Los Lanza Negra han organizado el transporte a Zandalar en bote desde las Islas del Eco al sur de Orgrimmar.', 'Los Lanza Negra han organizado el transporte a Zandalar en bote desde las Islas del Eco al sur de Orgrimmar.', 30706),
(167462, 'esMX', 'Ah, $p. Qué bueno. Estoy probando una hipótesis y necesito la ayuda de $Uun aventurero:una aventurera;... resistente como tú.$b$bEstamos experimentando con la reanimación de los amigos caídos de Zandalar.$b$bNo es un método de combate eficiente desde el punto de vista del maná, pero el trauma psicológico que les generaremos a los enemigos compensará los costos. Los zandalari no tienen mucha tolerancia a los cadáveres reanimados.$b$bNecesito más materiales para seguir trabajando, pero puedes tomar dos de mis primeras pruebas creadas por el Vacío para ver cómo funcionan. ¡Que lo disfrutes!', '', 30706),
(167461, 'esMX', 'Listo para probar.', 'Lista para probar.', 30706),
(167460, 'esMX', '¿Tú eres D. Lagos?', '¿Tú eres D. Lagos?', 30706),
(167459, 'esMX', '<No aparta los ojos de su tarea de jardinería mientras te acercas.>\n\nTen cuidado de no pisar las flores. Mi esposa detesta que las pisen.', '', 30706),
(167458, 'esMX', '<Sam parece estar muy contento.>\n\n¿Qué te ha parecido mi señora?', '', 30706),
(167457, 'esMX', 'Busco un carpintero de barcos y me han dicho que sabes dónde puedo encontrar a D. Lagos.', 'Busco un carpintero de barcos y me han dicho que sabes dónde puedo encontrar a D. Lagos.', 30706),
(167456, 'esMX', 'Me alegra volver a verte, $n.', '', 30706),
(167454, 'esMX', 'Princesa Talanji, estoy listo para enfrentar a la Alianza. Recuperemos el cetro abisal.', 'Princesa Talanji, estoy lista para enfrentar a la Alianza. Recuperemos el cetro abisal.', 30706),
(167453, 'esMX', '', '... ¿Nada? ¿Dónde eh\'tá el ejército? ¿La flota?', 30706),
(167452, 'esMX', '', '¡Prepárense! Cuando la niebla se levante, cargaremos contra la flota y Raal los asaltará con nuestras fuerzas aérea\'.', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(167451, 'esMX', 'Zandalar', 'Zandalar', 30706),
(167450, 'esMX', 'Busca al capitán Hicks del Implacable en el último muelle al sur de Puerto de Ventormenta. Es un barco confiable que parte periódicamente directo a Kul Tiras.', 'Busca al capitán Hicks del Implacable en el último muelle al sur de Puerto de Ventormenta. Es un barco confiable que parte periódicamente directo a Kul Tiras.', 30706),
(167449, 'esMX', 'Kul Tiras', 'Kul Tiras', 30706),
(167448, 'esMX', 'Para eso sirven los vagones de peste. Solo falta que Clamañublo dé la orden.', '', 30706),
(167447, 'esMX', 'Continuemos con la misión de la Dama Oscura. ¡Vamos a lanzar añublo!', '', 30706),
(167446, 'esMX', 'Asegúrate de que llegue a destino. ¡Tenemos que ganar esta batalla!', '', 30706),
(167445, 'esMX', '$p, ¡te asesinaré y después acabaré con estos otros demonios!', '', 30706),
(167444, 'esMX', '¡Un corsario kultirano se acerca por estribor!', '¡Un corsario kultirano se acerca por estribor!', 30706),
(167443, 'esMX', '¡Un corsario kultirano se acerca por babor!', '¡Un corsario kultirano se acerca por babor!', 30706),
(167442, 'esMX', '', 'No eh\'ta vez.', 30706),
(167441, 'esMX', 'Urgh... ¡la Luz... me... protegerá!', '', 30706),
(167440, 'esMX', '¡Debo proteger a lo salvaje!', '', 30706),
(167439, 'esMX', '', 'Cuando nuestro pueblo necesitó un hogar, los elfos de la noche nos acogieron. Nos nos quedaremos de brazos cruzados mientras ellos luchan para recuperar su hogar. ¡Pelearemos a su lado!', 30706),
(167438, 'esMX', 'Concédeme tu bendición.', 'Concédeme tu bendición.', 30706),
(167437, 'esMX', '¡Las corrientes los arrastrarán a su perdición!', '¡Las corrientes los arrastrarán a su perdición!', 30706),
(167436, 'esMX', '¡El mar será su tumba!', '¡El mar será su tumba!', 30706),
(167435, 'esMX', '¡Las mareas los aplastarán!', '¡Las mareas los aplastarán!', 30706),
(167434, 'esMX', '¡Que los traguen las profundidades!', '¡Que los traguen las profundidades!', 30706),
(167433, 'esMX', '¡No pueden escapar del abismo!', '¡No pueden escapar del abismo!', 30706),
(167432, 'esMX', '¡Húndanse bajo las olas!', '¡Húndanse bajo las olas!', 30706),
(167431, 'esMX', '¡Nuestras fuerzas inundarán esta tierra!', '¡Nuestras fuerzas inundarán esta tierra!', 30706),
(167430, 'esMX', '', 'No es... el mejor resultado...', 30706),
(167429, 'esMX', '¡Prepárense! ¡Los caminantes caerán a nuestros pies!', '¡Prepárense! ¡Los caminantes caerán a nuestros pies!', 30706),
(167428, 'esMX', '¡Nuestra reina reclama esta tierra para el abismo! ¡Nadie se interpondrá en su camino!', '¡Nuestra reina reclama esta tierra para el abismo! ¡Nadie se interpondrá en su camino!', 30706),
(167427, 'esMX', '¡La marea se alzará y se tragará esta tierra por la gloria de nuestra reina!', '¡La marea se alzará y se tragará esta tierra por la gloria de nuestra reina!', 30706),
(167426, 'esMX', '¡Tráiganme más cautivos! ¡El abismo ansía sus almas!', '¡Tráiganme más cautivos! ¡El abismo ansía sus almas!', 30706),
(167425, 'esMX', '¡Drenen la vida de su cuerpo! ¡Nuestra reina lo exige!', '¡Drenen la vida de su cuerpo! ¡Nuestra reina lo exige!', 30706),
(167424, 'esMX', '¡Respiren hondo, caminantes! ¡Dejen que el océano les llene los pulmones y libere su alma!', '¡Respiren hondo, caminantes! ¡Dejen que el océano les llene los pulmones y libere su alma!', 30706),
(167423, 'esMX', '¡Tráiganme a los prisioneros! ¡El abismo pide más almas!', '¡Tráiganme a los prisioneros! ¡El abismo pide más almas!', 30706),
(167422, 'esMX', '¡La Profundidad Voraz consumirá sus almas!', '¡La Profundidad Voraz consumirá sus almas!', 30706),
(167421, 'esMX', '¡Encuentren a los demás! ¡Necesitamos más sacrificios!', '¡Encuentren a los demás! ¡Necesitamos más sacrificios!', 30706),
(167420, 'esMX', '¡La reina reclama más almas para el abismo!', '¡La reina reclama más almas para el abismo!', 30706),
(167419, 'esMX', '¡Ahóguenlos! ¡Liberen sus almas al abismo!', '¡Ahóguenlos! ¡Liberen sus almas al abismo!', 30706),
(167418, 'esMX', 'Recursos: agotados. Apagando.', '', 30706),
(167417, 'esMX', 'Runas: vinculadas. Horda detectada. Modo de purificación: activado.', '', 30706),
(167416, 'esMX', '', 'Nos reuniremos en la oficina del supervisor de puerto.', 30706),
(167415, 'esMX', 'Estos títeres élficos del Vacío han venido a infestar a mis niños con su magia oscura. Reúne a mis niños y después tráeme la cabeza de esas abominaciones devotas.', '', 30706),
(167414, 'esMX', '¿Quieres seguir?', '¿Quieres seguir?', 30706),
(167413, 'esMX', '¡Tras ellos!', '¡Tras ellos!', 30706),
(167412, 'esMX', '', '¡La hija del mar no eh\'capará!', 30706),
(167411, 'esMX', '¿Qué sabemos acerca de los kultiranos?', '¿Qué sabemos acerca de los kultiranos?', 30706),
(167410, 'esMX', '', 'Los kultiranos y la Alianza han resistido mucho juntos. Quiero fortalecer nuestro vínculo.', 30706),
(167409, 'esMX', '', 'No se me ocurre nadie mejor para ayudarme con esta tarea, $n.', 30706),
(167408, 'esMX', 'Los seguiremos en el M.I.D.A.S.-V, ¡que la Alianza no trate de sorprendernos de nuevo!', '', 30706),
(167407, 'esMX', 'Tenemos que deh\'cubrir cómo destruir esta niebla y eliminar al resto de los miembro\' de la Alianza.', '', 30706),
(167406, 'esMX', '¡Concéntrense! ¡Todavía no terminamo\' de luchar contra la Alianza!', '', 30706),
(167405, 'esMX', '... Dije lo que dije, ¡yo no me retracto!', '', 30706),
(167404, 'esMX', 'Eh... ¿jefe? ¿No quiere pensarlo un poco mejor?', '', 30706),
(167403, 'esMX', '¡Les demostraremos a estos tipos que este pantano letal, maldito y horroroso le pertenece a la HORDA!', '', 30706),
(167401, 'esMX', '¡Tu presencia no es bienvenida aquí!', '', 30706),
(167400, 'esMX', 'Estos prisioneros nos darán información valiosa.', '', 30706),
(167399, 'esMX', 'Tus servicios serán bien recompensados.', '', 30706),
(167398, 'esMX', 'Gracias a tu ayuda, la Horda se ha asegurado una victoria', '', 30706),
(167397, 'esMX', '', '¡Solo se aceptan pagos en oro!', 30706),
(167396, 'esMX', '', 'Hay muchos más de donde salieron estos.', 30706),
(167395, 'esMX', '', 'Todos hablan con el estímulo adecuado.', 30706),
(167394, 'esMX', '', 'Esperamos el pago completo contraentrega.', 30706),
(167393, 'esMX', 'Se atragantarán con las cenizas... de sus crímenes.', '', 30706),
(167392, 'esMX', 'Perros necios. ¡Cayeron directamente en mi trampa! Ahora, ¡mueran!', '', 30706),
(167391, 'esMX', 'Ofrecer un tributo al altar.', 'Ofrecer un tributo al altar.', 30706),
(167390, 'esMX', 'Frente a ti, hay un pequeño altar de monedas y restos.', '', 30706),
(167389, 'esMX', '', '¡La Alianza perdió el control de las ruinas de Zul\'jan! Entremo\', tenemos mucho que planificar.', 30706),
(167388, 'esMX', '', 'Nuestros soldado\' pueden encargarse de lo que queda de la Avanzada Caída, ¡nosotros tenemo\' que ir a las ruinas de Zul\'jan!', 30706),
(167387, 'esMX', '', 'Tanto... frío...', 30706),
(167386, 'esMX', '', '¿Piensas que puedes sobrevivir al frío?', 30706),
(167385, 'esMX', '', '|TInterface\\Icons\\INV_STAFF_53:20|t|cFFFF0000%s|r marca a |cFFFF0000$n|r para lanzar |cFFFF0000|Hspell:288380|h[Explosión de rompedor de asedio]|h|r, ¡aléjate!', 30706),
(167384, 'esMX', '|TInterface\\Icons\\ABILITY_VEHICLE_LIQUIDPYRITE:20|t¡|cFFFF0000%s|r enciende e inicia una|cFFFF0000|Hspell:288221|h[Explosión ardiente]|h|r!', '', 30706),
(167383, 'esMX', '', '|TInterface\\Icons\\SPELL_FROST_FROZENCORE:20|t¡|cFFFF0000%s|r empieza a lanzar |cFFFF0000|Hspell:288441|h[Caída de hielo]|h|r!', 30706),
(167382, 'esMX', '¡Una ruptura de azerita hizo erupción en otro lugar!', '¡Una ruptura de azerita hizo erupción en otro lugar!', 30706),
(167381, 'esMX', '', '¡Podría despejar Puerto Ruina Pétrea en una hora!', 30706),
(167380, 'esMX', '', '¡Mis talentos están desaprovechados aquí!', 30706),
(167379, 'esMX', '', '¡Odio esta arena!', 30706),
(167378, 'esMX', '', 'Si yo estuviera a cargo, ¡habríamos terminado hace semanas!', 30706),
(167377, 'esMX', '¿Una fiesta para mí?', '¿Una fiesta para mí?', 30706),
(167376, 'esMX', '', '¿Cómo puedes tener la sangre tan fría?', 30706),
(167375, 'esMX', '', 'Eres más $ufrío:fría; que el hielo.', 30706),
(167374, 'esMX', '', 'Era apenas el precalentamiento...', 30706),
(167373, 'esMX', '', 'No temas, es solo un poquito de hielo y nieve.', 30706),
(167372, 'esMX', '', '¡Esto te dejará $uhelado:helada;!', 30706),
(167371, 'esMX', '', 'Lo que estás a punto de ver te helará la sangre.', 30706),
(167370, 'esMX', 'Y pensar que podría haber sido un piloto de espectáculos aéreos. ¡Habría estado más seguro!', '', 30706),
(167369, 'esMX', 'La Horda podría llegar en cualquier momento. Espero tener suficientes municiones...', '', 30706),
(167368, 'esMX', 'Qué gran día para sufrir desperfectos...', '', 30706),
(167367, 'esMX', '¿Dónde está el equipo de reparaciones? ¡Estoy varado!', '', 30706),
(167366, 'esMX', 'Si tan solo mi máquina no se hubiera estrellado...', '', 30706),
(167364, 'esMX', '¡Bien! ¿Quieres pelear? ¡Ven y come metralla!', '', 30706),
(167360, 'esMX', 'Un kodo atemorizado te acerca el hocico a la mano. ¡Quiere que lo lleves contigo!', 'Un kodo atemorizado te acerca el hocico a la mano. ¡Quiere que lo lleves contigo!', 30706),
(167358, 'esMX', '¡Adelante! Maten a cualquiera de la Alianza que vean, ¡no tengan piedad!', '', 30706),
(167355, 'esMX', 'No puedes llevarte esta llave.', 'No puedes llevarte esta llave.', 30706),
(167353, 'esMX', 'Por fin me libré de la trampa de Narassin. Gracias.', 'Por fin me libré de la trampa de Narassin. Gracias.', 30706),
(167352, 'esMX', 'Regresar a Drustvar.', 'Regresar a Drustvar.', 30706),
(167350, 'esMX', 'Gracias, $c. Pensé que nunca escaparía de esta prisión.', 'Gracias, $c. Pensé que nunca escaparía de esta prisión.', 30706),
(167349, 'esMX', '¡Libre! Después de todos estos años...', '¡Libre! Después de todos estos años...', 30706),
(167348, 'esMX', '', 'Elementos, perdónenme.', 30706),
(167347, 'esMX', '', '¡Me enviaron a proteger los elementos! ¡No me rendiré!', 30706),
(167346, 'esMX', '', 'Las minas están destruida\', nueh\'tro enemigo está débil y nueh\'tra máquina de muerte está lista. ¡Que la Alianza conozca nueh\'tro poder!', 30706),
(167344, 'esMX', 'Bwonsamdi me llama...', '', 30706),
(167343, 'esMX', '¡Jaja, sí! ¡Vamo\' a pintar el cielo con tu sangre!', '', 30706),
(167342, 'esMX', '¿De dónde saliste?', '', 30706),
(167341, 'esMX', '¡Qué bueno verte, $umuchacho:muchacha;! Tenemos una sorpresita para la Horda de Guerracolmillo. Aquí, ¡mírala por $uti mismo:ti misma;!', '', 30706),
(167340, 'esMX', 'Las cajas mecánicas ubicadas en Costa Oscura necesitan muchísimo combustible, y tenemos pocos suministros.\n\nPor suerte, aquí tenemos un excedente... El único problema es que tenemos que extraerlo de abajo del asentamiento de los cultistas.', '', 30706),
(167338, 'esMX', 'Mátenlos a todos. ¡Hoy no tendremos piedad!', '', 30706),
(167337, 'esMX', '¡Hoy nos vengaremos por Teldrassil!', '', 30706),
(167336, 'esMX', '¡No tienen respuesta para nuestras armas de asedio!', '', 30706),
(167335, 'esMX', 'Luché por mi pueblo...', '', 30706),
(167334, 'esMX', 'La Horda pelea con honor. ¿Tú puedes decir lo mismo?', '', 30706),
(167333, 'esMX', 'Los submarinos gnómicos fueron clave para ganar la Segunda Guerra. Es un honor trabajar en uno para la Alianza.$b$bAdemás, me dará la posibilidad de demostrarle a Pozzik que la ingeniería gnómica es verdaderamente superior en todos los sentidos a su método tan temerario y poco refinado de hacer explotar todo. Desde luego, nuestros torpedos explotan al hacer contacto, ¡esa es una explosión REFINADA! Calculada y precisa.', '', 30706),
(167332, 'esMX', '', 'Akunda, ¡te lo ruego! ¡Usa tu poder para alimentar eh\'ta máquina y que podamos usarla para asesinar a nueh\'tros enemigos!', 30706),
(167331, 'esMX', '¡Listo! Con el B.S.I. podrán escabullirse entre su flota y lanzar las naves de la Horda por los aires. ¡Nunca se te habría ocurrido algo así, Pozzik! Ingeniero de poca monta...', '', 30706),
(167330, 'esMX', 'No me sacarás... nada.', '', 30706),
(167329, 'esMX', '|TInterface\\ICONS\\Spell_Frost_Ring of Frost.blp:20|t ¡Los vientos gélidos se reúnen para desatar |cFFFF0000|Hspell:285459|h[Anillo de escarcha]|h|r!', '|TInterface\\ICONS\\Spell_Frost_Ring of Frost.blp:20|t ¡Los vientos gélidos se reúnen para desatar |cFFFF0000|Hspell:285459|h[Anillo de escarcha]|h|r!', 30706),
(167328, 'esMX', 'Entonces... ¿Esta cacería termina así?', '', 30706),
(167327, 'esMX', '¡Te tengo en la mira!', '', 30706),
(167326, 'esMX', 'Has luchado bien... para ser $un:una; $r...', '', 30706),
(167325, 'esMX', '¿$uUn:Una; $r? ¡Muy bien, muéstrame lo que tu lamentable pueblo considera furia!', '', 30706),
(167324, 'esMX', 'Déjanoslo a nosotro\', nos encargaremos de ella\'.', '', 30706),
(167323, 'esMX', '', 'Nathanos, Rokhan, necesito que desarmen esas mina\' mientras $n está ahí afuera.', 30706),
(167322, 'esMX', 'Toma esta mochila antisigilo y descubre a los saboteadores que acechan las defensas templeluz.', '', 30706),
(167321, 'esMX', 'Por suerte, Gebish el Genio Mecánico tiene un invento que resolverá todo.', '', 30706),
(167320, 'esMX', '¡Los templeluz trajeron artillería pesada, pero no nos servirá de nada si la Horda la sabotea!', '', 30706),
(167319, 'esMX', 'Con mi ayuda, el Engrandecedor ahora convierte la inteligencia en fuerza bruta.', '', 30706),
(167318, 'esMX', 'Como yo soy el más inteligente de mi especie, tenía sentido que fuera el voluntario.', '', 30706),
(167317, 'esMX', '', 'Me gusta esta jungla. Es mejor que la mía. Esta jungla solo trata de matarte y comerte. La mía hace eso solo para entrar en calor.\n\nA veces me pone nostálgico.', 30706),
(167316, 'esMX', 'Necesito más goren.', 'Necesito más goren.', 30706),
(167315, 'esMX', '', 'Los enanos Hierro Negro se las ingeniaron para desplegar rápidamente una base cerca y bloquearon una ruta de suministros. Los necios creen que sus máquinas topo de hierro los salvarán.$b$bLos enanos aman el hierro, casi tanto como mis amiguitos corrosivos.$b$bLlévate a algunos de mis amigos para que se alimenten con esas máquinas.', 30706),
(167314, 'esMX', '¡Ayuda! ¡Un médico! Oh, esperen...', '', 30706),
(167313, 'esMX', '¡Mi promesa de paz no se aplica contigo!', '', 30706),
(167312, 'esMX', '¡Ayuda!', '', 30706),
(167311, 'esMX', '¡Quítamela de encima!', '', 30706),
(167310, 'esMX', 'Gloria a los shal\'dorei...', '', 30706),
(167309, 'esMX', '¡Perdí la concentración! Bien... ¡Entonces usaré la magia de tu cadáver para potenciar mis gólems!', '', 30706),
(167303, 'esMX', '', 'Hiciste un buen trabajo, Rokhan. Avanzaremos por Nazmir, eliminaremo\' a la flota de la Alianza y terminaremo\' con eh\'ta guerra.', 30706),
(167294, 'esMX', 'Apresúrate, ¡vienen más minas reptantes!', '', 30706),
(167293, 'esMX', '¡Este cajón de armas le pondrá fin a cualquier ataque de la Horda!', '', 30706),
(167292, 'esMX', 'Saquen mis rompebots, ¡rápido!', '', 30706),
(167291, 'esMX', '¡La Horda... fracasará!', '¡La Horda... fracasará!', 30706),
(167290, 'esMX', 'Su pelea... es inútil...', 'Su pelea... es inútil...', 30706),
(167289, 'esMX', 'Nunca... tendrán... Nazmir...', 'Nunca... tendrán... Nazmir...', 30706),
(167288, 'esMX', 'Los demás... harán mi trabajo...', 'Los demás... harán mi trabajo...', 30706),
(167287, 'esMX', 'Me advirtieron... de esto...', 'Me advirtieron... de esto...', 30706),
(167286, 'esMX', '¡Por la... Alianza!', '¡Por la... Alianza!', 30706),
(167285, 'esMX', '¡Zuldazar... caerá!', '¡Zuldazar... caerá!', 30706),
(167284, 'esMX', 'Ya hemos... ganado...', 'Ya hemos... ganado...', 30706),
(167283, 'esMX', 'La gente de aquí no aprecia el verdadero poder de mis transmutaciones. Pero les enseñaré. Pronto aprenderán que soy una persona a la que deben respetar...$b$bSin embargo, si tú sabes apreciar el poder de la transmutación, podría realizar alguna tarea rápida para ti.$b$bA cambio de algunas monedas de oro, claro.', '', 30706),
(167280, 'esMX', '', 'El enemigo conocerá nuestra furia.', 30706),
(167279, 'esMX', '', 'Los kaldorei resistirán.', 30706),
(167278, 'esMX', '', 'A veces hay que esperar... otras hay que actuar.', 30706),
(167277, 'esMX', '', 'Lucharemos para proteger nuestro futuro.', 30706),
(167276, 'esMX', '', 'Escucha la voz de Elune.', 30706),
(167275, 'esMX', '', 'Que Elune ilumine tu camino.', 30706),
(167274, 'esMX', '', 'No pierdas la fe.', 30706),
(167273, 'esMX', '', 'Me gustas. Dime… ¿De casualidad no tienes un hermano gemelo?', 30706),
(167272, 'esMX', '', 'No, NO tengo un fetiche con las vendas. Bueno... tal vez un poquito.', 30706),
(167271, 'esMX', '', 'Mi consejo: evita los pozos de energía mágica. No solo desarrollarás una adicción, sino que involucionarás a una especie de... elfo de segunda mano.', 30706),
(167270, 'esMX', '', 'Ante su luz, se revelan todas las verdades.', 30706),
(167269, 'esMX', '', 'Es un honor servir a Elune.', 30706),
(167268, 'esMX', '', 'Hablo en nombre de mi pueblo.', 30706),
(167267, 'esMX', '', '¿Qué necesitas de los kaldorei?', 30706),
(167266, 'esMX', '', 'Somos los hijos de Elune.', 30706),
(167265, 'esMX', '', 'Ishnu-alah.', 30706),
(167264, 'esMX', '', 'La diosa me da fuerzas.', 30706),
(167262, 'esMX', '', 'Pensé que el alto mando nos daría una escolta más grande.', 30706),
(167261, 'esMX', '', '¿Dónde están nuestros refuerzos?', 30706),
(167260, 'esMX', '', 'Qué mal momento para tener problemas.', 30706),
(167259, 'esMX', '', '¡Mantente alerta, no podemos permitir que la Horda se lleve este envío!', 30706),
(167258, 'esMX', '¡El tiempo no espera a nadie!', '', 30706),
(167257, 'esMX', 'Tientas a la cólera de la naturaleza.', '', 30706),
(167256, 'esMX', 'El tiempo se agota.', '', 30706),
(167255, 'esMX', 'Que los vientos estén a tu favor.', '', 30706),
(167254, 'esMX', 'Cuenta con la naturaleza.', '', 30706),
(167253, 'esMX', 'Que la naturaleza te guíe.', '', 30706),
(167252, 'esMX', '¿Cómo puede servir la naturaleza?', '', 30706),
(167251, 'esMX', '¿Cómo puedo ayudarte?', '', 30706),
(167250, 'esMX', 'Saludos, amigos.', '', 30706),
(167248, 'esMX', '', 'Eso no salió como lo planeamos...', 30706),
(167247, 'esMX', '', '¡Nadie saquea a mi caravana!', 30706),
(167245, 'esMX', 'La dulce liberación de la muerte. Espero quedarme... muerto.', '', 30706),
(167244, 'esMX', '¡Oh, sí! ¡Ven a probar la última cepa de esta plaga!', '', 30706),
(167243, 'esMX', '%s desvía la energía de las armas para reparaciones internas y sistemas de diagnóstico.', '', 30706),
(167237, 'esMX', 'La naturaleza me reclama...', '', 30706),
(167236, 'esMX', '¡Templo maldito! ¡Debo recuperar!', '', 30706),
(167235, 'esMX', 'El círculo... continúa...', '', 30706),
(167233, 'esMX', '¡Te has metido con el toro equivocado!', '', 30706),
(167226, 'esMX', '¡Por Sylvanas!', '¡Por Sylvanas!', 30706),
(167225, 'esMX', 'No puedes encontrarnos a todos...', 'No puedes encontrarnos a todos...', 30706),
(167224, 'esMX', '¡Kul Tiras caerá!', '¡Kul Tiras caerá!', 30706),
(167223, 'esMX', '¡Por la Horda!', '¡Por la Horda!', 30706),
(167222, 'esMX', 'Los loa... me llaman de regreso.', '', 30706),
(167221, 'esMX', '¡Ja ja ja ja! ¡Qué linda quedará tu cabeza en mi lanza!', '', 30706),
(167220, 'esMX', '', 'Esta es una de las mochilas de Tacha. ¡Siempre se ocupa de llenarlas con cosas útiles!', 30706),
(167219, 'esMX', '¿Quién pensó que esto sería una buena idea?', '¿Quién pensó que esto sería una buena idea?', 30706),
(167218, 'esMX', '¡Así me gusta!', '¡Así me gusta!', 30706),
(167217, 'esMX', '¡Me encanta el olor de la pólvora por la mañana!', '¡Me encanta el olor de la pólvora por la mañana!', 30706),
(167216, 'esMX', '¡Uo, uo! ¡No pongas eso en cualquier lado!', '¡Uo, uo! ¡No pongas eso en cualquier lado!', 30706),
(167215, 'esMX', '', 'Mantendré esta zona a salvo para los vulperas en fuga. ¡Entra en ese barranco y mata a cualquiera que ataque a mi gente!', 30706),
(167214, 'esMX', 'Los Voldunai nunca se quedarán solos. ¡Estoy con ustedes!', 'Los Voldunai nunca se quedarán solos. ¡Estoy con ustedes!', 30706),
(167213, 'esMX', 'Me gusta cómo peleas... Podría aprender un par de cosas de ti.', 'Me gusta cómo peleas... Podría aprender un par de cosas de ti.', 30706),
(167212, 'esMX', 'No hay ningún problema que no podamos resolver juntos.', 'No hay ningún problema que no podamos resolver juntos.', 30706),
(167211, 'esMX', '¡Yo te cubro, $uamigo:amiga;!', '¡Yo te cubro, $uamigo:amiga;!', 30706),
(167210, 'esMX', '¡Por los vulperas!', '¡Por los vulperas!', 30706),
(167209, 'esMX', '¡Vol\'dun será libre!', '¡Vol\'dun será libre!', 30706),
(167208, 'esMX', 'Nisha envía saludos.', 'Nisha envía saludos.', 30706),
(167207, 'esMX', '¡Los vulperas nos mantenemos unidos!', '¡Los vulperas nos mantenemos unidos!', 30706),
(167205, 'esMX', '', 'Listo. El hielo los retendrá el tiempo que necesitamos para ocuparnos de las naves en la bahía.', 30706),
(167203, 'esMX', '', 'Creo que puedo detener su avance.', 30706),
(167200, 'esMX', '', 'Taelia y yo pudimos vencer a la Horda de nuestro lado del muelle. Veo que ustedes también han hecho algunos avances.', 30706),
(167199, 'esMX', 'Nos cansamos de sacarlos del agua a cañonazos, ¡pero siguen viniendo! ¿Puedes frenar sus botes?', 'Nos cansamos de sacarlos del agua a cañonazos, ¡pero siguen viniendo! ¿Puedes frenar sus botes?', 30706),
(167198, 'esMX', '', '¿Por qué eres tan $ufrío:fría; conmigo?', 30706),
(167197, 'esMX', '', '¡Cubriré Kul Tiras con un invierno eterno!', 30706),
(167196, 'esMX', '', '¡Mantente siempre $ufresco:fresca;!', 30706),
(167195, 'esMX', '', 'Siento que se acerca una ola de frío.', 30706),
(167194, 'esMX', '', 'Que descanses, grandote. Nos estás ayudando más de lo que podrías imaginar.', 30706),
(167193, 'esMX', '', 'Voy a tener que pedirte que pongas paños fríos a la situación.', 30706),
(167192, 'esMX', '', 'Se reconocerá a Grong para siempre como un héroe de la Alianza.', 30706),
(167191, 'esMX', '¡Estás pisando tierra kaldorei! ¡Vuelve con tu Reina alma en pena mientras puedas!', '', 30706),
(167190, 'esMX', '', 'Me apena ver a Grong así, pero sé que es lo que quería.', 30706),
(167189, 'esMX', '', 'La valentía y la entrega de Grong son admirables.', 30706),
(167188, 'esMX', '', 'El trabajo que están haciendo Megs y Morton cambiará el rumbo de esta guerra.', 30706),
(167187, 'esMX', 'Moira, te he fallado.', '', 30706),
(167186, 'esMX', '¡Las llamas de Roca Negra rugen por tu cabeza! ¡Por la Alianza!', '', 30706),
(167183, 'esMX', '¡Toma esto, engendro radioactivo! La explosión de azerita especial de Gallywix. ¡Dejará que $p penetre esa armadura que llevas!', '', 30706),
(167182, 'esMX', '', '¡Detente! No avanzarás.', 30706),
(167181, 'esMX', 'He matado cientos de tu tipo. ¡Desde los fosos de Grito de Guerra hasta los riscos de Arathi! ¡Conocerás a tu creador!', '', 30706),
(167180, 'esMX', '¡Ja! ¡Esto no es nada en comparación a mi paso por Alterac!', '', 30706),
(167179, 'esMX', 'LA TIERRA LLAMA...', '', 30706),
(167178, 'esMX', '¡APLASTARÉ HORDA CON MI FURIA!', '', 30706),
(167177, 'esMX', '¡Regresa al Frente de Vallefresno!', '', 30706),
(167176, 'esMX', 'Sí.', 'Sí.', 30706),
(167175, 'esMX', '<Bwonsamdi se frota las manos.>\n\nAh, voy a dih\'frutar esto. El testigo de Talanji, ¿le llevarías mi veredicto al pueblo de Zandalar?', '', 30706),
(167174, 'esMX', '¿Cómo va la colecta de almas, eh?\n\nEh\'pero que estés llevando la cuenta, porque todo\' saben que el viejo Bwonsamdi no lo eh\'ta haciendo.\n\n<Bwonsamdi se ríe.>\n\nHablando en serio, eh\'pero que no hayas olvidado nuestro pacto.', '', 30706),
(167172, 'esMX', '¡Rey, perdóneme!', '', 30706),
(167171, 'esMX', '¡Esta azerita le pertenece a la Alianza!', '', 30706),
(167170, 'esMX', '', 'El poder fluye en eh\'te lugar. Los espíritu\' de aquí son fuertes, pero... están atrapados. Es diferente de las voce\' que oigo en la necrópolis de Bwonsamdi. Aquí... están... canalizadas.\n\nDeberíamos apresurarnos. Tengo la sensación de que eh\'toy en un lugar que no recibe a los vivo\' con los brazos abiertos.\n\nAvísame cuando estés $Ulisto:lista; para continuar.', 30706),
(167169, 'esMX', 'Los tambores me guían a casa...', '', 30706),
(167168, 'esMX', '¡Suenan los tambores de guerra!', '', 30706),
(167167, 'esMX', '|TInterface\\ICONS\\Spell_Shaman_HighTide:20|t¡Laminaria lanza |cFFFF0000|Hspell:284760|h[Mareas catastróficas]|h|r!', '', 30706),
(167166, 'esMX', '|TInterface\\ICONS\\SPELL_NATURE_LIGHTNINGOVERLOAD:20|t¡Te ha afectado |cFFFF0000|Hspell:285350|h[Lamento de la tormenta]|h|r!', '|TInterface\\ICONS\\SPELL_NATURE_LIGHTNINGOVERLOAD:20|t¡Te ha afectado |cFFFF0000|Hspell:285350|h[Lamento de la tormenta]|h|r!', 30706),
(167165, 'esMX', '¡Las raíces de Onu desactivan tu trituradora!', '', 30706),
(167164, 'esMX', '', '¡La trituradora está armada y lista para salir a deforestar con estilo, jefe!', 30706),
(167163, 'esMX', 'Dame los suministros. ¡Defenderé a los vulperas!', 'Dame los suministros. ¡Defenderé a los vulperas!', 30706),
(167162, 'esMX', '', 'Morirán igual que los sethrak... ¡y todos los que intenten oprimir a los vulperas!', 30706),
(167161, 'esMX', '', '¡Mira esta destrucción, $p!\n\nEl único delito que cometieron estas caravanas fue aceptar un trabajo bien pago para transportar suministros.\n\nLos vulperas hemos ejercido el comercio libremente durante cientos de generaciones. ¿Y la Alianza cree que puede amedrentarnos para que rechacemos un trabajo, solo porque a ellos no les gustan nuestros clientes?\n\nSon iguales a los sethrak... Y ya conoces mi forma de lidiar con los sethrak.\n\n¿Me ayudarás? ¡Tengo muchas cosas por aquí que puedes usar para pelear como $Uun verdadero:una verdadera; vulpera!', 30706),
(167160, 'esMX', '¡Regreso a las arenas!', '', 30706),
(167159, 'esMX', '¡Te enterraré bajo de las arenas!', '', 30706),
(167158, 'esMX', 'La Horda... ¡Hora de probar mis últimos inventos!', 'La Horda... ¡Hora de probar mis últimos inventos!', 30706),
(167157, 'esMX', '¡Mekkatorque nos dio órdenes estrictas de acabar con ustedes!', '¡Mekkatorque nos dio órdenes estrictas de acabar con ustedes!', 30706),
(167156, 'esMX', 'La Horda no pertenece a este lugar, ¡largo de aquí!', 'La Horda no pertenece a este lugar, ¡largo de aquí!', 30706),
(167155, 'esMX', '¡No permitiremos que lastimen a los kultiranos!', '¡No permitiremos que lastimen a los kultiranos!', 30706),
(167154, 'esMX', '¡Tendremos que terminar lo que empezó Mekkatorque!', '¡Tendremos que terminar lo que empezó Mekkatorque!', 30706),
(167153, 'esMX', 'Mekkatorque nos advirtió sobre la Horda, ¡estamos preparados!', 'Mekkatorque nos advirtió sobre la Horda, ¡estamos preparados!', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(167152, 'esMX', '¡Sigues con vida! Bien, puedo corregir ese error.', '¡Sigues con vida! Bien, puedo corregir ese error.', 30706),
(167151, 'esMX', '¡Pagarán por haber venido aquí!', '¡Pagarán por haber venido aquí!', 30706),
(167150, 'esMX', '¡Morirás, al igual que todos los de tu Horda!', '¡Morirás, al igual que todos los de tu Horda!', 30706),
(167149, 'esMX', 'Nuestros aliados gnomos se encargarán de ustedes.', 'Nuestros aliados gnomos se encargarán de ustedes.', 30706),
(167148, 'esMX', '¡Las fuerzas de Mekkatorque nos ayudarán a destruirlos!', '¡Las fuerzas de Mekkatorque nos ayudarán a destruirlos!', 30706),
(167147, 'esMX', 'Perros de la Horda, ¡morirán igual que las fuerzas de Aspafresno!', 'Perros de la Horda, ¡morirán al igual que las fuerzas de Aspafresno!', 30706),
(167146, 'esMX', '¡Colina de la Vigilia le pertenece a Kul Tiras!', '¡Colina de la Vigilia le pertenece a Kul Tiras!', 30706),
(167145, 'esMX', '¡No expulsé a los piratas de Aspafresno para que la Horda viniera a en su lugar!', '¡No expulsé a los piratas de Aspafresno para que la Horda viniera a en su lugar!', 30706),
(167144, 'esMX', 'Kul Tiras se ha liberado de Aspafresno, ¡y ahora se liberará de la Horda!', 'Kul Tiras se ha liberado de Aspafresno, ¡y ahora se liberará de la Horda!', 30706),
(167143, 'esMX', 'Carter Contracorriente no responde.', 'Carter Contracorriente no responde.', 30706),
(167142, 'esMX', '', 'Quiero poner a prueba la determinación de Talanji. Sé que a ti no te falta, pero me divertiría que participaras.\n\n¿$UListo:Lista; para comenzar?', 30706),
(167141, 'esMX', '', '¡Miren nada más! Es $n, ¡la maravilla sin alas!\n\nVeo que Talanji ha realizado una elección predecible de sus testigos. Fingiré estar sorprendida.', 30706),
(167140, 'esMX', 'Pa\'ku será quien haga la próxima prueba. Resiste, Talanji.', '', 30706),
(167139, 'esMX', '', 'Zandalar... le pertenece a la Horda.', 30706),
(167138, 'esMX', '', '¡Mis kroluskos destruirán a tus hombres!', 30706),
(167135, 'esMX', 'Quiero hacerle una pregunta a Talanji. ¿Podrías aguardar un segundo?', '', 30706),
(167134, 'esMX', 'Talanji eligió muy bien a su testigo.', '', 30706),
(167133, 'esMX', '', 'Vamos, $n.', 30706),
(167132, 'esMX', 'Gonk será el próximo en poner a prueba tu valor. Buena suerte, Talanji.', '', 30706),
(167131, 'esMX', '', '¡Fuera! ¡Largo!', 30706),
(167130, 'esMX', '', '¡No dejes de correr!', 30706),
(167129, 'esMX', '', '¡No te comerás a mi teh\'tigo!', 30706),
(167128, 'esMX', '', '¡Resih\'te un poco más!', 30706),
(167127, 'esMX', '', '¡Atrás, sapo!', 30706),
(167126, 'esMX', '', '¡Largo de aquí!', 30706),
(167124, 'esMX', 'Atacaremo\' pronto. ¡Por la Horda!', '', 30706),
(167123, 'esMX', 'Atacaremo\' con todo el poder de nuestros dracoleones. Que solo quede un camino de destrucción donde eh\'té la Alianza.', '', 30706),
(167122, 'esMX', '¡La jefa de guerra dice que atacaremo\' pronto! No se lo esperarán.', '', 30706),
(167121, 'esMX', 'Esos matones de la Alianza me dieron una buena paliza... Creí que no salía vivo de esta.', 'Esos matones de la Alianza me dieron una buena paliza... Creí que no salía viva de esta.', 30706),
(167120, 'esMX', 'Bonito sombrero. Nisha debe haberte enviado.', 'Bonito sombrero. Nisha debe haberte enviado.', 30706),
(167119, 'esMX', 'No quiero participar en esta guerra... ¡pero al menos la Horda no nos asesina!', 'No quiero participar en esta guerra... ¡pero al menos la Horda no nos asesina!', 30706),
(167118, 'esMX', 'Quise hacerlos entrar en razón, ¡pero ni siquiera me escucharon!', 'Quise hacerlos entrar en razón, ¡pero ni siquiera me escucharon!', 30706),
(167117, 'esMX', 'Te debo una, $uamigo:amiga;.', 'Te debo una, $uamigo:amiga;.', 30706),
(167116, 'esMX', 'Como si no tuviéramos suficiente con los sethrak... ¡¿ahora también tenemos que soportar los ataques de la Alianza?!', 'Como si no tuviéramos suficiente con los sethrak... ¡¿ahora también tenemos que soportar los ataques de la Alianza?!', 30706),
(167115, 'esMX', 'Ah, eso es extraño. ¡¿Quién demonios puso eso en mi meca?! Llegaré al fondo de este asunto... pero no se lo menciones a nadie. Jamás.', '', 30706),
(167114, 'esMX', 'Recuerda Jastor, eres hábil, eres inteligente, ¡y DEBES agradarle a la gente!', '', 30706),
(167113, 'esMX', 'Estaba trabajando sin molestar a nadie... ¡y esos idiotas de la Alianza me atacaron sin previo aviso!', 'Estaba trabajando sin molestar a nadie... ¡y esos idiotas de la Alianza me atacaron sin previo aviso!', 30706),
(167112, 'esMX', 'Gracias, $pr... ¡Estos humanos iban a matarme!', 'Gracias, $pr... ¡Estos humanos iban a matarme!', 30706),
(167111, 'esMX', '¡Regresa al Páramo de los Ancianos!', '', 30706),
(167110, 'esMX', 'Muero por la Horda...', '', 30706),
(167109, 'esMX', '¡Los cielo\' le pertenecen a los Lanza Negra!', '', 30706),
(167108, 'esMX', 'Encárgate de que el resto de esos zepelines congelados tengan un final explosivo, $p. Me uniré a Rosalina y al resto de los Firmemares.', '', 30706),
(167107, 'esMX', '¡Lo logramos! ¡El ingenio prevalece por encima de la fuerza bruta!', '', 30706),
(167106, 'esMX', 'Tomar la bomba de combustible.', 'Tomar la bomba de combustible.', 30706),
(167105, 'esMX', 'Es imposible hacer arder algo sin combustible, ¡así que tendremos que inundar los campos! \n\nPor desgracia, estos cultistas se interponen en nuestras tareas para cargar combustible.', '', 30706),
(167104, 'esMX', 'Error crítico: materia inesperada en el núcleo.', '', 30706),
(167103, 'esMX', 'Enemigos detectados. Modo asesinato: activado. Evacúen el área.', '', 30706),
(167102, 'esMX', '¡Los aplastaremos en tierra, cielo y mar!', '', 30706),
(167101, 'esMX', '¡Que sientan el poder de la jefa de guerra!', '', 30706),
(167100, 'esMX', '¡Que llueva fuego infernal sobre ellos!', '', 30706),
(167099, 'esMX', 'Denle mi cadáver... a los lobos.', '', 30706),
(167098, 'esMX', '¡Alimentaré a mis lobos con tu cuerpo!', '', 30706),
(167097, 'esMX', '¿Ya no... aplastar?', '', 30706),
(167096, 'esMX', 'Bilis. ¡APLASTAR!', '', 30706),
(167095, 'esMX', 'Parece que el M.I.D.A.S.-G casi no tiene azerita. Deberíamos volver a cargarle combustible.', 'Parece que el M.I.D.A.S.-G casi no tiene azerita. Deberíamos volver a cargarle combustible.', 30706),
(167094, 'esMX', '<Echas un vistazo al manual escrito por otros ineptos y lo arrojas a la basura. Eres un ingeniero de primera, ¡no necesitas leer un manual escrito por otro tonto!\n\nFinalmente encuentras un medidor con el rótulo \"AZERITA\" y notas que la aguja está cerca de las palabras \"TOTALMENTE VACÍO, JEFE\".>', '<Echas un vistazo al manual escrito por otros ineptos y lo arrojas a la basura. ¡Sabes lo que haces!\n\nEmpiezas a mover y ajustar algunas partes del meca. ¿Qué tan difícil puede ser descifrar el trabajo de otro goblin?\n\nQuizás sea bastante difícil, pero finalmente encuentras un medidor con el rótulo \"AZERITA\" y notas que la aguja está cerca de las palabras \"TOTALMENTE VACÍO, JEFE\".>', 30706),
(167093, 'esMX', '<Echas un vistazo al manual escrito por otros ineptos y lo arrojas a la basura. ¡Sabes lo que haces!\n\nEmpiezas a mover y ajustar algunas partes del meca. ¿Qué tan difícil puede ser descifrar el trabajo de otro goblin?\n\nQuizás sea bastante difícil, pero finalmente encuentras un medidor con el rótulo \"AZERITA\" y notas que la aguja está cerca de las palabras \"TOTALMENTE VACÍO, JEFE\".>', '<Echas un vistazo al manual escrito por otros ineptos y lo arrojas a la basura. ¡Sabes lo que haces!\n\nEmpiezas a mover y ajustar algunas partes del meca. ¿Qué tan difícil puede ser descifrar el trabajo de otro goblin?\n\nQuizás sea bastante difícil, pero finalmente encuentras un medidor con el rótulo \"AZERITA\" y notas que la aguja está cerca de las palabras \"TOTALMENTE VACÍO, JEFE\".>', 30706),
(167092, 'esMX', '<Cualquiera creería que con tus conocimientos de ingeniería estarías a la altura de la avanzada tecnología goblin, pero... nada podría haberte preparado para esto.\n\nEl manual no solo se contradice en cada página, sino hasta en la misma oración. Es un milagro que esta cosa siquiera funcione.\n\nTerminas de realizar la verificación. Más allá de que lo ideal sería volver a construir esta máquina de cero, lo único que puedes advertir es que el meca tiene muy poca azerita.>', '<Cualquiera creería que con tus conocimientos de ingeniería estarías a la altura de la avanzada tecnología goblin, pero... nada podría haberte preparado para esto.\n\nEl manual no solo se contradice en cada página, sino hasta en la misma oración. Es un milagro que esta cosa siquiera funcione.\n\nTerminas de realizar la verificación. Más allá de que lo ideal sería volver a construir esta máquina de cero, lo único que puedes advertir es que el meca tiene muy poca azerita.>', 30706),
(167091, 'esMX', '<Lees detenidamente el manual del M.I.D.A.S.-G. \n\nDebes leerlo varias veces ya que la combinación de palabras goblin y de ingeniería \"inventiva\" dificultan mucho la comprensión.\n\nUna vez que crees haberlo entendido, realizas una verificación de los sistemas del M.I.D.A.S.-G. \n\nEl problema más notorio es un medidor que tiene el rótulo \"AZERITA\". La aguja del medidor está casi en la posición \"TOTALMENTE VACÍO\".>', '<Lees detenidamente el manual del M.I.D.A.S.-G. \n\nDebes leerlo varias veces ya que la combinación de palabras goblin y de ingeniería \"inventiva\" dificultan mucho la comprensión.\n\nUna vez que crees haberlo entendido, realizas una verificación de los sistemas del M.I.D.A.S.-G. \n\nEl problema más notorio es un medidor que tiene el rótulo \"AZERITA\". La aguja del medidor está casi en la posición \"TOTALMENTE VACÍO, JEFE\".>', 30706),
(167090, 'esMX', 'Este M.I.D.A.S.-G es asombroso, ¿verdad?', '', 30706),
(167089, 'esMX', '<Abre el manual del M.I.D.A.S.-G y verifica sus sistemas.>', '<Abre el manual del M.I.D.A.S.-G y verifica sus sistemas.>', 30706),
(167088, 'esMX', '¿Y bien? ¿Qué estás esperando? ¡Este meca no va a verificarse solo!\n\n... Un momento. Quizás debería haber invertido el dinero en hacer que esta cosa se autoverificara. ¡Gallywix, eres un genio!\n\nEse es el tipo de cosas que tienes que decir, $n.', '', 30706),
(167087, 'esMX', '¡Así que no lo rompas!', '', 30706),
(167086, 'esMX', 'Robamos...eh, digo, ¡inventamos esto solo para ti!', '', 30706),
(167085, 'esMX', '¿Vas a recolectar alguna\' cabezas, $Uricachón:ricachona;? Ojalá pudiera ir contigo. Pronto lo haré.\n\nVe al puerto y busca el barco de lo\' Renegados, el Lamento Alma en Pena. Es bastante feo, pero te llevará al otro lado del océano. Habla con la almirante del terror Velandrajo.', '¿Vas a recolectar alguna\' cabezas, $Uricachón:ricachona;? Ojalá pudiera ir contigo. Pronto lo haré.\n\nVe al puerto y busca el barco de lo\' Renegados, el Lamento Alma en Pena. Es bastante feo, pero te llevará al otro lado del océano. Habla con la almirante del terror Velandrajo.', 30706),
(167084, 'esMX', '¿Vas a conquistar a los kultiranos? Dicen que son unos arrogantes insufribles... No tanto como los gilneanos, pero bastante parecidos.\n\nComo sea, dirígete en dirección al sur, hacia el puerto. Habla con la almirante del terror Velandrajo en el Lamento Alma en Pena.\n\nTen cuidado.', '¿Vas a conquistar a los kultiranos? Dicen que son unos arrogantes insufribles... No tanto como los gilneanos, pero bastante parecidos.\n\nComo sea, dirígete en dirección al sur, hacia el puerto. Habla con la almirante del terror Velandrajo en el Lamento Alma en Pena.\n\nTen cuidado.', 30706),
(167083, 'esMX', 'Navega a Kul Tiras', 'Navega a Kul Tiras', 30706),
(167082, 'esMX', 'Navega a Zandalar', 'Navega a Zandalar', 30706),
(167081, 'esMX', '¿Zandalar, eh? El gran imperio trol. Esto es lo que pienso de su armada.\n\n<escupe>\n\n.\n\nVe a hablar con la gran almirante Jes-Tereth en el muelle.\n\n¡Acaba con ellos!', '¿Zandalar, eh? El gran imperio trol. Esto es lo que pienso de su armada.\n\n<escupe>\n\n.\n\nVe a hablar con la gran almirante Jes-Tereth en el muelle.\n\n¡Acaba con ellos!', 30706),
(167077, 'esMX', 'Pero si tantas gana\' tienen de conocer a Bwonsamdi... Adelante. ¡El loa de la muerte aguarda!', '', 30706),
(167076, 'esMX', '', '$p, crearé un camino para que cruces el agua hasta los firmemares que están en la costa sur.', 30706),
(167075, 'esMX', '', 'Avísame cuando estés $ulisto:lista; para comenzar.', 30706),
(167074, 'esMX', '', 'Comenzaremos cuando estés $ulisto:lista;.', 30706),
(167073, 'esMX', '¡Ya se han ocupado de Krazzlefrazz, ahora vamos a encargarnos del resto del ejército más adelante!', '', 30706),
(167072, 'esMX', '', 'Por supuesto. Está aquí.', 30706),
(167070, 'esMX', '|TInterface\\Icons\\Spell_winston_bubble:20|t¡|cFFFF0000%s|r activa el poder del Tridente del océano profundo!', '', 30706),
(167069, 'esMX', '|TInterface\\Icons\\ABILITY_VEHICLE_ELECTROCHARGE:20|t¡|cFFFF0000%s|r activa el poder de la Clamatempestades!', '', 30706),
(167068, 'esMX', '|TInterface\\Icons\\Spell_Priest_Void Blast:20|t¡|cFFFF0000%s|r activa el poder de la Piedra del Vacío!', '', 30706),
(167067, 'esMX', '|TInterface\\Icons\\SPELL_SHADOW_POSSESSION:20|t¡|cFFFF0000%s|r empieza a lanzar |cFFFF0000|Hspell:282517|h[Eco aterrador]|h|r!', '', 30706),
(167066, 'esMX', '', '¿Está...? ¿Lo destruiste?', 30706),
(167060, 'esMX', '¡Creo que calculé mal!', '', 30706),
(167059, 'esMX', '¡No esperaba otra cosa de una mente inferior como la tuya!', '', 30706),
(167058, 'esMX', 'Sí.', 'Sí.', 30706),
(167057, 'esMX', '¿Pelearás con nosotros hoy?', '', 30706),
(167056, 'esMX', '', 'Adiós, $uamigo:amiga;.', 30706),
(167055, 'esMX', 'Profeta, perdóname.', '', 30706),
(167054, 'esMX', '¡¿Crees que puedes detenernos?! Entonces morirás.', '', 30706),
(167053, 'esMX', '¡Jefe, $p! ¡Tienen que ayudarnos, tenemos mecas desde aquí hasta el Cruce de Arom!', '', 30706),
(167052, 'esMX', 'La prueba de Krag\'wa aún no ha terminado. ¡Regresa con Talanji!', 'La prueba de Krag\'wa aún no ha terminado. ¡Regresa con Talanji!', 30706),
(167051, 'esMX', '¿Estás $Ulisto:lista; para ayudarme, $n?', '', 30706),
(167050, 'esMX', 'Es bueno volver a verte, $n. Hemos aplastado a muchos enemigos juntos.', '', 30706),
(167049, 'esMX', 'La batalla por Lordaeron fue mi primera pelea. Ver el Ejército de la Alianza ante los muro\' fue... Bueno, me puso los nervio\' de punta, eso seguro.\n\nLuego vi a Colmillosauro. ¡Ese orco había ganado mil batallas! En sus ojo\' no había miedo... Pero parecían un poco vacíos.\n\nEl alto señor supremo me dio valor. Nos recordábamo\' el uno al otro que valía la pena pelear por la Horda.\n\nJamás lo dejaría solo. ¡Colmillosauro nos necesita, adalid!', '', 30706),
(167048, 'esMX', '', 'La esperanza prevalecerá.', 30706),
(167047, 'esMX', '', '¡Zuldazar caerá!', 30706),
(167046, 'esMX', 'Tienes talento para salvar personas, ¿te dedicas a esto? No, en serio, ¿cuánto te pagan?', '', 30706),
(167045, 'esMX', 'Mamá siempre me decía que iba a morirme rodeado de las babas de la sangre del planeta. ¡Parece que volvió a equivocarse!', '', 30706),
(167044, 'esMX', 'Tendría que haber leído el contrato antes de firmar. O tal vez debería aprender a leer.', '', 30706),
(167043, 'esMX', '¡Espero que contabilicen esto como horas extra! Diantres, a quién quiero engañar, ni siquiera contará como horas regulares.', '', 30706),
(167042, 'esMX', 'Creo que tragué un poco de esta cosa, ¿me convertiré en un goblin de azerita?', '', 30706),
(167041, 'esMX', '¡Gracias por salvarme, ni siquiera puedo pagarle a un abogado!', '', 30706),
(167040, 'esMX', '¡Sí, bueno, creo que esta vez no los demandaré!', '', 30706),
(167039, 'esMX', 'Luché con Colmillosauro en la batalla por Entrañas. \n\nNo habría salido con vida si no fuera por él.\n\nNo dejaré que se vaya así.', '', 30706),
(167038, 'esMX', '', '$p, llévate mi elemental de agua, te será de ayuda.', 30706),
(167037, 'esMX', '', 'Sí, Lady almirante.', 30706),
(167036, 'esMX', '¡Tus blasfemias no me asustan!', '', 30706),
(167035, 'esMX', 'El pueblo... de Drustvar... me... vengará...', '', 30706),
(167034, 'esMX', '¡Tu magia infecta debe erradicarse de estas tierras!', '', 30706),
(167033, 'esMX', '¿Tienes noticias del frente, $r?', '', 30706),
(167032, 'esMX', '¡Ay ay ay ay ay!', '¡Ay ay ay ay ay!', 30706),
(167031, 'esMX', '¡Bien, lo haré yo mismo! Y cuando digo que lo haré yo mismo, me refiero a que traigas a $p para que $Uél:ella; se encargue.', '', 30706),
(167030, 'esMX', '|TInterface\\ICONS\\SPELL_FROST_ICESHARD.BLP:20|t ¡Escapa de la jefa durante|cFFF00000|Hspell:287565|h[Avalancha]|h|r para evitar el daño!', '|TInterface\\ICONS\\SPELL_FROST_ICESHARD.BLP:20|t ¡Escapa de la jefa durante|cFFF00000|Hspell:287565|h[Avalancha]|h|r para evitar el daño!', 30706),
(167029, 'esMX', 'Úsame... para alimentar a las bestias.', '', 30706),
(167028, 'esMX', '¡Estas bestias te destrozarán!', '', 30706),
(167027, 'esMX', 'Jefe, esta es la quinta vez que tenemos esta charla. La verdad no entiendo por qué piensa que preguntarme una y otra vez va a cambiar algo.', '', 30706),
(167026, 'esMX', '¿Cómo que la operación se ha detenido por una ola de baba de azerita que salió del suelo?', '', 30706),
(167025, 'esMX', '', 'No nos detendrás. La fuerza del león... prevalecerá.', 30706),
(167024, 'esMX', '', '¡No! ¡Mi transportador ya casi está operativo!', 30706),
(167020, 'esMX', '', 'Bien. Reúnanse y lleven a todo\' a la cima de Zanchul. Debo enfrentarme a lo\' loa.', 30706),
(167019, 'esMX', '', 'Estamo\' bien, a pesar de las intencione\' de la Viuda Blanca.', 30706),
(167018, 'esMX', '', 'Me gustaría que estés a mi lado mientra\' me dirijo a mi concilio. Es imperativo que cuente con su apoyo para lo que se avecina.\n\nVen a verme cuando estés $Ulisto:lista; para que comiencen las formalidade\'.', 30706),
(167014, 'esMX', 'Bueno. No empecemos con las acusaciones. Llevemos este asunto afuera, ¿sí?', '', 30706),
(167013, 'esMX', '¡Espía de la Alianza! Ven sin hacer escándalo o muere al filo de mi espada.', '¡Espía de la Alianza! Ven sin hacer escándalo o muere al filo de mi espada.', 30706),
(167012, 'esMX', 'Ejem. Ogro Loker... ¿Compañero de la Horda?', '', 30706),
(167011, 'esMX', 'Tú... arderás.', '', 30706),
(167010, 'esMX', '¡Te destrozaremos por dentro!', '', 30706),
(167009, 'esMX', '|TInterface\\Icons\\INV_Misc_Herb_AncientLichenPetal.blp:20|tIvus |cFFFF0000|Hspell:287554|h[Petrifica]|h|r su corteza. ¡Derrota a los pesteznos para interrumpir el hechizo!', '', 30706),
(167008, 'esMX', '', '¡Las almas del núcleo de poder están controlando al gólem! ¡Tienes que destruirlo!', 30706),
(167007, 'esMX', '', '¿Eh? Algo anda mal...', 30706),
(167006, 'esMX', '', 'Si hicimos todo bien, el núcleo de poder debería unir al gólem y darle vida.', 30706),
(167005, 'esMX', 'Los elementos... me reciben.', '', 30706),
(167004, 'esMX', '¡Te ahogaré como la escoria que eres!', '', 30706),
(167003, 'esMX', 'Bien, tenemos la azerita. ¿Pero dónde están los cañoneros?', '', 30706),
(167002, 'esMX', 'Me alegra que el ritual de purificación no fuera fatal. Eres muy resistente... o muy $Uafortunado:afortunada;.', '', 30706),
(167001, 'esMX', 'Estoy listo para empezar.', 'Estoy lista para empezar.', 30706),
(167000, 'esMX', '%s comienza a brillar.', '%s comienza a brillar.', 30706),
(166999, 'esMX', '', 'Coloca el núcleo de poder rúnico en el corazón del gólem.', 30706),
(166998, 'esMX', '', 'Ahora tienes que unir las extremidades con las telarañas.', 30706),
(166995, 'esMX', '', 'Primero, tienes que colocar la madera en una forma humanoide.', 30706),
(166994, 'esMX', '', '¡Estoy tan emocionada! ¡Empecemos!', 30706),
(166993, 'esMX', '', 'Qué hermosa colina. Me dirigiré a ella.', 30706),
(166992, 'esMX', '', '¿Qué es ese sonido? Qué hermoso... Tengo que hallar de dónde viene...', 30706),
(166991, 'esMX', 'Algo huele delicioso por allí. Si sonrío, tal vez me dejen probar un poco...', '', 30706),
(166990, 'esMX', '¡Bien hecho!', '¡Bien hecho!', 30706),
(166989, 'esMX', '|A:Warfront-HordeWave3:25:23:0:0|a¡Se ha desplegado una fuerza de asalto de la Horda hacia el camino central!', '|A:Warfront-HordeWave3:25:23:0:0|a¡Se ha desplegado una fuerza de asalto de la Horda hacia el camino central!', 30706),
(166988, 'esMX', '|A:Warfront-HordeWave3:25:23:0:0|a¡Se ha desplegado una fuerza de asalto de la Horda hacia el camino del este!', '|A:Warfront-HordeWave3:25:23:0:0|a¡Se ha desplegado una fuerza de asalto de la Horda hacia el camino del este!', 30706),
(166987, 'esMX', '|A:Warfront-HordeWave3:25:23:0:0|a¡Se ha desplegado una fuerza de asalto de la Horda hacia el camino del oeste!', '|A:Warfront-HordeWave3:25:23:0:0|a¡Se ha desplegado una fuerza de asalto de la Horda hacia el camino del oeste!', 30706),
(166985, 'esMX', '', 'Aprender cosas nuevas, explorar nuevas costas, ¡ayudar al prójimo!', 30706),
(166984, 'esMX', 'Orden recibida.', '', 30706),
(166983, 'esMX', '', 'Lo siento, están todas ocupadas por los guardias locales.\n\nNo sé de dónde sacaron el oro. Anoche reservaron todas las habitaciones, hasta el capitán vino.\n\nAl menos uno de ellos me dejó un desastre para limpiar también esta mañana.', 30706),
(166982, 'esMX', 'Esas sí son metas nobles, señora.', 'Esas sí son metas nobles, señora.', 30706),
(166981, 'esMX', '', '¡Pequeña maleducada! ¿Tu madre no te enseñó a respetar a los mayores?', 30706),
(166980, 'esMX', '', 'Ahora que Valiente está limpiando la basura aquí, podremos volver a hacer cosas importantes.', 30706),
(166979, 'esMX', '', 'Sí, unos cuantos de hecho. Puedes subir si quieres verlos por ti misma.\n\nLo siento, pero tengo que seguir atendiendo a los demás clientes.', 30706),
(166978, 'esMX', '¿Hay algún guardia hospedado en esta posada?', '¿Hay algún guardia hospedado en esta posada?', 30706),
(166977, 'esMX', '¿No te parece un poco grosero de tu parte?', '¿No te parece un poco grosero de tu parte?', 30706),
(166976, 'esMX', 'Queremos una habitación, por favor.', 'Queremos una habitación, por favor.', 30706),
(166975, 'esMX', '', 'Y aquí estoy, cubierta de hollín, persiguiendo a los esbirros rezagados de Aspafresno.', 30706),
(166974, 'esMX', '', '\"Te enviaremos a un nuevo puesto\", dijeron. \"Es cerca del mar\", dijeron.', 30706),
(166973, 'esMX', '¡Si ven basura Aspafresno rondando por aquí, envíenmelos a mí! ¡Será un placer darles su merecido!', '', 30706),
(166972, 'esMX', '', 'Hola, pequeña, ¿podrías hacerte a un lado? Tenemos que pasar.', 30706),
(166971, 'esMX', 'Parece que fue el último dinosaurio de Dajingo...', '', 30706),
(166970, 'esMX', '¡Es hora de los dinosaurios de Dajingo!', '', 30706),
(166969, 'esMX', '', '<Darcy le dirige a Lyana una mirada de preocupación.>\n\nLas niñas buenas no dicen ese tipo de cosas, cariño.\n\n<Darcy se da vuelta para mirar a Lyana.>\n\nSeguramente es solo una etapa.', 30706),
(166968, 'esMX', '', 'Oh, cariño, nada de qué preocuparse. ¿Te asustaste? \n\nUno de los guardias se divirtió demasiado y necesitaba acostarse y dormir un rato.\n\nLo llevé directo a la cama en la posada, no te preocupes.', 30706),
(166967, 'esMX', 'Ohhh, esto no ha terminado aún. ¡Regresaré!', 'Ohhh, esto no ha terminado aún. ¡Regresaré!', 30706),
(166966, 'esMX', '', 'Ah, sí, pobrecito.\n\nNo le entendí una palabra porque balbuceaba y andaba a los tropezones por todos lados. ¿Algo de unos frijoles?\n\nLo mandé directo a la cama, en la posada Villa del Lago.\n\nEspero que no se sienta demasiado mal hoy.', 30706),
(166965, 'esMX', '¡Gloria a la Reina alma en pena!', '¡Gloria a la Reina alma en pena!', 30706),
(166964, 'esMX', '¿Qué pasó anoche?', '¿Qué pasó anoche?', 30706),
(166963, 'esMX', 'El guardia me dijo que anoche lo cuidaste, ¡qué amable!', 'El guardia me dijo que anoche lo cuidaste, ¡qué amable!', 30706),
(166962, 'esMX', '', 'Oh, eres tan adorable. ¡Mira esos cachetes!', 30706),
(166961, 'esMX', '', '¡Hola! Espero que no te importe el desorden. ¡Tenemos muchos soldados hambrientos que necesitan alimentarse!', 30706),
(166960, 'esMX', '', '¡Acepto... mi muerte definitiva!', 30706),
(166959, 'esMX', '', '¡El poder de la Dama Oscura los aplastará a todos!', 30706),
(166958, 'esMX', '', 'Usa los controles. ¡Esta vez tenemos que ganar!', 30706),
(166957, 'esMX', '', 'Consigan las minas que todavía funcionan. ¡Vamos a volar sus defensas!', 30706),
(166956, 'esMX', 'Yo... eh... perdí mi poción.', 'Yo... eh... perdí mi poción.', 30706),
(166955, 'esMX', '', '¿Sí? ¿Qué ocurre?', 30706),
(166954, 'esMX', '', 'Al fin, es hora de que tome el control del gólem.', 30706),
(166953, 'esMX', '', '¡Funcionó! ¡Sabía que podías hacerlo!', 30706),
(166952, 'esMX', 'Bzzt... Todos los circuitos funcionan a la perfección... Szzt.', '', 30706),
(166951, 'esMX', 'Szzt... Unidad AE-35 operativa... Szzt.', '', 30706),
(166950, 'esMX', 'Estoy completamente operativo... Fzzzt.', '', 30706),
(166949, 'esMX', 'Bzzt ...¡Listo para la acción!', '', 30706),
(166948, 'esMX', '¡La muerte de un guerrero!', '', 30706),
(166947, 'esMX', '¡NO PASARÁS A VOL\'GAR!', '', 30706),
(166946, 'esMX', 'No te muevas. Debo exorcizar la corrupción de N\'Zoth de tu cuerpo.', '', 30706),
(166945, 'esMX', '¡Debemos purgar el mal que pretende controlarte! Conozco un ritual que puede ser de ayuda, pero el proceso será... desagradable.', '', 30706),
(166944, 'esMX', 'TRANSITION CUTSCENE PLAYS HERE', 'TRANSITION CUTSCENE PLAYS HERE', 30706),
(166943, 'esMX', '¡No! Iban a pagar... caro.', '', 30706),
(166942, 'esMX', '¡¿Por qué me interrumpes?! ¡Estaba obteniendo información valiosa!', '', 30706),
(166941, 'esMX', '¡Te detendremos!', '¡Te detendremos!', 30706),
(166940, 'esMX', '¡La Horda... caerá...!', '¡La Horda... caerá...!', 30706),
(166939, 'esMX', 'Por Ventormenta... ¡Por el rey Anduin!', 'Por Ventormenta... ¡Por el rey Anduin!', 30706),
(166938, 'esMX', '¡Muero... por... la Alianza!', '¡Muero... por... la Alianza!', 30706),
(166937, 'esMX', '¡Jamás... abandonaremos... Kul Tiras...!', '¡Jamás... abandonaremos... Kul Tiras...!', 30706),
(166936, 'esMX', 'Sylvanas nunca ganará...', 'Sylvanas nunca ganará...', 30706),
(166935, 'esMX', '¡Kul Tiras... los... vencerá!', '¡Kul Tiras... los... vencerá!', 30706),
(166934, 'esMX', 'Ustedes... jamás...', 'Ustedes... jamás...', 30706),
(166933, 'esMX', 'Por... mi... familia...', 'Por... mi... familia...', 30706),
(166932, 'esMX', 'Lo siento... Lady Valiente...', 'Lo siento... Lady Valiente...', 30706),
(166931, 'esMX', 'Asesinado... por el verdugo... de Daelin...', 'Asesinada... por el verdugo... de Daelin...', 30706),
(166930, 'esMX', 'Por Kul Tiras...', 'Por Kul Tiras...', 30706),
(166929, 'esMX', 'Te... detendremos...', 'Te... detendremos...', 30706),
(166928, 'esMX', '¡La Luz te abandona!', '¡La Luz te abandona!', 30706),
(166927, 'esMX', '¡La Horda nunca ganará...!', '¡La Horda nunca ganará...!', 30706),
(166926, 'esMX', 'La Horda... pagará...', 'La Horda... pagará...', 30706),
(166925, 'esMX', 'La Luz... sobrevivirá...', 'La Luz... sobrevivirá...', 30706),
(166924, 'esMX', 'Toda la Horda... desaparecerá...', 'Toda la Horda... desaparecerá...', 30706),
(166923, 'esMX', 'Estoy listo para comenzar el ritual.', 'Estoy lista para comenzar el ritual.', 30706),
(166922, 'esMX', 'Hay un vudú oh\'curo aquí, colega... Eh\'to no será fácil.', '', 30706),
(166921, 'esMX', '|TInterface\\ICONS\\Ability_Creature_Amber_02.blp:20|t ¡Estás cubierto en |cFFFF0000|Hspell:287072|h[Oro líquido]|h|r!', '|TInterface\\ICONS\\Ability_Creature_Amber_02.blp:20|t ¡Estás cubierta en |cFFFF0000|Hspell:287072|h[Oro líquido]|h|r!', 30706),
(166920, 'esMX', '¡Cuidado abajo!', '¡Cuidado abajo!', 30706),
(166919, 'esMX', '¡Fuera bombas!', '¡Fuera bombas!', 30706),
(166918, 'esMX', '', '¿Qué te parece mi nuevo concilio, $n?', 30706),
(166913, 'esMX', '', 'El rey Rastakhan se rodeó de traidores y víboras. Talanji ha elegido sabiamente a su\' consejeros.', 30706),
(166911, 'esMX', '', 'Eh\'ta nueva manada que tenemos es cada vez más extraña.', 30706),
(166910, 'esMX', 'Es bueno volver a verte, $n.\n\n<El señor aojador Raal hace un gesto al resto de los integrantes del concilio que se encuentran reunidos cerca.>\n\nCorren tiempos extraño\' para los zandalari. Normalmente me opondría a que un exiliado y un tortollano estén entre nueh\'tras filas, pero despue\' de todo lo que ha sucedido, quizás lo que más necesitamos es un cambio.', '', 30706),
(166909, 'esMX', 'Ya veo.', 'Ya veo.', 30706),
(166908, 'esMX', 'Nos vemos ahí.', '', 30706),
(166907, 'esMX', '', 'La Horda no... vencerá...', 30706),
(166906, 'esMX', '', '¡No nos deshicimos de Aspafresno para que viniera la Horda!', 30706),
(166904, 'esMX', '', '$UBienvenido:Bienvenida; a la Mugambala. Apenas descubrimos este lugar, supe que íbamos a tener que organizar una fiesta al aire libre. Hay espacios privilegiados para sacos de dormir y demás. Ponte $ucómodo:cómoda; y compra un trago.', 30706),
(166900, 'esMX', 'Listo.', 'Lista.', 30706),
(166899, 'esMX', '¿Estás $ulisto:lista; para partir?', '', 30706),
(166898, 'esMX', '', '¡Más voluntarios, más pruebas!', 30706),
(166897, 'esMX', 'Vamo\', $p. ¡Muéh\'trale a la Alianza el poder de los trols y el poder de la Horda!', '', 30706),
(166896, 'esMX', '¡Azzaga choogo zinn!', '', 30706),
(166895, 'esMX', '... ¡CON PODER!', '', 30706),
(166894, 'esMX', '...en las sombras...', '', 30706),
(166893, 'esMX', '', '...Por los espíritus...', 30706),
(166892, 'esMX', 'Sendulo ma\'das na khu\'das, kuba zinn awe.', '', 30706),
(166891, 'esMX', 'Prepárate, $p. Te imbuiremo\' con el poder antiguo de los trols.', '', 30706),
(166890, 'esMX', 'Sé que te estás escondiendo por aquí, gatito.', '', 30706),
(166889, 'esMX', 'Ven, gatito, gatito...', '', 30706),
(166887, 'esMX', '¡No me negarás mi trofeo!', '', 30706),
(166886, 'esMX', '¡Hoy hay carne en el menú!', '', 30706),
(166885, 'esMX', 'Con la información y los recursos de Aspafresno, no tardaremos en deshacernos de los que se nos oponen.', '', 30706),
(166884, 'esMX', 'Eh\'ta vez... el trofeo... es tuyo...', 'Eh\'ta vez... el trofeo... es tuyo...', 30706),
(166883, 'esMX', 'Tienes una cabeza hermosa. ¡Será un trofeo eh\'tupendo!', 'Tienes una cabeza hermosa. ¡Será un trofeo eh\'tupendo!', 30706),
(166882, 'esMX', '', 'Misha resopla.', 30706),
(166881, 'esMX', 'Estaré bien.', '', 30706),
(166880, 'esMX', 'Esta vez tendrás que quedarte, Misha.', '', 30706),
(166879, 'esMX', '', 'Oh, ráfagas, tan quisquillosas y veleidosas... Me han condenado...', 30706),
(166878, 'esMX', '', '¡Vientos indómitos de Zandalar, escuchen mi llamado!', 30706),
(166877, 'esMX', 'Nos vemos, $p.', '', 30706),
(166876, 'esMX', 'Diles a esos orcos que pueden contar conmigo la próxima vez que necesiten construir algo rápido y letal, ¿quieres?', '', 30706),
(166875, 'esMX', 'Quizá pelear en una guerra no está tan mal después de todo...', '', 30706),
(166874, 'esMX', '¡Qué adrenalina! $p, eso fue más divertido que las carreras en el viejo barcódromo.', '', 30706),
(166873, 'esMX', '¡AHORA NOS VENGAREMOS!', '', 30706),
(166872, 'esMX', 'nos mataste... nos capturaste... quisiste usarnos como combustible...', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(166871, 'esMX', '', 'AAAAAa....aahhhh....', 30706),
(166870, 'esMX', 'Tú...', '', 30706),
(166869, 'esMX', '¡Este bebé se está cayendo a pedazos! Yo lo arreglaré mientras tú te encargas de la capitana.', '', 30706),
(166868, 'esMX', '¡Ja, ja, ja!', '', 30706),
(166867, 'esMX', '¡Come humo, Fizzle!', '', 30706),
(166866, 'esMX', '¡Incendiemos todo!', '', 30706),
(166865, 'esMX', '', 'No te defraudaremos, Telaamon. Nunca olvidaremos tu sacrificio.', 30706),
(166864, 'esMX', 'Lo único que lamento es que no estaré aquí para ver el fin de esta guerra. La tarea que ustedes tienen por delante es mucho más dura.', '', 30706),
(166863, 'esMX', 'Todos nuestros caminos nos llevan de vuelta a la Luz... algunos son más dolorosos que otros.', '', 30706),
(166862, 'esMX', '', '¿No temes a tu propia muerte? La Horda te hará cosas horribles, Telaamon.', 30706),
(166861, 'esMX', 'Luché contra la Legión desde antes que todos tus ancestros conocidos, Lady Valiente. No siento temor.', '', 30706),
(166860, 'esMX', '', 'Telaamon, gracias otra vez por... todo. Esto no puede ser fácil, dar la vida para que podamos derrotar a la Horda.', 30706),
(166855, 'esMX', '', 'Sin embargo, puede que en este caso tengas razón. Quizá sea para mejor.', 30706),
(166854, 'esMX', '', 'Aún me siento intranquila, Rexxar. Es mejor tener cuidado cuando se siguen órdenes que van en contra del propio sentido común.', 30706),
(166853, 'esMX', '...pero por ahora podemos seguir el plan de la jefa de guerra. Vale la pena matar a un humano culpable para salvar otras vidas.', '', 30706),
(166851, 'esMX', '¿Este es el fin?', '¿Este es el fin?', 30706),
(166850, 'esMX', '¡Duele! Duele...', '¡Duele! Duele...', 30706),
(166849, 'esMX', 'Ah, ¡qué injusticia!', 'Ah, ¡qué injusticia!', 30706),
(166848, 'esMX', '¡Pagarás por esto!', '¡Pagarás por esto!', 30706),
(166847, 'esMX', '¡Estoy arruinado!', '¡Estoy arruinada!', 30706),
(166846, 'esMX', 'Mmm, ¿cuánto valdrá tu piel?', 'Mmm, ¿cuánto valdrá tu piel?', 30706),
(166845, 'esMX', '¡No te metas con el cártel!', '¡No te metas con el cártel!', 30706),
(166844, 'esMX', '¡Ocúpate de tus cosas, $uamigo:amiga;!', '¡Ocúpate de tus cosas, $uamigo:amiga;!', 30706),
(166843, 'esMX', '¡Te arrepentirás de haber pisado este cañón!', '¡Te arrepentirás de haber pisado este cañón!', 30706),
(166842, 'esMX', 'Siento que una oscuridad envuelve tu alma. Me temo que tu esencia carga con la marca de las fuerzas que has enfrentado.', '', 30706),
(166841, 'esMX', 'Por la Horda... ¡Y el dinero!', 'Por la Horda... ¡Y el dinero!', 30706),
(166840, 'esMX', '¡No dejaré que te quedes con mi presa!', '¡No dejaré que te quedes con mi presa!', 30706),
(166839, 'esMX', 'Debemos encargarnos del Crisol de Tormentas.', '', 30706),
(166838, 'esMX', '', 'Eyir te ha tenido más piedad de la que mereces. Toma el espíritu de tu amigo y vete.', 30706),
(166836, 'esMX', '', 'La Reina alma en pena pagará por sus crímenes tarde o temprano. Te convendría no estar de su lado cuando llegue el momento.', 30706),
(166835, 'esMX', '', 'Apestas a Bwonsamdi y su magia oscura.', 30706),
(166834, 'esMX', '', 'No eres $ubienvenido:bienvenida; aquí.', 30706),
(166833, 'esMX', '', 'Hay mucho por hacer ante\' de que Talanji pueda vestir la corona. Debemos apresurarno\' antes de que vuelvan a surgir los dih\'turbios.\n\nVen a verme cuando estés $Upreparado:preparada; para llevar a cabo tu rol en este ritual sagrado.', 30706),
(166832, 'esMX', 'Llévame a Bashal\'Aran.', 'Llévame a Bashal\'Aran.', 30706),
(166831, 'esMX', '<El sable de la luna te mira expectante.>', '', 30706),
(166830, 'esMX', 'Pelean mejor de lo que eh\'peraba, forastero\'. Mmm... serán una bonita incorporación a mi colección...', '', 30706),
(166829, 'esMX', 'Qué grosero de su parte venir a nuestra ciudad sin invitación. ¡Zuldazar eh\'tá bajo la protección del viejo Bwonsamdi!', '', 30706),
(166826, 'esMX', '', 'Mi nuevo concilio te eh\'pera, $n. Erata y yo subiremos en breve.', 30706),
(166825, 'esMX', '', 'A su debido tiempo, princesa. Lo mejor para Zandalar es que los loa te otorguen el trono lo ante\' posible.', 30706),
(166824, 'esMX', '¡Vamos, eh\'píritus! ¡No dejen que ese mono gigante se quede con toda la diversión!', '', 30706),
(166823, 'esMX', '¿Van a dejar que estos forastero\' de la Alianza se metan en nueh\'tra ciudad? ¡Aniquílenlos!', '', 30706),
(166822, 'esMX', '¡Levántense, eh\'píritus de Zandalar! ¡Llévense a estos invasore\' a la tumba con ustede\'!', '', 30706),
(166821, 'esMX', 'Listo. El Vacío tiene su conducto y ahora quiere alimentarse.$b$bPodemos usar ese poder a nuestro favor. Ve y destruye a la Horda, ¡pero rápido! No podemos contener el ritual para siempre...', '', 30706),
(166820, 'esMX', 'Shu... dalees-na.', 'Shu... dalees-na.', 30706),
(166819, 'esMX', '¡La naturaleza está en tu contra, $uintruso:intrusa;! ¡Andu-falah-dor!', '¡La naturaleza está en tu contra, $uintruso:intrusa;! ¡Andu-falah-dor!', 30706),
(166818, 'esMX', '', 'Debería hablar con los sacerdote\'. No fueron ello\' los que nos sumieron en este conflicto.', 30706),
(166817, 'esMX', 'Estoy listo para transformarme en un arma de la Alianza.', '', 30706),
(166816, 'esMX', 'Entiendo los riesgos, $p. Y los acepto.', '', 30706),
(166815, 'esMX', 'Cueste lo que cueste, valdrá la pena si veo a la Horda pagar por lo que hizo.', '', 30706),
(166814, 'esMX', '¡Quiero llegar a ser tan imponente que la Horda tiemble de miedo con solo verme!', '', 30706),
(166813, 'esMX', 'Pero estamos en esto juntos, ¿no, $p? Tú no me dejarás fallar.', '', 30706),
(166812, 'esMX', 'Quiero superar las expectativas de todos.', '', 30706),
(166811, 'esMX', 'Principalmente me preocupa no estar a la altura.', '', 30706),
(166810, 'esMX', 'Entre nosotros, estoy un poco nervioso.', '', 30706),
(166809, 'esMX', 'Uso el humor para encubrir mi ansiedad.', '', 30706),
(166808, 'esMX', 'Pero mientras conserve este rostro perfecto, ¿a quién le importa?', '', 30706),
(166807, 'esMX', 'La probabilidad de que pierda mi agudeza es alta.', '', 30706),
(166806, 'esMX', 'Sin embargo, tiene sus riesgos.', '', 30706),
(166804, 'esMX', 'En un comienzo, su dispositivo era rudimentario. Apenas podía duplicar el tamaño del objetivo.', '', 30706),
(166803, 'esMX', '', 'Esta es nueh\'tra gente, Alta prelada. Perdona a los que puedan entrar en razón.', 30706),
(166802, 'esMX', '', 'Da la orden y ejecutaré a esto\' traidores.', 30706),
(166801, 'esMX', 'Cuando oí que los gnomos planeaban atacar a la Horda, supe que era mi oportunidad de ayudar.', '', 30706),
(166800, 'esMX', '', 'El reh\'to pronto conocerá al loa que tanto detestan.', 30706),
(166799, 'esMX', 'Sé lo que debes estar pensando. ¿Por qué una bestia inteligente elegiría este destino?', '', 30706),
(166797, 'esMX', 'Desactivando', 'Desactivando', 30706),
(166796, 'esMX', '|TInterface\\ICONS\\SPELL_FROST_SUMMONWATERELEMENTAL_2:20|t¡Laminaria lanza |cFFFF0000|Hspell:287107|h[Ira de las profundidades]|h|r!', '', 30706),
(166795, 'esMX', 'Eso... duele...', 'Eso... duele...', 30706),
(166794, 'esMX', '¡Maldición! Casi la tenía.', '¡Maldición! Casi la tenía.', 30706),
(166790, 'esMX', 'A la orden.', 'A la orden.', 30706),
(166789, 'esMX', '¡Tienes que parar de soplar ese silbato, en serio!', '¡Tienes que parar de soplar ese silbato, en serio!', 30706),
(166788, 'esMX', '¡Otra vez tú!', '¡Otra vez tú!', 30706),
(166787, 'esMX', '¡Aquí estoy, ya puedes empezar!', '¡Aquí estoy, ya puedes empezar!', 30706),
(166786, 'esMX', 'No sé qué es esto, pero cuenta conmigo.', 'No sé qué es esto, pero cuenta conmigo.', 30706),
(166785, 'esMX', 'Tenemos que dejar de reunirnos así... hic.', 'Tenemos que dejar de reunirnos así... hic.', 30706),
(166784, 'esMX', 'Nunca viajo ligero... hay suficiente para ti... hic.', 'Por suerte traje de más para ti.', 30706),
(166783, 'esMX', '', 'Al fin... conozco... mi propósito...', 30706),
(166782, 'esMX', '', '¡Largo de aquí! ¡El poder de la piedra debe ser MÍO!', 30706),
(166781, 'esMX', 'Amo... ya voy...', 'Amo... ya voy...', 30706),
(166780, 'esMX', 'Olvido... recíbeme...', 'Olvido... recíbeme...', 30706),
(166779, 'esMX', '¡Ya vienen! ¡Ya vienen!', '¡Ya vienen! ¡Ya vienen!', 30706),
(166778, 'esMX', '¡No puedes detener los susurros!', '¡No puedes detener los susurros!', 30706),
(166777, 'esMX', '', '¿En serio cree que puede abrir la piedra? Qué tonta. Si el tiempo no apremiara, me quedaría solo para verla fracasar.', 30706),
(166773, 'esMX', '¡Peleaste muy bien!', '', 30706),
(166772, 'esMX', 'Acércate, ¡te fortaleceré con el poder los elementos!', '', 30706),
(166771, 'esMX', 'Resiste, ¡he venido a ayudarte!', '', 30706),
(166770, 'esMX', '', '¡Carguen! ¡Si no capturamos Zul\'jan, nuestro plan fracasará!', 30706),
(166766, 'esMX', 'No esperaba morir... así...', 'No esperaba morir... así...', 30706),
(166765, 'esMX', '¡Ven aquí, $Uasqueroso hijo:asquerosa hija; de troggs! Te mostraré cómo hace las cosas la IV:7.', '¡Ven aquí, $Uasqueroso hijo:asquerosa hija; de troggs! Te mostraré cómo hace las cosas la IV:7.', 30706),
(166764, 'esMX', 'Rastakhan... acabará... contigo...', 'Rastakhan... acabará... contigo...', 30706),
(166763, 'esMX', 'Zandalar... los... destruirá...', 'Zandalar... los... destruirá...', 30706),
(166762, 'esMX', 'El ejército zandalari... los aplastará...', 'El ejército zandalari... los aplastará...', 30706),
(166761, 'esMX', '¡Nuestros aliados los perseguirán!', '¡Nuestros aliados los perseguirán!', 30706),
(166760, 'esMX', '¡El rey Rastakhan los matará a todos!', '¡El rey Rastakhan los matará a todos!', 30706),
(166759, 'esMX', '¡La princesa Talanji me vengará!', '¡La princesa Talanji me vengará!', 30706),
(166758, 'esMX', 'Zuldazar... sabrá... que están aquí...', 'Zuldazar... sabrá... que están aquí...', 30706),
(166757, 'esMX', 'Me escabulliré para adelantarme mientras ustedes doman esas bestias. Buena suerte.', '', 30706),
(166756, 'esMX', 'Te esperaré con ansias más adelante y destruiremos esta monstruosidad goblin.', '', 30706),
(166755, 'esMX', '', 'Ayudaré a nuestras tropas en Zul\'jan y me encontraré con ustedes más adelante, cuando hayan terminado.', 30706),
(166754, 'esMX', 'Tu hora... llegará también.', '', 30706),
(166753, 'esMX', 'Retuércete y grita todo lo que quieras. ¡Eso hace tu muerte mucho más divertida!', '', 30706),
(166752, 'esMX', '¡Los exterminaré y salvaré este planeta!', '', 30706),
(166751, 'esMX', '¡Sus lamentables máquinas no son nada ante la Luz! No permitiremos que su especie destruya este planeta.', '', 30706),
(166750, 'esMX', 'Escuadrón goblin... ¡A CORRER! ¡Huyan!', '', 30706),
(166749, 'esMX', '¡Qué pusilánime! Te lanzaremos a la atmósfera y de ahí a la estratósfera, al mejor estilo goblin.', '', 30706),
(166748, 'esMX', 'Mi lucha no es contra ti. Baja tu arma y me marcharé.', 'Mi lucha no es contra ti. Baja tu arma y me marcharé.', 30706),
(166747, 'esMX', 'La Viuda me dijo que era la única forma... No debí haberla eh\'cuchado.', 'La Viuda me dijo que era la única forma... No debí haberla eh\'cuchado.', 30706),
(166746, 'esMX', '¡Perdóname la vida! Olvidé quién era.', '¡Perdóname la vida! Olvidé quién era.', 30706),
(166745, 'esMX', 'Mi lucha no es contra ti. Eh\'taba equivocado.', 'Mi lucha no es contra ti. Eh\'taba equivocada.', 30706),
(166744, 'esMX', 'La Viuda Blanca nos mintió. No fuiste tú quien causó todo eh\'to.', 'La Viuda Blanca nos mintió. No fuiste tú quien causó todo eh\'to.', 30706),
(166743, 'esMX', 'Yo solo quería un hogar...', 'Yo solo quería un hogar...', 30706),
(166742, 'esMX', '¡Nos tratan como mendigo\'!', '¡Nos tratan como mendigo\'!', 30706),
(166741, 'esMX', '¡Tomaremo\' lo que nos pertenece! ¡Así lo dice la Viuda Blanca!', '¡Tomaremo\' lo que nos pertenece! ¡Así lo dice la Viuda Blanca!', 30706),
(166740, 'esMX', '¡Te enseñaremos a reh\'petar nuestro poder!', '¡Te enseñaremos a reh\'petar nuestro poder!', 30706),
(166739, 'esMX', '¡No somo\' los siervos de la Horda! ¡Así lo dice la Viuda Blanca!', '¡No somo\' los siervos de la Horda! ¡Así lo dice la Viuda Blanca!', 30706),
(166738, 'esMX', '¡Nunca más seremo\' \"la tribu más débil\"!', '¡Nunca más seremo\' \"la tribu más débil\"!', 30706),
(166737, 'esMX', '¡La Viuda Blanca ve nueh\'tra fuerza!', '¡La Viuda Blanca ve nueh\'tra fuerza!', 30706),
(166736, 'esMX', '', 'Todo parece estar en buenas condiciones aún, en vista de todo. Manos a la obra.', 30706),
(166735, 'esMX', 'Anduin... ¿Podemos hablar?', '', 30706),
(166734, 'esMX', '¡Leeroy Jenkins!', '', 30706),
(166731, 'esMX', '', 'Si no te molesta, voy a evitar las arañas. Cuando consigas la seda, ven a verme en Gol Koval en el sur.', 30706),
(166730, 'esMX', '', '¡Esto... termina... aquí!', 30706),
(166728, 'esMX', 'Creo que estoy... un poquito... dañado.', '', 30706),
(166727, 'esMX', '', '¡Herejes! ¡Pagarán por eh\'to con sus vidas!', 30706),
(166726, 'esMX', '¡Deja que te muestre lo que es poder de verdad!', '', 30706),
(166725, 'esMX', '¡¿Te atreves a atacarme?!', '', 30706),
(166724, 'esMX', '¡Conserva tu energía!', '¡Conserva tu energía!', 30706),
(166723, 'esMX', '¡No cruces los rayos!', '¡No cruces los rayos!', 30706),
(166722, 'esMX', 'Sujeta las ataduras. ¡Ya casi lo tenemos!', 'Sujeta las ataduras. ¡Ya casi lo tenemos!', 30706),
(166721, 'esMX', '¡¿Qué he hecho?!', '¡¿Qué he hecho?!', 30706),
(166720, 'esMX', 'Perdóname, por favor...', 'Perdóname, por favor...', 30706),
(166719, 'esMX', 'Así no...', 'Así no...', 30706),
(166718, 'esMX', '¡Aaaah! ¡Ayuda!', '¡Aaaah! ¡Ayuda!', 30706),
(166717, 'esMX', '¡No te desconcentres!', '¡No te desconcentres!', 30706),
(166716, 'esMX', 'Domínalo. ¡Lo enviaremos contra la Horda!', 'Domínalo. ¡Lo enviaremos contra la Horda!', 30706),
(166715, 'esMX', '¡No permitan que escape!', '¡No permitan que escape!', 30706),
(166713, 'esMX', '¡Ahhhhh! ¡Está suelto!', '¡Ahhhhh! ¡Está suelto!', 30706),
(166712, 'esMX', '¡Tontos mortales! ¡Su arrogancia será su perdición!', '', 30706),
(166709, 'esMX', '¡Veremos cómo $p prueba nuestro invento!', '¡Veremos cómo $p prueba nuestro invento!', 30706),
(166708, 'esMX', 'Aquí estamos a salvo, cariño.', 'Aquí estamos a salvo, cariño.', 30706),
(166705, 'esMX', '¡Voy a darles a estos gnomos un puñado de bombas!', '', 30706),
(166704, 'esMX', '¡Los controles son todos tuyos!', '', 30706),
(166703, 'esMX', 'No me dijeron... que terminaría... así.', 'No me dijeron... que terminaría... así.', 30706),
(166702, 'esMX', 'Los susurros me dijeron que vendrías. ¡$UBienvenido:Bienvenida; a tu perdición!', 'Los susurros me dijeron que vendrías. ¡$UBienvenido:Bienvenida; a tu perdición!', 30706),
(166701, 'esMX', 'Pozzik escupe sobre la cubierta de la nave.', '', 30706),
(166700, 'esMX', 'Se cree que puede enseñarme a mejorar un motor...', '', 30706),
(166699, 'esMX', 'Esto pondrá a ese payaso de Fizzle en su lugar...', '', 30706),
(166697, 'esMX', '', 'He trabajado en este sitio durante el tiempo suficiente para encontrar ciertas manifestaciones interesantes de este material al que llaman azerita. ¿Quieres probar suerte y luchar contra algunos elementales de azerita solitarios que he descubierto allí abajo?', 30706),
(166696, 'esMX', '¡Jinetes de murciélagos! ¡Cúbranse!', '', 30706),
(166695, 'esMX', '', 'Parece...', 30706),
(166694, 'esMX', '', '¿Qué es eso?', 30706),
(166693, 'esMX', '', 'Ahí... a lo lejos. No puedo distinguirlo...', 30706),
(166692, 'esMX', '', 'Nuestra tripulación no arriesgaría su vida si no creyéramos en ti.', 30706),
(166691, 'esMX', 'El Espuma de la Luna y su tripulación están bien preparados para lo que se avecina.', '', 30706),
(166690, 'esMX', '', 'Nuestro destino son las ruinas de Zul\'jan. Avancen en grupos pequeños para cruzar el pantano sin que los vean. ¡No peleen a menos que sea necesario!', 30706),
(166689, 'esMX', '<Ambient client scene of army leaving Zalamar.>', '<Ambient client scene of army leaving Zalamar.>', 30706),
(166688, 'esMX', '¡A los muelles! Tenemos que hacer una entrega.', '', 30706),
(166687, 'esMX', 'Aquí vienen.', '', 30706),
(166686, 'esMX', 'Tenemos que despejar el camino.', '', 30706),
(166685, 'esMX', 'Ya casi llegamos... ¿Estás $ulisto:lista; para demostrarles a los posibles inversores que esta cosa se defiende sola en el campo de batalla?', '', 30706),
(166684, 'esMX', 'Hablando de eso, ¿por qué no pruebas las armas? ¡Esta es una combinación perfecta entre bombardero, luchador aéreo y contenedor de alimentos!', '', 30706),
(166683, 'esMX', 'No sé por qué quieren tanto ese pedazo de costa maldito, pero nos ahorra el costo de enviar a este chico malo a Kul Tiras.', '', 30706),
(166682, 'esMX', 'El sitio de la misión no está lejos. La Alianza está acarreando un ejército del tamaño de la papada Gallywix.', '', 30706),
(166681, 'esMX', 'Fiu... ¡Nunca dudé de este montón de recios explosivos!', '', 30706),
(166680, 'esMX', '¡Bienvenidos a bordo! Sujétense... Vamos a tener que romper algunos récords de velocidad para salir de esta pasarela.', '', 30706),
(166679, 'esMX', '', 'Cuando hayamos asegurado la zona nos encontraremos contigo en Bashal\'Aran.', 30706),
(166678, 'esMX', 'No lamentaré la muerte de otro loa. No si puedo hacer algo para impedirlo.', 'No lamentaré la muerte de otro loa. No si puedo hacer algo para impedirlo.', 30706),
(166677, 'esMX', 'Si esperas que permanezca en silencio, te equivoca\'.', 'Si esperas que permanezca en silencio, te equivoca\'.', 30706),
(166676, 'esMX', '¿Cómo puede poner a la muerte por encima de todos lo\' loa? ¡No tiene sentido!', '¿Cómo puede poner a la muerte por encima de todos lo\' loa? ¡No tiene sentido!', 30706),
(166675, 'esMX', 'Ante\' de que nos demo\' cuenta, mudarán el trono a la Necrópolis. ¡Bah!\n\nNo lo permitiré.', 'Ante\' de que nos demo\' cuenta, mudarán el trono a la Necrópolis. ¡Bah!\n\nNo lo permitiré.', 30706),
(166674, 'esMX', '¿Qué más puedo hacer? Talanji nos condenará a todo\'. La Viuda Blanca sabe que así será.', '¿Qué más puedo hacer? Talanji nos condenará a todo\'. La Viuda Blanca sabe que así será.', 30706),
(166673, 'esMX', 'La Viuda Blanca me moh\'tró la verdad. Talanji nos pondrá a todos al servicio de Bwonsamdi. ¡Debemo\' detenerla antes de que sea demasiado tarde!', 'La Viuda Blanca me moh\'tró la verdad. Talanji nos pondrá a todos al servicio de Bwonsamdi. ¡Debemo\' detenerla antes de que sea demasiado tarde!', 30706),
(166672, 'esMX', '<Está sumamente concentrado en sus plegarias.>', '<Está sumamente concentrada en sus plegarias.>', 30706),
(166671, 'esMX', '¿En qué eh\'taba pensando? ¡Podrías haberme matado!', '¿En qué eh\'taba pensando? ¡Podrías haberme matado!', 30706),
(166670, 'esMX', 'Me apresuraba por llegar al Otro Lado sin saberlo.', 'Me apresuraba por llegar al Otro Lado sin saberlo.', 30706),
(166669, 'esMX', '¿Por qué luchamo\'? ¡Tú no eres mi $Uenemigo:enemiga;!', '¿Por qué luchamo\'? ¡Tú no eres mi $Uenemigo:enemiga;!', 30706),
(166668, 'esMX', 'Ahora veo con claridad... Luchar contra ti no resuelve nada. La Viuda eh\'taba equivocada.', 'Ahora veo con claridad... Luchar contra ti no resuelve nada. La Viuda eh\'taba equivocada.', 30706),
(166667, 'esMX', 'Tengo que confiar en Talanji. Ella no eligió eh\'te destino.', 'Tengo que confiar en Talanji. Ella no eligió eh\'te destino.', 30706),
(166666, 'esMX', 'No sé qué me ha pasado.', 'No sé qué me ha pasado.', 30706),
(166665, 'esMX', 'No... Eh\'ta no es la forma de arreglarlo... Perdóname.', 'No... Eh\'ta no es la forma de arreglarlo... Perdóname.', 30706),
(166664, 'esMX', '¡Mi loa no será el próximo en caer!', '¡Mi loa no será el próximo en caer!', 30706),
(166663, 'esMX', '¡No veré morir a más loa!', '¡No veré morir a más loa!', 30706),
(166662, 'esMX', '¡Solo me arrodillo ante mi loa!', '¡Solo me arrodillo ante mi loa!', 30706),
(166661, 'esMX', '¡La sombra de Bwonsamdi socava nueh\'tra fe! ¡No callaré más!', '¡La sombra de Bwonsamdi socava nueh\'tra fe! ¡No callaré más!', 30706),
(166660, 'esMX', '¡No serviré a una reina que hace trato\' con la muerte!', '¡No serviré a una reina que hace trato\' con la muerte!', 30706),
(166659, 'esMX', '¡Talanji porta la marca de la muerte! ¡Es una maldición!', '¡Talanji porta la marca de la muerte! ¡Es una maldición!', 30706),
(166658, 'esMX', '¡No serviré a Bwonsamdi!', '¡No serviré a Bwonsamdi!', 30706),
(166657, 'esMX', '', 'En este momento es demasiado peligroso viajar por Costa Oscura.$B$BEl acceso al portal se restablecerá cuando hayamos recuperado el control de la zona.', 30706),
(166656, 'esMX', '', 'En este momento es demasiado peligroso viajar por Costa Oscura.$B$BEl acceso al portal se restablecerá cuando hayamos recuperado el control de la zona.', 30706),
(166655, 'esMX', '¡Por la Alianza!', '', 30706),
(166654, 'esMX', 'Y recuerden que cada segundo que resistan es un segundo que nos acerca a nuestra victoria sobre estos monstruos.', '', 30706),
(166653, 'esMX', '¡La Horda vendrá, y cuando ellos lleguen, ustedes los harán sufrir por cada milímetro de tierra que pisen en este pantano maldito!', '', 30706),
(166652, 'esMX', 'Cada uno de ustedes será recordado por ofrecer su vida a la causa más noble: proteger Azeroth del yugo de la tiranía.', '', 30706),
(166651, 'esMX', 'Nuestro progreso en esta campaña continúa. No olvidaremos tus sacrificios.', '', 30706),
(166648, 'esMX', '¡Regresa al campo de batalla!', '¡Regresa al campo de batalla!', 30706),
(166647, 'esMX', 'No puede haber paz si no se toman medidas.', '', 30706),
(166646, 'esMX', 'Hay que purgar a la Horda para que Azeroth esté a salvo.', '', 30706),
(166645, 'esMX', '<Asiste a la reunión.>', '<Asiste a la reunión.>', 30706),
(166644, 'esMX', 'Llamando a la máquina topo', 'Llamando a la máquina topo', 30706),
(166643, 'esMX', 'Iré a hacer lo que pueda dentro de Zalamar. Volveremos a vernos cuando hayamos purgado el mundo de estos trols de sangre.', '', 30706),
(166642, 'esMX', '', '|TInterface\\ICONS\\Ability_Paladin_EmpoweredSealsRighteous:20|t¡Ra\'wani Kanae comienza a liberar |cFFFF0000|Hspell:284469|h[Sello de reprensión]|h|r!', 30706),
(166641, 'esMX', '', '|TInterface\\ICONS\\SPELL_HOLY_SEALOFWRATH:20|t¡Ra\'wani Kanae comienza a liberar |cFFFF0000|Hspell:284436|h[Sello de expiación]|h|r!', 30706),
(166640, 'esMX', '¡Esto no es mi culpa!', '¡Esto no es mi culpa!', 30706),
(166639, 'esMX', '¡Espera! Aún no termino.', '¡Espera! Aún no termino.', 30706),
(166638, 'esMX', '¡Sujétate bien!', '¡Sujétate bien!', 30706),
(166637, 'esMX', 'Muy bien, los protocolos de seguridad están... ¡Ups!', 'Muy bien, los protocolos de seguridad están... ¡Ups!', 30706),
(166636, 'esMX', 'Estamo\' aquí a pedido de Talanji. Su alteza real ha sido de tremenda ayuda para los prelado\', pues nos recordó quiénes somos y qué representamos. $b$bPuede que Rezan, nuestro loa, haya caído, pero sus ideale\' permanecen. Tenemos que guiar a los que están perdidos, ser una luminaria contra la oscuridad.$b$bPor la gracia de los loa, todavía somos uno con la luz.', 'Estamo\' aquí a pedido de Talanji. Su alteza real ha sido de tremenda ayuda para los prelado\', pues nos recordó quiénes somos y qué representamos. $b$bPuede que Rezan, nuestro loa, haya caído, pero sus ideale\' permanecen. Tenemos que guiar a los que están perdidos, ser una luminaria contra la oscuridad.$b$bPor la gracia de los loa, todavía somos uno con la luz.', 30706),
(166635, 'esMX', '', 'Se fue... con la marea...', 30706),
(166634, 'esMX', '¡Que te lleven las aguas oscuras!', '¡Que te lleven las aguas oscuras!', 30706),
(166633, 'esMX', '¡Mamáaaaa!', '', 30706),
(166632, 'esMX', 'Prefiero ver arder eh\'ta ciudad antes que arrodillarme ante la muerte.', 'Prefiero ver arder eh\'ta ciudad antes que arrodillarme ante la muerte.', 30706),
(166631, 'esMX', 'Dejé que mis miedo\' se apoderaran de mi... Talanji, perdóname, por favor.', 'Dejé que mis miedo\' se apoderaran de mi... Talanji, perdóname, por favor.', 30706),
(166630, 'esMX', '¡Los zandalari no somos esclavo\' del loa de la muerte!', '¡Los zandalari no somos esclavo\' del loa de la muerte!', 30706),
(166629, 'esMX', '¡Al final, todo\' visitan al viejo Bwonsamdi!', '', 30706),
(166628, 'esMX', '¡Ven aquí, criaturita!', '', 30706),
(166627, 'esMX', '¡Ahora conocen el poder del viejo Bwonsamdi!', '', 30706),
(166626, 'esMX', '¿Quieren probar un poco de mi poder?', '', 30706),
(166625, 'esMX', '¡Vamos! ¡Hagan algo útil!', '', 30706),
(166624, 'esMX', '¡Denles una lección a eso\' principiantes!', '', 30706),
(166623, 'esMX', 'Nos divertiremo\' mucho con esto, ¡ya verán!', '', 30706),
(166622, 'esMX', '¡Aquí tienen un juguetito!', '', 30706),
(166621, 'esMX', '¡Oh, nonono! ¡Ahora estás por tu cuenta!', '', 30706),
(166620, 'esMX', '¡No, no! ¡Nada de ayudar al fortachón!', '', 30706),
(166619, 'esMX', '|TInterface\\ICONS\\Ability_ThunderKing_BallLightning.blp:20|t ¡Te ha golpeado la |cFFFF0000|Hspell:286811|h[Cólera de Akunda]|h|r!', '|TInterface\\ICONS\\Ability_ThunderKing_BallLightning.blp:20|t ¡Te ha golpeado la |cFFFF0000|Hspell:286811|h[Cólera de Akunda]|h|r!', 30706),
(166618, 'esMX', 'Hace mucho tiempo que ere\' rey, Rastakhan. Quizá... demasiado. Si tú no estás a la altura, quizá debas darle lugar a esa hija tan linda que tiene\', ¿no?', '', 30706),
(166617, 'esMX', '¡Cuánta fuerza! ¡Ahora caerán!', '', 30706),
(166616, 'esMX', 'Por la gloria de... Kul... Tiras...', 'Por la gloria de... Kul... Tiras...', 30706),
(166615, 'esMX', '¡Has invadido el reino equivocado, cerdo!', '¡Has invadido el reino equivocado, cerdo!', 30706),
(166614, 'esMX', 'Eh\'te poder... eh\'ta muerte... es una maldición, ¡no una bendición! Oh, hija... ¿qué he hecho?', '', 30706),
(166613, 'esMX', '¡Estos forastero\' no se rinden! Bwonsamdi, ¡¿cómo pueden resistirse a tu poder?!', '', 30706),
(166612, 'esMX', '¡Eh\'ta oscuridad amenaza con consumirme el alma! Debo... liberarme de ella.', '', 30706),
(166611, 'esMX', '¿Por qué estos invasore\' todavía se resisten? ¡Ya tendrías que haberlos eliminado, Bwonsamdi!', '', 30706),
(166610, 'esMX', 'No... La oh\'curidad... es demasiado... ¡No puedo controlarla!', '', 30706),
(166609, 'esMX', '¡Sí! ¡Siento el poder de un loa en mis venas!', '', 30706),
(166608, 'esMX', '¡Ere\' muy demandante, Rastakhan! Te daré el poder que deseas... pero será mejor que cuide\' tu tono.', '', 30706),
(166607, 'esMX', '¡Bwonsamdi! ¡Tú ere\' mi loa! ¡Honra nuestro pacto y derriba a eh\'tos atacantes!', '', 30706),
(166606, 'esMX', '', 'Una vez que hayas cargado el núcleo de poder rúnico, búscame en las ruinas.', 30706),
(166605, 'esMX', 'Como desees, Rastakhan. Anda, prueba mi mojo...', '', 30706),
(166604, 'esMX', '¡Entonce\' dame el poder para deh\'truirlos!', '', 30706),
(166603, 'esMX', '¿Por qué tanto alboroto, su majestad? ¡El viejo Bwonsamdi no dejará que ningún forah\'tero se quede con su trono!', '', 30706),
(166602, 'esMX', '¡Bwonsamdi! ¡Los invasore\' de la Alianza han aniquilado a nueh\'tra gente! ¡Ayúdame!', '', 30706),
(166601, 'esMX', '¡La muerte se ha apoderado de mí!', '', 30706),
(166600, 'esMX', '¡¿Qué es eh\'te poder oscuro?!', '', 30706),
(166599, 'esMX', '¡Sufrirán una lenta agonía!', '', 30706),
(166598, 'esMX', '¡Conocerán el dolor!', '', 30706),
(166596, 'esMX', '¡Sufrirás!', '', 30706),
(166595, 'esMX', '¡La muerte es ineludible!', '', 30706),
(166593, 'esMX', '¡Arderás por tus crímenes!', '', 30706),
(166592, 'esMX', '¡Que llueva fuego!', '', 30706),
(166590, 'esMX', '¡Cuidado con el golpe de la serpiente!', '', 30706),
(166589, 'esMX', '¡La mordida de la serpiente puede ser letal!', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(166587, 'esMX', 'Vayan, mis pequeños, ¡vayan!', '', 30706),
(166586, 'esMX', '¡Zandalar puede ser un lugar letal!', '', 30706),
(166584, 'esMX', '|cFF0000FF(Misión)|r Envíame a Costa Oscura.', '|cFF0000FF(Misión)|r Envíame a Costa Oscura.', 30706),
(166583, 'esMX', '¡Obedezcan mi voluntad!', '', 30706),
(166582, 'esMX', '¡Sus corazones y mente\' me pertenecen!', '', 30706),
(166580, 'esMX', '¡Te recomiendo que huyas!', '', 30706),
(166579, 'esMX', '¡Largo de aquí!', '', 30706),
(166578, 'esMX', '¡Contemplen la ira de Zandalar!', '', 30706),
(166577, 'esMX', 'Le he fallado... a mi reino...', '', 30706),
(166576, 'esMX', '¡Mis leales súbditos! ¡Muéstrenles a eh\'tos forasteros el precio de su arrogancia!', '', 30706),
(166575, 'esMX', '¡No se enfrentan solo a mí, invasores! ¡Eh\'tán ante los mejores defensore\' de Zuldazar!', '', 30706),
(166574, 'esMX', '¿Podrías recordarme qué pasó?', '¿Podrías recordarme qué pasó?', 30706),
(166573, 'esMX', 'Listo. Traeré el cetro de regreso a Los Confines. Buena suerte a todos.', '', 30706),
(166572, 'esMX', '¡Mareas, otórguennos poder, cubran este pantano maldito con su niebla, creen un velo para la flota dentro de él!', '', 30706),
(166571, 'esMX', '¿Quién eres?', '¿Quién eres?', 30706),
(166570, 'esMX', '', '<Delaryn levanta la mirada.>\n\nTe recuerdo. Estabas allí.', 30706),
(166569, 'esMX', '', '<Delaryn no parece estar mirándote.>', 30706),
(166568, 'esMX', 'Estoy listo, usa el cetro abisal para crear la niebla que ocultará nuestras fuerzas.', 'Estoy lista, usa el cetro abisal para crear la niebla que ocultará nuestras fuerzas.', 30706),
(166567, 'esMX', 'El cetro abisal es un artefacto poderoso. Cuando des la señal, desataré su poder.\n\nRecuerda que cuando caiga la niebla, tendremos que avanzar rápido, antes de que la Horda y los zandalari comprendan nuestro plan.', '', 30706),
(166566, 'esMX', '', '¡Perdóname la vida! La Viuda Blanca llenó mi corazón de mentira\'... Ahora veo la verdad.', 30706),
(166565, 'esMX', '', '¡Expulsaremos a la Horda de nueh\'tra ciudad!', 30706),
(166564, 'esMX', 'Muéstrame una visión de Guardianes atormentados.', 'Muéstrame una visión de Guardianes atormentados.', 30706),
(166563, 'esMX', 'Muéstrame una visión de la Falla de Aln.', 'Muéstrame una visión de la Falla de Aln.', 30706),
(166562, 'esMX', 'Muéstrame una visión de los Acueductos arqueados.', 'Muéstrame una visión de los Acueductos arqueados.', 30706),
(166561, 'esMX', 'Muéstrame una visión de El Athenaeum real.', 'Muéstrame una visión de El Athenaeum real.', 30706),
(166560, 'esMX', 'Muéstrame una visión de La Aguja de la Noche.', 'Muéstrame una visión de La Aguja de la Noche.', 30706),
(166559, 'esMX', 'Muéstrame una visión del El alza del traidor.', 'Muéstrame una visión del El alza del traidor.', 30706),
(166558, 'esMX', 'Muéstrame una visión de La prueba de valor.', 'Muéstrame una visión de La prueba de valor.', 30706),
(166557, 'esMX', 'Muéstrame una visión de Las puertas del infierno.', 'Muéstrame una visión de Las puertas del infierno.', 30706),
(166556, 'esMX', 'Muéstrame una visión de los Salones de los lamentos.', 'Muéstrame una visión de los Salones de los lamentos.', 30706),
(166555, 'esMX', 'Muéstrame una visión de la Cámara del Avatar.', 'Muéstrame una visión de la Cámara del Avatar.', 30706),
(166554, 'esMX', 'Muéstrame una visión de La caída del Falsario.', 'Muéstrame una visión de La caída del Falsario.', 30706),
(166553, 'esMX', 'Muéstrame una visión de Brecha de la Luz.', 'Muéstrame una visión de Brecha de la Luz.', 30706),
(166552, 'esMX', 'Muéstrame una visión de Descenso Prohibido.', 'Muéstrame una visión de Descenso Prohibido.', 30706),
(166551, 'esMX', 'Muéstrame una visión de El Fin de la Esperanza.', 'Muéstrame una visión de El Fin de la Esperanza.', 30706),
(166550, 'esMX', 'Muéstrame una visión del Trono del Panteón.', 'Muéstrame una visión del Trono del Panteón.', 30706),
(166549, 'esMX', '|TInterface\\Icons\\INV_Sword_2H_DraenorQuest_B_01.blp:20|t¡El capitán guardia de añublo Thedric persigue a $n con una serie de ataques de |cFFFF0000|Hspell:286805|h[Filo apestado]|h|r!', '|TInterface\\Icons\\INV_Sword_2H_DraenorQuest_B_01.blp:20|t¡El capitán guardia de añublo Thedric persigue a $n con una serie de ataques de |cFFFF0000|Hspell:286805|h[Filo apestado]|h|r!', 30706),
(166548, 'esMX', 'Muéstrame una visión de Rama oscura.', 'Muéstrame una visión de Rama oscura.', 30706),
(166547, 'esMX', 'Terminamos con los preparativos, $n. El ritual está listo.$b$bLos encantamientos que aplicamos en estos huesos alcanzarán para que desatemos sus poderes sobre la Horda, pero debemos ser rápidos. ¿Estás $ulisto:lista; para comenzar?', '', 30706),
(166546, 'esMX', 'Qué bueno volver a trabajar contigo, $n. Sin dudas te preguntarás qué estamos haciendo.$b$bTodavía estamos preparando el ritual. Te avisaré cuando estemos listos.', '', 30706),
(166545, 'esMX', '', 'Tenemos que movernos rápido para que nuestra distracción contra la Horda y los zandalari funcione.', 30706),
(166544, 'esMX', '', 'Prepararé una vía para movilizar nuestras tropas a Nazmir. Nos encontraremos en Los Confines, $p.', 30706),
(166543, 'esMX', 'Y contigo, Halford. El poder de la Luz brilla con fuerza dentro de ti. No la pierdas.', '', 30706),
(166542, 'esMX', '...Gracias, Telaamon. Que la Luz esté contigo.', '', 30706),
(166541, 'esMX', 'Estoy dispuesto a pagar cualquier precio para asegurarme de que nadie sufra el mismo dolor que yo, Halford.', '', 30706),
(166540, 'esMX', 'Si no controlan a la Horda, será la perdición de este planeta.', '', 30706),
(166539, 'esMX', 'Todo a causa del hambre de poder que parte de mi pueblo no pudo controlar.', '', 30706),
(166538, 'esMX', 'Lo comprendo bien. Halford, yo vi a mi planeta convirtiéndose en una cosa amarga, muerta.', '', 30706),
(166537, 'esMX', 'Así es. Quien sea que vaya será la carnada de la Horda, y sus fuerzas lo asesinarán.... Mientras zarpa nuestra flota principal.', '', 30706),
(166536, 'esMX', 'Dijiste que era una misión suicida, ¿o no? Que nadie regresaría.', '', 30706),
(166535, 'esMX', '¡La Horda tiene el control de Altos de Lor\'danel!', '¡La Horda tiene el control de Cantera Petroglacial!', 30706),
(166534, 'esMX', 'Esta es tu última oportunidad de alejarte, Telaamon. Podemos hallar a otros que ocupen tu puesto, yo mismo estoy dispuesto a hacerlo.', '', 30706),
(166533, 'esMX', 'Estoy listo. Ojalá pudiera echarle una última mirada a su hermoso mundo.', '', 30706),
(166532, 'esMX', 'Sí. ¿Todo listo para ir a Nazmir?', 'Sí. ¿Todo listo para ir a Nazmir?', 30706),
(166531, 'esMX', '$n. Halford y tú están aquí porque es momento de comenzar nuestra lucha contra la Horda, ¿verdad?', '', 30706),
(166530, 'esMX', '¡El ritual se está volviendo inestable! ¡Atrás!', '¡El ritual se está volviendo inestable! ¡Atrás!', 30706),
(166529, 'esMX', '¡Será mejor que la princesa Talanji se encargue rápido de eh\'to!', '¡Será mejor que la princesa Talanji se encargue rápido de eh\'to!', 30706),
(166528, 'esMX', '¿Quién eh\' esa Viuda Blanca de la que hablan?', '¿Quién eh\' esa Viuda Blanca de la que hablan?', 30706),
(166527, 'esMX', 'No puedo creer que eh\'to sea verdad...', 'No puedo creer que eh\'to sea verdad...', 30706),
(166526, 'esMX', '¡Hagan pagar a eh\'tos traidores!', '¡Hagan pagar a eh\'tos traidores!', 30706),
(166525, 'esMX', '¡¿Tenía que ser precisamente hoy?!', '¡¿Tenía que ser precisamente hoy?!', 30706),
(166524, 'esMX', 'Todo pasó tan rápido...', 'Todo pasó tan rápido...', 30706),
(166523, 'esMX', '¿Talanji eh\'tá a salvo?', '¿Talanji eh\'tá a salvo?', 30706),
(166522, 'esMX', '¡Empezaron a deh\'trozar el lugar de repente!', '¡Empezaron a deh\'trozar el lugar de repente!', 30706),
(166521, 'esMX', '¡La Viuda Blanca te envía sus saludo\'!', '¡La Viuda Blanca te envía sus saludo\'!', 30706),
(166520, 'esMX', '¡Mascota de Talanji! ¡La Viuda Blanca te acabará!', '¡Mascota de Talanji! ¡La Viuda Blanca te acabará!', 30706),
(166519, 'esMX', 'La Viuda Blanca dijo que vendrías. ¡No me callarán!', 'La Viuda Blanca dijo que vendrías. ¡No me callarán!', 30706),
(166518, 'esMX', '¡No me callarán! ¡La Viuda Blanca me ha concedido la voz!', '¡No me callarán! ¡La Viuda Blanca me ha concedido la voz!', 30706),
(166517, 'esMX', '¡Nos prometió una alternativa! ¡No me la arrebatarás!', '¡Nos prometió una alternativa! ¡No me la arrebatarás!', 30706),
(166516, 'esMX', '¡Por la Viuda Blanca!', '¡Por la Viuda Blanca!', 30706),
(166515, 'esMX', 'Me dejé persuadir por los susurro\' de la Viuda. Lo siento.', 'Me dejé persuadir por los susurro\' de la Viuda. Lo siento.', 30706),
(166514, 'esMX', 'No me hagas daño, por favor.', 'No me hagas daño, por favor.', 30706),
(166513, 'esMX', 'No quería ocasionar tantos problema\'. ¡Me dejé llevar por la locura!', 'No quería ocasionar tantos problema\'. ¡Me dejé llevar por la locura!', 30706),
(166512, 'esMX', '¿En qué eh\'taba pensando? Gracias.', '¿En qué eh\'taba pensando? Gracias.', 30706),
(166511, 'esMX', 'Lo siento... me dijo que era la única forma de hacer que las cosa\' cambiaran.', 'Lo siento... me dijo que era la única forma de hacer que las cosa\' cambiaran.', 30706),
(166510, 'esMX', 'Lo siento, no sabía qué hacer.', 'Lo siento, no sabía qué hacer.', 30706),
(166509, 'esMX', '<Atacar.>', '<Atacar.>', 30706),
(166508, 'esMX', 'No soy tu enemigo. Déjame ayudarte.', 'No soy tu enemiga. Déjame ayudarte.', 30706),
(166507, 'esMX', 'Detente o enfréntate a las consecuencias.', 'Detente o enfréntate a las consecuencias.', 30706),
(166506, 'esMX', '¡Talanji nos ha olvidado! ¡Debemo\' rebelarnos!\n\n¡La Viuda Blanca nos mostrará el camino!', '¡Talanji nos ha olvidado! ¡Debemo\' rebelarnos!\n\n¡La Viuda Blanca nos mostrará el camino!', 30706),
(166505, 'esMX', '<Da un pisotón con furia.>\n\n¡Zuldazar no le pertenece a la Horda!', '<Da un pisotón con furia.>\n\n¡Zuldazar no le pertenece a la Horda!', 30706),
(166504, 'esMX', '¡Ya no suplicaré por migaja\'!', '¡Ya no suplicaré por migaja\'!', 30706),
(166503, 'esMX', 'Dime, ¡¿qué ha hecho la Horda por mí?!', 'Dime, ¡¿qué ha hecho la Horda por mí?!', 30706),
(166502, 'esMX', '¡Eh\'toy harto de cargar caja\' para la Horda!', '¡Eh\'toy harta de cargar caja\' para la Horda!', 30706),
(166501, 'esMX', '¡Debemos expulsar a la Horda! ¡Las calle\' son del pueblo!\n\n¡Así lo dice la Viuda Blanca!', '¡Debemos expulsar a la Horda! ¡Las calle\' son del pueblo!\n\n¡Así lo dice la Viuda Blanca!', 30706),
(166500, 'esMX', '<Te observa con desprecio.>\n\n¿Qué quieres?', '<Te observa con desprecio.>\n\n¿Qué quieres?', 30706),
(166499, 'esMX', '¡Encantador! ¡Más fuego! Supongo que no guardan bienes inflamables en esas bóvedas.', '', 30706),
(166498, 'esMX', 'Concédeme la bendición de la Orden Brasal.', 'Concédeme la bendición de la Orden Brasal.', 30706),
(166497, 'esMX', '', '¿Sí?', 30706),
(166496, 'esMX', '', '¡Vamos! ¡Mostrémosles lo que tenemos!', 30706),
(166495, 'esMX', '', '¡Como $unuevo:nueva;! ¡Ahora ve a darles una paliza!', 30706),
(166494, 'esMX', '¡No me decepciones!', '', 30706),
(166493, 'esMX', '¡Ve a pulverizar esa cosa en mil pedazos!', '', 30706),
(166492, 'esMX', 'Repasemos el plan de ataque contra Zuldazar.', 'Repasemos el plan de ataque contra Zuldazar.', 30706),
(166491, 'esMX', 'Bien, estás aquí. Supongo que Halford te ha contado sobre nuestro plan de ataque a Zuldazar\n\nRepasemos los detalles. Tendrás un papel clave en todo esto.', '', 30706),
(166490, 'esMX', '', 'En este momento no puedo usar más sales.', 30706),
(166489, 'esMX', 'Bueno, ese sí es un problema mayor.', '', 30706),
(166488, 'esMX', 'Si estos corredores rodean el perímetro, estimo que Mekkatorque podría aprovechar la información.', '', 30706),
(166487, 'esMX', 'Ahora no puedo usar más sales.', '', 30706),
(166486, 'esMX', '¡Deja de hablar y ayúdanos a derribarlo, Céfiro!', '', 30706),
(166485, 'esMX', 'Creo que iremos por el camino largo.', '', 30706),
(166484, 'esMX', 'Debe haber un interruptor. $n, ¿ves alguno?', '', 30706),
(166483, 'esMX', '', 'En marcha.', 30706),
(166482, 'esMX', '', 'Se ha desatado una revuelta en el Zócalo. Debemos actuar rápido.', 30706),
(166481, 'esMX', '', 'Yo protegeré a Talanji. Haz lo que tengas que hacer para terminar con eh\'to.', 30706),
(166480, 'esMX', '¿Dar 10 salmueritas?', '¿Dar 10 salmueritas?', 30706),
(166479, 'esMX', 'Tengo más sales para ti.', 'Tengo más sales para ti.', 30706),
(166478, 'esMX', '', 'Que no se te caiga, ¿entendiste? Mekkatorque se enfadará si sufre algún tipo de daño.', 30706),
(166474, 'esMX', '', 'Deja que hablen, Erata. Son libre\' de expresar su desacuerdo.', 30706),
(166473, 'esMX', 'Maldita... sea...', 'Maldita... sea...', 30706),
(166472, 'esMX', '', 'Debemos enseñarle modales a eh\'ta basura, su alteza.', 30706),
(166471, 'esMX', '¡Aléjense de mis cañones!', '¡Aléjense de mis cañones!', 30706),
(166470, 'esMX', 'Tus hermosas tierras están en ruinas. ¡Todo lo que amas está muriendo!', '', 30706),
(166469, 'esMX', '¡Y juro que asesinaremo\' a cada miembro de la Alianza que se atreva a atacarnos!', '', 30706),
(166468, 'esMX', 'Zuldazar no caerá ante la Alianza. ¡Somo\' fuertes y estamos unidos!', '', 30706),
(166467, 'esMX', 'Si la Alianza se las ingenia para deh\'truir la flota, el muelle quedará sin defensas. ¡Invadirán la ciudad!', '', 30706),
(166466, 'esMX', 'Esas explosione\' que oí... ¡Debía ser la flota zandalari!', '', 30706),
(166465, 'esMX', 'No puedo creer eh\'to, ¡la Alianza nos engañó! Sacrificaron a todos esos soldado\' para alejarno\' de la ciudad.', '', 30706),
(166464, 'esMX', '¡El poder de la Alianza conquistará Zuldazar!', '¡El poder de la Alianza conquistará Zuldazar!', 30706),
(166463, 'esMX', '¡El imperio de Zuldazar caerá ante la Alianza!', '¡El imperio de Zuldazar caerá ante la Alianza!', 30706),
(166462, 'esMX', '¡Avanzaremos hasta conquistar Zuldazar!', '¡Avanzaremos hasta conquistar Zuldazar!', 30706),
(166461, 'esMX', '¡Los aliados de la Horda serán castigados!', '¡Los aliados de la Horda serán castigados!', 30706),
(166460, 'esMX', '¡Zuldazar pagará por apoyar a la Horda!', '¡Zuldazar pagará por apoyar a la Horda!', 30706),
(166459, 'esMX', '¡Zuldazar caerá ante la Alianza!', '¡Zuldazar caerá ante la Alianza!', 30706),
(166455, 'esMX', 'Hasta aquí llegan tus esfuerzos.', '', 30706),
(166454, 'esMX', '¡|cFFEF0201La Horda|r comenzó a explotar una ruptura de azerita!', '¡|cFFEF0201La Horda|r comenzó a explotar una ruptura de azerita!', 30706),
(166453, 'esMX', '¡|cFF0EA6DCLa Alianza|r comenzó a explotar una ruptura de azerita!', '¡|cFF0EA6DCLa Alianza|r comenzó a explotar una ruptura de azerita!', 30706),
(166452, 'esMX', '%s se baña en una reposición nutritiva que permite que se recupere y vuelva a echar raíces en lo profundo de la tierra.', '', 30706),
(166451, 'esMX', '¡Estoy en eso!', '', 30706),
(166450, 'esMX', '', 'Buena puntería. Morton, llama a los girocópteros.', 30706),
(166449, 'esMX', '', 'Debes hacer justicia.', 30706),
(166448, 'esMX', '', 'Te diré lo que vi.', 30706),
(166447, 'esMX', '', 'Siento que nos eh\'peran días oscuros.', 30706),
(166446, 'esMX', '', 'Que los loa bendigan a nueh\'tra princesa.', 30706),
(166445, 'esMX', 'Admiro tu valor.', '', 30706),
(166444, 'esMX', 'Te diré lo que sé.', '', 30706),
(166443, 'esMX', 'Quiero ir al Crisol de Tormentas.', 'Quiero ir al Crisol de Tormentas.', 30706),
(166442, 'esMX', 'Vale la pena luchar por la Alianza.', '', 30706),
(166441, 'esMX', 'Quiero ir a la Batalla de Dazar\'alor (Banda).', 'Quiero ir a la Batalla de Dazar\'alor (Banda).', 30706),
(166440, 'esMX', 'La victoria tiene su precio.', '', 30706),
(166438, 'esMX', '¿Qué ha pasado? ¿Por qué se va el ejército? ¡Tengo un ejército entero de pterrordáctilo\' en camino!', '', 30706),
(166437, 'esMX', 'Quiero teletransportarme hasta Jaina.', 'Quiero teletransportarme hasta Jaina.', 30706),
(166436, 'esMX', 'Quiero teletransportarme hasta el Consejo de los sacerdotes marinos.', 'Quiero teletransportarme hasta el Consejo de los sacerdotes marinos.', 30706),
(166435, 'esMX', '', '¿Qué? No hay flota... ni ejército. ¿Qué eh\'tá pasando aquí?', 30706),
(166434, 'esMX', '', 'Cuando se disipe la niebla, liberaré mi poder sobre la flota de la Alianza hasta que llegue nueh\'tro apoyo.', 30706),
(166433, 'esMX', '', 'Entonces usaremos el artefacto en su contra. Limita tanto nueh\'tra visión como la de ellos.', 30706),
(166432, 'esMX', '', 'Me acaban de informar que la tesorería ha sido saqueada. La Alianza debe haber robado el artefacto.', 30706),
(166431, 'esMX', '', '¿Cómo puede ser? Se lo dieron a mi padre y lo guardaron en la tesorería.', 30706),
(166430, 'esMX', '', 'Princesa Talanji, la fuente de eh\'ta niebla es el artefacto que $uel adalid:la adalid; de la Horda robó a los kultirano\'.', 30706),
(166429, 'esMX', 'Zandalar es nueh\'tra... ¡PARA SIEMPRE!', '', 30706),
(166428, 'esMX', '¡Que las calles se inunden con la sangre de eh\'tos forasteros!', '', 30706),
(166427, 'esMX', '¡Levántense, caídos!', '', 30706),
(166426, 'esMX', 'Hmmm.', '', 30706),
(166425, 'esMX', 'Ayúdanos... O te convertirás en el loa de un reino deh\'truido y nadie recordará tu nombre.', '', 30706),
(166424, 'esMX', 'Oh, vaya, vaya... ¿Acaso el poderoso Rastakhan necesita la ayuda del viejo Bwonsamdi otra vez?', '', 30706),
(166423, 'esMX', '¡Bwonsamdi!', '', 30706),
(166422, 'esMX', 'RTC PLAYS HERE', 'RTC PLAYS HERE', 30706),
(166421, 'esMX', 'Tengo el cetro falso aquí. Creo que tú deberías hacer los honores. Flynn y yo te cubriremos esta vez.', '', 30706),
(166420, 'esMX', '<Toma el cetro falso para hacer el cambio.>', '<Toma el cetro falso para hacer el cambio.>', 30706),
(166419, 'esMX', '¡Ey! Tengo que emparchar esta cosa. ¿Me ayudas? \n\nSi me traes unas sales de las criaturas cercanas podremos dejarla como nueva.', '', 30706),
(166417, 'esMX', '... Creo que prefiero caminar.', '', 30706),
(166416, 'esMX', 'Montaremos los viento\' para salir de aquí.', '', 30706),
(166415, 'esMX', 'Tengo las sales.', 'Tengo las sales.', 30706),
(166414, 'esMX', '¿Podrías enviarme a Gnomeregan?', '¿Podrías enviarme a Gnomeregan?', 30706),
(166413, 'esMX', '', '¡Hola! ¿Podrías recolectar unas sales de las criaturas cercanas para mí mientras yo trabajo en estas reparaciones? \n\n¡Tendremos las baterías de este grandote cargadas en un abrir y cerrar de ojos!', 30706),
(166410, 'esMX', 'A sus posiciones. Cuando $p dé la señal, atacaremo\' a eh\'te Telaamon.', '', 30706),
(166409, 'esMX', '', 'Apresúrate, $uforastero:forastera;.', 30706),
(166408, 'esMX', '', 'Ya deberían estar aquí.', 30706),
(166407, 'esMX', '', 'Tranquila, Sef. Esperaste casi tres milenios por este día, unas horas más no es mucho pedir.', 30706),
(166406, 'esMX', '¡Bien, andando!', '', 30706),
(166405, 'esMX', 'Se acabó. Hora de informar a Talanji que podemo\' seguir con nuestro plan de deh\'truir a la flota y la fuente de eh\'ta niebla.', '', 30706),
(166404, 'esMX', 'He... cumplido... mi promesa. Ahora... descansaré.', '', 30706),
(166402, 'esMX', '', 'No te preocupes, amiga. Tu venganza se llevará a cabo en cuanto tenga mi cuerpo nuevo. Ay, ¿por qué no llegaron aún?', 30706),
(166401, 'esMX', 'No me dejan otra opción, ¡liberaré el poder de la Luz y limpiaré su corrupción de este mundo!', '', 30706),
(166400, 'esMX', '', '¡SE ACABÓ! Invades mi tierra, asesinas a mi pueblo, ¡¿y ahora profanas la última morada de un loa?!', 30706),
(166399, 'esMX', 'Urgh... $p, ¡aquí! Acaba con eh\'te, ¡depende de ti!', '', 30706),
(166398, 'esMX', 'La Luz está de mi lado, ¡este lugar maldito será tu tumba!', '', 30706),
(166397, 'esMX', 'Cuéntame tus planes.', 'Cuéntame tus planes.', 30706),
(166396, 'esMX', 'He combatido contra la Legión Ardiente durante miles de años, ¡la Horda no tiene ninguna oportunidad contra mi espada!', '', 30706),
(166393, 'esMX', 'Detendremo\' a la Alianza aquí.', '', 30706),
(166392, 'esMX', '', '¡Nueh\'tro valiente rey haría cualquier cosa para salvar Zandalar! Incluso convocar al loa de la muerte.', 30706),
(166391, 'esMX', '', '¡Los mejores guardia\' del rey no pudieron hacer nada contra la brutalidad de la Alianza!', 30706),
(166390, 'esMX', '¡Por Grong!', '', 30706),
(166389, 'esMX', 'Tu sacrificio no será olvidado.', '', 30706),
(166388, 'esMX', 'Que así sea. Héroes de la Alianza... ¡Derríbenlo! ¡No tengan piedad por este salvaje!', '', 30706),
(166385, 'esMX', 'Rey Rastakhan de Zandalar... ¡Te ordeno que te rindas! ¡Te inclinarás ante tu nuevo señor, el rey Anduin Wrynn, y entregarás a tu hija como rehén!', '', 30706),
(166383, 'esMX', '', 'Los descorazonado\' de la Alianza asaltaron la sala del trono. ¡Nueh\'tro noble rey los desafió hasta el final!', 30706),
(166382, 'esMX', '', 'Los monstruo\' de la Alianza cayeron sobre su presa como depredadores hambrientos.', 30706),
(166381, 'esMX', '', 'Los campeones de nuestro\' loa resistieron con valentía.', 30706),
(166380, 'esMX', '', 'La desalmada Alianza profanó nueh\'tro lugar sagrado. ¡Se burlaron de los loa! ¡Solo querían sangre y oro!', 30706),
(166379, 'esMX', '', 'Sin importarles nuestra historia y nuestra\' tradiciones, esos invasore\' saquearon nuestra\' reliquias más preciosas.', 30706),
(166378, 'esMX', '', 'El príncipe mercante tenía razón.', 30706),
(166377, 'esMX', 'Voy a adelantarme para ver si encuentro a eh\'te Telaamon. Búh\'came cuando hayas terminado de pelear contra la Alianza, $n.', '', 30706),
(166376, 'esMX', '', 'Uno de los héroe\' de la Horda, el príncipe mercante, intentó engañar a la Alianza para que emprendiera la retirada.', 30706),
(166375, 'esMX', '', '¡Pero los zandalari vigilamo\' bien nuestro\' tesoros!', 30706),
(166374, 'esMX', '', 'No lo sabíamos, pero esos espía\' de la Alianza deben haberse colado en el templo antes.', 30706),
(166372, 'esMX', '', 'Dazar\'alor ha resistido por mile\' de años. ¡La Alianza hizo un agujero en un costado de la pirámide y saqueó nuestro\' tesoros ancestrales!', 30706),
(166370, 'esMX', 'La kaja\'mita es mineral. \n\nMineral especial sabe a inteligente.', '', 30706),
(166369, 'esMX', 'Grong hace lo necesario. \n\nGrong hace lo mejor.', '', 30706),
(166368, 'esMX', '¡Eres libre!', '', 30706),
(166365, 'esMX', 'Ve a la gruta. Allí estarás a salvo.', '', 30706),
(166364, 'esMX', 'Sé libre, amigo mío.', '', 30706),
(166363, 'esMX', 'Cuando tenga un tamaño colosal, la Horda lo pensará dos veces antes de atacar a los Da\'kani.', '', 30706),
(166362, 'esMX', 'Este es un recordatorio de por qué tengo que ayudar a la Alianza.', '', 30706),
(166361, 'esMX', 'Matar a los Da\'kani tiene graves consecuencias.', '', 30706),
(166360, 'esMX', 'Si nos sentimos culpables, recordemos que estos furtivos atacaron primero.', '', 30706),
(166359, 'esMX', 'Matamos por necesidad, no por codicia.', '', 30706),
(166358, 'esMX', 'Matar o morir. Es una existencia salvaje.', '', 30706),
(166357, 'esMX', '¡Gnomos sucios! Esos infelices diminutos se interponen entre nosotros y Valiente. ¡Masácrenlos!', '', 30706),
(166356, 'esMX', 'Dejemos el jardín de Clayton y el hecho de que ya no tenemos casa para después, tenemos que ir a ocuparnos de la Alianza.', '', 30706),
(166355, 'esMX', 'Los odio a todos desde lo más profundo de mi corazón podrido.', '', 30706),
(166354, 'esMX', '¡Jajaja!', '¡Jajaja!', 30706),
(166353, 'esMX', 'Me llamo Clayton, estoy triste porque perdí mi jardincito en Entrañas, ¡buaa buaa buaa!', '', 30706),
(166352, 'esMX', '¿De qué hablas?', '', 30706),
(166351, 'esMX', '', 'Ay, genial, otra vez con Entrañas...', 30706),
(166350, 'esMX', 'No habría estado mal, ya que el que tenía en Entrañas quedó destruido.', '', 30706),
(166349, 'esMX', '', '¡Somos Renegados! ¿Qué vas a hacer, dormir la siesta y cuidar el jardín?', 30706),
(166348, 'esMX', 'Francamente, preferiría parar y descansar un poco.', '', 30706),
(166347, 'esMX', 'No me quejo, cualquier oportunidad de destripar a la Alianza es buena para mí.', '', 30706),
(166346, 'esMX', 'Sí, bueno, los planes cambian. Órdenes de arriba y esas cosas.', '', 30706),
(166345, 'esMX', '', 'Y si mal no recuerdo, YA HEMOS TERMINADO nuestra tarea.', 30706),
(166344, 'esMX', 'Jefe, pensé que teníamos que salir de aquí después de terminar nuestra tarea.', '', 30706),
(166343, 'esMX', '', '¡JejeJAJA! ¡Por fin puedo usar mi magia de las sombras sobre objetivos reales!', 30706),
(166342, 'esMX', 'Quiero teletransportarme hasta Mekkatorque.', 'Quiero teletransportarme hasta Mekkatorque.', 30706),
(166341, 'esMX', 'Les prometo una cosa... antes de que termine el día reviviré a ese miserable entrometido como Renegado. Héroes, ¡derriben a esa bestia!', '', 30706),
(166340, 'esMX', '¡No tienen la menor oportunidad de superar la innovación gnómica! Les aconsejo que se rindan... O vayan a juntar un montón de bananas.', '', 30706),
(166339, 'esMX', 'Monten estas bestias y persigan a la Alianza. ¡No deben salir de aquí con vida!', '', 30706),
(166338, 'esMX', '', 'No te preocupes, Genn. Tenemos una sorpresa que mantendrá ocupados a nuestros perseguidores. ¡Andando!', 30706),
(166337, 'esMX', '¡Jaina! Los hemos derrotado. No hace falta que...', '', 30706),
(166336, 'esMX', '', '¡Todas las naves, emprendan el regreso a casa! Mekkatorque y yo los cubriremos.', 30706),
(166335, 'esMX', '¡Les mostraremos a esos salvajes el poderío de Kul Tiras!', '', 30706),
(166334, 'esMX', '', '¡El ritual ya está en marcha, Lady almirante!', 30706),
(166333, 'esMX', '', 'Buena pelea, héroes. La nave está lista para partir.', 30706),
(166332, 'esMX', '', 'Déjenme ayudar a despejar el camino.', 30706),
(166329, 'esMX', 'En guardia, campeones. Siento... una oscuridad cada vez mayor.', '', 30706),
(166328, 'esMX', '', 'Bien, $n, avísame cuando estés $ulisto:lista;.', 30706),
(166327, 'esMX', '¡Yo vigilar puerta!', '', 30706),
(166326, 'esMX', 'Los campeones de la Horda se embarcaron en la nave zandalari y nos persiguieron.', '', 30706),
(166325, 'esMX', 'Fue entonces cuando la princesa trol regresó... con sangre en los ojos.', '', 30706),
(166324, 'esMX', 'Los sacerdotes marinos hicieron su trabajo. ¡Fue algo digno de ver!', '', 30706),
(166323, 'esMX', 'Las tropas de la Horda fueron implacables... despiadadas. ¡Pero nuestras fuerzas kultiranas no se rendían!', '', 30706),
(166319, 'esMX', 'La Séptima Legión luchó con valor para traernos hasta aquí.', '', 30706),
(166318, 'esMX', '¡Suficiente! Ha caído un héroe de la Alianza. Pero quiero ver sus hojas bañadas en sangre de Valiente. ¡Vamos!', '', 30706),
(166317, 'esMX', '¿Pero qué...? Okey, quiero saber dos cosas... Primero, ¿cómo pudieron dejar que ese pelele se escapara? Y segundo... ¿POR QUÉ NO TENGO UNA CÁPSULA DE ESCAPE?', '', 30706),
(166316, 'esMX', 'El manitas mayor peleó con valor. Pero al final... no alcanzó. Gracias a las mareas tenía un último truco bajo la manga y sobrevivió.', '', 30706),
(166312, 'esMX', 'Él nos ayudó desde las alturas mientras las tropas de gnomos nos ayudaban desde tierra... Hasta que apareció Gallywix.', '', 30706),
(166311, 'esMX', 'La Horda esperaba encerrarnos entre los adalides y las fuerzas que esperaban en los muelles. ¡Pero no contaban con el manitas mayor!', '', 30706),
(166310, 'esMX', 'Como saben, la Horda llegó demasiado tarde para salvar al rey Rastakhan. Mientras la princesa trol lloraba a su padre, fue Clamañublo quien reunió a las fuerzas.', '', 30706),
(166309, 'esMX', 'Haré lo posible para contarles lo que sucedió. Todo comenzó cuando vieron caer a su rey...', '', 30706),
(166308, 'esMX', 'Campeones, hablen con el sobreviviente. Quiero detalles sobre lo que ocurrió ahí.', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(166307, 'esMX', 'El gran almirante luchó con valor, y también el manitas mayor. Pero la Horda atacó con tanta rabia... ¡tanta furia!', '', 30706),
(166306, 'esMX', 'Tenemos un testigo que sobrevivió a la batalla, mi rey.', '', 30706),
(166305, 'esMX', '¡Ja, así es como se hace! Iré a ver si Rokhan necesita mi ayuda.', '', 30706),
(166304, 'esMX', 'El ataque a Zuldazar fue un éxito, pero la Horda nos alcanzó en la retirada.', '', 30706),
(166303, 'esMX', 'Jaina está gravemente herida... Mekkatorque está al borde de la muerte... ¿Qué hicimos mal, Genn?', '', 30706),
(166302, 'esMX', '¡Todos a las naves!', '', 30706),
(166301, 'esMX', 'Podemos saborear la victoria en Boralus. Es hora de sacar a nuestra gente de aquí.', '', 30706),
(166300, 'esMX', 'Rastakhan selló su destino cuando se alió con la Horda.', '', 30706),
(166299, 'esMX', 'Me alegra volver a verte, $p. ¡Iré a ver si alguien necesita ayuda!', '', 30706),
(166298, 'esMX', 'Ni lo sueñes, goblin. Héroes, ya saben qué hacer.', '', 30706),
(166297, 'esMX', 'Su elección de aliados no me sorprende. Los zandalari merecen su destino.', '', 30706),
(166296, 'esMX', 'Parece que la Reina alma en pena no es la única con necrófagos en su arsenal.', '', 30706),
(166295, 'esMX', 'Aun así... Han hecho sangrar a la Alianza. Recuperen fuerzas, héroes. Tendremos que seguir luchando.', '', 30706),
(166294, 'esMX', 'La señorita Valiente logró escapar con su miserable vida. Esto no complacerá a la jefa de guerra.', '', 30706),
(166293, 'esMX', 'Dejen a la princesa con su pesar, campeone\'. Sin duda, eh\'tará agradecida de que busquen vengar a Rastakhan.', '', 30706),
(166292, 'esMX', '', '¡Así será, princesa! ¡Héroes, todos a bordo!', 30706),
(166291, 'esMX', '', '¡Capitana, llévese a estos campeone\' de la Horda y persiga a los asesinos! ¡Quiero la cabeza de Jaina Valiente!', 30706),
(166290, 'esMX', '', 'La Alianza invadió nueh\'tra ciudad y mató a nueh\'tro rey. Los herido\' necesitan mi ayuda.', 30706),
(166289, 'esMX', '', '¡Timonel, vamos a lo\' muelles! Por lo\' loa... ¿Qué ha pasado aquí?', 30706),
(166288, 'esMX', '', '¡No! ¡Esos carniceros se eh\'tán escapando!', 30706),
(166287, 'esMX', '¡Princesa Talanji! ¡La Alianza usa el mojo de sus sacerdote\' marinos contra nosotro\'!', '', 30706),
(166286, 'esMX', 'No me importa lo que sea esa monstruosidad. ¡Derríbenla, campeones!', '', 30706),
(166285, 'esMX', '¡El mojo que prepararon esos sacerdotes marino\' es muy poderoso! ¡Invocaron algo horrible!', '', 30706),
(166284, 'esMX', 'Esos invasores de la Alianza sufrirán por sus crímenes. ¡No los dejen escapar!', '', 30706),
(166283, 'esMX', '¡Ya oyeron a la princesa!', '', 30706),
(166282, 'esMX', '', 'Ya saben el reh\'to. El rey Rastakhan fue un héroe para su pueblo. ¡Haría cualquier cosa para vengarlo!', 30706),
(166281, 'esMX', '', 'Te diré todo lo que sé. Todo eh\'to empezó cuando la Alianza llegó a la pirámide...', 30706),
(166280, 'esMX', '¡Contrólate! Estos campeones de la Horda vengarán a tu rey. Debes darles toda la información que puedas.', '', 30706),
(166279, 'esMX', '', '¡Esos monstruo\' de la Alianza! Ellos...', 30706),
(166278, 'esMX', '¡Tú! Dinos qué pasó aquí. ¡Ahora!', '', 30706),
(166277, 'esMX', 'Oh... no...', '', 30706),
(166276, 'esMX', '¡Tenemo\' que encontrar a Rastakhan y Talanji!', '', 30706),
(166275, 'esMX', '¡No dejen que los detengan ahora, héroes!', '', 30706),
(166274, 'esMX', '¡Tropas, andando! ¡Detengan el avance de la Horda!', '', 30706),
(166273, 'esMX', '¡Campeones! Encuentren una forma de bordear esos muros de hielo... ¡o atravesarlos!', '', 30706),
(166272, 'esMX', '', 'Vaya, Clamañublo... Nunca recibiste un sepulcro digno. Creo que por fin te ha llegado el momento.', 30706),
(166271, 'esMX', 'Valiente... ¡Cómo disfrutaré verte caer!', '', 30706),
(166270, 'esMX', '', '¡Deténganse! ¡No se acercarán un paso más!', 30706),
(166269, 'esMX', 'He visto otros más poderosos. ¡Vamos!', '', 30706),
(166268, 'esMX', '¡El loa de la muerte e\' muy poderoso!', '', 30706),
(166267, 'esMX', '¡No seas perezoso, colega simio! ¡Levántate y demuéh\'trales a esos invasore\' por qué no deberían meterse con el viejo Bwonsamdi!', '', 30706),
(166266, 'esMX', 'Ohhhhhhh, ¿qué tenemo\' aquí? Eh\'te grandote podría sernos útil, ¿eh?', '', 30706),
(166265, 'esMX', 'Campeones, tienen que ocuparse de esa distracción gigante. Rokhan, conmigo. ¡Debemos resistir!', '', 30706),
(166264, 'esMX', '¡Para demostrar nuestras capacidades, hemos preparado una pequeña... o debería decir... una GRAN sorpresa para ustedes!', '', 30706),
(166263, 'esMX', '¡Atención, brutos de la Horda! ¡Esta pirámide primitiva ahora es propiedad de la Alianza!', '', 30706),
(166262, 'esMX', '¡Por todos los loa! ¡¿Qué es esa cosa?!', '', 30706),
(166261, 'esMX', 'Ya la oyeron. ¡Sigan avanzando!', '', 30706),
(166260, 'esMX', '', 'Tengo que acudir a su lado de inmediato. Campeone\' de la Horda, ¡apresúrense, por favor!', 30706),
(166259, 'esMX', '', '¡El poder de Bwonsamdi inunda la ciudad! Mi padre no invocaría eh\'te ritual si el pronóstico no fuera nefasto.', 30706),
(166258, 'esMX', '¡Toma eso! ¡Buen trabajo, campeone\'!', '', 30706),
(166257, 'esMX', '¡Haremo\' todo lo posible, princesa! ¡Comenzaremo\' por quitar a estos Hierro Negro del camino!', '', 30706),
(166256, 'esMX', '', '¡Tenemo\' que alcanzar la pirámide ante\' que ellos! Mi padre está defendiéndola junto a un puñado de guardias.', 30706),
(166255, 'esMX', 'Las fuerzas de la Alianza están desembarcando en el puerto. Se expanden por Zuldazar como una plaga.', '', 30706),
(166254, 'esMX', 'Es indudable que la Horda querrá represalias por sus pérdidas. Tenemos que prepararnos para lo que viene.', '', 30706),
(166253, 'esMX', 'Campeones, gracias por todo lo que han hecho hoy. Ninguna recompensa será suficiente.', '', 30706),
(166252, 'esMX', 'Gracias, soldado. Me ocuparé de que sanen las heridas de la Lady almirante.', '', 30706),
(166251, 'esMX', 'Y así fue. ¡Lady Valiente es la heroína más intrépida que he visto!', '', 30706),
(166250, 'esMX', 'Cuando parecía que la Horda iba a ganar, ¡la Lady Almirante dio vuelta las cosas!', '', 30706),
(166249, 'esMX', '¡La Lady Almirante Valiente fue muy galante! Le dio a la Horda todas las oportunidades de retirarse.', '', 30706),
(166248, 'esMX', '', 'Creo que por ahora es suficiente. Trae a Grong a casa, $p.', 30706),
(166247, 'esMX', '¡Qué bestia magnífica!', '', 30706),
(166246, 'esMX', '', '¡Resistan! Hagan lo que sea necesario.', 30706),
(166245, 'esMX', '¡Resistan! Nuestros aliados harán su trabajo.', '', 30706),
(166244, 'esMX', '¡Alto! Los ancianos necesitan nuestra ayuda.', '', 30706),
(166243, 'esMX', '', '¡Resistan! ¡Los ancianos necesitan nuestra ayuda!', 30706),
(166242, 'esMX', '', 'No hay tiempo que perder. Bashal\'Aran espera.', 30706),
(166241, 'esMX', 'Uno menos. Aliados, ¡conmigo!', '', 30706),
(166240, 'esMX', '¡Rápido! Debemos avanzar.', '', 30706),
(166239, 'esMX', '', 'Por aquí. Los refuerzos asegurarán el área.', 30706),
(166238, 'esMX', 'El campo de batalla espera. ¡Por aquí!', '', 30706),
(166237, 'esMX', '¡Ha llegado la hora de recuperar nuestra tierra!', '', 30706),
(166236, 'esMX', '', '¡La batalla espera!', 30706),
(166235, 'esMX', '', '¡A la batalla!', 30706),
(166234, 'esMX', '', '¡Ah, qué bien, te despertaste! Lamento lo que pasó...', 30706),
(166232, 'esMX', '', 'Umbric, necesitamos un portal, ¡pronto!', 30706),
(166231, 'esMX', '¡Abortar! ¡Abortar! ¡Está fuera de control!', '', 30706),
(166230, 'esMX', '|TInterface\\Icons\\INV_Plate_RaidDeathKnightMythic_O_01Helm.blp:20|t¡Se ha invocado un |cFFFF0000|Hspell:282526|h[Espectro mortal]|h|r!', '', 30706),
(166227, 'esMX', '|TInterface\\Icons\\Ability_Mage_GreaterPyroblast.blp:20|t¡%s se prepara para lanzar una |cFFFF0000|Hspell:286379|h[Piroexplosión]|h|r!', '|TInterface\\Icons\\Ability_Mage_GreaterPyroblast.blp:20|t¡%s se prepara para lanzar una |cFFFF0000|Hspell:286379|h[Piroexplosión]|h|r!', 30706),
(166226, 'esMX', 'Recibimo\' nuevas lecturas de azerita en el detector. ¡Revísenlo!', '', 30706),
(166224, 'esMX', 'Hay un montón de azerita en un nuevo lugar en eh\'ta isla. ¡Pero cuídense las espalda\'! La Alianza también lo encontró.', '', 30706),
(166223, 'esMX', 'Parece que hay mucha azerita concentrada en un solo sitio. Sugiero que lleguemos allí primero.', '', 30706),
(166222, 'esMX', 'El detector de azerita está fuera de control. ¡Ese es el sonido de la oportunidad! Aprovechémosla.', '', 30706),
(166220, 'esMX', 'Los extractore\' de azerita están listos. Díganme dónde enviarlos. ¡Pero cuidado! Los de la Alianza los verán llegar.', '', 30706),
(166217, 'esMX', '¡Nuestro detector reporta montone\' de azerita! Deh\'plieguen los extractores antes que la Alianza.', '', 30706),
(166213, 'esMX', 'Una sola... bomba... más...', 'Una sola... bomba... más...', 30706),
(166212, 'esMX', '¡El bombardeo no se detiene por nadie!', '', 30706),
(166211, 'esMX', 'Bien, nuestros extractores de azerita ya están listos. ¿Quieren sacarlos de paseo? He marcado los lugares ideales en el mapa.', '', 30706),
(166210, 'esMX', 'Hemos encontrado algunos sitios óptimos para extraer azerita. Pero debemos ser rápidos. Seguramente la Horda también los encontró.', '', 30706),
(166209, 'esMX', '', 'Tus acciones han salvado miles de vidas. Gracias.', 30706),
(166208, 'esMX', '', 'Otro enemigo destruido. Costa Oscura está eternamente agradecida.', 30706),
(166207, 'esMX', '', 'La amenaza ya no existe. Peleaste bien, adalid.', 30706),
(166206, 'esMX', '', 'Nuestras centinelas han identificado una nueva amenaza en el área. ¡Elimínala antes de que ataque a nuestras fuerzas!', 30706),
(166205, 'esMX', '', 'Han detectado un adversario poderoso cerca. ¡No hay tiempo que perder, adalid!', 30706),
(166204, 'esMX', '', 'Este enemigo es una gran amenaza para los habitantes de Costa Oscura. ¡Hay que derribarlo!', 30706),
(166203, 'esMX', '', 'Has hecho lo que podías. Esperemos que tus esfuerzos sirvan para devolver el equilibrio a esta tierra.', 30706),
(166202, 'esMX', '', 'Sin nuestros druidas para cuidar a las criaturas de Costa Oscura, la corrupción se ha propagado sin control. Debemos detenerla antes de que sea demasiado tarde.', 30706),
(166201, 'esMX', '', 'Una medida necesaria, aunque lamentable. Gracias por llevarla a cabo.', 30706),
(166200, 'esMX', '', 'Las atrocidades de la Horda han enloquecido a nuestros espíritus ancestrales. Ayúdalos a encontrar la paz.', 30706),
(166199, 'esMX', '', 'Los cultistas están derrotados y se han dispersado. Si saben lo que les conviene, permanecerán así.', 30706),
(166198, 'esMX', '', 'Los Martillo Crepuscular que quedan han salido de su escondite. No sé qué planean, pero hay que detenerlos.', 30706),
(166197, 'esMX', '', 'Esas alimañas repugnantes son una desgracia para Costa Oscura. Nadie los extrañará.', 30706),
(166196, 'esMX', '', 'Los múrlocs siguen contaminando nuestras tierras y molestan a nuestro pueblo. Extermínalos.', 30706),
(166195, 'esMX', '', 'Hemos detenido la avanzada de los naga, por ahora. Debemos estar atentos.', 30706),
(166194, 'esMX', '', 'Los invasores naga se aprovechan del conflicto en Costa Oscura. Expúlsalos a las profundidades donde pertenecen.', 30706),
(166193, 'esMX', '', 'Bien hecho. ¡Que cada muerte de la Horda sea un mensaje para la Reina alma en pena!', 30706),
(166192, 'esMX', '', 'Nuestra victoria no estará completa hasta que purguemos a la Horda de Costa Oscura. ¡Mátenlos a todos!', 30706),
(166191, 'esMX', 'Bien hecho. ¡Deberían aprender a no meterse con $Uun:una; adalid de la Dama Oscura!', '', 30706),
(166190, 'esMX', '¡Otra victoria para la Horda!', '', 30706),
(166189, 'esMX', '¡Llamen a la val\'kyr! Este será un buen aliado...', '', 30706),
(166188, 'esMX', 'Hay un enemigo peligroso al acecho. No tengas piedad.', '', 30706),
(166187, 'esMX', 'Nuestros exploradores han detectado una amenaza poderosa cerca. Elimínala.', '', 30706),
(166186, 'esMX', 'Se ha avistado un oponente formidable en las cercanías. ¿Quieres probar tu valía?', '', 30706),
(166185, 'esMX', 'Estos trols son demasiado resistentes, pero los tenemos en retirada. No aguantarán mucho más.', '', 30706),
(166184, 'esMX', 'Estos trols secacorteza son los últimos resabios de una tribu condenada. Los ejércitos de la Dama Oscura los expulsaron de las Tierras del Interior. Terminemos con ese trabajo.', '', 30706),
(166183, 'esMX', 'Hemos derrotado a la Hermandad. Enviaré a la guardia de la muerte a encargarse de los rezagados.', '', 30706),
(166182, 'esMX', 'Esos rufianes de la Hermandad creen que tienen derechos sobre este territorio. Que sepan que estas tierras le pertenecen a la Horda.', '', 30706),
(166181, 'esMX', 'Eso debería mantenerlos a raya hasta que encontremos una solución más permanente.', '', 30706),
(166180, 'esMX', 'La magia que mantiene controlados a estos elementales se debilita. Destrúyelos antes de que se conviertan en un problema.', '', 30706),
(166179, 'esMX', 'Ahora que nos deshicimos de las alimañas podemos seguir trabajando. Mmm... ¡Son simples velas!', '', 30706),
(166178, 'esMX', 'Estos kóbolds asquerosos obstaculizan nuestras operaciones de minería. Deshazte de ellos. Ah, y llévate sus velas, ¿quieres? Me intriga saber por qué las protegen tanto.', '', 30706),
(166177, 'esMX', 'Siempre dije que la mejor forma de llegar a un cabeza dura es con una buena hacha. Creo que tu mensaje quedó muy claro.', '', 30706),
(166176, 'esMX', 'Estos brutos enormes no se dan cuenta de que ya no son bienvenidos en Arathi. Asegúrate de que lo comprendan.', '', 30706),
(166175, 'esMX', 'Excelente. Sus cadáveres serán buena carne de cañón en las próximas batallas.', '', 30706),
(166174, 'esMX', 'Parece que algunas fuerzas de la Alianza se niegan a morir como buenos soldaditos. Ayudémoslos un poco.', '', 30706),
(166173, 'esMX', 'Ese será el destino de todos los enemigos de la Horda.', '', 30706),
(166172, 'esMX', '¡Buen golpe! ¡La Horda vuelve a triunfar!', '', 30706),
(166171, 'esMX', 'Un cuerpo más para el ejército de la Dama Oscura.', '', 30706),
(166170, 'esMX', 'Hemos divisado un adversario poderoso cerca. ¡Derríbalo!', '', 30706),
(166169, 'esMX', 'Este enemigo piensa que puede resistir contra la Horda. Demuéstrale que se equivoca.', '', 30706),
(166168, 'esMX', '¡Surge una amenaza nueva! ¡No tengas piedad!', '', 30706),
(166167, 'esMX', '', '¡No! Esto... Esto no era...', 30706),
(166166, 'esMX', 'Un enemigo sin aliados es un enemigo doblegado. Bien hecho.', '', 30706),
(166165, 'esMX', 'Los elfos de la noche veneran a las criaturas de este lugar como espíritus afines. Esa debe ser motivación más que suficiente para destruirlos.', '', 30706),
(166163, 'esMX', 'Espléndido. Seguramente estarás de acuerdo en que nada es mejor que una profanación para desmoralizar a un enemigo.', '', 30706),
(166162, 'esMX', 'Parece que hemos provocado a los espíritus de los nativos caídos. Sería una pena enfurecerlos aún más.', '', 30706),
(166161, 'esMX', 'Bien hecho. Esta vez comprueba que estén bien muertos.', '', 30706),
(166160, 'esMX', 'Esos bufones del Martillo Crepuscular no saben cuándo morir ¿Serías tan amable de enseñarles?', '', 30706),
(166159, 'esMX', 'Ah, el dulce silencio. Su balbuceo incesante puede ser muy agotador.', '', 30706),
(166158, 'esMX', '', '¡Facilítame las cosas y muere!', 30706),
(166157, 'esMX', 'Estos múrlocs intolerables empiezan a ser más que una simple molestia. Encárgate de ellos.', '', 30706),
(166156, 'esMX', '¡Esas serpientes pensarán dos veces antes de volver a deslizarse hacia territorio de la Horda!', '', 30706),
(166155, 'esMX', 'Parece que esos nagas creen poder arrebatarnos lo que nos pertenece. Demuéstrales lo equivocados que están.', '', 30706),
(166154, 'esMX', 'Excelente. ¡No vamos a descansar hasta purgar toda esta costa maldita!', '', 30706),
(166153, 'esMX', 'La Alianza se aferra a este lugar como pulgas al lomo de un perro. Extermínalos.', '', 30706),
(166152, 'esMX', '<Parece que el cofre está sellado con magia.>', '<Parece que el cofre está sellado con magia.>', 30706),
(166151, 'esMX', '|TInterface\\Icons\\SPELL_FIRE_SELFDESTRUCT.BLP:20|tUna |cFFFF0000|Hspell:284374|h[Trampa de magma]|h|r se forma cerca.', '|TInterface\\Icons\\SPELL_FIRE_SELFDESTRUCT.BLP:20|tUna |cFFFF0000|Hspell:284374|h[Trampa de magma]|h|r se forma cerca.', 30706),
(166150, 'esMX', '|TInterface\\Icons\\Spell_Mage_Meteor.blp:20|t¡Los combatientes invocan un |cFFFF0000|Hspell:284388|h[Destello de fénix]|h|r desde atrás de una barrera mágica!', '|TInterface\\Icons\\Spell_Mage_Meteor.blp:20|t¡Los combatientes invocan un |cFFFF0000|Hspell:284388|h[Destello de fénix]|h|r desde atrás de una barrera mágica!', 30706),
(166149, 'esMX', '|TInterface\\Icons\\SPELL_SHAMAN_SPECTRALTRANSFORMATION.BLP:20|t¡Los combatientes toman sus formas finales! ¡Acaba con ellos!', '|TInterface\\Icons\\SPELL_SHAMAN_SPECTRALTRANSFORMATION.BLP:20|t¡Los combatientes toman sus formas finales! ¡Acaba con ellos!', 30706),
(166148, 'esMX', '|TInterface\\Icons\\SPELL_NATURE_GIFTOFTHEWILD.BLP:20|tLos combatientes invocan |cFFFF0000|Hspell:282031|h[Fuego en la niebla]|h|r, ¡derrota a las Bombas vivas antes de que |cFFFF0000|Hspell:284399|h[exploten]|h|r!', '|TInterface\\Icons\\SPELL_NATURE_GIFTOFTHEWILD.BLP:20|tLos combatientes invocan |cFFFF0000|Hspell:282031|h[Fuego en la niebla]|h|r, ¡derrota a las Bombas vivas antes de que |cFFFF0000|Hspell:284399|h[exploten]|h|r!', 30706),
(166147, 'esMX', '|TInterface\\Icons\\ABILITY_MONK_PALMSTRIKE.BLP:20|tTe están probando con |cFFFF0000|Hspell:282030|h[Golpe multidireccional]|h|r, ¡enfrenta todos los ataques!', '|TInterface\\Icons\\ABILITY_MONK_PALMSTRIKE.BLP:20|tTe están probando con |cFFFF0000|Hspell:282030|h[Golpe multidireccional]|h|r, ¡enfrenta todos los ataques!', 30706),
(166146, 'esMX', '', '¡Atacan nueh\'tro hogar! ¡Regresen a Zuldazar ahora!', 30706),
(166145, 'esMX', '¡Esas serpiente\' de la Alianza!', '', 30706),
(166144, 'esMX', '', '¡Nos han engañado! ¡Mi padre quedó solo para defender la ciudad!', 30706),
(166143, 'esMX', '', 'No tiene sentido. A menos... que quisieran traernos a Nazmir...', 30706),
(166142, 'esMX', 'Eh\'to me da mala espina. ¿Por qué traer la niebla si no hay nave\' para ocultar?', '', 30706),
(166141, 'esMX', 'Nop, nop. Ahora corremos.', '', 30706),
(166140, 'esMX', '¿Ahora nos preocupamos?', '', 30706),
(166139, 'esMX', 'No te preocupes, está todo bajo control.', '', 30706),
(166138, 'esMX', 'Con cuidado...', '', 30706),
(166136, 'esMX', '', 'La Horda ha reunido armas de asedio para prepararse para un ataque en Puerto Ruina Pétrea. ¡Atacaremos su base ahora y nos llevamos esas armas!', 30706),
(166135, 'esMX', 'Quiero teletransportarme hasta el rey Rastakhan.', 'Quiero teletransportarme hasta el rey Rastakhan.', 30706),
(166134, 'esMX', 'Parece que seré de la Horda de por vida después de esto. Gracias, $pr.', 'Parece que seré de la Horda de por vida después de esto. Gracias, $pr.', 30706),
(166133, 'esMX', 'Muéstrame lo que pasó.', 'Muéstrame lo que pasó.', 30706),
(166132, 'esMX', 'Les dije a esos palurdos que la Horda vendría a buscarnos. ¡Lok-bar! O lo que sea que digan los tuyos.', 'Les dije a esos palurdos que la Horda vendría a buscarnos. ¡Lok-bar! O lo que sea que digan los tuyos.', 30706),
(166131, 'esMX', 'Qué bueno volver a verte, $n. No hemos olvidado tu ayuda en Argus.', '', 30706),
(166130, 'esMX', 'Tienes mi agradecimiento... ¡y mi hacha!', 'Tienes mi agradecimiento... ¡y mi hacha!', 30706),
(166129, 'esMX', '¡Sí! Es hora de ahogar algunas ratas de la Alianza.', '¡Sí! Es hora de ahogar algunas ratas de la Alianza.', 30706),
(166128, 'esMX', '¡Arr! Después de esto, la Horda se ha congraciado conmigo.', '¡Arr! Después de esto, la Horda se ha congraciado conmigo.', 30706),
(166127, 'esMX', '¡Ja! Esos perros de la Alianza se lo merecían.', '¡Ja! Esos perros de la Alianza se lo merecían.', 30706),
(166126, 'esMX', '¿Te envió la capitana? Dale las gracias de mi parte.', '¿Te envió la capitana? Dale las gracias de mi parte.', 30706),
(166125, 'esMX', 'La capitana Owings tenía razón... ¡La Horda nos protege!', 'La capitana Owings tenía razón... ¡La Horda nos protege!', 30706),
(166124, 'esMX', 'Quiero teletransportarme hasta el Consejo de los loa.', 'Quiero teletransportarme hasta el Consejo de los loa.', 30706),
(166123, 'esMX', 'Buenas nuevas, $n.', '', 30706),
(166122, 'esMX', 'Objetivo eliminado. Bien hecho.', '', 30706),
(166121, 'esMX', 'Misión cumplida.', '', 30706),
(166120, 'esMX', 'Has neutralizado la amenaza. Buen trabajo, adalid.', '', 30706),
(166119, 'esMX', 'Se ha detectado una gran amenaza cerca. Permanece alerta.', '', 30706),
(166118, 'esMX', 'Nuestros exploradores nos informan que hay un enemigo poderoso en esta área. Ya sabes qué hacer.', '', 30706),
(166117, 'esMX', 'Hay un objetivo prioritario cerca de tu ubicación. ¡Elimínalo!', '', 30706),
(166116, 'esMX', 'Se quedarán un buen rato lamiéndose las heridas después de esa paliza. ¡Buen trabajo!', '', 30706),
(166115, 'esMX', 'Los Secacorteza son enemigos de Stromgarde desde la Segunda Guerra. Pelearán con uñas y dientes por esta tierra, y nosotros también.', '', 30706),
(166114, 'esMX', 'Quizás ahora les llegue el mensaje. ¡Bien hecho, $n!', '', 30706),
(166113, 'esMX', 'La Hermandad no está muy feliz de que les hayamos quitado Stromgarde, y lo están demostrando. Muéstrales que no se deben meter con nosotros.', '', 30706),
(166112, 'esMX', 'Excelente trabajo. Lo último que necesitamos son elementales salvajes sueltos en nuestros nuevos territorios.', '', 30706),
(166111, 'esMX', 'La magia que ata a los elementales a esta tierra parece estar debilitándose. Encárgate de ellos antes de que causen demasiado daño.', '', 30706),
(166110, 'esMX', 'Ahora nuestros mineros pueden trabajar tranquilos. Gracias, adalid.', '', 30706),
(166109, 'esMX', 'Los kóbolds de esta zona tienen un talento especial para meterse en nuestras minas. Tenemos que proteger nuestros recursos.', '', 30706),
(166108, 'esMX', 'Eso los mantendrá lejos de Stromgarde por un tiempo. Te agradezco la ayuda.', '', 30706),
(166107, 'esMX', 'Los ogros nunca son los mejores vecinos, pero los Puño de roca son particularmente... poco amigables. Convenzámoslos de que se comporten, ¿te parece?', '', 30706),
(166106, 'esMX', '¡Otra victoria para la Alianza!', '', 30706),
(166105, 'esMX', 'Las fuerzas de la Horda todavía tienen posiciones clave aquí. Tenemos que hacer algo al respecto.', '', 30706),
(166104, 'esMX', '¡Peligro! Sistemas comprometidos. ¡PURGAR! ¡PURGAR! ¡PURGAR!', '', 30706),
(166103, 'esMX', '¡Infiltración detectada! ¡Purgar entidades no autorizadas!', '', 30706),
(166101, 'esMX', '¡Nos atacan! ¡Aseguren una cabeza de playa!', '', 30706),
(166100, 'esMX', '¡Será su fin!', '', 30706),
(166099, 'esMX', '¡El juicio se acerca!', '', 30706),
(166098, 'esMX', '', '¡Han cometido un grave error!', 30706),
(166097, 'esMX', '', '¡Alguien tiene que darles una lección!', 30706),
(166096, 'esMX', '¡Nunca escaparán de la ira del mar!', '', 30706),
(166095, 'esMX', '¡Deben responder por sus acciones!', '', 30706),
(166094, 'esMX', '¡La tormenta crece dentro!', '', 30706),
(166093, 'esMX', '¡La tormenta los reclama!', '', 30706),
(166092, 'esMX', 'Intrusos detectados. Últimos mecanismos de defensa activados.', '', 30706),
(166091, 'esMX', '¡Quebraré su resistencia!', '', 30706),
(166090, 'esMX', '¡Los aplastaré!', '', 30706),
(166089, 'esMX', '¡Sus huesos se escarcharán!', '', 30706),
(166088, 'esMX', '¡Congelaré sus almas!', '', 30706),
(166087, 'esMX', '¡Reciban la marea creciente!', '', 30706),
(166086, 'esMX', 'El mar ha reclamado lo que es suyo.', '', 30706),
(166085, 'esMX', 'Los indignos se han ahogado.', '', 30706),
(166084, 'esMX', 'Las profundidades... llaman...', '', 30706),
(166083, 'esMX', 'Los mares... volverán... a levantarse...', '', 30706),
(166082, 'esMX', '¡Escoria débil!', '', 30706),
(166081, 'esMX', '¡Indigno!', '', 30706),
(166078, 'esMX', 'Quiero teletransportarme hasta el guardián del tesoro.', 'Quiero teletransportarme hasta el guardián del tesoro.', 30706),
(166077, 'esMX', '¡Basta! ¡No hay piedad para la Horda!', '', 30706),
(166076, 'esMX', '', '¡Deben pagar por sus crímenes!', 30706),
(166075, 'esMX', '', '¡No me convertiré en una marioneta de Bwonsamdi!', 30706),
(166074, 'esMX', 'Una rata leprosa hinchada chilla ruidosamente y corre para bloquearte el camino.', '', 30706),
(166062, 'esMX', '¡Más grande! ¡Engrandado! ¡GRANDE! ¡GROOONG!', '', 30706),
(166061, 'esMX', 'Debes detener el ritual que intentan hacer esos kultiranos, sea lo que sea. ¡Y sella sus bocas para siempre!', '', 30706),
(166060, 'esMX', 'Y así será... ¡Pero eso no significa que no pueda divertirme!', '', 30706),
(166059, 'esMX', '', 'No estamos aquí para provocarlos. ¡Concéntrate en el ritual! Debemos garantizar que nuestra gente pueda salir.', 30706),
(166058, 'esMX', '¡Cometieron un error al desafiar el poderío de Kul Tiras, escoria de la Horda!', '', 30706),
(166057, 'esMX', '¡Debemos romper el bloqueo y asegurar los muelles!', '', 30706),
(166056, 'esMX', '', 'Ella... Maiev, tengo que hablar contigo a solas.', 30706),
(166055, 'esMX', 'Nuestros caminos volverán a cruzarse, Clamañublo. Antes de que esta guerra termine te veré muerto o encadenado. Lo prometo.', '', 30706),
(166054, 'esMX', '', 'Espera... ¿Dónde está Sira? No está contigo.', 30706),
(166053, 'esMX', '¿Ya te marchas, Shaw? Qué pena. Tengo una flecha con tu nombre grabado.', '', 30706),
(166052, 'esMX', '¡Séptima Legión! ¡Defiendan el terreno! ¡Necesitamos alejar las naves!', '', 30706),
(166042, 'esMX', 'Quiero teletransportarme hasta Grong.', 'Quiero teletransportarme hasta Grong.', 30706),
(166039, 'esMX', 'Quiero teletransportarme hasta el Dúo.', 'Quiero teletransportarme hasta el Dúo.', 30706),
(166038, 'esMX', 'Maldita... sea...', 'Maldita... sea...', 30706),
(166037, 'esMX', '¡En su canto está su perdición!', '', 30706),
(166036, 'esMX', '¡El botín del mar puede ser muy... tentador!', '', 30706),
(166035, 'esMX', '¡Alto, escorias! ¡Tenemos invasores a bordo!', '¡Alto, escorias! ¡Tenemos invasores a bordo!', 30706),
(166034, 'esMX', 'Hace un poco de frío, ¿no creen?', '', 30706),
(166033, 'esMX', '¡Los congelaré hasta los huesos!', '', 30706),
(166032, 'esMX', '¡Basura apestosa de la Horda!', '', 30706),
(166031, 'esMX', '¡No eres digno de las mareas!', '', 30706),
(166030, 'esMX', 'Las mareas... los harán... pagar...', '', 30706),
(166029, 'esMX', 'Que los lleven... las profundidades...', '', 30706),
(166028, 'esMX', '¡Sabía que esta escoria no estaría a la altura de los hijos e hijas de Kul Tiras!', '', 30706),
(166027, 'esMX', '¡Hasta nunca! ¡Esos se hundieron cinco brazas de agua!', '', 30706),
(166026, 'esMX', '', '¡La voz del trueno dice la verdad!', 30706),
(166025, 'esMX', '', '¡No oirán más que el trueno!', 30706),
(166024, 'esMX', '', '¡La tormenta trae la ruina de los indignos!', 30706),
(166023, 'esMX', '', '¡Vientos, juzguen a quienes los desafían!', 30706),
(166022, 'esMX', '', '¡Que los cielos los partan en dos!', 30706),
(166021, 'esMX', '', '¡Nadie escapa de la furia del cielo!', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(166020, 'esMX', '', 'Que los mares se apiaden de sus almas malvadas.', 30706),
(166019, 'esMX', '', 'Aunque peleaban por una causa horrible, espero que hallen la paz.', 30706),
(166018, 'esMX', '', 'Que el mar... me lleve...', 30706),
(166017, 'esMX', '', 'Mareas... llévenme... a casa…', 30706),
(166016, 'esMX', '', '¡Encuentra consuelo en las profundidades!', 30706),
(166015, 'esMX', '', '¡Las mareas te han juzgado!', 30706),
(166012, 'esMX', 'Has dado un espectáculo impresionante. Mis escáneres muestran que todo ha vuelto a la normalidad aquí.', '', 30706),
(166011, 'esMX', 'Enviando señal a cañoneros velaniebla', 'Enviando señal a cañoneros velaniebla', 30706),
(166010, 'esMX', '', 'Mucho más grande, sí. Pero aún debemos controlar sus otras estadísticas.', 30706),
(166009, 'esMX', '¡Pero mira eso! ¡Qué bestia formidable!', '', 30706),
(166008, 'esMX', 'Debes ser $Unuevo:nueva; en la tripulación. ¡Te mostraré qué hacemos con sabandijas como esta!', 'Debes ser $Unuevo:nueva; en la tripulación. ¡Te mostraré qué hacemos con sabandijas como esta!', 30706),
(166007, 'esMX', '¡Destrozemos a este marinero de agua dulce!', '¡Destrocemos a este marinero de agua dulce!', 30706),
(166006, 'esMX', '¡Aléjense de $n, canallas de barrigas amarillas! ¡Ahora es $Uuno:una; de los nuestros!', '¡Aléjense de $n, canallas de barrigas amarillas! ¡Ahora es $Uuno:una; de los nuestros!', 30706),
(166005, 'esMX', '¡Velaniebla por siempre!', '¡Velaniebla por siempre!', 30706),
(166004, 'esMX', '¡Vamos, saquearemos juntos este lugar!', '¡Vamos, saquearemos juntas este lugar!', 30706),
(166003, 'esMX', '¡$UBienvenido:Bienvenida; a la tripulación, felicitaciones!', '¡$UBienvenido:Bienvenida; a la tripulación, felicitaciones!', 30706),
(166002, 'esMX', '¡Por los Filibusteros velaniebla!', '¡Por los Filibusteros velaniebla!', 30706),
(166001, 'esMX', '¡Yo cubriré tus espaldas, $n!', '¡Yo cubriré tus espaldas, $n!', 30706),
(166000, 'esMX', '¡Grong fuerte! ¡GRONG FUERTEEE!', '', 30706),
(165999, 'esMX', 'Soy Grong. Ayudo.', '', 30706),
(165998, 'esMX', 'Llévalo de vuelta al campamento, $p. ¡Es hora de probar su fuerza!', '', 30706),
(165997, 'esMX', '', 'Estado mental en deterioro: anotado.', 30706),
(165996, 'esMX', '¡Grong fuerte!', '', 30706),
(165995, 'esMX', '¡Pero tampoco te lo impediremos!', '', 30706),
(165994, 'esMX', '', 'No te lo recomendamos.', 30706),
(165993, 'esMX', '¡Yo querer más grande! Yo puedo soportar.', '', 30706),
(165992, 'esMX', '', 'Más rápido que antes, sin duda. ¿Y cómo sigue su intelecto?', 30706),
(165991, 'esMX', 'Me gustaría viajar en caravana.', 'Me gustaría viajar en caravana.', 30706),
(165990, 'esMX', '¿En qué puedo ayudar a $Uun viajero fatigado:una viajera fatigada; como tú?', '', 30706),
(165989, 'esMX', '', '¡Acércate más! Aquí estaremos a salvo de los ojos curiosos.', 30706),
(165988, 'esMX', '', 'Esa nave es... impresionante.', 30706),
(165985, 'esMX', '', '¡Veamos qué puede hacer un Grong engrandecido!', 30706),
(165984, 'esMX', '', '¡No! No caminaré en el Otro... Lado...', 30706),
(165980, 'esMX', 'Parece que esta plataforma de teletransporte se reactivó cuando golpeaste a ese prototipo de Molestrón. Debería llevarte abajo sin problemas.', '', 30706),
(165979, 'esMX', '', 'Todo nuestro trabajo está por dar frutos, $p. \n\n¡Avísame cuando estés $Ulisto:lista; para hacer historia!', 30706),
(165978, 'esMX', '', '¡El Engrandecedor es nuestro mejor invento!', 30706),
(165977, 'esMX', 'Como quieras. Héroes... ya saben lo que deben hacer.', '', 30706),
(165976, 'esMX', '¡Zandalar por siempre!', '', 30706),
(165975, 'esMX', 'Yo logré que entráramos. El resto depende de ti.', '', 30706),
(165974, 'esMX', 'No, no me rendiré. Porque pase lo que pase hoy, Zandalar seguirá de pie mucho despué\' de que la Alianza quede reducida a polvo.', '', 30706),
(165973, 'esMX', '', 'Debería estar agradecido.', 30706),
(165972, 'esMX', 'NOSOTRO\' conquistamos eh\'te mundo. NOSOTRO\' le dimos gloria. Ustedes... no son nada. Apena\' el último eslabón de una cadena de salvajes deseosos de minar nueh\'tra grandeza.', '', 30706),
(165971, 'esMX', '', 'Y la muerte es mi dominio.', 30706),
(165970, 'esMX', 'Los zandalari crearon un imperio que ha durado más de diez mil años... Mientra\' tus ancestros bárbaros se revolcaban en el barro.', '', 30706),
(165969, 'esMX', '¿Tú? ¿Un exiliado sin hogar...? ¿Te atreves a invadir eh\'te lugar sagrado y a exigirme que te entregue mi reino?', '', 30706),
(165968, 'esMX', 'Rey Rastakhan de Zandalar... En nombre de la Alianza y del rey Anduin Wrynn, exijo tu rendición.', '', 30706),
(165967, 'esMX', '', 'Hemos asestado un golpe decisivo contra los zandalari. Esperemos que su rey se rinda y le evite más sufrimientos a su pueblo.', 30706),
(165966, 'esMX', 'La sala del trono está adelante.', '', 30706),
(165965, 'esMX', '', 'Era lo mínimo que podía hacer. Fuiste muy útil.', 30706),
(165964, 'esMX', '', 'Luego me lo agradecerás, mi adalid.', 30706),
(165963, 'esMX', '¿Cuántas veces traicionaremos nuestro honor?', '', 30706),
(165962, 'esMX', '', '¡Hora de irnos!', 30706),
(165961, 'esMX', '', '...para que pueda matarlos mientras duermen.', 30706),
(165960, 'esMX', '', 'Seguramente intentarán rescatarlo cuando se enteren de su destino.', 30706),
(165959, 'esMX', 'Protocolos de seguridad fallando. Orden primaria: proteger Gnomeregan. Orden secundaria: transformarme en un ser consciente.', '', 30706),
(165958, 'esMX', 'Esta va directo a la repisa de chimenea.', '', 30706),
(165957, 'esMX', '', 'Te recomiendo que te alejes de la pared. Pronto se calentará bastante.', 30706),
(165956, 'esMX', '¡Inconcebible! Desactivaste todas las defensas. Me tomaré una foto con esta pila de basura para recordar este momento, posa ahí al lado para recordar tu logro si quieres.', '', 30706),
(165955, 'esMX', '', 'Ya está bien, Morton. Sabe más palabras que tú.', 30706),
(165954, 'esMX', '¡Prueba completa!', '', 30706),
(165953, 'esMX', 'Esto es aún peor de lo que imaginaba. ¡Parece que se han activado todos los mecanismos de defensa!', '', 30706),
(165952, 'esMX', 'Este lugar es una locura, ¡sácame de aquí!', 'Este lugar es una locura, ¡sácame de aquí!', 30706),
(165951, 'esMX', '¡Cuidado! ¡El prisionero se ha escapado!', '', 30706),
(165950, 'esMX', 'Vamos. ¡Mantendré a los guardias ocupados!', '', 30706),
(165949, 'esMX', '¡Impertinente! ¿Crees que sabe esa?', '', 30706),
(165948, 'esMX', '', 'A otra cosa... Tenemos que registrar la fuerza de Grong.', 30706),
(165947, 'esMX', '', 'Revisaremos los resultados en el campamento.', 30706),
(165946, 'esMX', '¿No quiso decir \"si no\"?', '', 30706),
(165945, 'esMX', 'Mi... hija...', '', 30706),
(165944, 'esMX', 'Me enorgullece ser parte de este proyecto científico que no solo traerá el fin de la Horda, sino también la salvación de mis hermanos.', '', 30706),
(165943, 'esMX', 'Uuuuuh, ¡tengo un par de almas nueva\' para mi colección!', '', 30706),
(165941, 'esMX', 'Eh\'tos tontos se arrepentirán de haber pisado nuestra ciudad sagrada.', '', 30706),
(165940, 'esMX', '¡Ese es el deh\'tino de todos los que profanan Zuldazar!', '', 30706),
(165939, 'esMX', '¡Te tengo!', '', 30706),
(165938, 'esMX', '¡Ahora me perteneces!', '', 30706),
(165937, 'esMX', '¡Ja! ¡Uno más para mí!', '', 30706),
(165936, 'esMX', '¡Deberías haber huido!', '', 30706),
(165935, 'esMX', '¡Muerte a los invasores!', '', 30706),
(165934, 'esMX', '¡Reúnete con Bwonsamdi!', '', 30706),
(165933, 'esMX', '|TInterface\\Icons\\Ships_ABILITY_Bombers.blp:20|t¡Un retador simio volador está arrojando un |cFFFF0000|Hspell:282247|h[Simiagonizante 3000]|h|r!', '', 30706),
(165932, 'esMX', 'Habla con Grong. Analizaremos los patrones de habla y el vocabulario.', '', 30706),
(165931, 'esMX', '', '¡Muy bien! Ahora mediremos la inteligencia.', 30706),
(165930, 'esMX', '¡Destruyeron un extractor de azerita!', '¡Destruyeron un extractor de azerita!', 30706),
(165929, 'esMX', 'Lo juro.', '', 30706),
(165928, 'esMX', 'Hay un marcador aquí al sur. Veamos cuánto tarda Grog en alcanzarlo.', '', 30706),
(165927, 'esMX', 'Sería prudente armar algunas trampas para cubrir los flancos. Sigan adelante, los alcanzaré.', '', 30706),
(165926, 'esMX', '', 'Primero, mediremos la velocidad de Grong.', 30706),
(165925, 'esMX', 'Estamos entrando en el corazón de Dazar\'alor. Los zandalari opondrán una resistencia feroz.', '', 30706),
(165924, 'esMX', '¡La Alianza agradece tu compromiso con la ciencia!', '', 30706),
(165923, 'esMX', '¡Ey! Ustedes, héroes fuertes y grandes de la Alianza... ¡Esperen un minuto!', '', 30706),
(165922, 'esMX', 'Buena caza, colega. Si te descubren, vuelve a verme o visita a alguno de los otros exploradore\' y te volveremo\' a hacer el vudú.', 'Buena caza, colega. Si te descubren, vuelve a verme o visita a alguno de los otros exploradore\' y te volveremo\' a hacer el vudú.', 30706),
(165921, 'esMX', '¿Te enviaron a ti a hacer el trabajo? Oh, eh\'to va a estar bueno...$b$bTu trabajo es simple, colega: entra, encuentra al objetivo y elimínalo. Sabemo\' que está ahí en algún lado. Mi trabajo es darte el vudú para que puedas engañar a los guardia\', pero cuídate de los centinela\'. Ellos sí pueden verte, así que tienes que ser $usigiloso:sigilosa;.$b$bTe daré una bomba de humo para cuando termines la misión. ¡Úsala para salir de ahí!', '¿Te enviaron a ti a hacer el trabajo? Oh, eh\'to va a estar bueno...$b$bTu trabajo es simple, colega: entra, encuentra al objetivo y elimínalo. Sabemo\' que está ahí en algún lado. Mi trabajo es darte el vudú para que puedas engañar a los guardia\', pero cuídate de los centinela\'. Ellos sí pueden verte, así que tienes que ser $usigiloso:sigilosa;.$b$bTe daré una bomba de humo para cuando termines la misión. ¡Úsala para salir de ahí!', 30706),
(165920, 'esMX', 'Ya hemos explorado este lugar y hemos desarmado las defensas zandalari. El camino debe estar despejado.', '', 30706),
(165919, 'esMX', '¡Maldición! Tenía la esperanza de poder evitar a esa monstruosidad.', '', 30706),
(165918, 'esMX', '¡Ya pueden entrar! Yo seguiré vigilando los cielos.', '', 30706),
(165917, 'esMX', '¡Atrás, héroes! Yo los ayudaré a entrar en la pirámide.', '', 30706),
(165916, 'esMX', 'Tienes las coordenadas, Manitas Mayor. Dispara cuando estés listo.', '', 30706),
(165915, 'esMX', 'Debemos llegar al punto de la incursión. ¡Abran un camino hacia la cascada!', '', 30706),
(165914, 'esMX', '¿Alguien pidió un ataque aéreo?', '', 30706),
(165913, 'esMX', 'Estoy listo.', 'Estoy lista.', 30706),
(165912, 'esMX', '¡Agh! ¡Hay que derribar a esas bestias! ¿Dónde está Mekkatorque con ese nuevo juguete que tiene?', '', 30706),
(165911, 'esMX', 'Quiero teletransportarme hasta el paladín.', 'Quiero teletransportarme hasta el paladín.', 30706),
(165910, 'esMX', 'Es una pena, merecía un destino mejor. Héroes, hagan lo que deban hacer pero... tengan piedad.', '', 30706),
(165909, 'esMX', 'Mucha suerte. Si te descubren, busca a otro agente por el campamento y podemos volver a intentar.', 'Mucha suerte. Si te descubren, busca a otro agente por el campamento y podemos volver a intentar.', 30706),
(165908, 'esMX', '¿Tú ejecutarás la operación? Bien. Me dijeron que enviarían $ual mejor:a la mejor;, ¡pero no esperaba que fueras tú!$b$bMis órdenes son darte apoyo. Puedo esconderte de todos menos de los ojos más aguzados. Infíltrate en su campamento y llévate el objetivo.$b$bTambién puedo darte una bomba más para que puedas salir después de completar la misión. ¡Úsala para escapar!', '¿Tú ejecutarás la operación? Bien. Me dijeron que enviarían $ual mejor:a la mejor;, ¡pero no esperaba que fueras tú!$b$bMis órdenes son darte apoyo. Puedo esconderte de todos menos de los ojos más aguzados. Infíltrate en su campamento y llévate el objetivo.$b$bTambién puedo darte una bomba más para que puedas salir después de completar la misión. ¡Úsala para escapar!', 30706),
(165907, 'esMX', '¡Impresionante! Te las has ingeniado para abrir la primera puerta de seguridad. El pasillo está repleto de bombabots, pero mi fiel aplastabombas está hecho para sobrevivir a una ocasión como esta. Tiene mi mejor conjunto de nitropropulsores y un campo de fuerza defensivo conectados y listos. ¡Vamos! ¡Despeja el camino!', '', 30706),
(165906, 'esMX', '¡La magia de Rastakhan ha hecho que nuestra propia arma nos ataque!', '', 30706),
(165905, 'esMX', 'Yo repeleré a los zandalari. ¡Héroes, ocúpense de estos matones de la Horda!', '', 30706),
(165904, 'esMX', 'Hola. Hola. Hola.', '', 30706),
(165903, 'esMX', '¡Vanguardia, conmigo! ¡Sigan atacando!', '', 30706),
(165902, 'esMX', '¡Soldados, defiendan nueh\'tra ciudad sagrada! ¡Detengan al enemigo! ¡Zandalar por siempre!', '', 30706),
(165901, 'esMX', 'Tenemos poco tiempo antes de que la Horda regrese a la ciudad. ¡Sigan avanzando!', '', 30706),
(165900, 'esMX', '¡Todas las fuerzas, avancen! Marquen un perímetro. No quiero sorpresas.', '', 30706),
(165899, 'esMX', '¡Liberen a la bestia!', '', 30706),
(165897, 'esMX', 'Es tiempo de poner a nuestro amigo simio en acción. ¡La Horda ni siquiera sabrá qué fue lo que los golpeó!', '', 30706),
(165896, 'esMX', '', 'Recuerden: nuestra meta es desestabilizar a los zandalari y eliminar a los objetivos de la Horda. El rey Wrynn no quiere que haya víctimas civiles.', 30706),
(165895, 'esMX', '', 'Asegura el puerto y prepárate para seguir avanzando, maestro espía.', 30706),
(165893, 'esMX', '¡Gran trabajo! Nuestro engaño en Nazmir alejó a las fuerzas de la Horda de la ciudad.', '', 30706),
(165892, 'esMX', '', 'No contaban con la unión de nuestras fuerza\' en su contra. Destruiremos la flota kultirana y terminaremo\' con esta guerra.', 30706),
(165891, 'esMX', 'Son astuto\', no puedo negarlo. Aprovecharon la niebla para sacar ventaja en eh\'te lugar maldito.', '', 30706),
(165890, 'esMX', '', 'Antes debemo\' destruir lo que causa esta niebla. Nuestros voladore\' no nos sirven de nada así. El origen está cerca de Zalamar, puedo percibirlo.', 30706),
(165889, 'esMX', 'Reconquistaremos la mayor parte de Nazmir. Cuando tomemo\' Zalamar, asaltaremos la flota kultirana.', '', 30706),
(165888, 'esMX', 'Trabajo en curso: ¡Sobrevive a las oleadas de atacantes!', 'Trabajo en curso: ¡Sobrevive a las oleadas de atacantes!', 30706),
(165887, 'esMX', '<Prepárate para defender el ritual.>', '', 30706),
(165886, 'esMX', 'Traigo a un prisionero.', 'Traigo a un prisionero.', 30706),
(165885, 'esMX', '', 'Coloca los explosivos. Cuando estemos listos, mi magia los activará.', 30706),
(165884, 'esMX', 'Quiero teletransportarme hasta Frida Bramidos Férreos.', 'Quiero teletransportarme hasta Frida Bramidos Férreos.', 30706),
(165883, 'esMX', '', 'Esta guerra ha dado muchos giros. Me parece que el camino actual es... peligroso.', 30706),
(165882, 'esMX', '¡Saludos, y gracias por ayudar a probar la banda!\n\nPuedo teletransportarte directamente hasta cualquier jefe que esté disponible en este momento para realizar pruebas.', '¡Saludos, y gracias por ayudar a probar la banda!\n\nPuedo teletransportarte directamente hasta cualquier jefe que esté disponible en este momento para realizar pruebas.', 30706),
(165881, 'esMX', 'Ciertamente, amiga mía. La Horda está en una encrucijada... otra vez.', '', 30706),
(165880, 'esMX', 'Parece que tenemos que encontrar el camino de vuelta solos.', '', 30706),
(165879, 'esMX', '', 'Así son las cosas.', 30706),
(165878, 'esMX', '¡$n prepara un festín sanguíneo!', '¡$n prepara un festín sanguíneo!', 30706),
(165877, 'esMX', 'Soy Grong.', '', 30706),
(165876, 'esMX', 'Tú vienes con nosotros, Aspafresno.', '', 30706),
(165875, 'esMX', '', 'Parece que ya no es momento para sutilezas.', 30706),
(165874, 'esMX', '', 'Libera a mis hombres. Serán más que útiles para mantener ocupados a los guardias.', 30706),
(165873, 'esMX', '', 'Te lo dije, no me sacarás ni un... Mmm, ¿qué tenemos aquí?', 30706),
(165872, 'esMX', 'Trabajo en curso: ¡Llega un murciélago que te lleva a un lugar seguro!', 'Trabajo en curso: ¡Llega un murciélago que te lleva a un lugar seguro!', 30706),
(165871, 'esMX', '|TInterface\\ICONS\\Ability_Mount_JungleTiger.blp:20|t ¡Eres el objetivo de la |cFFFF0000|Hspell:282447|h[Cólera de Kimbul]|h|r!', '|TInterface\\ICONS\\Ability_Mount_JungleTiger.blp:20|t ¡Eres el objetivo de la |cFFFF0000|Hspell:282447|h[Cólera de Kimbul]|h|r!', 30706),
(165870, 'esMX', '', 'Te contaré acerca de la caída de Rastakhan cuando estés lista.', 30706),
(165869, 'esMX', '', 'Debo saberlo... ¿Cómo cayó mi padre?', 30706),
(165868, 'esMX', '', 'Atacaron sin honor… Se robaron todo lo que se podían llevar y deh\'truyeron el resto.', 30706),
(165867, 'esMX', 'Es aquí.', '', 30706),
(165866, 'esMX', '', 'Conocían Dazar\'alor como si hubieran eh\'tado aquí antes…', 30706),
(165865, 'esMX', '', 'Procede, prisionero.', 30706),
(165864, 'esMX', '', 'Dime, Otoye... ¿cómo lograron entrar a nueh\'tra ciudad los invasores?', 30706),
(165863, 'esMX', 'Tú serás $Uel supervisor:la supervisora; durante estas pruebas. \n\nAdemás, siempre es buena idea tener a alguien cerca en caso de que algo salga mal... pero eso no sucederá.\n\nDime cuando estés $Ulisto:lista; para comenzar.', '', 30706),
(165862, 'esMX', '¡La tecnología gnómica está a años luz de la ingeniería goblin!', '', 30706),
(165861, 'esMX', '¿Qué estás...? Oh... Eso... no me lo esperaba.', '', 30706),
(165860, 'esMX', '¡Pues claro! Si el cetro es tan valioso, debe estar ahí, ¿verdad? ¡Vamos!', '', 30706),
(165859, 'esMX', '¿Hacia las pilas de oro y riquezas que desbordan la tesorería?', '', 30706),
(165858, 'esMX', 'Espera un poco. Deberíamos ir por este lado.', '', 30706),
(165857, 'esMX', 'Hmm... Este lugar tiene dos salidas.', '', 30706),
(165856, 'esMX', '¿No sabes lo que es el sarcasmo?', '', 30706),
(165855, 'esMX', 'Después de esto caerán rayos y habrá fuego en los pasillos, Céfiro.', '', 30706),
(165854, 'esMX', 'Mira esta sala completamente segura. ¡Deberíamos entrar de inmediato!', '', 30706),
(165853, 'esMX', 'Las astas de Mayla son perfectas... No es que esté pensando en sus astas eh... ¡No hables de sus astas!', '', 30706),
(165852, 'esMX', '¿Por qué la gente dice \"tomar el toro por las astas\" como si fuese algo bueno? Porque déjame decirte que es muy incómodo. Y descortés.', '', 30706),
(165851, 'esMX', 'Una vez Colmillosauro me dijo que tengo un \"estilo animal\". No me molestó. Pero parecía hambriento.', '', 30706),
(165850, 'esMX', 'La desventaja de tener \"Pezuña de Sangre\" como apellido es que todos temen que pises su alfombra.', '', 30706),
(165849, 'esMX', 'Los tauren resisten con orgullo.', '', 30706),
(165848, 'esMX', 'Peleamos cuando debemos pelear... por Azeroth.', '', 30706),
(165847, 'esMX', '¿Por qué acudes a mí?', '', 30706),
(165846, 'esMX', '¡|cFF0EA6DCLa Alianza|r ha destruido un extractor de azerita!', '¡|cFF0EA6DCLa Alianza|r ha destruido un extractor de azerita!', 30706),
(165845, 'esMX', '¡|cFFEF0201La Horda|r ha destruido un extractor de azerita!', '¡|cFFEF0201La Horda|r ha destruido un extractor de azerita!', 30706),
(165844, 'esMX', 'Que la madre tierra siempre te sonría.', '', 30706),
(165843, 'esMX', 'Soy Baine, hijo de Cairne.', '', 30706),
(165842, 'esMX', '¡Muy bien, $n, usemos esta cosa para hacer volar por los aires la Alianza! Y roguemos que no nos haga volar a nosotros...', '', 30706),
(165841, 'esMX', 'Hmm... ¡Es como si no supieran cómo funciona este meca! Supongo que todos tenemos mucho en común.', '', 30706),
(165840, 'esMX', '¡Estaremos más adelante, peleando contra la Alianza! ¡Los expulsaremo\' de aquí!', '', 30706),
(165839, 'esMX', '', 'Sea como sea, necesitamos esa máquina para echar a la Alianza de las ruinas.', 30706),
(165838, 'esMX', 'Eh, ¿objetivamente o subjetivamente?', '', 30706),
(165837, 'esMX', '', 'Parche, $p, buen trabajo. Pero la lucha aún no ha terminado. ¿Quedó algo de energía en tu máquina tras desarmar esas mina\'?', 30706),
(165836, 'esMX', 'Vamos a Xibala. ¡Me espera mi destino!', '', 30706),
(165835, 'esMX', 'Que los espíritus te protejan.', '', 30706),
(165834, 'esMX', 'Trampa en progreso', 'Trampa en progreso', 30706),
(165833, 'esMX', '¿Cómo puedo ayudarte?', '', 30706),
(165832, 'esMX', 'Conserva la fuerza. Conserva la lealtad.', '', 30706),
(165831, 'esMX', 'Honra a nuestros predecesores.', '', 30706),
(165830, 'esMX', 'Somos los guardianes de este mundo.', '', 30706),
(165829, 'esMX', 'Juntos somos más fuertes.', '', 30706),
(165828, 'esMX', 'Sin honor, no somos nada.', '', 30706),
(165827, 'esMX', 'La madre tierra nos guía a todos.', '', 30706),
(165826, 'esMX', 'Por la Horda... Siempre.', '', 30706),
(165825, 'esMX', '¡Ajá! ¿Qué tenemos aquí?', '', 30706),
(165824, 'esMX', '¡ROUF!', '¡ROUF!', 30706),
(165823, 'esMX', 'GRRRR...', 'GRRRR...', 30706),
(165822, 'esMX', '¡Ar-oof!', '¡Ar-oof!', 30706),
(165821, 'esMX', 'Rrrrrr...', 'Rrrrrr...', 30706),
(165820, 'esMX', '¡Guau!', '¡Guau!', 30706),
(165819, 'esMX', '¡Rrrrr... rouf!', '¡Rrrrr... rouf!', 30706),
(165818, 'esMX', 'Grrr...', 'Grrr...', 30706),
(165816, 'esMX', 'Iré a la gruta a despedirme.', '', 30706),
(165814, 'esMX', 'Te desearía suerte, pero... mis palabras serían en vano. ¡Súper teletransporte, activado!', '', 30706),
(165813, 'esMX', 'Además, he observado tu patética estrategia y predije tus próximos cuatro movimientos. ¡No puedes ser más $ulisto:lista; que alguien con capacidades tan avanzadas como yo!', '', 30706),
(165812, 'esMX', 'Ya he desactivado todos los protocolos de seguridad de esta unidad... Y me guardé algo especial para nosotros.', '', 30706),
(165811, 'esMX', 'Tenemos un plan. ¡Es tan complejo que $uun simple plebeyo:una simple plebeya; como tú jamás podría comprenderlo!', '', 30706),
(165810, 'esMX', 'Hemos estado observándote, \"adalid\". No tienes la menor idea de lo que enfrentas.', '', 30706),
(165809, 'esMX', 'Aléjate del robot... ¡O volaré este lugar por los aires!', '', 30706),
(165808, 'esMX', 'Sus actos nos avergüenzan a todos. Tenemos que restaurar el orden... Antes de que la Horda pierda todo lo que nos hizo fuertes.', '', 30706),
(165807, 'esMX', 'Esto esta mal. Carece totalmente de honor.', '', 30706),
(165804, 'esMX', 'Dime... Dime, ¿dónde está mi padre? ¿Y mi madre? Jaina... Tandred... Por favor, por favor... ¡Estoy tan solo! No... ¡No me dejes solo!', '', 30706),
(165802, 'esMX', 'Estuve muerto... ¿no? ¿Por cuánto tiempo? No estoy del todo vivo y sin embargo... No comprendo. Por favor... POR FAVOR... ¿Cómo es posible?', '', 30706),
(165801, 'esMX', 'Recuerdo la batalla. Jinetes de dragones orcos. Nuestros muelles consumidos por las llamas. Sentí una llamarada de agonía y luego... oscuridad.', '', 30706),
(165800, 'esMX', 'Por favor... ayúdame. N-No sé qué ha pasado. Qué me han hecho.', '', 30706),
(165799, 'esMX', '', 'Aspafresno está aquí.', 30706),
(165798, 'esMX', 'Valtrois, enciéndelas.', '', 30706),
(165797, 'esMX', '¡Apártense!', '', 30706),
(165796, 'esMX', 'Cuando estas exploten, este lugar será un caos.', '', 30706),
(165795, 'esMX', '¡Sí, lárgate! Nuestro ejército llegará en cualquier momento, de todos modos.', '', 30706),
(165794, 'esMX', 'Aunque vuelvan a conquistar estas ruinas, nuestras fuerzas marchan a través de Nazmir. ¡La Horda nunca ganará!', '', 30706),
(165793, 'esMX', '', 'Qué perceptiva, lady Aspafresno. Creo que tenemos que hablar sobre ciertos... intereses en común.', 30706),
(165792, 'esMX', '', 'Me sacaron de esa celda solamente porque necesitaban algo de mí.', 30706),
(165791, 'esMX', 'Muy bien, $n, es hora de luchar y vencer. Haremos el truco de siempre: ¡atacar y destruir todo lo que encontremos!', '', 30706),
(165789, 'esMX', '¡Tus juguetes no me causan daño! ¡Tú y la escoria de la Horda morirán hoy mismo!', '', 30706),
(165788, 'esMX', '¡Ja! ¿Qué se cree este idiota? Destruyámoslo y pongamos en marcha al ejército.', '', 30706),
(165787, 'esMX', '¡La Luz está conmigo! ¡Hasta aquí han llegado!', '', 30706),
(165786, 'esMX', '¡Mátenlos a todos!', '', 30706),
(165785, 'esMX', 'Por... Valiente...', '', 30706),
(165784, 'esMX', '¡No te irás de mi isla con esa bruja maldita!', '', 30706),
(165783, 'esMX', '¡Hora de revelar una de mis últimas invenciones!', '', 30706),
(165782, 'esMX', 'Quizá más tarde te demos la visita completa. ¡Es un lugar adorable! Je, je, je, je.', '', 30706),
(165781, 'esMX', 'Te llevaremos al reclusadero. Después estarás por tu cuenta.', '', 30706),
(165780, 'esMX', 'Hace mucho tiempo que lo buscábamos. ¡Un gran premio!', '', 30706),
(165779, 'esMX', '¿Qué estás mascullando, prisionero?', '', 30706),
(165778, 'esMX', '', 'Buena... pelea...', 30706),
(165777, 'esMX', '', 'He luchado contra novatos más fuertes que tú. No puedes igualarme.', 30706),
(165776, 'esMX', 'Parece que las palabras... no fueron suficientes...', '', 30706),
(165775, 'esMX', 'No interrumpirás mi trabajo. ¡No somos simples embajadores indefensos!', '', 30706),
(165774, 'esMX', 'Agh... No valió la pena...', '', 30706),
(165773, 'esMX', 'Oh, te has metido con la persona equivocada. ¡Te freiré!', '', 30706),
(165772, 'esMX', 'Eso espero, por tu bien.', 'Eso espero, por tu bien.', 30706),
(165771, 'esMX', 'Bah... Será igual que su padre.', 'Bah... Será igual que su padre.', 30706),
(165770, 'esMX', '¡Esto los mantendrá ocupados un buen rato!', '', 30706),
(165769, 'esMX', 'Mmm. Estás llevando las cosas un poco lejos.', '', 30706),
(165768, 'esMX', '', 'Oficial, este es Rexxar, el infame criminal de la Horda. ¡Debería estar en el rincón más oscuro y sucio de este calabozo!', 30706),
(165767, 'esMX', '', 'Ni siquiera mi magia tiene la potencia suficiente para disimular ese olor.', 30706),
(165766, 'esMX', '', '¡Rápido! Acérquense. Crearé el disfraz.', 30706),
(165765, 'esMX', '¡Les presento uno de mis artilugios favoritos!', '', 30706),
(165764, 'esMX', 'Sé cuánto les gustan las lanzas y las hachas, ¡pero seguramente saben reconocer una tecnología superior al verla!', '', 30706),
(165763, 'esMX', 'Sus posibilidades de victoria se reducen. Exponencialmente. A cada segundo.', '', 30706),
(165762, 'esMX', 'Lo razonable sería que se rindieran... ¿Pero cuándo fue razonable la Horda?', '', 30706),
(165761, 'esMX', '¿Eso es un sí?', '¿Eso es un sí?', 30706),
(165760, 'esMX', '¡Yo Grong!', '', 30706),
(165759, 'esMX', 'Te harán más grande. Tan grande que te transformarás en un arma para destruir a la Horda.', 'Te harán más grande. Tan grande que te transformarás en un arma para destruir a la Horda.', 30706),
(165758, 'esMX', '¿Qué es la kaja\'mita?', '¿Qué es la kaja\'mita?', 30706),
(165757, 'esMX', '¿Estás seguro de que quieres hacer esto?', '¿Estás seguro de que quieres hacer esto?', 30706),
(165756, 'esMX', 'En pocas palabras, la kaja\'mita es un mineral con propiedades asombrosas y una historia sórdida. \n\nCuando la descubrimos, se usaba en sujetos de prueba para determinar su utilidad.\n\nLos resultados de esos estudios cuestionables mostraban un aumento constante de la inteligencia cuando se consumía, seguido de un descenso pronunciado cuando se abandonaba la dieta.', '', 30706),
(165755, 'esMX', 'Nunca estuve tan seguro. \n\nSi puedo ayudar, es mi deber. \n\nNo desperdicies tu preocupación en mí. Estoy preparado para lo que vendrá.\n\nTú también deberías prepararte.', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(165754, 'esMX', 'Este es mi destino, $p.', '', 30706),
(165753, 'esMX', '¡El celador te necesita de inmediato! ¡Andando!', '¡El celador te necesita de inmediato! ¡Andando!', 30706),
(165752, 'esMX', '¿Qué puedo hacer por ti?', '¿Qué puedo hacer por ti?', 30706),
(165751, 'esMX', '¡Espero que tengan botas de goma!', '', 30706),
(165750, 'esMX', '¡Tú te lo buscaste!', '', 30706),
(165749, 'esMX', '¡Despejen el área de aterrizaje!', '', 30706),
(165748, 'esMX', '¡Veo que tienen un pequeño problema!', '', 30706),
(165747, 'esMX', '¡Ja! ¡No me importan tu oro y tus brillos! ¡Tus inventos siguen siendo pura basura!', '', 30706),
(165746, 'esMX', '¿Te crees mejor que yo? ¡¿TE CREES MEJOR QUE YO?! ¡A pelear, hojalatero!', '', 30706),
(165745, 'esMX', '¿Intentas detenerme con esa basura chillona a la que llamas \"traje de vuelo\"? ¿Qué harás? ¿Encandilarme hasta que muera?', '', 30706),
(165744, 'esMX', '¡No tan rápido, \"Manitas Torpes\"! ¡Tu pandilla de asesinos no irá a ningún lado! No he olvidado lo que hicieron con mi precioso gólem de oro...', '', 30706),
(165743, 'esMX', '¡Advertencia! ¡Advertencia! Signos vitales críticos. Secuencia de eyección iniciada.', '', 30706),
(165742, 'esMX', 'Sistemas.... fuera de servicio... se necesita... cargador...', '', 30706),
(165741, 'esMX', 'Falla en... Niveles de potencia... Advertencia... Advertencia...', '', 30706),
(165740, 'esMX', 'Falla del sistema inminente. Un desenlace... electrizante.', '', 30706),
(165739, 'esMX', 'Horda mala. ¡Destruye, mono! ¿Quién es un buen mono? ¡Tú!', '', 30706),
(165738, 'esMX', 'Recordatorio: No superar umbral compasivo. ¡Descarga solo para la Alianza!', '', 30706),
(165737, 'esMX', '¡Eh! ¡Nadie dijo que podías tocar esa llave!', '¡Eh! ¡Nadie dijo que podías tocar esa llave!', 30706),
(165736, 'esMX', 'Niveles de irritación del sujeto en aumento. ¡Mantener las descargas!', '', 30706),
(165735, 'esMX', 'Matriz antagonista en máxima capacidad. Listo para el despliegue.', '', 30706),
(165734, 'esMX', 'Todos los sistemas en línea. Objetivo en la mira. Baterías al máximo.', '', 30706),
(165733, 'esMX', 'Sistema Simiagonizante 3000 desplegado. ¡Prepárense para \"estimular\" al objetivo!', '', 30706),
(165732, 'esMX', '', 'Necesitamos a los zandalari y a su flota con urgencia si queremos enfrentarnos a la Alianza una vez más.', 30706),
(165731, 'esMX', 'Talanji pronto será proclamada reina. Ella será quien decida si se unen a nosotro\'.', '', 30706),
(165730, 'esMX', 'Jefa de guerra, creo que es hora de llamar a los zandalari.', '', 30706),
(165729, 'esMX', '', 'Nuestros soldados están agotados. Las filas de la Horda necesitan sangre nueva. ¿Qué opciones se les ocurren?', 30706),
(165728, 'esMX', '', 'Las fuerzas de la Alianza han resistido y no parecen haberse debilitado.', 30706),
(165727, 'esMX', '', 'Adalid. Líderes de la Horda. Los he convocado para debatir algunos asuntos de la guerra.', 30706),
(165726, 'esMX', '¿Esa sombra estaba ahí antes?', '¿Esa sombra estaba ahí antes?', 30706),
(165725, 'esMX', 'Mmm, oí algo...', 'Mmm, oí algo...', 30706),
(165724, 'esMX', 'Nadie puede esconderse de mí...', 'Nadie puede esconderse de mí...', 30706),
(165723, 'esMX', '¿Quién anda ahí? ¡Te oigo!', '¿Quién anda ahí? ¡Te oigo!', 30706),
(165722, 'esMX', 'Hay algo extraño...', 'Hay algo extraño...', 30706),
(165721, 'esMX', '¡Oí algo!', '¡Oí algo!', 30706),
(165720, 'esMX', 'No tenemos tiempo para esto. Tenemos que permanecer alerta.', 'No tenemos tiempo para esto. Tenemos que permanecer alerta.', 30706),
(165719, 'esMX', 'Agh, qué asco. ¿Quién haría algo así?', 'Agh, qué asco. ¿Quién haría algo así?', 30706),
(165718, 'esMX', '¡Ahora te veo!', '¡Ahora te veo!', 30706),
(165717, 'esMX', '¡Hay alguien aquí! ¡Hagan sonar las alarmas!', '¡Hay alguien aquí! ¡Hagan sonar las alarmas!', 30706),
(165716, 'esMX', '¡No deberías estar aquí!', '¡No deberías estar aquí!', 30706),
(165715, 'esMX', 'Princesa Talanji, ¿puedes usar tu poder para hacer funcionar el M.I.D.A.S.-V?', 'Princesa Talanji, ¿puedes usar tu poder para hacer funcionar el M.I.D.A.S.-V?', 30706),
(165714, 'esMX', '¡|cFF0EA6DC$n|r ha activado un extractor de azerita!', '¡|cFF0EA6DC$n|r ha activado un extractor de azerita!', 30706),
(165713, 'esMX', '¡La Alianza se arrepentirá de intentar emboscarnos en un pantano horrible plagado de trols de sangre y monstruos!\n\n... Aunque seguramente ya se hayan arrepentido.', '', 30706),
(165712, 'esMX', 'Por ahora seguiré buh\'cando respuestas. Si hay nuevos enemigo\' al acecho en las sombras, será mejor que salga a buscarlos.... antes de que ello\' nos encuentren.', '', 30706),
(165711, 'esMX', 'Pero tú ere\' la primera en pensar a futuro... y en ver el potencial de los trols. Eres joven, pero recta. Invoca a mi eh\'píritu si alguna vez necesitas el consejo de un viejo jefe.', '', 30706),
(165710, 'esMX', 'Zandalar resih\'te por tu valentía, Talanji. Tu padre eh\'taba atrapado en las vieja\' costumbres, soñaba con un imperio trol perdido en el tiempo.', '', 30706),
(165709, 'esMX', 'Es la líder de la Horda. No importa cómo llegó ahí. Y necesita buenos asesore\' que la ayuden a seguir el camino correcto.', '', 30706),
(165708, 'esMX', '', 'Más allá de las circunstancia\', ella es la líder de la Horda. Haré lo que pueda para que gobierne con justicia.', 30706),
(165707, 'esMX', 'El Rey Exánime no me resucitó. Eyir dice que ella no tiene el mojo necesario. Bwonsamdi eh\'tá tan confundido como nosotro\'. Y nadie quería ver a Sylvanas al mando.', '', 30706),
(165706, 'esMX', '¡Enemigo a la vista! ¡A las armas!', '¡Enemigo a la vista! ¡A las armas!', 30706),
(165705, 'esMX', '¡Guardias! ¡Rodéenlos!', '¡Guardias! ¡Rodéenlos!', 30706),
(165704, 'esMX', '¡Te encontré!', '¡Te encontré!', 30706),
(165703, 'esMX', '¡|cFFEF0201$n|r ha activado un extractor de azerita!', '¡|cFFEF0201$n|r ha activado un extractor de azerita!', 30706),
(165702, 'esMX', '<Esta tarántula ha tenido mejores días. \n\nParece que la mataron a golpes.>', '<Esta tarántula ha tenido mejores días. \n\nParece que la mataron a golpes.>', 30706),
(165701, 'esMX', '¡No sé qué es peor, si la Alianza o los trols de sangre! Bueno... En realidad, sí lo sé. ¡Pero vamos a destruirlos a todos!', '', 30706),
(165700, 'esMX', '¡Ya era hora! Empezaré a reconstruir el M.I.D.A.S.-V.', '', 30706),
(165699, 'esMX', '', 'Ojalá pudiera decir que este es el peor lugar en el que me he ocultado. Pero no es así. Iré a reparar el M.I.D.A.S.-V.', 30706),
(165698, 'esMX', 'Qué bueno verte, $n. ¿Reconstruiremos el M.I.D.A.S.-V? ¡Cuenta conmigo!', '', 30706),
(165697, 'esMX', '[PH] Llegada a las Ruinas de Auberdine.', '[PH] Llegada a las Ruinas de Auberdine.', 30706),
(165696, 'esMX', '', '¡Los atacaremos velozmente y por sorpresa!', 30706),
(165695, 'esMX', 'Que comience el ataque.', 'Que comience el ataque.', 30706),
(165694, 'esMX', '', 'Como ordenes. Esos monstruos sufrirán por lo que han hecho.', 30706),
(165693, 'esMX', '', 'Convoquen a nuestros aliados. Afilen sus gujas. Costa Oscura volverá a ser nuestra.', 30706),
(165692, 'esMX', '', '$p, ¡concéntrate en las val\'kyr! Yo me encargaré de este bruto.', 30706),
(165691, 'esMX', '', 'La cólera de Elune guía mi guja. Los percibo más adelante.', 30706),
(165690, 'esMX', '', 'Ahí está.', 30706),
(165689, 'esMX', '', 'Ahora ve. Recuerda tu deber con la Horda. Tenemos una guerra que ganar.', 30706),
(165688, 'esMX', '', 'Voy a ser muy clara. Encontrarás a ese traidor de Colmillosauro. Me lo entregarás. Y no volverás a fallarme nunca más.', 30706),
(165687, 'esMX', '', 'Es afortunado que hayas escapado con apenas un magullón. Afortunado... pero decepcionante.', 30706),
(165686, 'esMX', '', 'Déjame ver si entendí bien... ¿Colmillosauro asesinó por si solo a mis fuerzas de élite y a una forestal oscura veterana?', 30706),
(165685, 'esMX', '', 'Sigue avanzando. Seguramente aparecerán más.', 30706),
(165684, 'esMX', '', '¡Cuidado!', 30706),
(165683, 'esMX', '', 'Esperemos que Tyrande siga ahí.', 30706),
(165682, 'esMX', '', 'El Ojo de Elune debe estar en el Recinto de los Cazadores. ¡Adelante!', 30706),
(165675, 'esMX', '', 'Que la diosa te proteja.', 30706),
(165674, 'esMX', '', 'Cuando tú digas.', 30706),
(165673, 'esMX', '', 'Así se hará.', 30706),
(165672, 'esMX', '', 'Las centinelas están listas.', 30706),
(165671, 'esMX', '', 'Mis disparos nunca fallan.', 30706),
(165670, 'esMX', '', 'Te escucho.', 30706),
(165669, 'esMX', '', '¡$p, por aquí! ¡Llegaste justo a tiempo!', 30706),
(165668, 'esMX', '', '¡No permitas que pase la Horda!', 30706),
(165667, 'esMX', '', '¡Resiste!', 30706),
(165666, 'esMX', 'Nuestro coinventor, Grong, ha tenido la grandeza de ofrecerse para que lo engrandezcamos por el bien común.', '', 30706),
(165665, 'esMX', 'Una vez que el proceso esté completo, ¡lo desataremos sobre la Horda!', '', 30706),
(165664, 'esMX', '¿Si lo probamos con la Horda?', '', 30706),
(165663, 'esMX', 'Producto del intelecto da\'kani y el ingenio goblin.', '', 30706),
(165662, 'esMX', '', 'Pero primero tenemos que hacer una pequeña prueba.', 30706),
(165661, 'esMX', '', 'Lo siento. Es que todos sabemos que tú eres su preferido.', 30706),
(165660, 'esMX', '', '¡No digas ridiculeces! Si funciona, ¡nuestros enemigos serán el arma más poderosa!', 30706),
(165659, 'esMX', '', '¡Qué mala idea! ¿Serás tú quien le diga a Halford que matamos a su mascota si las cosas salen mal?', 30706),
(165658, 'esMX', '', 'Estrictamente hablando, convierte la inteligencia en tamaño y fuerza, pero no queremos aburrirlos con los detalles.', 30706),
(165657, 'esMX', '', 'Como su nombre indica, agranda las cosas.', 30706),
(165656, 'esMX', '', 'Te presentamos... ¡el Engrandecedor!', 30706),
(165655, 'esMX', '', '¡Somos... los… kaldorei!', 30706),
(165654, 'esMX', '', 'Y ese error fue su ruina. Porque nuestra esperanza no vive en los árboles, ¡vive en el espíritu que nos une!', 30706),
(165653, 'esMX', '', 'La Horda quemó nuestros bosques para matar nuestra esperanza.', 30706),
(165652, 'esMX', '', '¡Elune nos ha dado el poder para salvarnos!', 30706),
(165651, 'esMX', '', '¡La victoria es nuestra esta noche!', 30706),
(165650, 'esMX', '', 'Nos vengaremos de esta masacre, ¡y le demostraré a Sylvanas que ella no ha ganado! Y si la Alianza no nos ayuda... lo haremos solos.', 30706),
(165649, 'esMX', 'Tyrande...', '', 30706),
(165648, 'esMX', '', 'Saber que la Horda no puede usarlo contra mi gente me deja más tranquila. Te agradezco que lo hayas traído de regreso.', 30706),
(165647, 'esMX', '', 'Crecí con las historias sobre el poder de este artefacto.', 30706),
(165646, 'esMX', 'La Alianza recordará por siempre la valentía y el sacrificio de héroes como el maestro del acero Telaamon.', '', 30706),
(165645, 'esMX', 'Esta será nuestra base. ¡Bashal\'Aran pertenece a la Horda!', '', 30706),
(165644, 'esMX', '', 'Recuperaremos Bashal\'Aran para la Horda. ¡Andando!', 30706),
(165643, 'esMX', 'Bashal\'Aran. Supo ser una joya resplandeciente... La recuperaremos.', '', 30706),
(165642, 'esMX', '¿La Reina alma en pena te ha enviado a matar más inocentes, Clamañublo?', '', 30706),
(165641, 'esMX', 'Hagan de cuenta que el enemigo vigila cada paso que damos. Sigan adelante.', '', 30706),
(165640, 'esMX', '', 'Buena caza, adalid.', 30706),
(165639, 'esMX', '', '¿Acaso la Horda te ha quitado todo el honor, Sira? Responderás por tus actos.', 30706),
(165638, 'esMX', '', 'No tengas piedad. Maiev no tendrá piedad contigo.', 30706),
(165637, 'esMX', 'Pero miren quién decidió venir. ¡El mismísimo líder de los elfos de la noche!', '', 30706),
(165636, 'esMX', 'Resistiremos. ¡La Horda pagará por lo que ha hecho aquí!', '', 30706),
(165635, 'esMX', 'Tendremos que hacer sacrificios... pero si vencemos, podremos ponerle fin a esta guerra en cuestión de semanas.', '', 30706),
(165634, 'esMX', '¡A la costa... ahora!', '', 30706),
(165633, 'esMX', '', '¡A la costa! ¡Antes de que nos arrasen!', 30706),
(165632, 'esMX', 'Ahora, ¡a la costa!', '', 30706),
(165631, 'esMX', '', 'Si queremos poner fin a este horror, debemos recuperar Bashal\'Aran. ¡Andando!', 30706),
(165630, 'esMX', '', 'Elune ha abandonado estas tierras. ¡Márchense o morirán!', 30706),
(165629, 'esMX', '', '¡Maiev! Eres una necia si crees que puedes detenernos.', 30706),
(165628, 'esMX', '', 'No flaquees. La Horda ha pisado suelo kaldorei. ¡Recuperaremos Auberdine!', 30706),
(165627, 'esMX', '', '<se ríe>', 30706),
(165626, 'esMX', 'Ahora nos toca esperar. No te preocupes, los gnomos protegerán nuestra arma secreta hasta que llegue el momento oportuno.', '', 30706),
(165625, 'esMX', 'No hace falta disculparse, lady almirante. Nos alegra tenerla de vuelta en nuestros operativos.', '', 30706),
(165624, 'esMX', 'No te demores. No sé qué habrá descubierto Kelsey, pero puede ser clave para ganar una ventaja táctica en esta guerra.', '', 30706),
(165623, 'esMX', 'Bien, has venido. No perdamos tiempo.', '', 30706),
(165622, 'esMX', 'Se acerca el momento de la acción. Estamos por cambiar el curso de esta guerra. Ven a verme a bordo del Redención del Viento en cuanto puedas.', '', 30706),
(165621, 'esMX', '', 'Alto comandante, lamento la demora. Tenía que atender un asunto que requería mi atención.', 30706),
(165620, 'esMX', '¡NO SIGAN!', '', 30706),
(165619, 'esMX', '|TInterface\\ICONS\\ABILITY_PALADIN_BEACONOFLIGHT:20|tUn cruzado comienza a lanzar |cFFFF0000|Hspell:283650|h[Fe cegadora]|h|r!', '', 30706),
(165618, 'esMX', '', '|TInterface\\ICONS\\SPELL_HOLY_SEALOFWRATH:20|tFrida Bramidos Férreos comienza a liberar |cFFFF0000|Hspell:284436|h[Sello de expiación]|h|r!', 30706),
(165617, 'esMX', '', '|TInterface\\ICONS\\Ability_Paladin_EmpoweredSealsRighteous:20|tFrida Bramidos Férreos comienza a liberar |cFFFF0000|Hspell:284469|h[Sello de reprensión]|h|r!', 30706),
(165616, 'esMX', '', 'Yo también. Pero pase lo que pase, Kul Tiras y la Alianza resistirán juntas.', 30706),
(165615, 'esMX', '', 'Gracias, Lady almirante. Fue un honor prestarle servicio. Espero que podamos terminar pronto con esta guerra.', 30706),
(165614, 'esMX', '', 'Hiciste un buen trabajo, Taelia. Creo que tendremos que volver a confiar en tu valentía antes de que todo esto termine.', 30706),
(165613, 'esMX', '', 'Por favor, dile al alto comandante Aterravermis que iré a verlo al Redención del Viento en cuanto pueda. Gracias por tu ayuda hoy.', 30706),
(165612, 'esMX', '', 'Las fuerzas de la Alianza creen que nos han atrapado en Fuerte Guerracolmillo, ¡pero son ellos los que caerán en la trampa!', 30706),
(165611, 'esMX', 'Rokhan, tú vienes conmigo. Tenemos que recuperar esas piezas para los goblins.', '', 30706),
(165610, 'esMX', '', '¡Hora de vencer a la Horda!', 30706),
(165609, 'esMX', '', 'Es el último trabajador del embarcadero. Están a salvo.', 30706),
(165608, 'esMX', '', 'En un ritual sagrado, la más fuerte de ellas se convirtió en su avatar: la guerrera nocturna. Nuestra victoria fue veloz.', 30706),
(165607, 'esMX', '', '¡Mantente firme! ¡Acaba con el enemigo!', 30706),
(165606, 'esMX', 'Una más... ¡Listo! La última trampa está desarmada. Mmmm. Tu trabajo es aceptable, Céfiro.', '', 30706),
(165605, 'esMX', '¿Podemos concentrarnos? Ya casi termino con las últimas trampas.', '', 30706),
(165604, 'esMX', 'Ahora que lo pienso, estos gólems de piedra furiosos me recuerdan a mi ex.', '', 30706),
(165603, 'esMX', 'Me conmueve tu preocupación, pero se necesita más que unas máscaras feas y unos gólems de piedra furiosos para derribarme.', '', 30706),
(165602, 'esMX', '¿El infame Flynn Céfiro no puede contra un puñado de máscaras místicas?', '', 30706),
(165601, 'esMX', 'Sí... Bueno, parece que la Alianza destrozó el aparato y se llevó algunas partes. ¡Y al escuadrón goblin!', '', 30706),
(165600, 'esMX', '', '¿Dónde está el M.I.D.A.S.-G?', 30706),
(165599, 'esMX', 'Si rescata a mi tripulación y recupera las partes, lo arreglaré de inmediato y regresaremos por lo que es nuestro.', '', 30706),
(165598, 'esMX', 'Hay una forma de solucionar esto, princesa. ¡El M.I.D.A.S.-V! Pero la Alianza lo atacó y robó algunas de sus partes.', '', 30706),
(165597, 'esMX', 'Y los perros de la Alianza han colocado trampas por toda la zona. No podemos marchar con nuestro ejército aquí.', '', 30706),
(165596, 'esMX', '', 'Explíquense. Aquí hay dos ejército\' que en lugar de atacar a la Alianza aguardan con los brazos cruzado\'.', 30706),
(165595, 'esMX', 'Oigo a Bwonsamdi... riendo.', 'Oigo a Bwonsamdi... riendo.', 30706),
(165594, 'esMX', 'Me lo... prometieron...', 'Me lo... prometieron...', 30706),
(165593, 'esMX', 'Loa... tengan piedad...', 'Loa... tengan piedad...', 30706),
(165592, 'esMX', '¿Necesitas ayuda? ¿Consejos? He desactivado una que otra trampa alguna vez.', '', 30706),
(165591, 'esMX', '¡Qué lenta es tu paciencia!', '', 30706),
(165590, 'esMX', 'Es un mecanismo complicado. Hay que desactivarlo con paciencia y delicadeza.', '', 30706),
(165589, 'esMX', '¿Cómo van las cosas allí? ¿Falta poco?', '', 30706),
(165588, 'esMX', 'No te preocupes, ¡puedes contar con nosotros!', '', 30706),
(165587, 'esMX', 'Conténganlos. Yo me ocupo de esto.', '', 30706),
(165586, 'esMX', 'Ah... oh....', '', 30706),
(165585, 'esMX', '¡Matar!', '', 30706),
(165584, 'esMX', '¡Todos caerán!', '', 30706),
(165583, 'esMX', 'La Alianza eh\'tá poniendo a prueba mi paciencia. Ya estarían todos muerto\' si no fuera por esta niebla.', '', 30706),
(165582, 'esMX', '', 'Gracias. Busquemos un lugar tranquilo para hablar.', 30706),
(165581, 'esMX', 'Hay muchas cosas que explicar. Algunas no termino de comprenderlas... Pero te diré lo que sé.', '', 30706),
(165580, 'esMX', '', 'Pasaron tantas cosas en mi ausencia. Anduin... he oído rumores sobre una vieja amiga mía... Calia Menethil. ¿Qué ocurrió en Arathi?', 30706),
(165579, 'esMX', 'Qué bueno tenerte de vuelta con nosotros, tía. Te extrañé.', '', 30706),
(165578, 'esMX', '', 'Sigo recuperándome, pero... Estaré bien. Ya tienes bastante para además tener que preocuparte por mí.', 30706),
(165577, 'esMX', 'Basta de lamentos. ¿Cómo estás tú? Detuviste a los guerreros más grandes de la Horda para que nuestra flota se retirara. Arriesgaste todo por la Alianza, Jaina.', '', 30706),
(165576, 'esMX', '', 'Fue una batalla costosa... en muchos sentidos.', 30706),
(165575, 'esMX', 'Nuestros sacerdotes tampoco saben qué hacer. La historia hablará de nuestra gran victoria en Zuldazar. Pero no veo motivos para celebrar.', '', 30706),
(165574, 'esMX', '', '¿La Luz puede curarlo?', 30706),
(165573, 'esMX', '', 'Lo siento. El mecanismo que conserva su cuerpo no se parece a ningún tipo de magia que conozca.', 30706),
(165572, 'esMX', 'Jaina, ¿hay algo que puedas hacer para ayudar a Mekkatorque?', '', 30706),
(165571, 'esMX', 'Tenemos que seguir peleando. Pero mientras luchamos por la victoria, no debemos olvidar quiénes somos y qué representamos.', '', 30706),
(165570, 'esMX', 'Ella es el verdadero problema aquí. Ya debe estar buscando formas de poner esto a su favor.', '', 30706),
(165569, 'esMX', '*gruñido furioso* No.', '', 30706),
(165568, 'esMX', '', 'Lo último que deseo es ser como Sylvanas Brisaveloz. ¿Y tú, Genn?', 30706),
(165567, 'esMX', '...Su reina lo haría.', '', 30706),
(165566, 'esMX', 'Muéstrame.', 'Muéstrame.', 30706),
(165565, 'esMX', '', '¿Atacar mientras los zandalari lamentan la muerte de su rey? Caeríamos al nivel de esa Alma en pena.', 30706),
(165564, 'esMX', 'Grandes partes de Nazmir ahora eh\'tán en manos de la Alianza. Eh\'tán usando esta niebla para cubrir sus movimiento\'.', '', 30706),
(165563, 'esMX', 'La Horda nunca ha estado tan vulnerable. Deberíamos lanzar un ataque decisivo... antes de que Sylvanas trame otro plan macabro.', '', 30706),
(165562, 'esMX', 'Más de la mitad de las naves zandalari se destruyeron en el primer ataque, y la flota de la Horda se ha desbandado. Las naves que quedan no resistirán contra la armada kultirana.', '', 30706),
(165561, 'esMX', 'Pero nuestra misión era abrir una grieta entre los zandalari y la Horda. En cambio, quizás hayamos fortalecido su vínculo.', '', 30706),
(165560, 'esMX', 'Fue una víctima de la guerra, Anduin. Un rey debe estar dispuesto a sacrificarse por su pueblo sin dudar ni un instante.', '', 30706),
(165559, 'esMX', '<Dori\'thur te mira expectante.>', '', 30706),
(165558, 'esMX', 'Lo sé, Genn... mejor que nadie.', '', 30706),
(165557, 'esMX', 'Sí, ¿pero cuánto nos ha costado? Han caído tantos... incluido Mekkatorque, que lucha por su vida. Y temo que la muerte de Rastakhan encenderá una sed de venganza en el corazón de los zandalari.', '', 30706),
(165556, 'esMX', 'La Horda está perdiendo en todos los frentes. La Alianza logrará la victoria en cuestión de semanas.', '', 30706),
(165555, 'esMX', 'Mi rey, el ataque contra Zuldazar ha sido un éxito rotundo.', '', 30706),
(165554, 'esMX', '¿Qué has traído contigo?', '', 30706),
(165553, 'esMX', '¡Han atravesado la puerta del sur!', '¡Han atravesado la puerta del sur!', 30706),
(165552, 'esMX', 'No podemos volar en esta niebla, ya hemos perdido muchos guerreros. ¡La Alianza quiere demorar nuestro ataque!', '', 30706),
(165551, 'esMX', 'Yo quise ayudar a las fuerza\' que quedaban, pero la Alianza me superaba ampliamente. Ese Telaamon no es un guerrero cualquiera.', '', 30706),
(165550, 'esMX', '', '¿Puedes decirnos algo de eh\'ta niebla? ¿De las ruina\' de Zul\'jan?', 30706),
(165549, 'esMX', '$n ha atacado las fuente\' de azerita de la Alianza y liberado a Aspafresno. Deben estar desesperado\' por terminar con eh\'ta guerra.', '', 30706),
(165548, 'esMX', '', '¡Vamo\'! Iremos a Nazmir a ponerle fin a eh\'ta locura.', 30706),
(165547, 'esMX', '¡Enfréntenme, cobardes! ¡Boralus es imparable!', '', 30706),
(165545, 'esMX', '', 'Solo digamos que Dalaran estaba muy lejos de Kul Tiras, y necesitaba adaptarme. Yo también te extrañé, Tandred. Incluso las bromas.', 30706),
(165544, 'esMX', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tUna de las gujas de Sira cae al suelo, usa |cFFFF0000|Hspell:289205|h[Lanzar]|h|r para arrojarla contra un avatar de venganza humeante.', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tUna de las gujas de Sira cae al suelo, usa |cFFFF0000|Hspell:289205|h[Lanzar]|h|r para arrojarla contra un avatar de venganza humeante.', 30706),
(165543, 'esMX', 'La única pregunta que tengo es... ¿cuándo empezaste a hablar como una continental?', '', 30706),
(165542, 'esMX', 'Siempre supe de qué lado estabas. Y ahora todos los demás también.', '', 30706),
(165541, 'esMX', 'Jaina, nuestra flota estaba perdida. Si no nos hubieras llamado, jamás habríamos sobrevivido allí, tal como Boralus no habría sobrevivido a Aspafresno.', '', 30706),
(165540, 'esMX', '', 'Temí que nuestro pueblo nunca me volvería a aceptar. No había nada que pudiera hacer para recuperar su afecto. El de mamá. El tuyo.', 30706),
(165539, 'esMX', '', '¡Basura de la Horda!', 30706),
(165538, 'esMX', '', '¡Bandu thoribas!', 30706),
(165537, 'esMX', '', '¡No sobrevivirán!', 30706),
(165536, 'esMX', 'Al final la naturaleza prevalecerá...', '', 30706),
(165535, 'esMX', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tMaiev |cFFFF0000|Hspell:284952|h[arremeterá]|h|r hacia tu ubicación, ¡guía su ataque hacia uno de los avatares de Sira!', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tMaiev |cFFFF0000|Hspell:284952|h[arremeterá]|h|r hacia tu ubicación, ¡guía su ataque hacia uno de los avatares de Sira!', 30706),
(165534, 'esMX', '<TEMP>Line', '', 30706),
(165533, 'esMX', '¡Teman a lo salvaje!', '', 30706),
(165532, 'esMX', '¡Los vientos responden a mi llamado!', '', 30706),
(165531, 'esMX', 'Siente la ira de la naturaleza.', '', 30706),
(165530, 'esMX', '<TEMP>Line 4', '', 30706),
(165529, 'esMX', '¡Basta de charla, Clamañublo! ¡Terminemos con esto!', '', 30706),
(165528, 'esMX', '<TEMP>Line 1', '', 30706),
(165527, 'esMX', 'Estamos listos para comenzar, milord.', 'Estamos listos para comenzar, milord.', 30706),
(165526, 'esMX', '<Nathanos te observa con ojos fríos. No crees que sea buena idea hacerle perder el tiempo.>', '<Nathanos te observa con ojos fríos. No crees que sea buena idea hacerle perder el tiempo.>', 30706),
(165525, 'esMX', 'Es imposible... derrotar a la muerte.', '', 30706),
(165524, 'esMX', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tMaiev |cFFFF0000|Hspell:284952|h[arremeterá]|h|r hacia tu ubicación, ¡guía su ataque hacia uno de los avatares de Sira!', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tMaiev |cFFFF0000|Hspell:284952|h[arremeterá]|h|r hacia tu ubicación, ¡guía su ataque hacia uno de los avatares de Sira!', 30706),
(165523, 'esMX', '¡La naturaleza exige venganza!', '', 30706),
(165522, 'esMX', '<TEMP>Line', '', 30706),
(165521, 'esMX', '<TEMP>Line', '', 30706),
(165520, 'esMX', 'La muerte nos llega a todos.', '', 30706),
(165519, 'esMX', '<TEMP>Line 4', '', 30706),
(165518, 'esMX', '¡Costa Oscura es nuestra! ¡Purgaremos estos bosques de ti y de tu Horda!', '', 30706),
(165517, 'esMX', '¡Se terminó, Clamañublo! ¡Estás a merced de la naturaleza!', '', 30706),
(165516, 'esMX', '<TEMP>Line 1', '', 30706),
(165515, 'esMX', 'Estamos listos para comenzar, archidruida.', 'Estamos listos para comenzar, archidruida.', 30706),
(165514, 'esMX', '<Malfurion aguarda con paciencia.>', '<Malfurion aguarda con paciencia.>', 30706),
(165513, 'esMX', '', 'Y así termina la saga más trágica de la historia de nuestro pueblo. Sígueme, $p. Es hora de devolver el farol a Lunargenta.', 30706),
(165512, 'esMX', '¡El poder de los loa cah\'tigará su arrogancia!', '', 30706),
(165511, 'esMX', '¡Invasores! ¡Profanadores! ¡Cómo se ATREVEN a perturbar nueh\'tros rituales!', '', 30706),
(165510, 'esMX', '', 'Tu fin... se acerca.', 30706),
(165509, 'esMX', '', 'No me derrotarán tan fácilmente...', 30706),
(165508, 'esMX', 'No puedo creer que la Alianza esté atacándono\' desde Nazmir. ¡Es una locura cruzar por ese lugar!', '', 30706),
(165507, 'esMX', 'La Alianza eh\'tá usando un vudú extraño, ¡ten cuidado!', 'La Alianza eh\'tá usando un vudú extraño, ¡ten cuidado!', 30706),
(165506, 'esMX', '', 'Nuestro pueblo habría sufrido el mismo destino si hubiéramos quedado vinculados a su magia. Apesadumbrado, el príncipe Kael\'thas decidió destruir la Fuente del Sol. ', 30706),
(165505, 'esMX', 'Uno de estos día\', seré yo el que te rescate. Ah, no le digas nada sobre eh\'to a Jabari.', 'Uno de estos día\', seré yo la que te rescate. Ah, no le digas nada sobre eh\'to a Jabari.', 30706),
(165504, 'esMX', '¡Pensé que no volveríamos a verno\'! Gracias por la ayuda, volveré con Rakera.', '¡Pensé que no volveríamos a verno\'! Gracias por la ayuda, volveré con Rakera.', 30706),
(165502, 'esMX', '', 'Arthas asesinó a nuestras fuerzas y utilizó la Fuente del Sol para resucitar a Kel\'Thuzad como un poderoso exánime, y corrompió sus aguas para siempre.', 30706),
(165501, 'esMX', '', '¡Jajajajaja! ¡Que ardan, $p! ¡Por la Horda!', 30706),
(165500, 'esMX', '', 'Eliminé los frenos para poder guardar un poco más de azerita. ¡Espero que no te moleste!', 30706),
(165498, 'esMX', '', '¡Hecho! ¡Es un contrato que no se puede romper!', 30706),
(165497, 'esMX', '', 'Je. Tú consigue la azerita y yo me encargo de la explosión, pequeñita.', 30706),
(165496, 'esMX', '', 'Tenemos que crear más. Cientos... Millones... ¡Bombillones!', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(165495, 'esMX', '', 'Sabía que terminarías valorando mi intelecto.', 30706),
(165494, 'esMX', '', 'Uraka sonríe.', 30706),
(165493, 'esMX', '', '¡Wuu! ¡Tu estrella de hierro hizo vibrar mi puesto desde las puertas principales, Uraka!', 30706),
(165491, 'esMX', '', 'La Alianza tuvo las agalla\' de atacar desde Nazmir.\n\nUn ataque estúpido, pero valiente. Les mostraremo\' cuál es el precio de su orgullo.', 30706),
(165490, 'esMX', '', 'Mataron a mi hermana antes de que pudiera cumplir su parte del pacto con la Dama Oscura.\n\nSomos tan pocas ahora.', 30706),
(165489, 'esMX', '¡Iré a buscar a la princesa, han capturado las ruina\' de Zul\'jan!', '', 30706),
(165488, 'esMX', '¡La Horda será erradicada, por el bien de Azeroth!', '', 30706),
(165487, 'esMX', '¡No podrán frenar el ataque de la Alianza!', '', 30706),
(165486, 'esMX', '¿Qué querías mostrarme?', '¿Qué querías mostrarme?', 30706),
(165485, 'esMX', '<Nathanos contempla el bosque con odio indisimulado.>', '', 30706),
(165484, 'esMX', '', 'En fin, nunca me agradaron tus manos de todas formas.', 30706),
(165483, 'esMX', '', 'Díselo a Kil\'rip. ¡Jajaja!', 30706),
(165482, 'esMX', '', 'Y quítate esa estúpida máscara. No eres una Riecráneos.', 30706),
(165481, 'esMX', '', 'Cierra el pico, Quizla. Sé lo que hago.', 30706),
(165480, 'esMX', '', 'Estás guardando demasiada azerita en este compartimento, Uraka. Vas a perder una mano.', 30706),
(165479, 'esMX', '', 'Agh... Otra vez, no...', 30706),
(165478, 'esMX', '¡Estoy listo, envíenme a Gnomeregan!', '¡Estoy lista, envíenme a Gnomeregan!', 30706),
(165477, 'esMX', '', 'Tú más que nadie deberías saber que pelear es inútil.', 30706),
(165476, 'esMX', '', 'No ganarás. ¡Como si pudieras matarme!', 30706),
(165474, 'esMX', 'Muy bien, adalid. Será mejor que volvamo\' a Orgrimmar... antes de que aparezcan más enemigo\'.', '', 30706),
(165473, 'esMX', 'Eso eh\'pero. Te necesitamo\'.', '', 30706),
(165472, 'esMX', 'Ve con honor. Volveremos a vernos.', '', 30706),
(165471, 'esMX', 'Hoy no, amigo mío. Este es un camino que debo recorrer solo.', '', 30706),
(165470, 'esMX', 'De ninguna manera, colega. ¡Iré contigo! Donde vaya el alto señor supremo, ahí eh\'taré.', '', 30706),
(165469, 'esMX', 'Zekhan, necesito que te quedes en Orgrimmar. Que todos los que quieren recuperar el honor de la Horda sepan que no deben abandonar la esperanza.', '', 30706),
(165468, 'esMX', 'Regresa con la reina alma en pena. Dile que no soy peón de nadie.', '', 30706),
(165467, 'esMX', 'Ah, bien. Sigues con vida. Poca… pero estás de pie.', '', 30706),
(165466, 'esMX', '¿Todo listo? Respira hondo. Me temo que no tengo mucha práctica en controlar mis golpes.', '', 30706),
(165465, 'esMX', 'Para conservar el favor del alma en pena, ella tiene que creer que te derroté. Pero tiene que parecer que fue una pelea dura.', '', 30706),
(165464, 'esMX', '¡Ey! ¡Lo logramos, colega! ¡Qué batalla! ¿Me vih\'te? ¡Echaba chispas!', '', 30706),
(165463, 'esMX', '¡Veamos cómo se las arreglan con este lindo artilugio!', '', 30706),
(165462, 'esMX', '¡Prepárense para una experiencia electrizante!', '', 30706),
(165461, 'esMX', '¡Prueba la artillería gnómica superior!', '', 30706),
(165460, 'esMX', '¡Van a quedar todos pequeñitos!', '', 30706),
(165459, 'esMX', '¡Propulsores activados!', '', 30706),
(165458, 'esMX', '', 'Guau... ¿de verdad?', 30706),
(165457, 'esMX', '', '¡Camaradas, a mí! ¡$UUn necio:Una necia; se atreve a desafiarme!', 30706),
(165456, 'esMX', 'Imposible....', '', 30706),
(165455, 'esMX', 'Mmm. Hace años que peleo contra la Horda. ¿Qué te hace pensar que puedes ganar?', '', 30706),
(165454, 'esMX', 'Tendría que haber... cobrado...', '', 30706),
(165453, 'esMX', 'Te daré este consejo: ¡No husmees en campos enemigos!', '', 30706),
(165452, 'esMX', '', 'Maten al traidor. ¡Y a todos los que lo defienden!', 30706),
(165451, 'esMX', '¡Por el honor de la Horda! ¡Lok-tar ogar!', '', 30706),
(165450, 'esMX', '¡Basta de charla, forestal oscura! Si viniste a buscar una pelea, ¡la tendrás!', '', 30706),
(165449, 'esMX', 'En nombre de la Alianza, estoy autorizado para aceptar su rendición.', '', 30706),
(165448, 'esMX', '¡Pongamos a prueba ese intelecto de la Horda del que Gallywix tanto presume!', '', 30706),
(165447, 'esMX', 'Veo que aún no has aprendido a temer a los enfrentamientos imposibles, mi joven amigo. Es un honor pelear a tu lado.', '', 30706),
(165446, 'esMX', '¡Fuerzas de la Alianza, diríjanse al puerto! Yo los cubriré.', '', 30706),
(165445, 'esMX', 'Si los loa quieren que caigamo\' aquí, lo haremo\' juntos. ¡Como la Horda!', '', 30706),
(165444, 'esMX', '¡Solo no!', '', 30706),
(165443, 'esMX', '', 'O morirás aquí, en el pantano, solo.', 30706),
(165442, 'esMX', '', 'Bajarás tu arma de inmediato y vendrás con nosotros.', 30706),
(165441, 'esMX', '', 'Y peor aún, después de abandonar a tu gente, conspiraste con humanos contra tu propia jefa de guerra.', 30706),
(165440, 'esMX', '', 'Faltaste a tu deber con la Horda, Colmillosauro.', 30706),
(165439, 'esMX', '¿Y cuáles son esas órdenes?', '', 30706),
(165438, 'esMX', '¿No les queda ni una pizca de honor? ¿Cómo van a darle la espalda a Colmillosauro despué\' de todo lo que hizo por la Horda?', '', 30706),
(165437, 'esMX', 'Sistemas... en riesgo... Sáquenme... de aquí...', '', 30706),
(165436, 'esMX', 'El traje... falla... Esto... no luce bien...', '', 30706),
(165435, 'esMX', 'Por eso hay que invertir en tecnología gnómica... ¡Y no en esa basura goblin!', '', 30706),
(165434, 'esMX', '¡Por Gnomeregan!', '', 30706),
(165433, 'esMX', '¡Uno menos! ¡Los que siguen!', '', 30706),
(165432, 'esMX', '¡Objetivo eliminado!', '', 30706),
(165431, 'esMX', '¡Conocerán el pináculo de la tecnología gnómica!', '', 30706),
(165430, 'esMX', 'He calculado sus probabilidades de sobrevivir. ¡No son buenas!', '', 30706),
(165429, 'esMX', 'Cuidado... con la hija... del mar...', '', 30706),
(165428, 'esMX', '¡Guardias, a mí! ¡Expulsaremos a esta escoria de la Horda de nuestra ciudad!', '', 30706),
(165427, 'esMX', 'Sea lo que sea, no debe triunfar. Debes estar $ulisto:lista; para cuando vuelva a llamarte, $n. Detendremos a Sylvanas... de una vez y para siempre.', '', 30706),
(165426, 'esMX', 'Sylvanas envió a sus campeones a ese santuario por una razón. Debe haber descubierto algo que puede darle una ventaja en la guerra.', '', 30706),
(165425, 'esMX', 'La Alianza está a un paso de la victoria. A un paso de terminar con este conflicto y traer la paz a Azeroth.', '', 30706),
(165424, 'esMX', 'Otro dios antiguo ha despertado... Esto es un mal augurio. Nuestro mundo ya está sufriendo demasiado. La herida de Silithus, la guerra...', '', 30706),
(165423, 'esMX', 'Las defensas automatizadas de Gnomeregan están en alerta roja. Si de verdad quieres ir allí, ¡ten cuidado!', '', 30706),
(165422, 'esMX', '', 'Adalid, tú y ese trol no se deben entrometer en este asunto. ¡Cumplo órdenes directas de la jefa de guerra!', 30706),
(165421, 'esMX', '', '¡Varok Colmillosauro! Eres culpable de traición a la Dama Oscura. Sal de la cabaña o la haré arder... como a ese árbol que tanto amaban tus amigos de la Alianza.', 30706),
(165420, 'esMX', 'Colmillosauro eh\'tá escondido en una pequeña granja aquí cerca. ¡Será mejor que lo encontremos antes que ellos!', '', 30706),
(165419, 'esMX', 'Ey, colega. ¡Aquí! ¡Necesito tu ayuda!', '', 30706),
(165418, 'esMX', '', 'Debo informarle a la jefa de guerra. Tú no harás nada más hasta que vuelva a contactarte. ¿Entendido?', 30706),
(165417, 'esMX', '<Prepárate para defender el ritual.>', '<Prepárate para defender el ritual.>', 30706),
(165416, 'esMX', '¡Ey! ¡Tú estás con la Horda! ¿No es cierto? ¡$UAtrápenlo:Atrápenla;, muchachos!', '', 30706),
(165415, 'esMX', 'Ahora que lo pienso, es exactamente lo que están haciendo ahora...', '', 30706),
(165414, 'esMX', 'Ladraban y gruñían como desquiciados. Se comportan así cada vez que se acerca algún pillo de la Horda.', '', 30706),
(165413, 'esMX', 'Debe haber sido su orco el que enloqueció a mis perros anoche.', '', 30706),
(165412, 'esMX', 'Si eran de su orco, entonces es un orco grande. Vayan con cuidado.', '', 30706),
(165411, 'esMX', 'Encontré unas huellas enormes esta mañana. Cruzaban el paso de montaña y se internaban en el pantano.', '', 30706),
(165410, 'esMX', '', '¿Vio alguna señal de por dónde pudo haber pasado semejante monstruo?', 30706),
(165409, 'esMX', '', 'Un orco asqueroso asaltó nuestra granja durante la noche. ¡Se robó una reliquia familiar invaluable!', 30706),
(165408, 'esMX', '', 'Buen señor, ¿podría ayudarnos?', 30706),
(165407, 'esMX', '', '¡Puaj! Nunca me acostumbraré al sabor de esta poción asquerosa.', 30706),
(165406, 'esMX', '', 'Dame un momento para explorar la zona. Volveremos a encontrarnos en Paso Crestagrana.', 30706),
(165405, 'esMX', '', 'Qué pena. Me encantan las arañas.', 30706),
(165404, 'esMX', '', '...a la madre.', 30706),
(165403, 'esMX', '', 'Lo que significa que nuestra presa también debe haberse enfrentado...', 30706),
(165402, 'esMX', '', 'Cuánto icor. Más de lo que esperaría de una de estas tarántulas jóvenes.', 30706),
(165401, 'esMX', '', 'Están muertas. Por los rastros que quedaron, diría que fue una pelea menor.', 30706),
(165400, 'esMX', '', 'Telarañas rotas. No quedan dudas de que alguien pasó por aquí. Y no era un gnoll.', 30706),
(165398, 'esMX', '<Derek gruñe mientras lo reviven.>', '', 30706),
(165397, 'esMX', '<Derek gime>', '', 30706),
(165396, 'esMX', '', '¡Necesitamos más tiempo! Termina, Signe. Yo me ocuparé de esto.', 30706),
(165395, 'esMX', '', '¡Por Kul Tiras!', 30706),
(165394, 'esMX', '', 'Pronto volveré a llamarte, adalid. Y $ujuntos:juntas; llevaremos a la Horda a su destino.', 30706),
(165393, 'esMX', '', 'Esto es más que una simple daga. Es una antorcha que iluminará el camino a seguir.', 30706),
(165392, 'esMX', '', 'Es una pena que esté inactiva. Pero todo lo que duerme puede despertar.', 30706),
(165391, 'esMX', '', 'Xal\'atath... Un arma fascinante. He oído historias sobre sus hazañas.', 30706),
(165386, 'esMX', '¡Toma esta mochila antisigilo y expulsa a esos perdedores!', '', 30706),
(165385, 'esMX', '¡Oye, tú! Hay espías por todo el lugar que están saboteando nuestras armas de asedio.', '', 30706),
(165384, 'esMX', 'Todos quieren que controle las tormentas, que cambie las mareas, pero nadie quiere sentarse a tener una conversación agradable.', '', 30706),
(165383, 'esMX', 'Jamás imaginé que la vida después de la muerte sería así.', '', 30706),
(165382, 'esMX', 'Sabes que yo era maresabio, ¿verdad? Puedo invocar relámpagos y controlar el mar. Solo quería confirmarlo.', '', 30706),
(165381, 'esMX', 'Disfruta de lo que tienes.', '', 30706),
(165380, 'esMX', 'Tienes que valorar esta vida.', '', 30706),
(165379, 'esMX', 'Nunca olvides lo que es valioso para ti.', '', 30706),
(165378, 'esMX', 'Lo importante es que mi familia estará a salvo.', '', 30706),
(165377, 'esMX', 'Ayudaré a la Horda, como ellos me ayudaron a mí.', '', 30706),
(165376, 'esMX', 'Este lugar es mi único hogar.', '', 30706),
(165375, 'esMX', '¡Ayuda!', '¡Ayuda!', 30706),
(165374, 'esMX', '', 'Bien, aquí estás. Empecemos.\n\nLa familia Valiente está detrás de la muerte del rey Rastakhan.\n\nMe parece lo más apropiado ocuparnos de ellos primero.', 30706),
(165373, 'esMX', '¿Cuál es el plan, lady almirante?', '¿Cuál es el plan, lady almirante?', 30706),
(165371, 'esMX', 'Estoy contigo.', 'Estoy contigo.', 30706),
(165370, 'esMX', '', 'El cobarde ya no tiene ningún lugar donde esconderse.', 30706),
(165369, 'esMX', '', '¡AYUDA! ¡Estoy atrapada!', 30706),
(165368, 'esMX', '', 'Sígueme y mantente cerca.', 30706),
(165367, 'esMX', 'Presentando respetos', 'Presentando respetos', 30706),
(165366, 'esMX', '', 'Es simple, Lord Valiente, le he dado una oportunidad para que se reencuentre con su familia.', 30706),
(165365, 'esMX', '¿Qué...? ¿Qué es esto? ¿Por qué...? ¡¿Qué me han hecho?!', '', 30706),
(165364, 'esMX', '', 'Para nosotros solo puede haber victoria o muerte, Baine.', 30706),
(165363, 'esMX', '¡Esto es demasiado!', '', 30706),
(165362, 'esMX', '', 'Y cuando terminemos de condicionar su mente, dejaremos que los Valiente recuperen a su príncipe perdido...', 30706),
(165361, 'esMX', '', 'Derek Valiente fue un héroe para los kultiranos.', 30706),
(165360, 'esMX', '¡¿Qué razón podría justificar esta locura?!', '', 30706),
(165359, 'esMX', '¡Sylvanas!', '', 30706),
(165358, 'esMX', '', 'Los espero en el Lamento del Alma en Pena. Tengo un plan para garantizar que la familia Valiente pague caro por la muerte de Rastakhan.', 30706),
(165357, 'esMX', '', 'No. Esta guerra no terminará hasta que la victoria sea nuestra. Hasta que el leoncito se arrodille ante mi trono.', 30706),
(165356, 'esMX', '', 'La Alianza ha asesinado al líder de los zandalari, ¿y tú quieres negociar?', 30706),
(165355, 'esMX', 'Tal vez podamos abrir las negociaciones...', '', 30706),
(165354, 'esMX', 'Sí, sí, parece que es este.', '', 30706),
(165353, 'esMX', 'Hmm... Me pregunto para qué sirve este botón...', '', 30706),
(165352, 'esMX', '¡Agh! ¡Ese no!', '', 30706),
(165351, 'esMX', 'Solo un turno más.', '', 30706),
(165350, 'esMX', '', 'Jaina, no deberías luchar sola. ¡Por lo menos ve con Taelia y $n!', 30706),
(165349, 'esMX', '', 'Me llevará un momento encontrar el camino.... Ah, ahí está. ¡Buena suerte!', 30706),
(165348, 'esMX', 'Dame un momento para ocultar nuestras acciones de sus resguardos... Listo.', '', 30706),
(165347, 'esMX', '', 'Magíster, creo que estamos listos para comenzar.', 30706),
(165346, 'esMX', 'Capitán Céfiro...', '', 30706),
(165345, 'esMX', 'Dime, ¿tenemos permitido retirar fondos adicionales de la tesorería?', '', 30706),
(165344, 'esMX', '', 'Esperamos que puedan reunir información de la pirámide para organizar el próximo asalto. Mekkatorque les ha dado un Artilugio de Posicionamiento Gnómico para realizar lecturas.', 30706),
(165343, 'esMX', 'Nuestro objetivo principal es el cetro abisal, pero el Manitas Mayor Mekkatorque nos ha asignado un segundo objetivo.', '', 30706),
(165342, 'esMX', 'Es en serio. ¿Conoces a mis amigos? La locura podría mejorarlos. Y los tentáculos serían un lindo toque también.', '', 30706),
(165341, 'esMX', 'Esta es una misión seria, Céfiro.', '', 30706),
(165340, 'esMX', '¿Por \"efectos secundarios\" te refieres a los tentáculos sombríos o a la caída en la locura? Un amigo quiere saber.', '', 30706),
(165339, 'esMX', 'Podemos convocar al Vacío para ocultar la magia que usará Lady Jaina para abrir el portal. Creemos haber eliminado todos los... efectos secundarios posibles.', '', 30706),
(165338, 'esMX', '', 'La tesorería está bien protegida, pero el magíster Umbric y yo tenemos una forma de que el equipo entre sin que se entere nadie.', 30706),
(165337, 'esMX', '¡No pasarán mientras respire!', '¡No pasarán mientras respire!', 30706),
(165336, 'esMX', '¡Caerán, monstruos!', '¡Caerán, monstruos!', 30706),
(165335, 'esMX', '¡Por Lunargenta!', '¡Por Lunargenta!', 30706),
(165334, 'esMX', '', 'No está aquí.', 30706),
(165333, 'esMX', 'Así que esta es la respuesta más rápida que puedo darte: no creo que hayamos visto perros anoche. Por lo menos no que yo recuerde.', '', 30706),
(165332, 'esMX', '¡No te des por vencido! Tienes un gran corazón, y eso tiene mucho valor.', '', 30706),
(165331, 'esMX', 'Mira, lo cierto es que nadie sabe arropar a un hombre como ella.', '', 30706),
(165330, 'esMX', 'En lugar de una velada romántica, la pobre Darcy se encontró con que tenía que llevar a dormir a un hombre descompuesto y limpiar el piso.', '', 30706),
(165329, 'esMX', 'Había comido pescado con patatas. Un almuerzo inolvidable.', '', 30706),
(165328, 'esMX', 'Le echa una mirada a los porotos con salchicha que ella está preparando para la cena y, sin previo aviso, la comida del mediodía vuelve a salir a escena.', '', 30706),
(165327, 'esMX', '¡Mi corazón no aguantó más! Un hombre que ha empinado el codo es un hombre sin defensas.', '', 30706),
(165326, 'esMX', 'Y entonces decide ir a informarle a la señorita Darcy Parker que se ha enamorado de ella.', '', 30706),
(165325, 'esMX', 'No hace falta que escuchen esta historia...', '', 30706),
(165324, 'esMX', 'De repente, ¡este había bebido tanto que casi no podía permanecer de pie!', '', 30706),
(165323, 'esMX', 'A decir verdad, lo mejor no fue la noche libre sino la botella de un ron exquisito... y la falta de órdenes de que no la bebiéramos toda en la misma noche.', '', 30706),
(165322, 'esMX', '¡Está bien! ¡Pero si el señor Shaw en persona vino a visitarnos! No todos los días el director de la IV:7 te da una noche libre.', '', 30706),
(165321, 'esMX', '¡Oye! ¡No hace falta contarles eso!', '', 30706),
(165320, 'esMX', '¿Anoche? No recordamos muy bien lo que pasó anoche, ¿verdad? ¡Jaja!', '', 30706),
(165319, 'esMX', '', 'Se escapó anoche. ¿Lo han visto?', 30706),
(165318, 'esMX', '', '¡Mi pobre hijita ha perdido a su cachorro!', 30706),
(165317, 'esMX', '', '¿Podrían ayudarnos, por favor?', 30706),
(165316, 'esMX', '¡No llevar! ¡Mío!', '', 30706),
(165305, 'esMX', '', '¡Me ENCANTAN las camisetas! ¡¿A ti te gustan tanto como a mí?! ¡IMPOSIBLE!', 30706),
(165304, 'esMX', '¡Tengo un mal presentimiento sobre esto! ¡Cuidado!', '', 30706),
(165303, 'esMX', '¡Cuidado!', '', 30706),
(165302, 'esMX', '¡Aj! ¡Ese es grande!', '', 30706),
(165301, 'esMX', '¡Rápido! ¡Quítales los suministros!', '', 30706),
(165300, 'esMX', '¡Toma esos suministros! ¡No permitas que se los queden los nagas!', '', 30706),
(165299, 'esMX', '¡Ja! ¡Los espantaste!', '', 30706),
(165298, 'esMX', 'Eso es, adalid, ¡que paguen!', '', 30706),
(165297, 'esMX', '¡Dales una lección a esos brutos escurridizos!', '', 30706),
(165296, 'esMX', 'Rescata a esos prisioneros... ¡antes de que los nagas les hagan algo peor!', '', 30706),
(165295, 'esMX', '¡Esos cautivos necesitan ayuda, adalid!', '', 30706),
(165285, 'esMX', 'Mi reina... Llegan informes de todos los puestos de avanzada. La Alianza está afirmando su dominio. La victoria está al alcance de sus manos.', '', 30706),
(165284, 'esMX', '', 'No les damos la espalda a nuestros aliados, Talanji. La campaña de guerra ha dado un giro desafortunado, es cierto... Pero nuestra causa no está perdida.', 30706),
(165283, 'esMX', '', 'Los título\' no significan nada para mí en este momento. Tengo que saber... Ahora que las naves zandalari eh\'tán destruidas... ¿La Horda nos abandonará?', 30706),
(165282, 'esMX', '', 'Lamento su pérdida, princesa... Es decir, Reina... Talanji.', 30706),
(165281, 'esMX', '¡Basta! La jefa de guerra ha llegado.', '', 30706),
(165280, 'esMX', '¡No es momento de hablar de venganza, Clamañublo!', '', 30706),
(165279, 'esMX', 'Has visto la traición de la Alianza con tus propios ojos. Deja que la venganza calme tu dolor.', '', 30706),
(165278, 'esMX', 'Conozco el dolor de perder a un padre. Si hay algo que pueda hacer, no dudes en pedírmelo.', '', 30706),
(165277, 'esMX', '', 'Gracia\' por venir, $n. Zuldazar sigue confundido despué\' del ataque de la Alianza. La fe de mi pueblo se ha conmovido... y la mía también.', 30706),
(165276, 'esMX', 'Creo que aquí se sienten como peces fuera del agua. ¡Ja! Ejem... Buen trabajo.', '', 30706),
(165275, 'esMX', 'Esos nagas miserables asaltan la costa. ¡Dales una lección que no olviden pronto!', '', 30706),
(165274, 'esMX', 'Azshara asola los mares desde los días en que mi caparazón era reluciente. Era hora de que alguien la enfrentara.', '', 30706),
(165273, 'esMX', 'Los nagas avanzan. No sé qué traman, pero sé que tenemos que detenerlos.', '', 30706),
(165272, 'esMX', '¡Será como usted ordene! ¡Servirán... o pagarán con su vida!', '', 30706),
(165271, 'esMX', 'Paciencia... paciencia. Aún podrían demostrar ser dignos de mi don. Probaré sus sueños... su carne.', '', 30706),
(165270, 'esMX', 'Estos patéticos mortales profanan su templo, amo. ¡Ahoguémoslos y que el agua limpie su irreverencia!', '', 30706),
(165269, 'esMX', 'Imaginar siquiera lo que esos nagas están planeando me hace temblar el caparazón. Gracias por ocuparte de ellos.', '', 30706),
(165268, 'esMX', '', 'Ja, ¡mírate! Asquerosamente dulce. Perfecto.', 30706),
(165267, 'esMX', 'Esto no es bueno, $n. Tenemos que enfrentar a esos nagas con la frente en alto. ¡Métete allí!', '', 30706),
(165266, 'esMX', 'No sabemos qué hará Azshara a continuación. A partir de ahora no debemos sacar los ojos de la orilla.', '', 30706),
(165265, 'esMX', '¡Caaaaa... miseTAAAAAAAS!', '¡Caaaaa... miii... seTAAAAAAAS!', 30706),
(165264, 'esMX', '¡Camisetas para todos!', '¡Camisetas para todos!', 30706),
(165263, 'esMX', '¡¿¡¿¡¿¡¿Quién quiere CAMISETAS GRATIS?!?!?!?!', '¡¿¡¿¡¿¡¿Quién quiere CAMISETAS GRATIS?!?!?!?!', 30706),
(165262, 'esMX', '¡Tengo más camisetas de las que puedo disparar!', '¡Tengo más camisetas de las que puedo disparar!', 30706),
(165261, 'esMX', '¡Jajaaaaa, síííí!', '¡Jajaaaaa, síííí!', 30706),
(165260, 'esMX', '¡Uuuuopa!', '¡Uuuuopa!', 30706),
(165259, 'esMX', '¡Consigan sus camisetas, sí!', '¡Consigan sus camisetas, sí!', 30706),
(165258, 'esMX', '¡Aaaaatención!', '¡Aaaaatención!', 30706),
(165257, 'esMX', 'Alguien tiene que detener a esos nagas. En este momento, ese alguien eres tú.', '', 30706),
(165256, 'esMX', '', 'Murieron cientos de inocentes. Familias enteras desaparecieron en un momento.', 30706),
(165255, 'esMX', '', 'Manos a la obra.', 30706),
(165254, 'esMX', '', '¡No! Esto... no debía ser...', 30706),
(165253, 'esMX', '<Activar palancas al azar>', '<Activar palancas al azar>', 30706),
(165252, 'esMX', 'Ella les mostrará el camino. Acérquense... Acérquense. Se acerca la hora en que todos los ojos se abrirán.', '', 30706),
(165251, 'esMX', 'Reciban el más grande de los dones. Mi sueño ahora es su sueño. El círculo de estrellas se ha hecho carne.', '', 30706),
(165250, 'esMX', 'Sí... Ciertamente era a ustedes que buscaba. Los que revierten las mareas.', '', 30706),
(165249, 'esMX', '¡Obedezcan!', '', 30706),
(165248, 'esMX', '¡Arrodíllense!', '', 30706),
(165247, 'esMX', '¡Marchítense!', '', 30706),
(165246, 'esMX', 'Las baratijas se pudren ante la mirada de un dios.', '', 30706),
(165245, 'esMX', 'Cada elección que tomas te ata más y más a mi dominio.', '', 30706),
(165244, 'esMX', 'Sí... Se acercan... cada vez más.', '', 30706),
(165243, 'esMX', 'Por fin... Reciban la verdad de la sombra.', '', 30706),
(165242, 'esMX', 'Déjense arrastrar por la marea hacia mi sueño...', '', 30706),
(165241, 'esMX', 'Más profundo, siempre más profundo.', '', 30706),
(165240, 'esMX', 'Criaturas mías... Las profundidades son mi dominio.', '', 30706),
(165239, 'esMX', 'Dominen su furia... Conviertan el odio en un arma.', '', 30706),
(165238, 'esMX', 'La tormenta guarda fortaleza... Pero hay un precio que pagar.', '', 30706),
(165237, 'esMX', 'Ahh... Creen que conocen el poder.', '', 30706),
(165234, 'esMX', 'Socorre a este fiel servidor, ¡oh, poderoso N\'Zoth!', '', 30706),
(165233, 'esMX', '¡Su cólera ha despertado!', '', 30706),
(165232, 'esMX', '¡Toda la gloria al amo!', '', 30706),
(165231, 'esMX', '¡Prueben su verdadero poder!', '', 30706),
(165230, 'esMX', 'Su mirada recorre todos los caminos... ¡Todos los sueños!', '', 30706),
(165229, 'esMX', 'Sus fieles son más que los granos de arena... ¡Más que las estrellas!', '', 30706),
(165228, 'esMX', 'Sus ojos contemplan todas las verdades... ¡Todos los innumerables crímenes!', '', 30706),
(165227, 'esMX', '', 'Teldrassil ardió porque yo decidí perdonarle la vida a Colmillosauro.', 30706),
(165226, 'esMX', 'Sí.', 'Sí.', 30706),
(165225, 'esMX', '¡La marea de sangre crece!', '', 30706),
(165224, 'esMX', '', '¿Estás $upreparado:preparada;?', 30706),
(165223, 'esMX', 'Todos... despertarán.', '', 30706),
(165222, 'esMX', 'Amo... Ellos son... dignos.', '', 30706),
(165221, 'esMX', 'No eran lo que usted buscaba, amo. Encontraremos otros que nos abrirán el camino.', '', 30706),
(165220, 'esMX', 'Los hemos probado... Y no eran dignos.', '', 30706),
(165219, 'esMX', '¡Su sueño ha terminado!', '', 30706),
(165218, 'esMX', '¡Indignos!', '', 30706),
(165217, 'esMX', '¡La carne fue débil!', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(165215, 'esMX', '¡Arrodíllense ante su verdadero amo!', '', 30706),
(165214, 'esMX', '¡Pagarán caro por su insolencia!', '', 30706),
(165213, 'esMX', 'La Horda arrasará con todo Azeroth si no nos interponemos en su camino. Empecemos aquí. Y ahora.', '', 30706),
(165212, 'esMX', '', 'El ritual está casi completo. ¡$p, libera el Ojo de Elune!', 30706),
(165211, 'esMX', '', 'La Alianza caerá ante la potencia de los zandalari.', 30706),
(165210, 'esMX', '', 'Hay mucha\' val\'kyr entre Eyir y nosotros, y sospecho que no quieren que pasemo\'.', 30706),
(165209, 'esMX', '¡Ya está hecho! ¡Rommath! ¡Teletranspórtanos a un lugar seguro!', '', 30706),
(165208, 'esMX', '¡Parece que el ritual está funcionando! ¡Magísteres, no se desconcentren!', '', 30706),
(165207, 'esMX', 'Placeholder: Sunwell Explodes', 'Placeholder: Sunwell Explodes', 30706),
(165206, 'esMX', 'Estos cobardes intentan apoderarse de esta ubicación. Acaba con ellos.', '', 30706),
(165205, 'esMX', 'Disputaremos cada paso a la Horda. Ellos no tendrán piedad, ¡así que no perdones a nadie!', '', 30706),
(165204, 'esMX', 'Nuestro avance en Kul Tiras se ha estancado. ¡Rompe las filas enemigas para que nuestras tropas puedan continuar!', '', 30706),
(165203, 'esMX', 'Enfrentaremos al enemigo en el campo de batalla. ¡Aplástalo y asegura nuestra victoria!', '', 30706),
(165202, 'esMX', '', '¡Los cobardes de la Alianza se niegan a enfrentarnos en combate abierto! ¡Usa las minas reptantes para romper sus defensas!', 30706),
(165201, 'esMX', '', 'El plan es simple: si ves soldados de la Alianza, los matas. No me importa cómo lo hagas.', 30706),
(165200, 'esMX', '', 'Nuestros enemigos avanzan. Resiste y derrótalos para asestarle un golpe fatal a su campaña.', 30706),
(165199, 'esMX', '', 'No toleraremos esta atrocidad. ¡Por la Alianza!', 30706),
(165198, 'esMX', 'Vaya, vaya, miren lo que nos encontramo\'. Asegúrate de que eh\'to tenga un resultado favorable para la Horda.', '', 30706),
(165197, 'esMX', 'Hay eh\'pías de la Alianza al acecho y no creo que tramen nada bueno. Ten cuidado... y disfruta de la cacería.', '', 30706),
(165196, 'esMX', 'No somos los únicos aquí que se oponen a la Horda. Has lo que sea necesario para reforzar la resistencia local.', '', 30706),
(165195, 'esMX', 'Un oficial importante de la Horda se esconde aquí. Encuéntralo y elimínalo.', '', 30706),
(165194, 'esMX', 'Otra victoria para la Alianza, gracias a ti.', '', 30706),
(165193, 'esMX', 'Nuestros enemigos con magia son como niños con espadas. Muéstrales el verdadero poder.', '', 30706),
(165192, 'esMX', '¡Ja! Parecen hormigas. ¡Corran, hormigas, corran!', '', 30706),
(165191, 'esMX', 'La Alianza ha asegurado el terreno cercano, pero nosotros solo necesitamos el cielo.', '', 30706),
(165190, 'esMX', '', 'Tenemos mucho en juego, no podemos perder. ¡Asegura nuestra victoria!', 30706),
(165189, 'esMX', '', 'No podemos permitir que la Alianza prevalezca. ¡Por la Horda!', 30706),
(165188, 'esMX', 'La Alianza ya ha encontrado resistencia aquí. Busca a los agitadores y ayúdalos como puedas.', '', 30706),
(165187, 'esMX', '¡Nuestras tropas atacan al enemigo! ¡Únete a la pelea y lleva gloria a la Horda!', '', 30706),
(165186, 'esMX', 'Esos cerdos apestosos se han reunido alrededor de unos montones de azerita poderosa. ¡No dejemos que les pongan sus asquerosas manos encima!', '', 30706),
(165185, 'esMX', 'Unos buenos para nada de la Horda han detenido a uno de nuestros escuadrones. ¡¿Qué estás esperando?! ¡Ve!', '', 30706),
(165184, 'esMX', 'La jefa de guerra cree que puede ganar. Demuéstrale que está equivocada.', '', 30706),
(165183, 'esMX', 'Así que la Horda al fin decidió salir de su escondite. ¡Libera nuestra furia!', '', 30706),
(165182, 'esMX', '¡Mis jinetes de grifos han descubierto al enemigo! ¡Destrúyelos, $n!', '', 30706),
(165181, 'esMX', '¡Tenemos problemas por aquí! ¡Detenlos de inmediato!', '', 30706),
(165180, 'esMX', '¿Armas de la Alianza? Qué táctica tan temeraria... Pero no importa, les has puesto fin. ¡Los expulsaremos de Zandalar!', '', 30706),
(165179, 'esMX', 'Eso le dará una linda sorpresa a la Horda. Y si, por accidente, los trols de sangre se lastiman... Bueno, todos salimos ganando.', '', 30706),
(165178, 'esMX', '', 'Si nuestros enemigos hubieran escuchado a la tierra, habrían evitado este destino. Me alegra que no lo hayan hecho. Adiós, $n.', 30706),
(165177, 'esMX', '', 'La Horda no podrá resistir el poderío de nuestra unión. ¡Por la Alianza!', 30706),
(165176, 'esMX', 'Has dejado a la Horda desconcertada. ¡Únete a la general Plumaluna en el Puerto Ruina Pétrea y denles el golpe de gracia juntos!', '', 30706),
(165175, 'esMX', 'Vol\'dun es un páramo que casi no vale la pena... y por eso la Horda lo ha abandonado. Tal vez podamos aprovechar eso.', '', 30706),
(165173, 'esMX', '¡Perfecto! No tendrán más alternativa que emprender la retirada y lamerse las heridas. Puedes regresar a la base. Bien hecho, $n.', '', 30706),
(165172, 'esMX', 'La Horda espera que peleemos sobre el agua. Por eso iremos bajo el agua.', '', 30706),
(165171, 'esMX', 'El maestro espía Shaw ha desarrollado un plan astuto para expulsar a la Horda de Nazmir. Preséntate en nuestra avanzada y comienza con la operación.', '', 30706),
(165170, 'esMX', 'Desde este pantano fétido se puede lanzar un ataque a la capital zandalari. Si expulsamos a la Horda, tendremos una gran ventaja táctica.', '', 30706),
(165169, 'esMX', '¡Lo has logrado! Romperé el ritual. Hay que ser muy cautos con poderes como estos.', '', 30706),
(165168, 'esMX', 'El Vacío es un aliado peligroso, y un enemigo letal. Tenemos que usar a esta criatura antes de que su fuerza eclipse la nuestra.', '', 30706),
(165167, 'esMX', 'Hemos debilitado su ejército, pero debemos atacar más para herirlos de verdad. Ayuda al magíster Umbric a preparar un ritual que nos ayudará con eso.', '', 30706),
(165166, 'esMX', 'Esto es Zuldazar, la joya del imperio zandalari. Ataca mientras están desprevenidos y extermina a los nuevos aliados de la Horda.', '', 30706),
(165165, 'esMX', '¡Bajaja! Fiuu... Ver a esos orcos volar en pedazos me hace llorar de la risa. ¡Te lo agradezco!', '', 30706),
(165164, 'esMX', '¡Es hora de que llueva muerte y destrucción ardiente sobre estos cobardes besacrustájeos! ¡Hazlos pedazos!', '', 30706),
(165163, 'esMX', 'Es un buen comienzo, pero debemos eliminar el grueso de sus fuerzas si queremos terminar con esta invasión absurda.', '', 30706),
(165162, 'esMX', 'Canto Tormenta ya ha sufrido demasiado la peste de la Horda. Acaba con su invasión patética como sea necesario.', '', 30706),
(165161, 'esMX', '¡Vaya! ¡Mira qué desastre! ¡La Horda no volverá a bombardear Drustvar nunca más, eso es seguro!', '', 30706),
(165160, 'esMX', 'Nuestros hombres en Drustvar ya tienen suficientes problemas para preocuparse por la plaga. ¡Quítales un problema de encima!', '', 30706),
(165159, 'esMX', '¡Los lacayos viles de Sylvanas han traído la plaga a nuestras tierras! Tenemos que detenerlos de inmediato.', '', 30706),
(165158, 'esMX', 'El ataque de la Horda a Drustvar fue audaz, pero ahora están dispersos. ¡Ataca ahora y expúlsalos!', '', 30706),
(165157, 'esMX', 'Bueno, este será un viaje muy emocionante.', '', 30706),
(165156, 'esMX', 'Puede que tenga razón, capitán. $p, deberíamos ir a ver eso.', '', 30706),
(165155, 'esMX', 'Esta área es segura... por ahora. Tenemos que movernos rápido.', '', 30706),
(165154, 'esMX', 'Ese silencio duró menos que un suspiro.', '', 30706),
(165153, 'esMX', '¡El calor sube, pequeño!', '', 30706),
(165152, 'esMX', '¡Derríbalo!', '', 30706),
(165151, 'esMX', '¡Ja! ¡Nunca vi una nave de guerra explotar así! ¡Tendrán que volver nadando a Zandalar!', '', 30706),
(165150, 'esMX', 'Esa nave de guerra de la Horda está bombardeando a los civiles de Boralus, que solo quieren vivir su vida en paz. Tenemos que detenerla.', '', 30706),
(165149, 'esMX', 'Eso los demorará. ¡Ahora, derriba a esa nave de guerra de la Horda!', '', 30706),
(165148, 'esMX', 'El ejército de la Horda avanza a paso firme hacia el Canal de Tiragarde. ¡Haz que se arrepientan de cada paso!', '', 30706),
(165147, 'esMX', '$n, ¿ya estás de vuelta? ¿Así que buscas algún resto del ritual de Magni? Puedes llevarte cualquiera de los cristales que se desprendieron cuando Magni se liberó.', '', 30706),
(165146, 'esMX', '¡Ja, ja! Una clásica combinación de ataques. ¡No tenían la más mínima posibilidad! ¡Ahora sal de ahí!', '', 30706),
(165145, 'esMX', '¡Hay una nave de guerra adelante! Yo la atacaré desde arriba mientras tú la destrozas desde adentro.', '', 30706),
(165144, 'esMX', '¡Lok-narash! La Alianza ha traído una nave de guerra para reforzar su campamento en la costa norte. ¡Derríbala!', '', 30706),
(165143, 'esMX', 'No pensamos que la Alianza avanzaría sobre Vol\'dun. Contén a sus soldados antes de que se expandan demasiado. Luego nos encargaremos del problema de raíz.', '', 30706),
(165142, 'esMX', 'Si eso no convence a la Alianza de irse de Nazmir para siempre, creo que nada lo hará.', '', 30706),
(165141, 'esMX', 'Eh\'tas garrapatas de sangre me dan asco hasta a mí... así que sé que la Alianza las va a detestar. ¡Ja, ja!', '', 30706),
(165140, 'esMX', '¡Buen trabajo, soldado! ¡Ahora, reúnete con Rokhan para dar el golpe de gracia!', '', 30706),
(165139, 'esMX', 'Es muy probable que la Alianza caiga ante los trols de sangre, pero quiero estar seguro de que morirán. Liquídalos en cuanto los veas.', '', 30706),
(165138, 'esMX', '', '¡¿Del este?! ¡La Horda está por todos lados!', 30706),
(165136, 'esMX', '', 'Nuestros soldados se ocuparán del resto. Descansa un momento antes de tu próxima tarea, $c. Te lo has ganado.', 30706),
(165135, 'esMX', '', 'Una nave de guerra se derriba como cualquier otro enemigo: golpea un objetivo crítico y no te guardes nada.', 30706),
(165133, 'esMX', 'Bien hecho. Nos has dado el tiempo necesario para ocuparnos de la nave de guerra y sus bombas cobardes. Derríbala.', '', 30706),
(165132, 'esMX', 'Nuestra prioridad es proteger Zuldazar. No podemos dejar que la Alianza invada la ciudad. ¡Haz que regresen a los botes!', '', 30706),
(165131, 'esMX', '¡Ja, ja, ja! ¡La magia de la Alianza no se compara con nueh\'tro vudú!', '', 30706),
(165130, 'esMX', 'A vece\' no puedes evitar el vudú. Hay ocasiones en que debe\' pedirle ayuda. Ahora, veamo\' quién tiene el vudú más poderoso.', '', 30706),
(165129, 'esMX', 'Rokhan coordinará la siguiente etapa de nuestro ataque. Ve a verlo de inmediato.', '', 30706),
(165128, 'esMX', 'Si la Alianza quiere esconderse entre los monstruos de Drustvar, todos ellos serán nuestra presa. Pelea con honor y con fiereza.', '', 30706),
(165127, 'esMX', 'A Azshara no le gustará que le nieguen algo que tenía entre ceja y ceja. A mí me encantará. Je.', '', 30706),
(165126, 'esMX', 'Ni idea de qué son estas cosas, pero Azshara sin duda las quiere. ¡Lo mejor será asegurarnos de que no las consiga!', '', 30706),
(165125, 'esMX', 'La Alianza cree que puede infiltrarse en Nazmir para emboscarno\', ¡mostrémosles lo equivocado\' que están!', '', 30706),
(165123, 'esMX', 'Las guerras las gana el bando con más recursos. Y tú nos has acercado a la victoria.', '', 30706),
(165122, 'esMX', 'Parece que los lacayos de Azshara salieron a buscar recursos. ¿Mi consejo? Ganarles de mano.', '', 30706),
(165121, 'esMX', '', '¡Sí! ¡Una victoria gloriosa! ¡Tírense a un pozo, insectos de la Alianza! ¡Valle Canto Tormenta le pertenece a la Horda!', 30706),
(165120, 'esMX', '', 'La Alianza piensa que nos tiene acorralados. Pero si hay alguien que puede abrirse camino para salir de este valle, soy yo. Vamos a matarlos a todos.', 30706),
(165119, 'esMX', '¡$C! Las fuerzas de la Alianza nos atacaron por los flancos y se dirigen hacia Fuerte Guerracolmillo. Regresa y detén su retirada.', '', 30706),
(165118, 'esMX', '<La máquina voladora de Brann está lista para despegar.>', '', 30706),
(165117, 'esMX', '', '¡Hay movimiento al norte! ¡No tengan piedad!', 30706),
(165116, 'esMX', '', '¡Nos atacan! ¡A las armas!', 30706),
(165115, 'esMX', 'Créeme, $n, ese se la estaba buscando hace años.', '', 30706),
(165114, 'esMX', 'Un naga particularmente desagradable se acerca a la orilla. ¿Qué tal si le das una cálida bienvenida?', '', 30706),
(165113, 'esMX', 'Bueno, si Azshara no nos había advertido hasta este momento, ¡sin duda lo hará ahora!', '', 30706),
(165112, 'esMX', 'Mmm, he oído historias sobre este naga. Es uno de los favoritos de Azshara. Será mejor que te encargues de esto personalmente.', '', 30706),
(165111, 'esMX', 'Nuestros guerreros en Fuerte Guerracolmillo nos han dado la plataforma perfecta para lanzar una invasión. ¡Conquistaremos el valle entero!', '', 30706),
(165110, 'esMX', '', '¡Ahí van los muros de la ciudad! ¡Ja, ja! Nuestros guerreros no tendrán problema para avanzar sobre Boralus ahora. ¡Lok-tar!', 30706),
(165109, 'esMX', '', '¡Ja! Tengo que conseguirme una de estas cosas. Ahora, ¡ve a las puertas de Boralus y hazlas volar en pedazos!', 30706),
(165108, 'esMX', '¡Nuestras fuerzas no pueden atravesar los muros de Boralus! ¡Reagrupémonos con los ingenieros y busquemos la forma de atravesar las defensas de la Alianza!', '', 30706),
(165107, 'esMX', 'Canal de Tiragarde es el bastión más fortificado de la Alianza en el continente. No podemos dudar ni perder enfoque. Ataca rápido, $p.', '', 30706),
(165105, 'esMX', '¡$n! Qué bueno verte. La general Rakera nos ha ordenado que entrenemos a nuestras tropa\' todos los días para prepararno\' para la guerra.\n\nEstos son nuestros mejores jinete\'. Estábamos por empezar los ejercicios de entrenamiento.\n\n¿En qué puedo ayudarte?', '', 30706),
(165104, 'esMX', '¡Un día lucharé a su lado! Hasta entonces, ¿podría entrenar con los mag\'har?', '', 30706),
(165103, 'esMX', 'Las fuerzas de la Alianza nos atacan en Nazmir. Necesitamos que todos tus jinetes vuelen hasta allí para detenerlos.', 'Las fuerzas de la Alianza nos atacan en Nazmir. Necesitamos que todos tus jinetes vuelen hasta allí para detenerlos.', 30706),
(165102, 'esMX', '¡Throm-ka, nuevos amigos! ¡Que hallen la gloria en las batallas contra nuestros enemigos!', '', 30706),
(165101, 'esMX', 'Nuevos tauren y elfos, ¡y hasta orcos como yo!', '', 30706),
(165100, 'esMX', '¡Vaya, $n! ¿Conoces a todas estas personas?', '', 30706),
(165099, 'esMX', 'No has ganado... nada...', 'No has ganado... nada...', 30706),
(165098, 'esMX', 'Ya has... perdido...', 'Ya has... perdido...', 30706),
(165097, 'esMX', 'La muerte nos llega... a todos...', 'La muerte nos llega... a todos...', 30706),
(165096, 'esMX', 'Solo veo... oscuridad...', 'Solo veo... oscuridad...', 30706),
(165095, 'esMX', 'Tú también perderás... como yo...', 'Tú también perderás... como yo...', 30706),
(165094, 'esMX', '¡La muerte ha venido por ti!', '¡La muerte ha venido por ti!', 30706),
(165093, 'esMX', '¡Nuestra victoria es inevitable!', '¡Nuestra victoria es inevitable!', 30706),
(165092, 'esMX', '¡La oscuridad te llevará!', '¡La oscuridad te llevará!', 30706),
(165091, 'esMX', '¡Tu mísera vida me pertenece!', '¡Tu mísera vida me pertenece!', 30706),
(165090, 'esMX', '¡La fe te ha cegado!', '¡La fe te ha cegado!', 30706),
(165089, 'esMX', 'Perderás... todo...', 'Perderás... todo...', 30706),
(165088, 'esMX', 'Solo veo... oscuridad...', 'Solo veo... oscuridad...', 30706),
(165087, 'esMX', 'No puedes ver... lo que... vendrá...', 'No puedes ver... lo que... vendrá...', 30706),
(165086, 'esMX', 'Su victoria... llegará...', 'Su victoria... llegará...', 30706),
(165085, 'esMX', 'Perdóname... Dama Oscura...', 'Perdóname... Dama Oscura...', 30706),
(165084, 'esMX', '¡Mis flechas son certeras!', '¡Mis flechas son certeras!', 30706),
(165083, 'esMX', '¡Tu vida está perdida!', '¡Tu vida está perdida!', 30706),
(165082, 'esMX', '¡No tienes oportunidad!', '¡No tienes oportunidad!', 30706),
(165081, 'esMX', '¡La muerte te llama!', '¡La muerte te llama!', 30706),
(165080, 'esMX', '¡Por la Dama Oscura!', '¡Por la Dama Oscura!', 30706),
(165079, 'esMX', '<Client scene, part of the Zandalari fleet moving out.>', '<Client scene, part of the Zandalari fleet moving out.>', 30706),
(165078, 'esMX', 'Hazlo. Envía todas las naves que puedas a la costa de Nazmir.', 'Hazlo. Envía todas las naves que puedas a la costa de Nazmir.', 30706),
(165077, 'esMX', '¿Es broma? No puedo despachar a toda la flota así como así. Lo máximo que puedo hacer es ordenar a las nave\' que no están atracada\' que tuerzan el rumbo hacia Nazmir.', '¿Es broma? No puedo despachar a toda la flota así como así. Lo máximo que puedo hacer es ordenar a las nave\' que no están atracada\' que tuerzan el rumbo hacia Nazmir.', 30706),
(165076, 'esMX', 'La flota kultirana está en la costa de Nazmir, moviliza nuestras naves y atácalos.', 'La flota kultirana está en la costa de Nazmir, moviliza nuestras naves y atácalos.', 30706),
(165075, 'esMX', '', '¡Guerreros de Zandalar! La Alianza nos ataca desde Nazmir, ¡Muévanse! ¡Mátenlos a todo\'!', 30706),
(165074, 'esMX', '', 'No... vinieron.', 30706),
(165073, 'esMX', '¡Ya sé! Les traeré muchos dulces. ¡Les encantarán!', '', 30706),
(165072, 'esMX', 'Pero ahora que sé dónde están, ¡puedo venir y hacerles compañía de vez en cuando!', '', 30706),
(165071, 'esMX', 'Espero que todos estén cómodos. ¡Quizás alguno es huérfano como yo!', '', 30706),
(165070, 'esMX', '¡Todos los líderes están aquí! No sé que harán, pero seguramente es algo muy importante.', '', 30706),
(165069, 'esMX', '¡Guau! ¿Aquí es donde conseguimos nuevos aliados para la Alianza?', '', 30706),
(165068, 'esMX', 'La Alianza nos ataca en Nazmir, necesitamos que movilices tus fuerzas para ayudar a la princesa Talanji.', 'La Alianza nos ataca en Nazmir, necesitamos que movilices tus fuerzas para ayudar a la princesa Talanji.', 30706),
(165067, 'esMX', '', '$n, qué bueno verte. Estoy en medio de mis ejercicio\' de entrenamiento, ¿qué necesitas?', 30706),
(165066, 'esMX', '', '¡La guja de una celadora nunca falla!', 30706),
(165065, 'esMX', '', '¡Ardan, basuras de la Horda!', 30706),
(165064, 'esMX', '', '¡Venganza por Teldrassil!', 30706),
(165063, 'esMX', '', '¡Por los kaldorei!', 30706),
(165062, 'esMX', '', 'Te fallé, Sira. Y te liberaré de tu tormenta para expiar mis culpas.', 30706),
(165061, 'esMX', '', '¿Cómo puedes aliarte con la Horda, hermana? ¿Cómo puedes abandonar la justicia?', 30706),
(165060, 'esMX', '', '¿Te atreves a hablarme de justicia? Morí obedeciendo tus órdenes. ¡Me abandonaste!', 30706),
(165059, 'esMX', 'Estamos listos para comenzar, celadora oscura.', 'Estamos listos para comenzar, celadora oscura.', 30706),
(165058, 'esMX', '<Sira mira fijo a su excomandante. Se ve decidida.>', '<Sira mira fijo a su excomandante. Se ve decidida.>', 30706),
(165057, 'esMX', 'Pero tus palabra\' me inquietan. Acércate, portavoz de la Horda. Puede que haya un modo de encontrar las respuesta\' que buscas.', '', 30706),
(165056, 'esMX', 'Recuerdo la batalla en estas costas corrompidas por la vileza. Perdí muchos amigos contras las fuerzas innumerables de la Legión Ardiente.\n\nEse día se desencadenaron sucesos que no solo afectarían a Azeroth, sino a todos los mundos tocados por la Legión.', '', 30706),
(165055, 'esMX', 'La Horda no puede seguir así. Propugnamos la nobleza y el honor, incluso cuando utilizamos esta guerra desafortunada y sin esperanza para justificar actos viles.\n\nLa Horda se forjó en la hoguera del conflicto. Nos unimos porque necesitábamos derrotar a enemigos en común para proteger nuestras tierras... nuestro pueblo. Pero con Sylvanas como jefa de guerra, la necesidad de sobrevivir quizá ya no alcance para mantenernos unidos.\n\nDebemos encontrar un nuevo camino... antes de perder todo lo que somos.', '', 30706),
(165054, 'esMX', '¿Qué le pasó a Vol\'jin en la batalla de la Costa Quebrada?', '¿Qué le pasó a Vol\'jin en la batalla de la Costa Quebrada?', 30706),
(165053, 'esMX', 'Invocar a espíritus que vagan por el espacio entre la vida y la muerte es una cosa. Comunicarse con un espíritu que ya ha cruzado es otra muy diferente. Y después está la situación de Vol\'jin.\n\nDebo decir que nunca he intentado algo así. Mi respeto por Talanji es cada vez mayor.', '', 30706),
(165052, 'esMX', '¡Sip! ¡Se está moviendo, sí que sí!', '', 30706),
(165051, 'esMX', 'Te escucho fuerte y claro, colega. Por qué no... Momento...', '', 30706),
(165050, 'esMX', 'Y no. Tocamos. Nada. ¿Entendido, capitán?', '', 30706),
(165049, 'esMX', 'Será como si no estuviera aquí.', '', 30706),
(165048, 'esMX', 'Avanzamos rápido y en silencio. Énfasis en \"en silencio\".', '', 30706),
(165047, 'esMX', '', '¡Pagarás por invadir nuestras tierra\'!', 30706),
(165046, 'esMX', '', 'La Luz de lo\' loa me da toda la fuerza que necesito. ¡Enfréntenme!', 30706),
(165045, 'esMX', '¿Un paladín trol? Ahora sí que lo he visto todo. Protesta todo lo que quieras, pero parece que los superamos en número.', '', 30706),
(165044, 'esMX', '', '¡Debes responder por tus actos viles!', 30706),
(165043, 'esMX', 'Ninguna enana en llamas me impedirá llegar a su rey. ¡Campeones, aniquílenla!', '', 30706),
(165042, 'esMX', 'Estamos aquí, rey Rastakhan. ¿Cuál es la situación con el ataque de la Alianza?', 'Estamos aquí, rey Rastakhan. ¿Cuál es la situación con el ataque de la Alianza?', 30706),
(165041, 'esMX', 'No tenemo\' tiempo que perder. La Alianza eh\'tá aquí.', '', 30706),
(165040, 'esMX', '', '¡Estamos contigo, Tyrande!', 30706),
(165039, 'esMX', '', '$n, corre la voz sobre nueh\'tro contraataque y búscame en la Puerta de Sangre.', 30706),
(165038, 'esMX', 'Pelearemos como uno en el campo de batalla. Tu pueblo ha sido un aliado muy valioso, rey Rastakhan. No los dejaremos solos.', '', 30706),
(165037, 'esMX', 'Convocaré a las fuerzas de la Horda. Esta es la oportunidad para terminar con esta guerra... a nuestro modo.', '', 30706),
(165036, 'esMX', 'De acuerdo. Debemos atacar juntos en todo\' los frentes. Talanji, ve a ayudar en la Puerta de Sangre mientras preparamos nueh\'tros ejércitos.', '', 30706),
(165035, 'esMX', 'Nuestras fuerzas han llegado a conocer la espesura de Nazmir. Podemos expulsar a la Alianza, siempre que peleemos junto a los zandalari.', '', 30706),
(165034, 'esMX', 'Tenemo\' que recuperar nuestro territorio y destruir eh\'ta flota.', '', 30706),
(165033, 'esMX', '', 'Quieren establecer una base para atacar Zuldazar. Nueh\'tros exploradores han visto una gran flota agrupándose en la coh\'ta.', 30706),
(165032, 'esMX', 'Las fuerza\' de la Alianza marchan sobre Nazmir. ¡Han capturado la Puerta de Sangre!', '', 30706),
(165031, 'esMX', '', 'Te espero en Tres Caminos. Tengo un plan.', 30706),
(165030, 'esMX', '¡¡Atrápenlos!! ¡Ahora! ¡Vamos, vamos, vamos!', '', 30706),
(165029, 'esMX', '¡Rápido! ¡Al avión!', '', 30706),
(165028, 'esMX', '¡Mis dagas y yo podemos ayudarlos!', '', 30706),
(165027, 'esMX', 'Indiquémosles el camino correcto entonces, ¿no?', '', 30706),
(165026, 'esMX', 'Porque yo la veo muy verde. No se parece en nada a una zona de la Horda.', '', 30706),
(165025, 'esMX', '¿Esta zona les parece apagada y sucia, perros?', '', 30706),
(165024, 'esMX', 'Parece que unos perritos de la Horda se han perdido. Qué pena.', '', 30706),
(165023, 'esMX', 'Vaya, vaya... ¿Qué tenemos aquí?', '', 30706),
(165022, 'esMX', '', '¡Ahí está!', 30706),
(165021, 'esMX', '', '¡La Horda se acerca! ¡Prepárense!', 30706),
(165020, 'esMX', '', 'La Horda temblará… mientras cae nuestra oscuridad.', 30706),
(165019, 'esMX', '¡Rápido, $n! ¡Ignis necesita ayuda!', '', 30706),
(165018, 'esMX', 'Hace mucho tiempo que no veo una operación naga de semejante escama... digo, escala. Je. Bien hecho, $Umuchacho:muchacha;.', '', 30706),
(165017, 'esMX', 'Nunca es bueno que los nagas se arrastren a la tierra. Detenlos antes de que puedan ejecutar los arteros planes de su reina.', '', 30706),
(165016, 'esMX', '¡Ja! Qué manera de hacer que vuelvan al agua. ¡Si tan solo pudiéramos librarnos de ellos para siempre!', '', 30706),
(165015, 'esMX', 'Ulduar. No he estado allí en años. Parece que los guardianes titánicos se han dedicado a restaurarlo.', '', 30706),
(165014, 'esMX', 'He visto muchos ataques de los nagas a lo largo de los años, pero nada como esto. ¡Oblígalos a retroceder, $c!', '', 30706),
(165013, 'esMX', '¡Sorprendente!', '', 30706),
(165012, 'esMX', '¡Lo lograste!', '', 30706),
(165011, 'esMX', '¡Aunque no seas $Uherrero:herrera;, si sigues mis instrucciones te irá bien!', '', 30706),
(165010, 'esMX', '¡Veo que no eres un novato en la herrería! ¡Excelente!', '', 30706),
(165009, 'esMX', '¡Nada mal, $c! Me recuerdas a un joven... ¡a un joven yo!', '', 30706),
(165008, 'esMX', '¡Jajaja! ¡Sí!', '', 30706),
(165007, 'esMX', 'Si algo he aprendido de tratar con los nagas, es que hay que atacar con decisión. Manos a la obra.', '', 30706),
(165006, 'esMX', 'Eso perturbará los planes de Azshara. Gracias,  $c.', '', 30706),
(165005, 'esMX', 'Hacía siglos que no veíamos a los nagas tan valientes. ¡Hay que darles una lección!', '', 30706),
(165004, 'esMX', 'Buen trabajo con los nagas. Nunca es suficiente la prudencia con esos bribones escurridizos.', '', 30706),
(165003, 'esMX', 'No sé qué planea Azshara, pero no puede ser bueno. Sigue las... eh... ¿huellas? de esos nagas.', '', 30706),
(165002, 'esMX', 'Quítame esta maldición, por favor.', 'Quítame esta maldición, por favor.', 30706),
(165001, 'esMX', 'El poderoso Akunda puede traer paz a un espíritu perturbado.\n\n¿Tu mente está atribulada, $uamigo:amiga;?', '', 30706),
(165000, 'esMX', 'Acércate, ¡deja que el poder de Akunda te deh\'peje la mente!', '', 30706),
(164999, 'esMX', 'Oh, ese es uno malo, camarada.', '', 30706),
(164998, 'esMX', '', 'Sigamos avanzando. Estén atentos a cualquier cosa sospechosa.', 30706),
(164997, 'esMX', '', 'Idiotas.', 30706),
(164996, 'esMX', '', 'Huellas profundas. Demasiado grandes para ser de humano. Debe ser Colmillosauro. Parece que iba hacia el este.', 30706),
(164995, 'esMX', '', 'El lodo ha sido removido. Alguien ha intentado disimular sus pasos entre los juncos. Sigamos avanzando.', 30706),
(164994, 'esMX', '', 'Parece que encontramos la ruta de escape. Mmm, hay lodo alrededor del lago. Deberíamos buscar huellas.', 30706),
(164993, 'esMX', '', 'Una cloaca. Lejos de la ciudad y de los ojos curiosos. Examinemos ese candado.', 30706),
(164992, 'esMX', '', 'La hora llegará. Pronto.', 30706),
(164991, 'esMX', '', 'Abre tu mente a los susurros.', 30706),
(164990, 'esMX', '', 'Nos esperan grandes cosas.', 30706),
(164989, 'esMX', '', 'Dime lo que quieres.', 30706),
(164988, 'esMX', '', 'Tantas posibilidades...', 30706),
(164987, 'esMX', '', '¿Qué buscas?', 30706),
(164986, 'esMX', '', 'Nos veremos afuera de los muros de Ventormenta. Mantente en las sombras.', 30706),
(164985, 'esMX', '', '<Línea de muerte.>', 30706),
(164984, 'esMX', '', 'Mis guardias han asegurado la puerta.\n\nAhora, hablemos de tu tarea.', 30706),
(164983, 'esMX', 'Perdón, capitán...', '', 30706),
(164982, 'esMX', 'Por el oro... ¡y la Horda!', '', 30706),
(164981, 'esMX', 'Sabía que no podrías hacerlo.', '', 30706),
(164980, 'esMX', '', '¡Por Zandalar!', 30706),
(164979, 'esMX', '', 'Loa, ¡concédanme su fuerza!', 30706),
(164978, 'esMX', '', '¡Muere, forastero!', 30706),
(164977, 'esMX', '', '¡Victoria para los loa!', 30706),
(164976, 'esMX', '', 'Que la Luz se apiade de sus alma\'... aunque es más de lo que merecen.', 30706),
(164975, 'esMX', '', 'Luz... guíame... al Otro Lado...', 30706),
(164974, 'esMX', '', '¡Zandalar por siempre!', 30706),
(164973, 'esMX', '', '¡La Luz juzga a todo\'!', 30706),
(164972, 'esMX', '', '¡A las armas! ¡Expulsen a estos forastero\' de Zuldazar!', 30706),
(164971, 'esMX', '', '¡Venganza para lo\' caídos!', 30706),
(164970, 'esMX', '', '¡La expiación está cerca!', 30706),
(164969, 'esMX', '', 'Invaden tierras sagrada\', forasteros. ¡No profanarán Zuldazar con su mugre!', 30706),
(164968, 'esMX', '', '¡Retrocedan mientras puedan, Horda! Esta ciudad es de Alianza.', 30706),
(164967, 'esMX', '', '¡Es hora de la expiación!', 30706),
(164966, 'esMX', '', '¡Venganza por los caídos!', 30706),
(164965, 'esMX', '', '¡A las armas! ¡Repelan a esta Horda miserable!', 30706),
(164964, 'esMX', '', '¡La Luz juzga a todos!', 30706),
(164963, 'esMX', '', '¡Sientan la furia de la montaña!', 30706),
(164962, 'esMX', '', 'Que la Luz... me guíe... a casa...', 30706),
(164961, 'esMX', '', 'Que la Luz se apiade de sus almas... ¡porque yo no lo haré!', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(164960, 'esMX', '', '¡No tenían oportunidad!', 30706),
(164959, 'esMX', '', '¡Te ha derrotado una Hierro Negro!', 30706),
(164958, 'esMX', '', '¡Enfrenta a una hija de la montaña!', 30706),
(164957, 'esMX', '', '¡Por la Alianza!', 30706),
(164954, 'esMX', '', '¡Caigan ante la dragona!', 30706),
(164953, 'esMX', '', '¡Hora de probar su valía!', 30706),
(164952, 'esMX', '', '¡Se enfrentan a una dragona de la Luz!', 30706),
(164951, 'esMX', '', '¡Sientan la furia de la Luz!', 30706),
(164950, 'esMX', '', 'Su Horda... solo sirve... a la muerte...', 30706),
(164949, 'esMX', '', '¡Un oponente vergonzoso!', 30706),
(164947, 'esMX', '', '¡Ja! ¡He luchado con diablillos que han dado más pelea que ustedes!', 30706),
(164946, 'esMX', '', 'En el Vacío Abisal, maté un sinnúmero de demonios de la Legión. Este puñado dispar de simpatizantes de los trols no representa una amenaza.', 30706),
(164945, 'esMX', '', '¡Su defensa es lamentable!', 30706),
(164944, 'esMX', '', '¡Los elementos los aplastarán!', 30706),
(164943, 'esMX', '', '¡No habrá piedad para ustedes!', 30706),
(164942, 'esMX', '', '¿Cuántos puñetazos pueden soportar?', 30706),
(164941, 'esMX', '', '¡La dragona proclama su perdición!', 30706),
(164940, 'esMX', '', '¿Quieres cambiar, Manceroy?', 30706),
(164939, 'esMX', '¡Solo quedarán sus cenizas!', '', 30706),
(164938, 'esMX', '¡Enfrenten las llamas del infierno!', '', 30706),
(164937, 'esMX', '¡Es hora de acabar con esto!', '', 30706),
(164936, 'esMX', 'El fuego... volverá... a brillar...', '', 30706),
(164935, 'esMX', '¡Justicia por Kul Tiras!', '', 30706),
(164934, 'esMX', '¡Otro cadáver para quemar!', '', 30706),
(164933, 'esMX', 'Qué mal eligen los zandalari a sus aliados.', '', 30706),
(164932, 'esMX', '¡Hasta aquí llegan sus pasos, escoria de la Horda! ¡Responderán por sus crímenes contra Kul Tiras!', '', 30706),
(164931, 'esMX', 'Juntos les demostraremos cómo se encarga la Alianza de sus enemigos. ¡Vengan aquí!', '', 30706),
(164930, 'esMX', 'Ven, Mestrah. ¡Terminemos con estos necios juntos!', '', 30706),
(164929, 'esMX', '¡El fuego está hambriento!', '', 30706),
(164928, 'esMX', '¡Miren bien dónde pisan!', '', 30706),
(164927, 'esMX', '¡El poder del cosmos los aplastará!', '', 30706),
(164926, 'esMX', '¡Las llamas adquieren muchas formas!', '', 30706),
(164925, 'esMX', '¡Todo será consumido!', '', 30706),
(164924, 'esMX', '', 'Por supuesto, milady.', 30706),
(164923, 'esMX', '', 'La forestal oscura Lyana es una rastreadora excepcional. Ella te ayudará.', 30706),
(164922, 'esMX', '', 'Espero que lo encuentres antes que ellos.', 30706),
(164921, 'esMX', '', 'Aunque haya quienes cuestionan las lealtades del alto señor supremo, no podemos permitir que caiga en manos del enemigo otra vez.', 30706),
(164920, 'esMX', '', 'Si las fuerzas del niño rey encuentran a Colmillosauro lo matarán sin pensarlo.', 30706),
(164919, 'esMX', '', 'Mis espías me informan que Varok Colmillosauro ha escapado de la custodia de la Alianza. Lo tenían en las Mazmorras de Ventormenta desde el asalto a Lordaeron.', 30706),
(164918, 'esMX', '', '¡Muerte a la Alianza!', 30706),
(164917, 'esMX', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tUna de las |cFFFF0000|Hspell:285766|h[gujas]|h|r de Maiev cayó al suelo. ¡Úsala para derrotar a los avatares de sufrimiento de Sira!', '|TInterface\\Icons\\inv_throwingchakrum_01_fel.blp:20|tUna de las |cFFFF0000|Hspell:285766|h[gujas]|h|r de Maiev cayó al suelo. ¡Úsala para derrotar a los avatares de sufrimiento de Sira!', 30706),
(164916, 'esMX', '', 'Rápido, campeones, ¡tomen una guja y destruyan a estas sombras!', 30706),
(164915, 'esMX', '', 'Una celadora siempre está lista, incluso en la muerte.', 30706),
(164914, 'esMX', '', '¡Sufran como yo sufrí!', 30706),
(164913, 'esMX', '', 'La muerte nos llega a todos.', 30706),
(164912, 'esMX', '', '¡Entonces no me dejas opción! ¡Bandu thoribas!', 30706),
(164911, 'esMX', '', 'Es tu última advertencia, Sira. ¡En nombre de Elune, ríndete!', 30706),
(164910, 'esMX', '', '¡Elune puede pudrirse! ¡Los veré arder a todos, como hizo ella!', 30706),
(164909, 'esMX', '', '¡Guau! ¡Puedo ver hasta Nazmir deh\'de aquí!', 30706),
(164908, 'esMX', '', '¿A dónde vamos?', 30706),
(164907, 'esMX', '', '¡Siempre quise montar un pterrordáctilo!', 30706),
(164906, 'esMX', '[Mata a Sira] Yo me encargo.', '[Mata a Sira] Yo me encargo.', 30706),
(164905, 'esMX', '[Perdonar a Sira] No lo haré.', '[Perdonar a Sira] No lo haré.', 30706),
(164904, 'esMX', '¿Qué esperas? ¡Acaba con ella!', '', 30706),
(164903, 'esMX', 'Hazlo.', '', 30706),
(164902, 'esMX', '', 'Curaremos sus heridas. ¡Liberen a los demás!', 30706),
(164901, 'esMX', '', '¿Azeroth eh\'tá sangrando? Ya se pondrá bien, ¡seguro que puede regenerarse como los trols! ¿No?', 30706),
(164900, 'esMX', '', '¿Cómo puedo transformarme en un brillante enorme como ese enano?', 30706),
(164899, 'esMX', '', '¡Esa eh\'pada es enorme!', 30706),
(164898, 'esMX', 'Vaya, vaya, miren lo que tenemos aquí. La cazadora se ha convertido en la presa. Pensándolo bien, es casi un cliché.', '', 30706),
(164897, 'esMX', '', 'Este es el fin. Ya no tienes escapatoria.', 30706),
(164896, 'esMX', 'Volveremos a hablar... pronto.', '', 30706),
(164895, 'esMX', 'El momento se acerca.', '', 30706),
(164894, 'esMX', 'Al venir a verme se te ha abierto una gran oportunidad.', '', 30706),
(164893, 'esMX', 'He soñado con tu destino, mortal.', '', 30706),
(164892, 'esMX', 'Ve... pero la daga debe quedarse... para servir a mi voluntad.', '', 30706),
(164891, 'esMX', '', 'Honra nuestro pacto... ¡libérame para forjar mi propio destino!', 30706),
(164890, 'esMX', '', '¡Escúchame, dios de las profundidades! Te he traído la llave que todo lo abre... el portador de verdades... ¡la antorcha que ilumina el camino!  ', 30706),
(164889, 'esMX', 'Es un honor otorgarte los atavíos de nuestros héroes más grandiosos. Belono sil\'aru, belore\'dorei. ¡Levántate, adalid de los sin\'dorei!', '', 30706),
(164888, 'esMX', 'Recuerda siempre que a nuestro pueblo no lo definen las tragedias, sino su capacidad para superarlas. De las cenizas del pasado, llevamos la llama de la esperanza hacia el futuro.', '', 30706),
(164887, 'esMX', '', 'No es que tengas mucha opción...', 30706),
(164886, 'esMX', '', 'Hemos llegado. No temas. Este designio era inevitable.', 30706),
(164885, 'esMX', '', 'Rema, rema, marinero...', 30706),
(164884, 'esMX', '', 'Eh\'te lugar está hecho con... ¿botes? ¿Eso es común aquí?', 30706),
(164883, 'esMX', '', '¡¿Tienes amigos pirata\'?! ¿Y conocen algún canto de mar bonito?', 30706),
(164882, 'esMX', '', 'Su poder e inteligencia nos han traído hasta aquí.', 30706),
(164881, 'esMX', '', 'Oí que a la gente de por aquí le encanta el agua. No entiendo por qué…', 30706),
(164880, 'esMX', '', '¿Puedo dih\'parar una de esas cosas? ¡Prometo que tendré cuidado!', 30706),
(164879, 'esMX', '', '¿Esto? Bueno, es mi adalid.', 30706),
(164878, 'esMX', '', '¡Ataquemos a los humanos! ¡Por la Horda!', 30706),
(164877, 'esMX', '', '¿Podemo\' ir a ver la nieve? ¡Quiero saber lo que se siente!', 30706),
(164876, 'esMX', '', 'Oí a algunos aventurero\' decir que Drustvar es muy aterrador... ¡Me encantan las hih\'torias de terror!', 30706),
(164875, 'esMX', '', 'Vaya que hay gente de ah\'pecto curioso aquí.', 30706),
(164874, 'esMX', 'Estamos listos para comenzar, Maiev.', 'Estamos listos para comenzar, Maiev.', 30706),
(164873, 'esMX', '<Maiev Cantosombrío observa atentamente a la celadora oscura al final de la plataforma.>', '<Maiev Cantosombrío observa atentamente a la celadora oscura al final de la plataforma.>', 30706),
(164871, 'esMX', '', 'Me dijeron que hay muchos tesoros eh\'condidos en la selva. ¡Tal vez pueda convertirme en una... arqui... arqueo... lóliga!', 30706),
(164870, 'esMX', '', 'No creo que pueda ser escriba. ¡No sé leer!', 30706),
(164869, 'esMX', '', '¿Sabes deh\'pellejar? ¿Puedo ver tu cuchillo?', 30706),
(164868, 'esMX', '', '¡Tal vez un día sea artesana! Lo que más me guh\'ta es la joyería.', 30706),
(164867, 'esMX', '¡Todo será consumido!', '', 30706),
(164866, 'esMX', '¡El fénix adopta muchas formas!', '', 30706),
(164865, 'esMX', '¡El poderío del cosmos los aplastará!', '', 30706),
(164864, 'esMX', '¡Miren por dónde caminan!', '', 30706),
(164863, 'esMX', '¡El fénix está hambriento!', '', 30706),
(164862, 'esMX', 'Ven, Ma\'ra. ¡Acabemos con estos necios juntos!', '', 30706),
(164861, 'esMX', '', '¿Quieres tomar mi lugar, Anathos?', 30706),
(164860, 'esMX', '', '¡El dragón proclama su perdición!', 30706),
(164859, 'esMX', '', '¿Cuántos puñetazos puedes soportar?', 30706),
(164858, 'esMX', '', '¡No habrá piedad para ustedes!', 30706),
(164857, 'esMX', '', '¡Los elementos los aplastarán!', 30706),
(164856, 'esMX', '', '¡Su defensa es lamentable!', 30706),
(164855, 'esMX', 'Entonces démosles una lección.', '', 30706),
(164854, 'esMX', '', 'En mi mundo natal, derribé a un sinfín de enemigos lazoluz. Estoy ansiosa por hacer lo mismo con estos rivales de la Horda.', 30706),
(164853, 'esMX', 'Vaya, vaya, los héroes más valientes de la Alianza... se acercan torpemente al corazón del imperio trol. Me temo que no podemos dejar que den un paso más.', '', 30706),
(164852, 'esMX', '', '¡Ja! ¡He luchado con goren que han dado más pelea que ustedes!', 30706),
(164851, 'esMX', '', 'Dices que la gente viene aquí y... ¿les deja sus cosa\' a desconocidos? ¿Cómo saben que es seguro?', 30706),
(164850, 'esMX', '', '¡Caigan ante la dragona!', 30706),
(164849, 'esMX', '', '¡Un oponente vergonzoso!', 30706),
(164848, 'esMX', '', 'Su Alianza... caerá...', 30706),
(164847, 'esMX', '', '¿Los banquero\' pueden quedarse con algunos objetos brillante\'?', 30706),
(164846, 'esMX', '', '¡Sientan la furia de los Mag\'har!', 30706),
(164845, 'esMX', '', '¡Seguro hay un montón de objetos brillante\' aquí!', 30706),
(164844, 'esMX', '', '¡Se enfrentan a la dragona de Draenor!', 30706),
(164843, 'esMX', '', '¡Hora de probar su valía!', 30706),
(164842, 'esMX', '¡Otro cadáver para quemar!', '', 30706),
(164841, 'esMX', '¡Contemplen las llamas del fénix!', '', 30706),
(164840, 'esMX', '¡Basta de perder el tiempo! ¡MUERAN!', '', 30706),
(164839, 'esMX', 'El fénix... renacerá...', '', 30706),
(164838, 'esMX', '¿Ves? Te dije que no había de que preocuparse.', '', 30706),
(164837, 'esMX', '¡Una debilidad típica de la Alianza!', '', 30706),
(164836, 'esMX', '¡Las llamas los harán cenizas!', '', 30706),
(164835, 'esMX', '', '¿Cuántos sáuridos entran en eh\'ta nave?', 30706),
(164834, 'esMX', '', '¿Tendremo\' una aventura?', 30706),
(164833, 'esMX', '', '¿Eh\'ta es tu NAVE?', 30706),
(164832, 'esMX', '', '¿Dónde encontraron calavera\' tan grandes? ¿Son de demosaurios?', 30706),
(164831, 'esMX', '', '¡Mira todas esas púa\'! Como dicen siempre los custodios, \"¡Si eh\'tá repleto de púas, es un producto de la Horda!\".', 30706),
(164830, 'esMX', '', 'Se ha eliminado otra amenaza contra nuestros planes. Tienes toda nuestra gratitud.', 30706),
(164829, 'esMX', '', 'Has luchado bien, adalid. Descansa con la tranquilidad de saber que has salvado la vida de nuestros soldados.', 30706),
(164828, 'esMX', '', 'No importa a quién envíen a atacarnos si te tenemos a ti para hacerle frente. ¡Por la Horda!', 30706),
(164827, 'esMX', 'Cuando partamos, nuestro pacto habrá terminado. Si nos desobedeces ante nuestro dios, el eco de tu alma rota resonará por toda la eternidad.', '', 30706),
(164826, 'esMX', 'Puedes quedarte con tu ofrenda. Quizá le divierta.', '', 30706),
(164825, 'esMX', 'Fa\'thuul, ocúpate.', '', 30706),
(164824, 'esMX', 'Me llevaré estos objetos. Es hora de que la oscuridad salga a la luz.', '', 30706),
(164823, 'esMX', 'Sí, ha unido los elementos... y algo más...', '', 30706),
(164822, 'esMX', 'He esperado tanto tiempo... ya siento su ira... su hambre. ¡El Imperio Negro regresará!', '', 30706),
(164821, 'esMX', '', '¡Otra victoria para la Horda! Siempre puedo contar con que harás lo que hay que hacer.', 30706),
(164820, 'esMX', 'Criatura, tenías que entregar las reliquias. ¿Por qué nos invocas aquí?', '', 30706),
(164819, 'esMX', '', 'Excelente trabajo. Ahora nuestras fuerzas podrán viajar más seguras en esta área.', 30706),
(164818, 'esMX', 'Uovssh thyzz... Y\'za othk feln yurr. ¡Shath\'mag sshk shu et\'agthu!', '', 30706),
(164817, 'esMX', '', 'Hasta los soldados más valientes flaquean cuando sus líderes caen frente a ellos. Esta batalla es nuestra.', 30706),
(164816, 'esMX', '', 'Coordinar un ejército de este tamaño no es rápido ni fácil. Y para la Alianza ahora será mucho más difícil gracias a ti.', 30706),
(164815, 'esMX', '', 'Detendremos a la Alianza aquí y ahora. $n, ¡elimina a su líder para desbaratar su cadena de mando!', 30706),
(164814, 'esMX', '', 'Ah, esta misión es sumamente sencilla. Hay un enemigo peligroso aquí. Elimínalo.', 30706),
(164813, 'esMX', '', 'La Alianza está enviando a algunos guerreros fuertes a esta región. Nosotros enviaremos $Ual más:a la más; fuerte que tenemos.', 30706),
(164812, 'esMX', '', 'Nuestras patrullas informan que hay un agente de la Alianza en este lugar. Confío en que puedes encargarte del asunto.', 30706),
(164811, 'esMX', '', 'Hemos identificado a un oficial enemigo en el área. Demuéstrales a nuestros nuevos aliados cómo la Horda defiende su territorio.', 30706),
(164808, 'esMX', 'Papi tenía otro plan, ahora mami no envejecerá nunca.', 'Papi tenía otro plan, ahora mami no envejecerá nunca.', 30706),
(164807, 'esMX', 'Mami intentó enviarme a buscar su voz para que pudiera jugar por siempre.', 'Mami intentó enviarme a buscar su voz para que pudiera jugar por siempre.', 30706),
(164806, 'esMX', '', 'Parece que esta alma perdida quiere seguirte. Quizá tendríamos que llevarla con Nathanos.', 30706),
(164804, 'esMX', 'Bien hecho, soldado. Honras a tus ancestros con esta victoria.', '', 30706),
(164803, 'esMX', 'Huyan, cachorros de la Alianza. Han sentido el poderío de la Horda sobre ustedes.', '', 30706),
(164802, 'esMX', 'Estoy listo para ingresar a la Fuente del Sol. <Iniciar la gesta La caída de la Fuente del Sol.>', 'Estoy lista para ingresar a la Fuente del Sol. <Iniciar la gesta La caída de la Fuente del Sol.>', 30706),
(164801, 'esMX', 'Peleamos con honor en cualquier campo, contra cualquier enemigo, $p. Enséñales a estos perros de la Alianza qué significa ser de la Horda.', '', 30706),
(164800, 'esMX', '', '¿Sí?', 30706),
(164799, 'esMX', '¡Sangre y truenos! ¡Por la Horda!', '', 30706),
(164798, 'esMX', '¡Martillo Salvaje! Ah, ¡y por la Alianza!', '', 30706),
(164797, 'esMX', 'Vaya, vaya... Parece que es necesario recordarle a la Horda quién manda en los cielos... Y esos somos nosotros. Derríbalos.', '', 30706),
(164796, 'esMX', 'Bien, estoy convencido. Espero que Chispacero tenga más de estos para el resto de mis agentes.', '', 30706),
(164795, 'esMX', 'Ya nadie cantará su canción.', 'Ya nadie cantará su canción.', 30706),
(164794, 'esMX', 'Lo abracé hasta que sentí el crujido.', 'Lo abracé hasta que sentí el crujido.', 30706),
(164793, 'esMX', 'Solía cantar una canción hermosa.', 'Solía cantar una canción hermosa.', 30706),
(164792, 'esMX', 'Ah... Debo irme.', '', 30706),
(164791, 'esMX', 'Bien. Eso sí que no salió como lo planeamos.', '', 30706),
(164790, 'esMX', '', 'Un oficial de la Alianza está reuniendo a las tropas cercanas. ¡No permitas que refuercen sus filas!', 30706),
(164789, 'esMX', 'Le enseñaré tu nombre, $n.', 'Le enseñaré tu nombre, $n.', 30706),
(164788, 'esMX', '¡Quiero volver a sentir ese dolor!', '¡Quiero volver a sentir ese dolor!', 30706),
(164787, 'esMX', 'Dice mi nombre. ¡Me duele!', 'Dice mi nombre. ¡Me duele!', 30706),
(164786, 'esMX', 'Detrás de los ojos... Siento sus dientes. Mordisquean, muerden, me estremecen el cerebro. Acércate, dulce, deja que te prueben.', 'Detrás de los ojos... Siento sus dientes. Mordisquean, muerden, me estremecen el cerebro. Acércate, dulce, deja que te prueben.', 30706),
(164785, 'esMX', 'He tenido muchas discrepancias con Sylvanas... Pero jamás olvidaré el sacrificio que hizo. Era la general forestal de Lunargenta. Nada cambiará eso.', '', 30706),
(164784, 'esMX', 'Cuando Arthas la resucitó como un alma en pena y la volvió contra Quel\'Thalas, nos rompió el corazón a todos.', '', 30706),
(164783, 'esMX', 'Ella pagó un precio muy alto para que muchos de nosotros pudiéramos escapar para reconstruir nuestro reino caído.', '', 30706),
(164782, 'esMX', 'Sylvanas Brisaveloz fue la protectora de nuestro reino. Si ella y sus forestales no se hubieran enfrentado a Arthas con semejante ferocidad, quizás nuestro pueblo habría desaparecido.', '', 30706),
(164781, 'esMX', 'No existen palabras para describir la devastación que sufrió nuestro pueblo ese día. Es un milagro que hayamos sobrevivido para contar esta historia. Un milagro que no podemos desperdiciar.', '', 30706),
(164780, 'esMX', 'Perdí un ojo en aquella batalla... Y habría perdido mi vida si no fuese por Halduron.', '', 30706),
(164779, 'esMX', 'No estábamos preparados en absoluto para lo que encontramos. Quel\'Thalas había gozado de una paz idílica durante años. Y de pronto, nos enfrentábamos a la muerte.', '', 30706),
(164778, 'esMX', 'Mi compañía patrullaba los bosques cerca de Zul\'Aman cuando nos informaron de la invasión de la Plaga.', '', 30706),
(164777, 'esMX', 'Aquí es donde comenzó el fin.', '', 30706),
(164776, 'esMX', '', 'Sabes que me dedico a asesinar personas, ¿verdad?', 30706),
(164775, 'esMX', '', 'Permanece alerta.', 30706),
(164774, 'esMX', '', 'Baja la voz.', 30706),
(164773, 'esMX', '', 'Mis flechas están listas.', 30706),
(164772, 'esMX', '', 'Te escucho.', 30706),
(164771, 'esMX', '', 'Apunta dos veces. Haz un disparo certero.', 30706),
(164770, 'esMX', '', 'No hagas ruido.', 30706),
(164769, 'esMX', '', 'Silenciosa y mortal.', 30706),
(164768, 'esMX', '', 'Por la Dama Oscura.', 30706),
(164767, 'esMX', '', 'La muerte de un solo soldado puede convertir una victoria en derrota. ¡Elimina al comandante de la Alianza para desbandar su ejército!', 30706),
(164766, 'esMX', '¡Todo será consumido!', '', 30706),
(164765, 'esMX', '¡Tiemblen ante su voracidad! ¡Su oscuridad!', '', 30706),
(164764, 'esMX', '¡Su patética existencia se esfumará!', '', 30706),
(164763, 'esMX', '¡Se ahogarán en su propio terror!', '', 30706),
(164762, 'esMX', '¡No son más que escombros en la estela de la tormenta!', '', 30706),
(164761, 'esMX', '¡Tiemblen ante su fuerza infinita!', '', 30706),
(164760, 'esMX', '¡Amo! ¡Concédeme fuerza!', '', 30706),
(164759, 'esMX', '¡La victoria será nuestra!', '', 30706),
(164758, 'esMX', '¡Este es el fin de su patética resistencia!', '', 30706),
(164757, 'esMX', '¡Sus gritos resonarán por estos salones!', '', 30706),
(164756, 'esMX', '¡Ya no corromperán esta cámara!', '', 30706),
(164755, 'esMX', '¡BASTA! ¡Esto termina aquí!', '', 30706),
(164754, 'esMX', 'Se... apoderará... de ustedes...', '', 30706),
(164753, 'esMX', 'Su terror... no tendrá... fin...', '', 30706),
(164752, 'esMX', 'Los peces se alimentarán…', '', 30706),
(164751, 'esMX', 'Sus sueños se acaban...', '', 30706),
(164750, 'esMX', '... y el mundo estará a su merced.', '', 30706),
(164749, 'esMX', '... y el amo consigue su premio.', '', 30706),
(164748, 'esMX', '¡Tu sueño se acaba!', '', 30706),
(164747, 'esMX', '¡Tu carne está perdida!', '', 30706),
(164746, 'esMX', '¡Por el amo!', '', 30706),
(164745, 'esMX', '¡No estaba a la altura!', '', 30706),
(164744, 'esMX', '¡Acobárdense ante su poder!', '', 30706),
(164743, 'esMX', '¡Arrodíllense a la sombra de su gloria!', '', 30706),
(164742, 'esMX', '¡Gocen sus susurros!', '', 30706),
(164741, 'esMX', '¡Acepten la verdad del amo!', '', 30706),
(164740, 'esMX', 'Vete... de aquí... Los heridos necesitan tiempo... para sanar...', 'Vete... de aquí... Los heridos necesitan tiempo... para sanar...', 30706),
(164739, 'esMX', 'Estoy... en paz...', 'Estoy... en paz...', 30706),
(164738, 'esMX', 'Lo siento... Quien te haya herido... Olvida... tu ira...', 'Lo siento... Quien te haya herido... Olvida... tu ira...', 30706),
(164737, 'esMX', '¿Ahora... estás $Usatisfecho:satisfecha;, $pr?', '¿Ahora... estás $Usatisfecho:satisfecha;, $pr?', 30706),
(164736, 'esMX', 'Ya entiendo... a qué... se referían... Es tan... oscuro...', 'Ya entiendo... a qué... se referían... Es tan... oscuro...', 30706),
(164735, 'esMX', '¡La sangre de la Horda ensuciará el suelo hoy!', '', 30706),
(164734, 'esMX', 'Lo siento, amigos... Ya no puedo ayudarlos...', 'Lo siento, amigos... Ya no puedo ayudarlos...', 30706),
(164733, 'esMX', 'Otra muerte sin sentido... como todas las demás...', 'Otra muerte sin sentido... como todas las demás...', 30706),
(164732, 'esMX', 'Al final ganaremos.', '', 30706),
(164731, 'esMX', 'Por favor, no lastimes a los demás...', 'Por favor, no lastimes a los demás...', 30706),
(164730, 'esMX', '¡Llegó tu fin!', '', 30706),
(164729, 'esMX', 'El mundo necesita más salud y menos guerras.', 'El mundo necesita más salud y menos guerras.', 30706),
(164728, 'esMX', 'Vivamos para luchar otro día, $pr.', 'Vivamos para luchar otro día, $pr.', 30706),
(164727, 'esMX', 'Lucharé contigo si insistes, pero no metas a los heridos en esto.', 'Lucharé contigo si insistes, pero no metas a los heridos en esto.', 30706),
(164726, 'esMX', 'Los soldados como tú provocaron este desastre.', 'Los soldados como tú provocaron este desastre.', 30706),
(164725, 'esMX', '¿Es que no tienes respeto por los heridos?', '¿Es que no tienes respeto por los heridos?', 30706),
(164724, 'esMX', '¡Estas personas morirán si no las sano!', '¡Estas personas morirán si no las sano!', 30706),
(164723, 'esMX', 'Por favor, $Uamigo:amiga;. No deseo luchar contigo.', 'Por favor, $Uamigo:amiga;. No deseo luchar contigo.', 30706),
(164722, 'esMX', 'Mi tarea no es luchar, pero daré mi vida para proteger a los heridos.', 'Mi tarea no es luchar, pero daré mi vida para proteger a los heridos.', 30706),
(164721, 'esMX', '¡Resistan! ¡Los refuerzos están en camino!', '', 30706),
(164719, 'esMX', 'Que su carne se convierta en una ofrenda de redención.', '', 30706),
(164718, 'esMX', 'Ha despertado, y ahora ellos dormirán en su lugar.', '', 30706),
(164717, 'esMX', 'Son insolentes... indignos de su gracia.', '', 30706),
(164716, 'esMX', 'El olor de la mugre mortal profana esta cámara.', '', 30706),
(164715, 'esMX', '', '$p... El lanzañublo...', 30706),
(164714, 'esMX', '¡Los nagas tienen el control de Mina de Lornesta!', '¡Los nagas tienen el control de Mina de Lornesta!', 30706),
(164713, 'esMX', '', 'Gracias por venir tan rápido, $n. Esta es una tarea que solo puedo confiarte a ti.', 30706),
(164712, 'esMX', '<Asiente.>', '<Asiente.>', 30706),
(164711, 'esMX', '¿Sí, mi reina?', '¿Sí, mi reina?', 30706),
(164710, 'esMX', '', '$UBienvenido campeón:Bienvenida, campeona;. Te necesito.', 30706),
(164707, 'esMX', '', 'El final ya está cerca.', 30706),
(164705, 'esMX', '', 'Pero ten cuidado. Si algo va a matarte, preferiría ser yo.', 30706),
(164704, 'esMX', '', 'Estás pensando abandonarme de nuevo, ¿verdad? Pero qué modales... con todo lo que he hecho por ti.', 30706),
(164703, 'esMX', '', '¿Lo ves?', 30706),
(164702, 'esMX', '', 'Una vez más demuestras que mereces mi admiración. No hay adalid más digno.', 30706),
(164701, 'esMX', '', 'Quédate cerca. No quiero perderte.', 30706),
(164700, 'esMX', '', 'Encuéntrame en el Precipicio del Olvido. Allí se abrirá el camino. Allí se revelará nuestro destino.', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(164699, 'esMX', '', 'La sangre de nuestras víctimas... no hay nada más dulce.', 30706),
(164698, 'esMX', '', 'Vamos, no puedes negar que formamos un equipo magnífico.', 30706),
(164697, 'esMX', '', 'Tú y yo lograremos proezas sorprendentes. Cosas realmente magníficas.', 30706),
(164696, 'esMX', '', 'Me alegra que tengamos una oportunidad de pasar más tiempo $ujuntos:juntas;. Debes saber que, de todos mis compañeros, nadie te supera.', 30706),
(164695, 'esMX', '', '¡Qué glorioso es estar renovada! Aunque no he olvidado tu abuso despiadado de mí en Silithus. Cuánto potencial desperdiciado.', 30706),
(164694, 'esMX', '', 'Sabía que eras la opción correcta, $n. Tu fuerza y tu coraje son... fascinantes.', 30706),
(164693, 'esMX', '', 'Sí. SÍ. Ha pasado tanto tiempo desde que tuve una forma mortal. Este cuerpo es agradable... ¿no crees?', 30706),
(164692, 'esMX', '', 'Pero tú... presiento que tu destino es la grandeza. $UJuntos:Juntas;, lograremos proezas sorprendentes. Cosas realmente magníficas.', 30706),
(164691, 'esMX', '', 'De hecho, acabo de ayudar a otro héroe mortal a derrotar a la Legión Ardiente. Mi sacrificio altruista me dejó débil. Lamentablemente, ese sacerdote tuvo…poca visión.', 30706),
(164690, 'esMX', '', 'Sé que puede ser... desconcertante hablar con un arma. Pero relájate. Solo quiero verte alcanzar tu máximo potencial.', 30706),
(164688, 'esMX', '', 'Sin fuerzas... Necesito... sangre... almas...', 30706),
(164687, 'esMX', '', 'Por más dolor que tengamos que soportar, no perderemos la esperanza. Cuando la oscuridad te rodee, dirige tu mirada hacia el sol eterno.', 30706),
(164686, 'esMX', '', 'Que este momento nos sirva como recordatorio de lo que significa ser sin\'dorei. Que cada uno de nuestros actos sirva para honrar los sacrificios de los que nos precedieron.', 30706),
(164685, 'esMX', '', 'Perdí mi fe tras la caída de Lunargenta. Perdí de vista quién era. Pero la gracia de la Luz me ayudó a encontrar mi redención a tiempo.', 30706),
(164684, 'esMX', '', 'Durante miles de años, la Fuente del Sol fue lo más importante que tenía nuestro pueblo. La profanación de Arthas nos produjo una herida muy grave.', 30706),
(164681, 'esMX', '', 'Un solo eslabón roto desbarata toda la cadena de mando. Bien hecho.', 30706),
(164680, 'esMX', '', '¡Se hizo justicia! ¡Selama am\'oronor!', 30706),
(164679, 'esMX', '', 'Por favor... Estas personas... necesitan ayuda... Necesitan sanar... Y tú también...', 30706),
(164678, 'esMX', '', 'Esta es una casa de paz. ¿Es que no tienes respeto por los heridos?', 30706),
(164677, 'esMX', 'Tomando', 'Tomando', 30706),
(164676, 'esMX', '', 'Un comandante enemigo está acuartelado aquí, vulnerable, como un cordero en el matadero. Haz los honores.', 30706),
(164675, 'esMX', 'La magia es genial. ¡Tal vez pueda aprender!', '', 30706),
(164674, 'esMX', '', 'No hay almas dispuestas por aquí cerca.', 30706),
(164673, 'esMX', '¡Es como si pudieras ver los lugares a los que vas, pero no están ahí de verdad!', '', 30706),
(164672, 'esMX', '¡Oooh! ¿A dónde vamos?', '', 30706),
(164671, 'esMX', '', 'Recibimos informes de un enemigo poderoso cerca. No lo subestimes.', 30706),
(164670, 'esMX', '¿Azeroth está… sangrando? Qué triste. ¿Se recuperará?', '', 30706),
(164669, 'esMX', '', '¡Un ataque decisivo, adalid! La derrota de la Horda se volvió segura en cuanto llegaste.', 30706),
(164668, 'esMX', '', 'Fue una muerte más limpia de la que merecían.', 30706),
(164667, 'esMX', '', 'Mira qué rápido caen a tus pies. ¡No nos quebrarán!', 30706),
(164666, 'esMX', '', 'Que su derrota tenga sabor a cenizas y lágrimas.', 30706),
(164665, 'esMX', '¿Ese es Magni? ¡Era cierto que es de diamante!', '', 30706),
(164664, 'esMX', 'Vaya… la espada…', '', 30706),
(164663, 'esMX', '', 'Creen que pueden contra nosotros. Demuéstrales que están muy equivocados.', 30706),
(164662, 'esMX', '', 'La Horda no se alzará con la victoria aquí. ¡Elimina a sus oficiales para dispersar sus ejércitos!', 30706),
(164661, 'esMX', '', 'Estas callejuelas son ideales para alguien que intenta pasar inadvertido. Echemos un vistazo.', 30706),
(164660, 'esMX', '', 'Hace miles de años que los kaldorei estamos en guerra. Los guerreros de la Horda son unos novatos en comparación.', 30706),
(164659, 'esMX', '', 'La bestia no sobrevive sin cabeza. Derriba al líder del enemigo y el resto también caerá.', 30706),
(164658, 'esMX', '', 'Estos salvajes solo comprenden la lengua de la muerte. Es hora de hablarles en su idioma.', 30706),
(164657, 'esMX', '', 'Tyrande busca el Ojo de Elune. Estaba guardado aquí en Auberdine.', 30706),
(164656, 'esMX', '', 'Para que la Horda esté tan organizada, tiene que haber un comandante dando órdenes cerca. ¡Acaba con esas órdenes!', 30706),
(164655, 'esMX', '', 'Que Elune te acompañe, hermana.', 30706),
(164654, 'esMX', 'Negarle a la Horda cada oportunidad en cada ocasión es la clave para la victoria. La Alianza prevalecerá.', '', 30706),
(164653, 'esMX', 'Tu victoria será un golpe duro para la Horda. Espero con ansias leer todos los detalles en mis informes.', '', 30706),
(164652, 'esMX', 'Tenemos un cargamento extra de armas a nuestra disposición. Podríamos repartirlas entre los trols de sangre. Después de todo, el enemigo de nuestro enemigo...', '', 30706),
(164651, 'esMX', 'Los agentes de la IV:7 han identificado objetivos prioritarios en tu ubicación. Ya sabes qué hacer.', '', 30706),
(164649, 'esMX', '', 'Los nagas buscan reliquias de poder para su ritual. Quieren invocar una tormenta implacable que purgará a los herejes de este mundo. Fanáticos...', 30706),
(164647, 'esMX', '¡$n ha capturado el Taller de Asedio del Anillo Sumergido para la Horda!', '¡$n ha capturado el Taller de Asedio del Anillo Sumergido para la Horda!', 30706),
(164646, 'esMX', '¡$n ha defendido el Taller de Asedio del Anillo Sumergido para la Horda!', '¡$n ha defendido el Taller de Asedio del Anillo Sumergido para la Horda!', 30706),
(164645, 'esMX', '¡$n ha asaltado el Taller de Asedio del Anillo Sumergido para la Horda!', '¡$n ha asaltado el Taller de Asedio del Anillo Sumergido para la Horda!', 30706),
(164644, 'esMX', '¡$n ha asaltado el Taller de Asedio del Anillo Sumergido para la Alianza!', '¡$n ha asaltado el Taller de Asedio del Anillo Sumergido para la Alianza!', 30706),
(164643, 'esMX', '¡$n ha defendido el Taller de Asedio del Anillo Sumergido para la Alianza!', '¡$n ha defendido el Taller de Asedio del Anillo Sumergido para la Alianza!', 30706),
(164642, 'esMX', '¡$n ha capturado el Taller de Asedio del Anillo Sumergido para la Alianza!', '¡$n ha capturado el Taller de Asedio del Anillo Sumergido para la Alianza!', 30706),
(164639, 'esMX', 'Excelente trabajo. La Horda tendrá que reevaluar sus planes.', '', 30706),
(164638, 'esMX', 'Esta misión habría sido imposible de realizar para muchos de mis agentes... Pero no para ti.', '', 30706),
(164637, 'esMX', 'Los trols de sangre me dan miedo, ¡pero sé que me mantendrás a salvo, $n!', '', 30706),
(164636, 'esMX', '¿Está el señor Keeshan aquí? ¡He oído muchas historias de guerra geniales sobre él!', '', 30706),
(164635, 'esMX', 'El agua aquí es bastante barrosa... ¿se puede nadar?', '', 30706),
(164634, 'esMX', 'Estos soldados están muy serios y concentrados. ¡Me recuerdan a los de mi hogar!', '', 30706),
(164633, 'esMX', '¡Mira esos dinosaurio\' pequeñitos! Quiero atrapar uno.', '', 30706),
(164632, 'esMX', '¿Eh\'to es un desierto? ¡Es como una playa sin fin!', '', 30706),
(164631, 'esMX', 'La Horda ha aumentado la cantidad de patrullas en esta área. Averigua a quién protegen y déjalos sin trabajo.', '', 30706),
(164630, 'esMX', '¿Esas son ruinas? ¡¿Podemos ir a explorar?!', '', 30706),
(164629, 'esMX', '¡Quiero ver dinosaurios!', '', 30706),
(164628, 'esMX', '¡Mira todas estas máquinas topo!', '', 30706),
(164627, 'esMX', 'Tu misión, si decides aceptarla, es infiltrarte en la operación de la Horda y matar a un recurso valioso.', '', 30706),
(164626, 'esMX', 'Una operación exitosa. Las sombras te sientan bien.', '', 30706),
(164625, 'esMX', '¡Diez!', '¡Diez!', 30706),
(164624, 'esMX', '¡Nueve!', '¡Nueve!', 30706),
(164623, 'esMX', '¡Ocho!', '¡Ocho!', 30706),
(164622, 'esMX', '¡Siete!', '¡Siete!', 30706),
(164621, 'esMX', '¡Seis!', '¡Seis!', 30706),
(164620, 'esMX', '¡Cinco!', '¡Cinco!', 30706),
(164619, 'esMX', '¡Cuatro!', '¡Cuatro!', 30706),
(164618, 'esMX', 'PLACEHOLDER - Cutscene of Derek Proudmoore being revived, Baine getting angry about it.', 'PLACEHOLDER - Cutscene of Derek Proudmoore being revived, Baine getting angry about it.', 30706),
(164617, 'esMX', '', 'Bueno... ¡eso lo veremos!', 30706),
(164616, 'esMX', '', '¡Ay, Toatana! No puedo creer que digas eso.', 30706),
(164615, 'esMX', 'Toatana sacude la cabeza y emite un chasquido dirigido a Xal\'atath.', '', 30706),
(164614, 'esMX', 'Toatana gesticula y emite un chirrido extraño.', '', 30706),
(164613, 'esMX', 'Toatana emite un chasquido furioso.', '', 30706),
(164612, 'esMX', '¿Qué planeas hacer?', '¿Qué planeas hacer?', 30706),
(164611, 'esMX', '', '¡NO AGUANTARÉ MUCHO MÁS!', 30706),
(164610, 'esMX', '', 'Recuerda: despacio. Con calma. No queremos que esta cosa se haga polvo antes de aprender cómo lograron hacer un encantamiento tan poderoso.', 30706),
(164609, 'esMX', '... ¡JA! ¡Es broma! Por supuesto que no me importa todo eso, ¡estoy volando en un meca que dispara láseres hechos con la sangre del planeta!', '', 30706),
(164608, 'esMX', 'Ese árbol no sería cenizas, la ciudad de los no-muertos aún sería nuestra... es algo para reflexionar, ¿no?', '', 30706),
(164607, 'esMX', 'Si lo piensas detenidamente, si nadie la hubiese descubierto, quizás nunca habríamos comenzado esta guerra.', '', 30706),
(164606, 'esMX', 'Sabes, a veces me pregunto si fue una buena idea contarle a Sylvanas sobre la azerita.', '', 30706),
(164605, 'esMX', 'La próxima vez que vea a ese engendro, ¡lo mataré!', '', 30706),
(164604, 'esMX', 'Gastaré una cantidad de oro ENORME para encontrar una forma de vencer su armadura.', '', 30706),
(164603, 'esMX', '|A:Warfront-HordeHero-Gold:25:23:0:0|a¡Se ha desplegado una fuerza de asalto naga!', '|A:Warfront-HordeWave3:25:23:0:0|a¡Se ha desplegado una fuerza de asalto naga!', 30706),
(164602, 'esMX', '', 'No... No puede terminar así...', 30706),
(164601, 'esMX', 'Esto no ha terminado. Regresaremos más fuertes que nunca.', '', 30706),
(164600, 'esMX', 'No... Lo siento, mi reina.', '', 30706),
(164599, 'esMX', '', 'Entendido. Será rápido y discreto.', 30706),
(164598, 'esMX', '', 'Mis Forestales oscuros están al acecho. Si tienes un objetivo en mente, podemos ayudarte.', 30706),
(164597, 'esMX', '', 'Aquí se dividen nuestros caminos. El resto te lo dejo a ti.', 30706),
(164596, 'esMX', '', 'Bashal\'Aran. Qué cambiado está.', 30706),
(164595, 'esMX', '¿Interrumpiste... mi bebida... para esto?', '', 30706),
(164594, 'esMX', '¡EY! ¡NO TOQUES!', '', 30706),
(164593, 'esMX', '¡Quédate quieto... para que pueda... golpearte! ¡Hip!', '', 30706),
(164592, 'esMX', 'Qué suerte que aún tengo mis brazos.', 'Qué suerte que aún tengo mis brazos.', 30706),
(164591, 'esMX', 'Huesos, no me fallen ahora.', 'Huesos, no me fallen ahora.', 30706),
(164590, 'esMX', 'Desde luego.', 'Desde luego.', 30706),
(164589, 'esMX', '¡Victoria o muerte!', '¡Victoria o muerte!', 30706),
(164588, 'esMX', '¡Por... la Horda!', '¡Por... la Horda!', 30706),
(164587, 'esMX', 'Mis talentos son tuyos.', 'Mis talentos son tuyos.', 30706),
(164586, 'esMX', '¿Me llamaste?', '¿Me llamaste?', 30706),
(164585, 'esMX', 'Como desees.', 'Como desees.', 30706),
(164584, 'esMX', 'Lleva a los corderos al matadero. Un sacrificio digno.', 'Lleva a los corderos al matadero. Un sacrificio digno.', 30706),
(164583, 'esMX', 'Abre la piedra. ¡Seremos uno con el vacío!', 'Abre la piedra. ¡Seremos uno con el vacío!', 30706),
(164582, 'esMX', '¡Ya no dormiremos! Nos alzamos... ¡junto con él!', '¡Ya no dormiremos! Nos alzamos... ¡junto con él!', 30706),
(164581, 'esMX', '¡Los ojos ven todo! Su grandeza... ¡su gloria!', '¡Los ojos ven todo! Su grandeza... ¡su gloria!', 30706),
(164580, 'esMX', '¡Mira esas herramientas tan afiladas! ¿Puedo probarlas?', '', 30706),
(164579, 'esMX', 'Nunca había visto ingeniería gnómica de cerca... ¡parece peligrosa!', '', 30706),
(164578, 'esMX', '¿Y cómo se transforman los pantalones en gemas?', '', 30706),
(164577, 'esMX', 'La señorita Westerson dice que \"chatarra\" es una mala palabra.', '', 30706),
(164576, 'esMX', '¿Qué pasa si toco una de esas cajas brillantes?', '', 30706),
(164575, 'esMX', '¡Quiero que me transfiguren unas hombreras grandes!', '', 30706),
(164574, 'esMX', '¿Esos tipos están hechos de vendas flotantes? ¡Me dan un poco de miedo!', '', 30706),
(164573, 'esMX', 'Algo sobre ver los frutos de tu labor o algo por el estilo. Sonaba ominoso, estoy seguro de que hará enfadar a Baine.', '', 30706),
(164572, 'esMX', 'Ah, cierto. El príncipe de la oscuridad me dijo que te necesitarían de vuelta en el Lamento del Alma en Pena al finalizar esta operación.', '', 30706),
(164570, 'esMX', '¡Nunca estuve en un bote tan grande!', '', 30706),
(164569, 'esMX', 'Je, je... jamás creí que acabaría aquí después de contarle a Sylvanas sobre la azerita.', '', 30706),
(164568, 'esMX', '¿Aquí hacen planes para ganar la guerra? ¿Aquí está Lady Jaina?', '', 30706),
(164567, 'esMX', '¿Es el MISMÍSIMO Halford Aterravermis? ¡Guau!', '', 30706),
(164566, 'esMX', 'Supongo que deberíamos ver el lado positivo. ¡Hicimos estallar una nave, matamos a unos cuantos robots y protegimos nuestra azerita!', '', 30706),
(164565, 'esMX', '¡Mira la armadura de la Séptima Legión! ¡Qué brillante!', '', 30706),
(164564, 'esMX', '¡Casi lo teníamos, BAH! Estúpida nave explosiva.', '', 30706),
(164563, 'esMX', '¿Ese es el acorazado de la Alianza? ¡Es fabuloso! ¡Mira todos esos cañones!', '', 30706),
(164562, 'esMX', '', 'He encantado unos arpones firmemar. ¿Serías tan amable de dispararlos a las naves de la Horda para que podamos devolverles la azerita directamente?', 30706),
(164561, 'esMX', '', 'Teletransportaré las bombas a las naves de la Horda cuanto antes, pero el hechizo necesita un objetivo específico.', 30706),
(164557, 'esMX', '¡Destruye esa cosa para que podamos salir de aquí!', '', 30706),
(164556, 'esMX', '¡EY! ¡Eso es trampa! ¡¿Un escudo indestructible y ADEMÁS nos inhabilita?! ¿Alguna vez te pasó, $p?', '', 30706),
(164555, 'esMX', '¡Contemplen el ultramagnetizador! Les impedirá salir de la nave y provocará un cortocircuito en su patético robot.', '', 30706),
(164554, 'esMX', 'Ha sido todo un DISGUSTO conocerlos, ¡disfruten su tiempo en el más allá o donde sea que vayan!', '', 30706),
(164553, 'esMX', '¡Ja! ¡Gallywix, mi armadura Compleja de Logística Titánica me protegerá de tus patéticos ataques!', '', 30706),
(164551, 'esMX', 'No, no te dejaré ir, ¡esto termina aquí y ahora!', '', 30706),
(164549, 'esMX', 'La nave se desmorona... ¡la próxima no tendrás tanta suerte, Gallywix!', '', 30706),
(164548, 'esMX', '¡Gallywix, $p! Debí destruirlos cuando tuve la oportunidad. ¡Pagarán por esto!', '', 30706),
(164547, 'esMX', 'Enviar la señal de auxilio falsa para atraer a Mekkatorque.', 'Enviar la señal de auxilio falsa para atraer a Mekkatorque.', 30706),
(164546, 'esMX', '¡Mira toda esta... esta destrucción! Esto es lo que pasa cuando posees oro y eres amante del drama.', '', 30706),
(164544, 'esMX', '<Enfréntate a Sira Guardaluna.>', '<Enfréntate a Sira Guardaluna.>', 30706),
(164543, 'esMX', '', '<El cuerpo de Delaryn lleva mucho tiempo frío.>', 30706),
(164541, 'esMX', 'Muéstrame lo que pasó.', 'Muéstrame lo que pasó.', 30706),
(164540, 'esMX', 'El fuego fatuo parece estar temblando.', '', 30706),
(164539, 'esMX', '', 'Nuestro destino nos espera más adelante. Allí, finalmente, el curso cambiará.', 30706),
(164538, 'esMX', 'No lo sé.', 'No lo sé.', 30706),
(164537, 'esMX', 'Asalten los Altos de Lor\'danel.', 'Asalten los Altos de Lor\'danel.', 30706),
(164536, 'esMX', 'Asalten Playa Marea Penumbral.', 'Asalten Playa Marea Penumbral.', 30706),
(164535, 'esMX', 'Asalten Arboleda Cenizal.', 'Asalten Arboleda Cenizal.', 30706),
(164534, 'esMX', 'Asalten Depósito Fresno.', 'Asalten Depósito Fresno.', 30706),
(164533, 'esMX', '', 'Puedo ayudarte a matar a nuestros enemigos. ¿Dónde quieres atacar ahora?', 30706),
(164532, 'esMX', '', 'Cada soldado que salvamos es un bruto cabeza dura menos que debo entrenar en Orgrimmar. Te debo un trago.', 30706),
(164531, 'esMX', '', 'Debo irme por un tiempo. Luchen con honor.', 30706),
(164530, 'esMX', '', 'Que así sea. Regaré la tierra con sangre de la Horda.', 30706),
(164529, 'esMX', '', 'Han construido una base sólida en Bashal\'aran. Bien hecho.', 30706),
(164528, 'esMX', '', '¡Escuchen, peones! Nadie descansará hasta que rescatemos a nuestros guerreros. ¡No abandonamos a los nuestros!', 30706),
(164527, 'esMX', '¡Vaya! ¡No sé si esos orcos sarnosos huelen peor muertos o vivos!', '', 30706),
(164526, 'esMX', 'Esos orcos apestosos intentan avanzar sobre nuestro territorio, pero siento su hedor a kilómetros de distancia. ¡Dales una paliza!', '', 30706),
(164525, 'esMX', '', 'Vi lo que hiciste ahí afuera. Me recuerda a mis días en Alterac. Esos días largos, eternos, en Alterac.', 30706),
(164524, 'esMX', 'Todavía los oigo.', 'Todavía los oigo.', 30706),
(164523, 'esMX', '', '¡Sí, sí! ¡De acuerdo! ¡Llévate esa cosa de aquí!', 30706),
(164521, 'esMX', '', 'Libera la piedra del Vacío, $n. Me dará la fuerza necesaria para encontrar las otras dos reliquias.', 30706),
(164520, 'esMX', '', 'Una piedra para invocar la oscuridad...', 30706),
(164519, 'esMX', '', 'Detenlos y toma lo que nos pertenece.', 30706),
(164518, 'esMX', '', '¡Allí! Esos novicios están practicando un ritual en la piedra.', 30706),
(164517, 'esMX', '', 'Aquello que buscamos está cerca. Una reliquia de energía del Vacío concentrada.', 30706),
(164516, 'esMX', '', 'Aquí. Un camino termina... otro comienza.', 30706),
(164515, 'esMX', '', 'Qué idiota sin carácter. Solo los fuertes merecen el poder verdadero.', 30706),
(164514, 'esMX', '', 'Una corona para el gobernante de todos los mundos...', 30706),
(164513, 'esMX', '¡Estoy tan ansioso que me tiemblan todas las papadas! Vamos por partes, hagamos estallar esa nave.', '', 30706),
(164512, 'esMX', 'Y ahí es cuando tú y yo lo hacemos explotar sobre su nave en llamas. ¡Más dramático imposible!', '', 30706),
(164511, 'esMX', 'Luego, cuando llegue, ¡lo atacaremos entre los dos! Yo lo atacaré desde el meca y tú, eh, haz eso que tú haces cuando no estás en él.', '', 30706),
(164510, 'esMX', 'Volverá volando y seguro dirá: \"¡Oh, no! ¡Gallywix me ha superado! ¡Destruyó mi nave, debo salvar a todos!\".', '', 30706),
(164509, 'esMX', 'Vamos a mostrarle a Mekkatorque que no somos estúpidos después de todo. Una vez que su nave esté en llamas, aterrizaremos en ella y lanzaremos una de esas cosas de auxilio.', '', 30706),
(164508, 'esMX', '¡Bien, aquí vamos! ¡Tenemos el combustible, el plan y las manos para presionar los botones y hacerlo realidad!', '', 30706),
(164507, 'esMX', '', '¡Rayos!', 30706),
(164506, 'esMX', '', 'Ahora... destrúyanlo.', 30706),
(164505, 'esMX', '', 'Allí, en el desembarco... Esa debe ser la tienda de Nathanos. Acércate.', 30706),
(164504, 'esMX', '', 'Tienen muchas tropas. Bien. Cuantos más matemos aquí, menos tendremos que derrotar en las próximas batallas.', 30706),
(164503, 'esMX', '', 'Lor\'danel... No ha quedado nada...', 30706),
(164502, 'esMX', 'Derribé a su líder y tomé las bombas de azerita.', 'Derribé a su líder y tomé las bombas de azerita.', 30706),
(164501, 'esMX', '', '*quejido* ¡Estoy perdiendo el control!', 30706),
(164500, 'esMX', '', 'La complejidad de estos encantamientos es increíble. No hay forma de que una sola persona haya… Vaya. Cuánto poder. Me está costando...', 30706),
(164499, 'esMX', '', '¡Fascinante! Los encantamientos no están yuxtapuestos, ¡están entretejidos! Jamás había visto algo así. Veamos si podemos separarlos un poco más.', 30706),
(164497, 'esMX', '', '$p, solo peleamos con una fracción de las fuerzas de la Horda. Compartiré contigo la visión de Dori\'thur para que podamos seguir espiándolos.', 30706),
(164496, 'esMX', '', 'No podemos vivir en el pasado. No cuando nuestro futuro está en riesgo. Lleva a nuestro pueblo a la victoria mientras yo calmo la ira de la guerrera nocturna.', 30706),
(164495, 'esMX', '', 'Tienes mucha fe en mí, teniendo en cuenta nuestra... historia.', 30706),
(164494, 'esMX', '', 'Ha llegado la hora de recuperar nuestro hogar. Maiev, tú liderarás nuestras fuerzas.', 30706),
(164493, 'esMX', '', 'Clamañublo sigue vivo, pero le ha costado una val\'kyr a su reina.', 30706),
(164492, 'esMX', '', 'Tyrande, ¿qué pasó?', 30706),
(164491, 'esMX', '', 'No. Nuestras fuerzas se reúnen. Saldaremos cuentas otro día.', 30706),
(164490, 'esMX', 'Los cazaré.', '', 30706),
(164489, 'esMX', '¡Bruja! Pagarás con creces por eso. ¡Vamos!', '', 30706),
(164488, 'esMX', 'No es nada. Cuídate, Zelling. Y recuerda que ahora este es territorio enemigo para ti.', '', 30706),
(164487, 'esMX', '¡La Horda ha reunido más de 28 ingredientes y está cerca de la victoria!', '', 30706),
(164486, 'esMX', '¡La Alianza ha reunido más de 28 ingredientes y está cerca de la victoria!', '', 30706),
(164485, 'esMX', '', '¡No! Dama Oscura... lo... siento...', 30706),
(164484, 'esMX', '', 'Nunca más. ¡Ash thoribas!', 30706),
(164483, 'esMX', '', 'No nos queda nada. Somos Renegadas.', 30706),
(164482, 'esMX', '', 'Y tú nos abandonaste. ¡Elune nos abandonó!', 30706),
(164481, 'esMX', '', '¡Sk\'magg yawifk hoq!', 30706),
(164480, 'esMX', '', 'Depositamos nuestra fe en ti.', 30706),
(164479, 'esMX', 'La señorita Voss... Tengo que darle las gracias. Y a ti también, Rexxar, por darme el gusto. Ahora que sé que viven plenamente, mi mente está en paz.', '', 30706),
(164478, 'esMX', '', '¡Luchen contra la oscuridad en sus corazones, hermanas!', 30706),
(164477, 'esMX', '¡Tenemos la azerita! Las fuerzas de la Alianza están débiles y nuestros guerreros se retiran. ¡Regresen a Alameda Viento Oeste!', '', 30706),
(164476, 'esMX', 'PLACEHOLDER scene of Lightforged beacons dropping and troops moving out', '', 30706),
(164475, 'esMX', 'Llegan demasiado tarde. ¡Contemplen!', '', 30706),
(164474, 'esMX', '[ÚLTIMA] ¡Dime qué sucedió!', '[ÚLTIMA] ¡Dime qué sucedió!', 30706),
(164473, 'esMX', '¡Los ecos de tu alma retorcida resonarán durante eones!', '', 30706),
(164472, 'esMX', 'Ha llegado tu hora.', '', 30706),
(164471, 'esMX', 'Pero cuando el ritual esté terminado...', '', 30706),
(164470, 'esMX', 'Puedes saborear un poco de poder ahora...', '', 30706),
(164469, 'esMX', 'O servirá como una excelente ofrenda.', '', 30706),
(164468, 'esMX', 'Seas lo que seas...', '', 30706),
(164467, 'esMX', 'Será mejor que cuides tu lengua...', '', 30706),
(164466, 'esMX', '¡$n ha recolectado un ingrediente para la Horda!', '', 30706),
(164465, 'esMX', '¡$n ha recolectado un ingrediente para la Alianza!', '', 30706),
(164464, 'esMX', '', '¡Levántense! ¡En nombre de Sylvanas, la Reina alma en pena, les concedo este don!', 30706),
(164463, 'esMX', 'No eres nada. ¡Resucítenlos!', '', 30706),
(164462, 'esMX', '¡¿Qué?!', '', 30706),
(164461, 'esMX', '', 'No estamos solos. ¡Ahora!', 30706),
(164460, 'esMX', '¡Suficiente! ¿Alguna última palabra, sacerdotisa?', '', 30706),
(164459, 'esMX', 'No puedes esconderte para siempre de mí, elfa.', '', 30706),
(164458, 'esMX', '', '¡Shal\'karath!', 30706),
(164457, 'esMX', 'Pronto sufrirás el mismo destino que tu querida Sira... y la noble Delaryn. Las reuniones pueden ser tan... conmovedoras.', '', 30706),
(164456, 'esMX', '', 'Te veré cuando hayamos echado a la Horda del muelle.', 30706),
(164455, 'esMX', '', 'No soy una reina. Soy la venganza de los kaldorei.', 30706),
(164454, 'esMX', 'Bastante ordinario para una... ¿reina de los elfos del árbol? Bueno, supongo que ya no... ¿A quiénes reinas ahora exactamente?', '', 30706),
(164453, 'esMX', '¡Los cobardes de la Alianza huyen! ¡Avancen todos! ¡Por la Horda!', '', 30706),
(164452, 'esMX', 'Nuestros exploradores informan que los trols de sangre de la región tienen armas extrañas. Lo último que necesitamos es una guerra en dos frentes.', '', 30706),
(164451, 'esMX', 'Recibes hierro y madera.\nObtienes Poder rebosante.', 'Recibes hierro y madera.', 30706),
(164450, 'esMX', '', 'No verás otro amanecer, monstruo.', 30706),
(164449, 'esMX', 'De todos modos, ya estaba aburrido de esconderme...', 'Bueno, ya estaba aburrida de esconderme...', 30706),
(164448, 'esMX', '¡Regresa a Zandalar, $usucio:sucia; $pr!', '¡Regresa a Zandalar, $usucio:sucia; $pr!', 30706),
(164447, 'esMX', '¡Kul Tiras nos pertenece!', '¡Kul Tiras nos pertenece!', 30706),
(164446, 'esMX', '¡Largo de nuestro continente, escoria de la Horda!', '¡Largo de nuestro continente, escoria de la Horda!', 30706),
(164445, 'esMX', '¡Ey! ¿Cómo me encontraste?', '¡Ey! ¿Cómo me encontraste?', 30706),
(164444, 'esMX', '¡Por la Alianza!', '¡Por la Alianza!', 30706),
(164443, 'esMX', 'Te tomaste tu tiempo para encontrarme.', 'Te tomaste tu tiempo para encontrarme.', 30706),
(164442, 'esMX', 'Siempre supe que la magia de la Horda no puede compararse con la nuestra. Frenaremos la llegada de cualquier tipo de refuerzo.', '', 30706),
(164441, 'esMX', 'La Horda está reuniendo refuerzos en esta zona. Busca a los responsables y elimínalos. ¡Por la Alianza!', '', 30706),
(164440, 'esMX', '', 'Ya veo... Muy bien, reina Talanji. La Horda te da la bienvenida.', 30706),
(164439, 'esMX', '', 'Soy la reina de Zandalar. Una reina no se arrodilla ante nadie. Seguramente sabrás entenderlo.', 30706),
(164438, 'esMX', '', '¿Iguales?', 30706),
(164437, 'esMX', '', 'Que sea oficial. Los zandalari y la Horda lucharán junto\'... como iguales.', 30706),
(164436, 'esMX', '', 'Tengo entendido que necesitas a nueh\'tras fuerzas. La Alianza no se detendrá hasta deh\'truirte.', 30706),
(164435, 'esMX', '', 'Sin su ayuda, quizá no habríamos superado las amenazas que surgieron.', 30706),
(164434, 'esMX', '', 'La Horda ha sido un aliado confiable para Zandalar.', 30706),
(164433, 'esMX', '', 'Sí, ya es hora de que lo hagamos.', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(164432, 'esMX', '', 'Eh\'peraré a la jefa de guerra en mi trono.', 30706),
(164431, 'esMX', 'Ah, es una pena. Hace tiempo que quiero el eh\'píritu de un jefe de guerra. En fin, continúa. Reclama tu corona.', '', 30706),
(164430, 'esMX', '', 'Así es. Mi honor vale má\' que mi libertad.', 30706),
(164429, 'esMX', '¿Esa es tu reh\'puesta definitiva?', '', 30706),
(164428, 'esMX', '', 'La teniente Maliyra perece por sus heridas sin revelar información.', 30706),
(164427, 'esMX', '', '¡No acabarás conmigo tan fácilmente!', 30706),
(164426, 'esMX', '', '¡No te diré... nada!', 30706),
(164424, 'esMX', 'Muero... ¡por Teldrassil!', '', 30706),
(164423, 'esMX', 'El teniente Golras perece por sus heridas sin revelar información.', '', 30706),
(164422, 'esMX', '¡No te diré nada, escoria de la Horda!', '', 30706),
(164421, 'esMX', 'El teniente Ivyth perece por sus heridas sin revelar información.', '', 30706),
(164420, 'esMX', '¡La Alianza tiene el control de Matorral Abrasador!', '¡La Alianza tiene el control de Matorral Abrasador!', 30706),
(164419, 'esMX', '¡Muere, escoria de la Horda!', '', 30706),
(164417, 'esMX', '¡Dime qué sucedió!', '¡Dime qué sucedió!', 30706),
(164416, 'esMX', '¡Nada de charla, solo muerte!', '', 30706),
(164415, 'esMX', '', 'Tomen a Clamañublo. Las val\'kyr son mías.', 30706),
(164414, 'esMX', '', 'No. Esperen mi señal antes de atacar.', 30706),
(164413, 'esMX', 'Somos una sola fuerza.', '', 30706),
(164412, 'esMX', '', '¡Bien hecho! Me alegra que estés de nuestro lado.', 30706),
(164411, 'esMX', '¡Ah, qué pelea! Apuesto a que ni siquiera te vieron llegar. ¡Ja, ja, ja!', '', 30706),
(164410, 'esMX', 'La mismísima tierra se los tragará enteros.', '', 30706),
(164409, 'esMX', '', 'Si matamos a ese objetivo le daremos un golpe a la moral de la Horda. Demuéstrales que su derrota es inevitable.', 30706),
(164408, 'esMX', 'Esos cabezas de chorlito de la Horda creyeron que podían escabullirse en nuestras narices. ¡Detenlos de inmediato!', '', 30706),
(164407, 'esMX', 'No has ganado... nada.', '', 30706),
(164406, 'esMX', '', 'Alto. Vienen más.', 30706),
(164405, 'esMX', '', 'Dejen que se pudra. No se merece una muerte limpia.', 30706),
(164404, 'esMX', '¡Lo lograste! ¡Le daremos un buen uso a esa azerita!', '', 30706),
(164403, 'esMX', 'Por las barbas de Magni, ¡la Horda ha estado acumulando azerita! ¡Acabemos con ellos y tomemos su botín!', '', 30706),
(164402, 'esMX', 'Te veré allí.', '', 30706),
(164400, 'esMX', 'Operaciones reanudadas.', '', 30706),
(164399, 'esMX', 'Capacidad de movimiento recuperada.', '', 30706),
(164398, 'esMX', 'Obteniendo objetivo nuevo para aniquilación arbórea.', '', 30706),
(164397, 'esMX', 'Reanudando operaciones normales.', '', 30706),
(164396, 'esMX', '', '¡Al menos tengo un soldado competente! Podrías enseñarles un poco a estos brutos.', 30706),
(164395, 'esMX', '', 'No pude proteger a mi pueblo, pero lo vengaré.', 30706),
(164394, 'esMX', 'El árbol... fue apenas el comienzo. ¡Esta costa entera sustentará a nuestros ejércitos!', '', 30706),
(164393, 'esMX', '', 'Por favor regrese al estrado, $useñor:señorita; $n.', 30706),
(164392, 'esMX', '', 'En efecto. Si miente en mi tribunal una vez más, $n, ¡$ulo:la; acusaré de desacato!', 30706),
(164391, 'esMX', '', '¡Rayos! Emboscaron un cargamento de suministros vital cerca. ¡Recupéralos! ¡Ahora!', 30706),
(164390, 'esMX', '', '¡Mentira! Su señoría, sabe perfectamente que $uel:la; testigo está mintiendo.', 30706),
(164389, 'esMX', '', '$UEl:La; testigo miente, su señoría. Todos estuvimos allí. Todos vimos esa paliza épica.', 30706),
(164388, 'esMX', '', '¿En serio? ¿No recuerda nada? Bien, continuemos.', 30706),
(164387, 'esMX', '', 'Recuerde que ESTÁ bajo juramento, $n.', 30706),
(164386, 'esMX', '', '$n, investigamos el caso $Ujunto\':junta;. ¿No estaba prestando atención? Ayy...', 30706),
(164385, 'esMX', '', 'Qué extraño, creí estar en lo correcto... Entonces continuemo\'. ¿Es cierto que en sus discusione\' con el señor Husmopasta descubrió un posible motivo?', 30706),
(164381, 'esMX', '', 'Anu dorah, adalid. Eres una inspiración para todos.', 30706),
(164380, 'esMX', '', 'No. La Horda permaneció a nueh\'tro lado cuando todo parecía perdido. No les pagaré con una traición.', 30706),
(164379, 'esMX', '', 'Expulsa a este monstruo. ¡Tor ilisar\'thera\'nal!', 30706),
(164378, 'esMX', '', 'Oh... por los loa...', 30706),
(164376, 'esMX', 'Tráeme la cabeza de la jefa de guerra de la Horda y olvidaremo\' el pacto de tu padre.', '', 30706),
(164375, 'esMX', 'Bien, ya que eh\'tás tan ansiosa por deshacerte de mí... Tengo un nuevo trato para ti.', '', 30706),
(164374, 'esMX', '', 'Has salvado innumerables vidas de la Alianza hoy. Tenemos una deuda de gratitud contigo.', 30706),
(164372, 'esMX', '', 'Ponme a prueba y termina con eh\'to.', 30706),
(164371, 'esMX', '', 'Así será. Gracias.', 30706),
(164370, 'esMX', 'Piensa en esto, y ve con mi bendición.', '', 30706),
(164369, 'esMX', '¿Y qué hay de la Horda?', '', 30706),
(164368, 'esMX', 'Los zandalari, sin duda... ¿pero qué hay de tus aliados? ¿Los tortollanos, los vulperas?', '', 30706),
(164367, 'esMX', 'Entonces te pregunto: ¿Quiénes conforman tu manada?', '', 30706),
(164366, 'esMX', 'Para defender nuestro hogar, los loa nos unimos y resistimos juntos.', '', 30706),
(164365, 'esMX', 'La manada fortalece a mi especie.', '', 30706),
(164364, 'esMX', '', 'La Horda nunca tuvo intenciones de pelear una guerra honorable. Debes detenerlos aquí y ahora.', 30706),
(164363, 'esMX', '', 'Te eh\'cucho, gran loa.', 30706),
(164362, 'esMX', '¡Lok-tar! ¡Gloria y honor para la Horda!', '', 30706),
(164361, 'esMX', '', 'Fue una lección emocionante. Ahora, acepta mi bendición. ¡Que los vientos te protejan!', 30706),
(164360, 'esMX', 'Luchaste con honor y con habilidad. El enemigo se quedará un buen rato lamiéndose las heridas.', '', 30706),
(164359, 'esMX', '', 'Me agrada tu espíritu, pequeña.', 30706),
(164358, 'esMX', 'Es hora de atacar. ¡Agrama-ka!', '', 30706),
(164357, 'esMX', '', 'No puedo luchar contra los vientos de cambio... pero los soportaré.', 30706),
(164356, 'esMX', '', 'El árbol que permanece rígido frente al viento se quiebra. Debes ser flexible, hija mía.', 30706),
(164355, 'esMX', 'Hoy aplastaremos a nuestros enemigos. ¡Lucha con honor, adalid!', '', 30706),
(164354, 'esMX', '', '¡Gah!', 30706),
(164353, 'esMX', '', '¿Tienes problemas?', 30706),
(164352, 'esMX', '', 'No veo casi nada... ¿sigues conmigo, $n?', 30706),
(164351, 'esMX', '', 'Esta tormenta se interpone entre tú y tu corona. ¡Asciende, Talanji!', 30706),
(164350, 'esMX', '', '¡No eh\'peraba menos!', 30706),
(164349, 'esMX', 'Qué descuidada y arrogante ha sido la Alianza al enviar tan pocas tropas. Haz que se arrepientan de su error.', '', 30706),
(164348, 'esMX', '', 'Gracias, gran loa.', 30706),
(164347, 'esMX', 'Estos suministros serán de gran ayuda para nuestros soldados. Será una guerra larga.', '', 30706),
(164346, 'esMX', 'Hemos localizado los refuerzos de la Horda en esta área. Busca su escondite y elimínalos.', '', 30706),
(164345, 'esMX', '¡Ja! Tus acciones le hacen honor a tus palabras. Tienes mi bendición.', '', 30706),
(164344, 'esMX', '', 'No te preocupes, $n. ¡No permitiré que te hagan daño!', 30706),
(164343, 'esMX', '¡Ja! Ahora están débiles. ¡Defiéndelos!', '', 30706),
(164342, 'esMX', 'Los convoys de la Alianza no están bien vigilados. Serán pan comido para ti. ¡Destrúyelos!', '', 30706),
(164341, 'esMX', '', '¡$n!', 30706),
(164340, 'esMX', '¿Ah, sí? Demuéstralo.', '', 30706),
(164339, 'esMX', 'Aquí podemos interrumpir las líneas de suministro del enemigo. Enfócate en el objetivo, soldado. ¡Lok-narash!', '', 30706),
(164338, 'esMX', '', 'Todo lo que tengo. Y mi propia vida, si fuera necesario.', 30706),
(164337, 'esMX', '', 'Puedo darle una mano con eso, capitana. ¡Aguarde!', 30706),
(164336, 'esMX', 'Dime, Talanji... ¿Qué sacrificarías para proteger a los que debes defender?', '', 30706),
(164335, 'esMX', 'Sigue así, colega, y ganaremo\' esta guerra en un abrir y cerrar de ojo\'.', '', 30706),
(164334, 'esMX', '', 'Estábamos recibiendo demasiados disparos, así que hice retroceder a mi gente. Pero si pudieran llegar allí rápido, podríamos llenar de arpones esas naves.', 30706),
(164333, 'esMX', 'Se marcharon furioso\', colega. ¡Taz\'dingo!', '', 30706),
(164332, 'esMX', 'Bien hecho, colega. Le comunicaré las buena\' noticia\' a la jefa de guerra.', '', 30706),
(164331, 'esMX', '', '¡Qué gusto oírlo! ¿Cuál es el estado de los emplazamientos de armas en las almenas?', 30706),
(164330, 'esMX', '', '¡Anu\'dora!', 30706),
(164328, 'esMX', 'Nuestros enemigo\' eh\'tán aquí, tal como predijo la jefa de guerra. Por la Horda, colega.', '', 30706),
(164327, 'esMX', '', 'La piedad ya no es una opción.', 30706),
(164326, 'esMX', '', '¡Sí, Lady almirante! Los Firmemares nunca rechazamos una buena caza.', 30706),
(164323, 'esMX', '', '¡Capitana Madison! ¿Qué dice si mantenemos ocupadas a esas naves mientras $p detiene a sus equipos de zapadores?', 30706),
(164321, 'esMX', 'Los espíritu\' susurran que hay un vudú poderoso cerca. Encuéntralo... y procura que la Alianza no le ponga las mano\' encima.', '', 30706),
(164318, 'esMX', 'La Horda te necesita aquí, colega. Ve y haznos sentir orgulloso\'.', '', 30706),
(164312, 'esMX', 'Este es un magíster de alto rango... ¡Debe haber un traidor entre nosotros! ¡Defensores! ¡Resistan! ¡No podemos dejar que esos monstruos lleguen a la Fuente del Sol!', 'Este es un magíster de alto rango... ¡Debe haber un traidor entre nosotros! ¡Defensores! ¡Resistan! ¡No podemos dejar que esos monstruos lleguen a la Fuente del Sol!', 30706),
(164308, 'esMX', 'Toda manada necesita un líder. Sigue acabando con sus oficiale\' por todo Kul Tiras y toda la Alianza eh\'tará perdida.', '', 30706),
(164305, 'esMX', 'Los eh\'pantaste. Sigamos golpeándolo\' donde les duele hasta que no les quede nada.', '', 30706),
(164304, 'esMX', 'Los espíritu\' dicen que un pez gordo de la Alianza se oculta por aquí. Demuéstrales que la Horda puede alcanzarlos sin importar donde eh\'tén.', '', 30706),
(164303, 'esMX', '', 'Prepárate, $n. Los loa nos observan.', 30706),
(164301, 'esMX', '', 'Pero sé que no debes intervenir. No puedes ayudarme aquí como lo hicih\'te con Samara.', 30706),
(164299, 'esMX', '', '¡Ja, ja, ja! Me encanta ver cómo huyen los cachorros de la Alianza con el rabo entre las patas.', 30706),
(164298, 'esMX', '', '¿Eh\'tán heridos?', 30706),
(164297, 'esMX', 'Necesitamos un asesinato silencioso, pero no conocemo\' la posición exacta del objetivo. ¿Tienes gana\' de escabullirte, colega?', '', 30706),
(164296, 'esMX', '', 'Ni siquiera ahora ere\' capaz de ver quién tiene la culpa de todo. Por eso, debes morir.', 30706),
(164295, 'esMX', '', 'Tú... ¡Tú eres la culpable del caos que se ha apoderado de la ciudad!', 30706),
(164294, 'esMX', '', 'Soy la voz que susurra mientra\' las demás rugen. Soy la araña que ha tejido la telaraña en la que te retuerces.', 30706),
(164293, 'esMX', '', 'Permíteme presentarme.', 30706),
(164292, 'esMX', '', '¿Qué significa eh\'to?', 30706),
(164291, 'esMX', '', 'Tenemo\' mucho que hacer, pero juntos prosperaremos. Te pido humildemente...', 30706),
(164286, 'esMX', '', '$p, conmigo. Nathanos Clamañublo anda por aquí cerca con dos de las val\'kyr de la Reina alma en pena.', 30706),
(164285, 'esMX', '', 'Maiev. Shandris. Preparen nuestras fuerzas para la guerra.', 30706),
(164284, 'esMX', '', 'Los mataremos a todos.', 30706),
(164283, 'esMX', '', 'Ahora, haremos justicia. La guerrera nocturna vive... en mí.', 30706),
(164282, 'esMX', '', '¡Elune! ¡Conviérteme en el instrumento de tu venganza!', 30706),
(164280, 'esMX', '', '¡Ash rohk ilisar! ¡Anu\'dorini ash\'ka!', 30706),
(164278, 'esMX', '', 'Kul erath shul, Kul erath sin.', 30706),
(164277, 'esMX', '', '¡In\'a shul da Elune!', 30706),
(164276, 'esMX', '', 'Con esta ofrenda, exijo ponerme tu cara más oscura.', 30706),
(164275, 'esMX', '', 'Con palabras ancestrales, invoco tu fase más despiadada.', 30706),
(164274, 'esMX', '', 'Ahora, ¡solo te serviré si me concedes justicia!', 30706),
(164273, 'esMX', '', 'Te serví durante milenios. Pero esta noche no vengo como doncella o madre... ni siquiera como sacerdotisa.', 30706),
(164272, 'esMX', '', '¡Elune! ¡Tu pueblo siempre te amó! Y aun así, te quedaste observando, distante e impasible, mientras sufría una muerte cruel.', 30706),
(164271, 'esMX', '', 'De todas las que intentaron hacer el ritual, ninguna ha sobrevivido. El poder bruto de Elune las destroza.', 30706),
(164270, 'esMX', '', 'Cuenta la leyenda que hace mucho tiempo Elune concedió su furia a nuestras guerreras más fuertes para proteger Kalimdor.', 30706),
(164268, 'esMX', '', '¿Zolani? ¿Qué sucede?', 30706),
(164267, 'esMX', '', 'Maiev. ¿Por qué es tan peligroso este ritual?', 30706),
(164266, 'esMX', '', 'Si no eh\'toy a la altura, tú serás quién le informe la decisión de los loa a mi pueblo.', 30706),
(164265, 'esMX', '', 'Tú serás mi teh\'tigo.', 30706),
(164264, 'esMX', '', 'Los loa se encargarán de poner a prueba su eh\'píritu.', 30706),
(164262, 'esMX', '', 'Tengo una tarea eh\'pecial en mente para ti, $n.', 30706),
(164261, 'esMX', 'Que los loa te protejan, Talanji.', 'Que los loa te protejan, Talanji.', 30706),
(164260, 'esMX', '¡La Horda me da asco!', '¡La Horda me da asco!', 30706),
(164259, 'esMX', '¡Marioneta de Bwonsamdi!', '¡Marioneta de Bwonsamdi!', 30706),
(164258, 'esMX', '¡Mi reina!', '¡Mi reina!', 30706),
(164257, 'esMX', '¡Di\'chuka Talanji!', '¡Di\'chuka Talanji!', 30706),
(164256, 'esMX', '¡Alabada sea Talanji! ¡Zandalar por siempre!', '¡Alabada sea Talanji! ¡Zandalar por siempre!', 30706),
(164255, 'esMX', '¡La morada de Rastakhan eh\'tá maldita!', '¡La morada de Rastakhan eh\'tá maldita!', 30706),
(164252, 'esMX', '', '¡Princesa Talanji!', 30706),
(164251, 'esMX', '', 'Si quiere ocupar el trono, Talanji debe someterse a nueh\'tro ritual más sagrado.', 30706),
(164250, 'esMX', '', 'Han pasado siglos de la última vez que nueh\'tro pueblo coronó a un nuevo gobernante.', 30706),
(164248, 'esMX', '¡Tengo uno en la mira!', '¡Tengo uno en la mira!', 30706),
(164247, 'esMX', '¡Mina reptante detectada!', '¡Mina reptante detectada!', 30706),
(164245, 'esMX', '¡Adiós, señorita Westerson!', '', 30706),
(164243, 'esMX', 'Cuéntame sobre la muerte de Vol\'jin.', 'Cuéntame sobre la muerte de Vol\'jin.', 30706),
(164242, 'esMX', 'Aquí está la guja de Vol\'jin.', 'Aquí está la guja de Vol\'jin.', 30706),
(164241, 'esMX', 'Envía una señal a los guerreros, Rexxar. Es hora de atacar la Finca Norwington.', 'Envía una señal a los guerreros, Rexxar. Es hora de atacar la Finca Norwington.', 30706),
(164240, 'esMX', '¡Lok-tar! ¡Vamos!', '', 30706),
(164239, 'esMX', '', 'Ven, $p. Ash\'alah puede cargarnos a $Uambos:ambas; sin esfuerzo.', 30706),
(164237, 'esMX', '', 'Camina con dignidad.', 30706),
(164235, 'esMX', '', 'Ella te verá pronto.', 30706),
(164234, 'esMX', '', 'Por la Dama Oscura.', 30706),
(164233, 'esMX', '', 'La muerte puede ser una segunda oportunidad.', 30706),
(164232, 'esMX', '', 'Obedezco.', 30706),
(164231, 'esMX', '', 'Somos el baluarte.', 30706),
(164230, 'esMX', '', 'Se ha despojado de todo. Solo queda el rito final en la poza de la pureza.', 30706),
(164229, 'esMX', '¡Di\'chuka Zandalar!', '¡Di\'chuka Zandalar!', 30706),
(164228, 'esMX', '', '¡Ash\'alah! ¿Dónde está Tyrande?', 30706),
(164227, 'esMX', '', '¡Prepárense, centinelas! ¡La suma sacerdotisa necesita nuestra ayuda!', 30706),
(164224, 'esMX', '', 'La muerte es fría... incluso para quienes arden.', 30706),
(164223, 'esMX', '', 'Hermana, ¿estás bien?', 30706),
(164222, 'esMX', '¡La Alianza tiene el control de Mina de Lornesta!', '¡La Alianza tiene el control de Mina de Lornesta!', 30706),
(164219, 'esMX', '¡La Alianza tiene el control de Playa Marea Penumbral!', '¡La Alianza tiene el control de Playa Marea Penumbral!', 30706),
(164218, 'esMX', '', '¡Andu-falah-dor!', 30706),
(164217, 'esMX', '', 'La muerte no perdona a nadie.', 30706),
(164216, 'esMX', '', 'Estamos todos condenados.', 30706),
(164215, 'esMX', '', 'Esperen, ¿oyen eso? ¡Hay sobrevivientes!', 30706),
(164214, 'esMX', '', 'Que así sea.', 30706),
(164213, 'esMX', '', 'La esperanza no basta.', 30706),
(164212, 'esMX', '¡La Alianza tiene el control de Cruce Desolado!', '¡La Alianza tiene el control de Cruce Desolado!', 30706),
(164211, 'esMX', '', 'Mi destino... mi maldición.', 30706),
(164210, 'esMX', '', 'No siento... nada.', 30706),
(164209, 'esMX', '¡La Alianza tiene el control de Arboleda Cenizal!', '¡La Alianza tiene el control de Arboleda Cenizal!', 30706),
(164205, 'esMX', 'Debemos conseguir un recurso más. Alguien que quiso resistirse... Y falló. La Dama Oscura fue muy... específica en su deseo.', '', 30706),
(164204, 'esMX', 'Vaya, qué inoportuno. ¡Protejan a las val\'kyr!', '', 30706),
(164203, 'esMX', '', '¡Clamañublo!', 30706),
(164202, 'esMX', 'Ahora que los preparativos están listos, podemos empezar con el ritual.', '', 30706),
(164201, 'esMX', '', '¿Dónde... está...?', 30706),
(164200, 'esMX', '', 'Ella llegará pronto, y los hará pedazos.', 30706),
(164199, 'esMX', '', '¡Ash\'al theradas!', 30706),
(164198, 'esMX', '', 'Huyan a los brazos de su Reina alma en pena. No les tendremos piedad.', 30706),
(164197, 'esMX', '', 'No ganarán. Seguimos cada paso que dan.', 30706),
(164196, 'esMX', '', 'Ni siquiera la muerte te detendrá ahora.', 30706),
(164195, 'esMX', '', 'Levántate, y sirve una vez más.', 30706),
(164194, 'esMX', '', 'La muerte te llama.', 30706),
(164193, 'esMX', '', 'Se te ha dado otra oportunidad.', 30706),
(164192, 'esMX', 'Ah, $uel adalid:la adalid; ha llegado. Bien. Tenemos trabajo por hacer.', '', 30706),
(164191, 'esMX', 'Cuando los elfos de la noche estén muertos a tus pies, llama a Brynja para resucitarlos.', '', 30706),
(164190, 'esMX', 'Tenemos que descubrir el origen de esta noche sobrenatural. Haz una investigación exhaustiva.', '', 30706),
(164189, 'esMX', '', 'Esos insectos de la Alianza han venido en busca de la azerita. ¿Qué esperas? ¡Aplástalos!', 30706),
(164188, 'esMX', '', 'Portavoz de la Horda. Gracias... por todo. Eh\'pero con ansias nueh\'tra próxima aventura. Por ahora, tengo un imperio que gobernar.', 30706),
(164187, 'esMX', '', 'Gracias, jefa de guerra. Ahora que soy reina, creo que tenemos un asunto urgente que dih\'cutir.', 30706),
(164186, 'esMX', 'Cuida tus modale\', pequeña. El viejo Bwonsamdi eh\'tá por encima de los demás loa. Tal como dijo tu padre.', '', 30706),
(164185, 'esMX', 'Descansa un momento, Talanji. Todo lo que quiero es que consideres algo.', '', 30706),
(164184, 'esMX', '', 'Hola, mi criatura sin alas. Ven, tengo que hablar contigo.', 30706),
(164183, 'esMX', '¡Ah, la futura reinita!', '', 30706),
(164180, 'esMX', '', 'Creo que no recibih\'te el mensaje, Talanji.', 30706),
(164178, 'esMX', '', 'Creo que estas balas están defectuosas... ¡No funcionan!', 30706),
(164177, 'esMX', '', 'Has hecho un trabajo admirable, $n. Pondré en marcha los preparativos para recibir a nuestros nuevos aliados en Orgrimmar.', 30706),
(164176, 'esMX', '', 'Felicitaciones, su majestad.', 30706),
(164175, 'esMX', '', 'Saludos, poderoso Krag\'wa.', 30706),
(164174, 'esMX', '', '¿Piensa mandarme a llamar? Pf. Supongo que hoy podemos permitirle estos caprichos.', 30706),
(164172, 'esMX', '', '¿Esta pistola está cargada?', 30706),
(164171, 'esMX', '', '¿Te atreves a pararte en el lugar de Rezan? ¿Acaso tu arrogancia no tiene límite\', Bwonsamdi?', 30706),
(164170, 'esMX', '', 'Loa de las formas. Es un placer verte.', 30706),
(164169, 'esMX', '', 'Saludos, madre de los vientos.', 30706),
(164165, 'esMX', '', 'Debo confesar que no sé qué sucederá ahora.', 30706),
(164164, 'esMX', '', 'Que los loa cuiden de ti, Viuda Blanca.', 30706),
(164163, 'esMX', '', 'Shadra... allí voy...', 30706),
(164162, 'esMX', '', 'Sí, llama a tu maestro. Si debo morir para que la verdad salga a la luz, ¡que así sea!', 30706),
(164161, 'esMX', '', 'No tiene que terminar de eh\'ta forma, Samara. No me hagas enviarte con Bwonsamdi.', 30706),
(164160, 'esMX', '', '¡Esa araña traidora! ¡Cuidado!', 30706),
(164159, 'esMX', '', 'En eh\'te concilio suceden muchas cosas por primera vez. Tú representas la esperanza de los zandalari y mis deseo\' para el futuro.', 30706),
(164158, 'esMX', '¡La Alianza tiene el control de Depósito Fresno!', '¡La Alianza tiene el control de Depósito Fresno!', 30706),
(164157, 'esMX', '¡La Alianza tiene el control de Cantera Petroglacial!', '¡La Alianza tiene el control de Cantera Petroglacial!', 30706),
(164150, 'esMX', '', '¡Ah, $n!', 30706),
(164149, 'esMX', '', 'La venganza es un arma poderosa.', 30706),
(164148, 'esMX', '', 'Te has vuelto más fuerte, hermana.', 30706),
(164147, 'esMX', '', 'Catorce disparos... los tengo.', 30706),
(164146, 'esMX', '', 'Ese es el que se robó mi cerveza.', 30706),
(164145, 'esMX', '', '¡Ash\'al theradas!', 30706),
(164144, 'esMX', '', '¡Les di a tres...! Eh... uno... ¡A cinco!', 30706),
(164143, 'esMX', '¡Trajo a $p!', '¡Trajo a $p!', 30706),
(164142, 'esMX', '¡Es Lady Jaina!', '¡Es Lady Jaina!', 30706),
(164141, 'esMX', '¡Estamos salvados!', '¡Estamos salvados!', 30706),
(164140, 'esMX', '¡Es la lady almirante!', '¡Es la Lady almirante!', 30706),
(164139, 'esMX', 'Pasé un buen tiempo con la princesa Talanji y los zandalari en Nazmir y más allá. Eh\'pero poder cerrar el trato para que se unan a la Horda. Así nos podremo\' ayudar mutuamente.', '', 30706),
(164138, 'esMX', 'Impresionante. Haré que nuestros reclutadores se contacten con algunos de esos ciudadanos. Han demostrado potencial.', '', 30706),
(164137, 'esMX', '', '¡Morirás!', 30706),
(164136, 'esMX', 'No tenemos que resistir solos. La población local seguramente esté dispuesta a ayudarte a combatir a la Horda. Súmalos a nuestra causa.', '', 30706),
(164135, 'esMX', '%s ha recibido mucho daño.', '', 30706),
(164134, 'esMX', 'Será mejor que no hagamo\' esperar a la princesa. Nos veremo\' en Zuldazar.', '', 30706),
(164133, 'esMX', 'Las bombas que plantaste antes aún son seguras, pero el tiempo apremia. Debemos avanzar, o perderemos la ventaja.', '', 30706),
(164132, 'esMX', 'Tenemos que ir al Pulpo, beber una pinta y esperar que explote todo... ¡hic!', '', 30706),
(164131, 'esMX', '', 'Tú, desde luego, eres la excepción.', 30706),
(164130, 'esMX', '¡Buen trabajo, $uamigo:amiga;! Si necesitas un aventón, puedes usar mi máquina voladora. ¡Sígueme!', '', 30706),
(164129, 'esMX', 'Nuestras fuerzas corren con ventaja... por ahora. ¡Ataquen y quiebren la voluntad del enemigo antes de que se recupere!', '', 30706),
(164128, 'esMX', '¡Hoy le has mostrado a la Alianza la furia de la Horda!', '', 30706),
(164127, 'esMX', '', 'Esos cobardes de la Alianza huyen como talbuks atemorizados. Patético. ¡Lok-tar!', 30706),
(164126, 'esMX', '', 'La Alianza se rehúsa a retirarse. ¡Avancen todos! ¡Nadie comerá ni descansará hasta que los hayamos expulsado!', 30706),
(164124, 'esMX', 'Una impresionante cantidad de cadáveres, y una gran muestra del potencial de ese equipo.', '', 30706),
(164123, 'esMX', 'Excelente trabajo, adalid. La amenaza de la Horda está neutralizada.', '', 30706),
(164122, 'esMX', '¡Glorioso! Sin duda valió la pena el viaje desde Altamontaña, ¿no, Aviash? ¡Ja!', '', 30706),
(164121, 'esMX', 'La Alianza lo pensará dos veces antes de lanzar su próximo ataque aéreo. ¡El cielo es de la Horda!', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(164120, 'esMX', '¡Por fin! He estado esperando que la Alianza nos combatiera por aire. ¡Será divertido derribar esa nave de guerra!', '', 30706),
(164119, 'esMX', 'Hay que rescatar a los prisioneros de la nave de guerra antes de destruirla. Pero puedes adelantarte a dañarla mientras los liberas.', '', 30706),
(164118, 'esMX', 'No se supone que peleemos con otras tripulaciones, pero son cosas que pasan, ¿no?', '', 30706),
(164117, 'esMX', '', 'El siguiente siglo es un poco confuso. Recorrí estos bosques sola y asustada. Solo recuerdo que dijo que mientras mi espíritu estuviera vinculado a mi cuerpo, jamás encontraría descanso.', 30706),
(164116, 'esMX', '', 'Creyendo que simplemente me desterraría, decidí esconderme en los bosques. En cambio... separó mi alma de mi cuerpo, pero mantuvo un leve vínculo para que no pudiera alejarme demasiado.', 30706),
(164115, 'esMX', '', 'Tul estaba furioso. Decidió usarme como ejemplo. \"Puedes combatir a estos invasores o esconderte en los bosques por siempre. ¿Qué eliges?\".', 30706),
(164114, 'esMX', '', 'Estaba viva cuando los continentales llegaron a nuestras costas. Gorak Tul se sentía amenazado por su presencia, así que ordenó saquear sus aldeas. Yo no quería involucrarme. Era una oradora de espinas, una guardiana de la naturaleza, y sabía que podíamos vivir en armonía si lo intentábamos.', 30706),
(164113, 'esMX', '', 'Atrás.', 30706),
(164112, 'esMX', 'Propaguen el añublo.', '', 30706),
(164111, 'esMX', 'Es tan difícil encontrar un ayudante útil hoy en día.', '', 30706),
(164110, 'esMX', '¿Te interesa probar un nuevo dispositivo de la IV:7? Estoy seguro de que encontrarás algunos sujetos de prueba de la Horda cerca.', '', 30706),
(164109, 'esMX', 'Apúrate. Tengo un bosque que infectar.', '', 30706),
(164108, 'esMX', 'No te preocupe\'. Yo te cuido la eh\'palda. No dejaré que se lleven nuestro trono.', '', 30706),
(164107, 'esMX', '¡Ah, llegan justo a tiempo! La Reina alma en pena está muy interesada en ver rodar sus cabezas, elfas de la noche.', '', 30706),
(164106, 'esMX', '', 'Llegamos tarde.', 30706),
(164105, 'esMX', '¡Bwonsamdi! ¡Ayúdame!', '', 30706),
(164104, 'esMX', '', 'Este lugar estaba lleno de risas y alegría. Ahora... solo hay silencio y muerte.', 30706),
(164103, 'esMX', '', 'Por aquí. Este fue mi puesto hace muchas lunas.', 30706),
(164102, 'esMX', '', 'Intentaron detenerla.', 30706),
(164101, 'esMX', '', '¿Qué les pasó?', 30706),
(164100, 'esMX', '', '...Como ordenes.', 30706),
(164099, 'esMX', '', 'Sira, explora la costa mientras el resto vamos tierra adentro. Encontraremos a Tyrande y nos reuniremos contigo en Lor\'danel.', 30706),
(164098, 'esMX', '', 'No debemos perder la fe en la diosa. Eso es exactamente lo que quiere la Horda.', 30706),
(164097, 'esMX', 'Todos somos Akunda.', 'Todos somos Akunda.', 30706),
(164096, 'esMX', '', 'Debes saber que ayudaste a detener estas invasiones patéticas... Y así hemos abierto la puerta a algo más grande de Nazjatar.', 30706),
(164095, 'esMX', '', 'Aún así tengo algo para ti que nunca se te habría ocurrido pedir... Un don que mereces más que nadie, mi $Ucampeón:campeona;.', 30706),
(164094, 'esMX', '', 'El universo se abre ante mí. Quizá te convenga rezar para que nuestros caminos no vuelvan a cruzarse.', 30706),
(164093, 'esMX', '', 'En cuanto nos conocimos, pude ver tu potencial. Y él también.', 30706),
(164092, 'esMX', '', 'Los nagas de tus costas no importan. No cuando estás frente al umbral de la verdadera grandeza.', 30706),
(164091, 'esMX', 'Una amenaza nueva de la Horda requiere artillería nueva. Prueba esto en el campo de batalla.', '', 30706),
(164089, 'esMX', '', 'Pudiste haber llegado antes. Toma lo que quieras, hay mucho por hacer.', 30706),
(164088, 'esMX', '', 'Ahora tienes que... ¡Alto!', 30706),
(164087, 'esMX', '', 'Elune... ¿crees que velaba por nosotros cuando Teldrassil ardió?', 30706),
(164086, 'esMX', '', 'Muy bien, mi adalid. Las ofrendas han sido entregadas... y aceptadas.', 30706),
(164085, 'esMX', '', 'Coloca las reliquias aquí, en este lugar sagrado. Utilizaremos su poder.', 30706),
(164084, 'esMX', '', 'Allí estás. Los preparativos están listos. ¿Procedemos?', 30706),
(164083, 'esMX', '', 'Es la encarnación de la ira de Elune. Arriesgaríamos la vida con solo asomarnos a ver el ritual de transformación.', 30706),
(164082, 'esMX', '', '¿De qué ritual hablas, Maiev? ¿Quién es la guerrera nocturna?', 30706),
(164081, 'esMX', '', 'No dejaremos sola a Tyrande en tierras enemigas. ¡Muévanse!', 30706),
(164080, 'esMX', '', '$p, sígueme. Hay poco tiempo.', 30706),
(164079, 'esMX', '', 'Y la única vida que desea arriesgar Tyrande es la suya. Que Elune vele por ella.', 30706),
(164078, 'esMX', '', 'Y la única vida que desea arriesgar Tyrande es la suya.', 30706),
(164075, 'esMX', '¡Ja! Con eso aprenderán. No permitiremos que sus sucias naves mancillen nuestros cielos. ¡Jamás!', '', 30706),
(164074, 'esMX', 'Ya están todos a salvo. Sabía que cumplirías la misión.', '', 30706),
(164070, 'esMX', 'Torcali eh\'tá en la hierba. En las recompensa\' que se acumulan en nuestras mesas. En la fuerza de nuestras lanza\'. Ella es la gran creadora. Grandes valles se forman por donde camina. Los ríos fluyen donde se posan sus cuerno\'.\n\nLa loa de Jo\'nok no tiene un templo. Zandalar es su lugar de culto. Si quieres conocerla, buh\'ca la montaña andante.\n\nJo\'nok es su campeón.', '', 30706),
(164069, 'esMX', '¡¿Esos invasores de la Horda creen que se pueden meter en nuestros cielos?! Eso es un insulto para los jinetes de grifos. Demuéstrales quiénes son los dueños de los aires.', '', 30706),
(164068, 'esMX', '¡La Horda está secuestrando a nuestro pueblo! Sube a esa nave de guerra y tráelos a casa.', '', 30706),
(164067, 'esMX', '¿Quién es Torcali?', '¿Quién es Torcali?', 30706),
(164066, 'esMX', '', '¡Muy bien, vamo\'! ¡Adiós, $uincauto:incauta;!', 30706),
(164065, 'esMX', '¡Jek, jek, jek, jek! ¡Esos ricachones no se la esperaban! Llevemos tus tesoros al sagrario.', '', 30706),
(164064, 'esMX', '', 'Mira eh\'to. ¡Hice que $ueh\'te incauto:eh\'ta incauta; me llevara a todos los santuario\' de los loa para robar objetos brillante\' para ti!', 30706),
(164063, 'esMX', '', '¡Oh, Jani! No pensé que llegaría\' tan pronto.', 30706),
(164062, 'esMX', '¡Azala! ¿Qué haces?', '', 30706),
(164061, 'esMX', '', 'Gracia\' por llevarme a pasear por Zandalar. Creo que es mejor que te marches...', 30706),
(164060, 'esMX', '', 'Creo que será bah\'tante difícil elegir un loa para mí. ¡Voy a tener que pensar mucho!', 30706),
(164059, 'esMX', '', '¡Hay tanto\' loa distinto\'! ¿Cómo se elige a quién seguir?', 30706),
(164058, 'esMX', '', 'Fue un intercambio justo. Que las sombras te guíen, $umi querido amigo:mi querida amiga;.', 30706),
(164057, 'esMX', '', 'Rápido. Tráeme eso.', 30706),
(164056, 'esMX', '', '¡Allí! La Clamatempestades está sobre su... pequeña mascota.', 30706),
(164055, 'esMX', '', '¡Vamos! ¡Todos atraviesen el portal! ¡Deprisa!', 30706),
(164054, 'esMX', '$n. Muéstrale la salida a esta molestia.', '', 30706),
(164053, 'esMX', '', '¿Cómo has estado?\n\nCuando capturemos Bashal\'Aran, invocaré mágicamente a quienes quedaron atrás.', 30706),
(164052, 'esMX', '', '¡Trabajen juntos! ¡Tú y $p pueden hacerlo, Taelia!', 30706),
(164051, 'esMX', '', '¡Aquí viene un enemigo poderoso! ¡Acabaremos con él!', 30706),
(164050, 'esMX', '', '¡Resistan solo un poco más!', 30706),
(164049, 'esMX', '', '¡Lady Almirante! ¡Parece que la Horda está enviando a los peores!', 30706),
(164048, 'esMX', '', 'Vieron la nave de Tyrande por última vez en la Ensenada de Zoram. Comenzaremos allí.', 30706),
(164047, 'esMX', '', '¡Expulsaremos estas abominaciones!', 30706),
(164046, 'esMX', '', 'La marea del alivio todo lo sana.', 30706),
(164045, 'esMX', '', 'Llegan refuerzos.', 30706),
(164044, 'esMX', '', 'Confía en que nuestros hermanos los expulsarán.', 30706),
(164043, 'esMX', '', '¡Debemos proteger esta puerta!', 30706),
(164042, 'esMX', '', 'No... ¡no puede terminar así!', 30706),
(164041, 'esMX', '', 'No te alejes, ¡el poder del mar purificará tus heridas!', 30706),
(164040, 'esMX', 'Pff. Debería volver a mi puesto.', 'Pff. Debería volver a mi puesto.', 30706),
(164039, 'esMX', '¡Qué olor! ¿Quién hizo esto?', '¡Qué olor! ¿Quién hizo esto?', 30706),
(164038, 'esMX', '¿Qué fue eso?', '¿Qué fue eso?', 30706),
(164037, 'esMX', 'Bueno... Está bien. $n, ve a la Antigua Forjaz. Seguramente encontremos algo del ritual de Magni. Solo espero que esto funcione…', '', 30706),
(164036, 'esMX', 'Sin embargo, necesitaré los restos del ritual previo para hacer uno para ti.', '', 30706),
(164035, 'esMX', 'No temas. Azeroth ya ha llamado a su portavoz. La forma pétrea de tu $Uamigo:amiga; solo será temporal.', '', 30706),
(164034, 'esMX', '¡¿Magni?! No, no, no, no le deseo eso a nadie, ¡no importa lo que haya en juego!', '', 30706),
(164033, 'esMX', 'Ya veo. Hay un ritual que puede conseguir lo que buscas. Tu rey lo ha hecho antes.', '', 30706),
(164032, 'esMX', '$UNuestro amigo:Nuestra amiga; debe permanecer en forma de piedra durante un largo período para resistir el calor intenso.', '', 30706),
(164031, 'esMX', '', 'Es hora de que terminemos con esto.', 30706),
(164030, 'esMX', '¡Pedruscón! Me alegra que vinieras. Necesitamos tu ayuda.', '', 30706),
(164029, 'esMX', '', 'Cuidado con ganarte la enemistad de un loa, Azala.', 30706),
(164028, 'esMX', '', 'Pero ten cuidado cuando manipules artefactos poderosos. Cuando advierto deshonestidad, no tengo piedad.', 30706),
(164027, 'esMX', '', 'Joven zandalari, puede que estés acostumbrada a salirte siempre con la tuya en tus merodeos por las calles de tu ciudad.', 30706),
(164026, 'esMX', '', '¿Acaso no te enseñé a controlar tus impulsos, seguidor mío? ¿No te enseñé a no lanzarte de cabeza a la violencia?', 30706),
(164025, 'esMX', '¡Sethraliss! Debes conservar tu fuerza. ¡Puedo ocuparme de esta saqueadora!', '', 30706),
(164024, 'esMX', '', 'Vorrik, no asustes a la niña.', 30706),
(164023, 'esMX', 'Esa piedra angular es un artefacto poderoso, y es importante para mi pueblo. No le pongas un dedo encima.', '', 30706),
(164022, 'esMX', '', '¡Ahh! ¡Juro que no iba a tocarla!', 30706),
(164021, 'esMX', '', '¿Doral ana\'diel?\n\nCuando capturemos Bashal\'Aran, invocaré mágicamente a quienes quedaron atrás.', 30706),
(164020, 'esMX', '', '¡Imposible!', 30706),
(164019, 'esMX', '', '¿En serio creías que estaba huyendo, capitana?', 30706),
(164018, 'esMX', 'Gracias, maestro de la caldera.', '', 30706),
(164007, 'esMX', 'Tanatoa se enfurece y lanza un hechizo oscuro a Xal\'atath.', '', 30706),
(164006, 'esMX', 'Tanatoa apunta a su colega de tamaño diminuto y hace un gesto abrupto.', '', 30706),
(164005, 'esMX', '¡Niña! ¡No toques esa piedra angular!', '', 30706),
(164004, 'esMX', '', '¿Podría\' levantarme? Solo quiero tocarla...', 30706),
(164003, 'esMX', '', '¡$n, mira eso!', 30706),
(164002, 'esMX', 'La reina Talanji ha solicitado hablar contigo.', 'La reina Talanji ha solicitado hablar contigo.', 30706),
(164001, 'esMX', '', 'Estos trols sin duda saben cómo celebrar la llegada de un nuevo líder.', 30706),
(163991, 'esMX', '<Placeholder RTC: Talanji addresses her people.>', '<Placeholder RTC: Talanji addresses her people.>', 30706),
(163990, 'esMX', 'Sí.', 'Sí.', 30706),
(163989, 'esMX', '', 'Los traje hasta el mar abierto precisamente porque aquí no tienen escapatoria.', 30706),
(163988, 'esMX', '', 'Los loa me han dado su bendición. Mis consejero\' me han recibido con los brazos abierto\'. Los líderes de nueh\'tra fe se han arrodillado frente a mí. Mi pueblo tiene muchas voce\', pero todos me han aceptado como su líder.\n\nUna vez que me pare sobre ese estrado, me convertiré en la reina Talanji. Es para lo que mi padre me preparó. Y para lo que me he preparado durante toda mi vida.\n\nEh\'toy lista. ¿Y tú?', 30706),
(163987, 'esMX', 'Estoy listo.', 'Estoy lista.', 30706),
(163986, 'esMX', '$n, tienes la piel de piedra. Azeroth te ha otorgado fuerza. Estás $Ulisto:lista;.', '', 30706),
(163985, 'esMX', '', 'Prepárate para la batalla. No abandonaremos Costa Oscura sin Tyrande.', 30706),
(163984, 'esMX', '', '¡El ritual la matará! Partiremos hacia Costa Oscura de inmediato.', 30706),
(163983, 'esMX', '', 'Piensa realizar los ritos antiguos...', 30706),
(163982, 'esMX', '', 'La guerrera nocturna.', 30706),
(163981, 'esMX', '', 'Ese tomo... ¿Podría ser...?', 30706),
(163980, 'esMX', '', 'Dori\'thur te acompañará. No estamos solos aquí afuera.', 30706),
(163979, 'esMX', '', '¡Ja! ¡Naves de la Horda en el horizonte! No tienes adónde huir, ¡bruja de hielo!', 30706),
(163978, 'esMX', 'Escucho la respuesta de la montaña.', '', 30706),
(163977, 'esMX', 'Estamos unidos. Le pertenezco y me pertenece.', '', 30706),
(163976, 'esMX', 'La tierra misma me acompaña.', '', 30706),
(163975, 'esMX', 'Templa el metal en el agua.', '', 30706),
(163974, 'esMX', '¡Golpea el metal para darle forma!', '', 30706),
(163973, 'esMX', '¡Despejen la forja!', '', 30706),
(163972, 'esMX', '¡Sujeta esto! Tu piel no sucumbirá a las llamas.', '', 30706),
(163970, 'esMX', '¡A forjar!', '', 30706),
(163969, 'esMX', '¡ARDE! ¡Arde con el fuego de los creadores!', '', 30706),
(163968, 'esMX', '¡$UEnano:Enana;, tráeme el metal!', '', 30706),
(163967, 'esMX', '', '¡Ese tonto glotón! Ve y toma lo que nos pertenece, $n.', 30706),
(163966, 'esMX', '', 'Por aquí. Dudo que Toatana nos entregue la corona voluntariamente.', 30706),
(163965, 'esMX', '', 'El resto de ustedes monten guardia. No nos moveremos un paso más hasta haber investigado el área.', 30706),
(163964, 'esMX', '¡La Horda ha experimentado la cólera de la Alianza! Ahora nos temerán. Y te temerán.', '', 30706),
(163963, 'esMX', '', '¡La marea crece!', 30706),
(163962, 'esMX', '', 'Puedo ayudarte. Debes repeler a los nagas que invaden tus costas. Sé cómo hacerlo.', 30706),
(163961, 'esMX', '', 'Debió destruirla para que no pudieran seguirla.', 30706),
(163960, 'esMX', '¿Los esbirros de la Horda creen que pueden atacarnos aquí? Tontos. ¡Erradícalos!', '', 30706),
(163959, 'esMX', '', 'La nave de Tyrande. O al menos lo que queda de ella.', 30706),
(163957, 'esMX', '', 'Si sabías tanto sobre mí, Capitana, tendrías que haber sido más sensata y escapar cuando tuviste la oportunidad.', 30706),
(163956, 'esMX', '¡Su ejército está destrozado! ¡Ha llegado el momento de la venganza de la Alianza!', '', 30706),
(163955, 'esMX', 'Debemos deshacernos de la Horda de una vez por todas. ¡Elimina esta amenaza de inmediato!', '', 30706),
(163954, 'esMX', 'Una victoria audaz y un golpe decisivo contra la Horda.', '', 30706),
(163953, 'esMX', 'Los estandartes de la Alianza ondearán con orgullo en esta tierra.', '', 30706),
(163952, 'esMX', '', '¡Helado hasta los huesos!', 30706),
(163951, 'esMX', 'Estoy listo para testificar. Vamos a la corte.', 'Estoy lista para testificar. Vamos a la corte.', 30706),
(163950, 'esMX', '¿Te has estado portando bien, $n? No has infringido ninguna ley, ¿cierto?', '', 30706),
(163949, 'esMX', '', '¡Todas las armas, abran fuego!', 30706),
(163948, 'esMX', '', '¡Cañones! ¡Abran fuego!', 30706),
(163947, 'esMX', 'Llegó la hora de vengarnos. ¡Arrasa con la Horda y no tomes prisioneros!', '', 30706),
(163946, 'esMX', '', '¡Te llevarán las mareas!', 30706),
(163945, 'esMX', '', '¡Las mareas se mueven en tu contra!', 30706),
(163944, 'esMX', '¡Rompan sus filas! Que regresen arrastrándose con su jefa de guerra.', '', 30706),
(163943, 'esMX', 'Nuestra comandante ha dado la señal.\n\n¡Vamos! ¡Vuelen, vuelen! ¡Por Costa Oscura y por la Alianza!', '', 30706),
(163942, 'esMX', 'Nuestros jinetes de hipogrifos estudian el terreno mientras hablamos.\n\nCuando la comandante dé la señal, volarán hacia la costa y se unirán a ellos.', '', 30706),
(163941, 'esMX', '', 'Prepárate para lo que sea.', 30706),
(163939, 'esMX', '¡Mi martillo está listo para recibirlos!', '', 30706),
(163938, 'esMX', '¡Tenemos polizontes, prepárense!', '', 30706),
(163937, 'esMX', '¡Se arrepentirán de haber subido a mi barco!', '', 30706),
(163936, 'esMX', '', '¡Le di a uno!', 30706),
(163935, 'esMX', '', '¡Estas armas nos darán la ventaja en Nazmir!', 30706),
(163934, 'esMX', '', 'Resistiremos hasta el final. Selama ashal\'anore.', 30706),
(163933, 'esMX', 'Liadrin, ¡vigila la entrada! ¡Que no entre nadie!', '', 30706),
(163932, 'esMX', '¡JA, JA, JA! ¡Esos matones de la Alianza nunca aprenden! ¿Quién es el gólem dorado más bonito? ¿Quién?', '', 30706),
(163931, 'esMX', 'Debemos dejar toda esta miseria atrás. ¡Ya no seremos elfos nobles! En honor a la sangre derramada y los sacrificios de nuestros seres queridos... ¡a partir de este día somos los sin\’dorei!', '', 30706),
(163930, 'esMX', '¡Ay, gracias AL CIELO! No te preocupes, chiquitín. Te voy a cuidar muy bien.', '', 30706),
(163929, 'esMX', 'No... ¡MONSTRUOS! ¡¿Cómo pudieron destruir algo tan glorioso?! Sylvanas tiene razón... ¡los matones de la Alianza no tienen alma!', '', 30706),
(163928, 'esMX', '¡Para que aprendan!', '', 30706),
(163927, 'esMX', '¡Se lo merecen!', '', 30706),
(163926, 'esMX', '¡¿Pero que hacen?! ¡No lo lastimen!', '', 30706),
(163925, 'esMX', 'Eh... ¿Por qué no hacemos un trato? Déjenmelo a mí y sigan alegremente su camino. Yo no le diré nada a su rey, y ustedes no le dirán nada a mi jefa de guerra. ¿De acuerdo?', '', 30706),
(163924, 'esMX', 'El alma de nuestro pueblo. Ahora es una fuente de putrefacción. Empeora con cada amanecer.', '', 30706),
(163923, 'esMX', '', 'La Fuente del Sol... ¿Qué ha hecho?', 30706),
(163922, 'esMX', '¡$n, ven conmigo! ¡Protege a los magísteres a toda costa! ¡Tenemos que llegar a la Fuente del Sol!', '', 30706),
(163921, 'esMX', 'Derrota a suficientes no-muertos para que podamos pasar y deja el resto para los trols. Eso nos dará un poco de tiempo.', '', 30706),
(163920, 'esMX', '', 'El sonido de los cañones... Los amani han llegado a la orilla. ¡Debemos apresurarnos!', 30706),
(163919, 'esMX', '¡Ha llegado la hora! ¡Que la luz del sol nos guíe hasta el final!', '', 30706),
(163918, 'esMX', '¡Detengámonos un momento a admirar esto! El oro... las gemas... Es... Es... ¡Es HERMOSO! ¡Muero de emoción!', '', 30706),
(163917, 'esMX', '¡Levántate, Kel\'Thuzad, y sirve al Rey Exánime una vez más!', '', 30706),
(163916, 'esMX', '¡La Muerte en persona ha venido a reclamar la casa alta de los elfos!', '', 30706),
(163915, 'esMX', '¡Ciudadanos de Quel\'Thalas! Les he dado muchas oportunidades de rendirse, pero las han rechazado tercamente. Sepan que hoy presenciarán el fin de toda su raza. Y de su antigua herencia.', '', 30706),
(163914, 'esMX', 'Hemos construido una Fortaleza. ¡Reúnan a todas las fuerzas que puedan! ¡Quiero la cabeza de Malfurion en una pica!', '', 30706),
(163913, 'esMX', 'Ahora que el Taller está en funcionamiento, podemos construir las catapultas que necesitamos para hacer arder esos árboles.', '', 30706),
(163912, 'esMX', 'El Gran Salón se ha convertido en un Bastión. Ahora podemos empezar a construir un Taller.', '', 30706),
(163911, 'esMX', 'El Cuartel está construido. Sugiero que recluten más soldados para llenarlo.', '', 30706),
(163910, 'esMX', 'El Altar de Tormentas está listo. Aprovecha su poder o úsalo para adoptar la forma de un aliado feroz.', '', 30706),
(163909, 'esMX', 'La Armería está lista. Con los recursos adecuados, puede mejorar nuestro armamento.', '', 30706),
(163908, 'esMX', 'Depósito Fresno nos permitirá cruzar rápidamente el campo de batalla y hacer que la muerte caiga sobre nuestros enemigos desde las alturas.', '', 30706),
(163907, 'esMX', 'Las Ruinas de Lornesta nos pertenecen. Extraigan el hierro del área para fortalecer la maquinaria de guerra de la Horda.', '', 30706),
(163906, 'esMX', 'Hemos tomado el control de Arboleda Cenizal. Aprovecha su madera para la campaña de guerra de la Horda.', '', 30706),
(163905, 'esMX', '¡Playa Marea Penumbral es nuestra! ¡Ahora nuestro boticario puede entrenar alquimistas y construir monstruosidades que aterrorizarán a la Alianza!', '', 30706),
(163904, 'esMX', 'Cruce Desolado nos pertenece. Si lo controlamos, podremos defender Bashal\'Aran.', '', 30706),
(163903, 'esMX', 'Ya nada será igual.', 'Ya nada será igual.', 30706),
(163902, 'esMX', 'La Horda se ha apoderado de Cantera Petroglacial. Mejoraremos nuestro arsenal con el hierro que extraigamos de sus profundidades.', '', 30706),
(163901, 'esMX', 'Ahora controlamos Matorral Abrasador. Usaremos la madera de sus bosques para conquistar Costa Oscura.', '', 30706),
(163900, 'esMX', '¡Retrocedan! La jefa de guerra no estará complacida cuando se entere de este fracaso.', '', 30706),
(163899, 'esMX', 'Las sombras se acercan.', 'Las sombras se acercan.', 30706),
(163898, 'esMX', 'Costa Oscura es de la Horda una vez más... ¡como debe ser!', '', 30706),
(163897, 'esMX', 'Avancen hacia el islote y terminemos con esto. ¡Por la Dama Oscura!', '', 30706),
(163896, 'esMX', 'Todos somos esclavos de este tormento.', 'Todos somos esclavos de este tormento.', 30706),
(163895, 'esMX', 'Mira a tu alrededor, elfo. La naturaleza está perdida.', '', 30706),
(163894, 'esMX', 'Habla. O márchate.', 'Habla. O márchate.', 30706),
(163893, 'esMX', 'La furia de la naturaleza se alza contra ti. ¡Al ataque!', '', 30706),
(163892, 'esMX', 'Nuestra determinación es más fuerte de lo que te imaginas. Puedes destruir nuestro hogar, pero jamás nuestra esperanza.', '', 30706),
(163891, 'esMX', '¿Que decías sobre detenernos? Estamos aquí, paseando por la costa, ante una vista encantadora de tu árbol. O lo que queda de él.', '', 30706),
(163890, 'esMX', '', 'Cuidado, estoy... aquí.', 30706),
(163889, 'esMX', 'Todo debe llegar a su fin.', 'Todo debe llegar a su fin.', 30706),
(163888, 'esMX', 'Tenemos Lor\'danel bajo control. ¡Defiendan esas catapultas!', '', 30706),
(163887, 'esMX', '¡La guerrera nocturna y la Alianza los destruirán a ti y a tu Horda asquerosa, Clamañublo!', '', 30706),
(163886, 'esMX', 'Me han dicho que tu preciosa Tyrande ha aprendido algunos trucos nuevos. Sus rituales inútiles no impedirán que recuperemos Costa Oscura.', '', 30706),
(163885, 'esMX', 'El fuego reduce la esperanza a cenizas.', 'El fuego reduce la esperanza a cenizas.', 30706),
(163884, 'esMX', '', '¡El océano será tu tumba!', 30706),
(163883, 'esMX', 'No por mucho.', '', 30706),
(163882, 'esMX', '¡Vuelve a hablar mal de mi reina y yo mismo te cortaré las alas!', '', 30706),
(163881, 'esMX', 'Al menos tengo un alma, monstruo despreciable.', '', 30706),
(163880, 'esMX', 'Ya has perdido una val\'kyr, Clamañublo. ¿Acaso el alma en pena está tan ciega como para ignorar que ha perdido Costa Oscura también?', '', 30706),
(163879, 'esMX', '', '¡La Horda desaparecerá!', 30706),
(163878, 'esMX', 'Puede que hayas sido formidable. Pero siento que tu alma se desvanece, que tu fuerza vital pierde intensidad... Con gusto extinguiré esa llama.', '', 30706),
(163877, 'esMX', 'No hay más que muerte y dolor.', 'No hay más que muerte y dolor.', 30706),
(163876, 'esMX', 'Hemos recuperado las ruinas de Bashal\'Aran. Desde aquí, construiremos nuestras fortificaciones y tomaremos todo lo necesario para recuperar Costa Oscura.', '', 30706),
(163875, 'esMX', 'Deben llegar a Bashal\'Aran. Acaben con todo a su paso.', '', 30706),
(163874, 'esMX', 'No creas en nada.', 'No creas en nada.', 30706),
(163873, 'esMX', '¡Invencible!', '', 30706),
(163872, 'esMX', 'Qué divertido. El elfo emplumado cree que puede detenernos.', '', 30706),
(163871, 'esMX', '¡Anar\'alah belore! ¡Arderás por lo que has hecho!', '', 30706),
(163870, 'esMX', 'Observo. Escucho.', 'Observo. Escucho.', 30706),
(163869, 'esMX', 'Suficiente, príncipe Arthas. ¡Tu camino termina aquí!', '', 30706),
(163868, 'esMX', 'Hemos recuperado Auberdine. ¡Sigan avanzando y consigan recursos para nuestro asalto!', '', 30706),
(163867, 'esMX', 'Notarán que estas tierras son más peligrosas que la última vez que las profanaron, escoria de la Horda.', '', 30706),
(163866, 'esMX', 'Observa el final: la disipación de la última barrera.', '', 30706),
(163865, 'esMX', 'Montaremos una base aquí mientras ustedes se adelantan para ver a qué nos enfrentamos.', '', 30706),
(163864, 'esMX', '¡Acaben con esos lanzagujas!', '', 30706),
(163863, 'esMX', '', '¡Por la Alianza!', 30706),
(163862, 'esMX', 'Tómense su tiempo, ¿qué prisa tenemos? Estoy seguro de que la Alianza esperará.', '', 30706),
(163861, 'esMX', '', '¡Por Kul Tiras!', 30706),
(163860, 'esMX', '', '¡Sopla un viento gélido!', 30706),
(163859, 'esMX', 'Esta noche sobrenatural solo es útil para atacar desde las sombras.', '', 30706),
(163858, 'esMX', 'Soldados de la Horda, prepárense. ¡Hoy expulsaremos a la Alianza de Costa Oscura y la recuperaremos en nombre de la Reina alma en pena!', '', 30706),
(163856, 'esMX', 'Sirvo a la Reina alma en pena.', 'Sirvo a la Reina alma en pena.', 30706),
(163854, 'esMX', '', '¡Te congelaré ahí mismo!', 30706),
(163853, 'esMX', 'Mis flechas nunca fallan.', 'Mis flechas nunca fallan.', 30706),
(163852, 'esMX', '¿Qué buscas?', '¿Qué buscas?', 30706),
(163851, 'esMX', 'Siempre alerta. Siempre listo.', 'Siempre alerta. Siempre lista.', 30706),
(163850, 'esMX', '¡Arrr! ¡Me uniré a la tripulación!', '¡Arrr! ¡Me uniré a la tripulación!', 30706),
(163848, 'esMX', '¿Tienes una mano para dar y un bolsillo para llenar, $p?\n\n¡Los Filibusteros velaniebla reclutarán gente solo por un día!\n\nÚnete a la tripulación y ayúdanos a saquear la Fundición Aspafresno allá en la colina. ¡Podemos patear a muchos de la Alianza y a esos presumidos de los Valiente!', '', 30706),
(163847, 'esMX', 'Los enemigos de la reina caerán.', 'Los enemigos de la reina caerán.', 30706),
(163846, 'esMX', 'Al final, la muerte nos llega a todos.', 'Al final, la muerte nos llega a todos.', 30706),
(163845, 'esMX', 'Saqueo para uno, saqueo para todos.\nSiempre saquea para ti primero.\n¡Y nunca olvides el alcohol!\n\n¡Ja, ja, ja!', '', 30706),
(163844, 'esMX', 'Por la Dama Oscura.', 'Por la Dama Oscura.', 30706),
(163843, 'esMX', 'Ahora contamos con la bendición de un Árbol de la Eternidad. ¡Recluta a todos los soldados que puedas y haz que Clamañublo pague por sus crímenes!', '', 30706),
(163842, 'esMX', 'Gracias al Taller de Gujas, podemos construir lanzagujas para romper las defensas de Lor\'danel.', '', 30706),
(163841, 'esMX', 'El Árbol de la Vida se ha convertido en un Árbol de las Edades. Ahora podemos comenzar a construir el Taller de Gujas.', '', 30706),
(163840, 'esMX', 'El Anciano de la Guerra ha despertado. Habla con Jarod si quieres invocar tropas nuevas en Bashal\'Aran.', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(163839, 'esMX', 'Hemos completado el Altar de Ancianos. Infúndete con su magia o úsalo para adoptar la forma de un aliado poderoso.', '', 30706),
(163838, 'esMX', 'El Recinto de los Cazadores ha abierto sus puertas. Con los recursos suficientes, puede suministrar armamentos mejorados a nuestras tropas.', '', 30706),
(163837, 'esMX', 'Depósito Fresno nos pertenece. Ahora podemos surcar los cielos de Costa Oscura y llamar a las quimeras para que nos acompañen a la batalla.', '', 30706),
(163836, 'esMX', 'Hay enormes depósitos de hierro ocultos bajo las Ruinas de Lornesta. Es hora de que los aprovechemos.', '', 30706),
(163835, 'esMX', 'Nos hemos apoderado de Arboleda Cenizal. Nuestras fuerzas se beneficiarán con la madera que ofrece.', '', 30706),
(163834, 'esMX', 'Con Playa Marea Penumbral bajo control, mis colegas druidas pueden unirse a nuestro ejército. También podemos invocar la ayuda de otro archidruida.', '', 30706),
(163833, 'esMX', 'Mientras controlemos Cruce Desolado, podemos defender Bashal\'Aran.', '', 30706),
(163832, 'esMX', 'Bien hecho. Nos hemos apoderado de Cantera Petroglacial y del hierro que hay en su mina.', '', 30706),
(163831, 'esMX', 'Hemos liberado Matorral Abrasador de la presencia de la Horda. Su madera será fundamental para nuestra campaña.', '', 30706),
(163830, 'esMX', '¡Retrocedan! Son más fuertes. Reagrúpense y regresaremos con más fuerza.', '', 30706),
(163829, 'esMX', 'Bien luchado. Hemos derrotado a un oponente terrible el día de hoy, y Costa Oscura ha vuelto a pertenecer a los kaldorei.', '', 30706),
(163828, 'esMX', '¡Las naves de guerra se retiran! Rápido, tomen un hipogrifo hacia la Draga y terminemos con esto de una vez por todas.', '', 30706),
(163827, 'esMX', '¿Acaso tu depravación no tiene fin? Nada nos detendrá, ¡ni siquiera tu crueldad infinita!', '', 30706),
(163826, 'esMX', 'He organizado una pequeña reunión para ti. ¡Forestales oscuros, ataquen!', '', 30706),
(163825, 'esMX', 'Como si esas gujas primitivas pudieran intimidarme. Tontos.', '', 30706),
(163824, 'esMX', 'Nuestras fuerzas pronto arrasarán contigo, Clamañublo. ¡Esta vez no tienes escapatoria!', '', 30706),
(163823, 'esMX', 'Hemos asegurado la costa en Lor\'danel. ¡Defiendan nuestros lanzagujas mientras se encargan de las naves goblin!', '', 30706),
(163822, 'esMX', 'Palabras osadas... de la boca de alguien que dejó el mundo por diez mil años para tomar una siesta.', '', 30706),
(163821, 'esMX', '¿Has venido a hacer el trabajo sucio de la Reina alma en pena, Clamañublo? ¿Aún te queda alguna creación maravillosa por destruir?', '', 30706),
(163820, 'esMX', 'No existe fuerza más poderosa que la naturaleza, Clamañublo. Pronto, aprenderás esa lección.', '', 30706),
(163819, 'esMX', '¿Realmente crees que tú y un puñado de druidas bárbaros pueden vencer el poderío de la Horda?', '', 30706),
(163818, 'esMX', 'Hemos recuperado Bashal\'Aran. Desde aquí, fortaleceremos nuestra posición y nuestras fuerzas para marchar hacia Lor\'danel.', '', 30706),
(163817, 'esMX', 'Cuando nombré a Sylvanas jefa de guerra, sabía que eh\'taba asumiendo un gran riesgo. Los loa tienen voces poderosa\', voces que jamás me llevaron por mal camino. Después de todo, eso es lo que me llevó a convertirme en cazador de las sombra\'. \n\nPero el día que morí, hablaban en voz alta, junto\', como si se tratara de muchos loa a la vez. Recuerdo que sonaban tan fuerte. Y ahora no puedo recordar a quién pertenecían las voce\'.', '', 30706),
(163816, 'esMX', 'Si queremos vencer a la Horda, debemos establecer una base en Bashal\'Aran. ¡Apresúrense!', '', 30706),
(163815, 'esMX', 'Clamañublo está aquí. Bien. Nos encargaremos de que pague por los actos de su Reina alma en pena.', '', 30706),
(163813, 'esMX', '¿Creen que recuperarán estas tierras con un puñado de elfos mugrosos?', '', 30706),
(163811, 'esMX', 'Auberdine es nuestra una vez más. Rápido, avancen y consigan todos los recursos que puedan.', '', 30706),
(163809, 'esMX', 'Mientras establecemos una base en Auberdine, ustedes se adelantarán para explorar Bashal\'Aran.', '', 30706),
(163808, 'esMX', 'Debemos darnos prisa.', '', 30706),
(163807, 'esMX', 'Deprisa.', '', 30706),
(163806, 'esMX', '¡Destruyan esas catapultas!', '', 30706),
(163805, 'esMX', '', '¡Destruyan esos lanzagujas!', 30706),
(163804, 'esMX', '¡Campeones de la Alianza! Las fuerzas de la nefaria Horda dominan la Costa Oscura. ¡Pero hoy la recuperaremos!', '', 30706),
(163802, 'esMX', 'Fueron muchísimas personas a mi funeral. Murieron muchísimos a manos de la Legión Ardiente.\n\nVen $uhéroe:heroína;. Vamo\' a ver qué podemo\' encontrar. Avísame cuando estés $ulisto:lista;. Vendrás conmigo en un camino que atraviesa las sombra\'.', '', 30706),
(163796, 'esMX', '', '¡El mar acude a mi llamado!', 30706),
(163792, 'esMX', '¡La cubierta esta lista para estallar!', '', 30706),
(163789, 'esMX', '¡Bombas listas!', '', 30706),
(163788, 'esMX', '¡Cargas colocadas!', '', 30706),
(163787, 'esMX', 'Creo que los hermanos Barbabronce se parecen mucho a él: tienen su modo de liderar, de dirigir la batalla y su curiosidad.', '', 30706),
(163786, 'esMX', 'Yo no robo escena a propósito, colega. ¡Los loa me hicieron así!', '', 30706),
(163784, 'esMX', 'Los otros trols dicen que me convertí en un... \"meme\". ¡¿Alguien puede decirme qué significa eso?!', '', 30706),
(163783, 'esMX', 'Hola, colega. ¿Traes la guja de Vol\'jin? Sin Talanji, la necesitaré para que me eh\'cuche.', '', 30706),
(163782, 'esMX', '', '¡Hundido! ¡No queda nada má\' que cenizas y astillas!', 30706),
(163777, 'esMX', '¡Traigo el relámpago Y el trueno!', '', 30706),
(163772, 'esMX', 'Ganó reputación por sus habilidades en el combate, pero además era un gran erudito. Su estudio se encuentra debajo de nosotros.', '', 30706),
(163767, 'esMX', 'He pasado mucho tiempo hablando a los espíritu\' y los loa. Muchos espíritus perdido\' he traído a Bwonsamdi para que cuidara de ellos.\n\nPero por más fuerte que sea, hizo falta la fortaleza de Talanji para encontrar a Vol\'jin.\n\nAquí actúan poderes oscuro\'. Poderes que nos esconden algo.', '', 30706),
(163765, 'esMX', 'Los Barbabronce eran un clan pequeño en ese entonces. Fue gracias a Aegrim que el apellido Barbabronce empezó a popularizarse e inspirar respeto.', '', 30706),
(163764, 'esMX', '¡Eyyy, colega!', '', 30706),
(163759, 'esMX', 'Será un honor servir.', '', 30706),
(163757, 'esMX', '', '¡Ahora pertenecen a lo\' tiburones!', 30706),
(163754, 'esMX', '', '¡Buen tiro! ¡Su nave se hundirá en las profundidades!', 30706),
(163753, 'esMX', '', '¡Ja! ¡Espero que los kultirano\' naden mejor de lo que navegan!', 30706),
(163748, 'esMX', 'Hola, mi $ubuen amigo:buena amiga;.', '', 30706),
(163746, 'esMX', 'Hasta nuestro próximo encuentro.', '', 30706),
(163744, 'esMX', 'Que la tierra te guíe.', '', 30706),
(163743, 'esMX', 'Adiós.', '', 30706),
(163741, 'esMX', 'Has venido en busca de algo.', '', 30706),
(163733, 'esMX', '', '<Talanji mira con desagrado.>\n\nBwonsamdi se ha parado en el lugar de Rezan. Eh\'te tipo es TAN descarado, juro por mi padre que...\n\n<Talanji respira profundo.>\n\nVamos. Terminemos con eh\'to.', 30706),
(163732, 'esMX', '', 'Gonk será una presencia familiar. Loti me ha contado que es un loa amable, que imparte sus enseñanza\' con amabilidad y es humilde para ser un loa. Veamos qué me tiene preparado.', 30706),
(163731, 'esMX', '', 'Pa\'ku es una loa tempeh\'tuosa. Seguramente me pondrá a prueba con la cólera de una tormenta.\n\n¿Estás $Ulisto:lista; para enfrentarte a una fuerza semejante, $n?', 30706),
(163730, 'esMX', '', 'Debo confesar que no sé mucho del poderoso Krag\'wa. Solo sé que es fuerte y que defenderá ferozmente a sus hermano\' del peligro. Puede que tú o yo tengamos que pelear.', 30706),
(163727, 'esMX', 'Estoy listo.', 'Estoy lista.', 30706),
(163726, 'esMX', '¿En qué puedo ayudarte?', '', 30706),
(163725, 'esMX', '', '¡Pagarás por tu\' crímenes! ¡Todos, ataquen!', 30706),
(163724, 'esMX', '', 'He escuchado historia\' sobre ti, Jaina Valiente. La niñita que traicionó a su padre y perdió a su hermano en la guerra. El fracaso es tu herencia familiar.', 30706),
(163723, 'esMX', '', 'Esta será su única advertencia. Vuelvan con la nave al puerto y ocúpense de sus muertos... o pronto se unirán a ellos.', 30706),
(163722, 'esMX', 'La tierra llama.', '', 30706),
(163712, 'esMX', '', '¡Eh\'tán desintegrando nuestro casco! Si estabas esperando un momento dramático para cambiar el curso de las mareas, ¡es AHORA!', 30706),
(163710, 'esMX', '90 segundos para que comience la batalla por Costa Oscura.', '', 30706),
(163709, 'esMX', '', '¡Nos eh\'tamos hundiendo! Si no se encargan de estos kultiranos, ¡volveremo\' nadando a casa!', 30706),
(163708, 'esMX', '', '¡Nos disparan! Quiten a esos kultirano\' de mis aguas, ¡ahora!', 30706),
(163702, 'esMX', '¡Ningún Horda pisa esta cubierta y sobrevive!', '', 30706),
(163701, 'esMX', '¡Todas las manos, a luchar!', '', 30706),
(163700, 'esMX', '¡Ha llegado la hora de recuperar estas costas! ¡Por la Alianza!', '', 30706),
(163699, 'esMX', '', '¡¿UNA MALDICIÓN?! ¡Por eso nadie ha regresado con eh\'te tesoro! ¡Salgamo\' de aquí!', 30706),
(163697, 'esMX', '', 'Ey, $n. ¡Abre ese cofre del tesoro para mí! ¡Quiero ver lo que hay adentro!', 30706),
(163695, 'esMX', '¡Sumaremos a estos Horda a nuestra colección de prisioneros!', '', 30706),
(163694, 'esMX', '', '¡Con todos eh\'tos objeto\' valiosos podría ser una ricachona! ¡Podría ser lo que quisiera!', 30706),
(163693, 'esMX', 'Prepárense. Nuestros jinetes se acercan.', '', 30706),
(163692, 'esMX', 'Nuestros exploradores están investigando las tierras ocultos por la noche. Cuando den la señal, comenzaremos la campaña para recuperar estas costas.', '', 30706),
(163691, 'esMX', '', '¡Se acerca un navío a babor! ¡Que conozcan el poder de nuestro\' cañones!', 30706),
(163690, 'esMX', '¡Intentan rescatar a los prisioneros!', '', 30706),
(163689, 'esMX', '¡Expulsen a los intrusos!', '', 30706),
(163688, 'esMX', '', '¡Se acercan bandera\' kultiranas a babor!', 30706),
(163687, 'esMX', '', '¡Se acercan kultiranos a estribor!', 30706),
(163686, 'esMX', '', '¡Se acerca un navío enemigo a eh\'tribor! ¡Preparen las armas!', 30706),
(163685, 'esMX', '¿En qué puedo ayudar?', '', 30706),
(163684, 'esMX', 'Honra a los espíritu\' del pasado.', '', 30706),
(163683, 'esMX', '¡Nunca nos rendiremo\'!', '', 30706),
(163682, 'esMX', 'Juntos somo\' fuertes.', '', 30706),
(163681, 'esMX', 'La Horda es nueh\'tra familia.', '', 30706),
(163680, 'esMX', '', '¿Alguna vez has vih\'to tantos tesoros, $n? Zuldazar tiene mucho oro... ¡Pero nada que se pueda levantar!', 30706),
(163679, 'esMX', '', '¡Todos a cubierta! ¡La hija del mar se arrepentirá de haberse metido en nueh\'tras aguas!', 30706),
(163678, 'esMX', '¡La batalla por la Costa Oscura ha comenzado!', '', 30706),
(163677, 'esMX', '30 segundos para que comience la batalla por Costa Oscura.', '', 30706),
(163676, 'esMX', '1 minuto para que comience la batalla por Costa Oscura.', '', 30706),
(163675, 'esMX', '¡Tres!', '¡Tres!', 30706),
(163674, 'esMX', '¡Dos!', '¡Dos!', 30706),
(163673, 'esMX', '¡Uno!', '¡Uno!', 30706),
(163672, 'esMX', '¡Rápido, $n! ¡A los baúles!', '', 30706),
(163671, 'esMX', '¡Eh\'pero que en la muerte te vaya mejor que en la vida!', '', 30706),
(163670, 'esMX', '¿Acaso no lo sabes, colega? ¡Nadie puede eh\'conderse de Bwonsamdi!', '', 30706),
(163669, 'esMX', '¡Si tenías tantas gana\' de morir, tendrías que haber venido a verme antes!', '', 30706),
(163668, 'esMX', 'Tu muerte ha sido como tu vida... Olvidable.', '', 30706),
(163667, 'esMX', '¡Gracias por enviar otro adalid a mi servicio!', '', 30706),
(163666, 'esMX', 'Tarde o temprano... ¡todo\' me sirven!', '', 30706),
(163664, 'esMX', '¡La tormenta te llevará!', '', 30706),
(163663, 'esMX', '¡Nadie puede sobrevivir a la tempestad!', '', 30706),
(163662, 'esMX', '', '¡Sus huesos caerán del cielo!', 30706),
(163661, 'esMX', '', '¡Han invocado mi ira!', 30706),
(163660, 'esMX', '¡No pueden huir!', '', 30706),
(163659, 'esMX', '¡No hay escapatoria!', '', 30706),
(163658, 'esMX', 'Los observo.', '', 30706),
(163657, 'esMX', 'Si fueran sabios, correrían.', '', 30706),
(163656, 'esMX', '¡Sufrirán mi ira!', '', 30706),
(163655, 'esMX', '¡Los aplastaré como moscas!', '', 30706),
(163654, 'esMX', '¡Mejor miren antes de que salte!', '', 30706),
(163653, 'esMX', '', 'El Taller está en funcionamiento. Empiecen a construir catapultas para que podamos despejar un camino hacia Lor\'danel.', 30706),
(163652, 'esMX', '', 'Nuestro Bastión se ha convertido en una Fortaleza. ¡Reúnan a nuestras fuerzas y prepárense para atacar el islote!', 30706),
(163651, 'esMX', '', 'Nuestro Gran Salón ahora es un Bastión. Podemos empezar a construir un Taller de inmediato.', 30706),
(163650, 'esMX', '', 'La construcción del Cuartel se ha completado. Aprovéchenlo para reclutar fuerzas adicionales.', 30706),
(163649, 'esMX', '', 'La Armería está lista. Proporciónenle los recursos que necesita para mejorar nuestras armas y armadura.', 30706),
(163648, 'esMX', '', 'Hemos terminado de construir el Altar de Tormentas. Absorbe su poder o úsalo para adoptar la forma de un aliado poderoso.', 30706),
(163647, 'esMX', '', 'Hemos asegurado Cruce Desolado. ¡Protéjanlo y mantengan el control sobre Bashal\'Aran!', 30706),
(163646, 'esMX', 'Puedo oler su miedo.', '', 30706),
(163645, 'esMX', '', 'Con Depósito Fresno en nuestras manos, podemos recorrer rápidamente el campo de batalla e invocar ayuda desde las alturas.', 30706),
(163644, 'esMX', '', 'Bien. La magia de Playa Marea Penumbral le permitirá a nuestro boticario entrenar alquimistas y crear monstruos que peleen a nuestro lado.', 30706),
(163643, 'esMX', '', 'Nos hemos apoderado de Ruinas de Lornesta. El hierro de su mina nos resultará muy útil.', 30706),
(163642, 'esMX', '', '¡Cantera Petroglacial nos pertenece! Extrae su hierro para que podamos equipar mejor a nuestros guerreros.', 30706),
(163641, 'esMX', '', 'Arboleda Cenizal nos pertenece. Usaremos la madera de su aserradero para fortalecer nuestra posición.', 30706),
(163640, 'esMX', '', 'Nos hemos apoderado del aserradero en Matorral Abrasador. Recojan su madera para reforzar nuestras fortalezas.', 30706),
(163639, 'esMX', '', 'Retrocedan y reagrúpense. La próxima vez que regresemos, Costa Oscura y la Alianza conocerán a la muerte.', 30706),
(163638, 'esMX', '', '¡La victoria es nuestra! Costa Oscura nos pertenece una vez más, y la Alianza jamás la recuperará.', 30706),
(163637, 'esMX', '', 'Prepárense para atacar. Maiev nos aguarda.', 30706),
(163636, 'esMX', '', '¡No le tememos a la muerte! ¡Somos sus heraldos!', 30706),
(163635, 'esMX', '¡Romper sus huesos!', '', 30706),
(163634, 'esMX', '', '¡Mueran, escorias de la Horda! ¡Ash\'al theradas!', 30706),
(163633, 'esMX', '', 'No me asustas, Sira. ¡Ni tú, ni las fuerzas de la muerte a las que sirves!', 30706),
(163630, 'esMX', '', 'Costa Oscura nos pertenece, Maiev. Vamos por ti.', 30706),
(163629, 'esMX', '¡Derramar su sangre!', '', 30706),
(163628, 'esMX', '¡Desgarrar su carne!', '', 30706),
(163626, 'esMX', 'Cómo es... posible...', '', 30706),
(163625, 'esMX', 'Nunca debieron entrar a la selva.', '', 30706),
(163623, 'esMX', '¡Los necio\' mueren primero!', '', 30706),
(163622, 'esMX', '¡Solo los fuerte\' sobreviven!', '', 30706),
(163621, 'esMX', '¡Sientan mis garras!', '', 30706),
(163620, 'esMX', '¡Empieza la caza!', '', 30706),
(163619, 'esMX', '', '¡Yo domino los vientos!', 30706),
(163618, 'esMX', '¡Yo soy la tormenta!', '', 30706),
(163617, 'esMX', 'Que el añublo cubra todo, desde aquí hasta la costa.', '', 30706),
(163616, 'esMX', '', '¡MI AMADO VEHÍCULO!', 30706),
(163615, 'esMX', '', '¡Jamás te olvidaré, Taladravidas!', 30706),
(163614, 'esMX', '', '¡Purificados por los relámpago\'!', 30706),
(163613, 'esMX', '', 'Hemos recuperado Lor\'danel. Lo único que se interpone entre nosotros y Maiev es la masa de agua.', 30706),
(163612, 'esMX', '', '¡Pero acabo de terminar de pagarlo!', 30706),
(163611, 'esMX', '', '¡Convoco el trueno!', 30706),
(163610, 'esMX', '', '¡Las marea\' te llevarán!', 30706),
(163609, 'esMX', '', 'Es cierto que he cometido errores, Sira... ¡Pero no hay justicia en esto!', 30706),
(163608, 'esMX', '', '¡Eh\'ta... ih\'la... es... increíble!', 30706),
(163607, 'esMX', '', 'Esto termina aquí, Maiev. Sabrás qué se siente cuando tus aliados te fallan.', 30706),
(163606, 'esMX', 'No dejen ni un rastro de vida.', '', 30706),
(163605, 'esMX', '', '¡Tú eres quien nos ha abandonado, Maiev! ¡Y me dejaste con toda la responsabilidad en tu ausencia!', 30706),
(163604, 'esMX', '', 'La tormenta... llama...', 30706),
(163603, 'esMX', '', '¡Ya no eres una Celadora, Sira! ¡Has abandonado todo lo que representamos!', 30706),
(163602, 'esMX', '', 'Después de la tormenta, llega la calma.', 30706),
(163601, 'esMX', '', 'Aaah... ¡Qué bien se siente controlar TANTO PODER!', 30706),
(163600, 'esMX', '', 'Bashal\'Aran está bajo nuestro control. Busquen recursos en la región y arrasen con los obstáculos de camino a Lor\'danel.', 30706),
(163599, 'esMX', '', '¡Tengo unas bombas metálicas para ti!', 30706),
(163598, 'esMX', '', '¡Purgado por la tormenta!', 30706),
(163597, 'esMX', '', '¡Hora de TALADRAR!', 30706),
(163596, 'esMX', '', '¡¡¡TALADRAR VIDAS!!!', 30706),
(163595, 'esMX', '¡Liberen el añublo!', '', 30706),
(163594, 'esMX', '', 'Avancen a Bashal\'Aran. Desde allí, ¡arrasaremos con la Alianza!', 30706),
(163593, 'esMX', '', 'Maiev. Es una necia si cree que puede detenernos.', 30706),
(163592, 'esMX', 'Si no soportas el calor... Probablemente quemaste el plato. ¡Créeme, sé lo que digo!', '', 30706),
(163591, 'esMX', '¿Viniste a besar al cocinero? Qué tradición tan rara, pero... no me molesta aceptar.', '', 30706),
(163590, 'esMX', 'Eres persistente, ¿eh? ¡Debes estar muriendo de hambre!', '', 30706),
(163589, 'esMX', 'La buena comida te alegra la vida.', '', 30706),
(163588, 'esMX', '', 'Sira... No... ¡Retírate ahora o me veré obligada a derribarte!', 30706),
(163587, 'esMX', 'Siempre usa ingredientes frescos.', '', 30706),
(163586, 'esMX', '¡No olvides alimentarte bien!', '', 30706),
(163585, 'esMX', '¡La vida es más placentera con el estómago lleno!', '', 30706),
(163584, 'esMX', 'Todavía tengo mucho que aprender.', '', 30706),
(163583, 'esMX', '¿Alguien tiene hambre?', '', 30706),
(163582, 'esMX', '', 'Hemos recuperado Auberdine. Pero no debemos dormirnos en los laureles. Avancen y consigan todos los recursos que puedan.', 30706),
(163581, 'esMX', 'He estado ideando nuevas recetas.', '', 30706),
(163580, 'esMX', '¡Hora de cocinar!', '', 30706),
(163579, 'esMX', '', 'Nuestras fuerzas capturarán Auberdine mientras ustedes se adelantan hacia Bashal\'Aran.', 30706),
(163578, 'esMX', 'La variedad es la sal de la vida.', '', 30706),
(163577, 'esMX', '¡Hola, mi $ubuen amigo:buena amiga;!', '', 30706),
(163576, 'esMX', '', 'Sígueme.', 30706),
(163575, 'esMX', '', 'Prepárense.', 30706),
(163574, 'esMX', '', '¡Campeones! ¡Arrebataremos Costa Oscura de las manos de la Alianza! ¡Preparen sus espadas!', 30706),
(163572, 'esMX', '', '¡Tu mente ha sido purificada!', 30706),
(163571, 'esMX', '', '¡No pueden desafiar el poder de Akunda!', 30706),
(163570, 'esMX', 'Una misión audaz. Como agradecimiento por haberme ayudado, les ofrezco mi colaboración. Cuando llegue el momento, encenderé la llama.', '', 30706),
(163569, 'esMX', 'La Gran Fundición ya no puede producir el calor que se necesita para fundir el metal... no sin tu ayuda.', '', 30706),
(163568, 'esMX', '¡Ignis! Necesitamos tu ayuda. Mi $uamigo:amiga; y yo queremos volver a forjar una antigua armadura enana.', '', 30706),
(163567, 'esMX', '¡Vuelve a la forja!', '', 30706),
(163566, 'esMX', 'Gracias, pequeñín. La forja ha vuelto a estar bajo mi control.', '', 30706),
(163565, 'esMX', '', 'Sigue molestando si quieres... ¡pero te advierto que mi guja está más filosa que NUNCA!', 30706),
(163564, 'esMX', '', 'La muerte se quedará con todos.', 30706),
(163563, 'esMX', '', 'Ahora mi verdadera cacería comienza.', 30706),
(163562, 'esMX', '', 'Fui una tonta al tener fe.', 30706),
(163561, 'esMX', '', 'Las promesas de Elune eran mentiras.', 30706),
(163560, 'esMX', '', 'Nada de palabras. Solo dolor.', 30706),
(163559, 'esMX', '', 'Nuestros enemigos sufrirán.', 30706),
(163558, 'esMX', '', 'Al fin veo el camino verdadero.', 30706),
(163557, 'esMX', '', 'No pongas a prueba mi paciencia.', 30706),
(163555, 'esMX', '', 'Por último, quiero preguntarle, $n: ¿quién cree USTED que mató al intendente?', 30706),
(163554, 'esMX', '', '¡Los tres acusados enfrentan el cargo de asesinar al intendente Paul North!', 30706),
(163553, 'esMX', 'Este artilugio es pura madera... ¡Busca combustible para incendiarlo!', '', 30706),
(163552, 'esMX', '¡Ya era hora de que apareciera alguien!', '', 30706),
(163551, 'esMX', '', '¡No tienen eh\'capatoria!', 30706),
(163550, 'esMX', '', '¡Se los ve muy a gusto arrastrándose!', 30706),
(163549, 'esMX', '', '¡Qué bien les queda la forma de alimaña!', 30706),
(163548, 'esMX', '', 'Mi cacería... ha terminado...', 30706),
(163547, 'esMX', '', 'La esperanza... te traicionará...', 30706),
(163546, 'esMX', 'Pongámosle fin a esto. Nuestro pueblo ha sufrido suficiente.', '', 30706),
(163545, 'esMX', 'Supongo que trabajar para Gallywix es mejor que ser rehén de estos tipos. Al menos un poco.', 'Supongo que trabajar para Gallywix es mejor que ser rehén de estos tipos. Al menos un poco.', 30706),
(163544, 'esMX', 'Bueno, supongo que mejor voy a reparar lo de Gallywix.', 'Bueno, supongo que mejor voy a reparar lo de Gallywix.', 30706),
(163543, 'esMX', '', '¿En esto nos convertiremos? ¿Esclavos en nuestra propia tierra?', 30706),
(163542, 'esMX', '', 'Otra caza exitosa.', 30706),
(163541, 'esMX', '', '¡Tu muerte fortalece a la manada!', 30706),
(163540, 'esMX', 'Solo quedan estos fragmentos.', '', 30706),
(163539, 'esMX', 'No será fácil volver a forjar una pieza de armadura histórica como esta. Pero con la ayuda de Grumnus, quizá sea posible.', '', 30706),
(163538, 'esMX', 'Cuenta la leyenda que cuando se forja una armadura de rey de la montaña, queda ligada al enano para el que se creó.', '', 30706),
(163537, 'esMX', '', '¡Carne freh\'ca!', 30706),
(163536, 'esMX', '', '¡Más presa\' para la manada!', 30706),
(163535, 'esMX', '¡Soy libre! Bueno, tan libre como pueden ser un mecánico de auxilio personal de Gallywix.', '¡Soy libre! Bueno, tan libre como pueden ser una mecánica de auxilio personal de Gallywix.', 30706),
(163534, 'esMX', '¡El viento reh\'ponde a mi voluntad!', '', 30706),
(163533, 'esMX', '¡Los cielo\' nos pertenecen!', '', 30706),
(163532, 'esMX', '¡El viento nos empuja!', '', 30706),
(163531, 'esMX', 'Me uno... al viento...', '', 30706),
(163530, 'esMX', 'Han demoh\'trado ser indignos de respirar eh\'te aire sagrado.', '', 30706),
(163529, 'esMX', '¡Muere, hereje!', '', 30706),
(163528, 'esMX', '', 'Cuando quieras, $n.', 30706),
(163527, 'esMX', '¡Comida para los sáurido\'!', '', 30706),
(163526, 'esMX', '¡No puedes enfrentarte a los loa!', '', 30706),
(163523, 'esMX', '', '¡Desde luego! La tengo aquí mismo.', 30706),
(163522, 'esMX', 'Todos de pie. La jueza Zumbarriel abandona la sala. Albóndiga tiene hambre. Se levanta la sesión.', '', 30706),
(163521, 'esMX', '', 'Me gustaría que la corte entre en receso para que su equipo investigue esta evidencia en detalle.', 30706),
(163520, 'esMX', '', 'Comandante Cuervario, su asociado hobgoblin ha encontrado información relevante para el planteo de la fiscalía.', 30706),
(163519, 'esMX', '', 'Ya veo. Es muy unusual... pero lo permitiré.', 30706),
(163518, 'esMX', '', 'Acérquese.', 30706),
(163517, 'esMX', 'Nugg necesita hablarle un momento, su señoría.', '', 30706),
(163516, 'esMX', '¡Alto! ¡Detengan todo!', '', 30706),
(163515, 'esMX', 'En el caso de la Horda contra Husmopasta, Skrizzik, Hongoveloz y $n, encontramos a...', '', 30706),
(163514, 'esMX', '', '¡Qué intrigante! Prosiga, señor presidente.', 30706),
(163513, 'esMX', 'Así es, su señoría.', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(163512, 'esMX', '', 'Ya veo. ¿Y han encontrado a algún culpable entre los presentes?', 30706),
(163511, 'esMX', 'El jurado ha llegado a un veredicto, su señoría.', '', 30706),
(163510, 'esMX', '', 'Muy bien. Ahora me gustaría darle al jurado la oportunidad de deliberar...', 30706),
(163509, 'esMX', '', 'La defensa descansa, su señoría.', 30706),
(163508, 'esMX', '', 'No hay otra explicación para lo obvio: $n mató a Paul North.', 30706),
(163507, 'esMX', '', '$n nos ha mentido todo este tiempo. Se comporta como $uun asesino:una asesina; con algo que esconder.', 30706),
(163506, 'esMX', '', 'Me gustaría presentarle al jurado esta foto S.E.L.F.I.E. que muestra claramente cómo $N infringe la ley distribuyendo invitaciones ilegales a Liza\'gar. ¡No tiene ningún respeto por la ley!', 30706),
(163505, 'esMX', '', '¿Su sed de sangre no tiene fin? Y por último: $useñor:señorita; $n. Usted acusó a mi cliente elfo de sangre de asesinato.', 30706),
(163504, 'esMX', '', 'Sin embargo, asesinaste a dos ingenieros inocentes mientras investigabas a mi cliente, ¿es correcto?', 30706),
(163503, 'esMX', '', '¿Ven? $uÉl:Ella; tiene motivos económicos. Y, $useñor:señorita; $n, ha acusado a mi intachable cliente orco de haber asesinado al intendente.', 30706),
(163502, 'esMX', '', '¡Pero los registros indican que USTED asesinó a Lord Sylysthrel para robar su bien habido oro del luchador! ¿Es eso correcto?', 30706),
(163501, 'esMX', '', '$uSeñor:Señorita; $n. Ha acusado a mi cliente goblin de tener motivos para matar a nuestro intendente.', 30706),
(163500, 'esMX', '', '¡$n mató a Paul North!', 30706),
(163499, 'esMX', '', 'Nos gustaría presentar una teoría alternativa al jurado:', 30706),
(163498, 'esMX', '', 'Gracias, su señoría.', 30706),
(163497, 'esMX', '', 'Gracias, abogado. ¿La defensa?', 30706),
(163496, 'esMX', '', 'La fiscalía deh\'cansa, su señoría.', 30706),
(163495, 'esMX', '', '¡Eh\'taba poseída por un demonio!', 30706),
(163494, 'esMX', '', '¡Era una eh\'pía de la Alianza!', 30706),
(163493, 'esMX', '', '¡Eh\'taba tan aburrida con la Arena Liza\'gar que decidió robar tiendas!', 30706),
(163492, 'esMX', '', '¡Eh\'taba tan aburrida con la Arena Liza\'gar que escupió por la borda del zepelín!', 30706),
(163491, 'esMX', '', 'La falsificación de invitaciones a causa del aburrimiento requiere una gran cantidad de ingresos disponibles, y esto concuerda con la espada enjoyada que $n encontró en la escena.', 30706),
(163490, 'esMX', '', 'Eh\'taba tan aburrida con la Arena Liza\'gar que empezó a distribuir invitaciones falsas.', 30706),
(163489, 'esMX', '', 'Libbiara Clamañublo tenía un excelente motivo para asesinar a Paul North:', 30706),
(163488, 'esMX', 'No, está equivocada...', '', 30706),
(163487, 'esMX', '', '¡Quería entregar el sombrero de nueh\'tro intendente al Rey Exánime!', 30706),
(163486, 'esMX', '', '¡Quería vender el sombrero de nueh\'tro intendente al más alto postor!', 30706),
(163485, 'esMX', '', '¡Quería entregar el sombrero de nueh\'tro intendente como alimento para un monstruo de las sombras invisible!', 30706),
(163484, 'esMX', '', '¡Quería entregar el corazón de nueh\'tro intendente al Rey Exánime!', 30706),
(163483, 'esMX', '', '¡Quería vender el corazón de nueh\'tro intendente al más alto postor!', 30706),
(163482, 'esMX', '', '¡Quería entregar el corazón de nueh\'tro intendente como alimento para un monstruo de las sombras invisible!', 30706),
(163481, 'esMX', '', '¡Quería entregar el alma de nueh\'tro intendente al Rey Exánime!', 30706),
(163480, 'esMX', '', '¡Quería vender el alma de nueh\'tro intendente al más alto postor!', 30706),
(163479, 'esMX', '', 'Eh\'to encaja con la evidencia que $n encontró en la escena: un pergamino sombrío.', 30706),
(163478, 'esMX', '', '¡Quería entregar el alma de nueh\'tro intendente como alimento para un monstruo de las sombras invisible!', 30706),
(163477, 'esMX', '', 'El maestro de las sombra\' Skrizzik también tenía un buen motivo:', 30706),
(163476, 'esMX', '¡Cómo... te... atreves...!', '', 30706),
(163475, 'esMX', '', '¡Él mató a Paul North para encubrir otro asesinato!', 30706),
(163474, 'esMX', '', '¡Él y Paul North eran parte de un triángulo amoroso!', 30706),
(163473, 'esMX', '', 'Tenía grandes deuda\' con Jaina Valiente.', 30706),
(163472, 'esMX', '', 'Tenía grandes deuda\' con Thrall.', 30706),
(163471, 'esMX', '', 'Eh\'to encaja con la evidencia que $ encontró en la escena: un cajón de suministro\' valiosos había sido robado.', 30706),
(163470, 'esMX', '', 'Tenía grandes deuda\' con Lord Sylysthrel.', 30706),
(163469, 'esMX', '', 'El jefe del foso Husmopasta tenía buenos motivo\' para matar a Paul North:', 30706),
(163468, 'esMX', '', 'Dama\' y caballero\' del jurado, han escuchado la evidencia.', 30706),
(163467, 'esMX', '', 'Pfshh. Si divertirse un poco es un crimen, entonces soy culpable. Pagaré cualquier multa que decidan. Terminemos con esto.', 30706),
(163466, 'esMX', '', 'Ya veo. ¿Y qué CRIMEN cometió por aburrimiento?', 30706),
(163465, 'esMX', '', '¿Y cuál era ese motivo?', 30706),
(163464, 'esMX', '', 'Gracias. Y, $n, ¿es cierto que en sus discusione\' con la señorita Hongoveloz descubrió un posible motivo?', 30706),
(163463, 'esMX', '', '¿Qué evidencia encontró en la escena del crimen que implica a la señorita Hongoveloz?', 30706),
(163462, 'esMX', '', 'Por último, $n, me gustaría preguntarle sobre Libbiara Hongoveloz.', 30706),
(163461, 'esMX', 'Lo siento.', '', 30706),
(163460, 'esMX', '', '¡No permitiré el desorden en mi tribunal de la gresca!', 30706),
(163459, 'esMX', '¡N-n-no comprende! Y-yo...', '', 30706),
(163458, 'esMX', '', '¿Y a quién iba a darle ese sombrero?', 30706),
(163457, 'esMX', '', '¿Y a quién iba a darle ese corazón?', 30706),
(163456, 'esMX', '', '¿Y a quién iba a darle esa alma?', 30706),
(163455, 'esMX', '', '¿Y cuál era ese motivo?', 30706),
(163454, 'esMX', '', 'Gracias. Y, $n, ¿es cierto que en sus discusione\' con el señor Skrizzik descubrió un posible motivo?', 30706),
(163453, 'esMX', '', '$n, uh\'ted también encontró evidencia que podría implicar al maestro de las sombra\' Skrizzik. ¿Qué encontró?', 30706),
(163452, 'esMX', '¿Qui-Quién, yo?', '', 30706),
(163451, 'esMX', '', 'Gracia\', su señoría. Me gustaría continuar con algunas pregunta\' sobre un tal maestro de las sombra\' Skrizzik.', 30706),
(163450, 'esMX', '', 'Abogada, puede continuar.', 30706),
(163449, 'esMX', '', 'Es poco ortodoxo, pero lo permitiré.', 30706),
(163448, 'esMX', '¡Hablas demasiado, niña! ¡Te mataré!', '', 30706),
(163447, 'esMX', '', '¿Y a quién le debía el dinero?', 30706),
(163446, 'esMX', '¡EY!', '', 30706),
(163445, 'esMX', '', '¿Y cuál era ese motivo?', 30706),
(163444, 'esMX', '', 'Gracias. Y, $n, ¿es cierto que en sus discusione\' con el señor Husmopasta descubrió un posible motivo?', 30706),
(163443, 'esMX', '', '¿Y cuál era esa evidencia?', 30706),
(163442, 'esMX', '', '$n, ¿es cierto que encontró evidencia en la escena del crimen que implica al jefe del foso Husmopah\'ta?', 30706),
(163441, 'esMX', '¡Ey!', '', 30706),
(163440, 'esMX', '', '$n, me gustaría hacerle algunas pregunta\' sobre el jefe del foso Husmopasta.', 30706),
(163439, 'esMX', '', 'La fiscalía llama a $n al estrado.', 30706),
(163438, 'esMX', '', 'Gracias, Tiana. Fiscal, su testigo.', 30706),
(163435, 'esMX', '', '¡Mis clientes son inocentes!', 30706),
(163434, 'esMX', '', 'Gracias, abogada. ¿Los comentarios de apertura de la defensa?', 30706),
(163431, 'esMX', '', 'Los tres acusado\' enfrentan cargos de asesinato. ¡Queremo\' demostrar que al menos uno es culpable!', 30706),
(163430, 'esMX', '', 'Gracia\', su señoría.', 30706),
(163429, 'esMX', 'Comprendo, Genn. Que la Luz te acompañe.', '', 30706),
(163428, 'esMX', '', 'La fiscalía puede proceder.', 30706),
(163427, 'esMX', 'No quiero desafiarte. Pero si yo no daba la orden, creo que Mía se habría lanzado a la batalla sin mí.', '', 30706),
(163426, 'esMX', '¡Con un poco de ingenio goblin y muchos explosivos podríamos derribar esa nave!', '', 30706),
(163425, 'esMX', 'Bien. El jurado puede sentarse.', '', 30706),
(163423, 'esMX', 'Escuchen, jurado. ¿Juran decir toda la verdad, ante los ojos de la Luz?', '', 30706),
(163422, 'esMX', 'Oficial Albóndiga, tómele juramento al jurado.', '', 30706),
(163421, 'esMX', 'Hoy presenciamos el caso del pueblo de la Horda contra Husmopasta, Skrizzik y Hongoveloz.', '', 30706),
(163420, 'esMX', 'El tribunal de Liza\'gar entra en sesión. La jueza Zumbarriel preside. Albóndiga tiene hambre.', '', 30706),
(163419, 'esMX', 'Escuchen todos.', '', 30706),
(163418, 'esMX', 'No puedo quedarme de brazos cruzados mientras sufren el mismo destino que nosotros. Gilneas peleará a su lado.', '', 30706),
(163417, 'esMX', 'Los elfos de la noche nos salvaron a los gilneanos de nuestra maldición. Nos dieron refugio en Darnassus cuando cayó nuestro reino.', '', 30706),
(163416, 'esMX', 'Por supuesto. Siempre puedes hablar con franqueza.', '', 30706),
(163415, 'esMX', '', 'Tu cooperación es bienvenida, $p. Al menos podemos contar contigo.', 30706),
(163414, 'esMX', '$p, nuestras fuerzas en Zuldazar aún no han iniciado el ataque. Con tu ayuda, quizás podamos alcanzar la victoria en ambos frentes.', '', 30706),
(163413, 'esMX', '¡Déjennos en paz!', '¡Déjennos en paz!', 30706),
(163412, 'esMX', '¡Llamen a los guardias!', '¡Llamen a los guardias!', 30706),
(163411, 'esMX', '¡Corran, es la Horda!', '¡Corran, es la Horda!', 30706),
(163410, 'esMX', 'Primero piratas, ¡y ahora la Horda!', 'Primero piratas, ¡y ahora la Horda!', 30706),
(163409, 'esMX', '¡La Horda está aquí!', '¡La Horda está aquí!', 30706),
(163408, 'esMX', 'Ya veo.', '', 30706),
(163407, 'esMX', 'Por supuesto que sí.', 'Por supuesto que sí.', 30706),
(163406, 'esMX', '', '¿Estás $ulisto:lista; para lo que viene?', 30706),
(163405, 'esMX', 'Forma de vida escaneada... No hubo coincidencias... Aegrim Barbabronce... Activando defensas...', '', 30706),
(163404, 'esMX', 'Intruso detectado... Levantando defensas...', '', 30706),
(163403, 'esMX', '', 'Tyrande partió rumbo a Costa Oscura antes que nuestro ejército. Planea arrebatársela a la Horda sola.', 30706),
(163398, 'esMX', '', 'No. Recuperaremos nuestro hogar, ahora.', 30706),
(163397, 'esMX', 'Muéstrame esta reliquia drust.', 'Muéstrame esta reliquia drust.', 30706),
(163396, 'esMX', '', '¡Mi pueblo necesita acción, no excusas! ¡No podemos languidecer en Ventormenta mientras la Horda profana nuestras tierras!', 30706),
(163395, 'esMX', '', 'Despué\' de todo el asunto con G\'huun y el asedio de la ciudad, Talanji necesitaba a alguien capaz de mantener el orden.\n\nJakra\'zet tenía, entre otras de sus cualidade\', una mano firme. Espero poder ocupar su cargo sin las partes más desagradable\' de su personalidad.\n\nTalanji me devolvió del exilio y me encargó eh\'te trabajo. Me convertí en la general Rakera, para el regocijo de Kaja. Ahora, además de liderar los ejércitos de Zandalar, debo prestar mi voz en el Concilio zanchuli.\n\nEs un honor y una oportunidad para corregir los errore\' del pasado.', 30706),
(163394, 'esMX', 'Eh\'te es Jo\'nok, el Baluarte de Torcali.\n\nJo\'nok reemplazará a Vol\'kaal. Un insecto que sirvió a la dama de las mentira\'.\n\nEstamos hecho\' para la guerra, no para usar palabras bonita\'. La voz de Jo\'nok en el Concilio representa la fuerza.\n\n<Jo\'nok se cruje los nudillos con fuerza.>', '', 30706),
(163393, 'esMX', '', 'Soy la alta prelada Erata, ante\' conocida como la Voluntad de Rezan.\n\nComo mi loa ha muerto, ahora respondo a Talanji. Eh\'pero serle útil como la voz de la fe en el Concilio zanchuli.', 30706),
(163392, 'esMX', 'Ahora sé lo que estás pensando. ¿Cómo alguien como yo termina en un lugar así?\n\nPara ser completamente honesto, no tengo idea. Creo que quizás Torga tuvo algo que ver.\n\n¡Al menos tendré una buena historia para contar! ¡El primer tortollano en llegar al Concilio zanchuli! ¡Jaja!', '', 30706),
(163391, 'esMX', 'Juro recuperar Teldrassil antes de que termine la guerra. Pero los recursos escasean y las bajas aumentan. Si pudiera pedirte un poco más de paciencia...', '', 30706),
(163390, 'esMX', 'Ojalá las cosas fueran distintas, suma sacerdotisa. Pero con la intensificación de la guerra en Arathi y Zandalar, asaltar Costa Oscura nos dispersaría y nos debilitaría demasiado.', '', 30706),
(163389, 'esMX', 'Velen, por favor cuéntale lo sucedido a $p.', '', 30706),
(163388, 'esMX', '', 'Los kaldorei siempre fuimos fieles a la Alianza. ¿Y ahora nos dejan solos?', 30706),
(163387, 'esMX', 'Tal vez.', '', 30706),
(163386, 'esMX', '', '¿Yo? Claro que no, ¡no tengo loa! ¡Tal vez te elija a ti!', 30706),
(163385, 'esMX', 'Pero si deseas cambiar de forma, debes serme leal. ¿Tienes algún problema con eso, niña?', '', 30706),
(163384, 'esMX', '', '¿Y los innumerables muertos? ¿Y las familias que nunca volverán a reunise?', 30706),
(163383, 'esMX', 'Mis seguidores son muy variados. Y aunque sigan a otro loa, todos forman parte de mi manada.', '', 30706),
(163382, 'esMX', '', '¡Allí está!', 30706),
(163381, 'esMX', 'Soy el maestro de las formas, pequeña. Si eliges honrarme a mí, te otorgaré este poder.', '', 30706),
(163380, 'esMX', '', 'El tridente del océano profundo está cerca. Debemos llegar a esa isla.', 30706),
(163379, 'esMX', 'Llamemos al auxilio mecánico para que repare el meca.', 'Llamemos al auxilio mecánico para que repare el meca.', 30706),
(163378, 'esMX', 'No, ¡NO quiero que trasladen mi maldito meca! $p, véngate en mi nombre.', '', 30706),
(163377, 'esMX', 'Ah, sí, la Alianza se los llevó cerca de aquí. ¿Quiere que traslade el meca?', '', 30706),
(163376, 'esMX', '¿Y los demás dónde están? Necesito que reparen esta cosa, ¡no que la trasladen!', '', 30706),
(163375, 'esMX', 'Ha llegado el auxilio mecánico, jefe. ¿A dónde trasladamos el meca?', '', 30706),
(163373, 'esMX', 'Aquí viene el auxilio mecánico. ¿Ves? ¡Eso es lo que me gusta, un servicio rápido y con sonrisa!', '', 30706),
(163372, 'esMX', '¡Aquí no hay nada más que bananas!', '¡Aquí no hay nada más que bananas!', 30706),
(163371, 'esMX', '<Marca el camino.>', '<Marca el camino.>', 30706),
(163370, 'esMX', '', 'Esta existencia no vale la pena.', 30706),
(163369, 'esMX', 'Golpeando', 'Golpeando', 30706),
(163368, 'esMX', '¡Las banana\' nunca fallan! Úsalas con responsabilidad, ¿eh?', '', 30706),
(163367, 'esMX', 'Es un viejo secreto de la pandilla Colmilloáureo, $p, pero sé que puedo confiártelo.', '', 30706),
(163366, 'esMX', 'Tenemos que movernos de manera rápida y sigilosa.', '', 30706),
(163365, 'esMX', 'Deshazte de las medidas de seguridad, nosotros te cuidaremos la espalda.', 'Deshazte de las medidas de seguridad, nosotros te cuidaremos la espalda.', 30706),
(163364, 'esMX', '', 'Los maresabios usarán el cetro abisal para ocultar nuestros verdaderos motivos tras un manto de niebla. Mientras tanto, la flota invadirá Dazar\'Alor desde el sur.', 30706),
(163363, 'esMX', '¿Será verdad que es mitad robot? ¡Eso explicaría por qué es tan molesto!', '', 30706),
(163362, 'esMX', '¡Voy dos pasos por delante de ti, júnior! Como siempre.', '', 30706),
(163361, 'esMX', '¡Ajá! ¡Por fin aire fresco!', '', 30706),
(163360, 'esMX', 'No... no estamos muertos. Solo deseamos estar muertos. Así es como se debe sentir Sylvanas todos los días.', '', 30706),
(163359, 'esMX', 'Ugh... ¿estamos muertos? ¿Así es como se siente Sylvanas todos los días?', '', 30706),
(163358, 'esMX', '% te señala.', '', 30706),
(163357, 'esMX', '¡Quedarás hecho hielo!', '', 30706),
(163356, 'esMX', '¡Congélate donde estás!', '', 30706),
(163355, 'esMX', 'Congelado de conocerte...', '', 30706),
(163354, 'esMX', 'Enfría esos ánimos...', '', 30706),
(163353, 'esMX', 'BZZT. ERROR. MUNICIONES DE AZERITA AGOTADAS.', '', 30706),
(163352, 'esMX', '¡No, no, nonononono!', '', 30706),
(163351, 'esMX', 'Bueno, ¡adiós!', '', 30706),
(163350, 'esMX', '¿Ves, Gallywix? Esta es la razón por la que la Horda nunca ganará. ¡No tienes la inteligencia necesaria para vencerme!', '', 30706),
(163349, 'esMX', '¡¿Se acabó la azerita?! ¡¿Y por qué este aparato estúpido no me avisó antes?!', '', 30706),
(163348, 'esMX', '', 'Quizás hayamos subestimado el valor de nuestros prisioneros.', 30706),
(163347, 'esMX', '¡Destrrruye esa...! Esperrra, ¡¿qué es ESO?!', '', 30706),
(163346, 'esMX', '', 'Motores a toda máquina, ¡partiremos de esta área inmediatamente!', 30706),
(163345, 'esMX', '', 'Dudo seriamente que esta tripulación pueda repeler a esos intrusos.', 30706),
(163344, 'esMX', '', '¡Intentan realizar un rescate!', 30706),
(163343, 'esMX', '', 'Según mis observaciones, ¡tenemos grandes probabilidades de alcanzar la victoria!', 30706),
(163342, 'esMX', '¡AH! $p, pulsa el gran botón rojo, ¡HAZ QUE ESTE MENTECATO VUELE EN PEDAZOS!', '', 30706),
(163341, 'esMX', 'Vaya, Gallywix, ¡eso sí que sería una lección! ¿Tienes alguna otra idea brillante?', '', 30706),
(163340, 'esMX', 'Y luego, venderé toda la chatarra que quede a un precio MENOR AL DE MERCADO. ¡El máximo insulto goblin!', '', 30706),
(163339, 'esMX', 'En fin, ¿en qué estaba? Ah, sí, explotar sus cosas. Sí, apuesto a que lo haré sollozar y patalear, ¡qué bebito llorón!', '', 30706),
(163338, 'esMX', 'En serio, ese tipo está obsesionado con las máquinas. ¡Me hace pensar que quiere ser mitad robot o algo!', '', 30706),
(163337, 'esMX', 'Luego, ¡voy a buscar MÁS de sus maquinitas y también las haré estallar!', '', 30706),
(163336, 'esMX', '¿Sabes qué voy a hacer cuando lo encuentre? Primero, haré volar en pedazos su traje mecánico.', '', 30706),
(163335, 'esMX', '', 'Necesitamos llegar a la sala de máquinas.', 30706),
(163334, 'esMX', '¡Se cree que es muuuuucho mejor que los goblins! Sí, pues, ¿sabes qué? ¡Al menos la mitad de nosotros no es RADIACTIVA!', '', 30706),
(163333, 'esMX', '', 'Con un poco de ayuda, ¡quizás podamos hacer estallar este taller goblin precario!', 30706),
(163332, 'esMX', 'Ahí está la nave de Mekkatorque. El rey de los gnomos, o como sea que lo llamen esos monstruitos.', '', 30706),
(163331, 'esMX', 'Debo decir que no me agrada mucho. Creo que te dejaré este tipo de cosas a ti a partir de ahora.', '', 30706),
(163330, 'esMX', 'Eh, se siente rarísimo hacer algo por otra persona. ¿Esto es lo que ustedes hacen todo el tiempo?', '', 30706),
(163329, 'esMX', '', 'Te seguiré y estudiaré en profundidad este vehículo aéreo primitivo.', 30706),
(163328, 'esMX', '', 'Tenemos que idear un plan para estropear esta nave precaria.', 30706),
(163327, 'esMX', '', '¡La evacuación es la prioridad máxima!', 30706),
(163326, 'esMX', '', '¡Llegas en el momento justo!', 30706),
(163325, 'esMX', '', 'Ay, me hace cosquillas. Siento su poder desde aquí.', 30706),
(163324, 'esMX', '', 'Alguien en este campamento tiene una llave. Esa llave abrirá un cofre. En ese cofre encontrarás la primera reliquia que buscamos.', 30706),
(163323, 'esMX', '', 'Un gran destino nos aguarda. Seguramente tú también lo presientes.', 30706),
(163322, 'esMX', '', 'Oh, mortales... Es tan fácil olvidar cuán intensos pueden ser sus delirios de grandeza.', 30706),
(163321, 'esMX', '', 'Siento en este preciso momento la peste de estos miserables. Puede que se adhiera a esta forma.', 30706),
(163320, 'esMX', '¡Nuestros enemigos caerán!', '¡Nuestros enemigos caerán!', 30706),
(163319, 'esMX', '', 'Un arma forjada en las profundidades...', 30706),
(163318, 'esMX', '', 'Qué deliciosa ironía: un pirata con un premio tan preciado... guardado como simple trofeo.', 30706),
(163317, 'esMX', '', 'Un naga poderoso poseía el tridente. Ahora sus esbirros quieren recuperarlo.', 30706),
(163316, 'esMX', '', '¡Por Kul Tiras!', 30706),
(163315, 'esMX', '', 'Creo que veo algunos firmemares luchando contra la Horda al otro lado del agua. Nos ayudarán a recuperar Puntanzuelo.', 30706),
(163314, 'esMX', '', 'Muy bien, intendente. Taelia, tú vienes conmigo.', 30706),
(163313, 'esMX', 'Envíame a Altos de Lor\'danel.', 'Envíame a Altos de Lor\'danel.', 30706),
(163312, 'esMX', 'Envíame a Arboleda Cenizal.', 'Envíame a Arboleda Cenizal.', 30706),
(163311, 'esMX', 'Envíame a Playa Marea Penumbral.', 'Envíame a Playa Marea Penumbral.', 30706),
(163310, 'esMX', 'Envíame a Bashal\'Aran.', 'Envíame a Bashal\'Aran.', 30706),
(163309, 'esMX', '', 'Hiciste lo correcto, Taelia.', 30706),
(163308, 'esMX', '', 'Ojalá que el resto de mi patrulla esté bien. Si me hubiera quedado...', 30706),
(163307, 'esMX', '', 'No quería abandonar a mis compañeros... Pero era la única forma de avisarles.', 30706),
(163306, 'esMX', '', 'Corazón de vendaval es nuestro grifo más veloz, así que me enviaron a alertar a los demás.', 30706),
(163305, 'esMX', '', 'Mi patrulla luchó con fuerza junto a los Firmemares, pero el enemigo fue implacable. Nos superaban ampliamente.', 30706),
(163304, 'esMX', '', 'Hay naves de guerra ante el portal marino. Decenas de soldados de la Horda invadían en un pequeño navío.', 30706),
(163303, 'esMX', '', 'Así es, Lady almirante. En cuanto vimos los explosivos de azerita, no nos quedó duda de lo que tramaban.', 30706),
(163302, 'esMX', '', 'Taelia, ¿cuál es la situación en Puntanzuelo? ¿Crees que la Horda planea derribar el portal marino?', 30706),
(163301, 'esMX', '', 'Prepárense. Ya casi llegamos.', 30706),
(163300, 'esMX', '', 'Si los nuestros están vivos, los rescataremos. Y si murieron luchando, haremos que la Horda pague.', 30706),
(163299, 'esMX', '', 'Pero hacemos lo mejor que podemos... y nunca perdemos la esperanza.', 30706),
(163298, 'esMX', '', 'A veces... A veces no puedes salvarlos a todos.', 30706),
(163297, 'esMX', '', 'Ya se han usado armas insufladas con azerita para derrumbar portales marinos. Imagino que harán lo mismo aquí.', 30706),
(163296, 'esMX', '', 'Puntanzuelo es el último portal marino que protege el canal.', 30706),
(163295, 'esMX', '', 'Me temo que tengo un pueblo que proteger ahora. Regresaré luego.', 30706),
(163294, 'esMX', 'Mamá dice que haces magia de hielo. ¿Me obsequiarías un helado?', 'Mamá dice que haces magia de hielo. ¿Me obsequiarías un helado?', 30706),
(163293, 'esMX', '¡Hola, lady Jaina! ¿Podrías mostrarnos tu magia? ¿Me regalarías un elemental de agua?', '¡Hola, lady Jaina! ¿Podrías mostrarnos tu magia? ¿Me regalarías un elemental de agua?', 30706),
(163292, 'esMX', '¡Es la lady almirante!', '¡Es la lady almirante!', 30706),
(163291, 'esMX', '¡Guau!', '¡Guau!', 30706),
(163290, 'esMX', '', 'Viajaremos a Canal de Tiragarde. Te esperaré en el canal, $p.', 30706),
(163289, 'esMX', 'Todos han descendido a los escalone\' de Zanchul para ser testigo\' de la coronación de Talanji.\n\nEs un suceso trascendental como nunca antes se había presenciado. Grábate este momento en la memoria, $n, pues los reye\' y las reina\' de los zandalari son notablemente longevos.', '', 30706),
(163288, 'esMX', '¿Dónde están todos?', '¿Dónde están todos?', 30706),
(163287, 'esMX', 'La futura reina Talanji me ha enviado a buh\'carte.', '', 30706),
(163286, 'esMX', '¡Artillería en camino!', '', 30706),
(163285, 'esMX', '¡Lanzagujas listo para la batalla!', '', 30706),
(163284, 'esMX', 'Sería bueno que este lanzagujas tuviera escolta.', '', 30706),
(163283, 'esMX', 'Aquí viene la artillería. Abran camino.', '', 30706),
(163282, 'esMX', 'Producción de lanzagujas completa. ¡Avancen, aliados!', '', 30706),
(163281, 'esMX', 'Lanzagujas, ¡en camino!', '', 30706),
(163280, 'esMX', 'Nos alegra que estés en casa, Jaina. Creo que... ¿Qué es eso? ¡Cuidado!', '', 30706),
(163279, 'esMX', '', 'Yo... Sí, madre. Tienes razón.', 30706),
(163278, 'esMX', '', 'Todos hemos cometido errores, pero sobreviviremos a la tormenta, mis amores. Juntos.', 30706),
(163277, 'esMX', '', 'Nada de peros, Jaina.', 30706),
(163276, 'esMX', 'Sí. Pero no era su destino.', '', 30706),
(163275, 'esMX', '', 'Cuando pienso que esos salvajes de la Horda capturaron su cuerpo y lo exhibieron como trofeo...', 30706),
(163274, 'esMX', '', 'Siento que Derek estaría decepcionado con mi comportamiento. En particular el que tuve contigo, Jaina.', 30706),
(163273, 'esMX', 'Padre era exigente, pero creo que estaría feliz de vernos juntos de nuevo.', '', 30706),
(163272, 'esMX', '', 'Fue un plan para provocarnos. Para obligarnos a cometer errores. No les daremos esa satisfacción.', 30706),
(163271, 'esMX', 'Una parte de mí se pregunta qué pensarían nuestro hermano y nuestro padre de todo lo que Kul Tiras ha vivido. Y de todo lo que hemos vivido como familia.', '', 30706),
(163270, 'esMX', '¡Cuidado! ¡Que no se queme!', '', 30706),
(163269, 'esMX', '¡Eso SÍ que le dará sabor!', '', 30706),
(163268, 'esMX', 'Ah, ¡el aroma del chili en la olla!', '', 30706),
(163266, 'esMX', '¡El chili de la Horda huele delicioso! ¡Falta muy poco para que esté listo!', '', 30706),
(163265, 'esMX', '¡Solo faltan un par de ingredientes y el chili de la Horda estará listo para comer!', '', 30706),
(163264, 'esMX', '¡No puedo esperar a probar el chili de la Alianza! ¡Ya casi está listo!', '', 30706),
(163263, 'esMX', '¡El chili de la Alianza va por buen camino! Solo necesita un par de ingredientes más...', '', 30706),
(163262, 'esMX', '¡Victoria para la Horda! ¡Y chili picante para mí!', '', 30706),
(163261, 'esMX', '¡La Alianza gana! Este chili es una delicia... ¡tengo que aprender la receta!', '', 30706),
(163260, 'esMX', '¡La primera cocina en reunir los ingredientes necesarios para preparar el chili gana! Cocineros, ¡que comience la competencia!', '', 30706),
(163259, 'esMX', 'Te extrañé, Jaina. Kul Tiras sufrió en tu ausencia. Cuando papá murió, nadie se ocupó de averiguar por qué pasó. Solo estaban furiosos.', '', 30706),
(163258, 'esMX', '¿Cinco minutos? Pero qué injusticia, hermana. ¡Fueron al menos diez!', '', 30706),
(163257, 'esMX', '', '¡Ese es el hermano que recuerdo! Apenas llevas cinco minutos en tierra firme y ya estás planeando tu próxima excursión.', 30706),
(163256, 'esMX', '', 'Gracias por el voto de confianza, hermanito. ¿Pero estás seguro de que no querías el trabajo?', 30706),
(163255, 'esMX', 'Oh, habría cumplido con mi deber de ser necesario, pero mi vida es el mar. Por cierto, teniendo en cuenta todo lo sucedido, creo que a nuestra madre le vendría bien navegar un poco.', '', 30706),
(163254, 'esMX', '¡Allí está mi hermana, la Lady almirante! Tus amigos de la Alianza dicen que eres una maestra de la diplomacia. Creo que este título nuevo podría funcionar muy bien.', '', 30706),
(163253, 'esMX', '', 'No empieces, Tandred. Aún no me acostumbro a que me llamen de esa forma. Siempre pensé que Derek sería el próximo Lord almirante.', 30706),
(163252, 'esMX', 'Lady almirante.', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(163251, 'esMX', 'Disculpe las molestias. Traigo un informe del maestro Shaw.', 'Disculpe las molestias. Traigo un informe del maestro Shaw.', 30706),
(163250, 'esMX', '', 'Así es... Estoy muy agradecida.', 30706),
(163249, 'esMX', 'Lo siento, madre. Jaina y yo estamos aquí ahora. Hay que agradecer a las mareas que volvieron a reunirnos.', '', 30706),
(163248, 'esMX', '', 'Perdí a tu hermano Derek, luego a tu padre, luego a Jaina. Cuando desapareciste con la flota, estaba sola.', 30706),
(163247, 'esMX', '', 'No te burles del dolor de una madre, Tandred.', 30706),
(163246, 'esMX', 'Me gustó mucho el homenaje, madre. Especialmente la parte donde dijiste que era \"audaz\".', '', 30706),
(163245, 'esMX', '', 'Qué rápido que cambia el mundo.', 30706),
(163244, 'esMX', '', 'Sabía que regresar a casa sería peligroso, pero debía arriesgarme. No pensé que encontraría sanación.', 30706),
(163243, 'esMX', '¡Bienvenidos al Gran Campeonato de Chili Pandaren! Este año, ¡la noble Alianza se enfrenta a la temible Horda!', '', 30706),
(163241, 'esMX', 'Así que esos son taunka, ¿eh? ¡Y yo que creí que los tauren se veían rudos! Consigue la azerita... Pero ten cuidado con esos cuernos.', '', 30706),
(163240, 'esMX', '¿Acaso veo... canoas taunka en el horizonte? Hicieron un largo viaje para buscar azerita. Encarguémonos de que se vayan con las manos vacías.', '', 30706),
(163239, 'esMX', '¿Qué utilidad podría tener la azerita para un vrykul no-muerto? Espero que nunca lo averigüemos. ¿Podrías ser tan amable de encargarte del asunto?', '', 30706),
(163238, 'esMX', '¿Alguna vez te preguntaste qué es peor que un vrykul? Un vrykul no-muerto, aparentemente. ¿Por qué no acabas con la miseria de esas pobres criaturas?', '', 30706),
(163237, 'esMX', 'Excelente... Parece que estamos lidiando con un culto. Será mejor mantenerlos alejados de la azerita. ¡Y tápate los oídos cuando canten!', '', 30706),
(163236, 'esMX', 'Mira, no soy experto en cultistas, pero creo que lo mejor es que la azerita esté en nuestras manos y no en las de ellos.', '', 30706),
(163235, 'esMX', '¿Oyes aullidos? Yo sí. Eso... nunca es bueno. ¡Creo que iré a ver cómo están las cosas bajo cubierta!', '', 30706),
(163234, 'esMX', '¡JA! Jamás te vencerán. ¡Mándalos al infierno, hermana!', '', 30706),
(163233, 'esMX', 'A la orden, Lady almirante. ¿Dónde estarás?', '', 30706),
(163232, 'esMX', '', 'Yo atacaré a la Horda de frente.', 30706),
(163231, 'esMX', '', 'Tandred, llévate nuestras mejores naves y zarpa para flanquearlos.', 30706),
(163230, 'esMX', 'El ataque de la Horda a Norwington los llenó de confianza. Era cuestión de tiempo antes de que volvieran a atacar.', '', 30706),
(163229, 'esMX', '¿Huargen ferales? Sin ánimo de ofender, ¡pensé que ese olor a perro mojado venía de ti! ¿Podrías encargarte de esto?', '', 30706),
(163228, 'esMX', '¡Brann Barbabronce!', '', 30706),
(163227, 'esMX', 'Eh, ¿ves las canoas taunka que se acercan a la costa? Podrían ser un problema. ¡Elimínalos!', '', 30706),
(163226, 'esMX', 'No había vih\'to un taunka en años. La última vez no me dejó buenos recuerdos. ¡Es hora de la venganza!', '', 30706),
(163225, 'esMX', 'Los eh\'píritus están inquietos con todos estos cultistas por aquí. Consigue la azerita y concédele\' la paz a los dos.', '', 30706),
(163224, 'esMX', 'Esos cultistas eh\'tán jugando con poderes malvados. ¡No dejes que se apoderen de la azerita!', '', 30706),
(163223, 'esMX', 'Necesitaré dar una vuelta por este lugar y patear algunos hueso\'. Será mejor que tengas tu arma lista por si acaso.$b$bAvísame cuando estés $Ulisto:lista;.', '', 30706),
(163222, 'esMX', 'Aquí hay mucha sangre y muchos hueso\', pero no hay señales de Bwonsamdi. Qué curioso. ¿Por qué el loa de las tumba\' abandonaría un lugar así?', '', 30706),
(163221, 'esMX', 'Listo.', 'Lista.', 30706),
(163220, 'esMX', 'Nunca había vih\'to huargen tan feroces. Mantén alerta a eh\'tos perros mientras recoges la azerita.', '', 30706),
(163219, 'esMX', 'Eh\'tos huargen se ven particularmente salvajes. Tal vez tengan rabia. Ten cuidado, ¡que no te muerdan!', '', 30706),
(163218, 'esMX', '¡Uff! ¡Huelo a esos vrykul no-muertos deh\'de aquí! Deshazte de ellos y consigue la azerita.', '', 30706),
(163217, 'esMX', 'Parece que la azerita eh\'tá atrayendo vrykul no-muertos. ¡Ajjj! ¡Qué desagradable!', '', 30706),
(163213, 'esMX', '', 'He visto a tus seguidore\' en Zuldazar transformarse en muchas cosa\'. Si te sigo, ¿yo también podré hacer eso?', 30706),
(163212, 'esMX', '', '¡Ere\' el loa de la manada, pero lo que más ansío conocer es tu maeh\'tría en el cambio de forma!', 30706),
(163211, 'esMX', '', 'Eh\'cuché que tú eres el loa más generoso, que permites a tus seguidore\' seguir a otros loa también.', 30706),
(163210, 'esMX', 'Ah, pequeñita. Dime, ¿qué te trae a mi guarida?', '', 30706),
(163203, 'esMX', '', 'He eh\'cuchado que Gonk es muy simpático. Veamos si eh\'tá en casa.', 30706),
(163202, 'esMX', '', 'Gonk pone a los malo\' en su lugar, ¿no?', 30706),
(163201, 'esMX', '', '¡$n! ¡Salgamos de aquí ante\' de que me devore!', 30706),
(163200, 'esMX', '', '¡Ahh! ¡No, no, aquí no hay bocadillos!', 30706),
(163199, 'esMX', 'Ah, $n. ¿Me trajiste algo para comer?', '', 30706),
(163198, 'esMX', 'Cierra los ojos, joven. Esto no va a ser agradable...', '', 30706),
(163197, 'esMX', '¡No imporrrta! ¡Dentro de un instante no quedarrrá nada de todo esto!', '', 30706),
(163196, 'esMX', '¿Hmmm? ¿Qué fue eso?', '', 30706),
(163195, 'esMX', '¡Ach! Ven aquí, miserable.', '', 30706),
(163194, 'esMX', '¡Una vez que se calme su sed de venganza, serrré libre de gobernar Azeroth como yo crrrea oportuno!', '', 30706),
(163193, 'esMX', '¡Ese arrrtefacto es lo único que impide que Alamuerrrte active el mecanismo de rrrecrreación!', '', 30706),
(163192, 'esMX', '¡Ah, no seas idiota! Nunca quise quedarrrme con tu estúpido cofrrre.', '', 30706),
(163191, 'esMX', '¡¿El arca?! No te atreverías...', '', 30706),
(163190, 'esMX', '¡Serrrás testigo de la destrrrucción de aquello que tanto quierrres!', '', 30706),
(163189, 'esMX', '¡Pero prrrimero!', '', 30706),
(163188, 'esMX', 'Te ofrrrecería un puesto de prrrestigio dentro de mi orrrganización si no tuviera que matarte.', '', 30706),
(163187, 'esMX', 'Qué pena…', '', 30706),
(163186, 'esMX', '¡No solo me has guiado hasta el arrrca, sino que además has eliminado las prrrotecciones!', '', 30706),
(163185, 'esMX', '¡Bien hecho, doctorrrr Jones!', '', 30706),
(163184, 'esMX', '¡$p! ¡Lo hemos logrado!', '', 30706),
(163183, 'esMX', 'Vaya, mira eso...', '', 30706),
(163182, 'esMX', '¡Con eso debería bastar!', '', 30706),
(163173, 'esMX', 'Rexxar, estoy listo para enfrentar a Cole y su tanque de azerita.', 'Rexxar, estoy lista para enfrentar a Cole y su tanque de azerita.', 30706),
(163172, 'esMX', '', 'Guau... ¡Krag\'wa! ¡De verdad regresah\'te!', 30706),
(163171, 'esMX', '', '¡¡¡Ahh!!!', 30706),
(163170, 'esMX', '', '¡Taz\'okun, ranita! ¿Podrías moh\'trarme tu hogar?', 30706),
(163169, 'esMX', '', '¡Y todas eh\'tas luciérnagas! ¡Sigamos avanzando!', 30706),
(163168, 'esMX', '', '¡Guau, mira eh\'ta estatua de rana brillante y gigante!', 30706),
(163167, 'esMX', 'Escena rápida del escudo del tanque de azerita bajando y disparando a la pandilla.', 'Escena rápida del escudo del tanque de azerita bajando y disparando a la pandilla.', 30706),
(163165, 'esMX', '', 'Nosotros colocaremos los cañones cerca del rompeolas. ¡Buena caza, $p!', 30706),
(163164, 'esMX', '', 'Apuesto que uno de esos magos está detrás de todo esto.', 30706),
(163163, 'esMX', '', '¡¿Qué has hecho?!', 30706),
(163162, 'esMX', '', 'Los libros vuelan descontroladamente... ¿Pero qué rayos sucede...?', 30706),
(163161, 'esMX', '', '¡Detén eso de inmediato! ¡No sé que les pasa a estas escobas! ¡Fuera!', 30706),
(163160, 'esMX', '', 'Adalides, prepárense. Sira atacará mientras seamos vulnerables.', 30706),
(163159, 'esMX', '|TInterface\\Icons\\INV_wildfireBomb_Shrapnel.blp:20|t ¡%s te marca con |cFFFF0000|Hspell:283409|h[Carga de gigavoltios]|h|r! ¡Cúbrete!', '|TInterface\\Icons\\INV_wildfireBomb_Shrapnel.blp:20|t ¡%s te marca con |cFFFF0000|Hspell:283409|h[Carga de gigavoltios]|h|r! ¡Cúbrete!', 30706),
(163158, 'esMX', 'Probando', 'Probando', 30706),
(163157, 'esMX', '', '¡Mejor juguemo\' con las crías! ¡Tú la traes!', 30706),
(163156, 'esMX', '', 'Pero también dicen que se enoja rápido. Mejor no la molestemo\'.', 30706),
(163155, 'esMX', '', 'Dicen que Pa\'ku es la loa de los viento\' y de los mare\' y de los cielo\'. ¡Dicen que ella trae el cambio!', 30706),
(163154, 'esMX', '', '¡Mira, ahí eh\'tá Pa\'ku! ¡Es más grande de lo que imaginé!', 30706),
(163153, 'esMX', '', 'Uoo... ¡ten cuidado, $n!', 30706),
(163152, 'esMX', 'El ciclo vuelve a empezar. Se ha restablecido el equilibrio. Sientan la brisa en sus hojas y florezcan una vez más.', '', 30706),
(163151, 'esMX', 'La Semana de los Niños todavía no ha terminado... ¿Me puedes dar otro silbato de huérfana zandalari?', 'La Semana de los Niños todavía no ha terminado... ¿Me puedes dar otro silbato de huérfana zandalari?', 30706),
(163150, 'esMX', 'No hay poder destructivo equiparable con el poder sanador de la naturaleza. Eleven sus ramas al cielo una vez más y crezcan.', '', 30706),
(163149, 'esMX', 'Espíritus de la naturaleza, escuchen nuestro llamado. Ancianos poderosos, ayúdennos a recuperar esta tierra.', '', 30706),
(163148, 'esMX', 'Los niño\' que llegan aquí no tienen casta. No tienen familia, no tienen hogar. Los cuidamos, les damo\' comida y la atención que necesitan para llegar a la adultez.\n\nNo obstante, no es fácil para un niño sin cah\'ta prosperar en la sociedad zandalari. A eh\'tos niños les espera una vida difícil, pero nosotros hacemo\' todo lo posible para darles lo que necesitan. Algunos de estos niño\' tienen vínculos latentes con los loa. Son pueh\'tos a prueba y un día se convierten en sacerdotes y sacerdotisas. Otros tienen una fortaleza extraordinaria para su edad y algún día podrían convertirse en guerreros.\n\nEh\'pero que estos niño\' se conviertan en adultos fuertes y capace\'. Por su propio bien.', '', 30706),
(163147, 'esMX', 'Verás morir a tus soldados... ¡Solo para demorar tu muerte inevitable!', '', 30706),
(163145, 'esMX', '¡Cualquier kultirano entregaría su vida con gusto para ajusticiar al asesino de Daelin!', '', 30706),
(163144, 'esMX', 'Estoy listo para enfrentarme a la Horda.', 'Estoy lista para enfrentarme a la Horda.', 30706),
(163143, 'esMX', '¡Gracias, $n!', '', 30706),
(163142, 'esMX', '¡¿Por qué alguien elegiría una sola cosa?! ¡Voy a empezar a estudiar ahora mismo!', '', 30706),
(163141, 'esMX', '¡Voy a ser el mejor héroe-rabalero-pirata-maresabio-halconero-druida de la historia!', '', 30706),
(163140, 'esMX', 'Pero no voy a ser un simple héroe...', '', 30706),
(163139, 'esMX', '¡Voy a ser un héroe como tú!', '', 30706),
(163138, 'esMX', 'Creo que finalmente decidí lo que quiero ser cuando crezca.', '', 30706),
(163137, 'esMX', '¡Todos fueron grandiosos, y yo podría ser como cualquiera de ellos!', '', 30706),
(163136, 'esMX', '¡No puedo creer que haya tantos adultos geniales por todo Kul Tiras!', '', 30706),
(163135, 'esMX', '', 'De alguna forma nuestros brutos han logrado inmovilizar a un pelotón entero de la Alianza. ¡Ayúdalos a rematarlos!', 30706),
(163133, 'esMX', '<Está tan concentrado en sus gritos que no nota tu llegada.>\n\n¡Las mentira\' de Talanji no engañan a la Viuda Blanca!', '<Está tan concentrada en sus gritos que no nota tu llegada.>\n\n¡Las mentira\' de Talanji no engañan a la Viuda Blanca!', 30706),
(163132, 'esMX', 'Centinelas, adelántense. Despejen y ocupen Bashal\'Aran.', '', 30706),
(163131, 'esMX', 'Nuestros aliados gilneanos avanzarán para capturar Bashal\'Aran.', '', 30706),
(163130, 'esMX', '', '¡Te estaré vigilando, \"detective\"!', 30706),
(163129, 'esMX', '', '¡Ey!', 30706),
(163128, 'esMX', '¡Está bien! Iré a hablar con él.', '¡Está bien! Iré a hablar con él.', 30706),
(163127, 'esMX', 'Solo trataba de ayudar.', 'Solo trataba de ayudar.', 30706),
(163126, 'esMX', 'No, solo estaba buscando pistas.', 'No, solo estaba buscando pistas.', 30706),
(163125, 'esMX', '', '<Te estudia con desconfianza por un momento.>\n\nSerá mejor que vayas a hablar con mi oficial al mando. Él lleva este caso. Lo encontrarás trabajando en el fondo del bar, en la otra punta de la arena.', 30706),
(163124, 'esMX', '', 'La línea entre \"buscar pistas\" y \"obstruir la justicia\" es muy delgada.\n\n¿Qué eres, una especie de \"detective\" $c?', 30706),
(163123, 'esMX', '', 'Eh... ¿Me pareció a mí o estabas interfiriendo con una investigación de asesinato en curso?', 30706),
(163122, 'esMX', '', 'Y entonces... ¿$ulisto:lista; para una pelea?', 30706),
(163121, 'esMX', '¡Oye, vuelve cuando quieras! ¡Podemos jugar a No despiertes a Ulfar!', '', 30706),
(163120, 'esMX', 'Hmm... ¡Entonces mantendré los oídos bien abiertos! ¡Gracias, hombre gato!', '', 30706),
(163119, 'esMX', '¡Oí el llamado cuando tenía más o menos tu edad! ¡Tal vez lo oigas pronto!', '', 30706),
(163118, 'esMX', 'Nuestros aliados gilneanos atacarán el aserradero en Matorral Abrasador.', '', 30706),
(163117, 'esMX', '¡Eso es genial...! ¡Yo también quiero poder hacer eso!', '', 30706),
(163116, 'esMX', '¡Y en foca! ¡Ups, me caí!', '', 30706),
(163115, 'esMX', '¡Y en lechúcico lunar!', '', 30706),
(163114, 'esMX', '¡Y en alce!', '', 30706),
(163113, 'esMX', '¡Y en un ave!', '', 30706),
(163112, 'esMX', '¡Claro que sí!', '', 30706),
(163111, 'esMX', 'Guau... ¿en serio? ¿Y también puedes transformarte en oso?', '', 30706),
(163110, 'esMX', 'No soy un gato que habla, ¡soy un druida que habla!', '', 30706),
(163109, 'esMX', '¡Por la Luz! ¡Un gato que habla!', '', 30706),
(163108, 'esMX', 'Nuestras Centinelas asaltarán la mina en Cantera Petroglacial.', '', 30706),
(163107, 'esMX', '¡Ey, mira! ¡Un niño! ¡Oye, niño!', '', 30706),
(163106, 'esMX', 'No le cuentes a mi mujer que estoy cenando.', '', 30706),
(163105, 'esMX', '¡Tengo mi cuchillo de la suerte para eliminarlos!', '', 30706),
(163104, 'esMX', '¡Sí, hora, de tragar un poco de agua!', '', 30706),
(163103, 'esMX', '¡No puedo ir sin mis peces!', '', 30706),
(163102, 'esMX', '', 'Al final... todos conocerán la muerte.', 30706),
(163101, 'esMX', '', 'Estoy un poco confundida... ¿contra quién peleamos?', 30706),
(163100, 'esMX', '', 'Una mujer de mi estatura no puede... ¿quién soy? ¡Hic!', 30706),
(163099, 'esMX', '', 'Esto es una cita, ¿no?', 30706),
(163098, 'esMX', '', '¿Servirán bebidas o solo habrá alcohol...? ¡Hic!', 30706),
(163097, 'esMX', '', '¡Vamos a practicar puntería!', 30706),
(163096, 'esMX', '', '¡Tengo que estar más borracha para disparar bien!', 30706),
(163095, 'esMX', '', 'Una pinta a su cuenta... ¡Hic!', 30706),
(163094, 'esMX', 'Mmm... Un alma deliciosa...', '', 30706),
(163093, 'esMX', '', '¡Cuidado! ¡El ron me afina mucho la puntería!', 30706),
(163092, 'esMX', '¡Ey, este lugar es muy bonito! ¿Dónde están todos los osos?', '', 30706),
(163091, 'esMX', '¡Más almas! ¡Tráiganme más almas!', '', 30706),
(163090, 'esMX', '¡Tengo sed de almas!', '', 30706),
(163089, 'esMX', '¡Necesito más almas!', '', 30706),
(163088, 'esMX', '¡Aliméntame con las almas de los vivos!', '', 30706),
(163087, 'esMX', '¡Necesito devorar más almas!', '', 30706),
(163086, 'esMX', 'Se me acaba la paciencia. ¡Dame almas!', '', 30706),
(163085, 'esMX', '¡Ansío saborear un alma!', '', 30706),
(163084, 'esMX', '¡Necesito más almas!', '', 30706),
(163083, 'esMX', '¡Cuéntame para otra ronda!', '¡Cuéntame para otra ronda!', 30706),
(163082, 'esMX', '¡Lucharé por un trago!', '¡Lucharé por un trago!', 30706),
(163081, 'esMX', '¡Cuentas con mi apoyo!', '¡Cuentas con mi apoyo!', 30706),
(163080, 'esMX', '¡Brindo por eso!', '¡Brindo por eso!', 30706),
(163079, 'esMX', 'No estoy tan sobrio como parece.', '', 30706),
(163078, 'esMX', '¡Me debes un trago por esto!', '', 30706),
(163077, 'esMX', '¡Démosles su merecido...! ¡Hip!', '', 30706),
(163075, 'esMX', '', 'Esto empieza a formar un panorama espeluznante. Ven a verme en la falla temporal de más adelante. Tal vez eso nos lleve a donde debemos estar.', 30706),
(163074, 'esMX', 'Cuando quieras, niño. ¡Tal vez algún día te vea entre la bandada!', '', 30706),
(163073, 'esMX', '¡Creo que puedo hacer eso! ¡Gracias, señor!', '', 30706),
(163072, 'esMX', 'Un corazón sincero. Los halcones conocen las intenciones de todos quienes los rodean. Si eres bueno y sincero, serás amigo de todos los animales.', '', 30706),
(163071, 'esMX', '¿Cuál es, señor?', '', 30706),
(163070, 'esMX', 'Sí. Requiere trabajo arduo y mucha perseverancia, pero si quieres ser un halconero hay una característica que debes ponderar por encima de todas.', '', 30706),
(163069, 'esMX', '¡Guau! ¡¿Eres un halconero?!', '', 30706),
(163068, 'esMX', '¡Winston!', '', 30706),
(163067, 'esMX', '¡Ah, entonces permíteme presentarme al mío!', '', 30706),
(163066, 'esMX', '¡Su halcón es tan genial! ¡Quiero un amigo pájaro!', '', 30706),
(163065, 'esMX', '¿Estás admirando nuestro monumento a Arom Tarjasenda? ¿Sabías que él dirigió el ataque contra los drust?', '', 30706),
(163064, 'esMX', '¡Mira a ese grandote con su halcón, $n!', '', 30706),
(163063, 'esMX', '¡Nos volverrrrremos a verrr, $p!', '', 30706),
(163062, 'esMX', '¡Lárgate, Schnottz!', '', 30706),
(163061, 'esMX', 'Regresemos a la base, a ver si encontramos desde dónde controla estas cosas Mekkatorque.', '', 30706),
(163060, 'esMX', 'Ahhh, sí. ¿Quierrres decir tus últimas palabrrrras? ¿Hmmm?', '', 30706),
(163059, 'esMX', 'Bien... ¿Porrr dónde íbamos?', '', 30706),
(163058, 'esMX', 'Más te vale que no las haya, Schnottz. La paciencia de Alamuerte se agota.', '', 30706),
(163057, 'esMX', 'Díganle que ya no habrrrrá más interrrrupciones.', '', 30706),
(163056, 'esMX', 'Yo puedo encarrrgarme a parrrtir de aquí, amigos míos. Informen a su maestrrro que ya me he ocupado del prrrroblema.', '', 30706),
(163055, 'esMX', '¡Ya nos hemos alejado suficiente!', '', 30706),
(163054, 'esMX', 'Pagarrrás por esto, $p. ¡Morrrirás ante el pelotón de fusilamiento!', '', 30706),
(163053, 'esMX', '¡Por si eso no fuerrra suficiente, saboteas mi rrritual y causas la muerrrte de Gluber!', '', 30706),
(163052, 'esMX', 'Pero...', 'Pero...', 30706),
(163051, 'esMX', '¡SIN PERRROS! ¡Silencio! ¡Sigue andando!', '', 30706),
(163050, 'esMX', 'Después matas a mis leales trrrabajadores sin compasión...', '', 30706),
(163049, 'esMX', 'Y con tu torrrpeza interrrfieres con mi operación…', '', 30706),
(163048, 'esMX', 'Prrrimero, caminas por Uldum como si fuerrras dueño de este lugarrr…', '', 30706),
(163047, 'esMX', '¡Para ESTO pagué! Los juguetes de Mekkatorque no le llegan ni a los talones.', '', 30706),
(163046, 'esMX', 'Así me gusta, ¡mira toda esa azerita! Toda esa destrucción... ¡todo ese PODER!', '', 30706),
(163045, 'esMX', 'Vamos... funciona... ¡DE UNA VEZ!', '', 30706),
(163044, 'esMX', '¡Pedazo de chatarra! ¡Pagué dinero por esto, y solo haces que quede como un idiota frente a los juguetes de Mekkatorque!', '', 30706),
(163043, 'esMX', '(Ey, eh, $p, esta vez será mejor que te sujetes a todo lo que encuentres).', '', 30706),
(163042, 'esMX', '¡JAJAJA! Mira con atención lo que pueden conseguir los goblins con oro, Mekkatorque. ¡Esta belleza rebosa de azerita!', '', 30706),
(163041, 'esMX', '*BZZT* ¡Ese meca de ustedes es un verdadero riesgo para la seguridad!', '', 30706),
(163040, 'esMX', '*BZZT* ¿Acaso revisaron este meca alguna vez? ¡No parece haber pasado la fase de prueba!', '', 30706),
(163039, 'esMX', '*BZZT* Acabo de realizar un análisis... ¡¿De verdad tu tecnología es TAN anticuada?!', '', 30706),
(163038, 'esMX', '*BZZT* ¡Ja! Das pena, Gallywix. ¡No eres un rival digno para mis creaciones!', '', 30706),
(163037, 'esMX', '*BZZT* ¡Esas porquerías goblin jamás igualarán la tecnología gnómica!', '', 30706),
(163036, 'esMX', '*Bzzt* ¿A quién quieres engañar, Gallywix? ¡Tu máquina se cae a pedazos!', '', 30706),
(163035, 'esMX', '*BZZT* ¡Qué triste, Gallywix! ¡Mis creaciones son mucho más fuertes que las tuyas!', '', 30706),
(163034, 'esMX', 'Ahora cocinamos con gas, ¡gas de AZERITA! Presiona ese gran botón rojo y veamos el verdadero potencial de esta cosa.', '', 30706),
(163032, 'esMX', 'Adalid, cuando estés $ulisto:lista;, Aviash te llevará a conocer la amenaza.', '', 30706),
(163031, 'esMX', 'O al menos es algo que debería hacer.', '', 30706),
(163030, 'esMX', 'Sin duda pensé en hacerlo.', '', 30706),
(163029, 'esMX', 'Puede que haya instalado un mecanismo de autodestrucción para impedir que la Horda robe este equipo.', '', 30706),
(163028, 'esMX', '¡El girocóptero es solo para uso del personal de la Alianza!', '', 30706),
(163027, 'esMX', 'Siempre que no explote en mil pedazos...', '', 30706),
(163026, 'esMX', '¡Te garantizo que estarás a salvo!', '', 30706),
(163025, 'esMX', '¡Tengo un girocóptero listo para ti!', '', 30706),
(163024, 'esMX', '¿En serrrio crees que podrás salirrrte con la tuya, $p? ¿Hmmm?', '', 30706),
(163023, 'esMX', '¿Ves? Esta cosa está bien, nunca cargo combustible hasta que esa aguja pasa \"Vacío\" por MUCHO, y jamás tuve un problema.', '', 30706),
(163022, 'esMX', '¿Nos quedamos sin combustible? No puede ser, ¡si tenemos azerita de sobra! Fíjate qué puede hacer esta cosa.', '', 30706),
(163020, 'esMX', '¡Gracias, continental!', '¡Gracias, continental!', 30706),
(163019, 'esMX', '¡La Horda se arrepentirá de haber venido!', '¡La Horda se arrepentirá de haber venido!', 30706),
(163018, 'esMX', '¡Por Kul Tiras! ¡Por la hija del mar!', '¡Por Kul Tiras! ¡Por la hija del mar!', 30706),
(163017, 'esMX', 'Tienes razón. Soy firmemar. ¡Hora de hacerle honor a mi título!', 'Tienes razón. Soy firmemar. ¡Hora de hacerle honor a mi título!', 30706),
(163016, 'esMX', 'Haz que paguen por lo que han hecho, continental.', 'Haz que paguen por lo que han hecho, continental.', 30706),
(163015, 'esMX', '¡Sabía que Taelia encontraría ayuda!', '¡Sabía que Taelia encontraría ayuda!', 30706),
(163014, 'esMX', '¿Qué estoy pensando? ¡No son más que monstruos contra quienes hay que pelear!', '¿Qué estoy pensando? ¡No son más que monstruos contra quienes hay que pelear!', 30706),
(163013, 'esMX', '¡Por la Lady almirante! ¡Por Kul Tiras!', '¡Por la Lady almirante! ¡Por Kul Tiras!', 30706),
(163012, 'esMX', 'Tengo un doctorado en explosiones y una especialización en literatura. ¿Y sabes qué? ¡No puedo explotar ni leer nada con la Alianza a mis espaldas!', 'Tengo un doctorado en explosiones y una especialización en literatura. ¿Y sabes qué? ¡No puedo explotar ni leer nada con la Alianza a mis espaldas!', 30706),
(163011, 'esMX', '', 'Mi madre estuvo a punto de perder su vida por tratar de salvar al pueblo de Darnassus. Haré todo lo posible para detener a la Horda aquí en Costa Oscura.\n\nCiertas atrocidades no pueden dejarse pasar.', 30706),
(163010, 'esMX', 'Estoy listo para volver a Loch Modan.', 'Estoy lista para volver a Loch Modan.', 30706),
(163009, 'esMX', '¿Cómo estás?', '', 30706),
(163008, 'esMX', 'Necesito un vuelo directo a Quel\'Danas.', 'Necesito un vuelo directo a Quel\'Danas.', 30706),
(163007, 'esMX', 'Señor maresabio, ¿en serio vive aquí?', '', 30706),
(163006, 'esMX', 'Mira, $n, ¡estamos volando por el agua! ¡Es increíble!', '', 30706),
(163005, 'esMX', '¿Quieres que le echemos un vistazo?', '', 30706),
(163001, 'esMX', '', 'La muerte nos llega a todos.', 30706),
(163000, 'esMX', '', '<Delaryn no parece estar mirándote.>', 30706),
(162998, 'esMX', '', 'Todos nos hemos visto afectados por estos tiempos oscuros. Algunos sufrimos de formas de las que jamás nos recuperaremos. Elegí un nombre que reflejara todo lo que cambié.', 30706),
(162997, 'esMX', 'Y si algo llega a salir mal, el auxilio mecánico vendrá a repararlo. ¡Hasta conseguí una garantía gratis!', '', 30706),
(162995, 'esMX', '¡No se esperan que nos unamos en un M.I.D.A.S.-G para sembrar el caos!', '', 30706),
(162994, 'esMX', '¡Fiu! Esta belleza sí que se mueve. ¡Imagina lo que le hará a la Alianza!', '', 30706),
(162993, 'esMX', 'Regresa a Canal de Tiragarde.', '', 30706),
(162992, 'esMX', 'Bien, sujétate. Solo debo averiguar qué botón hace que esta cosa vuele...', '', 30706),
(162991, 'esMX', 'Aahhhh, espera... ¡Creo que está yendo demasiaaaaaaado rápidooo!', '', 30706),
(162990, 'esMX', '¡Ja! Así me gusta. Sujétate fuerte, porque esto irá MUY RÁPIDO. ¡Su combustible es azerita, nena!', '', 30706),
(162989, 'esMX', 'Le demostraremos a la Alianza el verdadero poder de la tecnología goblin.\n\nY con eso me refiero a que los haremos explotar y estallar y reventar.', '', 30706),
(162988, 'esMX', 'Así es, Liam. Que las mareas te bendigan.', '', 30706),
(162987, 'esMX', 'Eso… ¿te lo dijo el agua?', '', 30706),
(162983, 'esMX', '', '¡Tú, errante! Ocupa una de las balistas. Protege a los civiles mientras huyen.', 30706),
(162982, 'esMX', 'Admiro tu valor, elfa. Pero se acabó la caza.', '', 30706),
(162981, 'esMX', 'Aunque pudiéramos fundir el metal, ningún enano soportaría tanto calor. ¡Ni siquiera un Hierro Negro!', '', 30706),
(162980, 'esMX', 'No te preocupes, Grumnus. Tengo unos amigos que pueden ayudarnos a resolver los dos problemas.', '', 30706),
(162979, 'esMX', 'Espero que sepas seguir el camino que hayas elegido. Si lo haces, tendrás una vida de felicidad y plenitud absoluta.', '', 30706),
(162978, 'esMX', 'Puede que llegue un momento en que tengas que enfrentarte al mal. Quizás con menos fanfarria que $n, pero tendrás que enfrentarlo de todos modos.', '', 30706),
(162977, 'esMX', 'No me lo quitaron, pequeño. Son mis hermanos y hermanas. Pero la oscuridad acecha en sus corazones.', '', 30706),
(162976, 'esMX', 'No sé si podremos reforjar la armadura, Brann. Para eso, La Gran Fundición tendría que llegar a temperaturas nunca antes vistas.', '', 30706),
(162975, 'esMX', '¿Te refieres a tipos malos? ¿Por qué los tipos malos te quitaron tu hogar?', '', 30706),
(162974, 'esMX', 'Antes vivía aquí, pero ahora este lugar está en manos de quienes desean herir.', '', 30706),
(162973, 'esMX', 'Como verás, la armadura está completamente destruida... ¡Ah! ¡Aquí está $Unuestro amigo:nuestra amiga;!', '', 30706),
(162972, 'esMX', 'Intento decidir qué quiero ser cuando sea grande. ¡Quería ver la roca de calamar gigante!', '', 30706),
(162971, 'esMX', 'Así es, amiguito. ¿Qué te ha traído hasta la sombra del Santuario de la Tormenta?', '', 30706),
(162970, 'esMX', '¡Guau! Señor, ¡¿es un maresabio de verdad?!', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(162969, 'esMX', 'Es toda una maravilla, ¿no es así?', '', 30706),
(162955, 'esMX', '', 'Eh\'te será un día que todos los zandalari guardarán en su memoria.\n\nEh\'pero que marque el comienzo de una etapa próspera para mi pueblo.', 30706),
(162954, 'esMX', 'Creo que nadie ha entrado al estudio de Aegrim desde su deceso.', '', 30706),
(162952, 'esMX', 'Estoy casi seguro de que los Firmemares necesitan un mecánico para sus armamentos, Lady Almirante. Me quedaré con $p.', '', 30706),
(162951, 'esMX', '', 'Ehm... ¿No tendríamos que llevar algunos remeros?', 30706),
(162950, 'esMX', '', 'Gracias, señora. ¡La seguimos, lady almirante!', 30706),
(162949, 'esMX', '', 'No te preocupes por tu grifo, cadete. Me aseguraré de que traten sus heridas.', 30706),
(162948, 'esMX', '', 'Sí, señora. Pero... No puedo dejar a Corazón de vendaval aquí.', 30706),
(162947, 'esMX', '', 'Un consejo sabio, madre. Adalid, Taelia... síganme. Cruzaremos el Canal de Tiragarde. Búsquenme allí.', 30706),
(162946, 'esMX', '', 'A Lorena le habría encantado que conservaras esto. Nos contó muchas historias alegres sobre ti y sus hermanos durante su servicio en Theramore. Lamento mucho tu pérdida.', 30706),
(162945, 'esMX', '', 'Madre, moviliza a nuestra infantería y a nuestros médicos.', 30706),
(162944, 'esMX', '', 'Haré que marchen hacia Puntanzuelo de inmediato, Jaina.', 30706),
(162943, 'esMX', '', 'Les enseñaremos el precio por atacar a Kul Tiras.', 30706),
(162942, 'esMX', 'En tus largos años de aventuras, has encontrado incontables pergaminos sombríos, pero nada que se pareciera a esto.\n\nEstá escrito en un idioma que no comprendes, y el papiro mismo está cubierto con una energía sombría. Este pergamino debe pertenecer a |cFF0000FFalguien que trabaja con magia oscura y malevolente|r.', '', 30706),
(162941, 'esMX', 'Este cajón está completamente vacío. Lo forzaron y se llevaron todo su contenido.\n\nPaul North era el intendente de la arena, y comerciaba artículos valiosos. Quien haya robado esta mercadería puede haber tenido |cFF0000FFmotivos económicos|r.', '', 30706),
(162940, 'esMX', 'Paul North yace sobre la mesa, sin respirar, con una espada clavada en el centro de su pecho esquelético.\n\nSospechas que esto fue lo que lo mató.\n\nLa espada tiene incrustaciones de oro y piedras preciosas. Quien haya comprado esta arma debió tener acceso a una |cFF0000FFgran fortuna|r.', '', 30706),
(162939, 'esMX', 'Guau...', '', 30706),
(162933, 'esMX', 'Le pediste a Lilian Voss que se encargara de ellos. Se aseguró de que así fuera.', '', 30706),
(162932, 'esMX', 'Qué... bueno. Pero, ¿cómo? Gastamos todo antes de mi muerte... es decir, mi transformación.', '', 30706),
(162931, 'esMX', 'Tu familia está bien. Tu esposa compró una pequeña casa en Alto de Arom, en Drustvar, y tus hijos no pasan hambre.', '', 30706),
(162924, 'esMX', 'Sí, más que nada.', '', 30706),
(162923, 'esMX', '¿Te parece sabio afligirte por tu vida anterior? ¿Estás seguro de que quieres saber?', '', 30706),
(162922, 'esMX', 'Rexxar, espera. ¿Tienes... noticias de mi familia? ¿Cómo están?', '', 30706),
(162921, 'esMX', 'Buen trabajo, Zelling. Hasta la próxima.', '', 30706),
(162920, 'esMX', '... Ya está. Vamos, tenemos que ver cómo están Misha y Zelling.', '', 30706),
(162919, 'esMX', '¡La Ciudad de Neferset caerá! ¡¡ATAQUEN!!', '', 30706),
(162918, 'esMX', 'Ja... ja... los demás vendrán... por ustedes...', '', 30706),
(162915, 'esMX', 'Ven, entonces, ¡a ver si puedes hacer justicia!', '', 30706),
(162913, 'esMX', '¡Yo seré el que lleve a la justicia al asesino de Daelin, a como dé lugar!', '', 30706),
(162912, 'esMX', 'Te ocultabas en tu hojalata mientras mataban a tus aliados, cobarde. ¡Al menos Daelin tuvo el coraje de luchar con sus soldados', '', 30706),
(162911, 'esMX', '', 'Rápido, ¡a la costa!', 30706),
(162910, 'esMX', '', 'La oscuridad ha caído sobre la costa.', 30706),
(162909, 'esMX', 'Nuestros aliados están listos. Comencemos.', 'Nuestros aliados están listos. Comencemos.', 30706),
(162904, 'esMX', 'No mentiré. No todos volverán con vida de esto. Necesitamos que la Horda crea que nuestro ataque es real.', '', 30706),
(162903, 'esMX', '', '¡Lady almirante! ¡La Horda está atacando Muelle Puntanzuelo!', 30706),
(162902, 'esMX', 'Gracias por venir tan rápido. Antes de proseguir, el rey Wrynn desea hablar con nosotros.', '', 30706),
(162901, 'esMX', 'Estoy listo para escuchar, alto comandante. [Comienzo de RTC]', 'Estoy lista para escuchar, alto comandante. [Comienzo de RTC]', 30706),
(162900, 'esMX', 'Mi pueblo organizará equipos de ataque para brindar apoyo, y los ingenieros del Manitas Mayor Mekkatorque prepararán algunas sorpresas para la Horda.', '', 30706),
(162899, 'esMX', 'Nuestro objetivo es atraerlos al norte de Nazmir. Los atacaremos con tácticas de guerrilla y provocaremos a los trols de sangre.', '', 30706),
(162898, 'esMX', 'Un asalto a la ciudad de Dazar\'alor desestabilizará las relaciones de la Horda con los zandalari.', '', 30706),
(162896, 'esMX', '', 'Eso suena perfecto, madre. Sabes... se siente bien volver a casa.', 30706),
(162895, 'esMX', '', 'Jamás estarás sola, hija mía. Vayamos a un lugar tranquilo y hablemos. La biblioteca de la fortaleza siempre fue tu lugar favorito. ¿Aún te agrada el olor húmedo de los libros viejos?', 30706),
(162894, 'esMX', '', 'Ese reino de tormento... me obligó a enfrentarme a recuerdos que había apartado por mucho tiempo. Pero en cuanto te vi ahí, yo... me di cuenta de que no tenía que enfrentarme a la oscuridad sola.', 30706),
(162893, 'esMX', '', 'Tuve visiones mientras te buscábamos en Thros. Vi momentos de duda y de dolor. No quiero abrir viejas heridas, pero... necesito saberlo. ¿Te sientes... mejor?', 30706),
(162892, 'esMX', '', 'Perdimos a tantos. Héroes valientes... Familias inocentes... víctimas del odio de un demente.', 30706),
(162891, 'esMX', '', 'No, no es sobre tu padre. Sé lo que le pasó a la ciudad. El ataque de la Horda. La explosión.', 30706),
(162890, 'esMX', '', '¿Sobre Theramore? Madre, perdóname. No quise recordarte...', 30706),
(162889, 'esMX', '', 'Esas conversaciones nunca dejan de ser difíciles. Jaina... ¿Puedo hacerte una pregunta?', 30706),
(162888, 'esMX', '¡El Faraón oscuro ha caído! ¡Sus inmortales colosos se desmoronan como juguetes!', '', 30706),
(162887, 'esMX', '¡Guau, gracias señor pirato!', '', 30706),
(162886, 'esMX', 'Así es, chico. Tengo uno de sobra. Ahora vuelve a estudiar. Y no crezcas tan rápido.', '', 30706),
(162885, 'esMX', 'Bien, si mis tropas no pueden matarte, ¡entonces lo haré yo! ¡Por Daelin Valiente!', '', 30706),
(162884, 'esMX', '¡Pero tienes ese sombrero genial!', '', 30706),
(162883, 'esMX', 'No tan rápido, niño. La vida pirata no es tan genial. No tendrás un corazón tierno ni una cama propia. ¡Y los ciudadanos respetables te llamarán bueno para nada!', '', 30706),
(162882, 'esMX', '¡Cuando crezca quiero ser como tú! ¡Olvida las reglas! ¡Voy a vivir una vida de aventuras en alta mar!', '', 30706),
(162881, 'esMX', 'Yo... eh... ¿sí?', '', 30706),
(162880, 'esMX', '¡Tienes sombrero y todo! ¡Eres tan genial! ¿Entonces navegas y bebes ron y encuentras tesoros escondidos?', '', 30706),
(162879, 'esMX', '¡Claro que sí! ¿Por qué preguntas?', '', 30706),
(162878, 'esMX', '¿Eres un pirata de verdad?', '', 30706),
(162877, 'esMX', '¡Ey, niño! ¿Qué haces aquí? Este no es lugar para un niñito de tu edad.', '¡Guau, $n! ¡Qué lugar increíble!', 30706),
(162876, 'esMX', '', '¡Ahhh! ¡Tenemos que salir de aquí!', 30706),
(162875, 'esMX', '', '¡Ahora mismo, jefe!', 30706),
(162866, 'esMX', 'No me importa si no está terminada, ¡pon esa trituradora en modo asesino AHORA!', '', 30706),
(162865, 'esMX', '¡Guau, $n! ¡Este lugar es increíble!', '', 30706),
(162861, 'esMX', 'MODO PILOTO AUTOMÁTICO: ACTIVADO. MATAR A TODOS LOS HOSTILES.', '', 30706),
(162860, 'esMX', 'Guardaré el esquema para mantenerlo a salvo. ¡No te preocupes, mis centinelas lo cuidarán!', '', 30706),
(162839, 'esMX', 'Aka\'magosh. Nos fortalecemos, ¡y ellos se debilitan!', '', 30706),
(162838, 'esMX', 'La Alianza ha aumentado notablemente su presencia en esta región. No temas enfrentar adversidades. Supéralas.', '', 30706),
(162837, 'esMX', 'Su derrota era inevitable. ¡Lok-tar!', '', 30706),
(162835, 'esMX', '', 'Debemos apresurarnos. Los susurros son más insistentes.', 30706),
(162834, 'esMX', '', 'Me complace tanto que tu mente esté abierta a todos los caminos posibles.', 30706),
(162833, 'esMX', '', 'Las cosas se han puesto interesantes. No sabía que esto fuera posible.', 30706),
(162814, 'esMX', '¡Vamos!', '', 30706),
(162813, 'esMX', 'Vuelve en un par de años, niño. Si practicas mucho, no tendrás problema para pasar las pruebas.', '', 30706),
(162812, 'esMX', '', 'Cierra tu maldita boca, Budd. ¡¡CIÉRRALA!!', 30706),
(162811, 'esMX', '¡Guau! ¡$n, mírame!', '', 30706),
(162809, 'esMX', '¡MÍRAME! ¡SOY UN MANATAURO!', '', 30706),
(162799, 'esMX', 'El rumbo de la batalla ha cambiado a nuestro favor gracias a ti. Bien hecho, $c.', '', 30706),
(162798, 'esMX', 'El rumbo de la batalla ha cambiado a nuestro favor gracias a ti. Buen trabajo.', '', 30706),
(162797, 'esMX', 'Ah, así que quieres montar un grifo. Puedo ayudarte.', '', 30706),
(162796, 'esMX', '¡Qué genial! Un día seré como usted. ¡Montaré grifos y esas cosas!', '', 30706),
(162795, 'esMX', '¡Ja! Desde luego. ¡Así somos los rabaleros!', '', 30706),
(162794, 'esMX', '¡Los nagas sacrifican a los aldeanos y arrasan con el pueblo! ¡Haz algo para detenerlos antes de que se cobren más vidas inocentes!', '', 30706),
(162793, 'esMX', '¡Los nagas se levantaron en armas! Detenlos antes de que se pierdan más vidas inocentes.', '', 30706),
(162792, 'esMX', '¡Ay, pero qué genial! ¿Es verdad que puede derrotar a un wendigo con las manos atadas a la espalda?', '', 30706),
(162791, 'esMX', 'A eso me dedico, niño.', '', 30706),
(162790, 'esMX', '¡Oh, guau! ¡Hola, señor! ¿Es usted un rabalero?', '', 30706),
(162789, 'esMX', '¿Qué hace un niño como tú en medio de las montañas?', '', 30706),
(162788, 'esMX', '¡$n, mira! ¡Mira cómo manejan ese grifo!', '', 30706),
(162787, 'esMX', 'Tu enfoque es... poco ortodoxo. Por otra parte, supongo que con el humo del fuego solo verán sus siluetas.', '', 30706),
(162786, 'esMX', 'El sol es maravilloso. ¡Es como una luz sagrada magnífica!', '', 30706),
(162785, 'esMX', '', '¿Qué era lo que debía agarrar?', 30706),
(162784, 'esMX', '¡Guau!', '', 30706),
(162783, 'esMX', '', 'Pero supongo que es el único plan que tenemos.', 30706),
(162782, 'esMX', 'Ah, saludos. Permaneceré aquí y contemplaré el sol.', '', 30706),
(162781, 'esMX', 'Soy Soulare de Andorhal, discípulo de la Luz.', '', 30706),
(162780, 'esMX', 'Estoy listo, Delormi. Devuélveme a mi tiempo.', 'Estoy lista, Delormi. Devuélveme a mi tiempo.', 30706),
(162779, 'esMX', '', '¡Este es el plan más absurdo... lunático... y ridículo que se te ha ocurrido nunca, Budd!', 30706),
(162778, 'esMX', 'Libre... Por fin. Recibirán una importante recompensa, amigos.', '', 30706),
(162774, 'esMX', '', 'El entramado del tiempo está a salvo por ahora... pero ya no podrás repararlo, tejedora Delormi...', 30706),
(162773, 'esMX', '', 'Nosotras no somos una debilidad... ¡y tú no eres nuestro destino!', 30706),
(162772, 'esMX', '', 'Las tijeras de la muerte destruyen fácilmente lo que es frágil. Debemos deshacernos de nuestra debilidad.', 30706),
(162771, 'esMX', '', 'Pero si nuestro destino es destruirlo. El entramado es débil, repararlo es inútil.', 30706),
(162770, 'esMX', '', '¡Delormi, detén esto! ¡Nuestro objetivo es conservar el entramado del tiempo!', 30706),
(162769, 'esMX', '', 'Se te ha otorgado todo el conocimiento que estoy dispuesta a compartir. Vete y no regreses jamás.', 30706),
(162768, 'esMX', '¿Así que los susurro\' no provenían del mismo que me envió de regreso?', '', 30706),
(162767, 'esMX', '', 'Has sido tocado por la mano del valor. Una fuerza tan noble no conspira sobre tronos mortales.', 30706),
(162766, 'esMX', '¿Quién tiene semejante poder? ¿Será el mih\'mo que me llevó a nombrar jefa de guerra a Sylvanas?', '', 30706),
(162765, 'esMX', '', 'Cazador de las sombras, ya no eres un mero espíritu. Te has convertido en algo que supera lo que puedo forjar con mi poder.', 30706),
(162764, 'esMX', 'Reina de las val\'kyr. Enviaron a mi espíritu al Otro Lado, y luego regresó. ¿Tú has hecho eh\'to?', '', 30706),
(162763, 'esMX', '', 'Mmm. Muy bien. Tú y tu adalid pueden acercarse. Pero recuerda que el engaño se paga con destrucción.', 30706),
(162762, 'esMX', 'Eyir, habla conmigo si los otro\' no te agradan.', '', 30706),
(162761, 'esMX', '', 'Alto... ¿Te ATREVES a traer una sacerdotisa de Bwonsamdi a MIS salones?', 30706),
(162760, 'esMX', '', 'Pero no perdamos el tiempo. Ábrete paso a las costas de Vol\'dun. Allí nos espera el tercer premio.', 30706),
(162759, 'esMX', '', 'Esbirros de la Reina alma en pena, abandonen este lugar o mueran.', 30706),
(162758, 'esMX', 'Abandona este lugar ahora o quédate para siempre. Tú decides.', '', 30706),
(162757, 'esMX', '', 'No me gusta eh\'to. Sugiero que nos vayamos... ¡ahora mismo!', 30706),
(162756, 'esMX', 'No eres no-muerto ni estás maldito. No perteneces aquí. Abandona este lugar de inmediato.', '', 30706),
(162755, 'esMX', '¿Ere\' tú el que aferra mi alma a este mundo? ¿Para aprisionarme como haces con la Plaga?', '', 30706),
(162754, 'esMX', 'Vol\'jin... Tu alma ha ingresado al Otro Lado y regresado. Has sido alterado... más de lo que imaginas.', '', 30706),
(162753, 'esMX', '¿Y eres tú... el que dejó mi eh\'píritu atrapado en eh\'te mundo?', '', 30706),
(162752, 'esMX', 'Los planes de la Reina alma en pena amenazan con romper el equilibrio. No tuve nada que ver con ellos.', '', 30706),
(162751, 'esMX', 'Rey Exánime. La voz que escuchaba mientra\' eh\'taba muriendo... La voz que me decía que nombrara jefa de guerra a Sylvanas... ¿Era tuya?', '', 30706),
(162750, 'esMX', '¡El equilibrio es importante! Además, ella adquirió el desagradable hábito de conservar lo que mata. No, tu jefa de guerra eh\'tá lejos de ser amiga del viejo Bwonsamdi.', '', 30706),
(162749, 'esMX', '¿Por qué querría yo a la Reina alma en pena al mando? Nononono. Claro que eh\'toy siempre a favor de la guerra y la muerte... Pero esa Sylvanas... altera demasiado la balanza.', '', 30706),
(162748, 'esMX', 'Cuida el tono, colega toro... O en poco tiempo te reencontrará\' con tu padre.', '', 30706),
(162747, 'esMX', '¡Habla sin rodeos! ¿Fuiste tú quien le dijo a Vol\'jin que nombrara jefa de guerra a Sylvanas?', '', 30706),
(162746, 'esMX', '¿Qué? Nonono. Te equivoca\', Talanji.', '', 30706),
(162745, 'esMX', '', 'Loa de la muerte, tu sirviente Vol\'jin te ha convocado. Pero tú has hecho oídos sordos a su\' pedidos.', 30706),
(162744, 'esMX', 'Ahhhh, has regresado. ¿Encontrah\'te el espíritu de Vol\'jin? ¿O estás aquí para hacer un trato, eh?', '', 30706),
(162743, 'esMX', 'La verdad de que tal ve\' no era un loa el que deseaba que Sylvanas fuera jefa de guerra, sino algo má\' poderoso.', '', 30706),
(162742, 'esMX', 'Recuerdo que me llevaba a algún sitio, pero a dónde... E\' como si me hubieran ocultado el recuerdo, para que no revele la verdad...', '', 30706),
(162741, 'esMX', 'Hace mucho tiempo que eh\'toy llamando a Bwonsamdi. No me escucha... O no quiere reh\'ponderme.', '', 30706),
(162740, 'esMX', 'Como están haciendo ahora. No los escucho, adalid. Las voce\' de los loa eh\'tán en silencio.', '', 30706),
(162739, 'esMX', 'Es como si hasta lo\' loa me hubiesen abandonado.', '', 30706),
(162738, 'esMX', 'Algo no andaba bien aquel día. Los demonio\' y sus espada\' burlaron mi vigilancia.', '', 30706),
(162737, 'esMX', 'Había una presencia. Algo se movía en las sombra\'. Algo poderoso.', '', 30706),
(162736, 'esMX', 'Eh\'peraba ver al viejo Bwonsamdi, a Shadra o a Hir\'reek... A cualquier loa.', '', 30706),
(162735, 'esMX', 'Recuerdo mi muerte. Recuerdo haber vih\'to el Otro Lado.', '', 30706),
(162734, 'esMX', 'Solo intentábamos… salvarte… de la verdad', '', 30706),
(162733, 'esMX', 'Te has ganado... un enemigo nefasto...', '', 30706),
(162732, 'esMX', 'El amo exige tu silencio.', '', 30706),
(162731, 'esMX', 'El amo... no estará contento...', '', 30706),
(162730, 'esMX', 'Buscas conocimiento prohibido.', '', 30706),
(162729, 'esMX', 'Devuelve al cazador de las sombras.', '', 30706),
(162728, 'esMX', 'Retírate.', '', 30706),
(162727, 'esMX', '¡Leña!', '¡Leña!', 30706),
(162726, 'esMX', '¡Te cortaré a la mitad!', '¡Te cortaré a la mitad!', 30706),
(162725, 'esMX', '', 'La detendré. Por todas nosotras. Descansa, magistrix.', 30706),
(162724, 'esMX', '', 'Debes detenerla… salvarnos… salvarte…', 30706),
(162723, 'esMX', '', 'Silencio, magistrix...  Pronto acabará todo.', 30706),
(162722, 'esMX', '', 'Delormi... la infin... no pude con ella...', 30706),
(162721, 'esMX', 'Sus hacedores les han fallado... ¡Su raza imperfecta ha sucumbido ante la maldición de la carne! ¡La dádiva de Lord Alamuerte les devolverá la perfección!', '', 30706),
(162720, 'esMX', 'No... la Ub3r-Llave le pertenece a Ventura... y Cía.', '', 30706),
(162719, 'esMX', 'Ustedes son los últimos de su tribu con algo de sentido común. ¡Como recompensa por darnos al príncipe Nadun, les otorgo el don que es su derecho de nacimiento y más aún!', '', 30706),
(162705, 'esMX', '', 'El entramado mismo del tiempo se rasgará. Todas las costuras se deshilvanarán.', 30706),
(162704, 'esMX', '', '¡Basta! ¡Deja de lastimarla!', 30706),
(162703, 'esMX', '', 'Todos los hilos deben cortarse. Delormi debe morir.', 30706),
(162702, 'esMX', '', '¡Eso es! Vaya, Gryzix sí que sabe lo que hace.', 30706),
(162701, 'esMX', 'Las sombra\' me niegan los recuerdos. Sombras... que... ¡vendrán por ustede\'! ¡Cuidado!', '', 30706),
(162700, 'esMX', '¿Era Bwonsamdi? ¿Acaso él anhelaba las muertes que ella trajo?', '', 30706),
(162699, 'esMX', 'Ah, joven amigo mío. La muerte es... Oh\'cura. Mi memoria... ya no es lo que era.', '', 30706),
(162698, 'esMX', 'Tengo que saber esto... Cuando la voz te habló y te ordenó que la nombraras jefa de guerra... ¿Qué espíritu era?', '', 30706),
(162697, 'esMX', 'Pero, desde entonces... Se ha esforzado por destruir el honor que mantiene unida a la Horda.', '', 30706),
(162696, 'esMX', '', 'Gracias, $n. ¡Voy a desencriptar a este muchachito!', 30706),
(162695, 'esMX', 'Sylvanas nos llevó a la victoria en la guerra contra la Legión.', '', 30706),
(162694, 'esMX', 'Baine... tu corazón late fuerte y sincero... Como el de tu padre. Me alegra que los demonio\' no te hayan llevado.', '', 30706),
(162693, 'esMX', '¡Vol\'jin! Mi viejo amigo, ¿de verdad eres tú?', '', 30706),
(162692, 'esMX', 'Talanji. Tu voz e\' poderosa.', '', 30706),
(162691, 'esMX', '', 'Vol\'jin, hijo de Sen\'jin, otrora jefe de guerra de la Horda. Reh\'ponde a mi llamado y preséntate ante nosotros.', 30706),
(162690, 'esMX', 'Misión... fracasada...', 'Misión... fracasada...', 30706),
(162689, 'esMX', '', '¡Ya deja de morir!', 30706),
(162688, 'esMX', '', 'Equilibrio.', 30706),
(162687, 'esMX', '', 'Tranquilidad.', 30706),
(162686, 'esMX', '¡Esa era mi trituradora favorita! ¡Pagarás por eso!', '¡Esa era mi trituradora favorita! ¡Pagarás por eso!', 30706),
(162685, 'esMX', 'Yo me encargo de tus heridas.', '', 30706),
(162684, 'esMX', 'Te estoy sanando.', '', 30706),
(162683, 'esMX', 'Sethraliss, perdóname... solo veo oscuridad.', '', 30706),
(162682, 'esMX', '¡Falla crítica! ¡Activando eyección de piloto!', '¡Falla crítica! ¡Activando eyección de piloto!', 30706),
(162681, 'esMX', 'Enemigos detectados. ¡Atacando!', 'Enemigos detectados. ¡Atacando!', 30706),
(162680, 'esMX', '', 'Los dioseh\' son loa-migos de los trols.', 30706),
(162679, 'esMX', '', 'Quiero quedarme con un vulpera, será mi mah\'cota... ¡Son tan peludito\'!', 30706),
(162678, 'esMX', '', '¿Por qué los Lanza Negra caminan tan encorvado\'?', 30706),
(162677, 'esMX', '', '¡Juguemos! ¡Tú será\' tú, y yo seré Bwonsamdi! ¡Ten cuidado! ¡Te comeré el alma!', 30706),
(162676, 'esMX', '', '¿Eso que hay en tu arma es sangre? ¿Puedo tocarla?', 30706),
(162675, 'esMX', '', '¿Por qué tantas raza\' de la Horda tienen tantos dedos en los pie\'?', 30706),
(162674, 'esMX', '', 'Si a todos les dicen que se alejen del vudú, ¿entonce\' quién puede hacer vudú?', 30706),
(162673, 'esMX', '', '¿Cuántos dedos perdih\'te y volvieron a crecerte?', 30706),
(162672, 'esMX', '¿Puedo llevarme a Xal\'atath? Es muy importante.', '¿Puedo llevarme a Xal\'atath? Es muy importante.', 30706),
(162671, 'esMX', '', 'Bueno, supongo que podría dejar que te la llevaras... Quizás sea la causa de todo esto. O al menos eso es lo que dijo. ¿Mencioné que puede hablar?', 30706),
(162670, 'esMX', '¿Cómo puede ser que el mar tenga una hija?', '', 30706),
(162669, 'esMX', '¿Las flotas de barcos se llaman así porque… flotan?', '', 30706),
(162668, 'esMX', '', '¿Cómo? ¿La espada negra del imperio? Sí, la encontré hace poco.', 30706),
(162667, 'esMX', '', 'Esto es muy extraño.', 30706),
(162666, 'esMX', '¿Por qué las velas de los barcos no se encienden como las de los candelabros?', '', 30706),
(162665, 'esMX', 'Nos llamamos kultiranos, pero de tiranos no tenemos nada.', '', 30706),
(162664, 'esMX', '¡Oí que los gilneanos se transformaron en lobos! ¿Eso significa que son todos druidas?', '', 30706),
(162663, 'esMX', '¿Por qué los elfos del Vacío son violetas? ¿Aguantaron la respiración durante demasiado tiempo?', '', 30706),
(162662, 'esMX', '¿Por qué los gnomos dejan de crecer?', '', 30706),
(162661, 'esMX', 'Si atas un globo a un ancla… ¿flota o se hunde?', '', 30706),
(162660, 'esMX', 'Así que vinieron por su preciosa tecnología, ¿eh? ¡Los destruiré con sus propias creaciones!', '', 30706),
(162659, 'esMX', 'Oh, sé muy bien de qué se trata su \"honor\". Prefiero pelear con mis reglas. ¡No durarás ni un minuto cuando este tanque alcance la potencia máxima!', '', 30706),
(162658, 'esMX', 'Hablas con audacia, pero te escondes dentro de tu máquina. ¡Enfréntanos con honor!', '', 30706),
(162657, 'esMX', 'Rexxar, el perro de la Horda que asesinó a Daelin Valiente. ¡Mis fuerzas acabarán contigo!', '', 30706),
(162655, 'esMX', 'Será mejor que vayamos a un lugar seguro... ¡Vamos al bar!', '', 30706),
(162654, 'esMX', '¡Veo un trol cerca del muelle!', '', 30706),
(162653, 'esMX', '¿Eso que veo son gallinas verdes? Debo dejar de beber tanto.', '', 30706),
(162652, 'esMX', 'Ey, ¿dónde están todos?', '', 30706),
(162651, 'esMX', '¡Pagarán por eso!', '¡Pagarán por eso!', 30706),
(162650, 'esMX', '', 'Huelo gnomos por allí. ¡Hagamos que vuelen por los aires antes de que inventen algo!', 30706),
(162649, 'esMX', '', '¡No tenemos más presupuesto! ¡Vuelvan a armar las minas usadas y sigan atacando!', 30706),
(162648, 'esMX', '', '¡Una de estas minas llegará hasta su búnker!', 30706),
(162647, 'esMX', '', '¡Más minas! ¡Más minas! Esto nos está costando una fortuna.', 30706),
(162646, 'esMX', '', 'Una gloria inmensa te aguarda, mi adalid.', 30706),
(162645, 'esMX', '¡Solo algunos minutos más y lanzaremos a estos robots contra el enemigo!', '', 30706),
(162644, 'esMX', 'Una vez que se activen, ¡la victoria será nuestra!', '', 30706),
(162643, 'esMX', '¡Los goblins no tienen una tecnología capaz de detener a estos robots!', '', 30706),
(162642, 'esMX', '¡Ya casi estoy lista! ¡Mis nuevos robots detendrán este ataque!', '', 30706),
(162641, 'esMX', '', 'Te lo advierto. Este siempre ha sido irritable. Dudo que su temperamento haya mejorado mucho en los últimos siglos.', 30706),
(162640, 'esMX', '', 'No es coincidencia que nuestros caminos se cruzaran, $n. Tu destino era encontrarme. Mi destino era encontrarte.', 30706),
(162639, 'esMX', '', '¿Te estás divirtiendo? Siempre podemos buscar más plebeyos para masacrar, si eso quieres.', 30706),
(162638, 'esMX', '¡Abran fuego! ¡El rompebots los detendrá!', '', 30706),
(162637, 'esMX', '¡Un par de golpes del rompebots y este ataque habrá llegado a su fin!', '', 30706),
(162636, 'esMX', '¡La tecnología goblin no es rival para mi rompebots gnómico!', '', 30706),
(162635, 'esMX', '¡Esta es la oportunidad perfecta para probar mi nuevo rompebots!', '', 30706),
(162634, 'esMX', 'Puedo sentir sus miradas al acecho. ¿Dónde están los refuerzos?', '', 30706),
(162633, 'esMX', 'Qué gran día para tener problemas...', '', 30706),
(162632, 'esMX', '¡Protejan el perímetro! ¡No podemos permitir que nadie le ponga las manos encima a este envío!', '', 30706),
(162631, 'esMX', '¡Apresúrense con esa rueda! ¡Estamos muy expuestos aquí!', '', 30706),
(162630, 'esMX', '¿Qué sabemos acerca de los trols zandalari?', '¿Qué sabemos acerca de los trols zandalari?', 30706),
(162629, 'esMX', 'Es un honor que Talanji haya solicitado que sea teh\'tigo de eh\'to. Hemos hablado un poco sobre su futuro y el de los zandalari. Espero que comprenda que nuestros pueblo\' tienen un vínculo indisoluble. Juntos seremos más fuerte\' que separados.\n\nPero tengo la certeza de que tú tienes un papel que cumplir en todo eh\'to. Quizás puedas convencerla aunque yo no pude.', '', 30706),
(162628, 'esMX', '¡Salven a su capitán, muchachos! Sálvenme...', '¡Salven a su capitán, muchachos! Sálvenme...', 30706),
(162627, 'esMX', '¿TRES? Les podríamos haber sacado cinco... ¡Tonto!', '', 30706),
(162626, 'esMX', '¡Alto, escorias!', '¡Alto, escorias!', 30706),
(162623, 'esMX', '', 'Y gracias a ti, la Horda cuenta con el poderío de la flota zandalari. Lo único que queda es terminar de desmoralizar al enemigo... y entonces esta guerra será nuestra.', 30706),
(162621, 'esMX', '', 'Será un arma valiosa en nuestra guerra contra Kul Tiras. Una daga que podremos clavar directo en el corazón de la casa Valiente... en el momento justo.', 30706),
(162619, 'esMX', '', 'Contempla el fruto de tu trabajo. Derek Valiente... el cadáver que rescataste del fondo del mar.', 30706),
(162617, 'esMX', '¿Qué querías decirme, jefa de guerra?', '¿Qué querías decirme, jefa de guerra?', 30706),
(162616, 'esMX', '', 'Derek Valiente... Sí, me servirás.', 30706),
(162615, 'esMX', '', 'Y matar a una cronomántica... Temo por la fuerza que pueda poseer.', 30706),
(162614, 'esMX', '', 'Solo he visto esta variante de mí en los confines más lejanos del tiempo. Quien haya hecho esto debe ser muy poderoso.', 30706),
(162613, 'esMX', '', 'Aran\'ethil, Delormi. Marchitándose en el piso... No le deseo ese destino a nadie.', 30706),
(162612, 'esMX', '', 'Otra yo. A juzgar por sus heridas, la trajeron contra su voluntad.', 30706),
(162611, 'esMX', '', 'Quizás haya otras pistas más adelante.', 30706),
(162610, 'esMX', '', 'Esto no tiene sentido. Aún debería quedarme tiempo... y no debería estar muerta.', 30706),
(162609, 'esMX', '', 'Ese cadáver. Se parece a...mí.', 30706),
(162608, 'esMX', '', '¿Por qué esto demora tanto tiempo?', 30706),
(162607, 'esMX', '', 'Ah, mira cómo caen todos. Qué pena.', 30706),
(162606, 'esMX', '', 'Su voz está fragmentada, pero está allí.', 30706),
(162605, 'esMX', '¡Llévate el cofre pero no me mates!', '', 30706);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(162604, 'esMX', '', 'Oigo el llamado del océano. Lo que buscamos está colina arriba.', 30706),
(162603, 'esMX', '', 'Esto es en verdad fascinante, pero siempre podemos encontrar más para matar luego.', 30706),
(162602, 'esMX', '', 'Cuanto más te acercas, más se aleja.', 30706),
(162601, 'esMX', '', 'Eres $Uun héroe:una heroína; muy $Upoderoso:poderosa;.', 30706),
(162600, 'esMX', '', '¡Alcen los escudos!', 30706),
(162599, 'esMX', 'Me... siento... débil...', 'Me... siento... débil...', 30706),
(162598, 'esMX', '¡Katrianna, a mi lado! ¡Acabemos con estos rufianes!', '¡Katrianna, a mi lado! ¡Acabemos con estos rufianes!', 30706),
(162597, 'esMX', 'A quien corresponda:\n\nEspero que esto sirva de advertencia. El esquema de la Ub3r-Llave es y seguirá siendo propiedad de Ventura y Cía.\n\nAh, y ni se les ocurra buscarnos en las ruinas que se encuentran al sudeste de aquí. Porque no encontrarán nada más que rocas.\n\n\n- Oficial de expedición en jefe McCormick', '', 30706),
(162596, 'esMX', '<Cuando te acercas a la playa, encuentras al Gurú de datos Gryzix, que ha sido asesinado. En su cadáver hay una nota.>', '', 30706),
(162595, 'esMX', 'Leer la nota.', 'Leer la nota.', 30706),
(162594, 'esMX', '¡Dori\'thur desciende en picada desde las alturas con un mensaje para ti!', '¡Dori\'thur desciende en picada desde las alturas con un mensaje para ti!', 30706),
(162593, 'esMX', 'Creí que mis hombres se habían encargado de ustedes en la playa, ladrones. ¡Supongo que tendré que hacerlo yo mismo!', '', 30706),
(162592, 'esMX', '¿Cuántos cocos podemos conseguir para $uel feo:la fea;?', '', 30706),
(162591, 'esMX', 'No podemos permitir que encuentren el esquema. ¡La Ub3r-Llave será nuestra!', '', 30706),
(162590, 'esMX', '¡Aplastaremos a la Alianza y a sus aliados hasta en el escondite más remoto!', '', 30706),
(162589, 'esMX', '¡Kul Tiras caerá! ¡Por la jefa de guerra! ¡Lok-tar ogar!', '', 30706),
(162588, 'esMX', 'No puedo creer que esos cabeza de serpiente nos atacaran. ¡Rápido, el señor Razdunk no aceptará el fracaso!', '', 30706),
(162587, 'esMX', '¡Muévanse, hobgoblins haraganes! ¡Quiero esa trituradora en funcionamiento para ayer!', '', 30706),
(162586, 'esMX', '', 'La encerré en ese cofre. NO DEJABA DE HABLARME.', 30706),
(162585, 'esMX', 'Me han concedido un \"don\". ¿Sabes cómo eliminarlo?', 'Me han concedido un \"don\". ¿Sabes cómo eliminarlo?', 30706),
(162584, 'esMX', '', '¡Estoy UN POCO OCUPADA en este momento!', 30706),
(162583, 'esMX', 'Otro plan frustrado. Estamos un paso más cerca de ganar esta guerra.', '', 30706),
(162582, 'esMX', 'He recibido informes que indican que hay actividad de la Horda en esta área. Ocúpate de que sus planes fracasen.', '', 30706),
(162581, 'esMX', '¡Mi vida por la Horda!', '¡Mi vida por la Horda!', 30706),
(162580, 'esMX', 'Ya basta de pruebas, ¡es hora de una demostración práctica!', 'Ya basta de pruebas, ¡es hora de una demostración práctica!', 30706),
(162579, 'esMX', 'Esta acción cuesta 1 |TInterface\\ICONS\\INV_Enchanting_80_VeiledCrystal.blp:15|t cristal velado. ¿Quieres continuar?', '', 30706),
(162578, 'esMX', 'Cuando nos unimos a la Horda no me imaginaba terminar haciendo... esto.', 'Cuando nos unimos a la Horda no me imaginaba terminar haciendo... esto.', 30706),
(162577, 'esMX', 'Podría simplemente usar una ilusión... ¿Por qué nos ocultamos?', 'Podría simplemente usar una ilusión... ¿Por qué nos ocultamos?', 30706),
(162576, 'esMX', 'Esto... no está bien...', 'Esto... no está bien...', 30706),
(162575, 'esMX', 'Increíble... Quizás funcione después de todo.', 'Increíble... Quizás funcione después de todo.', 30706),
(162574, 'esMX', 'No puedo creer que estemos haciendo esto.', 'No puedo creer que estemos haciendo esto.', 30706),
(162573, 'esMX', 'Esto tiene que ser una broma... ¿De verdad va a funcionar?', 'Esto tiene que ser una broma... ¿De verdad va a funcionar?', 30706),
(162572, 'esMX', 'La Semana de los Niños todavía no ha terminado... ¿Me puedes dar otro silbato de huérfano kultirano?', 'La Semana de los Niños todavía no ha terminado... ¿Me puedes dar otro silbato de huérfano kultirano?', 30706),
(162571, 'esMX', '¡Silencio! ¡Ya casi caen en la trampa!', '¡Silencio! ¡Ya casi caen en la trampa!', 30706),
(162570, 'esMX', '¿Qué te dije, colega? ¡Mira! ¡Están por caer en la trampa!', '¿Qué te dije, colega? ¡Mira! ¡Están por caer en la trampa!', 30706),
(162569, 'esMX', '¡Silencio! Baja la voz, colega, ¡o nos eh\'cucharán!', '¡Silencio! Baja la voz, colega, ¡o nos eh\'cucharán!', 30706),
(162565, 'esMX', '¡Los tengo encima! ¡Provócalo\', Motega! ¡Rápido, vaca estúpida!', '¡Los tengo encima! ¡Provócalo\', Motega! ¡Rápido, vaca estúpida!', 30706),
(162563, 'esMX', '¡Zunjo necesita sanación!', '¡Zunjo necesita sanación!', 30706),
(162562, 'esMX', 'Toro... inútil...', 'Toro... inútil...', 30706),
(162557, 'esMX', 'Mi martillo... ¡me ha fallado!', 'Mi martillo... ¡me ha fallado!', 30706),
(162555, 'esMX', 'Arash-falas...', 'Arash-falas...', 30706),
(162545, 'esMX', '', 'Aunque nos apartamos durante muchos años, Kul Tiras también ha sufrido las repercusiones de la guerra.\n\nLos huérfanos bajo nuestro cuidado han perdido a su familia en muchas tragedias. Piratas, brujas, incendios, bestias... hacemos todo lo posible para proporcionarles un hogar amoroso. Muchos se quedan aquí hasta que alcanzan la edad suficiente para hacer su vida, y nosotros hacemos lo posible para que salgan capacitados para enfrentar el porvenir, les buscamos oficios y modos de ganarse la vida.\n\nNuestra época favorita del año es la Semana de los Niños, donde los amantes de la aventura como tú pueden llevar a los niños para que vean y conozcan el mundo.', 30706),
(162544, 'esMX', 'De acuerdo, muchachos, ¡a divertirse!', 'De acuerdo, muchachos, ¡a divertirse!', 30706),
(162543, 'esMX', '¡Otro juguete para Zunjo!', '¡Otro juguete para Zunjo!', 30706),
(162542, 'esMX', '¡Atrás, Zunjo! ¡Yo me encargo!', '¡Atrás, Zunjo! ¡Yo me encargo!', 30706),
(162541, 'esMX', '', 'Pude haber llegado... a capitana...', 30706),
(162540, 'esMX', '', '¡El viejo Sr. Aletas habrá muerto en vano si pierden este botín!', 30706),
(162539, 'esMX', '', '¡Quieren robarse nuestro tesoro, muchachos! ¡Atrápenlos!', 30706),
(162538, 'esMX', '', '¡Rata de sentina!', 30706),
(162537, 'esMX', '', '¡Derribamos a un monstruo marino gigante para conseguir eso! ¡No te lo llevarás!', 30706),
(162536, 'esMX', '', '¡Ey! ¡Eso es mío!', 30706),
(162535, 'esMX', 'Que Bwonsamdi... ¡te maldiga!', 'Que Bwonsamdi... ¡te maldiga!', 30706),
(162534, 'esMX', '¡Los zandalari te mandan saludo\'!', '¡Los zandalari te mandan saludo\'!', 30706),
(162533, 'esMX', '', '¿Estás $ulisto:lista;, sastre?', 30706),
(162532, 'esMX', 'Estoy listo para entrar a la falla temporal.', 'Estoy lista para entrar a la falla temporal.', 30706),
(162531, 'esMX', 'Te acompañaré en tu viaje a través de las Tierras Fantasma. Búscame en Tranquillien.', '', 30706),
(162530, 'esMX', '', 'Por lo menos finge que eres útil, ¿quieres?', 30706),
(162529, 'esMX', '', '¿La palabra \"orco\" significa algo para ti?', 30706),
(162528, 'esMX', '', '¿Acaso sabes cuántos continentes hay?', 30706),
(162527, 'esMX', '¡Al ataque!', '', 30706),
(162526, 'esMX', '', 'Oh, Delormi... ¡ahora sí que estás perdida!', 30706),
(162525, 'esMX', '', '¿Me oyes? ¿Me ves? Oh, vaya...', 30706),
(162524, 'esMX', '|TInterface\\Icons\\INV_Polearm_2H_OdynSpear_D_01:20|t¡La |cFFFF0000%s|r activa |cFFFF0000|Hspell:282750|h[Custodia de las profundidades]|h|r y crea una burbuja protectora!', '', 30706),
(162523, 'esMX', '', '¡¿Oh, dónde estoy?!', 30706),
(162522, 'esMX', '|TInterface\\Icons\\SPELL_SHAMAN_MAELSTROMWEAPON:20|t¡La |cFFFF0000%s|r activa |cFFFF0000|Hspell:282743|h[Tormenta de aniquilación]|h|r y destruye a los débiles!', '', 30706),
(162521, 'esMX', '|TInterface\\Icons\\Spell_Priest_Void Blast:20|t¡La |cFFFF0000%s|r activa |cFFFF0000|Hspell:282738|h[Abrazo del Vacío]|h|r y convierte toda la sanación en daño!', '', 30706),
(162520, 'esMX', '', 'Disculpa pero, ¿ya han destruido el Pozo de la Eternidad? ... ¿o lo CREARON?', 30706),
(162519, 'esMX', '', '¿Hola? ¿Me ves? ¿En qué parte de Azeroth estoy...?', 30706),
(162518, 'esMX', '|TInterface\\Icons\\SPELL_SHADOW_FELMENDING:20|t¡|cFFFF0000%s|r empieza a lanzar |cFFFF0000|Hspell:282675|h[Pacto de los inquietos]|h|r!', '', 30706),
(162517, 'esMX', 'Hurgando', '', 30706),
(162516, 'esMX', '', 'Monstruo... Jamás llegarás a la Fuente del Sol. La general forestal... te... detendrá...', 30706),
(162515, 'esMX', '¡Suficiente! No permitiré que me sigan demorando con sus insolencias.', '', 30706),
(162514, 'esMX', '<Encantar con la vara de encantamiento de Sef.>', '<Encantar con la vara de encantamiento de Sef.>', 30706),
(162513, 'esMX', 'A pesar de estar bien físicamente, los encantamientos que brindan vida parecen estar degradados, por lo que ha quedado inanimado.$b$bTal vez un encantador con el equipo adecuado pueda restaurarlo a su gloria pasada.', '', 30706),
(162512, 'esMX', '|A:Warfronts-BaseMapIcons-Horde-Workshop-Minimap:25:23:0:0|a¡Nueva construcción disponible!', '|A:Warfronts-BaseMapIcons-Horde-Workshop-Minimap:25:23:0:0|a¡Nueva construcción disponible!', 30706),
(162511, 'esMX', '|A:Warfronts-BaseMapIcons-Horde-MainHall-Minimap:25:23:0:0|a¡Nueva construcción disponible!', '|A:Warfronts-BaseMapIcons-Horde-MainHall-Minimap:25:23:0:0|a¡Nueva construcción disponible!', 30706),
(162510, 'esMX', '|A:Warfronts-BaseMapIcons-Horde-Barracks-Minimap:25:23:0:0|a¡Nueva construcción disponible!', '|A:Warfronts-BaseMapIcons-Horde-Barracks-Minimap:25:23:0:0|a¡Nueva construcción disponible!', 30706),
(162509, 'esMX', '|A:Warfronts-BaseMapIcons-Horde-Armory-Minimap:25:23:0:0|a¡Nueva construcción disponible!', '|A:Warfronts-BaseMapIcons-Horde-Armory-Minimap:25:23:0:0|a¡Nueva construcción disponible!', 30706),
(162508, 'esMX', '|A:Warfronts-BaseMapIcons-Horde-Heroes-Minimap:25:23:0:0|a¡Nueva construcción disponible!', '|A:Warfronts-BaseMapIcons-Horde-Heroes-Minimap:25:23:0:0|a¡Nueva construcción disponible!', 30706),
