(162474, 'esMX', 'Encontrarás su lengua en la oscuridad. ¡No la toques! No creas en sus mentiras.', 'Encontrarás su lengua en la oscuridad. ¡No la toques! No creas en sus mentiras.', 30706),
(162473, 'esMX', '¡Ey! Muévete ¿No ves que me tapas el sol?', '', 30706),
(162472, 'esMX', '', '¿Que no ves que intento meditar?', 30706),
(162471, 'esMX', '', 'Paz...', 30706),
(162470, 'esMX', '', '¡Ups! Bueno… Eso no fue muy tranquilo.', 30706),
(162469, 'esMX', '', 'Un plan brillante.', 30706),
(162468, 'esMX', '', '¿Cómo se supone que medite si la Alianza está aquí? Supongo que tendremos que matarlos.', 30706),
(162467, 'esMX', '', 'Mantener el equilibrio. Ya medité antes. Ahora es momento para la violencia. Hay que mantener el equilibrio.', 30706),
(162466, 'esMX', '', '¡Estoy tranquila!', 30706),
(162465, 'esMX', '¿A quién matamos ahora?', '', 30706),
(162464, 'esMX', 'No es... justo...', '', 30706),
(162463, 'esMX', '¡Qué divertido, qué divertido!', '', 30706),
(162462, 'esMX', '¡Ahórrame los detalles, Charg!', '', 30706),
(162461, 'esMX', 'Bonito lugar. ¡Arrasemos con todo!', '', 30706),
(162460, 'esMX', '¡Alianza! ¿Qué sabor tendrá la sangre de esos malditos? Apuesto a que es salada.', '', 30706),
(162459, 'esMX', '¡AL ATAQUE!', '', 30706),
(162458, 'esMX', '*gruñe*', '', 30706),
(162457, 'esMX', 'Au...', '', 30706),
(162456, 'esMX', 'Estás muerto.', '', 30706),
(162455, 'esMX', 'Equipo... ataquen.', '', 30706),
(162454, 'esMX', 'Los mataremos.', '', 30706),
(162453, 'esMX', 'Bah. La Alianza. Mátenlos.', '', 30706),
(162452, 'esMX', 'Enemigos.', '', 30706),
(162451, 'esMX', 'Es extraño estar en la superficie.', '', 30706),
(162450, 'esMX', 'Eso... no se siente bien...', '', 30706),
(162449, 'esMX', '¡Ja! ¡Te di!', '', 30706),
(162448, 'esMX', 'De todos los lugares nuevos y apasionantes por explorar, ¿por qué la Horda tenía que aparecer aquí?', '', 30706),
(162447, 'esMX', '¡Mira la fauna! Se podría usar para forjar un gran yelmo. Y quizá decorarlo con dientes de la Horda...', '', 30706),
(162446, 'esMX', '¡Hora de una golpiza!', '', 30706),
(162445, 'esMX', '', '¿Alguna vez cazaste con una Hierro Negro?', 30706),
(162444, 'esMX', '', 'Entiérrenme... bajo la montaña...', 30706),
(162443, 'esMX', '', '¡Llamarada! ¡Hora de comer!', 30706),
(162442, 'esMX', '', '¡Bien, la Horda! Estaba buscando huesos para jugar con mi sabueso.', 30706),
(162441, 'esMX', '', '¡Por fin, tierra seca! Ahora, a humedecerla con lágrimas saladas de la Horda.', 30706),
(162440, 'esMX', '', '¡Atácalos, Llamarada!', 30706),
(162439, 'esMX', '', '¡Colecciono estas calaveras desde antes de morir!', 30706),
(162438, 'esMX', '', 'No es... la primera vez... que muero...', 30706),
(162437, 'esMX', '', '¡Otra calavera para mí!', 30706),
(162436, 'esMX', '', '¡Muy bien, Hierro Negro! ¡Aquí hay tesoros para nosotros! Y muerte para la Horda.', 30706),
(162435, 'esMX', '', '¡Por fin, tierra firme! ¡La Horda invita los tragos, chicos! Con lo que robemos de sus cadáveres, claro.', 30706),
(162434, 'esMX', '¡Muerte a la Alianza!', '', 30706),
(162433, 'esMX', '', '¡Uuh, nuevas calaveras de la Horda para mi colección! ¡Justo lo que necesitaba!', 30706),
(162432, 'esMX', '¡Kul Tiras arderá!', '', 30706),
(162431, 'esMX', '¡Sangre y truenos!', '', 30706),
(162430, 'esMX', '', '¡Dame esa calavera!', 30706),
(162429, 'esMX', '¡Por la jefa de guerra! ¡Por la Horda!', '', 30706),
(162428, 'esMX', '¡Lok\'tar ogar!', '', 30706),
(162427, 'esMX', '¡Entren! ¡Hay miembros de la Alianza que matar!', '', 30706),
(162426, 'esMX', '¡Vamos, vamos, vamos!', '', 30706),
(162425, 'esMX', '¡Al portal, brutos!', '', 30706),
(162424, 'esMX', '¡Mi familia cantará alabanzas sobre tu valentía!', '¡Mi familia cantará alabanzas sobre tu valentía!', 30706),
(162423, 'esMX', '¡Pensé que no saldría con vida! ¡Muchas gracias!', '¡Pensé que no saldría con vida! ¡Muchas gracias!', 30706),
(162422, 'esMX', '¡Muchas bendiciones para ti!', '¡Muchas bendiciones para ti!', 30706),
(162421, 'esMX', '¡Los nagas nunca se atrevieron a tanto!', '¡Los nagas nunca se atrevieron a tanto!', 30706),
(162420, 'esMX', '¡Les hablaré a los demás sobre tu bondad!', '¡Les hablaré a los demás sobre tu bondad!', 30706),
(162419, 'esMX', 'Me salvaste la vida. ¡Jamás lo olvidaré!', 'Me salvaste la vida. ¡Jamás lo olvidaré!', 30706),
(162418, 'esMX', '¡Me encanta el sonido del taladro!', '', 30706),
(162417, 'esMX', '', 'No, no, $Uestúpido:estúpida; $r...', 30706),
(162416, 'esMX', '', '¡Nadie monta a Lady!', 30706),
(162414, 'esMX', 'Idiotas.', '', 30706),
(162413, 'esMX', '¡Juntos! ¡Por Quel\'Thalas!', '¡Juntos! ¡Por Quel\'Thalas!', 30706),
(162412, 'esMX', '', '¡Ahora, jinetes!', 30706),
(162411, 'esMX', 'Solo quería arrojar... bombas...', 'Solo quería arrojar... bombas...', 30706),
(162410, 'esMX', '¡Tengo una bomba para lanzarte!', '', 30706),
(162409, 'esMX', 'Gilneas recordará tu coraje por siempre, Liam.', '', 30706),
(162408, 'esMX', '', 'Fuiste un hombre del pueblo, Liam. Diferente a toda la realeza. Los haremos pagar por esto.', 30706),
(162407, 'esMX', 'Volveremos, Liam. Te lo juro.', '', 30706),
(162406, 'esMX', 'Está aquí, adonde pertenece: rodeado de los héroes y patriotas de Gilneas.', '', 30706),
(162405, 'esMX', 'Que la Luz bendiga a nuestros antepasados, que han permitido que mi hijo descanse en este suelo sagrado.', '', 30706),
(162404, 'esMX', '', '¡Firmes, hermanos y hermanas! ¡Debemos resistir hasta que lleguen los refuerzos! ¡Por Quel\'Thalas!', 30706),
(162403, 'esMX', '¡Sigan disparando! Los espíritus guiarán nuestros disparos.', '', 30706),
(162402, 'esMX', 'El viento nos acompaña, ¡el objetivo está a la vista!', '', 30706),
(162401, 'esMX', '', '¡Sube y detén esa nave de guerra de la Horda!', 30706),
(162400, 'esMX', '', '¡$n, el grifo está listo para partir!', 30706),
