(162391, 'esMX', '', 'Resistiremos aquí. ¡Costa Oscura es de los kaldorei!', 30706),
(162390, 'esMX', '', 'Prepárense.', 30706),
(162389, 'esMX', '', '¡Derriben esas catapultas de inmediato!', 30706),
(162388, 'esMX', '|TInterface\\Icons\\INV_Misc_Herb_AncientLichenPetal.blp:20|tIvus |cFFFF0000|Hspell:282615|h[Petrifica]|h|r su corteza. ¡Derrota a los fuegos fatuos para interrumpir el hechizo!', '', 30706),
(162387, 'esMX', 'Mis batallas... han concluido...', 'Mis batallas... han concluido...', 30706),
(162386, 'esMX', '¡Prueba mi acero!', '¡Prueba mi acero!', 30706),
(162384, 'esMX', 'Buen trabajo. Ahora regresa a Kul Tiras a salvo.', '', 30706),
(162381, 'esMX', '', 'No importa lo que enfrentemos, no importa cuántas almas profanes, ¡no nos derrotarás!', 30706),
(162380, 'esMX', '', '¡Tu muerte se acerca, Maiev! ¡Forestales oscuros, ataquen!', 30706),
(162379, 'esMX', '', 'Nadie puede evadir el golpe de una auténtica celadora. ¡Tú deberías saberlo mejor que nadie!', 30706),
(162378, 'esMX', '', 'No hay esperanza para ti, Maiev. Las fuerzas de la muerte son infinitas. Verás tu patética base reducirse a cenizas.', 30706),
(162377, 'esMX', '', '¡Hemos perdido contacto con Auberdine y quiero saber por qué! ¡Andando!', 30706),
(162376, 'esMX', '', 'Sira... ¿Qué te ha hecho esa alma en pena?', 30706),
(162375, 'esMX', '', 'La Costa Oscura sigue en las garras de la Horda. Debemos retirarnos para volver a luchar otro día.', 30706),
(162374, 'esMX', '', 'La victoria es nuestra, héroes. Hemos recuperado Costa Oscura, pero el precio ha sido muy alto. Sylvanas pagará por esta atrocidad. Lo juro.', 30706),
(162373, 'esMX', '', 'Las naves de guerra de la Horda se retiran y el camino hacia Sira está despejado. Tomen un hipogrifo. Es hora de terminar con esto.', 30706),
(162372, 'esMX', '', '¿Quién eres tú para juzgarme? ¿Has olvidado cómo traicionaste a tus hermanas? ¡Ven y enfréntate a tu muerte!', 30706),
(162371, 'esMX', '', '¡Tus defensas se derrumban y tus ejércitos se caen a pedazos, Sira! ¡Pronto se hará justicia!', 30706),
(162370, 'esMX', '', 'El Taller de Gujas está listo. Construye lanzagujas para destruir las máquinas que bloquean nuestro camino a Lor\'danel.', 30706),
(162369, 'esMX', '', 'Ahora contamos con el apoyo de un Árbol de la Eternidad. ¡Recluta más fuerzas y enfréntate a Sira!', 30706),
(162368, 'esMX', '', 'Nuestro Árbol de la Vida se ha convertido en un Árbol de las Edades. Es hora de empezar a construir el Taller de Gujas.', 30706),
(162367, 'esMX', '', 'El Anciano de la Guerra se ha unido a nuestra causa. Ahora Jarod puede traer más tropas a Bashal\'Aran.', 30706),
(162366, 'esMX', '', 'Hemos terminado de construir el Recinto de los Cazadores. Concédele los recursos que necesita para mejorar nuestras armas y armaduras.', 30706),
(162365, 'esMX', '', 'El Altar de Ancianos se ha completado. Usa sus poderes para potenciarte o adoptar la forma de un aliado poderoso.', 30706),
(162364, 'esMX', '', 'Lor\'danel nos pertenece, pero Sira aún nos aguarda en esa monstruosidad goblin. Protejan nuestros lanzagujas mientras derriban sus defensas.', 30706),
(162363, 'esMX', '', 'Hemos capturado Cruce Desolado. ¡Resistan y protejan Bashal\'Aran!', 30706),
(162362, 'esMX', '', 'El Depósito Fresno le pertenece a la Alianza. Ahora podemos atravesar rápidamente el campo de batalla e invocar a las quimeras para que nos ayuden.', 30706),
(162361, 'esMX', '', 'La Alianza controla Playa Marea Penumbral. Ahora podemos reclutar druidas en nuestras filas e invocar la ayuda de un poderoso archidruida.', 30706),
(162360, 'esMX', '', '¿Aún tienes el descaro de darme órdenes? ¿Tú? ¿Que abandonaste a los Vigías en tu persecución de un único prisionero?', 30706),
(162359, 'esMX', '', '¡Sira! Detén esta locura y entrégate para recibir una muerte limpia. No puedes detener la marea de la venganza.', 30706),
(162358, 'esMX', '', 'Las Ruinas de Lornesta nos pertenecen. El hierro que hay cerca beneficiará a nuestros soldados.', 30706),
(162357, 'esMX', '', '¡Hemos capturado Cantera Petroglacial! Extraigan su hierro para que podamos robustecer a nuestras fuerzas.', 30706),
