UPDATE `broadcast_text_locale` SET `Text_lang`='¡Saludos y gracias por ayudarnos a probar el RPP de Battle for Azeroth! \n\nPuedo teletransportarte directamente a bandas que estén actualmente disponibles para probarlas. Esto funciona simplemente como un teletransporte y no como un servicio de buscador de partidas, así que espero que tengas un grupo listo para enfrentarte a los desafíos que te aguardan a donde sea que vayas. De no ser así, quizás te convenga echar un vistazo a la nueva función de Buscador de grupos para encontrar algunos aliados.\n\n¡Asegúrate de haber seleccionado la dificultad que quieres probar antes de teletransportarte, porque es probable que no puedas abandonar la zona fácilmente si quieres cambiar la dificultad!', `Text1_lang`='¡Saludos y gracias por ayudarnos a probar el RPP de Battle for Azeroth! \n\nPuedo teletransportarte directamente a bandas que estén actualmente disponibles para probarlas. Esto funciona simplemente como un teletransporte y no como un servicio de buscador de partidas, así que espero que tengas un grupo listo para enfrentarte a los desafíos que te aguardan a donde sea que vayas. De no ser así, quizás te convenga echar un vistazo a la nueva función de Buscador de grupos para encontrar algunos aliados.\n\n¡Asegúrate de haber seleccionado la dificultad que quieres probar antes de teletransportarte, porque es probable que no puedas abandonar la zona fácilmente si quieres cambiar la dificultad!', `VerifiedBuild`=30706 WHERE (`ID`=155691 AND `locale`='esMX');
