UPDATE `broadcast_text_locale` SET `Text_lang`='Puedo enseñarte lo básico de cualquier profesión de recolección o producción, pero eso es todo.\n\nPara superar las habilidades de un aprendiz, tendrás que visitar a un especialista que se dedique a una única profesión.\n\nPuedes aprender hasta dos profesiones: dos de recolección, dos de producción, o una de cada una.\n\nLas habilidades secundarias como arqueología, cocina y pesca no están incluidas entre estas dos profesiones; puedes aprender todas las que quieras de esas.', `Text1_lang`='Puedo enseñarte lo básico de cualquier profesión de recolección o producción, pero eso es todo.\n\nPara superar las habilidades de una aprendiza, tendrás que visitar a un especialista que se dedique a una única profesión.\n\nPuedes aprender hasta dos profesiones: dos de recolección, dos de producción, o una de cada una.\n\nLas habilidades secundarias como arqueología, cocina y pesca no están incluidas entre estas dos profesiones; puedes aprender todas las que quieras de esas.', `VerifiedBuild`=30706 WHERE (`ID`=47105 AND `locale`='esMX');
