UPDATE `broadcast_text_locale` SET `Text_lang`='¿Quién osa interrumpir...? ¿Qué es esto? ¿Qué han hecho? ¡Echarán todo a perder!', `VerifiedBuild`=30706 WHERE (`ID`=15130 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='¡Les mostraré que este perro maltrecho aún tiene dientes!', `VerifiedBuild`=30706 WHERE (`ID`=13519 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='Han intentado invadir el reino del cosechador con todas sus fuerzas.', `VerifiedBuild`=30706 WHERE (`ID`=13032 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='Su estupidez los ha llevado hasta la muerte. Han hecho caso omiso de poderes más allá de su entendimiento descaradamente. Han intentado invadir el reino del cosechador con todas sus fuerzas. Ahora solo les queda una salida... recorrer en solitario... el camino de los malditos.', `VerifiedBuild`=30706 WHERE (`ID`=13029 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text1_lang`='¡Abran fuego!', `VerifiedBuild`=30706 WHERE (`ID`=12417 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='Te doy la bienvenida al puesto de mando de la IV:7, $n.', `VerifiedBuild`=30706 WHERE (`ID`=8549 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='Por la gracia de Elune, estoy encantado de ofrecerte el mejor corcel que podrás encontrar en Teldrassil, y quizás en todo el mundo... el sable de la noche. Durante años, el ejército centinela ha confiado en su valor.$B$BTómate tu tiempo para examinarlos cuanto desees. Estoy seguro de que no quedarás $gdecepcionado:decepcionada;.', `Text1_lang`='Por la gracia de Elune, estoy encantada de ofrecerte el mejor corcel que podrás encontrar en Teldrassil, y quizás en todo el mundo... el sable de la noche. Durante años, el ejército centinela ha confiado en su valor.$B$BTómate tu tiempo para examinarlos cuanto desees. Estoy segura de que no quedarás $gdecepcionado:decepcionada;.', `VerifiedBuild`=30706 WHERE (`ID`=6482 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='Necesitas al caminasombras Zuru en el Valle de los Espíritus. Búscalo en el lago más arriba, al oeste del Valle de la Fuerza.', `Text1_lang`='Necesitas al caminasombras Zuru en el Valle de los Espíritus. Búscalo en el lago más arriba, al oeste del Valle de la Fuerza.', `VerifiedBuild`=30706 WHERE (`ID`=4809 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='Encontrarás a Finoso Virunegro más allá del Círculo de la Ley, en la Sala de los Oficios. Mata a ese bellaco miserable y recupera Ferrovil.$B$BLleva a Ferrovil al Santuario de Thaurissan y coloca el martillo en el lugar que le corresponde: las manos de la estatua erigida en mi honor.$B$BUna vez hecho esto, se abrirá el compartimento en el que guardé la llave maestra. Y lo que es más importante, Ferrovil permanecerá para siempre en mis manos. En el caso de que hicieran el intento de quitar el martillo, tanto la estatua como él se harán añicos y se perderán para siempre.', `VerifiedBuild`=30706 WHERE (`ID`=4655 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='Mi gran martillo, Ferrovil, pasó a manos del nuevo arquitecto jefe, Finoso Virunegro: un hombre de voluntad despreciable y escaso talento.$B$BAhí es donde apareces tú, $n. Quiero detenerlo. Es demasiado inepto como para ejercer el poder de Ferrovil, pero si su sucesor tiene la capacidad de usar el martillo en todo su potencial, la destrucción que podría ocasionar con sus creaciones podría ser de una magnitud incalculable.', `VerifiedBuild`=30706 WHERE (`ID`=4653 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='Saludos. ¿Buscas entrenarte en el arte de la guerra?', `Text1_lang`='Saludos. ¿Buscas entrenarte en el arte de la guerra?', `VerifiedBuild`=30706 WHERE (`ID`=3353 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='El arcón de la IV:7 se abre con un chirrido. Se escucha una voz atronadora. Se pueden descifrar las palabras: \'Ve... a buscar... sombras...\'', `VerifiedBuild`=30706 WHERE (`ID`=3225 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='El arcón de la IV:7 se abre estrepitosamente. Se escuchan gruñidos y voces en la distancia.', `VerifiedBuild`=30706 WHERE (`ID`=3224 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='El arcón de la IV:7 empieza a vibrar y a zumbar. Se escucha un sonido ensordecedor procedente del norte.', `VerifiedBuild`=30706 WHERE (`ID`=3223 AND `locale`='esMX');
UPDATE `broadcast_text_locale` SET `Text_lang`='El arcón de la IV:7 se abre y luego suena una alarma audible.', `VerifiedBuild`=30706 WHERE (`ID`=3222 AND `locale`='esMX');

